import{_ as g,o as t,c as n,a as i,t as u,C as h,M as _,U as k,f as p,F as w,p as D,e as b,q as v}from"./chunks/framework.B1z0IdBH.js";const f={name:"PoemCard",props:{poem:{type:Object,required:!0}},methods:{handleImageError(a){a.target.src="/images/logo.svg"}}},B={class:"entry-container"},y={class:"entry"},A={class:"entry-image"},j=["src","alt"],C={class:"entry-content"},z={class:"entry-title"},E=["href"],S={class:"entry-description"};function x(a,e,s,m,o,r){return t(),n("div",B,[i("div",y,[i("div",A,[i("img",{src:s.poem.image_url,alt:s.poem.page_title,onError:e[0]||(e[0]=(...d)=>r.handleImageError&&r.handleImageError(...d))},null,40,j)]),i("div",C,[i("h2",z,[e[1]||(e[1]=i("span",{class:"title-icon"},null,-1)),i("a",{href:s.poem.page_url,target:"_blank"},u(s.poem.page_title),9,E)]),i("p",S,u(s.poem.context_page_description),1)])])])}const M=g(f,[["render",x],["__scopeId","data-v-979c4810"]]),P=JSON.parse(`[{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%8F%E3%82%A4%E3%82%B4%E3%82%B1%E7%9B%AE","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/ce/Bryohaplocladium_%28Haplocladium%29_angustifolium2.JPG","page_title":"ハイゴケ目","context_page_description":"ハイゴケ目 は、蘚類の分類群の1つ。かつての分類体系でシトネゴケ目 、イヌマゴケ目 などとされていた分類群の大部分を含む。ただし、本分類群の系統分類については議論があり、研究者によって含まれる種が異なる。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stra%C3%9Fen_und_Pl%C3%A4tze_in_Berlin-Niedersch%C3%B6nhausen","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/NiederSchhsn-1_%2828%29_Homeyer_EHHesse_O.JPG","page_title":"Liste der Straßen und Plätze in Berlin-Niederschönhausen","context_page_description":"Die Liste der Straßen und Plätze in Berlin-Niederschönhausen beschreibt das Straßensystem im Berliner Ortsteil Niederschönhausen mit den entsprechenden historischen Bezügen. Gleichzeitig ist diese Zusammenstellung ein Teil der Listen aller Berliner Straßen und Plätze."},{"page_url":"https://de.wikipedia.org/wiki/Boulevard_Saint-Germain","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Librairie_internationale_71_boulevard_Saint-Germain_Paris.jpg","page_title":"Boulevard Saint-Germain","context_page_description":"Der Boulevard Saint-Germain erstreckt sich über das 5., 6. und 7. Arrondissement von Paris. Die in Ost-West-Richtung verlaufende Straße ist der längste Boulevard der Stadt. Sie ist hauptsächlich eine Einkaufsmeile mit Boutiquen, Buchläden und berühmten Cafés."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_pam%C3%A1tn%C3%BDch_strom%C5%AF_v_okrese_Mlad%C3%A1_Boleslav","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Brezno_pamatny_dub.jpg","page_title":"Seznam památných stromů v okrese Mladá Boleslav","context_page_description":"Toto je seznam památných stromů v okrese Mladá Boleslav, v němž jsou uvedeny památné stromy na území okresu Mladá Boleslav."},{"page_url":"https://pt.wikipedia.org/wiki/Berliet","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Berliet_1904_40HP_Tourer_on_London_to_Brighton_VCR_2010.jpg","page_title":"Berliet","context_page_description":"A Berliet era uma empresa automobilística francesa, fundada por Marius Berliet em 1902, em Lyon.\\nPara além de carros, nomeadamente de corrida, a Berliet produziu camiões, entre os quais o Berliet Gazelle, montado em Portugal e designado por Berliet Tramagal.\\nEm 1978 a Berliet foi comprada pela Renault."},{"page_url":"https://vi.wikipedia.org/wiki/Anartia_fatima","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Banded_Peacock_1%2C_Costa_Rica.jpg","page_title":"Anartia fatima","context_page_description":"Fatima là một loài bướm được tìm thấy ở miền nam Hoa Kỳ, México và Trung Mỹ."},{"page_url":"https://ro.wikipedia.org/wiki/Moscheea_Al_Saleh","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/%D8%AC%D8%A7%D9%85%D8%B9_%D8%A7%D9%84%D8%B5%D8%A7%D9%84%D8%AD_%D9%85%D9%86%D8%B8%D8%B1_%D9%85%D9%86_%D9%85%D9%8A%D8%AF%D8%A7%D9%86_%D8%A7%D9%84%D8%B3%D8%A8%D8%B9%D9%8A%D9%86.jpg","page_title":"Moscheea Al Saleh","context_page_description":"Moscheea Al Saleh este o moschee modernă din Sana'a, cea mai mare moschee din Yemen. Se află la periferia sudică a orașului, la sud de Maternitatea Al Sabeen. A fost inaugurată în noiembrie 2008 de președintele yemenit Ali Abdullah Saleh. Moscheea, cu o suprafață de 27.300 de metri pătrați, are o sală centrală cu o suprafață de 13.596 de metri pătrați și o capacitate de 44.000 de persoane. Costul de construcție s-a ridicat la aproape 60 de milioane de dolari americani. Deschisă pentru non-musulmani, moscheea este frecventată de turiști și promovează islamul moderat. Măsurile de securitate includ poliția și câinii care pot adulmeca prezența bombelor. După sciziunea dintre Houthis și Saleh din decembrie 2017, care s-a încheiat cu moartea președintelui Ali Abdullah Saleh, autoritățile conduse de Houthis au decis să redenumească moscheea în „Moscheea Poporului”."},{"page_url":"https://en.wikipedia.org/wiki/Griffeth-Pendley_House","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/GRIFFITH-PENDLEY_HOUSE%2C_PICKENS_COUNTY%2C_GA.jpg","page_title":"Griffeth-Pendley House","context_page_description":"Griffeth-Pendley House is a historic property that includes a log dogtrot home, barn and shed in Jasper, Georgia. It was built by Caleb \\"Cale\\" Griffeth III who inherited the 110-acre property from his father Caleb Griffeth II in 1877. It was listed on the National Register of Historic Places on April 16, 2008. It is located at 2198 Cove Road."},{"page_url":"https://de.wikipedia.org/wiki/Thurnwald-Gebirge","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3b/Papua_New_Guinea_relief_location_map.jpg","page_title":"Thurnwald-Gebirge","context_page_description":"Das Thurnwald-Gebirge ist eine Gebirgskette am Oberlauf des Sepik in der Provinz Sandaun in Papua-Neuguinea.\\nDie Benennung erinnert an den österreichischen Ethnologen Richard Thurnwald, den Begründer der Rechtsethnologie in Deutschland."},{"page_url":"https://hu.wikipedia.org/wiki/Nassarius","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Nassarius_arcularia_01.JPG","page_title":"Nassarius","context_page_description":"A Nassarius a csigák osztályának Neogastropoda rendjébe, ezen belül a Nassariidae családjába tartozó nem."},{"page_url":"https://en.wikipedia.org/wiki/Danube","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Dreifl%C3%BCsseeck-Passau-Aerial_%28P1140080E%29.jpg","page_title":"Danube","context_page_description":"The Danube is Europe's second-longest river, after the Volga. It is located in Central and Eastern Europe.\\nThe Danube was once a long-standing frontier of the Roman Empire and today flows through 10 countries. The river runs through the 2nd largest number of countries in the world with the Nile running through 11 countries. Originating in Germany, the Danube flows southeast for 2,850 km, passing through or bordering Austria, Slovakia, Hungary, Croatia, Serbia, Romania, Bulgaria, Moldova and Ukraine before draining into the Black Sea. Its drainage basin extends into nine more countries.\\nThe Danube river basin is home to fish species such as pike, zander, huchen, Wels catfish, burbot and tench. It is also home to a large diversity of carp and sturgeon, as well as salmon and trout. A few species of euryhaline fish, such as European seabass, mullet, and eel, inhabit the Danube Delta and the lower portion of the river.\\nSince ancient times, the Danube has become a traditional trade route in Europe. Today, 2,415 km of its total length are navigable. The river is also an important source of hydropower and drinking water."},{"page_url":"https://nv.wikipedia.org/wiki/Ch%CA%BC%C3%ADshiibeezhii_yi%C5%82_ahee%C5%82t%CA%BC%C3%A9h%C3%A9_(%C3%ADiyis%C3%ADg%C3%AD%C3%AD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Psaltriparus_minimus_-Chilliwack%2C_British_Columbia%2C_Canada_-male-8.jpg","page_title":"Chʼíshiibeezhii yił aheełtʼéhé (íiyisígíí)","context_page_description":"Chʼíshiibeezhii yił aheełtʼéhé éí tsídii tsídígíí dah yikahjí atah yisdzoh, áádóó éí Náhookǫsjí kéyah dah siʼánígíí bikááʼgóó hólǫ́. Ndaʼałkaahí dóó ééʼdeetįįhii éí \\"Psaltriparus minimus\\" deiłníigo dayózhí."},{"page_url":"https://fr.wikipedia.org/wiki/Louis_de_Sayn-Wittgenstein","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Ludwig_d_I_Wittgenstein.jpg","page_title":"Louis de Sayn-Wittgenstein","context_page_description":"Louis Ier, comte de Sayn-Wittgenstein, surnommé \\"le vieux\\", officiellement \\"Louis Ier de Sayn, comte de Wittgenstein\\" a dirigé le Comté de Wittgenstein, sur le cours supérieur des rivières Lahn et Eder, de 1558 jusqu'à sa mort. Il a converti son comté au Calvinisme et a été un homme politique influent dans le service de l'électorat Palatin."},{"page_url":"https://pl.wikipedia.org/wiki/Bazylika_Nawiedzenia_Naj%C5%9Bwi%C4%99tszej_Maryi_Panny_w_Tuchowie","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c6/Ryszard_Bo%C5%BCek.jpg","page_title":"Bazylika Nawiedzenia Najświętszej Maryi Panny w Tuchowie","context_page_description":"Bazylika Nawiedzenia Najświętszej Maryi Panny i św. Stanisława Biskupa i Męczennika z klasztorem redemptorystów w Tuchowie − murowany barokowy kościół przyklasztorny w Tuchowie, sanktuarium maryjne i miejsce pielgrzymkowe diecezji tarnowskiej, od 2010 bazylika mniejsza. Obok kościoła znajdują się zabudowania klasztoru zgromadzenia redemptorystów, którzy opiekują się tym sanktuarium, wybudowane w końcu XIX wieku."},{"page_url":"https://eo.wikipedia.org/wiki/Toledo_(Paranao)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/31/Bandeira_Toledo.jpg","page_title":"Toledo (Paranao)","context_page_description":"Toledo estas municipo kaj universitata grandurbo de la brazila subŝtato Paranao."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B5%D0%B6%D0%B0%D0%BD%D0%BE%D0%B2%D0%BE_(%D0%9D%D0%B8%D0%B6%D0%B5%D0%B3%D0%BE%D1%80%D0%BE%D0%B4%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Muromskij_uezd.jpg","page_title":"Бежаново (Нижегородская область)","context_page_description":"Бежаново — деревня в Вачском районе Нижегородской области. Входит в состав Новосельского сельсовета.\\nВ прошлом — деревня Яковцевской волости Муромского уезда Владимирской губернии."},{"page_url":"https://pl.wikipedia.org/wiki/Szko%C5%82a_Biznesu_Politechniki_Warszawskiej","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Graduacja-executive-mba-katalyst-2016-18%2C2%2C1781.jpg","page_title":"Szkoła Biznesu Politechniki Warszawskiej","context_page_description":"Szkoła Biznesu Politechniki Warszawskiej – uczelnia powstała w 1991 roku w wyniku wspólnego przedsięwzięcia Politechniki Warszawskiej i trzech szkół europejskich:\\nLondon Business School – 1. pozycja w Europie wg rankingu europejskich szkół biznesu Financial Times z 2017 roku,\\nHEC School of Management Paris – szkoła biznesu we Francji, zaliczana do grupy Grandes Ecoles, 2. pozycja w Europie wg rankingu europejskich szkół biznesu Financial Times z 2016 roku,\\nNorwegian School of Economics – państwowa uczelnia ekonomiczna w Norwegii, z której rekrutuje się m.in. prof. Finn Kydland, laureat Nagrody Nobla 2004 w dziedzinie ekonomii. Szkoła zajmuje 38. miejsce w Europie według Financial Times 2016.\\nPo ukończeniu studiów absolwenci otrzymują Dyplom Executive Master of Business Administration. Dyplom MBA nadawany jest przez Politechnikę Warszawską i zawiera zapis o udziale szkół partnerskich.\\nW 2006 roku oba programy Executive MBA oraz International MBA otrzymały prestiżową międzynarodową akredytację dla programów EPAS nadaną przez EFMD, organizację skupiającą wiodące światowe szkoły biznesu."},{"page_url":"https://en.wikipedia.org/wiki/Drainage","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/MagomeDrainage.jpg","page_title":"Drainage","context_page_description":"Drainage is the natural or artificial removal of a surface's water and sub-surface water from an area with excess of water. The internal drainage of most agricultural soils is good enough to prevent severe waterlogging, but many soils need artificial drainage to improve production or to manage water supplies."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%BE%D1%87%D1%82%D0%BE%D0%B2%D1%8B%D0%B5_%D0%BC%D0%B0%D1%80%D0%BA%D0%B8_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B8_(2004)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Rus_Stamp_GSS-Gagarin-2004.jpg","page_title":"Почтовые марки России (2004)","context_page_description":"Почтовые марки России (2004) — каталог знаков почтовой оплаты, введённых в обращение «Почтой России» в 2004 году.\\nВсего в этом году было выпущено 91 почтовая марка, 10 почтовых блоков и 27 малых листов."},{"page_url":"https://fr.wikipedia.org/wiki/Death","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Death_Mexico_06-89.jpg","page_title":"Death","context_page_description":"Death est un groupe américain de death metal, originaire d'Orlando, en Floride. Fondé en 1983, le groupe est l'un des pionniers du genre. Le premier album du groupe, Scream Bloody Gore, est considéré comme le premier album de death metal, bien que, Chuck Schuldiner, leader du groupe, ne soit pas considéré comme le créateur du metal extrême.\\nSchuldiner incarnait le groupe et n'hésitait pas à modifier sa composition pour l'adapter à ses désirs musicaux. Les membres de Death n'ont donc que très rarement joué sur plusieurs albums et aucun n'a joué sur plus de deux, à l'exception du batteur Gene Hoglan, qui jouera sur Individual Thought Patterns et Symbolic, et du bassiste Steve DiGiorgio, qui lui jouera sur les albums Human et Individual Thought Patterns. La mort de Schuldiner, le 13 décembre 2001, des suites d'une tumeur au cerveau, met un terme définitif aux carrières de Death et de son projet parallèle, Control Denied."},{"page_url":"https://vi.wikipedia.org/wiki/Galatea_(v%E1%BB%87_tinh)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Galatea_feat.jpg","page_title":"Galatea (vệ tinh)","context_page_description":"Galatea, còn được biết tới là Neptune VI, là vệ tinh bên trong gần thứ tư của Sao Hải Vương. Nó được đặt tên theo Galatea, một trong những Nereid trong thần thoại Hy Lạp, người mà Cyclop Polyphemus yêu.\\nGalatea được phát hiện vào cuối tháng 7 năm 1989 từ những hình ảnh được chụp bởi tàu thăm dò Voyager 2. Nó được đặt cho ký hiệu tạm thời là S/1989 N 4. Phát hiện đã được công bố vào ngày 2 tháng 8 năm 1989, nhưng trong các văn bản chỉ nói rằng \\"10 khung hình được chụp trong vòng 5 ngày\\", như vậy ngày khám phá ra Galatea là vào đâu đó trước ngày 28 tháng 7. Cái tên được đặt chính thức vào ngày 16 tháng 9 năm 1991.\\nVệ tinh Galatea có hình thù dị thường và không có dấu hiệu nào cho thấy có sự biến đổi địa chất. Nó trông như một đống mảnh vụn được tập hợp quanh một hạt nhân từ những mảnh vỡ của các vệ tinh ban đầu của Sao Hải Vương, những vệ tinh mà đã bị đập vỡ bởi những sự nhiễu loạn từ vệ tinh Triton ngay sau khi vệ tinh này bị bắt giữ vào một quỹ đạo ban đầu có độ lệch tâm rất cao.\\nQuỹ đạo của Despina nằm gần nhưng ở ngoài quỹ đạo của vệ tinh Thalassa và ở bên trong vành đai Le Verrier."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%BA%9A%E5%B8%83%E6%B4%9B%E5%86%85%E8%8C%A8%E8%B6%B3%E7%90%83%E4%BF%B1%E4%B9%90%E9%83%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Anes_Haurdic_-_FK_Jablonec_%282%29.jpg","page_title":"亚布洛内茨足球俱乐部","context_page_description":"亚布洛内茨足球俱乐部是一间位于捷克亚布洛内茨的足球俱乐部，是捷克足球甲级联赛的一支队伍。"},{"page_url":"https://en.wikipedia.org/wiki/List_of_works_by_Thomas_Eakins","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Study_for_an_Arcadian_G201.jpg","page_title":"List of works by Thomas Eakins","context_page_description":"This is a list of professionally authenticated paintings, drawings, and sculptures by Thomas Eakins. As there is no catalogue raisonné of Eakins' works, this is an aggregation of existing published catalogs."},{"page_url":"https://en.wikipedia.org/wiki/Gelati_Monastery","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Gelati_1661.jpg","page_title":"Gelati Monastery","context_page_description":"Gelati is a medieval monastic complex near Kutaisi in the Imereti region of western Georgia. Gelati was founded in 1106 by King David IV of Georgia and is recognized by UNESCO as a World Heritage Site.\\nThe Gelati Monastery is in Kutaisi, Imereti Province, Georgia and is considered to be one of the most significant monastic and educational centers of medieval Georgia. Inside the monastery there are murals and imagery surrounding the interior of the church dating back to the12th-17th centuries. It was one of the first monasteries in Georgia and adds to the Georgian culture.\\nThe monastery was built in the early decades of the Georgian Golden Age and is known for the use of gold aesthetic in their paintings and buildings. It was built to show how Christianity encompassed all of this land and that Georgia was filled with Christian gospel all around even high up in the mountains. As the monastery is covered in arches that stretch over mountains show how encompassing the monastery is over the mountains and over the hills."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D0%B8%D0%BD%D0%B0%D0%BB%D1%8C%D0%B4%D0%B8,_%D0%A0%D0%B8%D0%BD%D0%B0%D0%BB%D1%8C%D0%B4%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Rinaldo_rinaldi%2C_chirone_insegna_ad_achille_a_suonare_la_cetra%2C_1817.JPG","page_title":"Ринальди, Ринальдо","context_page_description":"Ринальдо Ринальди — итальянский скульптор."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B5%D0%B4%D0%B0%D0%BB%D1%8C_%D0%BE%D1%80%D0%B4%D0%B5%D0%BD%D0%B0_%D0%B2%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B3%D0%BE_%D0%BA%D0%BD%D1%8F%D0%B7%D1%8F_%D0%BB%D0%B8%D1%82%D0%BE%D0%B2%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D0%93%D1%8F%D0%B4%D0%B8%D0%BC%D0%B8%D0%BD%D0%B0%D1%81%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Gedimino_ordino_medalis_reversas.png","page_title":"Медаль ордена великого князя литовского Гядиминаса","context_page_description":"Меда́ль о́рдена Великого князя Литовского Гядими́наса — государственная награда Литовской Республики."},{"page_url":"https://en.wikipedia.org/wiki/Toyota_Land_Cruiser_(J40)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/1980_Toyota_Land_Cruiser_%28FJ40%29_hardtop_%2826042130985%29.jpg","page_title":"Toyota Land Cruiser (J40)","context_page_description":"The Toyota Land Cruiser (J40), is a series of Land Cruisers made by Toyota from 1960 until 2001. Traditional body on frame SUVs, most 40 series Land Cruisers were built as 2-door models with slightly larger dimensions than the similar Jeep CJ.\\nThe model was available in short, medium and long wheelbase versions, with petrol and diesel engines."},{"page_url":"https://de.wikipedia.org/wiki/Erasure/Diskografie","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Erasure_-_1992.jpg","page_title":"Erasure/Diskografie","context_page_description":"Diese Diskografie ist eine Übersicht über die musikalischen Werke des britischen Synthie-Pop-Duos Erasure. Den Quellenangaben zufolge hat das Duo in seiner Karriere mehr als 6,3 Millionen Tonträger verkauft, davon alleine mehr als 3,9 Millionen Exemplare im Vereinigten Königreich."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Monuments_historiques_in_Ottrott","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Odilienberg-16-CTH.jpg","page_title":"Liste der Monuments historiques in Ottrott","context_page_description":"Die Liste der Monuments historiques in Ottrott führt die Monuments historiques in der französischen Gemeinde Ottrott auf."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%BA%D9%88%D9%81%D8%B1%D9%8A%D9%86%D8%A7%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/MyoxomysSalviniWolf.jpg","page_title":"غوفرينات","context_page_description":"الغوفرينات هو فيلق من الحيوانات تتبع رتبة القوارض من طائفة الثدييات."},{"page_url":"https://en.wikipedia.org/wiki/Zach_Lee","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Zach_Lee_on_April_28%2C_2016.jpg","page_title":"Zach Lee","context_page_description":"Zachary Stephen Lee is an American professional baseball pitcher in the Oakland Athletics organization. The Los Angeles Dodgers drafted him in the first round of the 2010 MLB June Amateur Draft and signed him for $5.25 million. He made his Major League Baseball debut for the Dodgers in 2015 and also played for the San Diego Padres in 2017."},{"page_url":"https://be.wikipedia.org/wiki/%D0%9A%D1%80%D1%8D%D1%81%D1%86%D1%8C%D1%8F%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B7%D0%B0%D1%81%D1%82%D0%B0%D0%B2%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Krestyanskaya_Zastava.jpg","page_title":"Крэсцьянская застава","context_page_description":"«Крэсцьянская застава» — станцыя Люблінска-Дзмітраўскай лініі Маскоўскага метрапалітэна."},{"page_url":"https://war.wikipedia.org/wiki/Graphium_ucalegon","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Graphium_ucalegon.JPG","page_title":"Graphium ucalegon","context_page_description":"An Graphium ucalegon in uska species han Lepidoptera nga syahan ginhulagway ni William Chapman Hewitson hadton 1865. An Graphium ucalegon in nahilalakip ha genus nga Graphium, ngan familia nga Papilionidae.\\nMabibilngan ini ha Tanzania. Waray hini subspecies nga nakalista."},{"page_url":"https://pl.wikipedia.org/wiki/Parafia_%C5%9Bw._Bart%C5%82omieja_w_K%C5%82odzie","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/SM_K%C5%82oda_ko%C5%9Bci%C3%B3%C5%82_%C5%9Bw_Bart%C5%82omieja_%282%29_ID_590937.jpg","page_title":"Parafia św. Bartłomieja w Kłodzie","context_page_description":"Parafia Świętego Bartłomieja w Kłodzie – parafia rzymskokatolicka we wsi Kłoda, należąca do dekanatu Głogów – NMP Królowej Polski diecezji zielonogórsko-gorzowskiej, metropolii szczecińsko-kamieńskiej w Polsce, erygowana w 1366. Mieści się pod numerem 18."},{"page_url":"https://de.wikipedia.org/wiki/Scharka-Krankheit","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/PPV_genome.svg","page_title":"Scharka-Krankheit","context_page_description":"Scharka ist eine durch das Scharka-Virus hervorgerufene Pflanzenkrankheit des Steinobstes. Sie befällt insbesondere Pflaumen/Zwetschgen und auch Pfirsiche/Nektarinen sowie Aprikosen und ist deren bedeutendste Krankheit, die sich seit den 1960er-Jahren in Deutschland ausgebreitet hat und heute flächendeckend auftritt.\\nDurch die Krankheit wird insbesondere der Erwerbsanbau von Pflaumen/Zwetschgen durch Ertragsrückgang und schlechte Fruchtqualität beeinträchtigt."},{"page_url":"https://sv.wikipedia.org/wiki/Laajavuori","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Laajavuori.jpg","page_title":"Laajavuori","context_page_description":"Laajavuori är en kulle i Finland. Den ligger i den ekonomiska regionen Jyväskylä ekonomiska region och landskapet Mellersta Finland, i den södra delen av landet, 240 km norr om huvudstaden Helsingfors. Toppen på Laajavuori är 227 meter över havet, eller 77 meter över den omgivande terrängen. Bredden vid basen är 4,0 km. Laajavuori ligger vid sjön Vuorilampi.\\nTerrängen runt Laajavuori är huvudsakligen platt. Den högsta punkten i närheten är 249 meter över havet, 5,7 km sydväst om Laajavuori. Runt Laajavuori är det tätbefolkat, med 709 invånare per kvadratkilometer. Närmaste större samhälle är Jyväskylä, 2,7 km sydost om Laajavuori. I omgivningarna runt Laajavuori växer i huvudsak barrskog.\\nTrakten ingår i den boreala klimatzonen. Årsmedeltemperaturen i trakten är 1 °C. Den varmaste månaden är juli, då medeltemperaturen är 17 °C, och den kallaste är januari, med -14 °C."},{"page_url":"https://sk.wikipedia.org/wiki/Encamp","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Com%C3%BA_d%27Encamp_-_Andorra.jpg","page_title":"Encamp","context_page_description":"Encamp je okrsok v Andorre. Má 13 225 obyvateľov, jeho katastrálne územie je 84 km². Hustota zaľudnenia je 152,07 obyv./km², obec leží v nadmorskej výške 1 300 m n. m."},{"page_url":"https://sv.wikipedia.org/wiki/Agrotis_amphora","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/31/Diegrossschmette03seitz_0107.jpg","page_title":"Agrotis amphora","context_page_description":"Agrotis amphora är en fjärilsart som beskrevs av George Francis Hampson 1903. Agrotis amphora ingår i släktet Agrotis och familjen nattflyn. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://af.wikipedia.org/wiki/Chromiet","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Chromite-182955.jpg","page_title":"Chromiet","context_page_description":"Chromiet is 'n kubiese mineraal met formule FeCr₂O₄. Dit is die belangrikste chroomerts en word ook in Suid-Afrika aangetref as hoofbestanddeel van die gesteente chromitiet.\\nChromiet het die spinelstruktuur en kan mengkristalreekse vorm met magnesiochromiet, magnetiet en herciniet wat almal dieselfde kristalstruktuur het."},{"page_url":"https://en.wikipedia.org/wiki/San_Miguel_Ixtapan_(archaeological_site)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/SMI_MCG_Entrance.JPG","page_title":"San Miguel Ixtapan (archaeological site)","context_page_description":"San Miguel Ixtapan is an archaeological site located in the municipality of Tejupilco, in the State of Mexico.\\nTejupilco is about 100 kilometers west from the city of Toluca, Mexico State, on federal highway 134. The site is some 15 kilometers south of the municipal head, on state highway 8 that leads to Amatepec.\\nThis site is one of the few explored in the southwest region of the State of Mexico, that has provided some archaeological information on an area that virtually was not explored.\\nIts apogee was in the aftermath of the Teotihuacan decline. Located in an area which probably served as a liaison between the Central Highlands and regions of Michoacán and Guerrero, San Miguel Ixtapan had its greatest growth between 750 and 900 CE. Then the site reaches a substantial expansion and built most of the structures of the ceremonial area now visible, they represent only a portion of what was the site in its splendor. San Miguel Ixtapan was located in a privileged place with deposits of basalt prisms used for construction, fertile land and one of the larger flow springs in the State."},{"page_url":"https://eo.wikipedia.org/wiki/A%C5%9Doto_la_2-a","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Ashot_Yerkat.jpeg","page_title":"Aŝoto la 2-a","context_page_description":"Aŝoto la 2-a la Fera estis armena reĝo, la filo de reĝo Smbat la 1-a. Lia regado estis plenigita kun ribeloj de tronpostulantoj al la trono, kaj eksterlandaj invadoj, kiujn Aŝoto rebatis sukcese. De tio li ricevis la surnomon la Fera. En 914, Aŝoto la 2-a vizitis Konstantinopolon por ricevi helpon de la bizanca imperiestro Konstantino Porfirogenitus. Li revenis al Armenio kun granda helpo, kaj disbatis la araban minacon ĉe liaj teroj fare de Jusuf Ibn Abi'l-Saj. En 922 li estis agnoskita kiel la reganto de Armenio fare de la araba kalifo. Li geedziĝis kun Marie de Kaĉum."},{"page_url":"https://no.wikipedia.org/wiki/Hjem","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/SearsHouse115.jpg","page_title":"Hjem","context_page_description":"Et hjem er et bosted eller oppholdssted brukt som permanent residens for et individ, familie, husholdning eller flere familier i en stamme. Det er ofte et hus, en leilighet eller en annen bygning, eller alternativt et mobilt bosted, husbåt, yurt eller en annen bærbar beskyttelse. Et prinsipp i lovverket i mange land, relatert til retten til privatliv, nedfelt i artikkel 12 i menneskerettighetserklæringen er ukrenkeligheten av hjemmet som et individs beskyttelse.\\nHjemsted har juridisk betydning blant annet for skatteplikt og statsborgerlige rettigheter.\\nHjem gir vanligvis områder og fasiliteter for søvn, matlaging, spising og hygiene. Større grupper kan bo i et pleiehjem, barnehjem eller lignende institusjon. Når sikrere boliger ikke er tilgjengelige, kan folk bo i uformelle og noen ganger ulovlige skur som finnes i slumstrøk.\\nDet norske substantivet hjem brukes i en videre betydning enn den fysiske boligen. Ordet har vært brukt i betydningen fødested, om verden som helhet, og om en husmannsplass eller en avsidesliggende gård. Mange gårdsnavn, som Solem og Nerem, er sammensatt med med -em."},{"page_url":"https://tr.wikipedia.org/wiki/Karadeniz%27deki_bal%C4%B1klar_listesi","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Heniochus_acuminatus%2C_jeune_individu.jpg","page_title":"Karadeniz'deki balıklar listesi","context_page_description":"Karadeniz'deki balıklar listesi hem Karadeniz'deki yerli türlerden, hem de Karadeniz'deki egzotik türlerden oluşur.\\nAşağıdaki etiketler IUCN kriterlerine göre türlerin korunma durumunu belirtmek için kullanılır:\\nListelenen tüm türler kökenlerine göre sınıflandırılır: yerli, egzotik, istilacı, ve tesadüfen bulunan türler."},{"page_url":"https://de.wikipedia.org/wiki/New_Zealand_Army","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/New_Zealand_Army_structure_2020.png","page_title":"New Zealand Army","context_page_description":"Die New Zealand Army bildet die Landstreitkräfte der New Zealand Defence Force. Gegenwärtig besteht sie aus etwa 4500 Mann."},{"page_url":"https://fr.wikipedia.org/wiki/Gorbio","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Vue_du_village_de_Gorbio_depuis_la_piste_de_Valmaour.jpg","page_title":"Gorbio","context_page_description":"Gorbio est une commune française située dans le département des Alpes-Maritimes, en région Provence-Alpes-Côte d'Azur."},{"page_url":"https://en.wikipedia.org/wiki/Sigourney_Weaver","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/SigourneyWeaver07TIFF.jpg","page_title":"Sigourney Weaver","context_page_description":"Susan Alexandra \\"Sigourney\\" Weaver is an American actress. Weaver is considered to be a pioneer of action heroines in science fiction films. She is known for her role as Ellen Ripley in the Alien franchise, which earned her an Academy Award nomination in 1986 and is often regarded as one of the most significant female protagonists in cinema history.\\nA seven-time Golden Globe Award nominee, she won both Best Actress in Drama and Best Supporting Actress in 1988 for her work in the films Gorillas in the Mist and Working Girl, becoming the first person to win two acting Golden Globes in the same year. She also received Academy Award nominations for both films. For her role in the film The Ice Storm, she won the BAFTA Award for Best Actress in a Supporting Role. She also received a Tony Award nomination for her work in the 1984 Broadway play Hurlyburly.\\nWeaver's other film roles include Ghostbusters, Ghostbusters II, Galaxy Quest, Holes, WALL-E, Avatar, Prayers for Bobby, Paul, The Cabin in the Woods, and A Monster Calls; and the television miniseries Political Animals and The Defenders."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%95%E0%A6%BE%E0%A6%B2%E0%A7%8B_%E0%A6%97%E0%A6%A3%E0%A7%8D%E0%A6%A1%E0%A6%BE%E0%A6%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Muddy_Rhino_%28377658490%29.jpg","page_title":"কালো গণ্ডার","context_page_description":"কালো গণ্ডার বা হুক-লিপ গ্রিনোরিস হল গনগোষ্ঠীর একটি প্রজাতি, বতসোয়ানা, কেনিয়া, মালাউই, মোজাম্বিক, নামিবিয়া, দক্ষিণ আফ্রিকা, সোয়াজিল্যান্ড, তানজানিয়া, জাম্বিয়া এবং জিম্বাবুয়ে সহ পূর্ব ও দক্ষিণ আফ্রিকার অধিবাসী। যদিও গণ্ডারটি কালো বলে উল্লেখ করা হয়েছে, তবে রংগুলি বাদামী থেকে ধূসর পর্যন্ত পরিবর্তিত হতে পারে।\\nঅন্য আফ্রিকান গণ্ডার হল সাদা গণ্ডার । \\"সাদা গণ্ডার\\" শব্দটি \\"সাদা\\" শব্দটি প্রায়ই আফ্রিকার শব্দ Wyd শব্দটির একটি অর্থহীন ব্যাখ্যা বলে মনে করা হয় যার অর্থ তার বর্গক্ষেত্রের উপরের ঠোঁটটির উল্লেখ করে, কালো রেনোকার্সের নির্দিষ্ট বা আকৃষ্ট ঠোঁটের বিপরীত। । এই প্রজাতিগুলি এখন কখনও কখনও বর্গক্ষেত্র বা হুক-ঠোঁটের rhinoceros জন্য বলা হয়।\\nসামগ্রিকভাবে সামগ্রিকভাবে সমালোচক হিসাবে বিপন্ন শ্রেণীবদ্ধ করা হয় । তিনটি উপপ্রজাতি বিলুপ্ত ঘোষণা করা হয়েছে, পশ্চিমা কালো রেনোকারোওস সহ, যা ২011 সালে প্রকৃতির প্রকৃতি সংস্থার দ্বারা বিলুপ্ত ঘোষিত হয়েছিল।"},{"page_url":"https://be.wikipedia.org/wiki/%D0%91%D0%B5%D1%80%D0%BB%D1%96%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B0%D0%BA%D0%B0%D0%B4%D1%8D%D0%BC%D1%96%D1%8F_%D0%BC%D0%B0%D1%81%D1%82%D0%B0%D1%86%D1%82%D0%B2%D0%B0%D1%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Akademie_der_Kuenste_Berlin_1.jpg","page_title":"Берлінская акадэмія мастацтваў","context_page_description":"Берлінская акадэмія мастацтваў — адукацыйная ўстанова ў Берліне, Германія. Заснавана ў 1696 годзе курфюрстам Фрыдрыхам III Брадэнбургскім і выконвала адукацыйныя і адміністрацыйныя функцыі. З'яўляецца акадэмічнай установай, члены якога абмяркоўваюць пытанні развіцця мастацтва і з'яўляецца кансультатыўным органам. З 1931 года выконвае толькі адміністрацыйныя функцыі. Адукацыйныя функцыі з гэтага часу выконвае спецыяльна створаны Берлінскі ўніверсітэт мастацтваў.\\nНовы будынак Берлінскай акадэміі мастацтваў на Парыжскай плошчы побач з адноўленым атэлем «Адлон» быў пабудаваны пасля аб'яднання Германіі па праекце членаў Акадэміі Гюнтэра Беніша, Манфрэда Забатке і Вернера Дурта. Да Другой сусветнай вайны на гэтым месцы ў палацы Арніма размяшчалася Пруская акадэмія мастацтваў."},{"page_url":"https://fi.wikipedia.org/wiki/Jerusalem","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Midrachov_jerusalem_mozesy2.jpg","page_title":"Jerusalem","context_page_description":"Jerusalem on kaupunki Lähi-idässä. Sekä israelilaiset että palestiinalaiset väittävät sitä pääkaupungikseen, mutta kummankaan väite ei ole laajalti tunnustettu kansainvälisesti.\\nJerusalem on juutalaisuuden, kristinuskon ja islamin pyhä kaupunki, joka on rakennettu Juudean vuoren kiviselle perustalle. Kaupungin rakennukset ja muurit ovat vuosisatojen ajan olleet vuoresta louhittua kiveä. Jerusalemissa on kiviä kaikissa vivahteissa, on kivisiä julkisivuja, kivitorneja ja -muureja, kiviterasseja rinneviljelmien ympärillä. Tulella kaupunkia ei ole pystytty hävittämään, ja valloittajien vaihtuessa tuhottu kaupunki on jälleen rakennettu uusien poliittisten ja uskonnollisten lippujen alla samoja kiviäkin rakennusmateriaalina käyttäen.\\nKaupunkia 20 vuotta jakanut rajalinja poistettiin kesäkuussa 1967 kuuden päivän sodan jälkeen. Poliittiset tapahtumat ja itsemurhaterroristien iskut ovat kuitenkin johtaneet siihen, että Jerusalem on yhä näkymättömällä muurilla kahtia jaettu kaupunki. Sen länsiosa on ollut Israelin pääkaupunki vuodesta 1949, ja itäpuoli on palestiinalaisten suunnitelmissa itsenäisen Palestiinan valtion pääkaupunki."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%95%D1%84%D1%80%D0%B5%D0%BC%D0%BE%D0%B2,_%D0%90%D0%BD%D0%B4%D1%80%D0%B5%D0%B9_%D0%93%D0%B5%D0%BE%D1%80%D0%B3%D0%B8%D0%B5%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Rus_Stamp_GSS-Ledokol_Georgy_Sedov-%28perfor%29.jpg","page_title":"Ефремов, Андрей Георгиевич","context_page_description":"Андре́й Гео́ргиевич Ефре́мов — старший помощник капитана парохода ледокольного типа «Георгий Седов» Главного управления Северного морского пути. Участник Великой Отечественной войны. Герой Советского Союза. Почётный полярник."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AC%D8%A8%D8%A7%D9%84_%D8%A7%D9%84%D8%A5%D9%84%D8%A8%D9%87_%D8%A7%D9%84%D8%AD%D8%AC%D8%B1%D9%8A%D8%A9_%D8%A7%D9%84%D8%B1%D9%85%D9%84%D9%8A%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Pravcicka_brana_001.jpg","page_title":"جبال الإلبه الحجرية الرملية","context_page_description":"جبال الإلبه الحجرية الرملية هي جبال أغلبها من الحجر الرملي على صعيد نهر الإلبه الذي ينبع في أرض التشيك، ثم يمر بالأراضي الألمانية المنخفضة نحو الشمال الغربي حتى يصب في بحر الشمال عند مدينة هامبورغ. تقع منطقة الجبال الحجرية الرملية بالقرب من مدينة درسدن الألمانية وتمتد جنوبا في جمهورية التشيك. يمر من خلالها نهر الإلبه الذي حفر فيها ممره عبر ملايين السنين. تسمح اللغة الألمانية بضم كل تلك الكلمات في كلمة واحدة، فتلك الجبال تسمى باللغة الألمانية Elbsandsteingebirge.\\nتلك المنطقة تعتبر منطقة سياحية يفضلها من يحب التجوال في الطبيعة ومن يهوى هواية تسلق الجبال. إنها منطقة رائعة في الجمال إذ تنتشر فيها أبراجا عالية صخرية طبيعية بأشكال مختلفة وتتخللها أشجار الغابات، وهي أحد المحميات في ألمانيا.\\nتبلغ مساحة المنطقة نحو 700 كيلومتر مربع وتصل فيها ارتفاع الجبال إلى نحو 723 متر فوق سطح البحر. يسمى الجزء التابع لألمانيا \\" سويسرا السكسونية \\"،اما الجزء الموجود في دولة التشيك فيسمى \\"سويسرا البوهيمية\\"، وقد جرى العرف على تسمية المنطقة بأكملها بـ \\"سويسرا السكسونية البوهيمية \\" „Sächsisch-Böhmische Schweiz“ أو بلغة التشيك."},{"page_url":"https://pl.wikipedia.org/wiki/Palazzo_Nasciaro","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Palazzo_Nasciaro_Naxxar_Malta.jpeg","page_title":"Palazzo Nasciaro","context_page_description":"Palazzo Nasciaro, znany też jako Casa Nasciar – XVIII-wieczny miejski dom mieszkalny w Naxxar na Malcie, zbudowany w czasach Zakonu Maltańskiego. Budynek datuje się wstecz do okresu poprzedzającego XVIII wiek, kiedy to był rezydencją rodzinną. W swej historii przeszedł różne procesy adaptacyjne, w zależności od aktualnych potrzeb mieszkańców.\\nZostał zbudowany z intencją, aby służyć jako dom reprezentacyjny, i czasem jako miejsce wypoczynku architektów, którzy go zaprojektowali. Podczas okresu brytyjskiego budynek znany był jako Lieutenant's House i mieścił zarząd regionu na Malcie. W końcu został pierwszym posterunkiem policji w Naxxar oraz pierwszą główną komendą policji regionu. Następnie przekształcono go w pierwszą szkołę podstawową w Naxxar. Pod budynkiem znajduje się schron z okresu II wojny światowej, wykorzystywany przez lokalną społeczność podczas bombardowań Malty; mieścił się tam też podziemny szpital położniczy.\\nOstatnia zmiana nazwy tego domu miejskiego na Palazzo Nasciaro może wprowadzać w błąd, gdyż jego plan pokazuje, że nie jest to pałac. Zmiana ta powstała prawdopodobnie z powodów czysto romantycznych."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D8%A7%D8%A6%D9%85%D8%A9_%D8%A8%D8%A7%D8%A8%D9%88%D8%A7%D8%AA_%D8%A7%D9%84%D9%83%D9%86%D9%8A%D8%B3%D8%A9_%D8%A7%D9%84%D9%82%D8%A8%D8%B7%D9%8A%D8%A9_%D8%A7%D9%84%D8%A3%D8%B1%D8%AB%D9%88%D8%B0%D9%83%D8%B3%D9%8A%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Pope_Peter_VII.jpg","page_title":"قائمة بابوات الكنيسة القبطية الأرثوذكسية","context_page_description":"قائمة بابوات الكنيسة القبطية الأرثوذكسية، هي القائمة المعنية ببطاركة الكرسي الرسولي السكندري الأرثوذكسي؛ أي أن البابا هو الرئيس الأعلى للمسيحيين التابعين روحياً للكنيسة القبطية الأرثوذكسية في مصر والعالم.\\nبحسب التقليد العام للكنيسة القبطية الأرثوذكسية، فإن كلمة بطريرك تُطلق كذلك على كل تلميذ من تلاميذ المسيح؛ سواء من التلاميذ الإثني عشر الأوائل أو على السبعين تلميذاً رغم ظهور هذا اللفظ لأول مرة بأمر من الإمبراطور ثيودوسيوس الثاني بإطلاقه على أسقف روما والذي يعني \\"أب الآباء\\". وبالقياس؛ فباعتبار أن مرقس هو المؤسس للكنيسة فهو البطريرك الأول لكرسي الإسكندرية. وسار هذا التقليد تباعاً بتولي خليفة لمرقس ليتولى إدارة شئون الكنيسة وأتباعها. وكان لقب بابا اُطلق أول الأمر على أسقف الإسكندرية، ثم انتقل إلى أسقف روما كذلك خاصةً مع انشقاق الكنيسة بعد انعقاد المجامع المسكونية التي كان هدفها محاولة توحيد الديانة المسيحية تحت عقيدة واحدة وكنيسة واحدة، وذلك طبقاً لقانون الإيمان المسيحي الذي يذكر بأن الـ«كنيسة واحدة مقدسة جامعة رسولية»؛ وهو ما تؤمن به الكنيسة القبطية الأرثوذكسية."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%95%E0%AE%BF%E0%AE%B4%E0%AE%95%E0%AF%8D%E0%AE%95%E0%AE%BE%E0%AE%9A%E0%AE%BF%E0%AE%AF%E0%AE%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Gangnam_Seoul_January_2009.jpg","page_title":"கிழக்காசியா","context_page_description":"கிழக்கு ஆசியா அல்லது வடகிழக்கு ஆசியா என்பது ஆசியக் கண்ட்த்தின் கிழக்கு உள்வட்டாரம் ஆகும்; இதைப் புவிப்பரபியலாகவோ அல்லது பண்பாட்டியலாகவோ வரையறுக்கலாம். terms. இது புவிப்பரப்பியலாகவும் புவி அரசியல் வழியிலும், சீனப் பெருநாடு, ஆங்காங், மக்காவு, யப்பான், மங்கோலியா, வடகொரியா, தென்கொரியா, தைவான் ஆகிய பகுதிகளை உள்ளடக்கும்.\\nஇவ்வட்டாரம் பல பண்டைய நாகரிகங்களின் தொட்டிலாகும். இவற்றுள் பண்டையக் கால சீன நாகரிகம் யப்பான் நாகரிகம், கொரிய நாகரிகம், மங்கோலியப் பேரரசு ஆகியவை உள்ளடங்கும். கிழக்காசியா உலக நாகரிகத் தொட்டில்களில் ஒன்றாகும்; இதில் பண்டைய சீன நாகரிகம் உலக மாந்தரின வரலாற்றிலேயே மிகப் பழைய நாகரிகத் தொட்டில்களில் ஒன்றாகும். பல ஆயிரம் ஆண்டுகளாக, சீனா கிழக்காசியாவை உருமாற்றி வந்துள்ளது. இந்த வட்டாரத்தில் சீன நாகரிகம் பெருமை மிக்கதாக தன்னைச் சுற்றியமைந்த அண்டை நாடுகள்பால் பெருந்தாக்கம் செலுத்தியது. வரலாற்றியலாக, கிழக்காசியச் சமூகங்கள் சீனப் பண்பாட்டுக் களத்தின் பகுதியாகவே விளங்கி வந்துள்ளன. கிழக்காசிய சொற்களும் எழுத்துகளும் முறையே செவ்வியல் சீனத்தில் இருந்தும் சீன எழுத்து வடிவத்தில் இருந்தும் உருவாகியுள்ளன. சீன நாட்காட்டி கிழக்காசியப் பண்பாட்டை உட்கொண்டுள்ளது. இதுவே மற்ற கிழக்காசிய நாட்காட்டிகள் உருவாகவும் வழிவகுத்துள்ளது."},{"page_url":"https://ca.wikipedia.org/wiki/Tiruchirappal%C2%B7li","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Trichy_International_Airport.JPG","page_title":"Tiruchirappal·li","context_page_description":"Tiruchirappal·li també Tiruchirapalli, i abreujat Tiruchi o Trichy, en anglès coneguda com a Trichinopoly és una ciutat i corporació municipal de Tamil Nadu, la quarta ciutat de l'estat després de Chennai, Coimbatore i Madurai, capital del districte de Tiruchirappalli. Consta al cens del 2001 amb una població de 746.062 habitants i una estimació de 2009 puja a 1.139.534 habitants. Està al centre de l'estat a la riba del riu Cauvery. La ciutat portaria el nom de Trishira, un dimoni de tres caps. La ciutat té un aeroport internacional que porta el seu nom."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9D%D0%BE%D0%B2%D0%B8%D0%B9_%D1%81%D0%BE%D0%B1%D0%BE%D1%80_%D0%B2_%D0%9B%D1%96%D0%BD%D1%86%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Linzer_Dom_-_Fenster_-_Grundsteinlegung_Gesamt.jpg","page_title":"Новий собор в Лінці","context_page_description":"Новий собор або Собор Непорочного зачаття Пресвятої Діви Марії — католицька церква, розташована в місті Лінц й освячена на честь свята Непорочного зачаття Діви Марії; кафедральний собор єпархії Лінца. Найбільша церковна будівля в Австрії."},{"page_url":"https://uk.wikipedia.org/wiki/Jaguar_XK","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/1999_Jaguar_XKR_%28X100%29_convertible_%282012-10-26%29_01.jpg","page_title":"Jaguar XK","context_page_description":"Jaguar XK серії — модель 2-дверного купе, що виробляється британським автовиробником Jaguar з 1996 року. Перша модель з серії була представлена ​​на Женевському автосалоні 5 березня 1996 року.\\nНа сьогоднішній день існує два покоління: X100 і X150.\\nXK8 став першим «Ягуаром» з восьмициліндровим мотором."},{"page_url":"https://de.wikipedia.org/wiki/STS-104","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/ISS_Quest_airlock.jpg","page_title":"STS-104","context_page_description":"STS-104 ist die Missionsbezeichnung für einen Flug des US-amerikanischen Space Shuttle Atlantis der NASA. Der Start erfolgte am 12. Juli 2001. Es war die 105. Space-Shuttle-Mission, der 24. Flug der Raumfähre Atlantis und der 10. Flug eines Shuttle zur Internationalen Raumstation."},{"page_url":"https://hu.wikipedia.org/wiki/Bel%C3%A9nyeshegy","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/RO_BH_Belejeni_2011.23.jpg","page_title":"Belényeshegy","context_page_description":"Belényeshegy, település Romániában, a Partiumban, Bihar megyében."},{"page_url":"https://hu.wikipedia.org/wiki/Messier_14","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/30/M14HunterWilson.jpg","page_title":"Messier 14","context_page_description":"A Messier 14 gömbhalmaz a Kígyótartó csillagképben."},{"page_url":"https://fi.wikipedia.org/wiki/Sam_Sihvo","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Sam-Sihvo-1910s.jpg","page_title":"Sam Sihvo","context_page_description":"Samuli ”Sam” Sihvo oli säveltäjä, sanoittaja ja jääkärivänrikki."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%B9%BF%E6%B8%AF%E6%99%AF%E9%9D%88%E5%AE%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/%E9%B9%BF%E6%B8%AF%E7%A6%8F%E5%BE%B7%E5%AE%AE%E7%A5%9E%E5%83%8F.jpg","page_title":"鹿港景靈宮","context_page_description":"鹿港景靈宮，原名鹿港景福宮，是位於臺灣彰化縣鹿港鎮景福里的蘇府王爺廟，原主祀鹿港五方土地公中的東方土地公，後改主奉蘇府三王爺。"},{"page_url":"https://es.wikipedia.org/wiki/POST","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/49/POST_card_3usd.jpg","page_title":"POST","context_page_description":"POST, siglas en inglés de power-on self-test o autoprueba de arranque, es un proceso de verificación e inicialización de los componentes de entrada y salida en una computacional que se encarga de configurar y diagnosticar el estado del hardware."},{"page_url":"https://de.wikipedia.org/wiki/Polarwolf","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Arcticwolf_distribution.gif","page_title":"Polarwolf","context_page_description":"Der Polarwolf, Weißwolf oder Arktischer Wolf ist eine Unterart des Wolfes und zählt zur Hundefamilie. Da er in einer sehr unwirtlichen und menschenfeindlichen Gegend lebt, ist sein Leben weitgehend unerforscht."},{"page_url":"https://bs.wikipedia.org/wiki/Njema%C4%8Dka_marka","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/200_DM_1996.jpg","page_title":"Njemačka marka","context_page_description":"Njemačka marka je bila valuta Savezne Republike Njemačke u periodu od 21. juna 1948 do 31. decembra 2001. Uvedena je putem novčane reforme 1948 na području američke, britanske i francuske okupacione zone, zamjenjujući Reichsmark. Nedugo poslije, i u ruskoj okupacionoj zoni uvodi se 24. jula 1948 nova valuta istog naziva koja ostaje valuta Njemačke Demokratske Republike do 31. jula 1964. Poslije osnivanja Savezne Republike Njemačke 23. maja 1949, marka ostaje njena zvanična valuta, kao i valuta u zapadnom Berlinu. Nakon ujedinjenja Njemačke, marka postaje valuta Njemačke sve do uvođenja eura. Ipak, po provedenim anketama, mnogi Nijemci još uvijek preračunavaju iznose iz eura u marke i većinom smatraju da je marka bila mnogo stabilnija valuta od eura. Po podacima Savezne njemačke banke u novembru 2008 u opticaju je bilo oko 14 milijardi njemačkih maraka, koje još nisu konvertovane u eure.\\nMarka je izdavana u obliku kovanica i novčanica. Postojale su ukupno četiri serije novčanica."},{"page_url":"https://fr.wikipedia.org/wiki/Eudicotyledoneae_(classification_phylog%C3%A9n%C3%A9tique)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/46/H_petiolaris4_keilor_bg_email.jpg","page_title":"Eudicotyledoneae (classification phylogénétique)","context_page_description":"Cette page a pour objet de présenter un arbre phylogénétique des Eudicotyledoneae, c'est-à-dire un cladogramme mettant en lumière les relations de parenté existant entre leurs différents groupes, telles que les dernières analyses reconnues les proposent. Ce n'est qu'une possibilité, et les principaux débats qui subsistent au sein de la communauté scientifique sont brièvement présentés ci-dessous, avant la bibliographie."},{"page_url":"https://cs.wikipedia.org/wiki/Otavipithecus_namibiensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Otavipithecus_namibiensis.JPG","page_title":"Otavipithecus namibiensis","context_page_description":"Otavipithecus namibiensis je druh vyhynulých úzkonosých primátů, žijících ve středním miocénu na území dnešní Namibie. Jediný známý druh Otavipithecus namibiensis byl v roce 1991 zachycen na výsypce dolu Berg Aukas v pohoří Otavi Mountains. V roce 1992 byly na téže lokalitě nalezeny další části kostry a ve stejné době byl nový druh i popsán. Ostatky rodu Otavipithecus jsou dosud velmi vzácné a zahrnují jen zlomek dolní čelisti se zadními zuby, část čelní kosti, silně narušenou loketní kost, první krční obratel a článek prstu přední končetiny.\\nOtavipithecus byl spíše menším primátem, neboť jeho váha je podle velikosti stoliček odhadována na 14 - 20 kg.\\nMěl nespecializovaný chrup býložravých primátů. Jeho stoličky jsou opatřeny jen slabou vrstvu zubní skloviny, což odpovídá pojídání měkké stravy - ovoce, mladých listů, bobulí, pupenů a podobně. Tím se Otavipithecus blížil spíše proconsulidům časného miocénu než pokročilejším středně miocénním hominoidům. Ti již byli vybaveni silnější sklovinou a robustnějšími čelistmi, patrně v reakci na vysušování klimatu a větší rozšíření tužších plodů na úkor měkkého tropického ovoce."},{"page_url":"https://mr.wikipedia.org/wiki/%E0%A4%B5%E0%A4%BF%E0%A4%B8%E0%A4%BE%E0%A4%AA%E0%A5%82%E0%A4%B0_%E0%A4%A4%E0%A4%B2%E0%A4%BE%E0%A4%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Visapurtank.jpg","page_title":"विसापूर तलाव","context_page_description":"विसापूर तलाव हा अहमदनगर जिल्ह्यातील श्रीगोंदे तालुक्यात आहे."},{"page_url":"https://en.wikipedia.org/wiki/Cadbury","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Cadbury_Factory%2C_Bournville_-_geograph.org.uk_-_1266844.jpg","page_title":"Cadbury","context_page_description":"Cadbury, formerly Cadbury's and Cadbury Schweppes, is a British multinational confectionery company wholly owned by Mondelez International since 2010. It is the second largest confectionery brand in the world after Mars. Cadbury is internationally headquartered in Uxbridge, west London, and operates in more than 50 countries worldwide. It is known for its Dairy Milk chocolate, the Creme Egg and Roses selection box, and many other confectionery products. One of the best-known British brands, in 2013 The Daily Telegraph named Cadbury among Britain's most successful exports.\\nCadbury was established in Birmingham, England in 1824, by John Cadbury who sold tea, coffee and drinking chocolate. Cadbury developed the business with his brother Benjamin, followed by his sons Richard and George. George developed the Bournville estate, a model village designed to give the company's workers improved living conditions. Dairy Milk chocolate, introduced in 1905, used a higher proportion of milk within the recipe compared with rival products. By 1914, the chocolate was the company's best-selling product."},{"page_url":"https://nl.wikipedia.org/wiki/Twee_broers","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c8/Hans_Christian_%C3%98rsted_som_ung.jpg","page_title":"Twee broers","context_page_description":"Twee broers is een sprookje van Hans Christian Andersen, het verscheen in 1859."},{"page_url":"https://sq.wikipedia.org/wiki/Mikel_Maruli","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Botticelli_-_Michael_Tarchaniota_Marullus.jpg","page_title":"Mikel Maruli","context_page_description":"Mikel Maruli ishte poet dhe humanist i shquar italian me prejardhje shqiptare."},{"page_url":"https://es.wikipedia.org/wiki/Condado_de_Zagreb","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Flag_of_Zagreb_County.svg","page_title":"Condado de Zagreb","context_page_description":"El condado de Zagreb es un condado croata. Dado que rodea a la ciudad de Zagreb, este condado se suele considerar como el área metropolitana de la capital croata. Su centro administrativo es la ciudad de Zagreb.\\nEl condado tiene mucha historia: la ciudad de Samobor existe desde 1242. Además, era una de las primeras localidades turísticas de la región.\\nHoy, el desarrollo económico y urbano de sus ciudades está estrechamente vinculado a Zagreb. Es más, varias ciudades tales como Zaprešić, Velika Gorica o Sesvete se están fusionando con las áreas industriales de la capital.\\nEl condado limita al norte con los condados de Krapina-Zagorje y de Varaždin, al este con el condado de Bjelovar-Bilogora, al sureste con el condado de Sisak-Moslavina y al suroeste con el condado de Karlovac."},{"page_url":"https://en.wikipedia.org/wiki/Moldovan_leu","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/1ban-md.png","page_title":"Moldovan leu","context_page_description":"The leu is the currency of Moldova. Like the Romanian leu, the Moldovan leu is subdivided into 100 bani. The name of the currency originates from a Romanian word which means \\"lion\\"."},{"page_url":"https://ko.wikipedia.org/wiki/1998%EB%85%84_FIFA_%EC%9B%94%EB%93%9C%EC%BB%B5_%EA%B2%B0%EC%8A%B9%EC%A0%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Ballon_Finale_Coupe_du_Monde_1998.JPG","page_title":"1998년 FIFA 월드컵 결승전","context_page_description":"1998년 FIFA 월드컵 결승전 은 1998년 7월 12일, 생드니의 스타드 드 프랑스에서 1998년 FIFA 월드컵 우승팀을 가리기 위해 열린 축구 경기이다. 결승전은 1994년에 FIFA 월드컵 우승을 차지한 브라질 과 개최국 프랑스의 대결로, 후자의 팀은 대회 결승전에 처음으로 올랐다. 프랑스는 3-0 완승을 거두며 사상 첫 FIFA 월드컵을 거두었고, 혁명 기념일 이틀 전에 이룩한 업적이어서 프랑스는 이 우승에 더 큰 의의를 두게 되었다. 지네딘 지단이 이 경기의 MVP로 선정되었는데, 그는 전반에 2골을 기록하였고, 프랑스는 에마뉘엘 프티의 3번째 골을 막판에 추가하였다. 관중은 80,000명 가량이 웅집하였다.\\n양팀 모두 고전 끝에 결승 무대에 도달하였다. 브라질은 조별 리그 3경기에서 6점을 적립하였는데, 이때 1패는 노르웨이에 당한 것이었다. 16강에서 칠레를 4-1, 8강에서 덴마크를 3-2로 꺾은 브라질은 네덜란드와의 준결승전에서 승부차기 끝에 승리해 결승 진출을 확정지었다. 한편 프랑스는 조별 리그에서 3경기를 모두 이기며 순항하였고, 파라과이와의 16강전에서 골든골로 신승을 거두었다. 8강에서는 이탈리아를 상대로 승부차기 끝에 이겼고, 준결승전에서는 처녀 출전국 크로아티아를 따돌리고 결승전 진출을 이룩하였다.\\n결승전 직전, 브라질 스트라이커 호나우두가 발작을 일으킴에 따라 그의 몸상태에 의혹이 제기되었다. 본래 결승전 출전 명단에서 제외되었으나, 그의 몸상태에도 불구하고, 경기 72분전에 그는 결승전 선발 명단에 포함되었다. 본 경기에서, 그는 파비앵 바르테즈 프랑스 수문장과의 충돌로 부상을 당하였다. 비록 호나우두의 출전을 강행한 결정으로 효과를 보지 못하였으나, 그가 대회 기간동안 주축 선수로 활동해 4번 득점하고 3번의 득점 기회를 창출한 것을 한 것이 신빙성 있는 결정으로 증명되고 있다.\\nFIFA 월드컵 우승 후, 프랑스는 네덜란드와 벨기에에서 열린 UEFA 유로 2000의 본선에 진출해 우승을 거두었다. 브라질은 1999년에 코파 아메리카 우승을 차지하였고, 대한민국과 일본에서 2002년에 열린 다음 FIFA 월드컵에서 정상에 올랐다. 호나우두는 그 후로 FIFA 월드컵 최다 득점 신기록을 깼으나, 이 기록은 2014년 FIFA 월드컵에 미로슬라프 클로제가 또다시 경신하였다."},{"page_url":"https://en.wikipedia.org/wiki/Margaret_Hunt_Hill","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Margaret_Hunt_Hill_Bridge_Construction_-_March_2010.jpg","page_title":"Margaret Hunt Hill","context_page_description":"Margaret Hunt Hill was an American heiress and philanthropist."},{"page_url":"https://id.wikipedia.org/wiki/Weary_River","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Weary_River_Poster.jpg","page_title":"Weary River","context_page_description":"Weary River adalah sebuah film drama romansa Amerika tahun 1929 garapan Frank Lloyd dan dibintangi oleh Richard Barthelmess, Betty Compson, dan William Holden. Film tersebut diproduksi dan didistribusikan oleh First National Pictures."},{"page_url":"https://da.wikipedia.org/wiki/Hochgrat","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/ca/Hochgrat_panorama.jpg","page_title":"Hochgrat","context_page_description":"Hochgrat er et 1.832 m højt bjerg i Allgäuer Alperne i Bayern i Tyskland. Det er det højeste bjerg i Nagelfluhkette, i Naturpark Nagelfluhkette og hausberg i Oberstaufen.\\nSvævebanen Hochgratbahn fører fra Weißachtal til Bergstation på en vestlig skulder af Hochgat i 1.634 meters højde ved Staufner Haus. Hochgrat er kendt for sin udsigt til bjerget Säntis og til Bodensee, samt for skipisterne og vandremulighederne. Fjernvandrevejene E4 og E5 fører over Hochgrat."},{"page_url":"https://nl.wikipedia.org/wiki/Ethmia_festiva","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Ethmia_festiva.jpg","page_title":"Ethmia festiva","context_page_description":"Ethmia festiva is een vlinder uit de familie van de grasmineermotten. De wetenschappelijke naam van de soort is voor het eerst geldig gepubliceerd in 1914 door Busck."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%BD%D1%83%D0%BA%D0%B8_%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D0%B5%D0%B2%D1%8B_%D0%92%D0%B8%D0%BA%D1%82%D0%BE%D1%80%D0%B8%D0%B8_%D0%B8_%D0%BF%D1%80%D0%B8%D0%BD%D1%86%D0%B0_%D0%90%D0%BB%D1%8C%D0%B1%D0%B5%D1%80%D1%82%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Prince_Christian_of_Schleswig-Holstein.jpg","page_title":"Внуки королевы Виктории и принца Альберта","context_page_description":"У британской королевы Виктории и её мужа принца Альберта было 42 внука. В этой статье также перечисляются 9 детей и 85 правнуков королевы."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A6%D0%B2%D0%B5%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/%D0%A6%D0%B5%D1%86%D0%B8%D0%BD_%D1%86%D0%B2%D0%B8%D1%98%D0%B5%D1%82.jpg","page_title":"Цвет","context_page_description":"Цвет репродуктивни је биљни орган, који представља кратак изданак са ограниченим растом, са листовима специфично измењеним функцијом. Основна функција цвета је репродукција биљке. Цветови су карактеристични само за биљке цветнице. Упоредноморфолошка испитивања су показала да се првобитни цвет може филогенетски извести из спорофилних цвасти папрати. Прашници и карпеле, као делови цвета са најважијом улогом, су хомологи микроспорофилима и макроспорофилима. Код примитивних скривеносеменица још увек се може наћи издужена цветна оса на којој су спорофили спирално распоређени, што подсећа на примитивно стање код голосеменица. На прогресивнијем ступњу се јавља скраћивање спорофилне осе, смањује се број спорофила и формира се комплетан цветни омотач."},{"page_url":"https://ms.wikipedia.org/wiki/Argelita","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Torre_Quadrada_%28Argelita%29.JPG","page_title":"Argelita","context_page_description":"Argelita merupakan sebuah kawasan perbandaran yang terletak di Sepanyol di Wilayah Castellón, di komuniti autonomi Valencia."},{"page_url":"https://eo.wikipedia.org/wiki/Carcabuey","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Carcabuey-mapa.png","page_title":"Carcabuey","context_page_description":"Carcabuey estas vilaĝo kaj municipo de la Aŭtonoma Komunumo Andaluzio, en la provinco Córdoba, sude de Hispanio. La areo de la municipo estas 80 km² kie loĝas 2752 geloĝantoj, do loĝdenso estas 34.4 loĝ./km². Carcabuey situas je 96 km de la provinca ĉefurbo Córdoba."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D1%80%D1%83%D1%88%D0%B8%D0%BD%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%90%D0%BD%D0%B0%D1%82%D0%BE%D0%BB%D1%96%D0%B9_%D0%A1%D1%82%D0%B0%D0%BD%D1%96%D1%81%D0%BB%D0%B0%D0%B2%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Akademmistechko_metro_station_Kiev_2010_01.jpg","page_title":"Крушинський Анатолій Станіславович","context_page_description":"Круши́нський Анато́лій Станісла́вович\\n— український архітектор, член Спілки архітекторів України з 1975 року."},{"page_url":"https://cs.wikipedia.org/wiki/Agentura_Spojen%C3%BDch_st%C3%A1t%C5%AF_americk%C3%BDch_pro_mezin%C3%A1rodn%C3%AD_rozvoj","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Ronald_Reagan_Building%2C_under_construction_in_the_1990s_in_Washington%2C_D.C..jpg","page_title":"Agentura Spojených států amerických pro mezinárodní rozvoj","context_page_description":"Agentura Spojených států amerických pro mezinárodní rozvoj, či Americká agentura pro mezinárodní rozvoj, je agentura federální vlády Spojených států amerických, zodpovědná primárně za administraci zahraniční civilní pomoci. Byla založena roku 1961 výkonným rozhodnutím prezidenta Johna F. Kennedyho za účelem realizace programů rozvojové pomoci v oblastech schválených Kongresem na základě zákona Foreign Assistance Act z roku 1961. USAID, jako nezávislá federální agentura, získává souhrnné zahraničně-politické směrnice od amerického Ministerstva zahraničních věcí a usiluje o „podání pomocné ruky lidem v zámoří, bojujícím za lepší život, za účelem zotavení z katastrof, či těm, kteří se snaží žít ve svobodné a demokratické zemi.“\\nOficiální cíle USAID zahrnují poskytování „ekonomické, rozvojové a humanitární pomoci po celém světě na podporu amerických zahraničně-politických cílů.“ Agentura působí v subsaharské Africe, Asii, na Blízkém východě, v Latinské Americe a Karibiku, Evropě a Eurasii. K září 2012 se USAID stáhl z Ruska, kde působil dvě desetiletí, poté, co ruská vláda rozhodla zastavit jeho programy v zemi."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%BB%80%E7%A7%91%E6%89%98%E5%A4%AB%E6%96%AF%E5%9F%BA%E5%8D%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/%D0%96%D0%B4_%D1%80%D0%B0%D0%B7%D1%8A%D0%B5%D0%B7%D0%B4_53_%D0%BA%D0%BC.jpg","page_title":"什科托夫斯基區","context_page_description":"什科托夫斯基区是俄罗斯的一个区，位于该国东南部，由滨海边疆区负责管辖，面积2,664.5平方公里，2010年人口24,511，人口密度每平方公里9.2人。"},{"page_url":"https://fi.wikipedia.org/wiki/Gerda_Kraan","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Gerda_Kraan.png","page_title":"Gerda Kraan","context_page_description":"Gerarda \\"Gerda\\" Kraan on alankomaalainen entinen yleisurheilija, joka kilpaili keskimatkojen juoksussa. Hän edusti seuratasolla De Bataven -seuraa. Kraan voitti kultaa Belgradin EM-kisoissa 1962 ajalla 2.02,8. Hän osallistui olympialaisiin kahdesti, vuosina 1960 ja 1964. Kraan ei päässyt finaaliin saakka Roomassa 1960, mutta Tokion kisoissa 1964 hän sijoittui seitsemänneksi."},{"page_url":"https://pt.wikipedia.org/wiki/Novalis","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Novalis.jpg","page_title":"Novalis","context_page_description":"Georg Philipp Friedrich von Hardenberg, Freiherr von Hardenberg, mais conhecido pelo pseudónimo Novalis, foi um dos mais importantes representantes do primeiro romantismo alemão de finais do século XVIII e o criador da flor azul, um dos símbolos mais duráveis do movimento romântico."},{"page_url":"https://fr.wikipedia.org/wiki/Brignogan-Plages","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/557_Brignogan.JPG","page_title":"Brignogan-Plages","context_page_description":"Brignogan-Plages [bʁiɲogɑ̃ plaʒ] est une ancienne commune du département du Finistère, dans la région Bretagne, en France.\\nLe 1ᵉʳ janvier 2017, elle fusionne avec Plounéour-Trez pour former la commune nouvelle de Plounéour-Brignogan-plages.\\nC'est une station balnéaire située en bordure de la Manche et qui fait partie de la Côte des Légendes."},{"page_url":"https://ne.wikipedia.org/wiki/%E0%A4%B0%E0%A5%8B%E0%A4%A1%E0%A5%8D%E0%A4%B0%E0%A4%BF%E0%A4%97%E0%A5%8B_%E0%A4%B8%E0%A4%BF%E0%A4%B2%E0%A5%8D%E0%A4%AD%E0%A4%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/RodrygoGoes.jpg","page_title":"रोड्रिगो सिल्भा","context_page_description":"रोड्रिगो सिल्भा डे गो ब्राजिलका फुटबलर जो रियाल म्याड्रिडका लागि अग्रपङतीमा खेल्छन्। उनका वुवा इरीक सेरिय-बि क्लबबाट राइट ब्याकका रूपमा खेल्दथे। रोड्रिगो सन् २००१७मा ब्राजिलकाे १७ वर्षमुनि समुहबाट खेलेका थिए ।\\nसन् २०१९ मा सान्तोस एफसीबाट रियाल म्याड्रिडकाआयका थिए र २०१९ सेप्टेम्बर मा ला लिगा काे पहिलाे खेलमा ७१मिनेटमा\\nभिनिसियस_जुनियरकाे स्थानमा मैदान प्रवेश गरेका थिए र ७२ मिनेटमा सुन्दर गाेल गरेका थिए।"},{"page_url":"https://en.wikipedia.org/wiki/Freda_Ayisi","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Freda_Ayisi_2014_%28cropped%29.jpg","page_title":"Freda Ayisi","context_page_description":"Freda Ayisi is an English football forward who plays for London City Lionesses in FA Women's Championship. She previously played for Arsenal and Leicester City."},{"page_url":"https://en.wikipedia.org/wiki/Gondola","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Gondola_Mooring.jpg","page_title":"Gondola","context_page_description":"The gondola is a traditional, flat-bottomed Venetian rowing boat, well suited to the conditions of the Venetian lagoon. It is similar to a Kayak. It is propelled by a gondolier, who uses a rowing oar, which is not fastened to the hull, in a sculling manner and also acts as the rudder.\\nFor centuries, the gondola was a major means of transportation and the most common watercraft within Venice. In modern times, the boats still do have a role in public transport in the city, serving as traghetti over the Grand Canal operated by two oarsmen. For some years there were seven traghetti, but by 2017, the number had been reduced to three.\\nVarious types of gondola boats are also used in special regattas held amongst gondoliers. Their primary role today, however, is to carry tourists on rides at fixed rates. There are approximately 400 licensed gondoliers in Venice and a similar number of boats, down from the thousands that travelled the canals centuries ago. However, they are now elegant craft, instead of the various types of shabby homemade boats of the distant past."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9D%D0%BE%D0%B2%D0%BE%D0%B7%D0%B5%D0%BB%D0%B0%D0%BD%D0%B4%D1%81%D1%8C%D0%BA%D0%B0_%D0%B0%D1%80%D0%BC%D1%96%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/HK_GMW.jpg","page_title":"Новозеландська армія","context_page_description":"Новозеландська армія або Сухопутні війська Нової Зеландії — сухопутні війська, наземний компонент та найбільший вид Збройних сил Нової Зеландії, який разом з Королівськими новозеландським військово-морським флотом та Повітряними силами складають Сили оборони Нової Зеландії.\\nНовозеландська армія брала участь в основних конфліктах XX століття: Друга англо-бурська, Перша світова, Друга світова, Корейська, Малайська, Індонезійсько-малайзійській конфронтації, В'єтнамській, у війні в Перській затоці та у XXI столітті в Афганістані та Іраку у 2003—2011. З 1970-х років новозеландська армія, як правило, бере активну участь у складі різних миротворчих контингентів. З огляду на невеликий розмір цих сил, на них до цього часу лежить велика відповідальність за виконання оперативних завдань, починаючи з розгортання в Східному Тиморі в 1999 році та на Соломонових островах на рубежі століть."},{"page_url":"https://en.wikipedia.org/wiki/Frequency_analysis","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d5/English_letter_frequency_%28alphabetic%29.svg","page_title":"Frequency analysis","context_page_description":"In cryptanalysis, frequency analysis is the study of the frequency of letters or groups of letters in a ciphertext. The method is used as an aid to breaking classical ciphers.\\nFrequency analysis is based on the fact that, in any given stretch of written language, certain letters and combinations of letters occur with varying frequencies. Moreover, there is a characteristic distribution of letters that is roughly the same for almost all samples of that language. For instance, given a section of English language, E, T, A and O are the most common, while Z, Q, X and J are rare. Likewise, TH, ER, ON, and AN are the most common pairs of letters, and SS, EE, TT, and FF are the most common repeats. The nonsense phrase \\"ETAOIN SHRDLU\\" represents the 12 most frequent letters in typical English language text.\\nIn some ciphers, such properties of the natural language plaintext are preserved in the ciphertext, and these patterns have the potential to be exploited in a ciphertext-only attack."},{"page_url":"https://it.wikipedia.org/wiki/Piero_Valenti","image_url":"https://upload.wikimedia.org/wikipedia/it/2/21/Virtus_Pallacanestro_Bologna_1983-84.jpg","page_title":"Piero Valenti","context_page_description":"Piero Valenti è un ex cestista italiano."},{"page_url":"https://en.wikipedia.org/wiki/Husted,_Colorado","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Early_El_Paso_County_Colorado_map.jpg","page_title":"Husted, Colorado","context_page_description":"Husted was a settlement on the Denver and Rio Grande Railroad and located thirteen miles north of Colorado Springs. Residents were involved in ranching and lumber businesses. In 1878, a railroad post office was moved from Southwater to Husted. The post office closed in 1920."},{"page_url":"https://it.wikipedia.org/wiki/Menaspidae","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/MenaspidDB17.jpg","page_title":"Menaspidae","context_page_description":"I menaspidi sono una famiglia di pesci cartilaginei estinti, vissuti nel Carbonifero e nel Permiano. I loro resti sono stati ritrovati in Scozia, Germania, Stati Uniti e Australia."},{"page_url":"https://fr.wikipedia.org/wiki/Staffelberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Staffelberg_Franken.jpg","page_title":"Staffelberg","context_page_description":"Le Staffelberg est une montagne de Bavière, en Allemagne. Elle fait partie de la Suisse franconienne et c'est un des reliefs les plus remarquables de la Franconie."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%A0%D0%B8%D0%B9%D0%B8-%D1%81%D1%8E%D1%80-%D0%92%D1%8C%D0%B5%D0%BD%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/019_Rilly-sur-Vienne_%28_37220_%29.JPG","page_title":"Рийи-сюр-Вьенн","context_page_description":"Рийи-сюр-Вьенн — Францин гӀала-коммуна, лаьтта Центр — Луаран атагӀа регионехь. Коммунан департамент — Эндр а, Луара а. Кхузахь климат барамехь ю, аьхка йовха хуьлу, ткъа Ӏа барамехь-шийла хуьлу. ГӀалин бахархой французаш бу. Официалан Французийн мотт бу."},{"page_url":"https://en.wikipedia.org/wiki/Samir_Dahmani","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Samir_Dahmani_ATHLETISME_MEETING_STANISLAS_2016_NANCY_TOMBLAINE_%2827601454352%29_%28cropped%29.jpg","page_title":"Samir Dahmani","context_page_description":"Samir Dahmani is a French middle-distance runner. He represented his country in the 800 metres at the 2017 World Championships without qualifying for the semifinals."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A4%D1%80%D1%96_(%D0%9F%D1%80%D0%B8%D0%BC%D0%BE%D1%80%D1%81%D1%8C%D0%BA%D0%B0_%D0%A1%D0%B5%D0%BD%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Fry-76-mairie.JPG","page_title":"Фрі (Приморська Сена)","context_page_description":"Фрі — муніципалітет у Франції, у регіоні Верхня Нормандія, департамент Приморська Сена. Населення — 157 осіб.\\nМуніципалітет розташований на відстані близько 100 км на північний захід від Парижа, 33 км на схід від Руана."},{"page_url":"https://en.wikipedia.org/wiki/Radio_Z%C3%BCrisee","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Seegr%C3%A4ben_-_radio_z%C3%BCrisee_IMG_4872_ShiftN.jpg","page_title":"Radio Zürisee","context_page_description":"Radio Zürisee, is a private-owned Swiss radio station based in Rapperswil on the Zürich lake shore in the canton of St. Gallen."},{"page_url":"https://it.wikipedia.org/wiki/Campile","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7f/Corse-Campile-EgliseStPierreStPaul.jpg","page_title":"Campile","context_page_description":"Campile è un comune francese di 189 abitanti situato nel dipartimento dell'Alta Corsica nella regione della Corsica."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A7%D7%9C%D7%99%D7%A4%D7%A1%D7%95_(%D7%99%D7%A8%D7%97)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Calypso_-_Voyager_2.jpg","page_title":"קליפסו (ירח)","context_page_description":"קליפסו הוא אחד מירחי שבתאי והתגלה ב-1980 על ידי כירח ה-25 של שבתאי."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%AD%A3%E9%9B%80%E8%BB%8A%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Shojaku_Station_%2802%29_IMG_4644r_R_20150808.JPG","page_title":"正雀車站","context_page_description":"正雀車站是一個位於大阪府攝津市阪急正雀，屬於阪急電鐵京都本線的鐵路車站。車站編號為HK-66。"},{"page_url":"https://ur.wikipedia.org/wiki/%D9%85%D8%A7%D8%B1%DB%8C%DB%81_%D8%AA%DA%BE%DB%8C%D8%B1%DB%8C%D8%B3%DB%8C%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Maria_Theresa_and_Francis_Wedding_Breakfast_by_Martin_van_Meytens_ca_1736.jpg","page_title":"ماریہ تھیریسیا","context_page_description":"ماریہ تھیریسا والبرگا امالیا کرسٹینا سلطنت ہیبسبرگ کی واحد خاتون حکمران اور سلطنت ہیبسبرگہیبسبرگ خاندان کی آخری فرد تھیں۔ وہ آسٹریا، ہنگری، کروشیا، بوہیمیا، ٹرانسلوینیہ، منٹووا، میلان، لوڈومیریا اور گلیشیا، آسٹریا نیدرلینڈز اور پیرما کی جکمران تھیں۔ شادی کے ذریعہ، وہ لورین کے ڈچس، ٹسکنی کے گرینڈ ڈچس اور ہولی رومن ایمپریس تھیں۔\\nماریہ تھیریسا نے اپنا 40 سالہ دور اقتدار اس وقت شروع کیا جب اکتوبر 1740 میں اس کے والد، شہنشاہ چارلس VI کا انتقال ہو گیا۔ چارلس VI نے 1713 کی عملی منظوری سے اس کے ساتھ الحاق کا راستہ ہموار کیا اور اپنا پورا دور اس کو حاصل کرنے میں صرف کیا۔ اس نے ساوائے کے پرنس یوجین کے مشورے کو نظرانداز کیا، جن کا ماننا تھا کہ صرف دستخطوں کے مقابلے میں ایک مضبوط فوجی اور دولت مند خزانہ زیادہ اہم ہے۔ آخر کار، چارلس VI نے ایک کمزور اور غریب حالت کو پیچھے چھوڑ دیا، خاص طور پر پولش جانشین کی جنگ اور روس-ترکی جنگ کی وجہ سے ۔ مزید یہ کہ، ان کی موت پر، سیکسیونی، پرشیا، بویریا اور فرانس نے ان کی زندگی کے دوران ان کی منظوری سے انکار کر دیا۔ پرسیا کے فریڈرک دوم نے فوری طور پر حملہ کیا اور آسٹریا کی جانشینی کی جنگ کے نام سے جانے والے سات سالہ تنازع میں سلیسیا کے متمول صوبہ ہیلس برگ کو اپنے ساتھ لے لیا۔"},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%AD%E0%A6%BE%E0%A6%B0%E0%A6%A4%E0%A7%80%E0%A6%AF%E0%A6%BC_%E0%A6%9C%E0%A6%BE%E0%A6%A4%E0%A7%80%E0%A6%AF%E0%A6%BC%E0%A6%A4%E0%A6%BE%E0%A6%AC%E0%A6%BE%E0%A6%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Flag_of_the_Maratha_Empire.svg","page_title":"ভারতীয় জাতীয়তাবাদ","context_page_description":"ভারতীয় জাতীয়তাবাদ বলতে ভারতের স্বাধীনতা আন্দোলনের আদর্শগুলি, স্বাধীনোত্তর ভারতীয় প্রজাতন্ত্রের রাজনীতিতে সেই আদর্শের প্রভাব এবং ভারতীয় সমাজে জাতিগত ও ধর্মীয় সংঘাতের কারণস্বরূপ একাধিক আপাত-পরস্পরবিরোধী আদর্শের সম্মিলিত একটি আদর্শকে বোঝায়। প্রাক-১৯৪৭ যুগের ভারতে ভারতীয়দের জাতীয় চেতনার প্রতিফলন এই ভারতীয় জাতিয়তাবাদ। সেই যুগে এই জাতীয়তাবাদ বৃহত্তর ভারতীয় উপমহাদেশকে প্রভাবিত করেছিল।"},{"page_url":"https://nn.wikipedia.org/wiki/Cape_Geddes","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Chinstrap_penguins_at_Cape_Geddes_Laurie_Island_1962.jpg","page_title":"Cape Geddes","context_page_description":"Cape Geddes er eit nes på nordenden av Ferguslie Peninsula på nordkysten av Laurie Island i Sør-Orknøyane. Det vart kartlagd i 1903 av Den skotske nasjonale antarktisekspedisjonen under William Speirs Bruce, som namngav det etter professor Patrick Geddes, ein kjend skotsk biolog og sosiolog."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Personenbahnh%C3%B6fe_in_Mecklenburg-Vorpommern","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/BfM%C3%B6lln.jpg","page_title":"Liste der Personenbahnhöfe in Mecklenburg-Vorpommern","context_page_description":"Diese Liste führt sämtliche Personenbahnhöfe und -haltepunkte in Mecklenburg-Vorpommern auf, die gegenwärtig im Regelverkehr bedient werden. Darüber hinaus werden die Art der Betriebsstelle, das Gemeindegebiet auf dem sich diese befindet, der zugehörige Verkehrsverbund, die Bedienung durch Fern-, Regional- oder S-Bahn sowie die bedienten Strecken genannt."},{"page_url":"https://it.wikipedia.org/wiki/Rustam_Qosimjonov","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Kasimdzhanov%2CRustam_990417_Porz.jpg","page_title":"Rustam Qosimjonov","context_page_description":"Rustam Qosimjonov è uno scacchista uzbeko, Grande maestro, già campione del Mondo FIDE nel periodo 2004-2005."},{"page_url":"https://en.wikipedia.org/wiki/Cowgill,_Missouri","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Caldwell_County_Missouri_Incorporated_and_Unincorporated_areas_Cowgill_Highlighted.svg","page_title":"Cowgill, Missouri","context_page_description":"Cowgill is a city in Caldwell County, Missouri, and is part of the Kansas City metropolitan area with the United States. The population was 188 at the 2010 census."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%BE%D9%88%D8%B1%DB%8C%D9%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Paolo_Veronese_-_The_Banishment_of_Vashti_-_WGA24786.jpg","page_title":"پوریم","context_page_description":"پوریم جشنی است که برای نجات یهودیان ایران در زمان شاه اخشورش از دست هامان برگزار می‌شود. هامان قرعه انداخت تا تاریخ مرگ یهودیان را تعیین کند. جشن در ۱۴ آدار برگزار می‌شود و یهودیان شوش این روز را در ۱۵ آدار جشن گرفتند. که آن روز را «پوریم شوشان» نامیدند. در دوره تلمودی، جدای از احترام برای اورشلیم، جشن پوریم شوش در شهرهای محصور در اسرائیل از زمان یوشع بن نون به صورت قانون درآمده بود. علاوه بر این امروزه، بر طبق قانون یهودی، جشن در ۱۵ آدار در اورشلیم که از زمان یوشع بن نون شهری محصور بوده برگزار می‌شود، ولی در تل‌آویو که شهری غیر محصور است، برگزار نمی‌شود. در سال کبیسه عبری، که در آن دو ماه آدار وجود دارد، پوریم در دومین ماه آدار برگزار می‌شود.\\nدر روایت تاریخی وقایع کتاب استر اختلاف نظرهایی وجود دارد. بعضی از پژوهشگران تأثیر جشن ایرانیان را در این جشن می‌بینند. بعضی دیگر شک خودشان را دربارهٔ برابر کردن خشایارشا با اخشورش بیان می‌دارند. منتقدین کتاب مقدس، متذکر شده‌اند که تشابهی بین نام‌های مردخای و استر با خدایان بابلی وجود دارد. هیچ ذکری از پوریم در منابع یهودی در قرن اول پیش از میلاد وجود ندارد.\\nبر پایه تلمود، جوامعی که از نابودی، شکنجه و کشتار رهایی یافتند، می‌بایستی جشنی همانند پوریم برگزار کنند."},{"page_url":"https://be.wikipedia.org/wiki/%D0%93%D0%B0%D1%80%D0%B0%D0%B4%D1%8B_%D0%91%D1%80%D1%8D%D1%81%D1%86%D0%BA%D0%B0%D0%B9_%D0%B2%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%86%D1%96","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e7/KosauskiZamak054.JPG","page_title":"Гарады Брэсцкай вобласці","context_page_description":"У Рэспубліцы Беларусь крытэрыі аднясення населеных пунктаў да катэгорый устаноўлены Законам Рэспублікі Беларусь ад 5 мая 1998 г. № 154—З «Аб адміністрацыйна-тэрытарыяльным дзяленні і парадку вырашэння пытанняў адміністрацыйна-тэрытарыяльнага ўладкавання Рэспублікі Беларусь». Згодна з артыкулам 8 гэтага закона, гарады дзеляцца на наступныя падкатэгорыі:\\nгорад Мінск — сталіца Рэспублікі Беларусь;\\nгарады абласнога падпарадкавання — найбольш буйныя населеныя пункты, якія з'яўляюцца адміністрацыйнымі і буйнымі эканамічнымі і культурнымі цэнтрамі з развітой вытворчай і сацыяльнай інфраструктурай;\\nгарады раённага падпарадкавання — населеныя пункты з колькасцю насельніцтва не менш за 6 тысяч чалавек, якія маюць прамысловыя прадпрыемствы, сетку ўстаноў сацыяльна-культурнага і бытавога прызначэння, з перспектывамі далейшага развіцця і росту колькасці насельніцтва."},{"page_url":"https://sv.wikipedia.org/wiki/Justus_Dahinden","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Migros_Ostermundigen.jpg","page_title":"Justus Dahinden","context_page_description":"Justus Dahinden, född 18 maj 1925 i Zürich, Schweiz, död 11 april 2020 i Zürich, var en schweizisk arkitekt, konstnär och författare."},{"page_url":"https://es.wikipedia.org/wiki/Templo_budista","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Stupa_1%2C_Sanchi_02.jpg","page_title":"Templo budista","context_page_description":"Un templo budista es el lugar de culto para los budistas, los seguidores del budismo. Incluyen las estructuras denominadas vihara, chaitya, estupa, chörten, wat y pagoda en diferentes regiones e idiomas.\\nLos templos en el budismo representan la tierra pura o el medio ambiente puro de un buda. Los templos tradicionales budistas están diseñados para inspirar la paz interior y exterior.​ Su estructura y arquitectura varía de región a región. Por lo general, el templo se compone no solo de sus edificios, sino también del entorno circundante. Los templos budistas están diseñados para simbolizar 5 elementos: fuego, aire, tierra, agua y sabiduría.​\\nLos templos pueden ir desde santuarios medio enterrados con entradas ricamente talladas hasta simples torres o estatuas. El templo budista chino tiende a ser un edificio de una sola planta de madera ricamente tallada, pintada o decorada, construido alrededor de un atrio que se usa para el culto. Por el contrario, los templos shinto de Japón son más simples y de diseño rústico."},{"page_url":"https://nl.wikipedia.org/wiki/Meilen_Tu","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Meilen_Tu.jpg","page_title":"Meilen Tu","context_page_description":"Meilen Tu is een voormalig professioneel tennisspeelster uit de Verenigde Staten, geboren uit Taiwanese ouders. Ze begon met tennis toen zij zes jaar oud was en was actief in het proftennis van 1994 tot in 2008."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%A9%AC%E6%9D%BE%E5%AD%90%E5%B1%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Melochia_parvifolia.jpg","page_title":"马松子属","context_page_description":"馬松子屬是梧桐科下的一個屬，為草本、亞灌木和喬木植物。該屬共有約54種，分布於熱帶地區。"},{"page_url":"https://en.wikipedia.org/wiki/%22Little%22_North_Western_Railway","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Adlington%2C_Blackburn%2C_Cherry_Tree%2C_Chorley%2C_Hincaster_Ingleton_%26_Wennington_RJD_103.jpg","page_title":"\\"Little\\" North Western Railway","context_page_description":"The North Western Railway was an early British railway company in the north-west of England. It was commonly known as the \\"Little\\" North Western Railway, to distinguish it from the larger London and North Western Railway.\\nThe NWR was first leased, and later taken over, by the Midland Railway. The MR used part of the line for its London to Scotland Settle and Carlisle main line.\\nThe NWR main line, which ran from Skipton in the West Riding of Yorkshire to Morecambe on the Lancashire coast, gave the MR access to the west coast in an area dominated by the rival LNWR.\\nPart of the line, between Lancaster and Morecambe, was used in the early twentieth century for pioneering overhead electrification.\\nTwo-thirds of the line, in North Yorkshire, is still in use today, mainly for local services. Of the dismantled Lancashire section, two-thirds has been reused as a combined cyclepath and footpath."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%8F%A0%E6%B5%B7%E6%9C%89%E8%BD%A8%E7%94%B5%E8%BD%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Zhuhai_Tram_cy_map.png","page_title":"珠海有轨电车","context_page_description":"珠海有轨电车是指位于广东省珠海市的有轨电车，是珠海城市建设集团有限公司下属全资子公司珠海城建现代交通有限公司投资、融资、建造的交通系统。"},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A8%D8%A7%D9%81%D9%88%D8%B3%D8%A7%D9%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Bafoussam%2C_Tamdja_neighbourhood._view_of_BEAC_from_afar.jpg","page_title":"بافوسام","context_page_description":"بافوسام کامرون اؤلکه‌سینین شهرلریندن بیریدیر. دنیز سَویه‌سیندن ۱۵۲۱ متر یۆکسکلیکده قۇرولان شهر سوْن نۆفوس ساییمینا گؤره توْپلام جمعیتی ۱٬۱۴۶٬۰۰۰ نفردیر و بۇ باخمیدان آفریقا قاره‌سینین بؤیوک شهرلریندن بیری سایا گلیر و ۴۰۲ کیلومتر موربّع ساحه‌سی وار."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D1%80%D0%BD%D0%B5%D0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Grote_Kerk%2C_Duivelhuis_en_Arnhem_Stadthuis_-_panoramio.jpg","page_title":"Арнем","context_page_description":"А́рнем — община и город на востоке Нидерландов, стоит на Рейне, административный центр провинции Гелдерланд. Первые упоминания о городе относятся к 893 году под названием Oppidium Arnoldi Villa. В XIX веке благодаря своей живописности стал модным курортным городом. В нем начали селиться богачи из бывших «сахарных баронов» или плантаторов, приехавших из заокеанских колоний."},{"page_url":"https://es.wikipedia.org/wiki/Borano","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cf/Diborane-3D-balls.png","page_title":"Borano","context_page_description":"Los boranos son hidruros de boro, es decir, compuestos químicos formados exclusivamente por boro e hidrógeno. El más simple conocido es el BH₃, aunque su masa molecular corresponde al diborano B₂H₆. La mayor parte de los boranos tienen fórmulas moléculares del tipo BₙHₙ₊₄ o BₙHₙ₊₆. Se obtienen por hidrólisis del boruro de magnesio con ácido clorhídrico diluido.\\nAlgunos boranos típicos son B₂H₆, B₄H₁₀, B₉H₁₅, B₁₀H₁₄, B₁₀H₁₆. Los boranos se prepararon por primera vez entre 1912 y 1936 por Alfred Stock que desarrolló técnicas de vacío para manejar estas sustancias tan reactivas. La síntesis original de Stock, ‑la reacción del Mg₃B₂ con ácido‑, ha sido sustituida en la actualidad en todos los casos, excepto para el B₆H₁₀. La mayoría de las síntesis actuales implican la termólisis de B₂H₆ bajo condiciones diversas, con frecuencia en presencia de hidrógeno.\\nDiborano. El B₂H₆ es un gas inflamable espontáneamente en el aire y que se hidroliza instantáneamente por la acción del agua, formando H₂ y B(OH)₃. Se obtiene de manera prácticamente cuantitativa por la reacción estequiométrica del hidruro de litio con BF₃."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9D%D0%B0%D1%83%D0%BC%D0%BE%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_(%D0%9C%D0%BE%D1%81%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/%D0%9D%D0%B0%D1%83%D0%BC%D0%BE%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%28%D0%A8%D0%B0%D1%82%D1%83%D1%80%D1%81%D0%BA%D0%B8%D0%B9_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD%29_4.JPG","page_title":"Наумовская (Московская область)","context_page_description":"Наумовская — деревня в Шатурском муниципальном районе Московской области. Входит в состав Дмитровского сельского поселения. Население — 75 чел."},{"page_url":"https://et.wikipedia.org/wiki/Krimulda_piirkond","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Flag_of_Krimuldas_novads.png","page_title":"Krimulda piirkond","context_page_description":"Krimulda piirkond on 1. järgu haldusüksus Lätis.\\nPiirkond moodustati 2009. aastal Krimulda ja Lēdurga vallast.\\nLäti Rahvastikuregistri andmetel oli 1. jaanuaril 2012 Krimulda piirkonna elanikest lätlasi 91,93%, venelasi 4,16% ja teistest rahvustest inimesi 3,93%."},{"page_url":"https://ast.wikipedia.org/wiki/Ed%C3%A1_Moderna","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/TokubeiKabuki.jpg","page_title":"Edá Moderna","context_page_description":"La Edá Moderna ye'l terceru de los periodos históricos nos que s'estrema convencionalmente la hestoria universal, entendíu ente'l sieglu XV y el XVIII. Cronológicamente alluga un periodu que'l so entamu puede afitase na cayida de Constantinopla o nel descubrimientu d'América, y que'l so final puede asitiase na Revolución francesa. Esisten persones que marquen el so fin na década previa, tres la independencia de los Estaos Xuníos. Nesta convención, la Edá Moderna corresponder al periodu en que se destacar los valores de la modernidá frente al periodu anterior, la Edá Media, que ye xeneralmente identificáu como una edá aisllada y intelectualmente escura. L'espíritu de la Edá Moderna buscaría los so referente nun pasáu anterior, la Edá Antigua identificada como Dómina Clásica."},{"page_url":"https://de.wikipedia.org/wiki/Arte_Moris","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Arte_Moris.jpg","page_title":"Arte Moris","context_page_description":"Arte Moris ist die erste Kunstschule, Kulturzentrum und Künstlervereinigung in Osttimor. Sie hat ihr Zentrum im ehemaligen Nationalmuseum in Comoro, in der Landeshauptstadt Dili.\\nArte Moris wurde im Februar 2003 gegründet, nach der gewalttätigen Besatzungszeit durch Indonesien. „Ihr Hauptziel sollte Kunst als ein Baustein im psychologischen und sozialen Wiederaufbau von einem Land, das von Gewalttätigkeit verwüstet worden ist, mit besonderer Betonung auf die Hilfe seiner jungen Bürger“. Die Idee zu diesem Projekt hatten die Schweizer Gabriela und Luca Gansser.\\nArte Moris bietet örtliche Kunstkurse für Timoresen, fördert fortgeschrittene Studenten und organisiert den Verkauf von Kunst in ihrer Galerie und zwei Hotels in Dili. Arte Moris arbeitet auch mit der professionellen Dramaschauspieltruppe Bibi Bulak zusammen. In Baucau gibt es als Ableger das Afalyca Community Arts Centre, das nach demselben Muster arbeitet.\\nDie bei Arte Moris entstehende Kunst ist vom Stil her sehr breit gefächert, oft aber surrealistisch und zeigt kulturelle Aspekte aus den unterschiedlichen Regionen des Landes.\\nSchirmherr von Arte Moris ist der Friedensnobelpreisträger und Politiker José Ramos-Horta."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%AD%E0%A4%BE%E0%A4%B0%E0%A4%A4%E0%A5%80%E0%A4%AF_%E0%A4%86%E0%A4%AE_%E0%A4%9A%E0%A5%81%E0%A4%A8%E0%A4%BE%E0%A4%B5,_1998","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Wahlergebnisse_Indien_1998.svg","page_title":"भारतीय आम चुनाव, 1998","context_page_description":"आम चुनाव में आयोजित की गई भारत 1998 में, सरकार के बाद निर्वाचित 1996 में ढह गई और 12 वीं लोक सभा बुलाई गई थी. नए चुनाव कहा जाता था जब भारतीय राष्ट्रीय कांग्रेस को छोड़ दिया संयुक्त मोर्चा सरकार से नेतृत्व I. K. Gujralके बाद, वे मना कर दिया ड्रॉप करने के लिए क्षेत्रीय द्रविड़ मुनेत्र कड़गम पार्टी से सरकार के बाद द्रमुक से जुड़ा हुआ था पर एक जांच पैनल के लिए श्रीलंका अलगाववादियों के लिए दोषी ठहराया हत्या के राजीव गांधी. के परिणाम में नए चुनाव भी सामने दुविधा की स्थिति, के साथ कोई पार्टी या गठबंधन बनाने में सक्षम एक मजबूत बहुमत है । हालांकि भारतीय जनता पार्टी's अटल बिहारी वाजपेयी तुरन्त अपने स्थान के प्रधानमंत्री से समर्थन मिलने के 286 सदस्यों में से 545, सरकार फिर से ढह देर से 1998 में जब ऑल इंडिया अन्ना द्रविड़ मुनेत्र कड़गम, साथ 18 सीटें, वापस ले लिया और उनके समर्थन है । इस एक वोट के लिए नेतृत्व के विश्वास प्रस्ताव संसद में, जहां सरकार द्वारा खो 272-273 और इस प्रकार के लिए अग्रणी, नई सामान्य चुनाव में 1999. यह भी पहली बार चिह्नित आजादी के बाद से है कि भारत की लंबे समय से संचालन पार्टी, कांग्रेस, जीतने में विफल बहुमत लगातार दो चुनाव."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_Lienz","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Unser_Herr_Im_Elend-St%C3%B6ckl_I.jpg","page_title":"Liste der denkmalgeschützten Objekte in Lienz","context_page_description":"Die Liste der denkmalgeschützten Objekte in Lienz enthält die 73 denkmalgeschützten, unbeweglichen Objekte der Gemeinde Lienz im Bezirk Lienz."},{"page_url":"https://de.wikipedia.org/wiki/Burg_Helfenberg_(Thurgau)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Helfenberg_Zeichnung.jpg","page_title":"Burg Helfenberg (Thurgau)","context_page_description":"Die Ruine der mittelalterlichen Burg Helfenberg steht in der Thurgauer Gemeinde Hüttwilen nahe dem Dorf Uerschhausen. Sie wird erstmals 1331 in der Chronik von Christian Kuchimeister erwähnt."},{"page_url":"https://en.wikipedia.org/wiki/Beni_Hammad_Fort","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2b/Kalaa_des_Beni_Hammad.5.jpg","page_title":"Beni Hammad Fort","context_page_description":"Beni Hammad Fort, also called Al Qal'a of Beni Hammad is a fortified palatine city in Algeria. Now in ruins, in the 11th century, it served as the first capital of the Hammadid dynasty. It is in the Hodna Mountains northeast of M'Sila, at an elevation of 1,418 metres, and receives abundant water from the surrounding mountains. Beni Hammad Fort is near the town of Maadid, about 225 kilometres southeast of Algiers, in the Maghreb.\\nIn 1980, it was inscribed as a World Heritage Site by UNESCO, and described as \\"an authentic picture of a fortified Muslim city\\".\\nThe town includes a 7-kilometre long line of walls. Inside the walls are four residential complexes, and the largest mosque built in Algeria after that of Mansurah. It is similar in design to the Grand Mosque of Kairouan, with a tall minaret, 20 metres.\\nExcavations have brought to light numerous terracotta, jewels, coins and ceramics testifying to the high level of civilization under the Hammadid dynasty. Also among the artifacts discovered are several decorative fountains using the lion as a motif. The remains of the emir's palace, known as Dal al-Bahr, include three separate residences separated by gardens and pavilions."},{"page_url":"https://es.wikipedia.org/wiki/Armind","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Armind_Recordings.png","page_title":"Armind","context_page_description":"Armind es un subsello discográfico neerlandés enfocado, principalmente, al trance y al house.​ Está bajo las manos del sello discografíco Armada Music, cuya cara principal en el público es su fundador Armin van Buuren.​​\\nEn su corto inicio, Armind ha lanzado pistas influyentes en las escenas de música electrónica y trance. Desde Motorcycle's As The Rush Comes, a nombres famosos en la comunidad de la danza como Mike y Mark Otten, la etiqueta Armind ha convertido en sinónimo de himnos progresivos masivos.​​"},{"page_url":"https://en.wikipedia.org/wiki/Australian_residential_architectural_styles","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d1/%281%29house_High_Street_Glenbrook.jpg","page_title":"Australian residential architectural styles","context_page_description":"Australian residential architectural styles have evolved significantly over time, from the early days of structures made from relatively cheap and imported corrugated iron to more sophisticated styles borrowed from other countries, such as the Victorian style from the United Kingdom, the Georgian style from North America and Europe and the Californian bungalow from the United States. A common feature of the Australian home is the use of fencing in front gardens, also common in both the UK and the US.\\nClimate has also influenced housing styles, with balconies and veranda spaces being more prevalent in subtropical Queensland due to the mild, generally warm winters experienced in the state. For many years, Australian homes were built with little understanding of the Australian climate and were widely dependent on European styles that were unsympathetic to Australian landscapes. In recent times, modern Australian residential architecture has reflected the climatic conditions of the country, with adaptations such as double and triple glazing on windows, coordination considerations, use of east and west shade, sufficient insulation, strongly considered to provide comfort to the dweller."},{"page_url":"https://ko.wikipedia.org/wiki/ZPU-4","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0a/Zpu-2.jpg","page_title":"ZPU-4","context_page_description":"ZPU-4는 구 소련에서 1949년에 14.5mm KPV 중기관총 4정을 묶어 만든 대공포다. 1949년부터 소비에트 연방이 채용하여 사용하기 시작한 이래 전 세계적으로 50여 개국 이상에서 채용되었다. 한국전쟁과 베트남 전쟁에서도 사용되었으며, 특히 베트남 전쟁 중에는 미국의 헬리본 부대와 중고고도에서 대공미사일을 피해 저속 침투하는 미국 해군 및 미국 공군의 공격기 편대에 많은 피해를 입혔다. 2연장 대공포는 ZPU-2라 부르며, 1정만 대공마운트 장착한 것을 ZPU-1로 부른다. 조선민주주의인민공화국도 대량으로 장비하고 있어 유사시 한국군 및 주한미군의 작전에 큰 위협요소가 되고 있다."},{"page_url":"https://it.wikipedia.org/wiki/Agostino_Mascardi","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Agostino_Mascardi.jpeg","page_title":"Agostino Mascardi","context_page_description":"Agostino Mascardi è stato un letterato e storico italiano."},{"page_url":"https://he.wikipedia.org/wiki/%D7%92%D7%95%D7%98%D7%A4%D7%A8%D7%99%D7%93_%D7%A7%D7%9C%D7%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/GottfriedKeller.jpg","page_title":"גוטפריד קלר","context_page_description":"גוטפריד קלר היה סופר ומשורר שווייצרי.\\nכותב גרמנית."},{"page_url":"https://it.wikipedia.org/wiki/Suddivisioni_dell%27Azerbaigian","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Azerbaijan_districts_numbered.png","page_title":"Suddivisioni dell'Azerbaigian","context_page_description":"L'Azerbaigian è suddiviso in dieci regioni economiche, entità senza poteri amministrativi ma solo statistici a loro volta divise in 66 distretti e 12 città. Il terzo livello è infine costituito dai comuni."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D1%8E%D1%81%D1%82%D0%B0%D0%B2_%D0%94%D0%BE%D1%80%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Juiferr5.jpg","page_title":"Гюстав Доре","context_page_description":"Поль Гюстав Доре — французький гравер, ілюстратор, живописець та скульптор. Найвидатніший ілюстратор книжок епохи романтизму."},{"page_url":"https://sv.wikipedia.org/wiki/Chicagos_tunnelbana","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/JacksonStation_RedLine_CTA.jpg","page_title":"Chicagos tunnelbana","context_page_description":"Chicagos tunnelbana kallas av befolkningen L-train, en förkortning för elevated train, det vill säga högbana. Namnet kommer av att de första delarna av systemet byggdes som högbana redan 1892 med den klassiska öglan, the Loop, i downtownområdet. Totalt har tunnelbanan en längd av 170,6 km. Av systemet utgörs 72,3 km av egentlig tunnelbana från 1943, vilken går i tunnel under downtown. Tunnelbanesystemet är med amerikanska mått mätt relativt omfattande. Vissa linjer är i trafik dygnet runt såsom röda och blå linjen, andra linjer är i trafik ca 04.30 -ca 01.30. Blå linjen går hela vägen från flygplatsen in till centrala staden.\\nDen äldre delen av L-train, högbanan, är idag ganska sliten och utgör en stark kontrast mot downtowns skyskrapor.\\nMånga filmer har även spelats in med systemet som bakgrund, bland annat Jagad, The Sting, The Blues Brothers, Mercury Rising, Just Visiting och Ocean's Eleven. I Spiderman 2 filmar man i tunnelbanan."},{"page_url":"https://ru.wikipedia.org/wiki/Arostropsis_groehni","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/ZooKeys-160-073-g002_Arostropsis_groehni_01.jpg","page_title":"Arostropsis groehni","context_page_description":"Arostropsis groehni — ископаемый вид жесткокрылых насекомых из рода Arostropsis семейства долгоносики. Обнаружены в эоценовом балтийском янтаре Европы."},{"page_url":"https://fr.wikipedia.org/wiki/Chawion","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Ru_de_Chawion_dans_le_bois_de_Staneux%2C_le_long_de_l%27avenue_Princesse_Cl%C3%A9mentine.JPG","page_title":"Chawion","context_page_description":"Le ruisseau ou ru de Chawion est un cours d'eau belge affluent du Wayai et faisant donc partie du bassin versant de la Meuse. Il coule en province de Liège dans les communes de Jalhay, Spa et Theux."},{"page_url":"https://es.wikipedia.org/wiki/Moda_en_la_d%C3%A9cada_de_1980","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Girl_with_permed_hair_in_the_1980s.jpg","page_title":"Moda en la década de 1980","context_page_description":"La moda en la década de 1980 en Gran Bretaña, los Estados Unidos, Europa y Australia tenía un fuerte énfasis en la ropa cara y accesorios de moda. Tendía a ser muy brillante y vívida en apariencia. Las mujeres expresaron una imagen de riqueza y éxito a través de una brillante bisutería, como grandes pendientes de imitación de oro, collares de perlas y ropa cubierta con lentejuelas y diamantes. La moda punk comenzó como una reacción contra el movimiento hippie de las últimas décadas y los valores materialistas de la década actual.​ La primera mitad de la década fue relativamente suave en comparación con la segunda mitad, que es cuando el icónico esquema de colores de los años ochenta se hizo popular.\\nEl cabello de la década de 1980 era en general voluminoso, rizado, cardado y muy estilizado.​ Los programas de televisión como Dynasty ayudaron a popularizar el volumen elevado y la imagen glamorossa asociada con él.​​ Las mujeres de la década de 1980 llevaban maquillaje brillante y pesado. La moda cotidiana de los años 80 consistía en labios de color claro, pestañas oscuras y gruesas, y colorete rosado o rojo -también conocido como rubor-.​"},{"page_url":"https://ar.wikipedia.org/wiki/%D9%83%D9%88%D9%83%D8%A7_%D9%83%D9%88%D9%84%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Morocco-128_-_Coke_Delivery_%28from_film%29_%282219047982%29.jpg","page_title":"كوكا كولا","context_page_description":"كوكا كولا ‏ مشروب مرطب يعرف في أمريكا بالـ\\"كوك\\" ‏. وهو ماء مكربن أي مضاف له غاز ثاني أكسيد الكربون مع محليات ومادة أو نكهة الكولا وكافايين ومواد مضافة أخرى. اخترعه جون ستيث بمبرتون ‏ في عام 1886. وهناك مشروب آخر مشابه ومنافس يعرف باسم بيبسي كولا ‏."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D0%BE%D0%B4%D1%8F%D0%BD%D0%B8%D0%B9_%D0%BC%D0%BB%D0%B8%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/%D0%92%D0%BE%D0%B4%D1%8F%D0%BD%D0%B8%D0%B9_%D0%BC%D0%BB%D0%B8%D0%BD_%D0%B7_%D1%81%D0%B5%D0%BB%D0%B0_%D0%9B%D0%BE%D0%BC%D0%B0%D1%87%D0%B8%D0%BD%D1%86%D1%96_02.jpg","page_title":"Водяний млин","context_page_description":"Водяни́й млин — млин, що використовує енергію води. У Словнику Грінченка водяний млин називається просто «млином» без уточнювального означення. Маленькі водяні млини називалися ще млиницями.\\nДля України характерні два типи водяних млинів: гребляні та наплавні. Наплавні млини базувалися лише на великих річках, зокрема Дніпрі, Десні, Сеймі. Основою, на яку встановлювали саму конструкцію млина, були човни-баржі. У разі потреби такі млини могли переміщуватись річкою.\\nЗа типом водяного колеса розрізняли такі види стаціонарних млинів:\\nКоре́чний млин — з наливним колесом.\\nПідсубі́йний млин — з підливним колесом."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%98%D0%BA%D0%BE%D0%BD%D0%BE%D0%BC%D1%83,_%D0%90%D0%BD%D1%82%D0%BE%D0%BD%D0%B8%D1%81","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/48/Themistocle.JPG","page_title":"Иконому, Антонис","context_page_description":"Антонис Иконому – греческий революционер, провозгласивший Революцию в 1821 году на острове Идра, ставшего одним из трёх основных оплотов революционного греческого флота. В греческой историографии получил также печальную известность и как первая жертва межгреческой классовой борьбы, происходившей на фоне Освободительной войны."},{"page_url":"https://en.wikipedia.org/wiki/Cliff_Richard","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Cliff_Richard_The_Shadows_Bruxelles03.JPG","page_title":"Cliff Richard","context_page_description":"Sir Cliff Richard OBE is a British singer, musician, performer, actor and philanthropist. Richard has sold more than 250 million records worldwide. He has total sales of over 21 million singles in the United Kingdom and is the third-top-selling artist in UK Singles Chart history, behind the Beatles and Elvis Presley.\\nRichard was originally marketed as a rebellious rock and roll singer in the style of Elvis Presley and Little Richard. With his backing group, the Shadows, Richard dominated the British popular music scene in the pre-Beatles period of the late 1950s to early 1960s. His 1958 hit single \\"Move It\\" is often described as Britain's first authentic rock and roll song; in the opinion of John Lennon of the Beatles, \\"before Cliff and the Shadows, there had been nothing worth listening to in British music\\". In the early 1960s, he had a prosperous film career with films including The Young Ones and Summer Holiday. Increased focus on his Christianity and subsequent softening of his music led to a more middle-of-the-road image and he sometimes ventured into contemporary Christian music."},{"page_url":"https://en.wikipedia.org/wiki/Ethel_and_Albert","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Ethel_albert_1954.JPG","page_title":"Ethel and Albert","context_page_description":"Ethel and Albert was a radio and television comedy series about a married couple, Ethel and Albert Arbuckle, living in the small town of Sandy Harbor. Created by Peg Lynch, who scripted and portrayed Ethel, the series first aired on local Minnesota radio in the early 1940s before a run on the NBC Blue Network and ABC from May 29, 1944 to August 28, 1950. It co-starred Alan Bunce as Albert.\\nRadio historian Gerald Nachman called the show \\"insightful and realistic... a real leap forward in domestic comedy—a lighthearted, clever, well-observed, daily 15-minute show about the amiable travails of a recognizable suburban couple\\" which combined \\"the domestic comedy of a vaudeville-based era with a keen modern sensibility. Lynch made her comic points without stooping to female stereotypes, insults, running gags, funny voices or goofy plots.\\"\\nThe show began as three-minute filler between a pair of Minnesota KATE station programs, then expanded to 15 minutes, and finally became a half-hour show during its last years on radio."},{"page_url":"https://nl.wikipedia.org/wiki/Carel_Lanters","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Laren-CarelLanters-33Afvoerdeksels.jpg","page_title":"Carel Lanters","context_page_description":"Carel Lanters is een Nederlandse beeldend kunstenaar. Naast vrij werk zoals tekeningen, beelden en akoestische performances realiseert hij opdrachten voor monumentale werken in de openbare ruimte en is hij actief als curator van groepstentoonstellingen."},{"page_url":"https://en.wikipedia.org/wiki/List_of_ecclesiastical_parishes_in_the_Diocese_of_Bath_and_Wells","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Church_of_St_Bridget%2C_Chelvey%2C_from_south-west.jpg","page_title":"List of ecclesiastical parishes in the Diocese of Bath and Wells","context_page_description":"The ecclesiastical parishes within the Diocese of Bath and Wells cover the majority of the English county of Somerset and small areas of Devon, Dorset, Gloucestershire and Wiltshire. The episcopal seat of the Bishop of Bath and Wells is in the Cathedral Church of Saint Andrew in the city of Wells in Somerset. The diocesan offices, the bishops' offices and residences and the cathedral are all located around the Bishop's Palace in Wells. The diocese is not referred to as \\"Bath diocese\\" or \\"Wells diocese\\", but as \\"Bath and Wells diocese\\". The ordinary of the diocese is the diocesan Bishop of Bath and Wells, Peter Hancock; he is assisted throughout the diocese by the Bishop suffragan of Taunton, Ruth Worsley, whose See was created in 1911. Alternative episcopal oversight is provided by the provincial episcopal visitor, the Bishop suffragan of Ebbsfleet, Jonathan Goodall, who is licensed as an honorary assistant bishop of the diocese in order to facilitate his work there.\\nThe parish with its local parish church is the basic unit of the Church of England."},{"page_url":"https://en.wikipedia.org/wiki/Maasvlakte","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Maasvlakte2_Construction.jpg","page_title":"Maasvlakte","context_page_description":"The Maasvlakte is a massive man-made westward extension of the Europoort port and industrial facility within the Port of Rotterdam. Situated in the municipality of Rotterdam in the Netherlands, the Maasvlakte is built on land reclaimed from the North Sea."},{"page_url":"https://pl.wikipedia.org/wiki/South_Kensington_(stacja_metra)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/London_1100546.jpg","page_title":"South Kensington (stacja metra)","context_page_description":"South Kensington – stacja metra londyńskiego na terenie Royal Borough of Kensington and Chelsea, leżąca na trasie trzech linii: District Line, Circle Line oraz Piccadilly line. Została oddana do użytku w 1868 roku. W roku 2009 skorzystało z niej ok. 28,243 mln pasażerów. Należy do pierwszej strefy biletowej."},{"page_url":"https://pt.wikipedia.org/wiki/Ester_Martin_Bergsmark","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Ester_Martin_Bergsmark.jpg","page_title":"Ester Martin Bergsmark","context_page_description":"Ester Martin Bergsmark - nascido em 29 de dezembro de 1982 em Estocolmo, Suécia - é um cineasta sueco."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Sakralbauten_in_Dresden","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/53/Loschwitzer_Kirche_3.jpg","page_title":"Liste von Sakralbauten in Dresden","context_page_description":"Die Liste von Sakralbauten in Dresden bietet einen Überblick über die kirchengeschichtlich, stadtgeschichtlich oder architektonisch wichtigsten Sakralbauten in Dresden. Während der erste Abschnitt bestehende Gotteshäuser enthält, sind im zweiten Abschnitt Sakralbauten verzeichnet, die zwar noch bestehen, jedoch nicht mehr als Gotteshäuser genutzt werden. Im dritten Abschnitt wurden die wichtigsten Sakralbauten aufgenommen, die heute nicht mehr bestehen. Die meisten davon wurden durch die Luftangriffe 1945 zerstört."},{"page_url":"https://ca.wikipedia.org/wiki/Rocquencourt","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Rocquencourt_78_Mairie.JPG","page_title":"Rocquencourt","context_page_description":"Rocquencourt és un municipi francès al departament d'Yvelines. L'any 2007 tenia 3.267 habitants.\\nForma part del cantó de Le Chesnay i del districte de Versalles. I des del 2002 de la Comunitat d'aglomeració Versailles Grand Parc."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D0%B0%D1%80%D0%BE%D0%B2%D0%B0_%D0%BC%D0%B0%D1%88%D0%B8%D0%BD%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/69/Curtis-turbina.jpg","page_title":"Парова машина","context_page_description":"Парова́ маши́на — тепловий поршневий двигун зовнішнього згоряння, в якому потенціальна енергія водяної пари, котра надходить під тиском з парового котла, перетворюється в механічну роботу при зворотно-поступальному русі поршня, який через механічні ланки надає обертального руху вихідному валу. У ширшому розумінні, парова машина — всякий тепловий двигун, який перетворює енергію пари в механічну роботу."},{"page_url":"https://en.wikipedia.org/wiki/List_of_international_cricket_five-wicket_hauls_at_Green_Park_Stadium","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Kanpur_green_park.jpg","page_title":"List of international cricket five-wicket hauls at Green Park Stadium","context_page_description":"The Green Park Stadium—formerly known as Modi Stadium—is a cricket ground in Kanpur, India. It is the home ground of the Uttar Pradesh cricket team and has played host to Ranji Trophy matches, as well as being a Test and One Day International venue. The ground has hosted 21 Test matches, since the first one in 1952 when India played England. It has also staged 14 ODIs, the first of which was in 1986 when India lost to Sri Lanka by a margin of 17 runs. As of September 2019, only one T20 International has been played at the ground.\\nIn cricket, a five-wicket haul refers to a bowler taking five or more wickets in a single innings. This is regarded as a notable achievement. The fourth Test of England's 1951-52 tour of India was the first Test held at the stadium. Roy Tattersall, Ghulam Ahmed and Malcolm Hilton took five-wicket hauls in the first, second and third innings of the match respectively. As of September 2019, 26 Test match five-wicket hauls have occurred at the ground.\\nTwo bowlers have taken five-wicket hauls during ODIs at Green Park. The first player to do so was Javagal Srinath of India, which is also the best figures in ODI cricket at this ground."},{"page_url":"https://eu.wikipedia.org/wiki/Bataiarri","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Vittsk%C3%B6vle_kyrka%2C_dopfunt.jpg","page_title":"Bataiarri","context_page_description":"Bataiarria, bataioaren sakramentua egiteko erabiltzen den ura duen pontea da. Egitura beregain bezala egon ohi da elizaren posizio nabarmen batean, aitaren egiteko ponteak berriz horma edo zutabeetara itatsita egoten diren bitartean. Batzuetan kapera edo eraikin propioa ere izaten du bataiarriak, bataiotegia."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%B3%D8%A7%D9%85%D9%89_%D8%B3%D9%88%D8%B3%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Sammy_Sosa_TEX.jpg","page_title":"سامى سوسا","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nسامى سوسا لاعب بيسبول من جمهورية الدومينيكان."},{"page_url":"https://en.wikipedia.org/wiki/Moonbow","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Moonbow_-_AstroHub%27.jpg","page_title":"Moonbow","context_page_description":"A moonbow is a rainbow produced by moonlight rather than direct sunlight. Other than the difference in the light source, its formation is the same as for a solar rainbow: It is caused by the refraction of light in many water droplets, such as a rain shower or a waterfall, and is always positioned in the opposite part of the sky from the moon relative to the observer.\\nMoonbows are much fainter than solar rainbows, due to the smaller amount of light reflected from the surface of the moon. Because the light is usually too faint to excite the cone color receptors in human eyes, it is difficult for the human eye to discern colors in a moonbow. As a result, a moonbow often appears to be white. However, the colors in a moonbow do appear in long exposure photographs.\\nMoonbows have been mentioned at least since Aristotle's Meteorology."},{"page_url":"https://pl.wikipedia.org/wiki/Plac%C3%B3wka_Stra%C5%BCy_Celnej_%E2%80%9EOkoni%C3%B3wek%E2%80%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Tworki_komisariat_SC_1926.jpg","page_title":"Placówka Straży Celnej „Okoniówek”","context_page_description":"Placówka Straży Celnej „Okoniówek” – jednostka organizacyjna Straży Celnej pełniąca w okresie międzywojennym służbę ochronną na granicy polsko-niemieckiej."},{"page_url":"https://no.wikipedia.org/wiki/Daniel_Bahr","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/FDP-Wahlkampfkundgebung_in_der_Wolkenburg_K%C3%B6ln-2128.jpg","page_title":"Daniel Bahr","context_page_description":"Daniel Bahr er en tysk politiker. Fra 12. mai 2011 til desember 2013 var han Tysklands helseminister, til da var han parlamentarisk statssekretær i samme departement.\\nBahrs utdannelse er Master of Business Administration med tyngdepunkt International Health Care and Hospital Management. Han var FDPs helseekspert.\\nFra 29. oktober 2009 til 11. mai 2011 var han parlamentarisk statssekretær i Tysklands helsedepartement. Den 27. november 2010 ble han valgt til formann for FDP i Nordrhein-Westfalen.\\nI 2014 begynte han i ledelsen for Allianz Private Krankenversicherung."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B9%E3%82%BA%E3%82%AD%E3%83%BB%E3%82%BD%E3%83%AA%E3%82%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Suzuki_Solio_Bandit_MA15S.JPG","page_title":"スズキ・ソリオ","context_page_description":"ソリオは、スズキが製造・販売するコンパクトトールワゴン。\\n本項ではソリオの前身ブランドにあたるワゴンRワイド、ワゴンR+、ワゴンRソリオについても記述する。"},{"page_url":"https://el.wikipedia.org/wiki/%CE%9B%CE%B9%CE%BB","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/33/Lille2013.jpg","page_title":"Λιλ","context_page_description":"Η Λιλ ή Λίλλη είναι πόλη στη βόρεια Γαλλία. Βρίσκεται σε στρατηγικό σημείο της Ευρώπης, αφού γειτονεύει με το Βέλγιο και απέχει λίγο από το Λουξεμβούργο, την Αγγλία, την Ολλανδία και τη Γερμανία. Αποτελεί την τέταρτη μεγαλύτερη μητροπολιτική περιοχή της χώρας, μετά το Παρίσι, τη Λυών και τη Μασσαλία.\\nΤο 2006 είχε πληθυσμό 226.014 κατοίκων, ενώ η ευρύτερη μητροπολιτική περιοχή ξεπερνάει το 1,1 εκατομμύριο κατοίκους.\\nΣτη Λιλ πραγματοποιούνται οι διεθνείς συσκέψεις του Ευρωπαϊκού Οργανισμού Σιδηροδρόμων."},{"page_url":"https://pl.wikipedia.org/wiki/White_2115","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/White_2115Krak%C3%B3w.jpg","page_title":"White 2115","context_page_description":"White 2115, właściwie Sebastian Czekaj – polski raper i autor tekstów oraz członek zespołu 2115 Gang. Współpracował z takimi wykonawcami jak m.in. Bedoes, Blacha, Żabson, Beteo, Białas czy Zeamsone."},{"page_url":"https://en.wikipedia.org/wiki/Hoenderloo","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Heldringkerk.jpg","page_title":"Hoenderloo","context_page_description":"Hoenderloo is a Dutch village located south west of the city of Apeldoorn. Most of the village is part of the municipality of Apeldoorn, but a small part belongs to the municipality of Ede, among which the hamlet Hoog Baarlo.\\nThe village is located in the Southern part of the Veluwe and close to the national park Hoge Veluwe and the Deelerwoud. It is a very touristic village, with a large number of camping sites, recreation parks, restaurants, hotels and shops."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A4%D0%BE%D0%BD%D0%B5%D1%82%D0%B8%D0%BA%D0%B0_%D0%B8_%D1%84%D0%BE%D0%BD%D0%BE%D0%BB%D0%BE%D0%B3%D0%B8%D1%8F_%D1%85%D0%B8%D0%BD%D0%B4%D1%83%D1%81%D1%82%D0%B0%D0%BD%D0%B8","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3d/Hindi_vowel_chart.png","page_title":"Фонетика и фонология хиндустани","context_page_description":"В настоящей статье представлены сведения о фонологии и фонетике стандартного хинди, индоарийского языка, одного из двух существующих стандартных языков хиндустанского кластера."},{"page_url":"https://es.wikipedia.org/wiki/Albania","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Flag_of_Albania.svg","page_title":"Albania","context_page_description":"Albania, oficialmente República de Albania, es un país situado en el sureste de Europa. Limita con Montenegro al noroeste, con Kosovo al noreste, con Macedonia del Norte al este y con Grecia por el sur y el sureste. Tiene costa hacia el mar Adriático en el oeste y hacia el mar Jónico al suroeste. Italia se encuentra a 72 km de la costa albanesa, separada por el estrecho de Otranto que une el mar Adriático con el Jónico.\\nEl actual territorio albanés fue, en diversos momentos de su historia, parte de la provincia romana de Dalmacia, de Macedonia y de Mesia Superior. La república moderna consiguió su independencia tras el colapso del Imperio Otomano en Europa como resultado de las Guerras de los Balcanes, desarrolladas entre los años 1912 a 1913. Albania declaró su independencia en 1912 y esta fue reconocida al año siguiente. A partir de entonces, el país se constituyó como principado, república y reino hasta su invasión por tropas italianas en 1939. Italia creó la Gran Albania, que en 1943 pasó a ser protectorado nazi.​"},{"page_url":"https://cs.wikipedia.org/wiki/Herm%C3%ADna_%C5%A0kodov%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Plze%C5%88%2C_pomn%C3%ADk_osvobozen%C3%AD_U_Pr%C3%A1ce.JPG","page_title":"Hermína Škodová","context_page_description":"Hermína Škodová byla členkou majetné plzeňské rodiny Hahnenkammových německého původu, manželkou průmyslníka Emila Škody a matkou dědice firmy Škoda Karla Škody."},{"page_url":"https://tg.wikipedia.org/wiki/Slingsby_Sky","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Slingsby_Sky.png","page_title":"Slingsby Sky","context_page_description":"Slingsby Sky — як ҳавогарди сохтаи Slingsby Sailplanes Ltd., Kirkbymoorside, Yorkshire дар кишвари بریتانیا аст. Ин ҳавогард дар Сентябр 1, 1950 нахустин парвози худро анҷом дод."},{"page_url":"https://nl.wikipedia.org/wiki/Graphiurus_ocularis","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/SpectacledDormouse.jpg","page_title":"Graphiurus ocularis","context_page_description":"Graphiurus ocularis is een zoogdier uit de familie van de slaapmuizen. De wetenschappelijke naam van de soort werd voor het eerst geldig gepubliceerd door Smith in 1829."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%B8%E0%A7%8C%E0%A6%B0%E0%A6%9C%E0%A6%97%E0%A6%A4%E0%A7%87%E0%A6%B0_%E0%A6%9C%E0%A6%A8%E0%A7%8D%E0%A6%AE_%E0%A6%93_%E0%A6%AC%E0%A6%BF%E0%A6%AC%E0%A6%B0%E0%A7%8D%E0%A6%A4%E0%A6%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Protoplanetary-disk.jpg","page_title":"সৌরজগতের জন্ম ও বিবর্তন","context_page_description":"আমাদের এই সৌরজগতের জন্ম ও বিবর্তন আনুমানিক ৪৫০ কোটি বছর পূর্বে কোন বিরাট আণবিক মেঘের একটি ছোট অংশের মহাকর্ষীয় ধ্বসের মাধ্যমে শুরু হয়েছিল বলে ধারণা করা হয়। ধ্বসে পড়া অংশের অধিকাংশ ভরই কেন্দ্রের একটি ছোট স্থানে কেন্দ্রীভূত হয়ে সূর্য গঠন করে, বাকি অংশগুলো চ্যাপ্টা হয়ে জন্ম দেয় একটি ভ্রূণগ্রহীয় চাকতির যা থেকে সৌরজগতের সকল গ্রহ, প্রাকৃতিক উপগ্রহ, গ্রহাণু এবং অন্যান্য ছোট ছোট বস্তু গঠিত হয়।\\nনীহারিকা অনুকল্প নামের এই বহুল পরিচিত ও সর্বজনগৃহীত মডেলটি প্রথম প্রস্তাব করেছিলেন Emanuel Swedenborg, ইমানুয়েল কান্ট এবং পিয়ের সিমোঁ লাপ্লাস, সেই ঊনবিংশ শতাব্দীতে। পরবর্তীতে বিজ্ঞানের অনেকগুলো শাখার সক্রিয় অংশগ্রহণে মডেলটির উন্নতি ঘটেছে যার মধ্যে রয়েছে জ্যোতির্বিজ্ঞান, পদার্থবিজ্ঞান, ভূতত্ত্ব এবং গ্রহ বিজ্ঞান। ১৯৫০-এর দশকে মহাকাশ যুগের সূচনা ঘটা এবং ১৯৯০-এর দশকে বহির্গ্রহ আবিষ্কৃত হতে শুরু হওয়ার পর অনেকেই এই মডেলের পুনর্বিশ্লেষণ বা সমালোচনা করছেন। নতুন আবিষ্কারগুলোকেও এই অনুকল্পের মাধ্যমে ব্যাখ্যা করা যায় কিনা সেটিই তাদের প্রশ্ন।\\nপ্রাথমিক অবস্থা থেকে সৌরজগৎ অনেক বিবর্তিত হয়েছে। কোন গ্রহের চারদিকে আবর্তনরত গ্যাস ও ধূলিকনার চাকতি থেকে তার উপগ্রহ তৈরি হয়ে থাকতে পারে, আবার কিছু উপগ্রহ ভিন্ন জায়গায় উৎপন্ন হয়ে পরবর্তীতে গ্রহের মহাকর্ষীয় বন্ধনে ধরা দিতে পারে।"},{"page_url":"https://es.wikipedia.org/wiki/Slav%C3%ADkov","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Slav%C3%ADkov_%28okres_Havl%C3%AD%C4%8Dk%C5%AFv_Brod%29_vlajka.jpg","page_title":"Slavíkov","context_page_description":"Slavíkov es una localidad del distrito de Havlíčkův Brod en la región de Vysočina, República Checa, con una población estimada a principio del año 2018 de 300 habitantes.\\nSe encuentra ubicada al norte de la región, cerca de la orilla del río Sázava —un afluente derecho del río Moldava— y de las regiones de Bohemia Central y Pardubice.​"},{"page_url":"https://id.wikipedia.org/wiki/I%C3%B1igo_Mart%C3%ADnez","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Inigo_Martinez.jpg","page_title":"Iñigo Martínez","context_page_description":"Íñigo Martínez Berridi adalah pemain sepak bola Spanyol yang bermain untuk Real Sociedad di La Liga, biasanya ia bermain sebagai Bek sentral."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A1%D0%B0%D0%BD%D1%82%27%D0%90%D0%BD%D1%82%D0%B8%D0%BE%D0%BA%D0%BE_(%D0%B3%D1%80%D0%B0%D0%B4)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Panorama_Sant%27Antioco_da_Porto_Botte.jpg","page_title":"Сант'Антиоко (град)","context_page_description":"Сант'Антио̀ко е пристанищен град и община в Южна Италия, провинция Южна Сардиния, автономен регион и остров Сардиния. Разположен е на 10 m надморска височина. Населението на общината е 11 390 души.\\nГрад Сант'Антиоко е най-важният център на остров Сант'Антиоко. Сант'Антиоко е една от двете общини, намиращи се на острова."},{"page_url":"https://sv.wikipedia.org/wiki/Odessa,_Texas","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/98/Odessa%2C_TX%2C_City_Hall_DSCN0985.JPG","page_title":"Odessa, Texas","context_page_description":"Odessa är en stad i Ector County i delstaten Texas, USA med 90 943 invånare. Odessa är administrativ huvudort i Ector County.\\nStadens universitet heter University of Texas of the Permian Basin."},{"page_url":"https://zh.wikipedia.org/zh-hk/%E9%98%BF%E5%8F%A4%E6%B2%B3%E7%95%94%E7%BB%B4%E8%80%B6%E5%B0%94%E7%B1%B3","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/be/Map_commune_FR_insee_code_81315.png","page_title":"阿古河畔维耶尔米","context_page_description":"阿古河畔維耶爾米是法國南部-庇里牛斯大區 塔恩省的一個市鎮，屬於卡斯特爾區 阿古河畔維耶爾米縣。該市鎮2009年時的人口 為1,464人。"},{"page_url":"https://en.wikipedia.org/wiki/Carl_Johan_Bonnesen","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Carl_Bonnesen_byEmil_Axel_Krause.jpg","page_title":"Carl Johan Bonnesen","context_page_description":"Carl Johan Bonnesen was a Danish sculptor. Carl Johan Bonnesen specialised in depictions of animals and exotic, 'primitive' subjects as seen in the first sculpture he ever exhibited »A Victorious Group of Huns« from 1889. It was soon followed by »A Barbarian«, 1891, »The Period of the Huns«, 1893, »A Bedouin«, 1897 and »A Mounted Chinese Warrior«, 1900.\\nBonnesen soon had many commissions. At the age of 22 in 1891 his first sculpture was acquired by the collector Heinrich Hirschsprung and cast in bronze. His most important patron was the brewer Carl Jacobsen, who among other pieces ordered »Thor Driving Across the Arch of the Sky«. Bonnesens last great patron was Harald Plum, who had the huge sculpture group »Thors Fighting the Giants« placed on his private island, Thorø. «, 1891, »The Period of the Huns«, 1893, »A Bedouin«, 1897 and »A Mounted Chinese Warrior«, 1900."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D8%A7%D8%B1%D8%A8%D8%B1%D8%A7_%D9%86%D9%88%D8%A8%D9%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Barbara_noble_1.jpg","page_title":"باربرا نوبل","context_page_description":"باربرا نوبل ‏ ؛ روائية بريطانية."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9B%D0%B8%D1%82%D0%BE%D0%B2%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%B5%D1%82%D0%BD%D0%BE%D0%BA%D0%BE%D1%81%D0%BC%D0%BE%D0%BB%D0%BE%D0%B3%D1%96%D1%87%D0%BD%D0%B8%D0%B9_%D0%BC%D1%83%D0%B7%D0%B5%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/%D0%AD%D1%82%D0%BD%D0%BE%D0%BA%D0%BE%D1%81%D0%BC%D0%BE%D0%BB%D0%BE%D0%B3%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B9_%D0%BC%D1%83%D0%B7%D0%B5%D0%B9_7.jpg","page_title":"Литовський етнокосмологічний музей","context_page_description":"Литовський етнокосмологічний музей — музей, присвячений історії та перспективам освоєння людиною космосу, фактам усвідомлення законів Всесвіту древньою людиною, взаємозв'язку людства з небом, Сонцем, Місяцем та зірками."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D1%80%D0%BE%D1%84%D0%B8%D0%BB%D0%B8%D0%BD","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7b/Profilin_actin_complex.png","page_title":"Профилин","context_page_description":"Профилин – это актин-связывающий белок, участвующий в обеспечении динамической нестабильности и реструктуризации актинового цитоскелета.\\nПрофилин найден во всех эукариотических организмах в большинстве клеток. Профилин важен для пространственного и временного контроля роста актиновых филаментов, который является естественным процессом при клеточном движении и смене клеточной формы. Эта реструктуризация актинового цитоскелета сопровождает такие процессы, как развитие органов, заживление ран и уничтожение инфекционных агентов клетками иммунной системы. Профилин также связывает последовательности, богатые пролином, в различных белках. Несмотря на то, что большая часть профилина связана с актином, у него ещё есть более 50 партнёров для связывания, многие из которых родственны актину. Профилин также вовлечён в процессы, происходящие в клеточном ядре, такие, как сплайсинг мРНК Профилин связывает некоторые виды мембранных фосфолипидов. Функция этих взаимодействий – поддержание профилина в неактивной форме. Он может быть активирован действием фермента фосфолипазы С. Профилин – главный аллерген, содержащийся в пыльце берёзы и многих травянистых растений."},{"page_url":"https://pt.wikipedia.org/wiki/Bhimsen_Joshi","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Pandit_Bhimsen_Joshi_%28cropped%29.jpg","page_title":"Bhimsen Joshi","context_page_description":"Bhimsen Joshi foi um cantor indiano de música hindustani."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Anglininkai","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Anglininkai.2.jpg","page_title":"Anglininkai","context_page_description":"Anglininkai sī chi̍t ê tī Lietuva Kiōng-hô-kok Panevėžys Kūn Biržai Koān Širvėna Tiúⁿ-ló-khu ê chng-thâu. Chit-ê só͘-chāi tī 2011 nî ê sî-chūn ū 223 ê lâng tòa."},{"page_url":"https://ro.wikipedia.org/wiki/Coprinopsis_picacea","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Pilz1a.JPG","page_title":"Coprinopsis picacea","context_page_description":"Coprinopsis picacea, sin. Coprinus picaceus, din încrengătura Basidiomycota în familia Psathyrellaceae și de genul Coprinopsis este o ciupercă necomestibilă, cunoscută în popor sub denumirea buretele ciocănitoarei sau coprin pestriț, fiind o specie saprofită care crește solitar, dar totuși relativ des întâlnită, găsită în România, Basarabia și Bucovina de Nord pe soluri calcaroase, mai rar pe cele argiloase, în păduri de fagi precum în păduri călduroase de stejari și carpeni, din august până în octombrie."},{"page_url":"https://af.wikipedia.org/wiki/Pablo_Casals","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Fritz_Kreisler%2C_Harold_Bauer%2C_Pablo_Casals%2C_and_Walter_Damrosch_at_Carnegie_Hall_on_March_13%2C_1917.jpg","page_title":"Pablo Casals","context_page_description":"Pau Casals i Defilló,\\"., gewoonlik in Engels bekend as \\"Pablo Casals\\"\\", was 'n tjellis, komponis, en dirigent van Katalonië, Spanje. Hy word in die algemeen beskou as die beste tjellis van die eerste helfte van die 20ste eeu, en as een van die grootste tjelliste van alle tye. Hy het baie opnames gedurende sy loopbaan gemaak, van onder andere solo, kamermusiek en orkestrale werke; ook as dirigent. Hy word egter waarskynlik die beste onthou vir sy opnames van Johann Sebastian Bach se Tjello Suites wat hy gemaak het vanaf 1936 tot 1939. Die Presidensiële Vryheidsmedalje is in 1963 deur President John F. Kennedy aan hom toegeken."},{"page_url":"https://de.wikipedia.org/wiki/Stolpersteine_in_Slowenien","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Stolperstein_f%C3%BCr_Oton_Baumgarten_%28Ljubljana%29.jpg","page_title":"Stolpersteine in Slowenien","context_page_description":"Die Liste der Stolpersteine in Slowenien enthält die Stolpersteine in Slowenien, die an das Schicksal der Menschen erinnern, die während der Zeit des Nationalsozialismus auf dem Gebiet des heutigen Slowenien ermordet, deportiert, vertrieben oder in den Suizid getrieben wurden. Die Stolpersteine wurden von Gunter Demnig verlegt. In slowenischer Sprache heißen die Stolpersteine: Tlakovci spomina.\\nDie slowenische Stadt Maribor war im Jahr 2012 Kulturhauptstadt Europas und organisierte in diesem Rahmen die erstmalige Verlegung von Stolpersteinen in Slowenien – als Teil des Projekts Shoah – Let Us Remember, finanziell unterstützt von der Task Force für Internationale Kooperation bei Holocaust-Bildung, Gedenken und Forschung. Am 25. und 26. Januar 2012 fanden – anlässlich des International Holocaust Remembrance Day – an den drei Verlegeorten Feierstunden mit der symbolischen Verlegung der Stolpersteine statt. Die eigentliche Verlegung erfolgte erst am 13. Juli 2012 durch Gunter Demnig und den damaligen slowenischen Präsidenten Danilo Türk, der den letzten Stein setzte."},{"page_url":"https://en.wikipedia.org/wiki/Viscoplasticity","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/PVS_VISCOUS3.JPG","page_title":"Viscoplasticity","context_page_description":"Viscoplasticity is a theory in continuum mechanics that describes the rate-dependent inelastic behavior of solids. Rate-dependence in this context means that the deformation of the material depends on the rate at which loads are applied. The inelastic behavior that is the subject of viscoplasticity is plastic deformation which means that the material undergoes unrecoverable deformations when a load level is reached. Rate-dependent plasticity is important for transient plasticity calculations. The main difference between rate-independent plastic and viscoplastic material models is that the latter exhibit not only permanent deformations after the application of loads but continue to undergo a creep flow as a function of time under the influence of the applied load.\\nThe elastic response of viscoplastic materials can be represented in one-dimension by Hookean spring elements. Rate-dependence can be represented by nonlinear dashpot elements in a manner similar to viscoelasticity. Plasticity can be accounted for by adding sliding frictional elements as shown in Figure 1."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%94%D0%BC%D0%B8%D1%82%D1%80%D1%96%D0%B2%D1%81%D1%8C%D0%BA%D0%B0_%D1%86%D0%B5%D1%80%D0%BA%D0%B2%D0%B0_(%D0%97%D0%B3%D0%BE%D1%80%D0%B0%D0%BD%D0%B8)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Zgorany_Liubomlskyi_Volynska-Dmytrievska_church-general_view-2.jpg","page_title":"Дмитрівська церква (Згорани)","context_page_description":"Церква святого великомученика Димитрія — постійно діючий православний храм у селі Згорани в Любомльському районі на Волині. Настоятель — ієрей Петро Луць. Збудований у 1674 році храм та дзвіниця є пам'ятками архітектури та містобудування національного значення."},{"page_url":"https://es.wikipedia.org/wiki/Burgo_(Arouca)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/ARC-burgo.png","page_title":"Burgo (Arouca)","context_page_description":"Burgo es una freguesia portuguesa del concelho de Arouca, con 5,38 km² de superficie y 2.067 habitantes. Su densidad de población es de 384,2 hab/km²."},{"page_url":"https://no.wikipedia.org/wiki/Huitfeldts_gate_(Oslo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Huitfeldts_gate_25.jpg","page_title":"Huitfeldts gate (Oslo)","context_page_description":"Huitfeldts gate er en gate i Oslo som går fra Henrik Ibsens gate til Munkedamsveien. Gaten ble i 1864 oppkalt etter sjøhelten Iver Huitfeldt.\\nLangs gaten er for en stor del leiegårder fra siste halvdel av 1800-tallet, og mange av gårdene på oversiden er fra helt fra 1870-årene. De fleste 1800-tallsgårdene er i varianter av nyrenessanse.\\nTidligere gikk det trikk i Huitfeldts gate. Den kom fra Engens gate og svingte sørvestover i Ruseløkkveien, så opp Cort Adelers gate og ned Huitfeldts gate før den fortsatte gjennom Lassons gate og Munkedamsveien mot Skillebekk.\\nDrammenbanen åpnet i 1872, og Huitfeldts gate gikk først over en enkel bro over den skjæringen som jernbanen gikk gjennom. Senere ble jernbanen elektrifisert, og det oppført en fagverksbro av samme type som ved Ruseløkkveien og Munkedamsveien. Etter at Oslotunnelen ble åpnet og jernbanestrekningen inn til Vestbanestasjonen nedlagt, mistet disse broene sin funksjon, men de fleste er der fortsatt, også den ved Huitfeldts gate. Langs den nedlagte jernbanetraseen er det oppført nye bygårder langs Løkkegangen øst for Huitfeldts gate og langs Lassons gate på vestsiden. Enkelte gårder er blitt omnummerert."},{"page_url":"https://lv.wikipedia.org/wiki/Deniss_Rodmens","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Dennis_Rodman_ToPo.jpg","page_title":"Deniss Rodmens","context_page_description":"Deniss Kīts Rodmens ir bijušais amerikāņu basketbolists, spēlēja vieglā uzbrucēja un spēka uzbrucēja pozīcijās. Savas karjeras laikā spēlējis piecos NBA klubos: Detroitas \\"Pistons\\", Sanantonio \\"Spurs\\", Čikāgas \\"Bulls\\", Losandželosas \\"Lakers\\" un Dalasas \\"Mavericks\\". 1986. gada NBA draftā viņu ar kopējo 27. kārtas numuru izvēlējās Detroitas \\"Pistons\\".\\nIr izcīnījis piecus NBA čempionu titulus, divreiz piedalījies NBA Visu zvaigžņu spēlēs. Viņš bija līgas labākais atlēkušo bumbu savācējs septiņas sezonas pēc kārtas. Tika iekļauts NBA simboliskajā aizsardzības izlasē septiņas reizes un divreiz tika atzīts par līgas labāko aizsargu.\\n2011. gada augustā viņš tika uzņemts basketbola slavas zālē."},{"page_url":"https://es.wikipedia.org/wiki/Jos%C3%A9_Velarde","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/1881-01-30%2C_Madrid_C%C3%B3mico%2C_Jos%C3%A9_Velarde%2C_Cilla_%28cropped%29.jpg","page_title":"José Velarde","context_page_description":"José Velarde Yusti fue un poeta español."},{"page_url":"https://de.wikipedia.org/wiki/Liste_neuer_Bahnh%C3%B6fe_in_den_Niederlanden","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Station_Zaandam_Kogerveld.jpg","page_title":"Liste neuer Bahnhöfe in den Niederlanden","context_page_description":"Die Nederlandse Spoorwegen führten 1970/71 unter dem Namen „Spoorslag '70“ einen Knotenpunktfahrplan ein. Damit war der Aus- und Neubau zahlreicher Bahnhöfe verbunden. Diese Liste enthält die seit 1970 in den Niederlanden neu eröffneten Bahnhöfe."},{"page_url":"https://no.wikipedia.org/wiki/%C3%98rland","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Primula_veris_230405.jpg","page_title":"Ørland","context_page_description":"Ørland er en kommune på Fosenhalvøya i Trøndelag. Den grenser i øst til Åfjord og Indre Fosen kommuner.\\nØrland flystasjon er kommunens og regionens største arbeidsplass. Administrasjonsenteret er Bjugn. Brekstad, som ble erklært som by i 2005, er det regionale handelssenteret og har også andre regionale funksjoner som tingrett og helsetjenester. Landbruket er også dominerende i kommunen, både i landskapsbildet og sysselsettingsmessig.\\nDen mest kjente severdigheten er Austråttborgen, som har en tusenårig historie. Herregården fikk sin nåværende form i 1656.\\nI forbindelse med regjeringen Solbergs kommunereform vedtok Stortinget 8. juni 2017 at Bjugn og Ørland kommuner slås sammen fra 1. januar 2020. Den nye kommunen får navnet Ørland, og kommunesenterfunksjonene skal fordeles mellom de eksisterende administrasjonssentrene Bjugn og Brekstad, men med Bjugn som definert administrasjonssenter."},{"page_url":"https://es.wikipedia.org/wiki/Aidan_Turner","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Aidan_Turner_bearded.jpg","page_title":"Aidan Turner","context_page_description":"Aidan Turner es un actor irlandés, conocido por sus papeles en televisión como Dante Gabriel Rossetti en Desperate Romantics, Ruairí McGowan en The Clinic, y John Mitchell en el drama sobrenatural Being Human. En la pantalla grande interpreta al enano Kíli en las tres partes de la adaptación cinematográfica de la novela El hobbit, de J. R. R. Tolkien. Además, dio vida al personaje de Luke Garroway en la adaptación cinematográfica de Cazadores de sombras: Ciudad de Hueso. Es el protagonista de la nueva versión de \\"Poldark\\" de la BBC, que se estrenó en 2015.\\nSu última actuación conocida es en el filme Loving Vincent de 2017, como el barquero."},{"page_url":"https://tr.wikipedia.org/wiki/Eric_Clapton","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Eric-Clapton_1975.jpg","page_title":"Eric Clapton","context_page_description":"Eric Patrick Clapton, İngiliz Blues gitaristi, şarkıcı ve besteci. Lakabı \\"Slowhand\\"dir.\\nThe Yardbirds, Bluesbreakers, Cream, Blind Faith, Derek and Dominos gibi gruplarda çaldı.\\n\\"Tears In Heaven\\" isimli şarkısıyla 6 dalda Grammy ödülü kazandı."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%99%E1%83%94%E1%83%95%E1%83%98%E1%83%9C_%E1%83%A4%E1%83%90%E1%83%98%E1%83%92%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Kevin_Feige_-_Guardians_of_the_Galaxy_premiere_-_July_2014_%28cropped%29.jpg","page_title":"კევინ ფაიგი","context_page_description":"კევინ ფაიგი — ამერიკელი პროდიუსერი და Marvel Studios-ის პრეზიდენტი 2007 წლიდან. მის მიერ პროდიუსირებული ფილმების საერთო შემოსავალი 26.5 მილიარდ აშშ დოლარს აღემატება. იგი, აგრეთვე ამერიკის პროდიუსერთა გილდიის წევრია.\\nკევინ ფაიგი დაიბადა ბოსტონში, ხოლო გაიზარდა უესტფილდში, (ნიუ-ჯერსი). დაამთავრა უესტფილდის საშუალო სკოლა, შემდგომში კი — სამხრეთ კალიფორნიის უნივერსიტეტი.\\n2019 წელს მიიღო ოსკარის პირველი ნომინაცია ფილმისთვის „შავი პანტერა“ (2018) — Marvel-ის კინოსამყაროს პირველი ფილმი, რომელსაც გადაეცა ოსკარის ჯილდო. იმავე წელს მისი პროდიუსერობით გამოვიდა ფილმი „შურისმაძიებლები: დასასრული“ (2019), რომლის შემოსავალმა 2.7 მილიარდ აშშ დოლარს გადააჭარბა, რითაც იქცა ყველა დროის ყველაზე შემოსავლიან ფილმად, ისევე როგორც ყველაზე შემოსავლიან სუპერგმირულ ფილმად."},{"page_url":"https://en.wikipedia.org/wiki/List_of_defunct_airlines_of_Serbia","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/JAT_Boeing_727_at_Zurich_Airport_in_May_1985.jpg","page_title":"List of defunct airlines of Serbia","context_page_description":"This is a list of defunct airlines of Serbia."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Pers%C3%B6nlichkeiten_der_Stadt_Saarbr%C3%BCcken","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Stephan_toscani.jpg","page_title":"Liste von Persönlichkeiten der Stadt Saarbrücken","context_page_description":"Diese Liste enthält in Saarbrücken geborene Persönlichkeiten sowie solche, die in Saarbrücken ihren Wirkungskreis hatten, ohne dort geboren zu sein. Beide Abschnitte sind jeweils chronologisch nach dem Geburtsjahr sortiert."},{"page_url":"https://de.wikipedia.org/wiki/Markkleeberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Markkleeberg_Bahnhof.jpg","page_title":"Markkleeberg","context_page_description":"Markkleeberg ist eine Große Kreisstadt im Landkreis Leipzig in Sachsen."},{"page_url":"https://pl.wikipedia.org/wiki/Julia_Crawford_Ivers","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/The_Heart_of_Paula_%281916%29_1.jpg","page_title":"Julia Crawford Ivers","context_page_description":"Julia Crawford Ivers – amerykańska producentka, scenarzystka i reżyserka epoki kina niemego.\\nPonieważ starała się unikać mediów i rozgłosu, o jej życiu wiadomo niewiele. W przemyśle filmowym pracowała od 1910 r., kiedy to podjęła pracę dla studia Pallas Pictures, którego współwłaścicielem był jej mąż Oliver Ivers. W studiu tym zajmowała się m.in. pisaniem scenariuszy, ale też wieloma innymi pracami. W latach 1915-1917 nadzorowała produkcję w Bosworth Studios, zajmowała się tam także reżyserią, pisaniem scenariuszy i zarządzaniem finansami.\\nW następnych latach była producentką w Phoplay Company a następnie w Famous Players-Lasky/Paramount zajmowała się reżyserią, produkcją i montażem. Ostatnim wyreżyserowanym przez nią filmem był The White Flower. Po tym filmie porzuciła pracę dla wielkich wytwórni i zaczęła pisać scenariusze jako wolny strzelec. W latach 1916-1922 współpracowała z Williamem Desmondem Taylorem. Kiedy ten został zamordowany, Crawford była jedną z podejrzanych. Opublikowała wtedy artykuł, w którym krytykowała tych, którzy w tym kontekście oczerniali jej imię. Ostatecznie zabójstwo Taylora pozostało niewyjaśnione."},{"page_url":"https://cs.wikipedia.org/wiki/Zemianske_Podhradie","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/R%C3%B8d_r%C3%A6v_%28Vulpes_vulpes%29.jpg","page_title":"Zemianske Podhradie","context_page_description":"Zemianske Podhradie je obec na Slovensku v okrese Nové Mesto nad Váhom. Od okresního města je vzdálena asi 10 kilometrů severním směrem. Ve vzdálenosti přibližně 7 kilometrů severozápadně se od obce nachází státní hranice s Českou republikou. Sousedí s Bošácou, do které plynule přechází, a s Novou Bošácou. Obec leží na východních svazích Bílých Karpat v místech nazývaných Bošácká dolina. Protéká jí potok Bošáčka, který sleduje silniční komunikaci číslo III/061024. Železniční trať tudy není vedena. Lokalita dnešní obce byla osídlena již v paleolitu, ale první písemná zmínka je datována až k roku 1396.\\nObec je rodištěm slovenského spisovatele a zakladatele tamní bibliografie Ľudovíta Vladimíra Riznera. Jeho rodný dům spolu s blízkým atypickým kostelem a sousední bývalou farou, ve které působil slovenský kazatel a národopisec Jozef Ľudovít Holuby, patří mezi místní kulturní památky. K nim se ještě řadí zdejší kaštel včetně parku, jež ho obklopuje, a Riznerův náhrobek na hřbitově."},{"page_url":"https://es.wikipedia.org/wiki/Teselado_pentagonal","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/P5-type3.png","page_title":"Teselado pentagonal","context_page_description":"En geometría, un teselado pentagonal es un tipo de recubrimiento del plano en el que cada pieza individual tiene la forma de un pentágono.\\nLos recubrimientos a base de piezas pentagonales convexas del mismo tamaño se convirtieron en objeto de investigación geométrica a comienzos del siglo XX. Han producido sorprendentes resultados a lo largo de más de cien años, involucrando tanto a matemáticos profesionales como a matemáticos aficionados a través de los artículos de Martin Gardner en la revista Scientific American. En este período, se han ido descubriendo quince tipos de teselados pentagonales monoedrales convexos distintos, estando pendiente a finales del año 2017 la confirmación definitiva de la demostración formulada por el matemático francés Michaël Rao, de que no es posible que exista ningún otro tipo más.\\nUn teselado regular pentagonal en el plano euclidiano es imposible, porque el ángulo interno de un pentágono regular, 108°, no es un divisor de 360°, la medida angular de un círculo completo. A pesar de ello, los pentágonos regulares pueden recubrir tanto una superficie hiperbólica como una esfera."},{"page_url":"https://en.wikipedia.org/wiki/Northwest_Township,_Williams_County,_Ohio","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Indiana-Michigan-Ohio_Tri-Point_Marker.jpg","page_title":"Northwest Township, Williams County, Ohio","context_page_description":"Northwest Township is one of the twelve townships of Williams County, Ohio, United States. The 2000 census found 1,384 people in the township."},{"page_url":"https://no.wikipedia.org/wiki/Qiemo","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/88/Location_of_Qiemo_within_Xinjiang_%28China%29.png","page_title":"Qiemo","context_page_description":"Qiemo eller Qarqan, er et fylke i den autonome region Xinjiang i Folkerepublikken Kina.\\nHovedsetet, også Qiemo og kanskje bedre kjent som Cherchen, er en oaseby på 1200 moh ved elven Cherchen-Darya. Den var av stor betydning for den klassiske Silkeveien, en forgrening av denne gamle handelsveien som valgte å omgå ørkenen Taklamakan på sørsiden.\\nFolketallet var på 52 651 innbyggere i 1999."},{"page_url":"https://no.wikipedia.org/wiki/Matthew_Gubler","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Criminal_Minds_at_Paley.jpg","page_title":"Matthew Gubler","context_page_description":"Matthew Gray Gubler er en amerikansk skuespiller. Han ble kjent i filmen The Life Aquatic, og senere i TV-serien Criminal Minds.\\nThe Life Aquatic With Steve Zissou\\nCriminal Minds\\nRV\\nAlvin og Gjengen\\nThe Great Buck Howard\\nHow To Be A Serial Killer\\nDays of Summer\\nAlvin og Gjengen 2\\nAll Star Superman\\nMagic Valley\\nPornstar"},{"page_url":"https://sv.wikipedia.org/wiki/Fj%C3%A4llspira","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Pedicularis_hirsuta_Kilpisj%C3%A4rvi_2012-07.jpg","page_title":"Fjällspira","context_page_description":"Fjällspira är en växtart i familjen snyltrotsväxter.\\nDen är en flerårig ört som blir upp till 20 centimeter hög. Fjällspira känns lätt igen på kombinationen av nordliga utbredningsområdet och de karaktäristiska blommorna och sågtandade spetsiga bladkanter.\\nStjälken har vitt hår och bladen är smala. Den blommar tidigt, ofta i juni, och de rosa blommorna sitter i ett ax på toppen av stjälken. Växtplatserna är fuktiga och kalkhaltiga och de finns på stenig tundra, havsstränder och flodstränder. Fjällspira är en halvparasit. Det vill säga, den suger näring från rötterna på andra växter, ofta växter i videsläktet.\\nUtbredningsområdet sträcker sig runt Nordpolen, på de isfria landområdena i Arktis, men med ett gap vid Berings sund. Arten finns alltså i nordöstra Kanada, på Grönland, Svalbard och Novaja Zemlja, i de norra delarna av Fennoskandinavien och i Ryssland. Den påträffas mycket sällsynt i Alaska.\\nI Skanderna uppträder fjällspira som en nordlig unicentrisk art och växten påträffas i fjällområdena från Polcirkeln till Väst-finnmark, inklusive delar av de nordligaste delarna av Sverige och Finland."},{"page_url":"https://fr.wikipedia.org/wiki/Yannick_Nyanga","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/July_22%2C_2011_Yannick_Nyanga.jpg","page_title":"Yannick Nyanga","context_page_description":"Yannick Nyanga Kabasele, né le 19 décembre 1983 à Kinshasa, est un joueur de rugby à XV et à sept français. Il évolue au poste de troisième ligne aile en équipe de France et au sein des effectifs de l'AS Béziers, du Stade toulousain, où il passe l'essentiel de sa carrière, de 2005 à 2015, et du Racing 92, où il termine sa carrière de joueur en 2018. Il reste dans ce club pour occuper le poste de directeur sportif dès l'année suivante.\\nIl participe à deux coupes du monde, en 2007 et 2015, et gagne le Tournoi des Six Nations 2006 avec l'équipe de France. En club, il est quatre fois champion de France et remporte la coupe d'Europe avec le Stade toulousain en 2010."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A6%E3%82%BA%E3%83%99%E3%82%AD%E3%82%B9%E3%82%BF%E3%83%B3%E5%B9%B4%E9%96%93%E6%9C%80%E5%84%AA%E7%A7%80%E3%82%B5%E3%83%83%E3%82%AB%E3%83%BC%E9%81%B8%E6%89%8B%E8%B3%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/%D0%A8%D0%B0%D1%86%D0%BA%D0%B8%D1%851.jpg","page_title":"ウズベキスタン年間最優秀サッカー選手賞","context_page_description":"ウズベキスタン年間最優秀サッカー選手賞 はウズベキスタンサッカー連盟 が選出する、1年を通じて最も活躍したウズベク人サッカー選手もしくはウズベク・リーグ所属のサッカー選手に贈られる賞である。"},{"page_url":"https://is.wikipedia.org/wiki/Ducati","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Ducati_749_Dark.jpg","page_title":"Ducati","context_page_description":"Ducati Motor Holding er ítalskt fyrirtæki sem framleiðir mótorhjól. Fyrirtækið var stofnað var árið 1926."},{"page_url":"https://kn.wikipedia.org/wiki/%E0%B2%B5%E0%B2%BF%E0%B2%A6%E0%B3%8D%E0%B2%AF%E0%B2%BE%E0%B2%AD%E0%B3%82%E0%B2%B7%E0%B2%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Vidhyabhushana.jpg","page_title":"ವಿದ್ಯಾಭೂಷಣ","context_page_description":"ಡಾ.ವಿದ್ಯಾಭೂಷಣ, ರು, ಭಕ್ತಿ ಭಾರತೀ ಪ್ರತಿಷ್ಠಾನ್ ಎಂಬ ಸಂಸ್ಥೆಯ ಮೂಲ ಸ್ಥಾಪಕರಲ್ಲೊಬ್ಬರು. ಈ ಪ್ರತಿಷ್ಥಾನ, ಪುರುಂದರದಾಸರ ಆರಾಧನೆ, ದಾಸರ ಪುಣ್ಯದಿನಗಳ ಸಮಯದಲ್ಲಿ ಭಕ್ತಿಸಂಗೀತದ ಕಾರ್ಯಕ್ರಮಗಳನ್ನು ಹಮ್ಮಿಕೊಂಡು ಸುಪ್ರಸಿದ್ಧ ಕಲಾವಿದರಿಂದ ಪ್ರಸ್ತುತಪಡಿಸುತ್ತದೆ."},{"page_url":"https://pt.wikipedia.org/wiki/Conselho_D%C3%A9lfico_Internacional","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Delphichymn.jpg","page_title":"Conselho Délfico Internacional","context_page_description":"IDC News\\nConselho Délfico Internacional é uma organização de beneficência não-governamental. Segundo o site oficial da IDC é a autoridade máxima em todas as questões relativas aos Jogos délficos da era moderna, tanto para os jovens e para adultos.\\nA sede da IDC é em Berlim, Alemanha."},{"page_url":"https://nl.wikipedia.org/wiki/Marillion","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Mosley_2009.jpg","page_title":"Marillion","context_page_description":"Marillion, opgericht in 1979, is een Britse band die voornamelijk progressieve rock maakt.\\nDe groep heeft zich genoemd naar het boek The Silmarillion van J.R.R. Tolkien."},{"page_url":"https://fr.wikipedia.org/wiki/Tallink","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/ff/Victoria_I_Tallinn.jpg","page_title":"Tallink","context_page_description":"Tallink, ou AS Tallink Grupp, est une compagnie maritime estonienne créée en 1989, spécialisée dans le transport de passagers et de véhicules entre l'Estonie, la Finlande, la Suède et la Lettonie. Silja Line fait depuis 2007 partie du Tallink Grupp. L'entreprise est l'une des principales compagnies maritimes en mer Baltique."},{"page_url":"https://de.wikipedia.org/wiki/Leipzig","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Runde_Ecke_Leipzig.jpg","page_title":"Leipzig","context_page_description":"Leipzig ist eine kreisfreie Stadt sowie mit 593.145 Einwohnern die größte Stadt im Freistaat Sachsen und belegte 2019 in der Liste der Großstädte in Deutschland den achten Rang. Für Mitteldeutschland ist sie ein historisches Zentrum der Wirtschaft, des Handels und Verkehrs, der Verwaltung, Kultur und Bildung sowie gegenwärtig ein Zentrum für die „Kreativszene“.\\nLeipzig ist eines der sechs Oberzentren Sachsens und bildet mit der rund 35 Kilometer entfernten Großstadt Halle im Land Sachsen-Anhalt den länderübergreifenden Ballungsraum Leipzig-Halle, in dem etwa 1,1 Millionen Menschen leben. Mit Halle und weiteren Städten in den Ländern Sachsen, Sachsen-Anhalt und Thüringen ist Leipzig Teil der polyzentralen Metropolregion Mitteldeutschland.\\nNach Verleihung des Stadtrechts und der Marktprivilegien um das Jahr 1165 entwickelte sich Leipzig bereits während der deutschen Ostsiedlung zu einem wichtigen Handelszentrum. Leipzigs Tradition als bedeutender Messestandort in Mitteleuropa mit einer der ältesten Messen der Welt geht auf das Jahr 1190 zurück und war eng mit der langjährigen Rolle Leipzigs als internationales Zentrum des Pelzhandels verknüpft."},{"page_url":"https://fr.wikipedia.org/wiki/Millepertuis_%C3%A0_sous","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Hypericum_nummularium.jpg","page_title":"Millepertuis à sous","context_page_description":"Le Millepertuis à sous ou Millepertuis nummulaire est une plante de la famille des Clusiaceae selon la classification classique, ou des Hypericaceae selon la classification phylogénétique."},{"page_url":"https://en.wikipedia.org/wiki/Almorox","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2b/Almorox_Ayuntamiento.jpg","page_title":"Almorox","context_page_description":"Almorox is a municipality located in the province of Toledo, Castile-La Mancha, Spain.\\nAccording to the 2006 census, the municipality had a population of 2371 inhabitants."},{"page_url":"https://en.wikipedia.org/wiki/%C5%A0trbsk%C3%A9_Pleso","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Grandhotel_%C5%A0trbsk%C3%A9_Pleso.jpg","page_title":"Štrbské Pleso","context_page_description":"Štrbské Pleso is a favorite ski, tourist, and health resort in the High Tatras, Slovakia located on the lake by the same name. With extensive parking facilities and a stop on the Tatra trolley and rack railway, it is a starting point for a host of popular hikes including to Kriváň and Rysy."},{"page_url":"https://it.wikipedia.org/wiki/Grotta_dei_Santi","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Grotta_dei_Santi_%28Licodia_Eubea%29_08.jpg","page_title":"Grotta dei Santi","context_page_description":"Il complesso di Grotta dei Santi è un sito rupestre sito del territorio del comune di Licodia Eubea."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9D%D1%96%D0%BA%D0%BE%D0%BB%D0%BE_%D0%9C%D1%96%D0%BA%D0%B5%D1%82%D1%82%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/uk/b/b8/%D0%A1%D0%B0%D0%B4_%D0%B1%D0%B0%D1%80%D0%BE%D0%BA%D0%BE_%D0%86%D1%82%D0%B0%D0%BB%D1%96%D0%B9%D1%81%D1%8C%D0%BA%D0%BE%D0%B3%D0%BE_%D0%BF%D0%B0%D0%BB%D0%B0%D1%86%D1%83.jpg","page_title":"Ніколо Мікетті","context_page_description":"Ніколо Мікетті — італійський архітектор і садівник доби бароко."},{"page_url":"https://pl.wikipedia.org/wiki/Middleton_(Leeds)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Former_Cinema_-_Acre_Road_%28geograph_3203004%29.jpg","page_title":"Middleton (Leeds)","context_page_description":"Middleton – osada w Anglii, w hrabstwie ceremonialnym West Yorkshire, w dystrykcie Leeds. Leży 7 km na południe od centrum miasta Leeds i 267 km na północ od Londynu. W 2001 miejscowość liczyła 21 002 mieszkańców. Middleton jest wspomniana w Domesday Book jako Mildentone/Mildetone."},{"page_url":"https://ga.wikipedia.org/wiki/Philip_Reeve","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Philip_Reeve_-_Lucca_Comics_%26_Games_2016.jpg","page_title":"Philip Reeve","context_page_description":"Is údar Briotanach ficsin é Philip Reeve. Scríobhann sé leabhair do pháistí don chuid is mó."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%B6%8A%E5%8D%97%E6%B0%91%E6%97%8F%E8%A7%A3%E6%94%BE%E8%BF%90%E5%8A%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Statue_of_Phan_Dinh_Phung_2_crop.JPG","page_title":"越南民族解放运动","context_page_description":"越南民族解放運動，又稱越南獨立運動，指的是越南19世紀末至20世紀初這一段時間裡反抗殖民統治、爭取民族解放的一系列獨立運動的統稱。"},{"page_url":"https://es.wikipedia.org/wiki/Saint-Gelven","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Abbaye_Notre-Dame_de_Bon-Repos_%C3%A0_Saint-Gelven_-_C%C3%B4tes_d%27Armor_%2822%29_-_France_-_04.jpg","page_title":"Saint-Gelven","context_page_description":"Saint-Gelven, era una comuna francesa situada en el departamento de Costas de Armor, de la región de Bretaña, que el uno de enero de 2017 pasó a ser una comuna delegada de la comuna nueva de Bon-Repos-sur-Blavet​ al unirse con las comunas de Laniscat y Perret."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-Samson_de_La_Roche-Guyon","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f8/La_Roche-Guyon_Saint-Samson_178.JPG","page_title":"Église Saint-Samson de La Roche-Guyon","context_page_description":"L’église Saint-Samson est une église catholique paroissiale située à La Roche-Guyon, dans le Val-d'Oise. Sa construction commence en 1404, quand le roi Charles VI accorde l'autorisation d'édifier une église paroissiale en dehors du périmètre du château. Or, les travaux sont bientôt interrompus par la guerre de Cent Ans, et ne reprennent que dans le second quart du siècle suivant. L'église est conçue à la base dans le style gothique flamboyant, mais comme souvent au XVIᵉ siècle dans la région, les finitions se font dans le style de la Renaissance. Son plan, assez simple, ne prévoit à l'origine qu'un vaisseau central de cinq travées se terminant par un chevet plat, accompagné de deux bas-côtés, dont la dernière travée se termine par un mur oblique. Le clocher s'élève au-dessus de la première travée du nord. Le bas-côté nord est remanié au XVIIIᵉ siècle, et une série de quatre chapelles latérales est alors ajoutée du côté nord. L'église Saint-Samson a été inscrite aux monuments historiques par arrêté du 4 juin 1926."},{"page_url":"https://de.wikipedia.org/wiki/St._Franz_Xaver_(Gmeinschwenden)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Franz_Xaver_Breher_Gr%C3%B6nenbach.jpg","page_title":"St. Franz Xaver (Gmeinschwenden)","context_page_description":"Die Kapelle in Gmeinschwenden, einem Ortsteil von Bad Grönenbach, ist ein katholischer Sakralbau. Die Kapelle wurde 1885 errichtet und trägt das Patrozinium Franziskus Xaverius."},{"page_url":"https://en.wikipedia.org/wiki/Gymnema_sylvestre","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Gymnema_sylvestre_R.Br_-_Flickr_-_lalithamba.jpg","page_title":"Gymnema sylvestre","context_page_description":"Gymnema sylvestre is a perennial woody vine native to tropical Asia, China, the Arabian Peninsula, Africa, and Australia. It has been used in Ayurvedic medicine. Common names include gymnema, Australian cowplant, and Periploca of the woods, and the Hindi term gurmar, which means \\"sugar destroyer\\".\\nThe leaves and extracts contain gymnemic acids, the major bioactive constituents that interact with taste receptors on the tongue to temporarily suppress the taste of sweetness."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Chimbu_S%C3%A9ng","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Chuave%2C_Chimbu%2C_Papua_New_Guinea.jpg","page_title":"Chimbu Séng","context_page_description":"Chimbu Séng sī Papua New Guinea Soaⁿ-lūn Tōa-khu ê chi̍t ê séng."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B7%D6%80%D5%A6%D5%AB%D5%B6%D5%BD%D5%AF%D5%AB_%D5%AF%D5%B8%D5%AA%D5%B8%D6%82%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/%D0%AD%D1%80%D0%B7%D0%B8%D0%BD_%D0%B4%D0%B5%D0%BC%D0%B4%D1%8D%D1%8D.png","page_title":"Էրզինսկի կոժուն","context_page_description":"Էրզինսկի կոժուն, մունիցիպալ շրջան Ռուսաստանի Դաշնության Տիվա հանրապետությունում։\\nՍտեղծվել է 1975 թվականին։ Վարչական կենտրոնը՝ Էրզին։"},{"page_url":"https://uk.wikipedia.org/wiki/Pteriomorphia","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Argopecten_irradians.jpg","page_title":"Pteriomorphia","context_page_description":"Pteriomorphia — підклас молюсків класу двостулкових. Містить сучасні ряди Arcoida, Limoida, Mytiloida, Ostreoida, Pectinoida і Pterioida та деяку кількість вимерлих родин, таких як Evyanidae, Colpomyidae, Bakevelliidae, Cassianellidae і Lithiotidae. Багато сучасних представників добре відомі — мідії, морські гребінці і устриці.\\nМолюски підкласу Pteriomorpha мають пластинчасті зябри та мешкають на поверхні морського дна. Вони прикріплюються до поверхонь за допомогою біссуса. Одна з ніг редукована, краї мантії не з'єднані. Зябра зазвичай великі та допомагають в харчуванні."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%AE%D1%82%D1%86%D0%B5","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a8/Spreewaldseen_Uetze.jpg","page_title":"Ютце","context_page_description":"Ютце — сільська громада в Німеччині, розташована в землі Нижня Саксонія. Входить до складу району Ганновер.\\nПлоща — 140,56 км². Населення становить 20 260 ос."},{"page_url":"https://fr.wikipedia.org/wiki/Histoire_de_la_bande_dessin%C3%A9e","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Jim_Lee.jpg","page_title":"Histoire de la bande dessinée","context_page_description":"L’histoire de la bande dessinée pour être générale doit au moins être décrite au regard des trois principaux pôles de la création artistique de la bande dessinée, l’Europe qui a vu sa création, les États-Unis à qui nous devons sa popularité et l’Asie qui représente aujourd’hui la plus grosse production de bandes dessinées avec le Japon et la Corée, et remettre la création de la bande dessinée dans le contexte qui l'a vue naître."},{"page_url":"https://es.wikipedia.org/wiki/Malle","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Malle_Castle_de_Renesse_Front_070218.jpg","page_title":"Malle","context_page_description":"Malle es una localidad y municipio de la provincia de Amberes en Bélgica. Sus municipios vecinos son Beerse, Brecht, Lille, Rijkevorsel, Vorselaar y Zoersel. Tiene una superficie de 52,0 km² y una población en 2020 de 15.594 habitantes​, siendo los habitantes en edad laboral el 63% de la población.​ Malle es un importante centro económico de la zona al ser el hogar de varias empresas belgas."},{"page_url":"https://de.wikipedia.org/wiki/Opferkult_der_Azteken","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Aztekenreich-und-Mexiko.JPG","page_title":"Opferkult der Azteken","context_page_description":"Der Opferkult der Azteken stand im Zentrum ihrer Religion. Diese forderte – wie auch die anderer mittelamerikanischer Kulturen – Menschenopfer, um den Lauf der Sonne und den Fortbestand der Welt zu sichern. Die Azteken glaubten, dass das Universum aus dem Kampf zwischen Licht und Dunkelheit entstanden sei. Da die Götter wie Menschen sterblich waren, mussten sie durch Gaben der Menschen ernährt werden."},{"page_url":"https://ast.wikipedia.org/wiki/Bonilla_de_la_Sierra","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Iglesia_de_Bonilla_de_la_Sierra.jpg","page_title":"Bonilla de la Sierra","context_page_description":"Bonilla de la Sierra ye un conceyu de la comarca d'El Barco de Ávila-Piedrahíta, asitiáu nel valle del Corneja, na provincia d'Ávila, Comunidá Autónoma de Castiella y Lleón, n'España. Pertenez al partíu xudicial de Piedrahíta."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8A%D5%A5%D5%BF%D5%A1%D5%AF%D5%A1%D5%B6_%D5%AE%D5%A1%D5%BC%D5%A1%D5%B5%D5%B8%D6%82%D5%A9%D5%B5%D5%B8%D6%82%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Maccari-Cicero.jpg","page_title":"Պետական ծառայություն","context_page_description":"Պետական ծառայություն, պետական ապարատում ընդգրկված քաղաքացիների աշխատանքային գործունեություն։ Որպես վարչաիրավական ինստիտուտ՝ պետական ծառայությունն իրավական նորմերի ամբողջություն է, որը կարգավորում է ծառայության հարաբերությունների ծագման, փոփոխման և դադարեցման, ծառայողների պատասխանատվության և խրախուսման հարցերը։ Կարգավորվում է իրավունքի նորմերով․\\nպետական իրավունք\\nվարչական իրավունք\\nֆինանսական իրավունք և իրավունքի այլ ճյուղերի նորմերով։"},{"page_url":"https://ar.wikipedia.org/wiki/%D9%83%D8%A7%D8%AA%D8%A7%D9%86%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Koshirae_daisho_Met_36.25.1725.jpg","page_title":"كاتانا","context_page_description":"الكاتانا هو سيف ياباني يتميز بشفرة منحنية أحادية الحواف مع حارس دائري أو مربع وقبضة طويلة لاستيعاب اليدين. تم استخدامه من قبل الساموراي في اليابان القديمة والإقطاعية."},{"page_url":"https://en.wikipedia.org/wiki/Hurricane_Manuel","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Deslave_Carretera_Pie_de_la_Cuesta%2C_Sep_2013.jpg","page_title":"Hurricane Manuel","context_page_description":"Hurricane Manuel was the most destructive eastern Pacific tropical cyclone on record. Manuel brought widespread flooding across much of Mexico in September 2013, along with Hurricane Ingrid, which hit the opposite side of the nation the same day as Manuel, the first such occurrence since 1958. The fifteenth named storm and seventh hurricane of the annual hurricane season, Manuel originated from a strong area of low pressure south of Acapulco on September 13. Within favorable conditions aloft, the storm intensified into a tropical storm as it tracked northward. The following day, Manuel curved westward and strengthened to a point just shy of hurricane intensity before making its first landfall at that intensity on September 15. Due to interaction with land, the tropical storm quickly weakened, and its center dissipated over western Mexico on September 16. However, the storm's remnants continued to track northwestward into the Gulf of California, where they reorganized into a tropical cyclone the next day. Manuel regained tropical storm status on September 18 as it began to curve northeastward."},{"page_url":"https://la.wikipedia.org/wiki/Lingua_Latina","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Diane_de_Versailles_Leochares.jpg","page_title":"Lingua Latina","context_page_description":"Lingua Latina, sive sermo Latinus, est lingua Indoeuropaea, qua primum Latini universi et Romani antiqui in primis loquebantur, quamobrem interdum etiam lingua Latia et lingua Romana appellatur. Nomen linguae ductum est a terra, quam gentes Latine loquentes incolebant, Latium vetus interdum appellata, in paeninsula Italica inter Tiberim, Volscos, Appenninum, et mare Inferum sita.\\nCum populi rei publicae Romanae et imperii Romani lingua Latina in rebus publicis privatisque uterentur, etiam lingua Latina linguam Graecam magnopere adfecit, nec minus haec illam. Sicut lingua Graeca, Latina lingua flexiva est, ut nexus verborum non ex ordine appareat, sicut mos est linguis Romanicis et Anglicae, sed ex affixis.\\nUsus linguae Latinae continuo ab antiquitate usque ad tempora hodierna extenditur. Saeculis VII-IX multas peperit linguas quae linguae Romanicae vocantur, sicut Catalanam, Dacoromanicam, Francogallicam, Gallaicam, Hispanicam, Italianam, Lusitanam, ne omnes afferantur."},{"page_url":"https://it.wikipedia.org/wiki/WAGS","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Elisabetta_Canalis_66%C3%A8me_Festival_de_Venise_%28Mostra%29.jpg","page_title":"WAGS","context_page_description":"WAGS è l'acronimo di Wives And Girlfriends ovvero mogli e fidanzate di sportivi famosi, in particolare calciatori. È usato anche al singolare, WAG, per indicare una specifica partner di uno sportivo famoso. Solitamente si tratta di modelle, attrici o starlette televisive che, anche grazie alla loro vicinanza con i compagni sportivi, ottengono maggiore notorietà presso il grande pubblico.\\nIl termine fu usato per la prima volta dai tabloid inglesi per indicare le mogli e le fidanzate dei calciatori della Nazionale di calcio dell'Inghilterra. È entrato nell'uso comune durante i Mondiali di calcio FIFA 2006, anche se il termine era stato coniato in precedenza. L'acronimo da allora è stato utilizzato anche dai giornali negli altri Paesi per descrivere le partner femminili degli sportivi in generale, pur se rimane prevalente l'ambito calcistico."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D1%82%D0%BE%D1%80%D0%BE%D0%B9_%D0%BA%D0%B0%D0%B1%D0%B8%D0%BD%D0%B5%D1%82_%D0%91%D0%BE%D1%80%D0%B8%D1%81%D0%B0_%D0%94%D0%B6%D0%BE%D0%BD%D1%81%D0%BE%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Official_portrait_of_Oliver_Dowden_crop_2.jpg","page_title":"Второй кабинет Бориса Джонсона","context_page_description":"Второй кабинет Бориса Джонсона — 99-е правительство Великобритании, действующее с 13 декабря 2019 года под председательством Бориса Джонсона."},{"page_url":"https://es.wikipedia.org/wiki/Fatou_Diome","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Fatou_Diome_par_Claude_Truong-Ngoc_avril_2015.jpg","page_title":"Fatou Diome","context_page_description":"Fatou Diome es una escritora senegalesa de expresión francesa."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Laign%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Laign%C3%A9-FR-53-%C3%A9glise-01.jpg","page_title":"Laigné","context_page_description":"Laigné sī ūi-tī Hoat-kok Pays de la Loire toā-khu Mayenne koān ê chi̍t ê commune."},{"page_url":"https://en.wikipedia.org/wiki/Wide_shot","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/1963_Cleopatra_trailer_screenshot_%283%29.jpg","page_title":"Wide shot","context_page_description":"In photography, filmmaking and video production, a wide shot is a shot that typically shows the entire object or human figure and is usually intended to place it in some relation to its surroundings. These are typically shot now using wide-angle lenses. However, due to sheer distance, establishing shots and extremely wide shots can use almost any camera type."},{"page_url":"https://fi.wikipedia.org/wiki/Ranitidiini","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Ranitidine_Structural_Formulae.png","page_title":"Ranitidiini","context_page_description":"Ranitidiini on eräs mahahapon eritystä vähentävä lääke. Se on H2-reseptoreja salpaava aine, jota käytetään vatsan liikahappoisuudesta johtuvaan närästykseen.\\nLääkettä alkoi valmistaa ensiksi GlaxoSmithKline-lääkeyhtymä, nimellä Zantac. Nykyään ranitidiinia on saatavilla useilla eri rinnakkaisilla tuotenimillä.\\nSyyskuussa 2019 syöpää aiheuttavaa N-nitrosodimetyyliamiinia löydettiin useiden valmistajien ranitidiinituotteista, tämä johti lääkkeiden markkinoilta vetämiseen muun muassa Suomessa. Huhtikuussa 2020 ranitidiini poistettiin Yhdysvaltojen markkinoilta näiden huolenaiheiden takia."},{"page_url":"https://en.wikipedia.org/wiki/Andrew_Frederick_Gault","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/%22Rokeby%22%2C_A._F._Gault%27s_house%2C_Sherbrooke_Street%2C_Montreal%2C_QC%2C_about_1885.jpg","page_title":"Andrew Frederick Gault","context_page_description":"Andrew Frederick Gault was an Ulster-born Canadian merchant, industrialist, and philanthropist known as the Cotton King of Canada.\\nBorn in Strabane, Ireland, Gault was the youngest son of Leslie Gault, an Anglo-Irish merchant and shipowner in County Tyrone and his wife Mary Hamilton. His mother was from an old family in County Donegal His father was a general trader in Strabane who branched out into shipping, sending emigrant ships to New Brunswick and the United States, to return with timber and grain. In 1841 Leslie Gault lost three ships at sea and also lost money on grain and timber, due to falling markets. In 1842 he himself emigrated with his family to Lower Canada to make a fresh start in Montreal, the mercantile centre of British North America, but nine months later he died of cholera. His widow returned to Ireland. Their son, Mathew Hamilton Gault, aged twenty, took control of the business in Montreal, while Andrew Gault attended the new High School of Montreal.\\nOn leaving school Gault joined the dry-goods firm of Walter McFarlane, and from 1853 to 1858 he was in partnership with James B."},{"page_url":"https://vec.wikipedia.org/wiki/Moltiplegasion","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Three_by_Four.svg","page_title":"Moltiplegasion","context_page_description":"Ła moltiplegasion o moltiplicasion ła xé na de łe quatro operasion fondamentałi del'aritmètega. Ła signifega sumar un nùmaro par sè steso tante volte quante ghe dixe i altri tèrmini del'operasion. Ła sóa operasion inversa ła xé ła divixion.\\nSeguéndo ła scrita:\\ni tèrmini e i se ciama faturi o fatóri, el xé el prodoto. El ségno chel particołarixa st'operasion qua el se ciama par o per. El poe végnare scrito anca e 'ntel'àlgebra de łe łétare se pol anca no scrìvarlo.\\nL'ełemento neutro de ła moltiplegasion el xé l' e moltiplegar qualcosa par el dà sénpre zero.\\nŁe tabełine łe xé na serie de moltiplegasion sénplexe che łe va inparae a memoria a ła scóła ełementare: in xènare łe va da quea del'1 a quea del 10."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A7%D8%AA%D9%88%D9%85%D8%A7%D8%AA%D8%A7%DB%8C_%D8%B3%D9%84%D9%88%D9%84%DB%8C_%D8%B3%D8%A7%D8%AF%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Rule35rand.png","page_title":"اتوماتای سلولی ساده","context_page_description":"اتوماتای سلولی ساده\\nدر ریاضیات و نظریه محسابات، اتوماتای سلولی ساده جزو اتوماتای سلولی یک بعدی می‌باشد به نحوی که مجموعه حالات فقط متشکل از دو حالت باشد و قاعده تعیین حالت یک سلول در گام بعدی، فقط تابعی از حالت فعلی خود آن سلول و دو همسایه مجاورش باشد. این سیستم یکی از ساده‌ترین سیستم‌های محاسبه می‌باشد، با این وجود، یکی از این سیستم‌ها موسوم به قاعده ۱۱۰ هم ارز ماشین محاسبه تورینگ می‌باشد. به این معنی که هر محاسبه ای که بر روی ماشین تورینگ قابل انجام باشد، بر روی قاعده ۱۱۰ هم قابل انجام است."},{"page_url":"https://be.wikipedia.org/wiki/%D0%96%D1%8B%D0%B3%D1%96%D0%BC%D0%BE%D0%BD%D1%82_%D0%9A%D0%B0%D1%80%D0%B0%D0%BB%D1%8C_%D0%A0%D0%B0%D0%B4%D0%B7%D1%96%D0%B2%D1%96%D0%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/%C5%BDygimont_Karal_Radzivi%C5%82._%D0%96%D1%8B%D0%B3%D1%96%D0%BC%D0%BE%D0%BD%D1%82_%D0%9A%D0%B0%D1%80%D0%B0%D0%BB%D1%8C_%D0%A0%D0%B0%D0%B4%D0%B7%D1%96%D0%B2%D1%96%D0%BB_%28M._Starkman%2C_1857%29.jpg","page_title":"Жыгімонт Караль Радзівіл","context_page_description":"Жыгімо́нт Ка́раль Радзіві́л — дзяржаўны і ваенны дзеяч Вялікага Княства Літоўскага, мецэнат. Крайчы і падчашы вялікі літоўскі, ваявода новагародскі.\\nВалодаў Дзераўной, Хотавам, Крашынам, Калдычэвам і Бярозаўцам у Новагародскім ваяводстве, Шыдлоўцам у Польшчы. IV ардынат на Нясвіжы."},{"page_url":"https://en.wikipedia.org/wiki/Central_Expressway_(Dallas)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Central_Expressway_near_NorthPark_Center%2C_Dallas%2C_TX.JPG","page_title":"Central Expressway (Dallas)","context_page_description":"Central Expressway is a north–south highway in Dallas, Texas and surrounding areas. The best-known section is the North Central Expressway, a name for a freeway section of U.S. Highway 75 between downtown Dallas and McKinney, Texas. The southern terminus is at an intersection with \\"hidden\\" Interstate 345 and Woodall Rodgers Expressway. From south of Main Street and its crossing under the Interstate 45 overhead in downtown Dallas, Central Expressway became the South Central Expressway, renamed César Chávez Boulevard on April 9, 2010."},{"page_url":"https://ca.wikipedia.org/wiki/Cos_de_Marines_dels_Estats_Units_d%27Am%C3%A8rica","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/66/E9b_USMC_SM.jpg","page_title":"Cos de Marines dels Estats Units d'Amèrica","context_page_description":"El Cos de Marines dels Estats Units d'Amèrica o Cos d'infanteria de la Marina dels Estats Units és un dels cinc cossos que conformen les Forces Armades dels Estats Units d'Amèrica.\\nÉs el cos més petit que depèn de la Secretaria de Defensa i el segon més petit de les Forces Armades, just per davant del Cos de Guarda Costa dels Estats Units d'Amèrica. El seu potencial és de 180.000 membres en actiu i 40.000 soldats a la reserva."},{"page_url":"https://simple.wikipedia.org/wiki/George_Sand","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Casimir_Dudevant.jpeg","page_title":"George Sand","context_page_description":"Amandine Aurore Lucile Dupin, later Baroness Dudevant, best known by her pseudonym George Sand, was a French novelist and feminist."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_Berlin-Kreuzberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Stolperstein_Ritterstr_123_%28Kreuz%29_Ellen_Roeder.jpg","page_title":"Liste der Stolpersteine in Berlin-Kreuzberg","context_page_description":"Die Liste der Stolpersteine in Berlin-Kreuzberg enthält die Stolpersteine im Berliner Ortsteil Kreuzberg im Bezirk Friedrichshain-Kreuzberg. Sie ist nach Nachnamen sortiert und listet Namen, Standorte und, soweit bekannt, Informationen über den Geehrten.\\nIm Mai/Juni 1996 verlegte Gunter Demnig im Rahmen der NGBK-Ausstellung Künstler forschen nach Auschwitz ohne Genehmigung die ersten 51 Berliner Stolpersteine im Gebiet der Oranienstraße und Dresdener Straße. Der erste dieser Steine und damit auch der überhaupt erste Berliner Stolperstein war der für Lina Friedemann vor dem Eingang Oranienstraße 158. Erst drei Monate später befasste sich aufgrund von Bauarbeiten am Moritzplatz das Kreuzberger Tiefbauamt mit den Stolpersteinen; nachträglich wurden die Verlegungen legalisiert.\\nDas mit dieser einmaligen Verlegungsaktion zunächst eingestellte Projekt wurde erst wieder aufgenommen, nachdem der in Südafrika lebende Enkel eines aus der Naunynstraße verschleppten Ehepaares zufällig auf 1996 verlegte Kreuzberger Stolpersteine gestoßen war und dann die Verlegung von Steinen für seine Großeltern initiierte."},{"page_url":"https://ca.wikipedia.org/wiki/Vaunavais_e_la_Rocheta","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Mairie_Vaunaveys_2011-09-15-090.jpg","page_title":"Vaunavais e la Rocheta","context_page_description":"Vaunaveys-la-Rochette és un municipi francès, situat al departament de la Droma i a la regió d'Alvèrnia-Roine-Alps. L'any 2007 tenia 580 habitants."},{"page_url":"https://pt.wikipedia.org/wiki/Chumbawamba","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Chumbawamba.jpg","page_title":"Chumbawamba","context_page_description":"Chumbawamba foi uma banda inglesa formada em 1982 que começou tocando hardcore punk com uma postura voltada para o anarco-punk.\\nDepois de 25 anos de carreira a banda mudou seu estilo para uma mistura de dance music, world music e folk music, influenciados pelo pop, embora ainda sejam influenciados pela postura política anarquista e irreverente.\\nÉ mais conhecida na América por seu single \\"Tubthumping\\", do álbum Tubthumper, que foi o tema do jogo World Cup 98, da EA.\\nEm 2008, a banda lançou seu décimo terceiro álbum intitulado \\"The Boy Bands Have Won, and All the Copyists and the Tribute Bands and the TV Talent Show Producers Have Won, If We Allow Our Culture to Be Shaped by Mimicry, Whether from Lack of Ideas or from Exaggerated Respect. You Should Never Try to Freeze Culture. What You Can Do Is Recycle That Culture. Take Your Older Brother's Hand-Me-Down Jacket and Re-Style It, Re-Fashion It to the Point Where It Becomes Your Own. But Don't Just Regurgitate Creative History, or Hold Art and Music and Literature as Fixed, Untouchable and Kept Under Glass."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Fontenille","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Fontenille16_mairie.JPG","page_title":"Fontenille","context_page_description":"Fontenille sī ūi-tī Hoat-kok Poitou-Charentes tōa-khu Charente séng ê chi̍t-ê commune."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B0%D1%80%D0%B0%D0%BF%D1%83%D0%B0%D0%BC%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Bandeira_Marapoama.png","page_title":"Марапуама","context_page_description":"Марапуа́ма — муниципалитет в Бразилии, входит в штат Сан-Паулу. Составная часть мезорегиона Сан-Жозе-ду-Риу-Прету. Входит в экономико-статистический микрорегион Нову-Оризонти. Население составляет 2536 человек на 2006 год. Занимает площадь 113,345 км². Плотность населения — 22,4 чел./км²."},{"page_url":"https://en.wikipedia.org/wiki/9th_term_Sejm_and_10th_term_Senate_of_Poland","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Andrzej_So%C5%9Bnierz_Sejm_2016.JPG","page_title":"9th term Sejm and 10th term Senate of Poland","context_page_description":"The 9th term Sejm and the 10th term Senate is the legislature of the Republic of Poland following the 2019 Polish parliamentary election held on 13 October 2019 which returned 460 deputies to the Sejm and 100 senators to the Senate.\\nThe Parliament of Poland held its inaugural meeting on 12 November 2019."},{"page_url":"https://es.wikipedia.org/wiki/Escudo_de_Flix","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Escut_de_Flix.svg","page_title":"Escudo de Flix","context_page_description":"El escudo oficial de Flix​ blasonamiento:\\nEscudo en loseta: de plata, un fresno frutado de sinople. Por timbre, una corona de barón."},{"page_url":"https://cs.wikipedia.org/wiki/Villa_Ehmig","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Villa_Ehmig_%28Kada%C5%88%29_-_detail_fas%C3%A1dy.jpg","page_title":"Villa Ehmig","context_page_description":"Villa Ehmig je vilou v ulici T. G. Masaryka ve vilové čtvrti dříve známé jako Zahradní Město v Kadani. Stavba byla dokončena roku 1929. Autorem projektu je architekt Franz Ehrenberger, který jej vyhotovil na objednávku kadaňského advokáta JUDr. Gustava Ehmiga. Vila nechvalně proslula za druhé světové války jako kancelář zdejšího gestapa. Tomuto účelu nepřestala sloužit ani za dob komunistické totality, kdy byla sídlem okresní správy StB."},{"page_url":"https://no.wikipedia.org/wiki/Den_argentinske_uavhengighetskrigen","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Cruce_Andes_1.jpg","page_title":"Den argentinske uavhengighetskrigen","context_page_description":"Den argentinske uavhengighetskrigen var en rekke konflikter og militære felttog som ble utkjempet for å frigjøre Visekongedømmet Río de la Plata, som besto av det som i dag er Argentina, Uruguay, Paraguay, Bolivia og deler av Chile, fra det spanske styret. Denne krigen var en del av de hispanoamerikanske uavhengighetskrigene, som var en serie selvstendighetskamper i Latin-Amerika som etterfulgte den franske invasjonen av Spania i 1808, som igjen var en del av napoleonskrigene i Europa. Dermed hadde denne konflikten militære og politiske forbindelser med de andre selvstendighetskampene på kontinentet, særlig med den chilenske uavhengighetskrigen, og hærer og statsmenn fra hele kontinentet samarbeidet og kjempet på begge sider av de senere nasjonalgrensene mellom de søramerikanske landene.\\nKrigen i Río de la Plata ble utkjempet mellom 1810 og 1818 mellom argentinske styrker under Manuel Belgrano og José de San Martín mot de spanske og amerikanske rojaliststyrkene, som ville opprettholde det spanske styret. Vi kan skille mellom tre hovedfronter i denne krigen: den nordlige, den østlige og fronten på forsiden av Andesfjellene."},{"page_url":"https://no.wikipedia.org/wiki/Isak_Gustaf_Clason","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Nordiska_museet_2008a.jpg","page_title":"Isak Gustaf Clason","context_page_description":"Isak Gustav Clason var en svensk arkitekt og professor. Han fikk sitt gjennombrudd rundt 1890. Han kom til å fornye den svenske arkitektur ved å velge ekte materialer som stein i fasadene i stedet for gips. Han tegnet rundt århundreskiftet mange overdådige hus i Stockholm, blant annet langs paradegaten Strandvägen i Östermalm. Han stod også for ombyggingen av Tyresö slott i nyskapt 1600-tallsstil.\\nDen norske arktitekten Rudolf Emanuel Jacobsen studerte under Clason og var en tid hans assistent."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%B9%E0%A6%BE%E0%A6%B0%E0%A7%8D%E0%A6%AC%E0%A6%BF_%E0%A6%B9%E0%A6%BF%E0%A6%89%E0%A6%AF%E0%A6%BC%E0%A7%87%E0%A6%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Ranji_1897_page_295_H._T._Hewett.jpg","page_title":"হার্বি হিউয়েট","context_page_description":"হার্বার্ট ট্রেমেনহির হিউয়েট সমারসেটের নর্টন ফিটজওয়ারেন এলাকায় জন্মগ্রহণকারী বিখ্যাত প্রথম-শ্রেণীর ইংরেজ শৌখিন ক্রিকেট তারকা ছিলেন। প্রথম-শ্রেণীর ইংরেজ কাউন্টি ক্রিকেটে সমারসেট, অক্সফোর্ড ও মেরিলেবোন ক্রিকেট ক্লাবের পক্ষে খেলেছেন হার্বি হিউয়েট। দলে তিনি মূলতঃ বামহাতি উদ্বোধনী ব্যাটসম্যান হিসেবে খেলতেন। এছাড়াও মিডিয়াম বোলিং করতেন তিনি।\\n১৮৮৯ থেকে ১৮৯৩ সময়কালে কাউন্টি দলটির পক্ষে অধিনায়কের দায়িত্ব পালন করেছেন। স্বল্প সময়ের মধ্যে সেরা বোলারদের আক্রমণ মোকাবেলা করে দ্রুতলয়ে রান তুলতে তার জুড়ি মেলা ভার ছিল। বলকে শক্তিশালী কব্জির মোচড়ে আঘাত করতে তিনি অদ্বিতীয় ছিলেন। ইংল্যান্ডের অন্যতম সেরা ব্যাটসম্যান হিসেবে বিবেচিত হয়ে আসছেন।\\nহ্যারো স্কুলে অধ্যয়ন করেছেন তিনি। ১৮৮৬ সালে অক্সফোর্ড থেকে ব্লু লাভ করেন। ১৮৮৪ সাল থেকে সমারসেটের পক্ষে খেলতে শুরু করেন হার্বি হিউয়েট। শুরুতে মাঝারীসারির ব্যাটসম্যান হিসেবে খেলেন। তবে ঐ সময়ে তার খেলা ছন্দবিহীন অবস্থায় ছিল। তাস্বত্ত্বেও ১৮৮৯ সালে থেকে ১৮৯৩ সময়কালে কাউন্টি দলটির পক্ষে অধিনায়কের দায়িত্ব পালন করেছেন।\\nঅধিনায়ক হিসেবে দায়িত্ব লাভের পরবর্তী দুই বছরে সুন্দর নেতৃত্বের মাধ্যমে ও উদ্বোধনী ব্যাটসম্যান হিসেবে কাউন্টি দলকে প্রথম-শ্রেণীর খেলায় অংশগ্রহণের মর্যাদায় প্রভূতঃ ভূমিকা রাখেন।"},{"page_url":"https://ca.wikipedia.org/wiki/Fusell_de_forrellat","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/04/En-Kar98k_rifle.jpeg","page_title":"Fusell de forrellat","context_page_description":"Un fusell de forrellat és un fusell que es carrega manualment mitjançant l'accionament d'una palanca incorporada al forrellat del fusell o carrabina. Va rebre aquest nom per la seva similitud amb el forrellat emprat a les portes de les cases.\\nPer a carregar l'arma, s'obre el forrellat, s'introdueix el cartutx i es torna a tancar el forrellat. Un cop disparada l'arma, es torna a obrir el forrellat i s'extreu la beina.\\nEncara que en el segle xxi, el fusell de forrellat ha estat substituït pels fusells semiautomàtics i el fusell d'assalt, el de forrellat segueix sent preferit per les armes de precisió, com els fusell de franctirador i les usades en el tir esportiu i la caça, a causa que són comparativament més fàcils de produir, desarmar i rearmar. El mecanisme també es troba en algunes escopetes i en pistoles de tir esportiu."},{"page_url":"https://de.wikipedia.org/wiki/%C3%96sterreichische_Eurom%C3%BCnzen","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/25_Euro_%C3%96sterreich_2007_%C3%96sterreichische_Luftfahrt_98.jpg","page_title":"Österreichische Euromünzen","context_page_description":"Die österreichischen Euromünzen sind die in Österreich ab 1. Jänner 2002 in Umlauf gebrachten Euromünzen der gemeinsamen europäischen Währung Euro. Der Euro ist seit dem 1. Jänner 1999 in Österreich gültig."},{"page_url":"https://es.wikipedia.org/wiki/Clappertonia","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Curtis%27s_botanical_magazine_%28Tab_7836%29_%288346195785%29.jpg","page_title":"Clappertonia","context_page_description":"Clappertonia es un género de fanerógamas con tres especies perteneciente a la familia Malvaceae. Es originario de los trópicos de África y América. Fue descrito por Carl Daniel Friedrich Meissner y publicado en Plantarum vascularium genera secundum ordines ... 1: 36, en el año 1837.​"},{"page_url":"https://en.wikipedia.org/wiki/President_of_the_European_Council","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Charles_Michel_%2849467991288%29.jpg","page_title":"President of the European Council","context_page_description":"The president of the European Council is the person presiding over and driving forward the work of the European Council, as well as a principal representative of the European Union on the world stage. This institution comprises the college of heads of state or government of EU member states as well as the president of the European Commission, and provides political direction to the European Union.\\nFrom 1975 to 2009, the head of the European Council was an unofficial position held by the head of state or government of the member state holding the semiannually rotating presidency of the Council of the European Union at any given time. However, since the 2007 Treaty of Lisbon, article 15 of Treaty on European Union states that the European Council appoints a full-time president for a two-and-a-half-year term, with the possibility of renewal once. Appointments, as well as the removal of incumbents, require a double majority support in the European Council.\\nOn 19 November 2009, the European Council agreed that its first president under the Lisbon Treaty would be Herman Van Rompuy."},{"page_url":"https://id.wikipedia.org/wiki/Stasiun_MRT_Pasir_Ris","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/MRT_Singapore_Destination_1.png","page_title":"Stasiun MRT Pasir Ris","context_page_description":"Stasiun MRT Pasir Ris adalah stasiun konstruksi melayang dari MRT Singapura di Jalur Timur Barat. Berlokasi di pusat kota Pasir Ris dan merupakan stasiun terakhir di ujung timur jalur ini."},{"page_url":"https://sl.wikipedia.org/wiki/Roberta_Bondar","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Roberta_Bondar_NASA.jpg","page_title":"Roberta Bondar","context_page_description":"Roberta Lynn Bondar O.C., O.Ont, F.R.C.P., kanadska nevrobiologinja, zdravnica patologinja in nevrologinja, astronavtka ter akademikinja, * 4. december 1945, Sault Ste. Marie, Ontario.\\nLeta 1968 je diplomirala iz zoologije in agronomija na Univerzi v Guelphu, leta 1971 končala magisterij iz eksperimentalne patologije na Univerzi Zahodnega Ontaria in leta 1974 doktorirala iz nevrobiologije na Univerzi v Torontu ter leta 1977 še iz medicine na Univerzi McMaster.\\nLeta 1981 je postala članica Kraljevega kolidža zdravnikov in kirurgov Kanade iz nevrobiologije.\\nTri leta pozneje, leta 1984, je začela astronavtsko urjenje. V vesolje je bila poslana kot del Nasine misije STS-42. Kasneje je več kot desetletje delovala kot vodja ekipe znanstvenikov, ki so s pomočjo podatkov o telesnih funkcijah astronavtov preučevali sposobnost obnove človeškega telesa po izpostavitvi pogojem kakršni vladajo med vesoljskimi poleti.\\nMed letoma 2003 in 2009 je bila kanclerka Univerze Trent."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1870","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Lu%C3%ADs_de_Saxe-Coburgo_e_Bragan%C3%A7a.jpg","page_title":"Lijst van personen geboren in 1870","context_page_description":"Dit is een lijst van personen die geboren zijn in 1870.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://hu.wikipedia.org/wiki/Bonn","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Altes_Rathaus_Bonn.jpg","page_title":"Bonn","context_page_description":"Bonn Németország 19., Észak-Rajna–Vesztfália 9. legnagyobb városa, amely Észak-Rajna-Vesztfália tartományban, Kölntől nagyjából 20 kilométerre délre, a Rajna partján helyezkedik el. 1949 és 1990 között az NSZK fővárosa, illetve a német kormány központja egészen 1999-ig; időközben a német parlament házai, a Bundestag és a Bundesrat is elköltöztek Bonnból azóta, hogy a német államfő, a Bundespräsident is áttette székhelyét. Ennek ellenére továbbra is fontos politikai központ maradt, számos közintézménnyel. Durván a fele a kormányhivataloknak megőrizte bonni székhelyét, amelyet ma sokan a szövetségi városnak neveznek."},{"page_url":"https://vi.wikipedia.org/wiki/Macleaya_microcarpa","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Feuilles_vertes_au_soleil.jpg","page_title":"Macleaya microcarpa","context_page_description":"Macleaya microcarpa là một loài thực vật có hoa trong họ Anh túc. Loài này được Fedde mô tả khoa học đầu tiên năm 1905."},{"page_url":"https://fr.wikipedia.org/wiki/Spermophile_de_Richardson","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Richardson%27s-Ferocity-Szmurlo.jpg","page_title":"Spermophile de Richardson","context_page_description":"Le Spermophile de Richardson, appelé aussi Écureuil terrestre de Richardson est une espèce de rongeurs de la famille des Sciuridés vivant en Amérique du Nord.Il creuse de large tunnel complique dans la terre."},{"page_url":"https://pl.wikipedia.org/wiki/Jewhen_Past","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Yevhen_Past.jpeg","page_title":"Jewhen Past","context_page_description":"Jewhen Serhijowycz Past, ukr. Євген Сергійович Паст – ukraiński piłkarz, grający na pozycji bramkarza."},{"page_url":"https://fi.wikipedia.org/wiki/Wes_Brown","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/W_Brown.jpg","page_title":"Wes Brown","context_page_description":"Wesley Michael Brown on englantilainen jalkapalloilija, joka on edustanut urallaan Englannin Valioliigassa muun muassa Manchester Unitedia ja Sunderlandia. Hän on pelipaikaltaan puolustaja.\\nBrown teki harjoittelijasopimuksen Unitedin kanssa kesällä 1996, ja ammattilaissopimuksen jo neljää kuukautta myöhemmin, 4. marraskuuta 1996. Koko uransa Manchester Unitedissa pelannut Brown teki debyyttinsä joukkueessa 4. toukokuuta 1998 ottelussa Leedsia vastaan, tullen vaihdosta kentälle. Seuraavalla kaudella Brown oli mukana voittamassa triplaa Unitedin kanssa. Brown oli kehittymässä loistavaksi puolustajaksi ja oli viemässä avauspaikan Unitedissa, mutta juuri ennen kauden 1999–2000 alkua Brown loukkasi polvensa ristisiteet harjoituksissa, ja häneltä jäi väliin käytännössä koko kausi.\\nKausi 2000–2001 oli Brownille erinomainen. Hän muodosti Jaap Stamin kanssa liigan pitävimmän toppariparin ja United voitti Valioliigan. Brown palkittiin uudella neljän vuoden jatkosopimuksella. Samalla joukkueen manageri Sir Alex Ferguson kehui Brownin hienoja esityksiä."},{"page_url":"https://en.wikipedia.org/wiki/Edo_Vanni","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Edo_Vanni_1957_coach.jpg","page_title":"Edo Vanni","context_page_description":"Edo Joe Vanni was an American player, coach, manager and front office executive in minor league baseball. A lifelong resident of the Seattle area, he was called \\"the face of Seattle baseball\\" upon his death, at 89, of heart failure in Bellevue, Washington, on April 30, 2007."},{"page_url":"https://de.wikipedia.org/wiki/Firehole_River","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/ca/FireholeRiverFountainFlats0904.jpg","page_title":"Firehole River","context_page_description":"Der Firehole River ist ein Fluss im Südwesten des Yellowstone-Nationalparks in den Vereinigten Staaten. Er gehört zum Missouri-Mississippi-Flusssystem als Quellfluss dessen längsten Zweiges.\\nDer Fluss entspringt an der nordamerikanischen kontinentalen Wasserscheide im Inneren der Caldera des Yellowstone-Vulkans und verläuft in nördlicher Richtung 45 km bis zum Zusammenfluss mit dem Gibbon River, mit dem zusammen er dann den Madison River bildet. Dabei passiert der Firehole River das Obere Geysir-Becken mit dem Old Faithful, einem der bekanntesten Geysire der Erde, sowie vier weitere kleinere Geysir-Becken und eine Reihe weiterer geothermaler Gebiete, deren Abfluss er aufnimmt. Kurz vor dem Zusammenfluss passiert der Fluss den Firehole Canyon mit den Firehole Falls, Wasserfällen im Canyon. Weitere, kleinere Wasserfälle sind die Keppler Cascades am Oberlauf. Nennenswerte Zuflüsse sind linksseitig der Little Firehole River und der Fairy Creek, die beide den Calderarand im Bereich des Madison Plateaus entwässern, sowie rechtsseitig der Nez Perce Creek, der aus dem Central Plateau des Parkgebietes entspringt."},{"page_url":"https://en.wikipedia.org/wiki/St_Edwen%27s_Church,_Llanedwen","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/St._Edwen%27s_church.jpg","page_title":"St Edwen's Church, Llanedwen","context_page_description":"St Edwen's Church, Llanedwen is a 19th-century parish church near the Menai Strait, in Anglesey, north Wales. The first church was founded here by St. Edwen in 640, but the present structure dates from 1856 and was designed by Henry Kennedy, the architect of the Diocese of Bangor. It contains some memorials from the 17th and 18th centuries and a reading desk that reuses panel work from the 14th and 17th centuries. The 18th-century historian Henry Rowlands was vicar here, and is buried in the churchyard. The church is on land that forms part of the Plas Newydd estate, home of the family of the Marquess of Anglesey since 1812 and owned by the National Trust. Some of the Marquesses of Anglesey, and some of their employees, are also buried in the churchyard.\\nThe church is used for worship by the Church in Wales, one of seven in a combined parish. A service is held using the Book of Common Prayer each Sunday morning. St Edwen's is one of the few churches in regular use in Wales to be lit entirely by candles."},{"page_url":"https://en.wikipedia.org/wiki/Hellenistic_period","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Zeus_Ammon_%28Antikensammlung_M%C3%BCnchen%29.jpg","page_title":"Hellenistic period","context_page_description":"The Hellenistic period covers the period of Mediterranean history between the death of Alexander the Great in 323 BC and the emergence of the Roman Empire as signified by the Battle of Actium in 31 BC and the conquest of Ptolemaic Egypt the following year. The Greek word Hellas was originally the widely-recognized name of Greece, from which the word Hellenistic was derived.\\nDuring the Hellenistic period Greek cultural influence and power reached the peak of its geographical expansion, being dominant in the Mediterranean world and most of West and Central Asia, even in parts of the Indian subcontinent, experiencing prosperity and progress in the arts, exploration, literature, theatre, architecture, music, mathematics, philosophy, and science. It is often considered a period of transition, sometimes even of decadence or degeneration, compared to the enlightenment of the Greek Classical era. The Hellenistic period saw the rise of New Comedy, Alexandrian poetry, the Septuagint and the philosophies of Stoicism, Epicureanism, and Pyrrhonism. Greek science was advanced by the works of the mathematician Euclid and the polymath Archimedes."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D9%88%D8%A7%D8%AD%D8%A7%D8%AA_%D8%A7%D9%84%D8%AF%D8%A7%D8%AE%D9%84%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Flickr_-_Argenberg_-_2007-05-232.jpg","page_title":"الواحات الداخلة","context_page_description":"الواحات الداخلة وتختزل إلى الداخلة، أحد واحات الصحراء الكبرى ومركز يتبع محافظة الوادي الجديد بمصر. تمتد نحو 80 كم من الشرق إلى الغرب و25 كم من الشمال إلى الجنوب. وتقع على الطريق الواصل بين الفرافرة شمالا والخارجة شرقا."},{"page_url":"https://de.wikipedia.org/wiki/Bolide_(Automarke)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Bolide_1904_Two_Seater_in_Staplefield_on_London_to_Brighton_VCR_2006.jpg","page_title":"Bolide (Automarke)","context_page_description":"Bolide war der Markenname eines französischen Herstellers von Automobilen."},{"page_url":"https://sk.wikipedia.org/wiki/Palcmansk%C3%A1_Ma%C5%A1a_(vodn%C3%A1_n%C3%A1dr%C5%BE)","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f2/Dedinky_and_Palcmanska_masa.jpg","page_title":"Palcmanská Maša (vodná nádrž)","context_page_description":"Palcmanská Maša je najväčšia vodná nádrž na území Slovenského raja, vytvorená na hornom toku rieky Hnilec, v kotlinovitom rozšírení údolia pod južnými skalnatými zrázmi Geráv.\\nNa jej brehoch vyrástli ubytovacie, športové a rekreačné zariadenia. Priamo na jazere sú umiestnené zariadenia rybného hospodárstva.\\nPri brehoch vodnej nádrže Palcmanská Maša vznikla v roku 1933 zlúčením obcí Imrichovce a Štefanovce obec Dedinky.\\nÚčelom nádrže je akumulovanie vody pre zabezpečenie prívodu k vodnej elektrárni v Dobšinej, vyrovnanie prietokov Hnilca a rekreačné využitie.\\nNádrž sa nachádza v údolí rieky Hnilec nad miestnou časťou obce Mlynky, Palcmanskou Mašou. Vznikla vybudovaním betónovej gravitačnej priehrady na Hnilci v rkm 71,350. Pri dosiahnutí maximálnej hladiny 786,10 m n. m. je v nádrži akumulovaných 11,063 mil. m³ vody a je zatopená plocha o rozlohe 86,5 ha. Dĺžka vzdutia dosahuje 3,9 km. Nádrž je dôležitou súčasťou prečerpávacej vodnej elektrárne Dobšiná, prvej prečerpávacej elektrárne na Slovensku."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_%C4%8Destn%C3%BDch_ob%C4%8Dan%C5%AF_m%C4%9Bsta_Kladna","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Portret_Prins_Vladimir_Clementis%2C_Bestanddeelnr_934-6773_%28cropped%29.jpg","page_title":"Seznam čestných občanů města Kladna","context_page_description":"Seznam čestných občanů města Kladna je chronologický seznam osobností které obdržely titul Čestné občanství nebo jiná ocenění města Kladna."},{"page_url":"https://es.wikipedia.org/wiki/Bluebird-Proteus_CN7","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Goodwood_Airfield_-_geograph.org.uk_-_80659.jpg","page_title":"Bluebird-Proteus CN7","context_page_description":"El Bluebird-Proteus CN7 es un vehículo propulsado por una turbina de gas conducido por Donald Campbell. Consiguió el récord mundial de velocidad en tierra sobre el lecho del Lago Eyre en Australia el 17 de julio de 1964. El vehículo elevó el récord de la FIA sobre un recorrido de una milla a la velocidad de 403,10 millas por hora."},{"page_url":"https://de.wikipedia.org/wiki/Oligoz%C3%A4n","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9a/Entelodon_Sp_Illustration.jpg","page_title":"Oligozän","context_page_description":"Das Oligozän ist in der Erdgeschichte eine chronostratigraphische Serie innerhalb des Systems des Paläogens, früher des Tertiärs. Der Beginn des Oligozäns liegt bei etwa 33,9 Millionen Jahren, es endete vor etwa 23,03 Millionen Jahren. Dem Oligozän folgte das Miozän und ihm ging das Eozän voraus."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B8%D1%80_(%D0%BA%D0%BE%D0%BA%D1%82%D0%B5%D0%B9%D0%BB%D1%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Kir_cocktail.jpg","page_title":"Кир (коктейль)","context_page_description":"«Кир» — коктейль-аперитив, изобретённый в Бургундии в первой половине XX века. Представляет собой смесь белого сухого вина и чёрносмородинового ликёра Creme de Cassis. Входит в число официальных коктейлей Международной ассоциации барменов, категория «Современная классика»."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B1%D8%B2%D9%87%D8%A7%DB%8C_%D9%86%D8%A7%D9%85%DB%8C%D8%AF%D9%87%E2%80%8C%D8%B4%D8%AF%D9%87_%D8%A8%D9%87_%D9%86%D8%A7%D9%85_%D8%A7%D8%B4%D8%AE%D8%A7%D8%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Kronprincess_Margareta_%28Austin1999%29.jpg","page_title":"رزهای نامیده‌شده به نام اشخاص","context_page_description":"فهرست رقم‌های کشاورزی که به نام شخصیت‌های حقیقی و داستانی نام گذاری شده‌اند به شرح زیر است:"},{"page_url":"https://he.wikipedia.org/wiki/%D7%A1%D7%99%D7%A0%D7%99%D7%A1%D7%98%D7%A8_%D7%92%D7%99%D7%99%D7%98%D7%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Avenged-Sevenfold-BergenCalling-2011-Christian_Misje-5510.jpg","page_title":"סיניסטר גייטס","context_page_description":"בריאן אלווין היינר ג'וניור, הידוע בשם סיניסטר גייטס, הוא הגיטריסט הראשי של להקת הרוק Avenged Sevenfold."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A8%E3%83%89%E3%83%AF%E3%83%BC%E3%83%89%E3%83%BB%E3%82%A8%E3%83%AB%E3%82%AC%E3%83%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Fritz_Kreisler_2.jpg","page_title":"エドワード・エルガー","context_page_description":"初代準男爵サー・エドワード・ウィリアム・エルガーは、イングランドの作曲家、指揮者。もとは音楽教師でありヴァイオリニストでもあった。\\nエルガーが遺した楽曲の多くは母国イギリスのみならず、世界中の演奏会で取り上げられている。中でも最もよく知られるのは『エニグマ変奏曲』や行進曲『威風堂々』、ヴァイオリン協奏曲、チェロ協奏曲、2曲の交響曲などである。また、『ゲロンティアスの夢』をはじめとする合唱作品、室内楽曲や歌曲も作曲した。\\n1904年にナイト、1931年准男爵に叙されている。1924年からは国王の音楽師範を務めた。"},{"page_url":"https://no.wikipedia.org/wiki/Aden","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Stamp_Aden_1953_20sh.jpg","page_title":"Aden","context_page_description":"Aden er en havneby i Jemen. På dette sted var det bosetting fra en gang mellom 400-tallet og 600-tallet f.Kr. Byen har to deler: Havnebyen, som er den moderne byen, og Madinat ash-Sha'b, som er gamlebyen og der regjeringsbygningene befant seg. Forstedene Khormaksar og Sheikh Othman ligger nord for gamlebyen, og mellom dem ligger Adens internasjonale flyplass. Aden var hovedstad i Syd-Jemen. Etter at Jemen og Sydjemen ble forent har Aden blitt en tollfri sone."},{"page_url":"https://ca.wikipedia.org/wiki/St_James%27s","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/BPheadoffice.JPG","page_title":"St James's","context_page_description":"St James's és un barri del districte de Ciutat de Westminster de Londres, Anglaterra. Limita al nord amb Piccadilly, a l'oest amb Green Park, al sud amb The Mall i St James's Park i a l'est amb el Haymarket."},{"page_url":"https://en.wikipedia.org/wiki/World_Archery_Federation","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Archery_at_the_2012_Summer_Paralympics_%288238934528%29.jpg","page_title":"World Archery Federation","context_page_description":"The World Archery Federation is the governing body of the sport of archery. It is based in Lausanne, Switzerland. It is composed of 156 national federations and other archery associations, and is recognised by the International Olympic Committee."},{"page_url":"https://it.wikipedia.org/wiki/L%C3%AD%C5%A1%C5%A5any_(%C3%9Ast%C3%AD_nad_Labem)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/L%C3%AD%C5%A1%C5%A5any_n%C3%A1ves.jpg","page_title":"Líšťany (Ústí nad Labem)","context_page_description":"Líšťany è un comune della Repubblica Ceca facente parte del distretto di Louny, nella regione di Ústí nad Labem."},{"page_url":"https://de.wikipedia.org/wiki/Sabaton","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Hellfest2017Sabaton_04.jpg","page_title":"Sabaton","context_page_description":"Sabaton ist eine schwedische Heavy-Metal-Band aus Falun, die sich im Jahre 1999 formierte. Der weitaus größte Teil der Lieder von Sabaton beschäftigt sich mit militärhistorischen Themen, von denen viele in einer Verbindung zum Ersten oder Zweiten Weltkrieg stehen. Der Name „Sabaton“ bezeichnet einen Eisenschuh, der im Mittelalter oftmals als Teil der Ritterrüstung getragen wurde. Sämtliche Stücke der Band, abgesehen von Ruina Imperii, sind auf Englisch erschienen, zudem ist das gesamte Album Carolus Rex ebenfalls in schwedischer Sprache erschienen. Des Weiteren covert die Band gelegentlich deutsch- und schwedischsprachige Stücke und fügt gelegentlich anderssprachige, oft lateinische, Textzeilen ein."},{"page_url":"https://pt.wikipedia.org/wiki/Krittika","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Pleiades_large_ru.jpg","page_title":"Krittika","context_page_description":"Krittika é a terceira nakshatra da lista clássica do ciclo lunar na astrologia hindu, declinação 26°40' - 10 °, corresponde às Plêiades - um aglomerado estelar aberto na constelação de Touro."},{"page_url":"https://vi.wikipedia.org/wiki/Kayak","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Ready_for_the_throw_Curtis_LOC.JPG","page_title":"Kayak","context_page_description":"Kayak là một chiếc thuyền tương đối nhỏ hẹp, được điều khiển hoàn toàn bằng sức người, thiết kế chủ yếu để được tự đẩy bằng mái chèo tay. Kayak truyền thống có một boong với một hoặc nhiều buồng lái, mỗi chỗ ngồi có một tay chèo. Buồng lái được bao phủ bởi một nắp boong để ngăn sự xâm nhập của nước từ sóng hoặc tia nước, giúp cho những người chơi kayak lâu năm cảm thấy thoải mái khi thực hiện kĩ năng \\"cuộn kayak\\", một động tác lật phải kayak mà nắp boong sẽ giúp cho nước không tràn vào boong.\\nMột số loại thuyền kayak hiện đại thay đổi đáng kể so với thiết kế truyền thống nhưng vẫn giữ thiết kế cơ bản của một chiếc kayak, ví dụ trong việc loại bỏ buồng lái của các chỗ ngồi chèo trên thuyền; buồng không khí xung quanh thuyền được làm phồng lên; thay thế vỏ đơn bằng vỏ đôi, và thay thế mái chèo bằng tay với các thiết bị hỗ trợ khác, ví dụ như cánh quạt chạy bằng động đạp bằng chân. Kayak cũng dần trở thành một loại thuyền, bằng việc được đẩy bằng động cơ điện nhỏ, thậm chí cả các thiết bị khí động học được lắp thêm bên ngoài."},{"page_url":"https://en.wikipedia.org/wiki/Jean-Jacques_Barth%C3%A9lemy","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Barth%C3%A9l%C3%A9my_M%C3%A9dailles_ph%C3%A9niciennes.jpg","page_title":"Jean-Jacques Barthélemy","context_page_description":"Jean-Jacques Barthélemy was a French scholar who became the first person to decipher an extinct language. He deciphered the Palmyrene alphabet in 1754 and the Phoenician alphabet in 1758."},{"page_url":"https://cy.wikipedia.org/wiki/Penmaenmawr","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Penmaenmawr_%26_Foel_Lus_-_geograph.org.uk_-_3153833.jpg","page_title":"Penmaenmawr","context_page_description":"Mae Penmaenmawr yn dref ym mhlwyf Dwygyfylchi, yng ngogledd-orllewin Sir Conwy, gogledd Cymru, poblogaeth tua 4,000. Mae'n dref glan môr sydd wedi tyfu o gwmpas y chwarel, ond nid oes llawer o bobl yn gweithio yn y chwarel bellach. Mae'n sefyll ar arfordir y gogledd rhwng tref Conwy a Bangor, ar yr A55. Mae Caerdydd 205.4 km i ffwrdd o Penmaenmawr ac mae Llundain yn 325 km. Y ddinas agosaf ydy Bangor sy'n 14.8 km i ffwrdd.\\nMae ganddi orsaf ar Reilffordd Arfordir Gogledd Cymru. Mae iddi dri ward, pob un a'i gymeriad ei hun; Penmaenan yn y gorllewin, Pant-yr-afon yn y canol a phentref Dwygyfylchi yn y dwyrain.\\nBu newid mawr yn sgîl creu'r lôn ddeuol newydd, yr \\"Expressway\\" yn y 1980au, pan gollodd y dref ran helaeth o'i phromenâd cyfnod Edwardaidd oedd yn boblogaidd gan bobl leol ac ymwelwyr fel ei gilydd, ond codwyd un newydd yn ei le. Mae Penmaenmawr yn nodedig am ei llwybrau cerdded ar y bryniau a'i golygfeydd hardd. Mae Bwlch Sychnant yn denu ymwelwyr."},{"page_url":"https://en.wikipedia.org/wiki/Norma_Jean_(band)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Norma_Jean.jpg","page_title":"Norma Jean (band)","context_page_description":"Norma Jean is an American metalcore band from Douglasville, Georgia, a suburb of Atlanta. Since their inception in 1997, numerous line up changes have left the band with no original members. To date, Norma Jean has released eight studio albums and received a Grammy Award nomination in 2006 for Best Recording Package for their second album O God, the Aftermath. The band's name is derived from the real name of actress Marilyn Monroe."},{"page_url":"https://la.wikipedia.org/wiki/Ferdinandus_Columbus","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Hernando_Col%C3%B3n_signature.jpg","page_title":"Ferdinandus Columbus","context_page_description":"Vide etiam paginam discretivam: Columbus\\nFerdinandus Columbus sive Hispanice Hernando Colón, filius quem Christophoro Columbo Beatrix Enríquez de Arana peperit, fuit bibliophilus et patris biographus. Illa vita Hispanice scripta post mortem auctoris ab Alphonso Ulloa Italiane versa anno 1571 titulo Historie edita est. Documenta congerere incepit ad descriptionem et cosmographiam Hispaniae conscribendam. Bibliotheca Columbina a Ferdinando Columbo conlecta partim sub tutela archidioecesis Hispalensis servatur."},{"page_url":"https://sv.wikipedia.org/wiki/Willem_van_Aelst","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Flower_still_life_with_a_watch_by_Willem_van_Aelst.jpg","page_title":"Willem van Aelst","context_page_description":"Willem van Aelst, född 1625 i Delft och död i Amsterdam omkring 1683 var en holländsk konstnär.\\nWillem van Aelst var brorson och elev till konstnären Evert van Aelst. Han var 1645-1656 verksam i Frankrike och\\nItalien. I Italien arbetade han åt storhertigen av Toscana. Där umgicks han med Otto Marseus van Schrieck som influerade hans måleri.\\nHans sätt att måla blomsterstilleben är framförallt påverkad av Jan Davidszoon de Heem. van Aelst målade även andra sorters stilleben, exempelvis jakt-parafernalia. På en del av van Aelst målningar framstår i dag bladverken som blå. Det beror på att van Aelst använde sig av en teknik där han först målade bladen blå och sedan la på tunna lasyrer för att få dom gröna. Dessa lasyrer har ibland slitits bort med tiden.\\nWillem van Aelst hade som målare stor ekonomisk famgång. Han skall ha ägt ett hus på Prinsengracht i Amsterdam, vilket även då var en mycket fin adress. van Aelst var lärare åt Rachel Ruysch. Han finns representerad vid bland annat Göteborgs konstmuseum och Nationalmuseum i Stockholm."},{"page_url":"https://it.wikipedia.org/wiki/Masfjorden","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Haugsv%C3%A6rsfjorden.JPG","page_title":"Masfjorden","context_page_description":"Masfjorden è un comune norvegese della contea di Vestland."},{"page_url":"https://es.wikipedia.org/wiki/Liga_de_Campeones_de_la_UEFA_2017-18","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Kyiv_NSC_Olimpiyskyi_5.jpg","page_title":"Liga de Campeones de la UEFA 2017-18","context_page_description":"La Liga de Campeones de la UEFA 2017–18 fue la 63.ª edición de la competición. La final se disputó en el Estadio Olímpico de Kiev de Kiev, Ucrania, el 26 de mayo de 2018.\\nEl Real Madrid, que había ganado las dos ediciones anteriores, repitió éxito tras derrotar al Liverpool en la final 3-1. Por ello jugó la Supercopa de Europa 2018 contra el Atlético de Madrid, campeón de la Liga Europa de la UEFA 2017-18, y también se clasificó para jugar la Copa Mundial de Clubes de la FIFA 2018. Real Madrid y Liverpool se volvieron a enfrentar en la instancia decisiva como ya lo hicieron en la temporada 1980-81.\\nLa final se disputó en Ucrania, concretamente en el Estadio Olímpico de Kiev, con capacidad para 70.050 espectadores, que alberga los partidos importantes del Dinamo Kiev y de la selección de ese país; esta fue la primera ocasión en la que la final de una competición europea de clubes de disputaba en Ucrania.\\nInaugurado en agosto de 1923, ha sufrido hasta cinco remodelaciones, incluyendo una en 2012 con motivo de la Eurocopa celebrada en 2012 en Ucrania y Polonia, como sede compartida, y fue elegido para disputar la final del mencionado torneo continental."},{"page_url":"https://en.wikipedia.org/wiki/Frederick_Selous","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Frederick_C._Selous_grave.jpg","page_title":"Frederick Selous","context_page_description":"Frederick Courteney Selous, DSO, was a British explorer, officer, professional hunter, and conservationist, famous for his exploits in Southeast Africa. His real-life adventures inspired Sir Henry Rider Haggard to create the fictional Allan Quatermain character. Selous was also a friend of Theodore Roosevelt, Cecil Rhodes and Frederick Russell Burnham. He was pre-eminent within a select group of big game hunters that included Abel Chapman and Arthur Henry Neumann. He was the older brother of ornithologist and writer Edmund Selous."},{"page_url":"https://de.wikipedia.org/wiki/Heinrich_Adolf_von_Eck","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Abhandlungen_zur_geologischen_Specialkarte_von_Preussen_und_den_Th%C3%BCringischen_Staaten_%281892%29_%2816581160210%29.jpg","page_title":"Heinrich Adolf von Eck","context_page_description":"Heinrich Adolf von Eck war ein deutscher Geologe und Paläontologe. Sein Schwerpunkt lag auf der Bearbeitung der Triasablagerungen des mitteleuropäischen Beckens."},{"page_url":"https://cs.wikipedia.org/wiki/Kuka%C4%8Dka_koel","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Asian_Koel_%28Male%29_I_IMG_8190.jpg","page_title":"Kukačka koel","context_page_description":"Kukačka koel je velký druh kukačky."},{"page_url":"https://fi.wikipedia.org/wiki/Yhdysvaltain_hallitus","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Jovita_Carranza_official_photo_%28cropped%29.jpg","page_title":"Yhdysvaltain hallitus","context_page_description":"Yhdysvaltain hallitus on Yhdysvaltain liittovaltiotason hallinnon korkein elin, jota johtaa presidentti."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%97%A5%E6%9C%AC%E5%85%A7%E9%96%A3%E7%B8%BD%E7%90%86%E5%A4%A7%E8%87%A3%E5%A4%AB%E4%BA%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/PM_and_Mrs_Abe_arrive_at_WH_26_April_2007_from_side_angle_cropped.jpg","page_title":"日本內閣總理大臣夫人","context_page_description":"日本內閣總理大臣夫人是日本總理大臣的配偶，這個稱謂並不是法定的官職或公共職務。總理大臣夫人通常簡稱爲「總理夫人」或「首相夫人」。另外，至今尚未有女性出任內閣總理大臣一職，所以目前不存在對女總理大臣配偶的相應稱呼。"},{"page_url":"https://da.wikipedia.org/wiki/N%C3%B8rre_Herlev","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Bygaden%2C_N%C3%B8rre_Herlev_-_Mapillary_%28vnbrieX-M1eLWxiPrc3dpg%29.jpg","page_title":"Nørre Herlev","context_page_description":"Nørre Herlev er en landsby i Nordsjælland med 414 indbyggere. Nørre Herlev er beliggende i Nørre Herlev Sogn nær Hillerødmotorvejen en kilometer vest for Brødeskov, seks kilometer syd for Hillerød centrum og 34 kilometer nordvest for Københavns centrum. Landsbyen tilhører Hillerød Kommune og er beliggende i Region Hovedstaden.\\nNørre Herlev Kirke ligger i landsbyen."},{"page_url":"https://nl.wikipedia.org/wiki/Louis-Jean_Empain","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/La_Villa_Empain_en_2012%2C_apr%C3%A8s_restauration..jpg","page_title":"Louis-Jean Empain","context_page_description":"Louis Jean Lain Empain was een Belgisch bankier, ondernemer en filantroop."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A6%E3%83%AB%E3%82%AF%E3%81%AE%E5%A4%A7%E6%9D%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Warka_Vase%2C_Middle_Register.jpg","page_title":"ウルクの大杯","context_page_description":"ウルクの大杯、またはワルカの大杯は古代都市ウルクの遺跡にあるシュメールの女神イナンナの神殿複合体跡で発見された大型の杯。アラバスター製であり浮彫が施されている。この都市遺跡は現在のイラク南部、ムサンナー県にある。ウルクのボウルやエジプトのナルメルのパレットと同じく、物語の浮彫彫刻が施された作品の中では現存する最も古い作品の一つで、前3200年-前3000年頃のものと見られる。\\nシュメール美術の代表的傑作の一つとされ、図像の中に杯が2つ描かれていることから、本来は2つあり対になっていたと考えられている。対応するペアの大杯は発見されていない。製造時期がウルク古拙文字の登場時期前後であることから考古学的にも極めて重要な遺物である。"},{"page_url":"https://sl.wikipedia.org/wiki/Vojne_v_nekdanji_Jugoslaviji","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Muzej_DR-crop.JPG","page_title":"Vojne v nekdanji Jugoslaviji","context_page_description":"Vojne v nekdanji Jugoslaviji so vse vojne, ki so se zgodile na ozemlju bivše SFRJ od leta 1991 do 2001. V vojne je bilo vpletenih vseh šest nekdanjih jugoslovanskih republik. Vojna se je končala hitro v Sloveniji, v drugih republikah, kot sta Hrvaška in Bosna in Hercegovina, pa je trajala skoraj štiri leta. Po nekajletnem miru je ponovno prišlo do konflikta na Kosovu, ki se je nato razširil na Makedonijo, kjer je nastala kratkotrajna državljanska vojna.\\nZa večino vojn na tleh nekdanje Jugoslavije so bili značilni izraziti etnični konflikti med Srbi, Hrvati, Bošnjaki in Albanci, kasneje pa tudi med Albanci in Makedonci. Te konflikte je podžgalo spodbujanje nacionalizma ter trenja, zlasti med Hrvati in Srbi, kar so izkoristili politiki tako na srbski kot hrvaški strani. Ključno pa je etnične konflikte razplamtela politika nekaterih srbskih politikov kot je zlasti Slobodan Milošević, kar je na koncu pripeljalo do najbolj krvavih vojn na evropskih tleh po drugi svetovni vojni.\\nVojne so povzročile ogromno gospodarsko škodo. Veliko ljudi je bilo pregnanih s svojih domov, prišlo pa je tudi do množičnih pobojev skoraj na vseh v vojne vpletenih straneh."},{"page_url":"https://en.wikipedia.org/wiki/1938","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Diana_Rigg_1973.jpg","page_title":"1938","context_page_description":"1938 was a common year starting on Saturday of the Gregorian calendar, the 1938th year of the Common Era and Anno Domini designations, the 938th year of the 2nd millennium, the 38th year of the 20th century, and the 9th year of the 1930s decade."},{"page_url":"https://pl.wikipedia.org/wiki/Chignall_Smealy","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Village_of_Chignall_Smealy_-_geograph.org.uk_-_119196.jpg","page_title":"Chignall Smealy","context_page_description":"Chignall Smealy – wieś w Anglii, w hrabstwie Essex, w dystrykcie Chelmsford. Leży 7 km na północny zachód od miasta Chelmsford i 49 km na północny wschód od Londynu."},{"page_url":"https://en.wikipedia.org/wiki/Rieti_Valley","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Estensione_del_Lago_Velino_-_1.jpg","page_title":"Rieti Valley","context_page_description":"The Rieti Valley or Rieti Plain is a small plain in central Italy, where lies the city of Rieti, Lazio. It is also known as Sacred Valley and Holy Valley since saint Francis of Assisi lived here for many years and erected four shrines, which have become the destination of pilgrims.\\nIt is the center of the Sabine region and an important part of the province of Rieti. Originated from the draining of the ancient Lake Velino, it is crossed by the Velino river and bordered by Monti Reatini and Sabine Mountains."},{"page_url":"https://no.wikipedia.org/wiki/Johann_Gutenberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Gutenberg.jpg","page_title":"Johann Gutenberg","context_page_description":"Johann Gutenberg var en tysk gullsmed og metallurg som regnes som oppfinneren av boktrykkerkunsten, det vil si masseframstilling av bøker trykt med løse bokstavtyper.\\nI Kina ble det trykt blokkbøker allerede på 500-tallet og brukt løse typer fra 1000-tallet. Kineserne var også de første til å lage papir. I Europa ble det lagd noen få bøker med blokksats først fra 1430-tallet. Gutenberg videreutviklet imidlertid teknikkene, han forbedret trykkpressen og fant fram til bedre trykkfarger og blylegeringer for støping av typer. På 1450-tallet etablerte han en trykkemetode for bøker som ble enerådende fram til slutten av 1800-tallet og i bruk til 1950-tallet.\\nMuligheten for å masseprodusere bøker dannet grunnlaget for det moderne informasjonssamfunnet."},{"page_url":"https://hu.wikipedia.org/wiki/%C3%81llatok_list%C3%A1ja_neuronjaik_sz%C3%A1ma_szerint","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9d/Marmoset_copy.jpg","page_title":"Állatok listája neuronjaik száma szerint","context_page_description":"Az alábbi listában különböző állatok találhatók meg, sorba rendezve az idegrendszerükben, illetve agyukban lévő neuronok száma szerint. A számok nagy része becslés, melyet az egyes állat neuronsűrűségét és agyának átlagos térfogatát összeszorozva állapítottak meg."},{"page_url":"https://de.wikipedia.org/wiki/Buckeltanzfliegen","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Hybos_culiciformis-pjt.jpg","page_title":"Buckeltanzfliegen","context_page_description":"Die Buckeltanzfliegen sind eine Familie der Zweiflügler und werden den Fliegen zugeordnet. Die Vertreter dieser Familie wurden früher den Tanzfliegen zugerechnet, heute stellen sie jedoch aufgrund morphologischer Unterschiede eine eigene Familie dar. Weltweit sind etwa 1300 Arten dieser Gruppe bekannt, in Deutschland etwa 200."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_in_de_Lange_Leidsedwarsstraat","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/RM3307_Amsterdam_-_Lange_Leidsedwarsstraat_154.jpg","page_title":"Lijst van rijksmonumenten in de Lange Leidsedwarsstraat","context_page_description":"Een overzicht van de 32 rijksmonumenten in de Lange Leidsedwarsstraat in Amsterdam."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Laucha_an_der_Unstrut","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Laucha_an_der_Unstrut%2C_M%C3%BChlstra%C3%9Fe_1%2C_Tittel-M%C3%BChle-006.jpg","page_title":"Liste der Kulturdenkmale in Laucha an der Unstrut","context_page_description":"In der Liste der Kulturdenkmale in Laucha an der Unstrut sind alle Kulturdenkmale der Gemeinde Laucha an der Unstrut und ihrer Ortsteile aufgelistet. Grundlage ist das Denkmalverzeichnis des Landes Sachsen-Anhalt, das auf Basis des Denkmalschutzgesetzes vom 21. Oktober 1991 durch das Landesamt für Denkmalpflege und Archäologie Sachsen-Anhalt erstellt und seither laufend ergänzt wurde."},{"page_url":"https://hu.wikipedia.org/wiki/Szen%C3%A1tus_(Olaszorsz%C3%A1g)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/De_Nicola_ritratto.jpg","page_title":"Szenátus (Olaszország)","context_page_description":"Az Il Senato della Repubblica vagy Szenátus az olaszországi törvényhozás felsőházaként működik, a Képviselőházzal együtt teszik ki az olasz parlamentet.\\nAz olasz alkotmány szerint a Szenátus tagjait regionális választókörzetekből és a külföldi képviseletek választókörzeteiből választják meg. A Szenátusban 315 szenátori mandátum van, melyből 309 mandátum a régiók és 6 mandátum a külképviseletek jelöltjeiből áll össze.\\nMinden tartománynak az Olasz Alkotmány 57. cikkelye szerint legalább 7 szenátort kell megválasztania, kivéve Molise és Valle d'Aosta tartományokat, akik 2 illetve egy szenátort küldenek.\\nA szenátortok a parlamenti ciklus végével választhatók meg emellett a Szenátusban vannak örökös szenátorok és nyugalmazott örökös köztársasági elnöki szenátor."},{"page_url":"https://fr.wikipedia.org/wiki/Saint-Gaudens","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Public_du_Stade_saint-gaudinois%2C_en_1921.jpg","page_title":"Saint-Gaudens","context_page_description":"Saint-Gaudens est une commune française située dans le département de la Haute-Garonne, dont elle est sous-préfecture, en région Occitanie."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%B6%D0%B5%D0%BD%D1%89%D0%B8%D0%BD_%D0%91%D0%B8%D0%B1%D0%BB%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Drevnosti_RG_v1_ill018a_-_Eleusa_with_Old_Testament_women.jpg","page_title":"Список женщин Библии","context_page_description":"Список женщин Библии включает перечисление персонажей Священного Писания, с которыми связаны какие-либо сюжеты. Имена, фигурирующие лишь в генеалогических списках, отсутствуют."},{"page_url":"https://ca.wikipedia.org/wiki/Trisopterus","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1a/Capellanes-Pez-10.jpg","page_title":"Trisopterus","context_page_description":"Trisopterus és un gènere de peixos pertanyent a la família dels gàdids."},{"page_url":"https://fr.wikipedia.org/wiki/R%C3%A9serve_nationale_de_faune_du_cap_Tourmente","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/CapTourmentePierrier.JPG","page_title":"Réserve nationale de faune du cap Tourmente","context_page_description":"La réserve nationale de faune du cap Tourmente est l'une des huit réserves nationales de faune du Canada présentes au Québec. Établie dans une région liée aux premiers temps de l'histoire de la Nouvelle-France, cette réserve est destinée à protéger les marais à Scirpe d'Amérique, une plante qui constitue l'alimentation de l'Oie des neiges lors de ses migrations annuelles."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Smith_County,_Tennessee","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/19/James-bradley-house-tn1.jpg","page_title":"National Register of Historic Places listings in Smith County, Tennessee","context_page_description":"This is a list of the National Register of Historic Places listings in Smith County, Tennessee.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in Smith County, Tennessee, United States. Latitude and longitude coordinates are provided for many National Register properties and districts; these locations may be seen together in a map.\\nThere are 13 properties and districts listed on the National Register in the county.\\nThis National Park Service list is complete through NPS recent listings posted October 14, 2016."},{"page_url":"https://gl.wikipedia.org/wiki/Tobolsk","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Tobolskhouse2.jpg","page_title":"Tobolsk","context_page_description":"Tobolsk foi a capital histórica de Siberia, e actualmente unha cidade ordinaria do óblast de Tiumen, en Rusia. Está localizada na confluencia dos ríos Tobol e Irtish."},{"page_url":"https://it.wikipedia.org/wiki/Collezione_personale_di_gioielli_della_regina_Elisabetta_II","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Elizabeth_II_Southern_Cross.png","page_title":"Collezione personale di gioielli della regina Elisabetta II","context_page_description":"I Gioielli della Regina sono la storica collezione di gioielli di proprietà personale del monarca, attualmente la regina Elisabetta II Questi sono separati dai gioielli della Corona inglese come pure dalle regalie di Stato.\\nL'origine di una collezione di gioielli reale distinta a quella della Corona è vaga, anche se si ha ragione di credere che tale tradizione abbia avuto origine nel XVI secolo. Molti pezzi di gioielleria provengono dall'estero e sono stati portati nel Regno Unito come risultati di guerre civili, colpi di stato e rivoluzioni, oppure acquisiti come doni dal monarca. Gran parte dei gioielli oggi parte della collezione della regina Elisabetta II sono del XIX e XX secolo.\\nI gioielli della corona sono indossati unicamente durante le incoronazioni o per occasioni importanti come l'annuale cerimonia di apertura del parlamento. In altre occasioni formali come banchetti di stato, la regina indossa spesso gioielli provenienti dalla propria collezione privata. Elisabetta ha più di 300 gioielli personali, tra cui 98 spille, 46 collane, 37 braccialetti, 34 paia di orecchini, 15 anelli, 14 orologi e 5 pendenti, di cui i più importanti sono elencati qui di seguito."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9A%D0%B0%D1%83%D0%BB%D0%BE%D0%BD%D0%B8%D1%8F","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/45/Caulonia_2.jpeg","page_title":"Каулония","context_page_description":"Кауло̀ния е градче и община в Южна Италия, провинция Реджо Калабрия, регион Калабрия. Разположено е на 298 m надморска височина. Населението на общината е 7026 души."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%B8%D0%B5_%D0%BF%D0%BB%D0%B0%D0%BA%D0%B0%D1%82%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/%D0%9D%D0%B0%D1%83%D1%87%D0%B8%D1%82%D0%B5%D1%81%D1%8C_%D1%80%D0%B5%D0%B1%D1%8F%D1%82%D0%B8%D1%88%D0%BA%D0%B8_%D0%BD%D0%B5_%D1%82%D1%80%D0%B5%D0%BF%D0%B0%D1%82%D1%8C%2C_%D0%BD%D0%B5_%D0%BF%D0%BE%D1%80%D1%82%D0%B8%D1%82%D1%8C_%D0%BA%D0%BD%D0%B8%D0%B6%D0%BA%D0%B8.jpg","page_title":"Советские плакаты","context_page_description":"Советские плакаты — наглядные пособия, создаваемые в СССР, направленные к разъяснению определенного вопроса, как, например, отношения советской власти к текущим событиям в доступной форме. Совместно с радио и газетами являлись средствами агитации и пропаганды, воздействующими на сознание и настроение людей с целью побуждения их к политической или другой деятельности.\\nХарактер советских плакатов менялся по мере исторического развития СССР, при этом содержавшаяся в них пропаганда сочетала общечеловеческие ценности, патриотизм, общеобразовательные элементы, призывы к здоровому образу жизни и так далее.\\nСоветские плакаты, как правило, являются произведениями изобразительного искусства и отражают элементы советского культурного наследия."},{"page_url":"https://be.wikipedia.org/wiki/%D0%9F%D1%80%D1%8D%D0%B7%D1%96%D0%B4%D1%8D%D0%BD%D1%86%D0%BA%D1%96%D1%8F_%D0%B2%D1%8B%D0%B1%D0%B0%D1%80%D1%8B_%D0%B2%D0%B0_%D0%A3%D0%BA%D1%80%D0%B0%D1%96%D0%BD%D0%B5_(2019)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Official_portrait_of_Petro_Poroshenko.jpg","page_title":"Прэзідэнцкія выбары ва Украіне (2019)","context_page_description":"Выбары Прэзідэнта Украіны 2019 — чарговыя выбары Прэзідэнта Украіны, першы тур якіх адбыўся 31 сакавіка 2019, згодна з зацвярджаным каляндарным планам выбараў Цэнтральнай выбарчай камісіяй Украіны.\\nУ першым туры найбольшую колькасць галасоў атрымалі Уладзімір Зяленскі і дзеючы Прэзідэнт Пётр Парашэнка, якія выйшлі ў другі тур."},{"page_url":"https://en.wikipedia.org/wiki/The_Voice_of_the_Philippines_(season_2)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Apl.de.ap_2011.jpg","page_title":"The Voice of the Philippines (season 2)","context_page_description":"The second season of The Voice of the Philippines was a reality singing competition in ABS-CBN which started airing on October 26, 2014. apl.de.ap, Lea Salonga, Sarah Geronimo, and Bamboo Mañalac returned as coaches for this season. Toni Gonzaga also returned to host the show; she was also joined by The Voice Kids host, Luis Manzano. Robi Domingo and Alex Gonzaga also returned to reprise their roles as the show's V-reporters.\\nThe show aired every Saturdays 8:45 p.m. and Sundays at 8:30 p.m.\\nOn March 1, 2015, Jason Dy of Team Sarah won the competition, beating Alisah Bonaobra of Team apl."},{"page_url":"https://de.wikipedia.org/wiki/Checkpoint_Charlie","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/891119b_berlin_checkpoint_charlie_grenzuebergang.jpg","page_title":"Checkpoint Charlie","context_page_description":"Der Checkpoint Charlie war einer der Berliner Grenzübergänge durch die Berliner Mauer zwischen 1961 und 1990. Er verband in der Friedrichstraße zwischen Zimmerstraße und Kochstraße den sowjetischen mit dem US-amerikanischen Sektor und damit den Ost-Berliner Bezirk Mitte mit dem West-Berliner Bezirk Kreuzberg. Der Kontrollpunkt wurde im August/September 1961 infolge des Mauerbaus von den West-Alliierten eingerichtet, um den Angehörigen ihres Militärpersonals weiterhin das Überschreiten der Sektorengrenze zu ermöglichen, wobei sie registriert und belehrt wurden. Kontrollen aller anderen Besucher Ost-Berlins fanden, wie überall auf westlicher Seite, auch am Checkpoint Charlie nicht statt."},{"page_url":"https://nl.wikipedia.org/wiki/Alvis_Saracen","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/British_Saracen_Artillery_Command_Vehicle_FV610_%285781700148%29.jpg","page_title":"Alvis Saracen","context_page_description":"De Alvis Saracen is een Brits gepantserd infanterietransportvoertuig geproduceerd door Alvis. Het werd vooral gebruikt door het Britse leger en is ook veelvuldig ingezet in Noord-Ierland. In 1972 werd de productie gestaakt en in totaal zijn 1.838 voertuigen geproduceerd."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%A3%E0%B8%B2%E0%B8%A2%E0%B8%8A%E0%B8%B7%E0%B9%88%E0%B8%AD%E0%B9%81%E0%B8%AB%E0%B8%A5%E0%B9%88%E0%B8%87%E0%B8%A1%E0%B8%A3%E0%B8%94%E0%B8%81%E0%B9%82%E0%B8%A5%E0%B8%81%E0%B9%83%E0%B8%99%E0%B8%9B%E0%B8%A3%E0%B8%B0%E0%B9%80%E0%B8%97%E0%B8%A8%E0%B8%88%E0%B8%B5%E0%B8%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Rock_painting_hua_mountain_1.jpg","page_title":"รายชื่อแหล่งมรดกโลกในประเทศจีน","context_page_description":"องค์การการศึกษา วิทยาศาสตร์ และวัฒนธรรมแห่งสหประชาชาติ ได้ขึ้นทะเบียนแหล่งมรดกโลกของประเทศจีนทั้งสิ้น 55 แหล่ง ประกอบด้วยมรดกโลกทางวัฒนธรรม 37 แหล่ง มรดกโลกทางธรรมชาติ 14 แห่ง และมรดกโลกแบบผสมอีก 4 แหล่ง"},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9A%D0%B8%D1%80_%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Median_Empire.jpg","page_title":"Кир Велики","context_page_description":"Кир Велики такође познати као Кир II основао је Ахеменидско царство. Током своје владавине проширио је царство на већи део југозападне и централне Азије, од Египта и Босфора на западу све до реке Инд на истоку, и створио прво и највеће царство античког доба. Током три деценије владавине, овај владар је победио и покорио нека већа краљевства тог доба, укључујући Медију, Лидију и Вавилон, а водио је војне експедиције и у централну Азију где је покорио све народе. Ипак, није ишао у походе на афрички Египат или европску Грчку као касније Камбиз II и Дарије I Велики. Према Херодоту, погинуо је у бици против Скита у лето 530. или 529. п. н. е. Наследио га је син Камбиз II који је освојио Египат током кратке владавине. Кир је био следбеник зороастријске религије. Осим јаког утицаја на иранску историју, Кир је снажно утицао и на јеврејску религију, људска права, политику, војну стратегију те уопште на источну и западну цивилизацију."},{"page_url":"https://sl.wikipedia.org/wiki/Zgorevalna_komora","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/02/CanAnnularCombustor.svg","page_title":"Zgorevalna komora","context_page_description":"Zgorevalna komora je del motorja, kjer poteka zgorevanje goriva."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%B0%D1%81%D0%B8%D0%BB%D1%8C%D0%BA%D0%BE%D0%B2","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2d/%D0%92%D0%B0%D1%81%D0%B8%D0%BB%D1%8C%D0%BA%D0%BE%D0%B2_1852_%D0%B8%D0%B7_%D0%92%D0%B8%D0%BD%D0%BA%D0%BB%D0%B5%D1%80%D0%B0.jpg","page_title":"Васильков","context_page_description":"Василько́в — город областного значения в Киевской области Украины, расположенный 25 км южнее Киева. Город стоит на реке Стугна и является центром Васильковского района, не входя в его состав."},{"page_url":"https://he.wikipedia.org/wiki/%D7%99%D7%95%D7%A8%D7%9D_%D7%99%D7%90%D7%99%D7%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Yom_Kippur_War._Force_Naftul._XXXXII.jpg","page_title":"יורם יאיר","context_page_description":"יורם שמואל יאיר הוא איש צבא ישראלי, אשר שירת בצה\\"ל 35 שנים עד לשחרורו בדרגת אלוף, בשנת 1998. לאחר שחרורו, הוא עוסק בפעילות בתחום החברתי חינוכי בהתנדבות ועובד בתחום העסקי. משמש כיושב ראש ויועץ אסטרטגי של מספר חברות בישראל ומחוצה לה, ומכהן כיו\\"ר \\"יחד למען החייל\\", יו\\"ר עמותת \\"אחריי!\\" ויו\\"ר עמותה המפעילה כפרי גמילה מסמים ואלכוהול. יאיר בנה ועומד בראש תוכנית רבין למנהיגות במרכז הבינתחומי הרצליה."},{"page_url":"https://nl.wikipedia.org/wiki/Jozef_van_Salm-Reifferscheid-Dyck","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Salm-Dyck%2C_Joseph.jpg","page_title":"Jozef van Salm-Reifferscheid-Dyck","context_page_description":"Jozef Frans Maria Anton Hubert Ignatius was altgraaf en vervolgens vorst van Salm-Reifferscheid-Dyck. Hij was tevens botanicus."},{"page_url":"https://en.wikipedia.org/wiki/History_of_Finland","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/AntreaNet.jpg","page_title":"History of Finland","context_page_description":"The History of Finland begins around 9,000 BC during the end of the last glacial period. Stone Age cultures were Kunda, Comb Ceramic, Corded Ware, Kiukainen, and Pöljä cultures. The Finnish Bronze Age started in approximately 1,500 BC and the Iron Age started in 500 BC and lasted until 1,300 AD. Finnish Iron Age cultures can be separated into Finnish proper, Tavastian, and Karelian cultures. The earliest written sources mentioning Finland start to appear from the 12th century onwards when the Catholic Church started to gain a foothold in Southwest Finland.\\nDue to the Northern Crusades and Swedish colonisation of some Finnish coastal areas, most of the region became a part of the Kingdom of Sweden and the realm of the Catholic Church from the 13th century onwards. After the Finnish War in 1809, the vast majority of the Finnish-speaking areas of Sweden were ceded to the Russian Empire, making this area the autonomous Grand Duchy of Finland. The Lutheran religion dominated. Finnish nationalism emerged in the 19th century. It focused on Finnish cultural traditions, folklore, and mythology, including music and—especially—the highly distinctive language and lyrics associated with it."},{"page_url":"https://it.wikipedia.org/wiki/Burgauberg-Neudauberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Burgauberg-Neudauberg_im_Bezirk_GS.png","page_title":"Burgauberg-Neudauberg","context_page_description":"Burgauberg-Neudauberg è un comune austriaco di 1 366 abitanti nel distretto di Güssing, in Burgenland. È stato istituito nel gennaio del 1971 con la fusione dei comuni soppressi di Burgauberg e Neudauberg; capoluogo comunale è Burgauberg."},{"page_url":"https://en.wikipedia.org/wiki/Cultivated_plant_taxonomy","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Pliny_the_Elder.png","page_title":"Cultivated plant taxonomy","context_page_description":"Cultivated plant taxonomy is the study of the theory and practice of the science that identifies, describes, classifies, and names cultigens—those plants whose origin or selection is primarily due to intentional human activity. Cultivated plant taxonomists do, however, work with all kinds of plants in cultivation.\\nCultivated plant taxonomy is one part of the study of horticultural botany which is mostly carried out in botanical gardens, large nurseries, universities, or government departments. Areas of special interest for the cultivated plant taxonomist include: searching for and recording new plants suitable for cultivation; communicating with and advising the general public on matters concerning the classification and nomenclature of cultivated plants and carrying out original research on these topics; describing the cultivated plants of particular regions; maintaining databases, herbaria and other information about cultivated plants.\\nMuch of the work of the cultivated plant taxonomist is concerned with the naming of plants as prescribed by two plant nomenclatural Codes."},{"page_url":"https://sv.wikipedia.org/wiki/Cerro_Torre","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Cerro_Torre.jpg","page_title":"Cerro Torre","context_page_description":"Cerro Torre är ett berg i södra Patagonien på gränsen mellan Chile och Argentina. Berget är 3102 meter högt och räknas liksom det närbelägna Fitz Roy till ett av världens mest svårbestigna. Cerro Torres topp är helt istäckt vilket försvårar bestigningen. Berget har tidigare varit mycket otillgängligt, drygt 220 kilometer nordväst om den tidigare utposten El Calafate. Men i mitten av 1980-talet etablerade Argentina en ny utpost, El Chaltén, i området som en del av det geopolitiska spelet med Chile om gränsdragningarna i området. Från El Chaltén når man bergets fot på en halv dags vandring. Berget ingår i Los Glaciares nationalpark på den argentinska sidan, en park som sedan 1981 är med på Unescos världsarvslista.\\nNär den första bestigningen av berget skedde är omstritt. Cesare Maestri hävdade att han hade lyckats bestiga berget 1959, det saknades dock vittnen som kunde verifiera det och hans klättringspartner Toni Egger omkom på vägen ned för berget. År 1991 lyckade andra klättrare för första gången följa Maestris spår, men utan att hitta några spår efter hans klättring i berget."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A7%A8%E0%A7%A6%E0%A7%A7%E0%A7%AC_%E0%A6%86%E0%A6%87%E0%A6%B8%E0%A6%BF%E0%A6%B8%E0%A6%BF_%E0%A6%AC%E0%A6%BF%E0%A6%B6%E0%A7%8D%E0%A6%AC_%E0%A6%9F%E0%A7%81%E0%A6%AF%E0%A6%BC%E0%A7%87%E0%A6%A8%E0%A7%8D%E0%A6%9F%E0%A6%BF%E0%A7%A8%E0%A7%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Chinnaswamy_Stadium_MI_vs_RCB.jpg","page_title":"২০১৬ আইসিসি বিশ্ব টুয়েন্টি২০","context_page_description":"২০১৬ আইসিসি বিশ্ব টুয়েন্টি২০ আন্তর্জাতিক ক্রিকেট কাউন্সিলের নির্দেশনায় পরিচালিত আইসিসি বিশ্ব টুয়েন্টি২০ প্রতিযোগিতার ৬ষ্ঠ আসর। ৮ মার্চ থেকে ৩ এপ্রিল পর্যন্ত এ ক্রিকেট প্রতিযোগিতাটি ২০১৬ সালে প্রথমবারের মতো ভারতে ও সর্বশেষবারের মতো দুই বছর অন্তর অনুষ্ঠিত হয়। পরবর্তী আসর ২০২০ সালে অনুষ্ঠিত হবে। ২৮ জানুয়ারি, ২০১৫ তারিখে দুবাইয়ে অনুষ্ঠিত প্রথম সভা শেষে আইসিসি ভারতকে প্রতিযোগিতার স্বাগতিক দেশ হিসেবে ঘোষণা করে। পূর্বতন চ্যাম্পিয়ন শ্রীলঙ্কা সুপার টেন পর্বে ইংল্যান্ডের কাছে ১০ রানে পরাজিত হয়ে প্রতিযোগিতা থেকে বিদায় নেয়।\\nভারতের সাতটি শহরে প্রতিযোগিতার খেলাগুলো অনুষ্ঠিত হয়। তন্মধ্যে, কলকাতার ইডেন গার্ডেন্সে চূড়ান্ত খেলায় ইংল্যান্ডকে পরাজিত করে ওয়েস্ট ইন্ডিজ শিরোপা জয় করে। ভারতীয় ব্যাটসম্যান বিরাট কোহলি টুর্নামেন্টের সেরা খেলোয়াড় নির্বাচিত হন, অন্যদিকে বাংলাদেশের তামিম ইকবাল এবং আফগানিস্তানের মোহাম্মাদ নবী যথাক্রমে টুর্নামেন্টের সর্বোচ্চ রান সংগ্রহকারী এবং সর্বোচ্চ উইকেট শিকারী হন।"},{"page_url":"https://pl.wikipedia.org/wiki/Dekanat_Trzebiat%C3%B3w","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Ko%C5%9Bci%C3%B3%C5%82_Cerkwica.jpg","page_title":"Dekanat Trzebiatów","context_page_description":"Dekanat Trzebiatów – jeden z dekanatów należący do archidiecezji szczecińsko-kamieńskiej."},{"page_url":"https://fr.wikipedia.org/wiki/Renoncule_aquatique","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Renoncule_aquatiqueRhin.jpg","page_title":"Renoncule aquatique","context_page_description":"La renoncule aquatique est une plante herbacée vivace de la famille des Renonculacées.\\nElle forme des tapis à la surface des eaux stagnantes, qui fleurissent d'avril à juillet."},{"page_url":"https://el.wikipedia.org/wiki/%CE%86%CE%BC%CF%80%CF%81%CE%B1%CF%87%CE%B1%CE%BC_%CE%9C%CF%80%CE%BB%CE%BF%CF%8D%CE%BC%CE%B5%CF%81%CF%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Meyssens%2C_Johannes_-_Abraham_Bloemaert.jpg","page_title":"Άμπραχαμ Μπλούμερτ","context_page_description":"Ο Άμπραχαμ Μπλούμερτ ήταν Ολλανδός ζωγράφος και χαράκτης. Ήταν ένας από τους \\"\\"Μανιεριστές του Χάαρλεμ\\" από περίπου το 1585, αλλά με την αλλαγή του αιώνα άλλαξε το ύφος του, τείνοντας περισσότερο προς το μπαρόκ. Ζωγράφισε κυρίως πίνακες με θέματα από την ιστορία και μερικά τοπία. Ήταν σημαντικός δάσκαλος και εκπαίδευσε τους περισσότερους από τους \\"Καραβατζιστές της Ουτρέχτης\\", τουλάχιστον για κάποια περίοδο."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B0%D1%81%D0%BA%D0%B5%D1%82%D0%B1%D0%BE%D0%BB%D1%8C%D0%BD%D0%B0%D1%8F_%D0%B0%D1%80%D0%B5%D0%BD%D0%B0_(%D0%9B%D0%BE%D0%BD%D0%B4%D0%BE%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/London_2012_Olympic_Basketball_Arena.jpg","page_title":"Баскетбольная арена (Лондон)","context_page_description":"Баскетбольная арена — спортивный комплекс, в котором прошёл баскетбольный турнир летних Олимпийских игр 2012 года, площадка была одним из главных мест в Лондоне на Олимпийских и Паралимпийских играх. Неофициальное прозвище — «Маршмэллоу».\\nВ олимпийской заявке Лондон предложил четыре арены в Олимпийском парке, но пересмотренный генеральный план, опубликованный в 2006 году, свел их в три, а волейбол переместился в Эрлс Корт. Ограждение арены было отменено, а фехтование прошло в выставочном центре Лондона.\\nБаскетбольная арена вмещала 12 000 человек на Олимпийских играх и 10 000 на Паралимпийских играх. Арена также использовалась как зона ожидания для спортсменов во время церемонии открытия и закрытия Олимпийских игр. Концепция дизайна была принята в июне 2008 года и документ планирования был представлен в ноябре 2008 года.\\nВ начале октября 2008 года было предположение, что Арена Уэмбли может быть использована как замена места проведения предварительных раундов олимпийского турнира по баскетболу, но в марте 2009 года было подтверждено, что новая арена будет построена в Стратфорде, как первоначально предлагалось."},{"page_url":"https://cs.wikipedia.org/wiki/Otakar_%C5%A0%C3%ADn","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/OtakarSin.jpg","page_title":"Otakar Šín","context_page_description":"Otakar Šín byl český hudební skladatel, teoretik a pedagog."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AC%D8%AF%D8%B1%D9%8A_%D8%A7%D9%84%D9%85%D8%A7%D8%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Ploketes_d%27_aiwe_dj3_cost%C3%A9.jpg","page_title":"جدري الماء","context_page_description":"جدري الماء أو الحُمَاقُ أو العَنْقَزُ أو الجُدَيْري ‏ هو مرض فيروسي مُعدٍ يصيب الجلد والاغشية المخاطية أي الملتحمة وباطن\\nالفم، ويترافق بحكة شديدة، وربما باختلاطات مثل التهاب السحايا والدماغ\\nالسليم بعد عشرة ايام من بدء المرض."},{"page_url":"https://de.wikipedia.org/wiki/Filmjahr_2017","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9a/Geoffrey_Bayldon_2009.jpg","page_title":"Filmjahr 2017","context_page_description":"Die zehn erfolgreichsten Filme an den deutschen Kinokassen nach Besucherzahlen:"},{"page_url":"https://fr.wikipedia.org/wiki/Ch%C3%A2teau-Gaillard_(Amboise)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Vue_de_l%27orangerie_royale.jpg","page_title":"Château-Gaillard (Amboise)","context_page_description":"Le domaine royal de Château-Gaillard, voulu par Charles VIII à son retour de la première guerre d'Italie, se situe à Amboise dans le Val de Loire. Comprenant notamment un logis-royal comptant parmi les châteaux de la Loire, il s’étend au pied du flanc méridional de l’éperon des Châteliers, à proximité immédiate du Clos-Lucé.\\nLe domaine de Château-Gaillard fut un « laboratoire » de la Renaissance française : premier jardin d'acclimatation en France avec notamment la création de la première orangerie royale française, premier jardin de la Renaissance française créé par dom Pacello da Mercogliano avec la réalisation de la première perspective paysagère axiale et des premiers parterres « à la française », première transposition française de l’architecture de la Renaissance italienne incarnée par les villas des Médicis à Florence. Le domaine royal de Château-Gaillard a fait l’objet d’une inscription au titre des monuments historiques en 1963. Au terme de cinq ans de restauration, le domaine a été ouvert au public en 2014."},{"page_url":"https://nl.wikipedia.org/wiki/Ibeji","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/IbejiTwins.jpg","page_title":"Ibeji","context_page_description":"Ibeji zijn beeldjes van het volk Yoruba. In de taal Yoruba betekent het woord tweelingen: ibi = geboren, eji = twee. Het gaat om houten beeldjes van 15 tot 25 cm hoog.\\nDe Yoruba zijn een belangrijke etnische groep in Afrika. In hun cultuur zijn tweelingen belangrijk. In hun godsdienst zijn er tweelinggoden Orisha Ibeji.\\nEeneiige tweelingen komen voor aan 4 per 1000 geboortes. Het aantal twee-eiige tweelingen ligt hoger in Afrika dan elders en is het hoogst bij de Yaruba in Nigeria met 45 per 1000 geboortes. De stad Igboora komt zelfs aan 150 tweelingen per 1000 geboortes.\\nAls een tweeling geboren wordt, bezoeken de ouders een Babalawo. De eerstgeborene krijgt de naam Taiyewo, Tayewo, Taiwo, Taiye of Taye, wat betekent de eerste om de wereld te zien. De tweede heet Kehinde, de laatste die kwam. Een kind dat na een tweeling komt heet Idowu. Het kind daarna heet Alaba. Daarna komt Oni en Ola of Idogbe.\\nVolgens de Yoruba zendt Kehinde Taiyewo om te zien hoe het leven op aarde is en om te zeggen of het goed is. Taiyewo communiceert met Kehinde door zijn manier van huilen. Taiyewo geldt als rustig, kalm en introvert. Kehinde geldt als extravert."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_des_Pyr%C3%A9n%C3%A9es-Orientales","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Le_ch%C3%A2teau%2C_Montalba.jpg","page_title":"Liste des monuments historiques des Pyrénées-Orientales","context_page_description":"Cet article recense les monuments historiques des Pyrénées-Orientales, en France.\\nPour les monuments historiques de Perpignan, voir la liste des monuments historiques de Perpignan.\\nPour les monuments historiques de Villefranche-de-Conflent, voir la liste des monuments historiques de Villefranche-de-Conflent."},{"page_url":"https://tr.wikipedia.org/wiki/Fran%C3%A7ois_Achille_Bazaine","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Bazaine.jpeg","page_title":"François Achille Bazaine","context_page_description":"François Achille Bazaine, İkinci İmparatorluk döneminde üstün hizmetler verdikten sonra, Fransız-Alman Savaşı sırasında, 27 Ekim 1870'te Metz'i Almanlara bırakarak 140 bin askeriyle birlikte teslim olduğu için idama mahkûm edilen Fransız mareşal.\\n1833'te teğmen oldu. Kırım Savaşı arasında albay rütbesiyle bir tugayı komuta etti ve 1855'te tümgeneralliğe yükseltilerek Sivastopol valiliğine atandı.Fransa'nın Sardinya'yla birlikte Avusturya'ya karşı açtığı savaşta, 24 Haziran 1859'da Salaferino'yu aldı. 1863'te Meksika'ya gönderildi. O yılın Mayıs ayında Pueblo'yu ele geçirdi ve Fransız sefer kuvvetlerinin komutanı oldu. 5 Eylül 1864'te mareşalliğe yükseltildi.\\n10 Ağustos 1870'te, Fransız-Alman Savaşı'nın ilk önemli çarpışmasından hemen sonra başkomutanlığa atandı. Birkaç sonuçsuz çatışmadan sonra, Metz'deki müstahkem mevkiye çekildi. Fransızların 1 Eylül'de Sedan'daki yenilgilerinden sonra, Prusya şansölyesi Otto von Bismarck'la görüşerek 140 bin kişilik ordusuyla birlikte teslim oldu.\\nBu yüzden bir askeri mahkeme 10 Aralık 1873'te Bazaine'in, rütbesinin geri alınarak idam edilmesine karar verdi.Fransa cumhurbaşkanı Mareşal Patrice de Mac-Mahon, bu kararı 20 yıl hapse çevirdi."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D0%B5%D0%BE%D0%B3%D1%80%D0%B0%D1%84%D1%96%D1%8F_%D0%94%D0%B0%D0%BD%D1%96%D1%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Denmark-Hedeland-amphitheatre.jpg","page_title":"Географія Данії","context_page_description":"Данія — північноєвропейська країна, що розташована на Ютландському півострові й прилеглих островах Балтійського і Північного морів. До Данії відносяться також Фарерські острови в Північній Атлантиці й острів Ґренландія у Північній Америці. Загальна площа країни 43 094 км², з яких на суходіл припадає 42 434 км², а на поверхню внутрішніх вод — 660 км². Площа країни удвічі більша за площу Львівської області України. Загальна протяжність узбережжя континентальної Данії становить понад 7 тис. км. Данія межує суходолом лише з Німеччиною, довжина спільного державного кордону — 68 км. Рельєф країни — горбиста рівнина. Країна має помірний морський клімат з невеликими добовими і сезонними амплітудами температури повітря, що у поєднанні з достатньо родючими ґрунтами створює привабливі умови для інтенсивного сільського господарства. Рослинність прадавніх широколистяних лісів і вересових пусток здебільшого поступилась агробіоценозам полів і пасовищ інтенсивного агропромислового комплексу, культурним урбанізованим ландшафтам населених пунктів, шляхів сполучення. Природа країни охороняється в численних заповідниках, національних парках, ботанічних і орнітологічних заказниках."},{"page_url":"https://de.wikipedia.org/wiki/Ferrari_F2002","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Mschumacher_2002.jpg","page_title":"Ferrari F2002","context_page_description":"Der Ferrari F2002, oder von den Medien auch Rote Göttin genannt, war der 35. Formel-1-Rennwagen der Scuderia Ferrari. Er nahm an 15 der 17 Rennen der Formel-1-Weltmeisterschaft 2002 teil, nachdem man die Saison mit dem Vorjahreswagen, dem F2001, gestartet war. Außerdem wurden die ersten vier Rennen der Formel-1-Weltmeisterschaft 2003 mit dem F2002 gefahren. Mit diesem Rennwagen verteidigte Michael Schumacher seinen Weltmeistertitel, sowie Ferrari die Konstrukteurswertung."},{"page_url":"https://cs.wikipedia.org/wiki/Kuzn%C4%9Bck","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Coat_of_Arms_of_Kuznetsk_%28Penza_oblast%29.png","page_title":"Kuzněck","context_page_description":"Kuzněck je město v Penzenské oblasti v Ruské federaci. Při sčítání lidu v roce 2010 měl bezmála devadesát tisíc obyvatel, čímž byl druhé největší město oblasti."},{"page_url":"https://en.wikipedia.org/wiki/Laughing_kookaburra","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/DSC_0276%281%29.jpg","page_title":"Laughing kookaburra","context_page_description":"The laughing kookaburra is a bird in the kingfisher subfamily Halcyoninae. It is a large robust kingfisher with a whitish head and a brown eye-stripe. The upperparts are mostly dark brown but there is a mottled light-blue patch on the wing coverts. The underparts are cream-white and the tail is barred with rufous and black. The plumage of the male and female birds is similar. The territorial call is a distinctive laugh that is often delivered by several birds at the same time, and is widely used as a stock sound effect in situations that involve a jungle setting.\\nThe laughing kookaburra is native to eastern mainland Australia, but has also been introduced to parts of New Zealand, Tasmania, and Western Australia. It occupies dry eucalypt forest, woodland, city parks and gardens. This species is sedentary and occupies the same territory throughout the year. It is monogamous, retaining the same partner for life. A breeding pair can be accompanied by up to five fully grown non-breeding offspring from previous years that help the parents defend their territory and raise their young."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A4%D1%80%D0%B8%D0%B4%D1%80%D0%B8%D1%85_%D1%84%D0%BE%D0%BD_%D0%A5%D0%BE%D0%B5%D0%BD%D1%86%D0%BE%D0%BB%D0%B5%D1%80%D0%BD-%D0%97%D0%B8%D0%B3%D0%BC%D0%B0%D1%80%D0%B8%D0%BD%D0%B3%D0%B5%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Princess_Louisa_of_Hohenzollern_%281859-1948%29.jpg","page_title":"Фридрих фон Хоенцолерн-Зигмаринген","context_page_description":"Фридрих Евгений Йохан фон Хоенцолерн-Зигмаринген от род Хоенцолерн е принц от Хоенцолерн-Зигмаринген и генерал на кавалерията на пруската армия.\\nТой е най-малкият син на княз Карл Антон фон Хоенцолерн-Зигмаринген и съпругата му принцеса Йозефина Фредерика Луиза фон Баден, дъщеря на велик херцог Карл Лудвиг Фридрих фон Баден и Стефани дьо Боарне.\\nСлед образованието си Фридрих предприема дълги пътувания от 1861 до 1864 г. до Австрия, Италия, Швейцария и Англия. През 1860-те години и 1870-те години той пътува до Италия, Египет и Гърция.\\nПрез есента 1862 г. Фридрих Евгений започва военната си кариера в пруската армия. PПрез 1866 г. той участва в Австрийско-пруската война, и 1870 – 1871 г. във Френско-пруската война. От 17 юни 1889 до 21 септември 1893 г. той командва 22. дивизия. От 1893 до 1896 г. той е командващ генерал на 3. пруски армейски корпс.\\nФридрих отказва да вземе „испанската корона“.\\nФридрих умира бездетен на 61 години на 2 декември 1904 г. в Мюнхен и е погребан на 6 декември 1904 г. в църквата в манастир Хедингер в Зигмаринген."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A8%D0%B5%D0%B2%D1%87%D0%B5%D0%BD%D0%BA%D0%BE_(%D0%A1%D0%BB%D0%B0%D0%B2%D1%83%D1%82%D1%81%D0%BA%D0%B8%D0%B9_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Shevchenko_slav_gerb.png","page_title":"Шевченко (Славутский район)","context_page_description":"Шевченко — село в Славутском районе Хмельницкой области Украины.\\nНаселение по переписи 2001 года составляло 153 человек. Почтовый индекс — 30018. Телефонный код — 3842. Занимает площадь 0,79 км². Код КОАТУУ — 6823985304."},{"page_url":"https://en.wikipedia.org/wiki/Red_fox","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Vulpes_vulpes_schrencki_01.jpg","page_title":"Red fox","context_page_description":"The red fox is the largest of the true foxes and one of the most widely distributed members of the order Carnivora, being present across the entire Northern Hemisphere including most of North America, Europe and Asia plus parts of Northern Africa. It is listed as least concern by the IUCN. Its range has increased alongside human expansion, having been introduced to Australia, where it is considered harmful to native mammals and bird populations. Due to its presence in Australia, it is included on the list of the \\"world's 100 worst invasive species\\".\\nThe red fox originated from smaller-sized ancestors from Eurasia during the Middle Villafranchian period, and colonised North America shortly after the Wisconsin glaciation. Among the true foxes, the red fox represents a more progressive form in the direction of carnivory. Apart from its large size, the red fox is distinguished from other fox species by its ability to adapt quickly to new environments. Despite its name, the species often produces individuals with other colourings, including leucistic and melanistic individuals."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D8%A7%D8%AC%D9%8A_%D8%B3%D9%88%D8%B3%D9%8A%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Alagie_Sosseh.jpg","page_title":"الاجي سوسيه","context_page_description":"الاجي سوسيه ‏ هو لاعب كرة قدم غامبي في مركز الدفاع. شارك مع منتخب غامبيا لكرة القدم. أما مع النوادي، فقد لعب مع نادي فريدريكستاد ونادي ميوندالن ونادي هاماربي لكرة القدم ونادي مشكي بوشان وHammarby Talang FF وأي كي سيريوس و وHammarby IF وLandskrona BoIS ونادي إسكلستونا وNest-Sotra Fotball."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A9%D7%9C%D7%99%D7%98%D7%99_%D7%91%D7%95%D7%A1%D7%A0%D7%99%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Tvrtko.png","page_title":"שליטי בוסניה","context_page_description":"אחרי עלייתם לכס המלכות כל מלכי בוסניה הוסיפו לשמם את שם הכבוד \\"סטייפן\\"."},{"page_url":"https://fr.wikipedia.org/wiki/NGC_4032","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/NGC_4032_SDSS.jpg","page_title":"NGC 4032","context_page_description":"NGC 4032 est une galaxie irrégulière magellanique située dans la constellation de la Chevelure de Bérénice à environ 58 millions d'années-lumière. NGC 4032 a été découvert par l'astronome germano-britannique William Herschel en 1785.\\nLa classe de luminosité de NGC 4032 est V-VI et elle présente une large raie HI."},{"page_url":"https://cy.wikipedia.org/wiki/Sgrech_asur","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0c/CyanocoraxCaeruleusHabitat.jpg","page_title":"Sgrech asur","context_page_description":"Aderyn a rhywogaeth o adar yw Sgrech asur a adnabyddir hefyd gyda'i enw gwyddonol Cyanocorax caeruleus; yr enw Saesneg arno yw Azure jay. Mae'n perthyn i deulu'r Brain sydd yn urdd y Passeriformes.\\nTalfyrir yr enw Lladin yn aml yn C. caeruleus, sef enw'r rhywogaeth. Mae'r rhywogaeth hon i'w chanfod yn Ne America."},{"page_url":"https://ro.wikipedia.org/wiki/List%C4%83_de_localit%C4%83%C8%9Bi_din_jude%C8%9Bul_Sibiu","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/05/Leschkirch_bl.jpg","page_title":"Listă de localități din județul Sibiu","context_page_description":"Această listă este generată cu date din Wikidata și este actualizată periodic de un robot.\\nEditările făcute în listă vor fi șterse la următoarea actualizare!\\nSfârșitul listei autogenerate."},{"page_url":"https://eu.wikipedia.org/wiki/Himantura_imbricata","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Himantura_maldives.jpg","page_title":"Himantura imbricata","context_page_description":"Himantura imbricata Himantura generoko animalia da. Arrainen barruko Dasyatidae familian sailkatzen da."},{"page_url":"https://pl.wikipedia.org/wiki/Annweiler_am_Trifels","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Annweiler-St_Josef-06-2019-gje.jpg","page_title":"Annweiler am Trifels","context_page_description":"Annweiler am Trifels – niemieckie miasto położone w kraju związkowym Nadrenia-Palatynat, w powiecie Südliche Weinstraße, siedziba gminy związkowej Annweiler am Trifels. Miasto leży nad rzeką Queich i jest położone o ok. 12 km od miasta Landau in der Pfalz. Populacja miasta wynosi 6 889 mieszkańców."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%BB%D0%B0%D0%B3%D0%BE%D0%B4%D0%B0%D1%80%D0%BD%D0%BE%D1%81%D1%82%D1%8C_%D0%92%D0%B5%D1%80%D1%85%D0%BE%D0%B2%D0%BD%D0%BE%D0%B3%D0%BE_%D0%B3%D0%BB%D0%B0%D0%B2%D0%BD%D0%BE%D0%BA%D0%BE%D0%BC%D0%B0%D0%BD%D0%B4%D1%83%D1%8E%D1%89%D0%B5%D0%B3%D0%BE_%D0%92%D0%BE%D0%BE%D1%80%D1%83%D0%B6%D1%91%D0%BD%D0%BD%D1%8B%D0%BC%D0%B8_%D1%81%D0%B8%D0%BB%D0%B0%D0%BC%D0%B8_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%BE%D0%B9_%D0%A4%D0%B5%D0%B4%D0%B5%D1%80%D0%B0%D1%86%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/%D0%91%D0%BB%D0%B0%D0%B3%D0%BE%D0%B4%D0%B0%D1%80%D0%BD%D0%BE%D1%81%D1%82%D1%8C_%D0%92%D0%B5%D1%80%D1%85%D0%BE%D0%B2%D0%BD%D0%BE%D0%B3%D0%BE_%D0%93%D0%BB%D0%B0%D0%B2%D0%BD%D0%BE%D0%BA%D0%BE%D0%BC%D0%B0%D0%BD%D0%B4%D1%83%D1%8E%D1%89%D0%B5%D0%B3%D0%BE_%D0%92%D0%A1_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B8.png","page_title":"Благодарность Верховного главнокомандующего Вооружёнными силами Российской Федерации","context_page_description":"Благодарность Верховного Главнокомандующего Вооружёнными Силами Российской Федерации — форма поощрения за заслуги в исполнении воинского долга, обеспечении безопасности государства и укреплении его обороноспособности."},{"page_url":"https://en.wikipedia.org/wiki/Transportation_in_Richmond,_Virginia","image_url":"https://upload.wikimedia.org/wikipedia/en/0/0b/GRTC_Pulse_2019-05-11.jpeg","page_title":"Transportation in Richmond, Virginia","context_page_description":"Transportation in Richmond, Virginia and its immediate surroundings include land, sea and air modes. While almost all of Henrico County would be considered part of the Richmond area, southern and eastern portions of Chesterfield adjoin the three smaller independent cities of Petersburg, Hopewell, and Colonial Heights, collectively commonly called the Tri-Cities area. A largely rural section of southwestern Chesterfield may be considered not a portion of either suburban area.\\nRichmond-Petersburg metropolitan area is considered by many criteria to include the Tri-Cities area and many more surrounding counties, incorporated towns, and unincorporated communities."},{"page_url":"https://es.wikipedia.org/wiki/Condado_de_Cherokee_(Carolina_del_Sur)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Map_of_South_Carolina_highlighting_Cherokee_County.svg","page_title":"Condado de Cherokee (Carolina del Sur)","context_page_description":"El condado de Cherokee, fundado en 1897, es uno de los 46 condados del estado estadounidense de Carolina del Sur. En el año 2000 tenía una población de 52 537 habitantes con una densidad poblacional de 52 personas por km².​ La sede del condado es Gaffney.​"},{"page_url":"https://it.wikipedia.org/wiki/Gorgier","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Gorgier_201214_c.jpg","page_title":"Gorgier","context_page_description":"Gorgier è un comune svizzero di 2 004 abitanti del Canton Neuchâtel, nel distretto di Boudry, sul lago di Neuchâtel."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_Herford","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Stolpersteinlage_Herford_Kirchgasse_4.JPG","page_title":"Liste der Stolpersteine in Herford","context_page_description":"Die Liste der Stolpersteine in Herford enthält alle Stolpersteine, die im Rahmen des gleichnamigen Projekts von Gunter Demnig in Herford verlegt wurden. Mit ihnen soll an Opfer des Nationalsozialismus erinnert werden, die in Herford lebten und wirkten."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A1%D0%B5%D0%BD%D0%B0_(%D1%80%D0%B0%D0%BA%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/The_Seine_as_seen_from_the_Eiffel_Tower%2C_June_2002.jpg","page_title":"Сена (рака)","context_page_description":"Се́на — рака на поўначы Францыі.\\nДаўжыня 776 км, плошча басейну 78,6 тыс. км². Упадае ў праліў Ла-Манш, утвараючы эстуарый. Сярэдні расход вады 400–500 м³/с, зімовыя паводкі. У ніжнім цячэнні адчувае ўплыў прыліваў. Суднаходная ніжэй горада Труа. Злучаная каналамі з Шэльдай, Маасам, Рэйнам, Ронай, Луарай, Сонай. На Сене — гарады Парыж, Руан, у эстуарыі — порт Гаўр."},{"page_url":"https://cs.wikipedia.org/wiki/Blackburn_Firebrand","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Blackburn_TF_Mk._IV.jpg","page_title":"Blackburn Firebrand","context_page_description":"Blackburn Firebrand byl britský jednomístný jednomotorový stíhací a stíhací-torpédový letoun vyvíjený za druhé světové války. Během konfliktu se nepodařilo typ dokončit v přijatelné podobě, a tak vstoupil do služby u Fleet Air Arm až po válce.\\nNa začátku války nemělo britské námořní letectvo výkonné stíhací letouny, které by splňovaly všechny předpoklady pro palubní provoz a zároveň byly svými výkony srovnatelné se stíhačkami operujícími z pevniny. Tuto situaci řešila britská Admiralita jednak nákupem strojů z USA, a jednak rychlou úpravou stávajících pozemních stíhaček. Zároveň se ale rozhodla objednat u domácích výrobců stroj, který měl být od samého počátku projektovaný pro britské letadlové lodě, a tudíž se od něj očekávalo, že svými výkony a vlastnostmi předčí stávající letadla.\\nSamotný vývoj letadla s označením B.37 Firebrand začal v roce 1940 pod vedením C. E. Pettyho, hlavního konstruktéra firmy Blackburn v Brough."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%96%AC%E6%B2%BB%E4%BA%9E%C2%B7%E6%AD%90%E5%A7%AC%E8%8A%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/O%27Keeffe-%28hands%29.jpg","page_title":"喬治亞·歐姬芙","context_page_description":"喬治亞·歐姬芙是一位美國藝術家，被列為20世紀的藝術大師之一。歐姬芙的繪畫作品已經成為1920年代美國藝術的經典代表，她以半抽象半寫實的手法聞名，其主題相當具有特色，多為花朵微觀、岩石肌理變化，海螺、動物骨頭、荒涼的美國內陸景觀為主。她的作品中常充滿著同色調的細微變化，組成具有韻律感的構圖，某些時候歐姬芙畫中的物品外輪廓，讓觀者感到此物品的清脆感。"},{"page_url":"https://en.wikipedia.org/wiki/Pyongsong","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bd/DPRK2006_Pyongnam-Pyongsong.PNG","page_title":"Pyongsong","context_page_description":"P'yŏngsŏng is a city in North Korea, the capital city of South P'yŏngan province in western North Korea. The city is located about 32 kilometres northeast of P'yŏngyang, and was formally established in December 1969. It has a population of 284,386."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AF%D8%A7%D9%86%D8%B4%DA%AF%D8%A7%D9%87_%DA%A9%D8%A7%D9%84%DB%8C%D9%81%D8%B1%D9%86%DB%8C%D8%A7%D8%8C_%D8%B3%D9%86_%D8%AF%DB%8C%DA%AF%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/UCSD-Warren_Pano.jpg","page_title":"دانشگاه کالیفرنیا، سن دیگو","context_page_description":"دانشگاه کالیفرنیا از دانشگاه‌های ایالتی آمریکا به حساب می‌آید. این دانشگاه در محله لاهویا شهر سن دییگو از ایالت کالیفرنیا واقع است.\\nکتابخانه مرکزی این دانشگاه به افتخار دکتر سوس نامگذاری شده‌است. مساحت این دانشگاه حدود ۸۶۶ هکتار در نزدیکی اقیانوس آرام، است که پردیس اصلی در حدود ۴۶۶ هکتار می‌باشد. دانشگاه کالیفرنیا سن دیگو در سال ۱۹۶۰ در نزدیکی مؤسسه اقیانوس‌شناسی Scripps تأسیس شده‌است و در بین ۱۰ دانشگاه با قدمت کالیفرنیا در رتبه هفتم قرار دارد و بیش از ۲۰۰ برنامه کارشناسی و تحصیلات تکمیلی را ارائه می‌دهد. در سال ۲۰۱۹ تعداد کل دانشجویان این دانشگاه ۳۳۹۳۵ اعلام شده‌است که از این میان ۸۱ درصد آن را دانشجویان دوره کارشناسی و ۱۹ درصد را دانشجویان تحصیلات تکمیلی تشکیل می‌دهند. تا اوت ۲۰۱۸، استادان، محققان و فارغ التحصیلان دانشگاه کالیفرنیا سن دیگو موفق به کسب ۲۰ جایزه نوبل، ۳مدال فیلدز، ۸ مدال ملی علوم آمریکا، ۸ فلوشیپ مک آرتور و ۲ جایزه پولیتزر شده‌اند. علاوه براین در حال حاضر ۲۹ استاد این دانشگاه در آکادمی ملی مهندسی آمریکا، ۷۰ استاد در آکادمی ملی علوم آمریکا، ۴۵ استاد در انستیتو پزشکی و ۱۱۰ استاد در آکادمی ملی علوم و هنر آمریکا عضو هستند."},{"page_url":"https://zh.wikipedia.org/zh-cn/1818%E5%B9%B410%E6%9C%8829%E6%97%A5%E6%97%A5%E9%A3%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/SE1818Oct29T.gif","page_title":"1818年10月29日日食","context_page_description":"1818年10月29日日食为一次在协调世界时1818年10月29日出现的日全食。该次日食食分为1.0241，食甚维持1分51秒。新月当天，地球上观测到月球和太阳的角距离极小，此时月球如果恰好在月球交点附近，穿过太阳和地球之间，与地球、太阳接近一直线，则会出现日食。月球本影接触地表而使该区域完全得不到阳光，就会形成日全食，同时在本影两侧数千公里的半影范围内遮挡部分阳光，则形成日偏食。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Naturschutzgebiete_in_der_Steiermark","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Seemoos2.JPG","page_title":"Liste der Naturschutzgebiete in der Steiermark","context_page_description":"In der Steiermark sind folgende Gebiete als Naturschutzgebiet ausgewiesen:"},{"page_url":"https://oc.wikipedia.org/wiki/Grandval","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Chateau_Alleuze_2.png","page_title":"Grandval","context_page_description":"Grandval es una comuna gevaudanesa situada dins lo departament de Losera e la region d'Occitània, ancianament de Lengadòc-Rosselhon."},{"page_url":"https://nv.wikipedia.org/wiki/Naakaii_Bik%C3%A9yahd%C4%99%CC%81%C4%99%CC%81%CA%BC_ts%C4%AFsg%C4%85k%C3%A1%C3%A1%CA%BC_dah_sid%C3%A1h%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Northern_Potoo_%28Nyctibius_jamaicensis%29_%283323628989%29.jpg","page_title":"Naakaii Bikéyahdę́ę́ʼ tsįsgąkááʼ dah sidáhí","context_page_description":"Naakaii Bikéyahdę́ę́ʼ tsįsgąkááʼ dah sidáhí éí yótʼáahdi tsídii dah yikahjí atah yisdzoh, áádóó éí Naakaii Bikéyahdi dóó Shádiʼááhjí kéyah dah siʼánígíí hólǫ́; ndaʼałkaahí dóó ééʼdeetįįhii éí \\"Nyctibius jamaicensis\\" deiłníigo dayózhí. Azhą́ néʼéshjaaʼ nahalin ndi, doo néʼéshjaaʼ átʼée da."},{"page_url":"https://nl.wikipedia.org/wiki/%27t_Vossenhol","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Edenflip.JPG","page_title":"'t Vossenhol","context_page_description":"Stichting zeilschool 't Vossenhol dateert uit 1947 en is daarmee een van de oudste zeilscholen van Nederland. De stichting organiseert zomerkampen voor jongeren en gehandicapten.\\nOp 8 juli 1947 werd de 'Stichting ter Bevordering ener Gezonde Watersport' opgericht, met als doel 'het bevorderen van een uit moreel en lichamelijk oogpunt gezonde watersport'. Later veranderde de naam in 'Stichting 't Vossenhol'. Oprichters waren de pastoor uit Warmond, Jan van der Lugt, die zelf graag zeilde samen met Menno Gijsen, een zeiler. De pastoor had een pedagogisch doel voor ogen, hij wilde dat jongeren leerden zeilen met moreel besef en goed gedrag. Hij ergerde zich namelijk aan het gedrag van de zeilers op de Kagerplas die vaak zonder T-shirt aan en met veel geschreeuw in hun zeilboot zaten.\\nDe zeilkampen werden aanvankelijk georganiseerd bij een boerderij in Oud Ade en sinds 1948 vanuit een buitenhuisje aan de Kaag dat eigendom was van ingenieur Vos. Dit weekeindhuis had de naam 't Vossenhol. Dit zou later de naam van de stichting worden. In 1962 verhuisden de zeilkampen naar de huidige locatie aan de Kaag aan de Hellegatspolder achter de boerderij van boer Pennings."},{"page_url":"https://ht.wikipedia.org/wiki/Ambrose,_Dakota_din%C3%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Ambrose%2C_North_Dakota_5-21-2008.jpg","page_title":"Ambrose, Dakota dinò","context_page_description":"Ambrose se yon vil nan eta Dakota dinò, nan Etazini."},{"page_url":"https://ja.wikipedia.org/wiki/TempleOS","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/TempleOS_4.05_session.png","page_title":"TempleOS","context_page_description":"TempleOSは、聖書で預言されている第三神殿となるように設計された、聖書をテーマにした軽量のオペレーティングシステムです。 アメリカのプログラマー、「テリー・A・デイビス」によって作成されました。「テリー・A・デイビス」は、彼が後に神からの啓示として述べた一連のエピソードの10年後に単独で開発しました。\\nシステムは、DOSとTurbo Cの混合に似たインターフェースを使用した、最新のx86-64 Commodore 64として特徴付けられました。デイビスは、640x480解像度、16色ディスプレイ、単一音声音声などのシステムの機能を明示的に宣言しました 神から彼に指示された。 BASICの代わりにC言語のオリジナルのバリエーションでプログラムされ、オリジナルのフライトシミュレータ、コンパイラ、カーネルが含まれていました。\\nTempleOSは2013年にリリースされ、最後に2017年に更新されました。これは、技術コミュニティで大きな好評を得て受け取られ、Davisは小さなオンラインのフォロワーを獲得しました。 彼は2018年8月11日に亡くなりました。"},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Hu%C3%A9rcanos","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/ca/Panor%C3%A1mica_de_Hu%C3%A9rcanos_26314.jpg","page_title":"Huércanos","context_page_description":"Huércanos sī tī Se-pan-gâ La Rioja siā-lí ê chi̍t ê municipio."},{"page_url":"https://mn.wikipedia.org/wiki/%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D1%81_%D0%91%D1%80%D0%B0%D0%B2%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Nicol%C3%A1s_Bravo_%28Joaqu%C3%ADn_Ram%C3%ADrez%29.jpg","page_title":"Николас Браво","context_page_description":"Николас Браво Руэда нь Мексикийн 11 дэх ерөнхийлөгч, цэргийн зүтгэлтэн. Тэрээр Мексикийн тусгаар тогтнолын дайн, 1846–1848 оны Мексик–Америкийн дайнуудад оролцож байв."},{"page_url":"https://eo.wikipedia.org/wiki/Salatcikorio","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/60/RadicchioCastelfrancoKopf.jpg","page_title":"Salatcikorio","context_page_description":"Salatcikorio estas la unu el la kulturformo de la amara cikorio, de kiu ekzistas diversaj kultivaraj grupo. La alia kulturformo estas la brusela cikorio, laŭ NPIV „Kf. de la amara cikorio, kun longe pomforma foliaro, kiun oni etioligas k manĝas kruda aŭ kuirita“."},{"page_url":"https://en.wikipedia.org/wiki/Vernon_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Vernon_Park_-_geograph.org.uk_-_1333876.jpg","page_title":"Vernon Park","context_page_description":"Vernon Park is the oldest country park in Stockport, Greater Manchester, England. The Victorian park contains the Vernon Park Museum."},{"page_url":"https://de.wikipedia.org/wiki/Stacheltang","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Desmarestia_aculeata_Helgoland.JPG","page_title":"Stacheltang","context_page_description":"Der Stacheltang ist eine Braunalgenart aus der Ordnung der Desmarestiales. Verbreitet in Nordatlantik und Nordpazifik, kommt er auch in der Nordsee und Ostsee vor. Sein stacheliges Aussehen weist er nur im Sommer und Herbst auf."},{"page_url":"https://de.wikipedia.org/wiki/Huttenheim_(Philippsburg)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/48/Huttenheim_Church_Inside.JPG","page_title":"Huttenheim (Philippsburg)","context_page_description":"Huttenheim ist ein Stadtteil von Philippsburg im Landkreis Karlsruhe in Baden-Württemberg. Der am 1. Januar 1973 eingemeindete Stadtteil hat heute ungefähr 2600 Einwohner. Nachbarortschaften sind Neudorf, Rußheim, Rheinsheim und die Stadt Philippsburg. Zurzeit ist Markus Heil Ortsvorsteher von Huttenheim."},{"page_url":"https://es.wikipedia.org/wiki/Modernismo_en_Zaragoza","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Casino_Mercantil_de_Zaragoza.jpg","page_title":"Modernismo en Zaragoza","context_page_description":"El modernismo zaragozano fue un movimiento poco ostentoso, aunque en algún caso, se perciban las enseñanzas de maestros foráneos, como en la Casa Juncosa de José de Yarza Echenique, en la que se advierte el influjo de Lluís Domènech i Montaner. En general se adscribió a los edificios privados de vivienda, y se interesó más por la ornamentación de sus fachadas a la vista que de soluciones integrales estructurales verdaderamente modernas.\\nAunque durante mucho tiempo se ha venido atribuyendo a Ricardo Magdalena la autoría de la mayoría de los edificios de habitación modernistas, tras las investigaciones en los archivos municipales de 1986, se sabe que no realizó ninguno de los edificios que se le asignaron, aunque, como arquitecto de la ciudad, intervino en la aprobación de muchos de ellos.​\\nSon los jóvenes arquitectos José de Yarza Echenique, Julio Bravo Folch, o el talaverano Juan Francisco Gómez Pulido quienes erigieron la mayor parte de los edificios modernistas de la ciudad, concentrándose particularmente en el Paseo de Sagasta."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AC%D9%88%D8%A7%D8%AF_%D9%86%D9%83%D9%88%D9%86%D8%A7%D9%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Esteghlal_FC_vs_Foolad_FC%2C_29_August_2019_-_6.jpg","page_title":"جواد نكونام","context_page_description":"جواد نكونام، من مواليد 7 سبتمبر 1980 في مدينة الري بإيران هو لاعب كرة قدم إيراني، يلعب مع نادي أوساسونا الإسباني، وقد شارك في كأس العالم لكرة القدم 2006 وكأس العالم لكرة القدم 2014.\\nبدأ نكونام مسيرته الكروية مع نادي باس طهران في عام 1998، ولعب له حتى عام 2005، وبعدها انتقل إلى نادي الوحدة الإماراتي، ثم تمت إعارته إلى نادي الشارقة الإماراتي، وفي موسم 2006/2007 انتقل إلى نادي أوساسونا الإسباني.\\nولعب نيكونام مع منتخب إيران لكرة القدم من عام 2000 إلى 2015م."},{"page_url":"https://en.wikipedia.org/wiki/Mount_Samat_National_Shrine","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Shrine_of_Valor_Memorial_Cross.jpg","page_title":"Mount Samat National Shrine","context_page_description":"Mount Samat National Shrine or Dambana ng Kagitingan is a historical shrine located near the summit of Mount Samat in the town of Pilár, Province of Bataan, in the Republic of the Philippines. The memorial shrine complex was built to honor and remember the gallantry of Filipino and American soldiers who fought against the Imperial Japanese Army during World War II.\\nConsisting of a Colonnade and the large Memorial Cross, the park was commissioned in 1966 by then-President Ferdinand Marcos, for the 25th Anniversary of World War II. The white Memorial Cross stands as a remembrance to the soldiers who fought and lost their lives in the Battle of Bataan. The shrine complex also includes a war museum with a wide array of collections from paintings of the Philippine heroes, to armaments used by the Filipino, American and Japanese forces during the battle.\\nFrom the colonnade and the cross, there is a panoramic view of Bataan, Corregidor Island and on a clear day, the city of Manila situated about 50 km across Manila Bay."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%85%AB%E9%98%AA%E7%A5%9E%E7%A4%BE_(%E5%AE%9D%E5%A1%9A%E5%B8%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Takarazuka-Yasaka-jinja1.jpg","page_title":"八阪神社 (宝塚市)","context_page_description":"八阪神社は兵庫県宝塚市平井にある神社である。\\n旧川辺郡平井村の村社。\\n例祭はだんじり祭が行われる。"},{"page_url":"https://azb.wikipedia.org/wiki/%D8%AA%D8%A7%D9%82%D8%A7%D8%AC%D9%88%D8%8C_%D9%85%DB%8C%D8%A7%D9%82%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Flag_of_Takajo_Miyagi.JPG","page_title":"تاقاجو، میاقی","context_page_description":"تاقاجو، میاقی ژاپون اؤلکه‌سینده یئر آلان بیر شهردیر و میاقی اوستانینده یئرلشیب. ۲۰۱۵-جی ایلين نۆفوس ساییمی اساسیندا 62329 نفر دیر."},{"page_url":"https://fr.wikipedia.org/wiki/Vautour_royal","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Sarcogyps_calvus_-Berlin_Zoo_-upper_body-8a.jpg","page_title":"Vautour royal","context_page_description":"Le Vautour royal est une espèce asiatique d'oiseaux charognards, très menacée selon l'UICN. C'est la seule espèce du genre Sarcogyps."},{"page_url":"https://fr.wikipedia.org/wiki/Kikonai","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a7/Kikonai_Town_Hall.jpg","page_title":"Kikonai","context_page_description":"Kikonai est un bourg du district de Kamiiso, situé dans la sous-préfecture d'Oshima, sur l'île de Hokkaidō, au Japon."},{"page_url":"https://en.wikipedia.org/wiki/Tenement_House_(Glasgow)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Dressing_table_-_The_bedroom_-_The_Tenement_House%2C_145_Buccleuch_Street%2C_Garnethill%2C_Glasgow_%2822944872893%29.jpg","page_title":"Tenement House (Glasgow)","context_page_description":"The Tenement House is a historic house museum in Glasgow, owned and operated by the National Trust for Scotland.\\nIt is located at 145 Buccleuch Street, in the Garnethill area, near Charing Cross railway station and Cowcaddens subway station. The property is a flat in an 1892 tenement building, preserved in its condition from the early 20th century. The flat was owned by Agnes Toward from 1911 until 1965; after her death it and its contents were acquired by the Trust, which opened it to the public. The museum received 17,053 visitors in 2018."},{"page_url":"https://fr.wikipedia.org/wiki/Croix_scandinave","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Staunton_flag1.png","page_title":"Croix scandinave","context_page_description":"La « croix scandinave » est un motif se retrouvant sur les drapeaux de certains pays nordiques, bien qu'on puisse les trouver aussi sur des drapeaux d'autres pays ou régions du monde."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D9%82%D8%A8%D8%B7%D8%A7%D9%86_%D8%B3%D9%86%D8%AF%D8%A8%D8%A7%D8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/MainTitleCaptSindbad1963Trailer.jpg","page_title":"القبطان سندباد","context_page_description":"القبطان سندباد هو فيلم مغامرات خيالي مستقل تم إنتاجه عام 1963، أنتجه فرانك كينج وهيرمان كنغ، من إخراج بايرون هاسكين، بطولة جاي ويليامز وهايدي برول. تم تصوير الفيلم في استوديوهات بافاريا للأفلام في ألمانيا وتم توزيعه من قبل مترو-غولدوين-ماير.\\nأعاد غاي إندور كتابة السيناريو، ثم أعيدت الكتابة مرة أخرى من قبل المنتج المشارك فرانك كينغ قبل أسبوع من التصوير من أجل خفض نفقات الإنتاج؛ تم إعادة تعريف الفيلم قبل إصداره. كما قام هاسكين بتصوير بعض المؤثرات الخاصة للفيلم الخاص بالتجربة التلفزيونية للفيلم في أم جي أم تيلفزيون، ولكن لم يتم أختيارها من أي شبكة."},{"page_url":"https://en.wikipedia.org/wiki/Holly_Madison","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Holly_Madison_11.jpg","page_title":"Holly Madison","context_page_description":"Holly Madison is an American model, showgirl, television personality and author. Madison is known for her role in the E! reality television show The Girls Next Door and for her own series, Holly's World. In July 2015, Madison released her first book and memoir, Down the Rabbit Hole: Curious Adventures and Cautionary Tales of a Former Playboy Bunny. In May 2016, she released her second book, The Vegas Diaries: Romance, Rolling the Dice, and the Road to Reinvention detailing her career and dating life in Las Vegas."},{"page_url":"https://fi.wikipedia.org/wiki/Kapteenin_tyt%C3%A4r","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Captain%27s_Daughter_1837.jpg","page_title":"Kapteenin tytär","context_page_description":"Kapteenin tytär on venäläisen kirjailijan Aleksandr Puškinin historiallinen romaani. Se ilmestyi 1836 kirjallisuuslehti Sovremennikissä. Teoksesta on ilmestynyt neljä suomennosta."},{"page_url":"https://vi.wikipedia.org/wiki/Amphicerus_bimaculatus","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Amphicerus_bimaculatus.jpg","page_title":"Amphicerus bimaculatus","context_page_description":"Amphicerus bimaculatus là một loài bọ cánh cứng trong họ Bostrichidae. Loài này được Olivier miêu tả khoa học năm 1790."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Hampton,_Virginia","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/FortWool.JPG","page_title":"National Register of Historic Places listings in Hampton, Virginia","context_page_description":"This is a list of the National Register of Historic Places listings in Hampton, Virginia.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in the independent city of Hampton, Virginia, United States. The locations of National Register properties and districts for which the latitude and longitude coordinates are included below, may be seen in an online map.\\nThere are 30 properties and districts listed on the National Register in the city, including 5 National Historic Landmarks. Another 2 properties were once listed but have been removed.\\nThis National Park Service list is complete through NPS recent listings posted September 13, 2019."},{"page_url":"https://es.wikipedia.org/wiki/Hospital_Universitario_La_Paz","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a9/Hospital_La_Paz.JPG","page_title":"Hospital Universitario La Paz","context_page_description":"El Hospital Universitario La Paz es un centro hospitalario de titularidad pública, situado en el distrito de Fuencarral-El Pardo de la ciudad de Madrid. Está administrado por el Servicio Madrileño de Salud, dependiente de la Consejería de Sanidad y es uno de los principales hospitales de referencia de España. También es centro de referencia nacional e internacional en varias áreas específicas de elevado nivel de desarrollo científico y tecnológico. Será remodelado en 2019, cuando se inicien las obras de demolición para construir, en 3 fases, un nuevo complejo hospitalario. Las obras durarán aproximadamente 10 años."},{"page_url":"https://en.wikipedia.org/wiki/Blaise_Nkufo","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/BlaiseNkufo.jpg","page_title":"Blaise Nkufo","context_page_description":"Isetsima Blaise Nkufo is a Swiss former international footballer who played as a striker.\\nHe was born in Zaire and raised in Switzerland from the age of seven. Nkufo played professionally in Switzerland, Qatar, Germany, the Netherlands, and the United States, scoring 209 goals in 442 career league appearances. Nkufo was also a member of the Swiss national team, having won 34 caps and scored seven goals. He played for them at the 2010 World Cup."},{"page_url":"https://fr.wikipedia.org/wiki/Festival_du_cin%C3%A9ma_am%C3%A9ricain_de_Deauville_2014","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Jessica_Chastain_Deauville_2014.jpg","page_title":"Festival du cinéma américain de Deauville 2014","context_page_description":"Le Festival du cinéma américain de Deauville 2014, la 40ᵉ édition du festival, a eu lieu du 5 au 14 septembre 2014.\\nLe jury est présidé par le réalisateur Costa-Gavras."},{"page_url":"https://fr.wikipedia.org/wiki/Jack_(film,_1916)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Jack_1916.jpg","page_title":"Jack (film, 1916)","context_page_description":"Jack est un court-métrage muet américain, réalisé par Frank Borzage et sorti en 1916."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D9%88%D8%B1%D9%8A%D8%A9_(%D9%82%D8%B5%D8%B1%D8%B4)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Coria.png","page_title":"قورية (قصرش)","context_page_description":"بلدية قورية، هي بلدية تقع في مقاطعة قصرش والتي تقع في منطقة إكستريمادورا، غرب إسبانيا.\\nيبلغ عدد سكانها 12.767 نسمة وفقاً لإحصائية سنة.و تبلغ مساحتها 103 كم2،و بذلك تكون الكثافة السكانية 123,95 نسمة/كم2. يبلغ ارتفاعها 280 م عن سطح البحر."},{"page_url":"https://de.wikipedia.org/wiki/Toomas_Hendrik_Ilves","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Toomas_Hendrik_Ilves_2011-12-19.jpg","page_title":"Toomas Hendrik Ilves","context_page_description":"Toomas Hendrik Ilves war vom 9. Oktober 2006 bis zum 10. Oktober 2016 Staatspräsident der Republik Estland."},{"page_url":"https://es.wikipedia.org/wiki/Jacques_de_Baerze","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9d/Baertz-saintsetmartyrs.jpg","page_title":"Jacques de Baerze","context_page_description":"Jacques de Baerze fue un escultor flamenco en madera, dos de cuyos retablos mayores tallados sobreviven en Dijon, que fue la capital del Ducado de Borgoña.\\nDe Baerze probablemente vino de Gante y vivió en Dendermonde, a unos treinta kilómetros de distancia, que no está lejos de Amberes y Bruselas. Era claramente un maestro bien establecido antes de la muerte en enero de 1384 del gobernante local, Luis II de Flandes, duque de Brabante, ya que se registran dos comisiones de Luis para producir retablos tallados, aunque las obras no han sobrevivido. Estos retablos fueron para la capilla del castillo de Dendermonde y para el hospicio de la abadía cisterciense de Bijloke en Gante.​\\nEstas obras fueron ordenadas por Felipe II de Borgoña, duque de Borgoña, yerno de Luis y su sucesor como Conde de Flandes. En 1385, Felipe fundó un monasterio cartujo, la Cartuja de Champmol, como lugar de entierro dinástico de los Valois borgoñones y lo llenó de impresionantes obras de arte."},{"page_url":"https://id.wikipedia.org/wiki/Htop","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Htop.png","page_title":"Htop","context_page_description":"htop adalah sebuah program interaktif untuk memantau proses sistem dan mengelola proses. htop dirancang sebagai program alternatif top di Unix. htop menampilkan daftar proses yang sering diperbarui yang berjalan di sebuah komputer, biasanya diurutkan berdasarkan penggunaan jumlah CPU. Tidak seperti top, htop menyediakan daftar lengkap proses program yang sedang berjalan, bukan proses program yang memakan banyak sumber daya. htop menggunakan warna untuk memberikan informasi visual, seperti status prosesor, swap, dan memori.\\nPengguna sering menggunakan htop dalam kasus di mana top tidak memberikan informasi yang cukup tentang proses sistem. htop juga populer digunakan secara interaktif sebagai monitor sistem. Dibandingkan dengan top, htop menyediakan antarmuka yang lebih nyaman, banyak visual, kursor yang bisa dikendalikan untuk mengirim sinyal ke proses.\\nhtop ditulis dalam bahasa pemrograman C menggunakan pustaka ncurses. Namanya berasal dari nama depan penulis asli, seperti pinfo, sebuah program pengganti info yang melakukan hal yang sama."},{"page_url":"https://tt.wikipedia.org/wiki/%D0%A2%D1%83%D1%80%D0%BD%D0%B5%D0%BC%D0%B8%D1%80_(%D0%90%D0%B2%D0%B5%D1%80%D0%BE%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Vue_d%E2%80%99ensemble_de_Tournemire_%28Aveyron%29.jpg","page_title":"Турнемир (Аверон)","context_page_description":"Турнемир — Франциянең Аверон департаментына караган коммуна, Сент-Африк кантонына карый."},{"page_url":"https://sv.wikipedia.org/wiki/Punkva","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Punkva_lodicky.JPG","page_title":"Punkva","context_page_description":"Punkva är ett vattendrag i Tjeckien. Det ligger i länet Södra Mähren, i den östra delen av landet, 180 km sydost om huvudstaden Prag.\\nTrakten ingår i den hemiboreala klimatzonen. Årsmedeltemperaturen i trakten är 8 °C. Den varmaste månaden är juli, då medeltemperaturen är 20 °C, och den kallaste är december, med -6 °C. Genomsnittlig årsnederbörd är 896 millimeter. Den regnigaste månaden är juni, med i genomsnitt 110 mm nederbörd, och den torraste är mars, med 36 mm nederbörd."},{"page_url":"https://hr.wikipedia.org/wiki/Zelenika_(biljni_rod)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Moneses_uniflora_13433.JPG","page_title":"Zelenika (biljni rod)","context_page_description":"Zelenika, monotipski biljni rod trajnica iz porodice vrjesovki, smješten u tribus Pyroloideae. Jedini joj je predstavnik vrsta jednocvjetna kruščica, nekada uključivana među ostalima i u rod Chimaphila.\\nVrsta je raširena po Europi, Rusiji i Sjevernoj Americi. Raste i u Hrvatskoj"},{"page_url":"https://eu.wikipedia.org/wiki/Toyota_Center","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Houston_Toyota_Center_-.jpg","page_title":"Toyota Center","context_page_description":"Toyota Center AEBtako Texas estatuko Houston hirian dagoen kirol pabilioi bat da. 2003an inauguratua izan zen eta Houston Rockets taldearen jokalekua da."},{"page_url":"https://tl.wikipedia.org/wiki/LED","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Al_Sheedakim_and_LED_Panel_at_Phlogiston_Research_in_Boston%2C_MA_--_May_2004.jpg","page_title":"LED","context_page_description":"Sa larangan ng elektronika, ang LED o light-emitting diode ay isang uri ilaw at duhandas na semikonduktor o malasaluyang lumilikha ng liwanag kapag ang saloy ng dagitab ay inakwa sa paharap na direksiyon ng kasangkapang ito, katulad ng sa payak na sirkit ng LED. Isang anyo ng elektroluminisensiya ang epekto nito kung saan lumalabas ang liwanag na inkoherente at may makitid na ispektrum mula sa dugtungan p-n. Malawakang ginagamit ang mga LED bilang mga ilaw na panghudyat sa mga kagamitang elektroniko at higit na lumalaganap na rin sa mga nangangailangan ng mas maraming enerhiyang katulad ng mga flashlight at pang-ilaw sa mga pook. Karaniwang isang maliit na bagay na pinagmumulan ng liwanag, kadalasang may dinaragdag na optiks o optiko sa tsip upang mahugisan ang padron ng radyasyon at makatulong sa repleksiyon. Umaayon ang kulay ng sinasaboy na liwanag sa kayarian at kalagayan ng ginamit na malasaluyang materyal, at maaaring inprared, nakikitang ispektro, o ultabiyoleta."},{"page_url":"https://de.wikipedia.org/wiki/Konstruktionsprofil","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Extruded_aluminium_section_x3.jpg","page_title":"Konstruktionsprofil","context_page_description":"Konstruktionsprofile sind im Strangpressverfahren hergestellte längliche Halbzeuge aus Aluminium.\\nEs gibt verschiedene Konstruktionsprofilgrößen und Profilgeometrien sowie Verbindungselemente und Funktionszubehör und finden Einsatz vor allem im Maschinenbau und in der Automatisierungstechnik für Gestellunterbauten, Verkleidungen, Schutzeinrichtungen und Funktionsapplikationen.\\nKonstruktionsprofile aus Aluminium stehen einerseits in Konkurrenz zu Profilstählen, andererseits kann je nach Aufgabenstellung ein Mix aus beiden Werkstoffen die beste Lösung darstellen, z. B. Gestellkonstruktion aus Aluminiumprofil mit Versteifungselementen aus Stahlblechen."},{"page_url":"https://vi.wikipedia.org/wiki/Chim_l%E1%BA%B7n_m%C3%A0o_l%E1%BB%9Bn","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/48/Great_Crested_Grebe_%28Podiceps_cristatus%29_%281%29.jpg","page_title":"Chim lặn mào lớn","context_page_description":"Chim lặn mào lớn là một loài chim thuộc họ Chim lặn. Chim lặn mào lớn sinh sản ở các vùng hồ nước ngọt có thực vật. Phân loài P. c. cristatus được tìm thấy khắp châu Âu và châu Á. Nó là loài định cư ở phía tây ấm hơn của phạm vi phân bố nhưng di cư ở các khu vực lanh hơn. Phân loài châu Phi P. c. infuscatus và phân loài Úc P. c. australis chủ yếu không di cư."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%B8%D0%BA%D1%82%D0%BE%D1%80%D0%B8%D1%8F_%D0%BD%D0%B0_%D0%BC%D0%BE%D0%BD%D0%B5%D1%82%D0%B0%D1%85_%D0%94%D1%80%D0%B5%D0%B2%D0%BD%D0%B5%D0%B3%D0%BE_%D0%A0%D0%B8%D0%BC%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Acilius_Balbus_Denarius_125_BC.jpg","page_title":"Виктория на монетах Древнего Рима","context_page_description":"Виктория на монетах Древнего Рима представлена на множестве типов денежных знаков республиканского и императорского периодов. Образ богини Виктории представляет собой олицетворение победы и присутствует на монетах практически всех императоров от Октавиана Августа до византийских правителей.\\nВиктория изображалась как крылатая дева, неизменными атрибутами которой были венок и пальмовая ветвь, реже щит, трофеи, оливковая ветвь, вексиллум, диадема или хлыст. Часто богиню победы изображали стоящей на руке у божества, персонификации или правящего императора.\\nПосле принятия Римом христианства Виктория не исчезла с монет. Её продолжали изображать на деньгах зачастую вместе с христограммой."},{"page_url":"https://br.wikipedia.org/wiki/Spokane_(Washington)","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e7/Spokane_County_Washington_Incorporated_and_Unincorporated_areas_Spokane_Highlighted.svg","page_title":"Spokane (Washington)","context_page_description":"Spokane zo ur gêr lec'hiet e reter stad Washington er Stadoù-Unanet. Lilac City, \\"Kêr al Lireu\\", eo lesanv ofisiel kêr. Er bloavezh 2010 e oa 208 916 a annezidi o chom enni. E 2016 e voe istimet ar boblañs da 215 973 anneziad."},{"page_url":"https://fr.wikipedia.org/wiki/D%C3%A9bardage_par_c%C3%A2ble","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Thomas_Lake_logging_camp_1910.jpg","page_title":"Débardage par câble","context_page_description":"Le débardage par câble, aussi appelé téléphérage, est une forme de débardage qui vise à limiter les impacts sur le sol ou exploiter plus facilement des bois sur forte pente, pour des troncs pouvant peser jusqu'à 4,5 à 5,5 tonnes, néanmoins les très gros-bois peuvent être préalablement sectionnés in situ, avant d'être tractés par le câble.\\nAu lieu d'être extrait par des engins, le bois est tiré sur le sol ou porté, suspendu à un câble.\\nLa méthode se développe depuis les années 1970, d'abord en zone de montagne ou escarpée, puis en forêt de plaine pour mieux en protéger les sols. En effet, pour une forêt plus productive et écologiquement plus résiliente, ou pour répondre aux exigences d'écolabels tels que le PEFC, le forestier cherche à limiter les impacts des pneus d'engins forestiers ou de tracteurs sur les sols, et en particulier sur les sols sensibles.\\nL'augmentation des prix du pétrole pourrait aussi le rendre plus compétitif."},{"page_url":"https://en.wikipedia.org/wiki/Oakamoor","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Oakamoor_Village_Centre_-_geograph.org.uk_-_458933.jpg","page_title":"Oakamoor","context_page_description":"Oakamoor is a small village in north Staffordshire, England.\\nAlthough it is now a rural area, it has an industrial past which drew on the natural resources of the Churnet valley.\\nIron was smelted from medieval times. Copper and lumber were also important to the local economy.\\nIn the nineteenth century Thomas Bolton's copperworks near the River Churnet supplied copper wire for the first transatlantic telegraph cable. The buildings of the Thomas Bolton factory were demolished in 1966.\\nLightoaks Hall on Cheadle Road dates from the 1820s and was built for the Bolton family. Holy Trinity parish church, on Church Bank, was erected in 1832, at a cost of £1600, raised by subscription and a grant from the Church Building Society.\\nThe Churnet Valley line passed through Oakamoor. Oakamoor railway station was closed down in 1967. The railway track leading to Alton Towers railway station has been converted to a footpath."},{"page_url":"https://it.wikipedia.org/wiki/Siegfried_Marcus","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Wiener_Z%C3%BCnder.jpg","page_title":"Siegfried Marcus","context_page_description":"Siegfried Marcus è stato un ingegnere e inventore tedesco naturalizzato austriaco."},{"page_url":"https://fi.wikipedia.org/wiki/Gros_ventresit","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dd/Grosventre01.png","page_title":"Gros ventresit","context_page_description":"Gros ventres on Pohjois-Amerikan alkuperäisasukkaisiin kuuluva intiaaniheimo, joka erosi omaksi ryhmäkseen arapahoista 1600- ja 1700-lukujen taitteessa. He kuuluivat laajalle levinneeseen algonkinien kieliryhmään. Nomadien elämäntyylin omaksuneena gros ventret liikkuivat Yhdysvaltain ja Kanadan rajan molemmin puolin, lähinnä Montanan ja Saskatchewanon alueilla. Vuonna 1780 pohjoisilla tasangoilla on arveltu asuneen noin 3000 gros ventreä. Alimmillaan kansan väkiluku oli vuonna 1910, jolloin heidän määränsä oli vain 510.\\nGros ventreistä on käytetty myös arapahonkielistä nimeä atsina. Itse he kutsuivat itseään nimellä a'ani tai a'aninin. Myös hidatsa-heimosta on käytetty joskus gros ventres- nimeä. Ranskalaiset tulkitsivat näiden kahden erikielisen kansan käsimerkit väärin tasankojen merkkikielessä, ja siksi niin atsinoita kuin hidatsojakin kutsuttiin usein samalla nimellä.\\nGros ventrein välillä lähes sukupuuttoon kuollut kieli on nykyään uudelleen elvytetty. Mielenkiintoinen piirre kielessä on se, että naiset ja miehet lausuvat sitä eri tavalla."},{"page_url":"https://it.wikipedia.org/wiki/Pala_Pesaro","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Pala_pesaro_03.jpg","page_title":"Pala Pesaro","context_page_description":"La Pala Pesaro è un dipinto a olio su tela di Tiziano, databile al 1519-1526 e conservato nella basilica di Santa Maria Gloriosa dei Frari a Venezia."},{"page_url":"https://ast.wikipedia.org/wiki/Horornis_parens","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Horornis_parens_distribution_map.png","page_title":"Horornis parens","context_page_description":"El cetia de San Cristóbal ye una especie d'ave paseriforme de la familia Cettiidae, endémica de l' islla de San Cristóbal."},{"page_url":"https://en.wikipedia.org/wiki/Bhaktapur","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Bhaktapur_statue.JPG","page_title":"Bhaktapur","context_page_description":"Bhaktapur, also known as Khwopa, also known as the city of the temples, is a city in the east corner of the Kathmandu Valley in Nepal about 8 miles from the capital city, Kathmandu. It is located in and serves as the headquarters of Bhaktapur District in Bagmati Pradesh of Nepal. It is administratively divided into 10 wards.\\nKhwopa was the largest of the three Newa kingdoms of the Kathmandu Valley and was the capital of Nepal during the great 'Malla Kingdom' until the second half of the 15th century. It has a population of more than 81,728, of which the vast majority are still Newa Nepa mi. Historically more isolated than the other two kingdoms, Kathmandu and Patan, Bhaktapur has a distinctly different form of Nepal Bhasa language.\\nBhaktapur has the best-preserved palace courtyards and old city centre in Nepal and is listed as a World Heritage Site by UNESCO for its rich culture, temples, and wood, metal and stone artworks. This is supported by the restoration and preservation efforts of the German-funded Bhaktapur Development Project.\\nThe city is famous for a special type of dahi called \\"Ju Ju dhau."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%A4%E1%83%A1%E1%83%98%E1%83%A5%E1%83%9D%E1%83%90%E1%83%A5%E1%83%A2%E1%83%98%E1%83%A3%E1%83%A0%E1%83%98_%E1%83%9C%E1%83%98%E1%83%95%E1%83%97%E1%83%98%E1%83%94%E1%83%A0%E1%83%94%E1%83%91%E1%83%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/A_small_cup_of_coffee.JPG","page_title":"ფსიქოაქტიური ნივთიერება","context_page_description":"ფსიქოატიური ნივთიერება — ნებისმიერი ხელოვნური ან ბუნებრივი ნივთიერება, რომელიც მოქმედებს ცენტრალური ნერვული სისტემის ფუნქციონირებაზე. იგი ფსიქიკურ მდგომარეობას ცვლის, ხანდახან ცნობიერების სრულად დაკარგვამდე. ამ ცვლილებებმა შეიძლება მიიღოს როგორც დადებითი, ასევე უარყოფითი ხასიათი.\\nფსიქოაქტიურ ნივთერებებს, რომლებიც მაღალ ფსიქიკურ ფუნქციებზე მოქმედებს და რომელსაც ხშირად იყენებენ მედიცინაში ფსიქიკური დაავადებების სამკურნალოდ, ფსიქოტროპულ ნივთიერებებს უწოდებენ.\\nფსიქოაქტიურ ნივთიერებებს, რომლებიც აკრძალულია კანონმდებლობით და იწვევს დამოკიდებულებას, ქართულ ენაში ნარკოტიკს უწოდებენ.\\nნეიროტროპული საშუალებები — სამკურნალო პრეპარატების ფართო ჯგუფი, რომელიც მოქმედებს ნერვულ სისტემაზე: ცენტრალურსა და პერიფერიულზე. ნეიროტროპულ საშუალებას შეუძლია დათრგუნოს ან პირიქით — ასტიმულირებდეს ნერვული აგზნებადობის გადაცემას ცნს-ის სხვადასხვა უბანში, აამაღლოს ან შეამციროს პერიფერიული ნერვული სისტემის დაბოლოებების მგრძნობელობა, სხვადასხვა ტიპის სინაფსებზე ზემოქმედება."},{"page_url":"https://it.wikipedia.org/wiki/Nissan_Almera","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Nissan_Almera_front_20070518.jpg","page_title":"Nissan Almera","context_page_description":"Come Nissan Almera sono state commercializzati vari modelli della casa automobilistica giapponese Nissan sin dal 1995; sul mercato europeo è stata principalmente e sino al 2006 una berlina di classe compatta, commercializzata nel resto del mondo con denominazioni diverse a seconda dei mercati di destinazione."},{"page_url":"https://fr.wikipedia.org/wiki/Harpiste","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/91/EmilyLevin-Harpist.jpg","page_title":"Harpiste","context_page_description":"Le harpiste est le musicien qui joue de la harpe."},{"page_url":"https://da.wikipedia.org/wiki/Kik%C3%A6rt","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Cicer_arietinum_003.JPG","page_title":"Kikært","context_page_description":"Kikært er en enårig, urteagtig plante med en mere eller mindre forgrenet, opret til overhængende vækst. Plantens frø, kikærter, er meget anvendt i madlavningen. De kaldes også for garbanzobønner efter det spanske ord for planten."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%BD%D0%BE%D0%B3%D0%BE%D0%BB%D0%B5%D1%82%D0%BD%D0%B8%D0%B5_%D1%81%D0%B5%D1%80%D0%B8%D0%B8_%D0%BA%D0%BE%D0%BC%D0%BC%D0%B5%D0%BC%D0%BE%D1%80%D0%B0%D1%82%D0%B8%D0%B2%D0%BD%D1%8B%D1%85_%D0%BC%D0%B0%D1%80%D0%BE%D0%BA_%D0%A1%D0%A1%D0%A1%D0%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/1961_CPA_2550.jpg","page_title":"Многолетние серии коммеморативных марок СССР","context_page_description":"Как известно, почтовые марки одной серии могут иметь разные даты выпуска. Знаки почтовой оплаты с ясными серийными признаками оформления объединяют в единые серии независимо от года выпуска.\\nМноголе́тняя се́рия, или се́рия, выпуска́вшаяся в тече́ние не́скольких лет, — серия почтовых марок, выпуски которой появлялись в течение двух или более лет по датам выпусков. Другими словами, в датах выпусков формально присутствуют по крайней мере два разных года. При этом в каталоге марок имеется соответствующий текст. Многолетние серии обычно больше обычных, однолетних.\\nОсобый интерес представляют отдельные крупные серии, выпуск которых осуществляется на протяжении нескольких лет. Таких серий не так много. Еще более редки очень большие многолетние серии, которые носят специальное название перманентных.\\nМноголетние серии могут быть важной составной частью структуры каталогов почтовых марок, как это имеет место, например, у каталогов японских марок Сакура, JSCA и JSDA. В этих каталогах перманентные серии даже выделены в отдельные разделы, например, 1-я и 2-я перманентные серии национальных парков."},{"page_url":"https://en.wikipedia.org/wiki/Kazimierz_Deyna","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Kazimierz_deyna_in_sockers.jpg","page_title":"Kazimierz Deyna","context_page_description":"Kazimierz Deyna was a Polish footballer, who played as an offensive midfielder in the playmaker role and was one of the most highly regarded players of his generation, due to his excellent vision."},{"page_url":"https://vi.wikipedia.org/wiki/Asphodelus_acaulis","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Asphodelus_acaulis_001_GotBot_2016.jpg","page_title":"Asphodelus acaulis","context_page_description":"Asphodelus acaulis là một loài thực vật có hoa trong họ Thích diệp thụ. Loài này được Desf. miêu tả khoa học đầu tiên năm 1798."},{"page_url":"https://en.wikipedia.org/wiki/La_Vega_Central_Market","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/La_Vega_Central_en_Santiago.jpg","page_title":"La Vega Central Market","context_page_description":"La Vega Central, also known as the Feria Mapocho, is a market located at the far south of Recoleta commune in Santiago de Chile, almost at the north bank of the Mapocho River. A wide variety of products are sold in its surrounds, principally fresh fruit and vegetables from the Chilean Central Valley. La Vega Central is also home to over 500 dairy, meat, goods and merchandise stores, and offers a variety of Chilean cuisine. Today, hundreds of thousands of people pass daily through La Vega’s 60,000 square meters of stalls. La Vega Central has now achieved iconic status in Chile’s capital. A long-time vendor at the market was quoted as saying, “Markets nowadays compete by using marketing, but La Vega has never had to resort to this. It subsists on its own creation and that is its magic.”"},{"page_url":"https://fr.wikipedia.org/wiki/Hypoth%C3%A8se_Ga%C3%AFa","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Daisyworld-gbooth-swingdaisyball.png","page_title":"Hypothèse Gaïa","context_page_description":"L'hypothèse Gaïa, appelée également hypothèse biogéochimique, est une hypothèse controversée, initialement avancée en 1970 par le climatologue anglais James Lovelock en collaboration avec la microbiologiste américaine Lynn Margulis, mais également évoquée par d'autres scientifiques avant eux, selon laquelle la Terre serait « un système physiologique dynamique qui inclut la biosphère et maintient notre planète depuis plus de trois milliards d'années en harmonie avec la vie ».\\nL'ensemble des êtres vivants sur Terre formerait ainsi un vaste superorganisme — appelé « Gaïa », d'après le nom de la déesse de la mythologie grecque personnifiant la Terre — réalisant l'autorégulation de ses composants pour favoriser la vie. Un exemple cité par Lovelock à l'appui de son hypothèse est la composition de l'atmosphère, qui aurait été régulée au cours du temps de manière à permettre le développement et le maintien de la vie."},{"page_url":"https://lt.wikipedia.org/wiki/Sp%C4%97ra","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/63/Spera_lake.jpg","page_title":"Spėra","context_page_description":"Spėra – ežeras vidurio Lietuvoje, Širvintų rajone, apie 3,5 km į pietryčius nuo Musninkų. Ilgis pietvakarių–šiaurės rytų kryptimi 1,56 km, plotis iki 1,16 km. Altitudė 98,8 m. Ežeras seklus, jo dubuo susidaręs ledo lūstavietėje. Giliausia vieta siekia 2,7 m. Ežero dugne susikaupęs storas sapropelio sluoksnis. Krantai daugiausia lėkšti, pelkėti, šiaurėje ir vakaruose – aukšti, statoki. Krantuose – terasos. Iš pietų prieina Viršuliškių miškas, šiaurinėje pakrantėje plyti dirbami laukai.\\nĮ Spėrą suteka 6 upeliai, šiaurėje išteka Musės intakas Spėra. Vandens apykaita ežere 0,038 metų.\\nEžere sugaunama daugiausia karšių.\\nPrie Spėros įsikūrę kaimai: Viršuliškiai, Paspėriai, Meiliūnai. Pietrytinėje pakrantėje veikia kaimo turizmo sodyba."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%85%D9%86%D8%A8%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Minbar_at_Jameh_Mosque_in_Natanz.JPG","page_title":"منبر","context_page_description":"منبر جایگاهی است که خطبه یا خطابه از آن ایراد می‌شود. بسیاری از لغت‌دانان عرب، واژه منبر را از ریشه عربی نَبَرَ به معنای عالی و بلند دانسته‌اند.\\nابن منظور می‌گوید: «محل ایراد خطبه توسط خطیب را به دلیل بلندی آن، منبر می‌گویند.»\\nمنبر یادگار پیامبر دین اسلام محمد بن عبدالله و فراگیرترین رسانه جهت روشنگری و بصیرت افزایی از زمان وی تاکنون برای مسلمین بوده است.\\nبدلیل همین جایگاه ویژه و رسانه ای منبر بود که در تاریخ اسلام، جهت تسلط بر مسجد جامع شهر که محل تصمیم‌های بزرگ بود، بحث‌ها جدل‌ها و منازعات بسیاری انجام می‌شد. تسلط یافتن گروهی بر مسجد جامع و منبر آن شهر، نشان دهنده آن بود که او حاکم و زمامدار بلامنازع آن دیار است و اکثر مردم نیز به آن رضایت داده‌اند. نمونه ای از این دست، اجتماع گروهی از صحابه بعد از مرگ محمد بن عبدالله در مسجد النبی است که با در اختیار گرفتن مسجد و منبر، بر اوضاع تسلط یافتند."},{"page_url":"https://en.wikipedia.org/wiki/United_States_Army_Rangers","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b4/Swamp_Phase_Ranger_School_2009.jpg","page_title":"United States Army Rangers","context_page_description":"The United States Army Rangers, according to the U.S. military, are limited to those who served in designated U.S. Army Ranger units, past or present. However, the term is often used to include those who are graduates of the U.S. Army Ranger School, even though they did not serve in a Ranger unit.\\nThe term ranger has been in use unofficially in a military context since the early 17th century. The first military company officially commissioned as rangers were New England soldiers fighting in King Philip's War and from there the term came into common official use in the French and Indian Wars. There have been American military companies officially called Rangers since the American Revolution.\\nThe 75th Ranger Regiment is an elite airborne light infantry combat formation within the United States Army Special Operations Command. The six battalions of the modern Rangers have been deployed in Korea, Vietnam, Afghanistan, and Iraq, and saw action in several conflicts, such as those in Panama and Grenada."},{"page_url":"https://eu.wikipedia.org/wiki/Oison","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/CP_Ch%C3%A2teau_d%27Amoy%2C_Oison%2C_Loiret%2C_France.jpg","page_title":"Oison","context_page_description":"Oison Frantziako udalerria da, Loiret departamenduan dagoena, Centre eskualdean. 2013an 124 biztanle zituen."},{"page_url":"https://hu.wikipedia.org/wiki/Le_Po%C3%ABt-C%C3%A9lard","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Population_-_Municipality_code_26241.svg","page_title":"Le Poët-Célard","context_page_description":"Le Poët-Célard település Franciaországban, Drôme megyében. Le Poët-Célard Bourdeaux, Félines-sur-Rimandoule, Francillon-sur-Roubion, Mornans és Truinas községekkel határos."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9B%D0%B0%D0%B7%D0%B0%D1%80_%D0%91%D1%80%D0%B0%D0%BD%D0%BA%D0%BE%D0%B2%D0%B8%D1%9B","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Lazar_Brankovi%C4%87%2C_Esphigmenou_charter_%281429%29.jpg","page_title":"Лазар Бранковић","context_page_description":"Лазар Бранковић био је српски деспот и владар, син Ђурђа Бранковића."},{"page_url":"https://fr.wikipedia.org/wiki/Jayhawks_du_Kansas_(basket-ball)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Kansas_U_team_1899.jpg","page_title":"Jayhawks du Kansas (basket-ball)","context_page_description":"L'équipe de basket-ball des Jayhawks du Kansas est le programme universitaire de basket-ball représentant l'Université du Kansas. C'est l'une des équipes qui a rencontré le plus de succès dans l'histoire du basket-ball universitaire. Elle est classée en Division I de la NCAA et évolue dans la conférence Big 12.\\nLe premier entraîneur des Jayhawks est l'inventeur du basket-ball, James Naismith, qui est le seul entraîneur de l'histoire de l'équipe avec un bilan négatif. Le programme a vu émerger de nombreux joueurs professionnels notables, comme Clyde Lovellette, Wilt Chamberlain, Jo Jo White, Danny Manning, Raef LaFrentz, Paul Pierce, Nick Collison, Kirk Hinrich, Mario Chalmers et Andrew Wiggins, ainsi que les entraîneurs Phog Allen, Adolph Rupp, John McLendon, Dean Smith, Dutch Lonborg, Larry Brown, Roy Williams et Bill Self. Phog Allen fonda la National Association of Basketball Coaches et était, avec Lonborg, un des premiers partisans du Championnat NCAA de basket-ball.\\nEn 2008, ESPN a nommé les Jayhawks deuxième programme le plus prestigieux depuis la saison 1985-1986, après les Blue Devils de Duke."},{"page_url":"https://en.wikipedia.org/wiki/HIPPI","image_url":"https://upload.wikimedia.org/wikipedia/en/0/03/GSN_card_HIPPI-6400.jpg","page_title":"HIPPI","context_page_description":"HIPPI, short for High Performance Parallel Interface, is a computer bus for the attachment of high speed storage devices to supercomputers, in a point-to-point link. It was popular in the late 1980s and into the mid-to-late 1990s, but has since been replaced by ever-faster standard interfaces like Fibre Channel and 10 Gigabit Ethernet.\\nThe first HIPPI standard defined a 50-wire twisted pair cable, running at 800 Mbit/s with maximum range limited to 25 metres, but was soon upgraded to include a 1600 Mbit/s mode running on Serial HIPPI fibre optic cable with a maximum range of 10 kilometres.\\nHIPPI usage dwindled in the late 1990s. This was partly because Ultra3 SCSI offered rates of 320 MB/s and was available at almost any computer store at commodity prices. Meanwhile, Fibre Channel offered simple interconnect with both HIPPI and SCSI and speeds of up to 400 MB/s on fibre and 100 MB/s on a single pair of twisted pair copper wires. Both of these systems have since been supplanted by even higher performance systems during the 2000s."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%9A%E0%AE%BE%E0%AE%AE%E0%AE%B0%E0%AF%8D%E0%AE%B0%E0%AE%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Samarra_pottery_-_Oriental_Institute_Museum%2C_University_of_Chicago_-_DSC06931.JPG","page_title":"சாமர்ரா","context_page_description":"சாமர்ரா என்பது ஈராக் நாட்டிலுள்ள ஒரு நகரம் ஆகும். இது பாக்தாத் நகரிலிருந்து 125 கிலோ மீட்டர் வடக்கே சாலா அல் டின் ஆட்சிப்பிரிவில் டைகிரிஸ் நதியின் கிழக்குக் கரையில், அமைந்துள்ளது. 2002 ஆம் ஆண்டில் இதன் மக்கள்தொகை 201,700 எனக் கணிக்கப்பட்டது.\\n2007 இல் இந்நகரம் யுனஸ்கோவின் பாரம்பரிய சின்னமாக அறிவிக்க பட்டது."},{"page_url":"https://en.wikipedia.org/wiki/Andover,_New_Jersey","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Bird%27s-eye_view_of_Andover.jpg","page_title":"Andover, New Jersey","context_page_description":"Andover is a borough in Sussex County, New Jersey, United States. As of the 2010 United States Census, the borough's population was 606, reflecting a decline of 52 from the 658 counted in the 2000 Census, which had in turn declined by 42 from the 700 counted in the 1990 Census.\\nAndover was incorporated as a borough by an act of the New Jersey Legislature on March 25, 1904, from portions of Andover Township. The borough was named for Andover Township, which was in turn named for Andover, Hampshire, England."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%A4%E3%83%9E%E3%83%8F%E3%83%BB%E3%82%B8%E3%83%A7%E3%82%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Ymaha_Scooter_JOG_in_the_Honda_Collection_Hall..JPG","page_title":"ヤマハ・ジョグ","context_page_description":"ジョグとは、ヤマハ発動機が販売しているスクータータイプのオートバイである。"},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%B5%E0%AE%B3%E0%AF%88%E0%AE%A8%E0%AF%8D%E0%AE%A4_%E0%AE%AE%E0%AF%82%E0%AE%B2%E0%AE%95%E0%AF%8D%E0%AE%95%E0%AF%82%E0%AE%B1%E0%AF%81_%E0%AE%B5%E0%AE%9F%E0%AE%BF%E0%AE%B5%E0%AE%BF%E0%AE%AF%E0%AE%B2%E0%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Oxygen-difluoride-3D-vdW.png","page_title":"வளைந்த மூலக்கூறு வடிவியல்","context_page_description":"வேதியியலில், \\"வளைவு\\" என்ற சொல் அவர்களின் மூலக்கூறு வடிவவியலை விவரிக்க சில மூலக்கூறுகளுக்குப் பயன்படுத்தலாம். ஆக்ஸிஜன் போன்ற சில அணுக்கள், எப்பொழுதும் தங்கள் இரண்டு கூட்டு இணைப் பத்திரங்கள், அவற்றின் எலக்ட்ரான் உள்ளமைவு காரணமாக கட்டினியல்லாத திசைகளில் அமைக்கப்படுகின்றன. நீர் ஒரு வளைந்த மூலக்கூறின் உதாரணமாகும், அத்துடன் அதன் ஒப்புமைகளும். இரண்டு ஹைட்ரஜன் அணுக்களுக்கு இடையில் உள்ள பிணைப்புக் கோணம் தோராயமாக 104.45 ° ஆகும். முதன்மைக் குழு உறுப்புகளைக் கொண்டிருக்கும் மற்ற முக்கோண மூலக்கூறுகள் மற்றும் அயனிகளில் நொடிஜினல் வடிவவியல் பொதுவாகக் காணப்படுகிறது, நைட்ரஜன் டை ஆக்சைடு, சல்பர் டைகார்ட்டைடு, மற்றும் மெத்திலீன் போன்ற முக்கிய உதாரணங்கள்.\\nஇந்த வடிவவியல் கிட்டத்தட்ட எப்போதும் VSEPR கோட்பாட்டோடு ஒத்துப்போகிறது, இது பொதுவாக தனித்தனி ஜோடியின் அலைவரிசைகளுடன் கூடிய அணுவின் அல்லாத அடுக்கை விளக்குகிறது. அங்கு பல வகைகள் உள்ளன, அங்கு AX2E2 மிகவும் பொதுவானது, அங்கு இரு சமநிலைப் பத்திரங்கள் மற்றும் மத்திய அணுவின் இரண்டு தனித்தனி ஜோடி முழுமையான 8-எலக்ட்ரான் ஷெல் ஆகும். அவை 104 ° முதல் 109.5 ° வரை மைய கோணங்களைக் கொண்டுள்ளன, இதில் பிந்தையது ஒரு எளிய கோட்பாடலுடன் இணையும், இதில் நான்கு sp3 கலப்பின அலைவரிசைகளின் tetrahedral சமச்சீர் கணிப்பு உள்ளது."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A7%D9%84%D8%B1%D9%88%DB%8C%D8%8C_%D8%A7%DB%8C%D9%84%DB%8C%D9%86%D9%88%DB%8C","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3f/Eleroy_Il_Railroad_crossing1.JPG","page_title":"الروی، ایلینوی","context_page_description":"الروی آمریکانین ایلینوی ایالتینده یئرلشن بیر کند. ۲۰۱۱-جی ایلده وئریلن معلوماتا گؤره اهالیسینین سایی ۸۵ نفر ایدی."},{"page_url":"https://pl.wikipedia.org/wiki/Medali%C5%9Bci_mistrzostw_%C5%9Bwiata_junior%C3%B3w_w_narciarstwie_klasycznym_w_skokach_narciarskich","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Janne_Ahonen_Hockenheimring_2010-08-14.jpg","page_title":"Medaliści mistrzostw świata juniorów w narciarstwie klasycznym w skokach narciarskich","context_page_description":"Medaliści mistrzostw świata juniorów w narciarstwie klasycznym w skokach narciarskich – zestawienie zawodników, zawodniczek i drużyn, które przynajmniej jeden raz zdobyły medal mistrzostw świata juniorów w narciarstwie klasycznym w konkurencjach skoków narciarskich."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E8%8D%B7%E8%98%AD%E8%BB%8D%E9%9A%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Koninklijke_Marechaussee_busje.JPG","page_title":"荷蘭軍隊","context_page_description":"荷兰军队是荷兰王国的武装部队，其名称中的“Krijgsmacht”即荷语“军队”或“三军”的意思，来自“战争”和“武力”两词复合后的延伸涵意，并用来作为陆海空三军的统称。\\n荷兰军队由由皇家陆军、皇家海军、皇家空军和皇家宪兵队四个军种组成。全军最高统帅为荷兰君主、国防部领导人为国防大臣、三军司令由现役四星上将者出任，陆海空各军种指挥官称作司令，各由一名三星中将担任。\\n荷兰军队在过去是采用征兵制，到1996年后完全实施募兵制；目前荷兰国防部雇用四万八千名军职人员以及两万一千人的文职人员，也有雇用女性担当文职或武职。军事费用在2009年大概占GDP的1.65％，2010年11月国防部表示将削减一百万欧元的国防预算；同时甫上任不久的汉斯·希伦表示将会裁减一万余的人员并有更大规模的裁军计划，其具体内容为军事演习次数减少20%，舰艇海上巡逻时间减少11%，领空飞行巡逻任务减少10%，这样的削减内容不胜枚举。"},{"page_url":"https://pl.wikipedia.org/wiki/Gor%C4%85czka_szachowa","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Chess_Fever_Kapablanka.jpg","page_title":"Gorączka szachowa","context_page_description":"Gorączka szachowa – krótkometrażowa radziecka komedia filmowa, debiut reżyserski Wsiewołoda Pudowkina z 1925 roku.\\nKomedia opowiada o perypetiach pewnego młodzieńca, który popadł w konflikt z ukochaną, ponieważ poza szachami dla niego nic nie istniało. Dziewczyna nie popiera tej pasji, ale nauczyła się grać w szachy zdobywając serce ukochanego na zawsze.\\nFilm zrealizowany był w 1925 podczas trwania w Moskwie wielkiego międzynarodowego turnieju szachowego. W jednym epizodzie wystąpił mistrz świata José Raúl Capablanca."},{"page_url":"https://tr.wikipedia.org/wiki/G%C3%BCltan_K%C4%B1%C5%9Fanak","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/G%C3%BClten_K%C4%B1%C5%9Fanak_%28cropped%29.jpg","page_title":"Gültan Kışanak","context_page_description":"Gültan Kışanak, Kürt gazeteci ve siyasetçi.\\nDiyarbakır Büyükşehir Belediyesi Eski Başkanı, Barış ve Demokrasi Partisi eski eşbaşkanı, Türkiye Büyük Millet Meclisi 23. dönem Diyarbakır ve 24. dönem Siirt milletvekilidir.\\n2014 Türkiye yerel seçimlerinde Diyarbakır Büyükşehir Belediye Başkanı seçilmiştir. 30 Ekim 2016'da PKK'ya üye olmak iddiasıyla tutuklandı. Yerine, Etimesgut Kaymakamı Cumali Atilla kayyum olarak atandı."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A4%D0%B0%D0%BD%D1%81%D0%B0%D1%80%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Fanzara_%2813%29.jpg","page_title":"Фансара","context_page_description":"Фансара — муниципалитет в Испании, входит в провинцию Кастельон в составе автономного сообщества Валенсия. Муниципалитет находится в составе района Альто-Михарес. Занимает площадь 35 км². Население — 370 человек. Расстояние до административного центра провинции — 20 км."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkmale_in_Osterode_am_Harz","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Waldstra%C3%9Fe_3_%28Osterode_am_Harz%29_Villa_Marwedel_01.jpg","page_title":"Liste der Baudenkmale in Osterode am Harz","context_page_description":"In der Liste der Baudenkmale in Osterode am Harz sind die Baudenkmale der niedersächsischen Gemeinde Osterode am Harz und ihrer Ortsteile aufgelistet. Der Stand der Liste ist 1. Mai 2020. Die Quelle der Baudenkmale ist der niedersächsische Denkmalatlas."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-Romain_de_Wy-dit-Joli-Village","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Wy-dit-Joli-Village_%2895%29%2C_%C3%A9glise_Saint-Romain%2C_ancienne_base_du_clocher%2C_vue_vers_le_sud_2.JPG","page_title":"Église Saint-Romain de Wy-dit-Joli-Village","context_page_description":"L'église Saint-Romain est une église catholique paroissiale située à Wy-dit-Joli-Village, dans le département du Val-d'Oise, en France. Selon la tradition, elle aurait été fondée vers 625 par saint Romain, qui est peut-être natif des environs. Les parties les plus anciennes de l'église actuelle ne sont pas antérieures à la fin du XIᵉ ou au début du XIIᵉ siècle ; il s'agit des murs ouest et nord de la nef, ainsi que des piles de l'ancien clocher, qui s'élevait au-dessus de la première travée du chœur. L'église est reconstruite à partir de la fin de la période romane, vers le milieu du XIIᵉ siècle, en commençant par le chœur, et en terminant par le voûtement d'ogives de la nef. Après l'adjonction d'une chapelle du côté sud, qui devait être de style gothique rayonnant, l'église est consacrée par Eudes Rigaud en 1255. Bien plus tard, après la fin de la guerre de Cent Ans, une autre chapelle est bâtie du côté nord. Elle est de style gothique flamboyant, et constitue l'unique partie stylistiquement homogène de l'édifice : tout le reste a subi en effet des remaniements, avec, au moins, le repercement des fenêtres."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D1%81%D0%B0%D0%BC%D1%8B%D1%85_%D0%B2%D1%8B%D1%81%D0%BE%D0%BA%D0%B8%D1%85_%D0%B7%D0%B4%D0%B0%D0%BD%D0%B8%D0%B9_%D0%9B%D0%B8%D1%82%D0%B2%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Vilniaus_vartai.JPG","page_title":"Список самых высоких зданий Литвы","context_page_description":"Список самых высоких зданий Литвы — перечень самых высоких зданий страны."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%B7%B1%E8%8D%89%E3%83%90%E3%82%B9%E3%82%B9%E3%83%88%E3%83%83%E3%83%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Fukakusa_bus_stop_%28The_direction_of_Tokyo%29.jpg","page_title":"深草バスストップ","context_page_description":"深草バスストップは、京都市伏見区深草五反田町にある、名神高速道路京都南インターチェンジ東方の本線上にあるバス停留所である。\\n当停留所は京都市の南部にあり、京都の玄関口の一つとして機能している場所であり、高速バスの運行会社各社は京都深草の名称を用いて案内を行っている。\\nまた、名神高速道路上に存在するため、名神高速にある他の停留所と同様に、名神深草と呼ばれることもある。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B5%D1%81%D0%B5%D1%80%D1%80%D0%B8%D0%BB%D1%8C-%D0%B4%D0%B5-%D0%9A%D0%B0%D0%BC%D0%BF%D0%BE%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Becerril_soportales2_lou.jpg","page_title":"Бесерриль-де-Кампос","context_page_description":"Бесерриль-де-Кампос — населённый пункт и муниципалитет в Испании, входит в провинцию Паленсия в составе автономного сообщества Кастилия и Леон. Муниципалитет находится в составе района Тьерра-де-Кампос. Занимает площадь 78,96 км². Население — 959 человек. Расстояние до административного центра провинции — 14 км.\\nПокровителями города считаются святой Исидро и святая Каталина."},{"page_url":"https://de.wikipedia.org/wiki/Sankt_Petersburger_Philharmonie","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Saint_Petersburg_Philharmonia_%28the_Grand_Hall%29_-_2.JPG","page_title":"Sankt Petersburger Philharmonie","context_page_description":"Die Sankt Petersburger Philharmonie ist eine staatliche Kultureinrichtung in Sankt Petersburg, die älteste Philharmonie Russlands. Sie umfasst zwei Konzertsäle und bietet Raum für zwei symphonische Orchester, die Sankt Petersburger Philharmoniker und das Akademische Sinfonieorchester der Sankt Petersburger Philharmonie."},{"page_url":"https://af.wikipedia.org/wiki/Paul_W._Downs","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/PaulWDowns_2DopeQueens_LA.png","page_title":"Paul W. Downs","context_page_description":"Paul W. Downs is 'n Amerikaanse akteur, vervaardiger, en skrywer. Hy is bekend vir sy rolle in die rolprent Rough Night en in die televisiereekse Paulilu Mixtape en Broad City."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%9E%81%E9%80%9F%E5%89%8D%E8%BF%9B13","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/The_Amazing_Race_13_map.png","page_title":"极速前进13","context_page_description":"《极速前进13》是流行真人秀节目极速前进的第十三季。本季会继续有数对不同关系的选手参赛，为最终大奖进行环球旅行挑战，节目于美国CBS播放。\\nCBS原决定2007-08季度只进行一季比赛，但因为美国编剧协会罢工事件，促成了第12及13两季节目。\\n本季参赛报名于2007年11月27日截止，准入围者面试于12月至2008年1月进行，而最终入围者面试于2月在洛杉矶举行。节目的拍摄将在2008年4月至5月中进行。\\n《极速前进13》于2008年9月28日在CBS首播，而本节目播放时间为逢星期日晚上8时。"},{"page_url":"https://la.wikipedia.org/wiki/Antezant-la-Chapelle","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Antezant_Eglise1.jpg","page_title":"Antezant-la-Chapelle","context_page_description":"Antezant-la-Chapelle est commune Francicum 359 incolarum praefecturae Carantoni Maritimi in regione occidentali Aquitania Nova."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1872","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/L%C3%A9on_Blum_reading.jpg","page_title":"Lijst van personen geboren in 1872","context_page_description":"Dit is een lijst van personen die geboren zijn in 1872.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://en.wikipedia.org/wiki/Medeshamstede","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Peterborough_Cathedral_Hedda_Stone.jpg","page_title":"Medeshamstede","context_page_description":"Medeshamstede was the name of Peterborough in the Anglo-Saxon period. It was the site of a monastery founded around the middle of the 7th century, which was an important feature in the kingdom of Mercia from the outset. Little is known of its founder and first abbot, Sexwulf, though he was himself an important figure, and later became bishop of Mercia. Medeshamstede soon acquired a string of daughter churches, and was a centre for an Anglo-Saxon sculptural style.\\nNothing is known of Medeshamstede's history from the later 9th century, when it is reported in the Anglo-Saxon Chronicle of 864 to have been destroyed by Vikings and the Abbot and Monks murdered by them, until the later 10th century, when it was restored as a Benedictine abbey by Bishop Æthelwold of Winchester, during a period of monastic reform. Through aspects of this restoration, Medeshamstede soon came to be known as \\"Peterborough Abbey\\"."},{"page_url":"https://hu.wikipedia.org/wiki/Myers_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Myers_Park%2C_2016-01-21.jpg","page_title":"Myers Park","context_page_description":"A Myers Park Új-Zéland legnagyobb városa, Auckland belvárosában, a főutca, a Queen Street közelében található, 1915-ben alapított 2,4 hektáros közpark. A park területén jól megfigyelhetők az egész város alapját képező aucklandi vulkáni mező jellegzetességei, a hajdani lávafolyások maradványai. A meredek dombok között kialakult völgyben, a mai Karangahape Road által jelzett magaslati gerinc irányából kis patak futott a tenger felé és azt a város mai egyik fő kikötője, a Csendes-óceán felé nyíló Waitematā Harbour helyén érte el."},{"page_url":"https://de.wikipedia.org/wiki/Partielle_Differentialgleichung","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Drum_vibration_mode01.gif","page_title":"Partielle Differentialgleichung","context_page_description":"Eine partielle Differentialgleichung ist eine Differentialgleichung, die partielle Ableitungen enthält. Solche Gleichungen dienen der mathematischen Modellierung vieler physikalischer Vorgänge. Die Lösungstheorie partieller Differentialgleichungen ist für lineare Gleichungen weitgehend erforscht, für nichtlineare Gleichungen enthält sie noch viele Lücken. Zur praktischen Berechnung von Lösungen werden in der Regel numerische Verfahren herangezogen."},{"page_url":"https://sv.wikipedia.org/wiki/Malgrat_de_Mar","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Escut_oficial_Malgrat_de_Mar.jpg","page_title":"Malgrat de Mar","context_page_description":"Malgrat de Mar är en stad och kommun i Katalonien i Spanien. Den ligger längsmed Costa Brava mellan Santa Susanna och Blanes. En väg går från staden till väg N-II, medan väg B-682 förbinder den med Blanes, Lloret de Mar och Tossa de Mar. Malgrat de Mar har en RENFE-järnvägsstation på sträckan mellan Barcelona och Maçanet-Massanes."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%84%9B%E7%9F%A5%E7%9C%8C%E3%81%AE%E5%B8%82%E7%94%BA%E6%9D%91%E6%97%97%E4%B8%80%E8%A6%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Flag_of_Otowa_Aichi.JPG","page_title":"愛知県の市町村旗一覧","context_page_description":"愛知県の市町村旗一覧は、愛知県内の市町村に制定されている、あるいは制定されていた市町村旗の一覧である。なお、一覧の順序は全国地方公共団体コード順による。廃止された市町村旗は廃止日から順に掲載している。"},{"page_url":"https://fi.wikipedia.org/wiki/Holvi","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Barrel_vault_top_force.jpg","page_title":"Holvi","context_page_description":"Holvi on kaareutuva, kiilamaisista kivistä tai laastilla kiilaamalla kokoonliitetty kattorakenne; myös betonista on tehty holveja jo antiikin Roomassa.\\nValeholvi on holvia ulkonäöltään muistuttava rakenne, joka tehdään latomalla kiviä tai tiiliä portaittain aukon ylle.\\nHolvin pääosat ovat:\\ntuki- eli vastikemuurit, jotka kantavat holvin painon ja joille niiden sivusysäys siirtyy. Holvatun huoneen muut seinät ovat otsamuureja. Holvin jännemitta on tukimuurien etäisyys toisistaan\\nholvijalka on holvin alin kohta\\nholvikanta on vastikemuurin osa, johon holvijalka nojaa\\nholvilaki on sen korkein kohta\\nholvireisi on jalan ja laen välinen osa holvista\\nholviruoteet eli holvisuonet, holvipinnasta kohoavat, holvin pintoja eli kappoja eli kairoja kannattavat kaaret."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A1%D1%82%D0%B5%D0%BF%D0%B0_%D0%A1%D1%82%D0%B5%D0%BF%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%9B","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/OR-7_Narednik-Vodnik_II_klase_1908-1945.PNG","page_title":"Степа Степановић","context_page_description":"Степан Степановић Степа био је српски и југословенски војвода.\\nУчесник је српско-турских ратова, као питомац-наредник, касније потпоручник.\\nУ периоду између битака код Сливнице и код Куманова, обављао је дужности команданта батаљона, пука, бригаде, дивизије и помоћника начелника Главног ђенералштаба. Два пута био је и министар војни. У том периоду Српска војска је у организационом, стручном, материјалном и моралном погледу била добро припремљена за предстојеће ратове. У Првом балканском рату командовао је Другом армијом.\\nУ Другом балканском рату, армија под Степином командом пожртвовано је бранила нишавску зону са утврђеним логором у Пироту. Када је почео Први светски рат, као заступник одсутног начелника Штаба Врховне команде Радомира Путника, руководио је мобилизацијом и концентрацијом Српске војске. После Путниковог повратка у земљу, поново преузима дужност команданта Друге армије и са њеним главним снагама изводи марш-маневар преко Коцељеве и Текериша. У ноћном нападу, на источним падинама Цера, поразио је 21. дивизију аустроугарског 8. корпуса чиме је омогућио победу Срба у Церској бици."},{"page_url":"https://war.wikipedia.org/wiki/Juncus_acutiflorus","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Juncus.acutiflorus2.-.lindsey.jpg","page_title":"Juncus acutiflorus","context_page_description":"An Juncus acutiflorus in uska species han Liliopsida nga ginhulagway ni Jakob Friedrich Ehrhart ngan Franz Georg Hoffmann. An Juncus acutiflorus in nahilalakip ha genus nga Juncus, ngan familia nga Juncaceae. Waray hini subspecies nga nakalista."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%BE%D0%BA%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Tako_Poke.jpg","page_title":"Поке","context_page_description":"Поке — блюдо гавайской кухни, сырая рыба, нарезанная кубиками, которую подают или как закуску, или как основное блюдо. Одно из основных блюд гавайской кухни. Как правило, для приготовления поке используют или осьминога, или тунца. Блюдо с осьминогом обычно называют Тако Поке. Тунец, используемый в блюде, как правило, желтоперый. В другие варианты поке добавляют сырой лосось или моллюсков. Блюдо подают с сыром и тыквенными приправами."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%81%D0%BB%D0%BE%D1%87%D0%BD%D1%8B%D0%B5_%D1%83%D0%BA%D1%80%D0%B0%D1%88%D0%B5%D0%BD%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/%D0%95%D0%BB%D0%BE%D1%87%D0%BD%D0%BE%D0%B5_%D1%83%D0%BA%D1%80%D0%B0%D1%88%D0%B5%D0%BD%D0%B8%D0%B5_%22%D0%9A%D0%BE%D1%81%D0%BC%D0%BE%D0%BD%D0%B0%D0%B2%D1%82%22_1960%D0%B5.JPG","page_title":"Ёлочные украшения","context_page_description":"Ёлочные украшения — шары, фигурки и иные украшения, которыми наряжают новогоднюю ёлку, а также интерьер и экстерьер помещения к празднику Рождества и Нового года."},{"page_url":"https://en.wikipedia.org/wiki/Costa_del_Maresme","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Platja_Ocata.jpg","page_title":"Costa del Maresme","context_page_description":"The Costa del Maresme is a section of the Catalan coast that coincides with the coast of the Maresme region and covers a total of sixteen municipalities from Montgat to the mouth of the Tordera. It is bordered on the north by the Costa Brava and on the south by the Costa de Barcelona.\\nThe Costa del Maresme stretches between the Mediterranean Sea and the Catalan Coastal Range, which protects it from the north winds. The Costa del Maresme has extensive beaches, fishing villages and towns with a long history of tourism. Characterized by its mild climate and its Mediterranean landscape, it is a residential and tourist area that in recent decades has hosted many people from cities who have moved their first residence to the coast.\\nThe region has five marinas and fishing activity is mainly concentrated in and around Arenys de Mar. For this reason, Arenys and Sant Pol de Mar have been distinguished as fishing villages by the Catalan Tourism Agency."},{"page_url":"https://es.wikipedia.org/wiki/Federica_de_Hannover","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Personal_flag_of_Queen_Frederica_of_Greece.svg","page_title":"Federica de Hannover","context_page_description":"Federica de Hannover fue reina de Grecia desde 1947. Era por nacimiento princesa de Hannover y duquesa de Brunswick y Luneburgo. Fue la madre de la reina Sofía de España, del rey Constantino II de Grecia y de la princesa Irene de Grecia y Dinamarca."},{"page_url":"https://pl.wikipedia.org/wiki/Wilcza_G%C5%82owa","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Wolfskop_Wappen.png","page_title":"Wilcza Głowa","context_page_description":"Wilcza Głowa – herb szlachecki."},{"page_url":"https://de.wikipedia.org/wiki/Wasserturm_auf_dem_Kleinen_Strohberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Wasserturm_Strohberg2.jpg","page_title":"Wasserturm auf dem Kleinen Strohberg","context_page_description":"Der Wasserturm auf dem Kleinen Strohberg ist ein denkmalgeschützter ehemaliger Wasserturm in der Stadt Quedlinburg in Sachsen-Anhalt. Ein Umbau des Turms zur Sternwarte Quedlinburg ist im Bau und teilweise schon erfolgt."},{"page_url":"https://pt.wikipedia.org/wiki/%C3%81lbum_das_Gl%C3%B3rias","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Sua_Magestade_o_Imperador_do_Brazil_%28%C3%81lbum_das_Gl%C3%B3rias%2C_n.%C2%BA_5%2C_Maio_1880%29.png","page_title":"Álbum das Glórias","context_page_description":"Álbum das Glórias é o título de uma colecção de folhas volantes publicadas em duas séries, com caricaturas de políticos, intelectuais, artistas, jornalistas e outras figuras públicas portuguesas da época. As ilustrações, da autoria de Rafael Bordalo Pinheiro, são acompanhadas de textos satíricos traçando o perfil dos caricaturados, assinados, na sua maioria, por \\"João Rialto\\" e \\"João Ribaixo\\".\\nO Álbum das Glórias é uma das obras mais estimadas da bibliografia de Rafael Bordalo Pinheiro."},{"page_url":"https://it.wikipedia.org/wiki/Museo_civico_Luigi_Bailo","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Luigi_Serena_3.jpg","page_title":"Museo civico Luigi Bailo","context_page_description":"Il Museo civico \\"Luigi Bailo\\" è un museo di Treviso, intitolato al fondatore e primo direttore dei Musei civici di Treviso, l'abate Luigi Bailo, e oggi dedicato alle raccolte d'arte dall'Impressionismo alle Avanguardie.\\nIl Museo Bailo è la più antica tra le attuali sedi museali civiche: le altre sono il complesso di Ca' da Noal - ca' Robegan, nel quale si tengono esposizioni temporanee, e il complesso di Santa Caterina, che ospita le raccolte archeologiche, le collezioni di arte medievale e moderna, ed altre esposizioni temporanee."},{"page_url":"https://en.wikipedia.org/wiki/German_Steam_Locomotive_Museum","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Fahrzeughalle_DDM.jpg","page_title":"German Steam Locomotive Museum","context_page_description":"The German Steam Locomotive Museum or DDM is located at the foot of the famous Schiefe Ebene ramp on the Ludwig South-North Railway in Neuenmarkt, Upper Franconia. This region is in northern Bavaria, Germany. The DDM was founded in 1977."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%85%8B%E7%BE%85%E6%99%AE%E5%A4%AB%E5%B7%B4%E8%B5%AB%E6%B2%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Kropfbach.JPG","page_title":"克羅普夫巴赫河","context_page_description":"克羅普夫巴赫河，是德國的河流，位於該國東南部，由巴伐利亞負責管轄，屬於哈斯洛赫巴赫河的右支流，河道全長10.8公里，流域面積15.5平方公里。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A8%D0%B0%D1%83%D0%BB%D0%B8%D1%81,_%D0%AE%D1%80%D0%B3%D0%B8%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Lietuvos_Tarybos_prezidiumas.Presidium_of_Council_of_Lithuania_%281918%29.jpg","page_title":"Шаулис, Юргис","context_page_description":"Юргис Шаулис — литовский политик и дипломат, подписант Акта о независимости Литвы 1918 года, первый посол Литвы в Польше. Политэмигрант."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%98%D1%81%D0%BF%D0%B0%D1%80%D1%82%D0%B0_(%D0%BF%D0%BE%D0%BA%D1%80%D0%B0%D0%B8%D0%BD%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Antiocheia_in_Psidia.jpg","page_title":"Испарта (покраина)","context_page_description":"Испарта е покраина во југозападна Турција. Соседни покраини се Афјон на северозапад, Бурдур на југозапад, Анталија на југ и Конија на исток. Зафаќа површина од 8.993 км², а населението брои 448.298 жители. Административен центар е градот Испарта.\\nПокраината е позната по своите јаболка, вишни, грозје, рози и розини производи, како и по убавите ќилими. Најплодна е почвата кај Улуборлу. Испарта се наоѓа во Езерскиот крај на Средоземниот регион на Турција, богат со езера."},{"page_url":"https://ast.wikipedia.org/wiki/Catalina_d%27Arag%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Catherine_of_Aragon_as_Mary_Magdalene.jpg","page_title":"Catalina d'Aragón","context_page_description":"Catalina d'Aragón, foi Reina d'Inglaterra dende 1509 hasta 1533 como la primer esposa del rei Enrique VIII y madre de María I d'Inglaterra; enantes foi princesa de Gales como esposa d'Arturo, príncipe de Gales.\\nFía de la reina Sabela I de Castiella y del rei Fernandu II d'Aragón, Catalina tenía #tres años cuando foi prometida en matrimoniu al príncipe Arturo, herederu del tronu inglés. El matrimoniu #llevar a cabu en 1501, sicasí, Arturo finó cinco meses dempués. En 1507, actuó como embaxadora pa la Corte Española n'Inglaterra, convirtiéndose na primer muyer embaxadora de la hestoria europea.[2] En 1509 casóse con Enrique VIII, hermanu menor d'Arturo, quien asocediera al tronu apocayá. Mientres seis meses en 1513, sirvió como rexente d'Inglaterra mientres Enrique VIII taba en Francia y foi mientres esta rexencia que los ingleses resultaron victoriosos na batalla de Flodden Field contra los escoceses, un acontecimientu nel cual Catalina desempeñó un papel importante.[3]"},{"page_url":"https://arz.wikipedia.org/wiki/%D9%81%D8%A7%D9%86_%D9%83%D9%84%D9%8A%D9%81_%D8%A7%D9%86%D8%AF_%D8%A7%D8%B1%D8%A8%D9%8A%D9%84%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Van_Cleef_%26_Arpels_Exhibition.JPG","page_title":"فان كليف اند اربيلس","context_page_description":"فان كليف اند اربلز Van Cleef & Arpels هي وكالة مجوهرات فرنسية فاخرة، اتأسست على ايد تشارلز أربلز وشقيقه ألفريد فان كليف في سنة 1896، افتتح الأخوان أول متجر لهما في ميدان فاندوم في باريس سنة 1906 واشتهر المتجر أنذاك باستعمال الأحجار الكريمة والتقنيات الحديثة. تمكن فان كليف وأربلز من افتتاح عدة متاجر لهما بين عامي 1909، 1939 بعدها انتقلت الأسرة للعيش في الولايات المتحدة وافتتحوا أول متجر لهما في مدينة نيويورك. بقيت الشركة ملكاً لنفس العائلة حتى سنة 1999 بعدها انتقلت الملكية إلى كومبغاني فينانشري ريتشمونت. واستمرت فان كليف بعدها بالتألق وزينت مجوهرات فان كليف الثمينة الملوك، الأمراء والمشاهير. دخلت فان كليف أند أربلز عالم العطور في سنة 1978، بإطلاق أول عطر للنساء المفعم بعبق رائحة الأزهار الكلاسيكية وقد حقق نجاحاً كبيراً وحصل على مبيعات عالية. استمرت فان كليف بعدها في إطلاق العطور المميزة منها للرجال سنة 1989 في سنة 2008، وتبعها مجموعات أخرى غير اعتيادية. تمتلك فان كليف أند أربلز اليوم مجموعة من 51 عطر، أول مجموعة إصدار سنة 1976، وأحدثها في سنة 2015، للنساء والرجال."},{"page_url":"https://nl.wikipedia.org/wiki/Metro_van_Kiev","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/11/Syrets_metro_station_Kiev_2010_05.jpg","page_title":"Metro van Kiev","context_page_description":"De metro van Kiev werd geopend in 1960 en is het belangrijkste middel van openbaar vervoer in de Oekraïense hoofdstad. Het systeem heeft drie lijnen met een gezamenlijke lengte van een kleine 65,18 kilometer, telt 50 stations en wordt nog altijd uitgebreid. Kiev was de derde stad in de Sovjet-Unie die een metronetwerk kreeg en de eerste in Oekraïne. De metro van Kiev vervoert 1,38 miljoen reizigers per dag, 42,5% van de 3,25 miljoen mensen die van het hoofdstedelijke openbaar vervoer gebruikmaken."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%9D%8E%E5%AF%9F%C2%B7%E5%B8%AD%E5%A4%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Richard_Schiff_2012_Shankbone.JPG","page_title":"李察·席夫","context_page_description":"李察·席夫，是一位美國演員及諧星。他在電視劇《白宮風雲》飾演 Toby Ziegler 最為人所熟悉，他更憑此劇獲得艾美獎殊榮。席夫亦同時在這套影集中首度執導，在Talking Points中擔任導演。此外，他更會參演2015年播放的電影《熊麻吉2》。"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%80%81%E8%BF%91%E5%8D%AB%E5%86%9B","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Grenadier-a-pied-de-la-Vieille-Garde.png","page_title":"老近卫军","context_page_description":"老近衛軍，是拿破崙帝國衛隊的精銳成員，也是拿破崙大軍團的著名組成部分。老近衛軍由經驗豐富的老兵組成，這些士兵很早就追隨拿破崙作戰。\\n不少人認為，拿破崙是按照身體特徵，如高度，在普通士兵中，挑選適合人士，作為老近衛軍成員的。無論是老近衛軍的敵軍，抑或是老近衛軍的友軍，都對他們的身形留下了深刻印象。在軍中服役的時間與在作戰時表現出的勇氣，也都是選拔老近衛軍時的考慮因素。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A4%E3%83%AA%E3%82%A22%E4%B8%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/%E1%83%97%E1%83%91%E1%83%98%E1%83%9A%E1%83%98%E1%83%A1%E1%83%98_15_Tbilisi.jpg","page_title":"イリア2世","context_page_description":"イリア2世、グルジア語ラテン翻字: Ilia II、1933年1月4日 – は、全ジョージアのカトリコス総主教、ムツヘタ＝トビリシの大主教、ビチヴァンタとスフミ＝アブハジアの府主教。ジョージア正教会の首座主教。敬称は聖下 あるいは座下 。"},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AF%D8%A7%D9%86%D9%8A%D9%8A%D9%84_%D9%88%D9%88%D9%84%D9%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/ASK_Ebreichsdorf_vs._SC_Wiener_Neustadt_2015-09-22_%2871%29.jpg","page_title":"دانييل وولف","context_page_description":"دانييل وولف ‏ هو لاعب كرة قدم نمساوي، يلعب كلاعب وسط."},{"page_url":"https://es.wikipedia.org/wiki/Ceraceomyces","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Ceraceomyces_sublaevis_38439.jpg","page_title":"Ceraceomyces","context_page_description":"Ceraceomyces es un género de hongo perteneciente a la familia Amylocorticiaceae. El género está ampliamente extendido y cuenta con 16 especies.​"},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A7%D9%88%D8%A7_%DA%AF%D8%B1%DB%8C%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/EvaGreenFeb07.jpg","page_title":"اوا گرین","context_page_description":"اوا گیل گرین تلفظ فرانسوی: ​ زاده ۶ ژوئیهٔ ۱۹۸۰، هنرپیشه و مدل فرانسوی است. گرین بیش‌تر برای بازی در فیلم و سریال‌هایی در ژانر فانتزی و ترسناک و اجرای نقش زنان اغواگر با روحیه تاریک و پیچیده و همچنین همکاری با کارگردانانی همچون تیم برتون، برناردو برتولوچی و ریدلی اسکات شناخته شده‌است. گرین برای حضور در آثار مختلف، نامزد و برنده تعدادی جایزه از جمله بفتا شده‌است.\\nاوا گرین در اوایل ژوئیه ۱۹۸۰ در پاریس و در یک خانواده هنری متولد شد. مادرش، مارلن ژوبر خود بازیگر است که نقش زیادی در جذب گرین به این حرفه داشت. گرین کار خود را با حضور در تئاتر و آغاز کرد و سپس با حضور در فیلم رؤیاپردازان قدم به سینما گذاشت. ایفای نقش سیبلا در فیلم قلمرو بهشت باعث شد توجهات جهانی به سوی وی جلب شود. یک سال بعد، گرین با حضور در نقش باند گرل اصلی فیلم کازینو رویال به نام وسپر لیند به شهرتی بین‌المللی دست پیدا کرد. فیلم و بازی گرین با تحسین منتقدان و تماشاگران همراه شد و گرین برای عملکرد خود برنده جایزه ستاره نوظهور بفتا شد.\\nبه غیر بازی در فیلم‌های جریان اصلی، گرین برای حضور در آثار مستقل و کم بودجه نیز مشهور است. کراکز، رحم و حس بی‌نقص از جمله آثار مستقلی هستند که گرین در آن‌ها حضور پیدا کرد."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%98%8E%E5%B0%BC%C2%B7%E6%98%8E%E7%B4%8D%E9%9F%8B","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b2/Minni_Minnawi_and_George_W_Bush_%28cropped%29.jpg","page_title":"明尼·明納韋","context_page_description":"明尼·明納韋是蘇丹解放運動最大派系的領導者。他與其派系於2006年5月，與蘇丹政府簽定了和約。不過蘇丹解放運動的其他派系，在和約簽定之後，仍然持續與蘇丹政府軍及牧民武裝部隊對抗。\\n2006年9月4日，明尼·明納韋表示不反對聯合國安理會的1706號決議，這項決議的內容是派出聯合國維和部隊到達爾富爾地區。"},{"page_url":"https://es.wikipedia.org/wiki/Distrito_de_Uchiza","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Cascada_del_ca%C3%B1%C3%B3n_Dorado.jpg","page_title":"Distrito de Uchiza","context_page_description":"El distrito de Uchiza es uno de los cinco distritos que conforman la Provincia de Tocache en el Departamento de San Martín en el Perú.​"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A5%D1%80%D0%B0%D0%BC_%D0%91%D0%BE%D0%B6%D0%B5%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D0%BE%D0%B3%D0%BE_%D0%90%D0%B4%D1%80%D1%96%D0%B0%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Colonna_-_Tempio_di_Adriano_ricostruzione_1000165.JPG","page_title":"Храм Божественного Адріана","context_page_description":"Храм Божественного Адріана — храм на честь імператора Адріана в Римі, руїни якого сьогодні вбудовані в будівлю римської біржі.\\nПрийомний син Антонін Пій спорудив храм на честь обожненого Адріана в 141 або 145. Храм в корінфському стилі прикрашали 13 п'ятнадцятиметрових мармурових колон по боках і по 8 колон по вузьким боках будівлі. Храм знаходився на чотириметровому подіумі з пеперини, до храму вели широкі сходи, Стіна його целлу зовні була облицьована мармуровими плитками, а всередині прикрашена рельєфами із зображенням римських провінцій\\nВід споруди до наших днів збереглися лише одинадцять коринфських колон заввишки 15 метрів і одна зі стін целлу.\\nВ XVII столітті залишки язичницького храму були вбудовані в будинок митниці, виконаної в бароковому стилі. 1878 року будівля була перебудована для римської біржі та торговельно-промислової палати, при цьому античні фрагменти були очищені від надбудови XVII століття."},{"page_url":"https://ceb.wikipedia.org/wiki/Monomorium_madecassum","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Monomorium_madecassum_casent0010819_profile_1.jpg","page_title":"Monomorium madecassum","context_page_description":"Espesye sa holmigas ang Monomorium madecassum. Una ning gihulagway ni Auguste-Henri Forel ni adtong 1892. Ang Monomorium madecassum sakop sa kahenera nga Monomorium sa kabanay nga holmigas. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://en.wikipedia.org/wiki/Foreign_Narcotics_Kingpin_Designation_Act","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Figure_6_Number_of_Kingpin_Act_Designations_by_Year%2C_2000-2019_%2849395263437%29.jpg","page_title":"Foreign Narcotics Kingpin Designation Act","context_page_description":"The Foreign Narcotics Kingpin Designation Act, also known as the Kingpin Act, became law by the enactment of the Intelligence Authorization Act for Fiscal Year 2000. The U.S. international narcotics trafficking bill was introduced in the United States House of Representatives as H.R. 3164 on October 28, 1999. The Kingpin Act legislation passed by a margin of three hundred and eighty-five to twenty-six in the United States House of Representatives on November 2, 1999.\\nThe H.R. 1555 Act of Congress was passed by the 106th U.S. Congressional session and enacted into law by the 42nd President of the United States Bill Clinton on December 3, 1999."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%B3%D8%A7%DA%A9%D8%B1%D9%88%D8%B2_%D8%A7%D9%88%DA%A9%D8%AA%D8%A7%D8%A7%D8%B3%D8%AA%D8%A7%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Sucrose_octaacetate.png","page_title":"ساکروز اوکتااستات","context_page_description":"ساکروز اوکتااستات بیر شیمیایی ماده. ساکروز اوکتااستات استات گروه یا قروپوندا یئرلشیر."},{"page_url":"https://oc.wikipedia.org/wiki/Podan%C3%A0s","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Poudenas_-_Pont_sur_la_G%C3%A9lise_-1.JPG","page_title":"Podanàs","context_page_description":"Podanàs qu'es una comuna gascona d'Agenés, situada dens lo departament d'Òut e Garona e la region de Navèra Aquitània, ancianament d'Aquitània."},{"page_url":"https://ca.wikipedia.org/wiki/Llindes_portes_d%27acc%C3%A9s_habitatges","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Llindes_portes_d%27acc%C3%A9s_habitatges_de_la_Pla%C3%A7a_Major.jpg","page_title":"Llindes portes d'accés habitatges","context_page_description":"Les llindes de portes d'accés habitatges de Ventalló són protegides conjuntament com a bé cultural d'interès local.\\nAquestes llindes estan a diversos edificis distribuïts dins del nucli urbà de la població de Ventalló. En concret, s'han localitzat diverses llindes de pedra situades a les portes d'accés als habitatges i situades als carrers de l'Església, Mossèn Trayter i del Mar. També hi ha una finestra. Majoritàriament estan gravades amb una inscripció referent a la construcció de l'edifici en qüestió, acompanyat de la data de construcció o reforma i un motiu decoratiu. En el cas del número 9 del Carrer de l'Església, la inscripció \\"IVANES PAGES FAB EP FARRARIUS ME FESIT 21 V 1671\\" presenta un escut central amb les eines d'un ferrer representades i la data 1671. Del Carrer Mossèn Trayter, destaca Can Farriol, amb una inscripció malmesa al voltant d'una creu central i l'any 1798. Al número 2 hi ha la inscripció \\"MIQUEL RABERT ME FECIT. ANY 1697\\" i la finestra datada amb l'any 1791. De les tres llindes localitzades al carrer del Mar destaca el número 11, amb la inscripció \\"1717 MIQUEL FARRER ME FECIT\\". Al número 13, \\"ME FECIT FASERE\\", amb una creu central decorada."},{"page_url":"https://it.wikipedia.org/wiki/Gaetano_Negri","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/CappellaNegriCassinettadiLugagnano.JPG","page_title":"Gaetano Negri","context_page_description":"Gaetano Negri è stato un militare, storico, critico letterario, geologo, politico e scrittore italiano.\\nFu deputato e senatore del Regno d'Italia, rispettivamente nella XIV e dalla XVII legislatura, nonché sindaco di Milano."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D1%80%D0%B0%D0%BD%D0%B8%D1%86%D0%B0_(%D0%91%D0%BE%D0%B9%D0%BD%D0%B8%D0%BA)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/%D0%93%D1%80%D0%B0%D0%BD%D0%B8%D1%86%D0%B0_%28%D0%91%D0%BE%D1%98%D0%BD%D0%B8%D0%BA%29_-_Granica_%28Bojnik%29.JPG","page_title":"Граница (Бойник)","context_page_description":"Граница — населённый пункт в общине Бойник Ябланичского округа Сербии."},{"page_url":"https://sh.wikipedia.org/wiki/Burj_Khalifa","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Burj_dubai_3.11.08.jpg","page_title":"Burj Khalifa","context_page_description":"Burj Khalifa neboder je u Dubaiju, u Ujedinjenim Arapskim Emiratima i najviša je građevina na Zemlji. Visok je 818 metara s antenom. Trebao se zvati Burj Dubai, ali je u čast šeika Kalifa al-Nahjan nazvan Burj Khalifa.\\nBurj Khalifa je samo jedan od predviđenih sličnih nebodera u novom centru grada, \\"Downtown Dubaiju\\". Idejni je autor ovog projekta američki arhitekt Adrian Smith, a projektantska tvrtka je Skidmore, Owings and Merrill iz Chicaga. Kako se radi o divovskom građevinskom pothvatu, mnogo je izvođača radova, među kojima su najznačajniji korejski Samsung, belgijski Besix, emiratski Arabtec i američki Turner. Investitor, Emaar Properties, u većinskom je vlasništvu Mohameda bin Rašida Al Maktuma, vladara Dubaija.\\nGradnja je započela 21. 9. 2004., a neboder je otvoren 4. 1. 2010. Cijeli Burj Khalifa koštao je oko 4.1 milijarde američkih dolara."},{"page_url":"https://he.wikipedia.org/wiki/%D7%95%D7%90%D7%93%D7%99_%D7%A4%D7%95%D7%9B%D7%99%D7%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Beitar_Illit_settlement_encroaching_on_Wadi_Fukin_%28730276521%29.jpg","page_title":"ואדי פוכין","context_page_description":"ואדי פוכּין הוא כפר פלסטיני מוסלמי באזור יהודה בשולי הרי ירושלים, בעמק הנמצא בין העיר ביתר עילית ליישוב צור הדסה וסמוך לכביש 375. יש שזיהו את ואדי פוכין עם \\"כפר פיכול\\" או \\"פיכולה\\" המקורי, שזוהה כיישוב של כמות כהנים ממשמרת בילגה."},{"page_url":"https://de.wikipedia.org/wiki/St._Nikolaus_(M%C3%BCnzenberg)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/St._Nikolaus_%28M%C3%BCnzenberg%29_Orgel_06.JPG","page_title":"St. Nikolaus (Münzenberg)","context_page_description":"St. Nikolaus in Münzenberg im hessischen Wetteraukreis ist die ehemalige Hospitalkirche der Stadt, 1284 errichtet. Sie verfiel im Laufe der Zeit und wurde in den 1960er Jahren wiederhergestellt. Der zweischiffige Bau mit eingezogenem Rechteckchor ist gemeinsam mit dem südlich gelegenen 1776 datierten Ziehbrunnen aus Sandstein ein Kulturdenkmal aufgrund des hessischen Denkmalschutzgesetzes."},{"page_url":"https://hr.wikipedia.org/wiki/Mornari%C4%8Dki_kasino_u_Puli","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Pula_oldpostcard03.jpg","page_title":"Mornarički kasino u Puli","context_page_description":"Mornarički kasino, palača u centru Pule izgrađena 1913. godine za vrijeme austro-ugarske uprave nad Pulom.\\nPula je na prijelazu iz 19. u 20. stoljeće bila sjedište i središte respektabilne mornarice Austro-Ugarske Monarhije, grad imperativno predodređen da se s tom mornaricom naprosto poistovjeti. Prekrasno zdanje koje je zasigurno bilo krunski dragulj ondašnjeg grada-kasarne bila je palača izgrađena 9. svibnja 1872. naziva Marine-Kasino in Pola. Projekt je napravio arhitekt Friedrich Adam iz Münchena, a kamen temeljac postavljen je 1870. Ova zgrada stajala je tri i po desetljeća usred vlastitog raskošnog mediteranskog parka na velikoj, kameno-željeznom ogradom izoliranoj parceli u središtu Pule uz samu granicu povijesne jezgre i novoga dijela grada. Bila je prva susjeda kazališta s jedne i monumentalne palače nadvojvode Karla Stjepana porušene 1945. godine tijekom bombardiranja s druge strane.\\nMornarički je kasino ubrzo je postao sakupljalište tadašnje elite Pule. Zgrada je bila zatvorenog tipa, namijenjena članovima Znanstvenog društva, a članovi su mogli biti časnici, svećenici, stručnjaci čiji je rad bio vezan uz austro-ugarsku mornaricu."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%A7%D1%8B%D0%B3%D1%83%D0%BD%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/ICE_3_Fahlenbach.jpg","page_title":"Чыгунка","context_page_description":"Чыгу́нка — наземны від транспарту, у якім па рэйках рухаюцца цягнікі, ці адзінкавыя вагоны, ці кабіны. У шырокім значэньні чыгунка азначае інфрастуктуру — рэйкі, станцыі, тэхнічныя ўсталяваньні і г. д.\\nЧыгунка складаецца з матэрыяльнай часткі і эксплюатацыйнай."},{"page_url":"https://en.wikipedia.org/wiki/Ukrainian_nationalism","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Ukrainian-nationalism-1920.jpg","page_title":"Ukrainian nationalism","context_page_description":"Ukrainian nationalism is the ideology promoting the unity of Ukrainians into their own nation state. Although the current Ukrainian state emerged fairly recently, some historians, such as Mykhailo Hrushevsky, Orest Subtelny and Paul Robert Magocsi, have cited the medieval state of Kievan Rus' as an early precedent of specifically Ukrainian statehood. The origins of modern Ukrainian nationalism have also been traced to the 17th-century Cossack uprising against the Polish–Lithuanian Commonwealth, led by Bohdan Khmelnytsky."},{"page_url":"https://pl.wikipedia.org/wiki/Atropina","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Atropine-D-and-L-isomers-from-DL-xtal-2004-3D-balls.png","page_title":"Atropina","context_page_description":"Atropina – organiczny związek chemiczny z grupy alkaloidów tropanowych, ester 3-hydroksytropanu i kwasu 3-hydroksy-2-fenylopropanowego. Antagonista pozazwojowych receptorów muskarynowych M1-M2. Nie wykazuje istotnego działania na pozostałe receptory muskarynowe. Stosowana jako lek rozkurczowy i środek rozszerzający źrenice. Jest racematem składającym się z dwóch enancjomerów różniących się konfiguracją przy atomie 2 grupy fenylopropanianowej; enancjomer 2S to hioscyjamina, wykazująca silniejsze działanie niż racemat."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%B0_%D0%B4%D0%B8%D0%B2%D0%B5%D1%80%D0%B3%D0%B5%D0%BD%D1%86%D1%96%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/British.coalfields.19th.century.jpg","page_title":"Велика дивергенція","context_page_description":"Велика дивергенція або європейське диво - це соціоекономічний зсув, в результаті якого західний світ подолав домодерні обмеження зростання і у XIX столітті постав як наймогутніша і найбагатша світова цивілізація, затьмаривши Імперію Великих Моголів, Китай династії Цін, Ісламський світ, Корею Чосонів та Японію часів Токуґави.\\nНауковці пропонували широкий спектр теорій, які могли б пояснити, чому сталась Велика дивергенція, включаючи географію, культуру, інституції, колоніалізм, ресурси та просто вдачу. Існує суперечність з приводу номенклатури \\"великої\\" дивергенції, оскільки чіткою точкою початку дивергенції традиційно вважається XVI чи навіть XV століття, після комерційної революції та витоків меркантилізму і капіталізму впродовж епохи Відродження та Великих географічних відкриттів, зародження європейських колоніальних імперій, протоглобалізації, наукової революції чи епохи Просвітництва. Однак найбільший стрибок дивергенції стався в XIX столітті разом з Промисловою революцією та Технологічною революцією. З цієї причини \\"Каліфорнійська школа\\" вважає лише ці точки у часі великою дивергенцією."},{"page_url":"https://la.wikipedia.org/wiki/Boisea_trivittata","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Boxelder.jpg","page_title":"Boisea trivittata","context_page_description":"Boisea trivittata est Americana hemipterorum species familiae Rhopalidarum, quae praecipue in arboribus generum Aceris et Fraxini invenitur. Adulti sunt circa 12½ mm longi, coloratione atrobrunneo vel nigro, cum venis aurantiacis rubrisve in alis et signa similia in abdomine. Nymphae et cimices immaturi coloratione sunt miniati.\\nHaec insecta mollioribus plantarum partibus vescuntur: foliis, floribus, et ramunculis novis. Nisi eorum numerus inusitate sit magnus, detrimentum plantarum est leve; annis autem quando numerus magnopere increbescit, possunt utilibus nocere arboribus.\\nAutumno, adulti fiunt pestes domesticae. Hiberna petentes, aedificia per rimis intrant, ubi quieti in muris intus et pone lateris tegmen manent dum caelum sit frigidum. Hieme exacta, hiberna relinquunt ut coniungantur. Ova pariunt in Aceribus et Fraxinis. Vere exeunte, greges quinquaginta ad ducentorum plurimorumve cimicum possunt congregari in parietibus, ferme in loco aprico.\\nBoisea trivittata nonnumquam in Civitatibus Foederatis appellatur cimex aceris et Anglice garage beetle. Locutio quoque vulgata cimex foetidus, saepissime Pentatomidis adhibetur."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%A4%D1%80%D0%B8%D0%BA%D0%B0%D0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Fricamps%2C_Somme%2C_France_%284%29.JPG","page_title":"Фрикам","context_page_description":"Фрикам — Францин гӀала-коммуна, лаьтта О-де-Франс регионехь. Коммунан департамент — Сомма. Кхузахь климат барамехь ю, аьхка йовха хуьлу, ткъа Ӏа барамехь-шийла хуьлу. ГӀалин бахархой французаш бу. Официалан Французийн мотт бу."},{"page_url":"https://es.wikipedia.org/wiki/Estrecho_de_Bering","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Bering_Strait.jpeg","page_title":"Estrecho de Bering","context_page_description":"El estrecho de Bering es un brazo de mar localizado entre el extremo oriental de Asia y el extremo noroccidental de América. Sus aguas comunican el mar de Chukotka, al norte, con el mar de Bering, al sur. Su anchura es de 82 km entre las inmediaciones del cabo Dezhnev en la península de Chukchi, en Rusia, que constituye el punto más oriental del continente de Asia, y las cercanías del Cabo Príncipe de Gales, en Alaska, Estados Unidos, que es el punto más occidental del subcontinente de Norteamérica.\\nEl nombre fue puesto en honor a Vitus Bering, el explorador danés al servicio del Imperio ruso que lo cruzó en 1728.\\nDesde al menos 1562 los geógrafos europeos sospechaban que existía un estrecho de Anián entre Asia y Norteamérica. En 1648 Semión Dezhniov probablemente pasó a través del estrecho, pero su relato no llegó a Europa. La región en que se encuentra se denomina Beringia."},{"page_url":"https://en.wikipedia.org/wiki/Shark_tourism","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/White_shark.jpg","page_title":"Shark tourism","context_page_description":"Shark tourism is a way for tourists to see sharks the ocean rather than in an aquarium. It is a form of eco-tourism intended to show in that local shark species are more valuable alive than dead. Instead of opting for a one time economic benefit of harvesting sharks for their body parts, communities are enabled to assist tourists who want to see live sharks. People can get close to the sharks by free- or scuba diving or entering the water in a protective cage."},{"page_url":"https://pl.wikipedia.org/wiki/La_Ceiba_(gmina)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/49/Oficina_Banco_Central_La_Ceiba.jpg","page_title":"La Ceiba (gmina)","context_page_description":"La Ceiba – gmina w północnym Hondurasie, w departamencie Atlántida. W 2010 roku zamieszkana była przez ok. 185,8 tys. mieszkańców. Ośrodkiem administracyjnym jest La Ceiba."},{"page_url":"https://fr.wikipedia.org/wiki/Principes_de_cosmographie","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Tristan_-_Principes_de_Cosmographie_titre.png","page_title":"Principes de cosmographie","context_page_description":"Les Principes de cosmographie forment un ensemble de traités à vocation scientifique rédigés par Tristan L'Hermite à partir de manuscrits attribués à François Viète, destinés à l'éducation de Catherine de Parthenay et de ses enfants."},{"page_url":"https://sk.wikipedia.org/wiki/Doboj","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Kuca_Mulalic_DOBOJ.jpg","page_title":"Doboj","context_page_description":"Doboj je sídlo a opština v Bosne a Hercegovine, v entite Republika srbská, nachádza sa pri hraniciach s Federáciou Bosny a Hercegoviny. Mesto spadá do historických regiónov Bosny a Usory, ako aj do zemepisnej oblasti Posávia. Nachádza na sútoku riek Bosna a Spreča, pár metrov južne od samotného mesta sa do Bosny vlieva aj rieka Usora. Mesto, respektíve stredoveká pevnosť Doboj, ktorá sa v meste dodnes nachádza sa prvýkrát spomína 6. júna v roku 1415. V roku 2013 malo samotné mestské osídlenie 25 132 obyvateľov. Rozloha mestskej časti je 17 km², rozloha celej opštiny. Doboj je významné dopravné centrum, je sídlom viacerých obchodných a priemyselných firiem. Vyrába sa v ňom stavebný materiál, kompresory, pneumatické náradie, chemikálie, odev, ale aj potravinárske výrobky. V blízkosti sa nachádzajú bane na uhlie a bentonity. V meste sídli súkromná univerzita Slobomir P Univerzitet, futbalový klub FK Sloga Doboj a hádzanársky klub RK Sloga Doboj."},{"page_url":"https://pl.wikipedia.org/wiki/British_Rail_Class_376","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Class376londonbridge.jpg","page_title":"British Rail Class 376","context_page_description":"British Rail Class 376 \\"Electrostar\\" - typ elektrycznych zespołów trakcyjnych, produkowanych przez zakłady w Derby, należące do firmy Bombardier Transportation. Klasa ta wchodzi w skład rodziny pociągów Electrostar. Obecnie jedynym przewoźnikiem eksploatującym tego typu pociągi jest firma Southeastern, posiadająca 36 zestawów."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%9A%E0%A4%82%E0%A4%A6%E0%A5%8D%E0%A4%B0_%E0%A4%86%E0%A4%B0%E0%A5%8D%E0%A4%AC%E0%A4%BF%E0%A4%9F%E0%A4%B0_3","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Lunar_Orbiter_3_moon_image.jpg","page_title":"चंद्र आर्बिटर 3","context_page_description":"चंद्र आर्बिटर 1\\nचंद्र आर्बिटर 2\\nचंद्र आर्बिटर 4\\nचंद्र आर्बिटर 5"},{"page_url":"https://fr.wikipedia.org/wiki/Puits_sacr%C3%A9_de_Funtana_Coberta","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Pozzo_sacro_di_Funtana_Coberta_Base_della_tholos_con_accesso_al_pozzo.JPG","page_title":"Puits sacré de Funtana Coberta","context_page_description":"Le puits sacré de Funtana Coberta est un site archéologique situé près de Ballao, province du Sud-Sardaigne, Sardaigne. Son origine remonte aux environs de 1200 av. J.-C..\\nLe puits sacré de Funtana Coberta date de la période de la culture nuragique et constitue un des nombreux temples d'époque voué au culte de l'eau.\\nDes fouilles ont été entreprises par Antonio Taramelli en 1918 qui est à l'origine de la découverte et en 1994 par Maria Rosaria Manunza, mettant en évidence des offrandes votives : statuettes de bronze, bijoux et objets précieux de fabrication indigène ou extérieure."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%BE%D0%BB%D1%8C%D1%88%D0%B0%D1%8F_%D0%A2%D0%B0%D0%BB%D0%B8%D0%BD%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Bolshya_Talinka_ok.jpg","page_title":"Большая Талинка","context_page_description":"Больша́я Та́линка — село в Тамбовском районе Тамбовской области Российской Федерации. Входит в состав Столовского сельсовета."},{"page_url":"https://en.wikipedia.org/wiki/MS_Rangitane_(1929)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/StateLibQld_1_171399_Rangitane_%28ship%29.jpg","page_title":"MS Rangitane (1929)","context_page_description":"RMS Rangitane was a passenger liner owned by the New Zealand Shipping Company. She was one of three sister ships delivered to the company in 1929 for the All-Red Route between Britain and New Zealand. Rangitane was built by John Brown & Company and launched on 27 May 1929.\\nThe three ships each measured about 16,700 gross register tons, 530 feet in length and nearly 70 feet in breadth. They could carry nearly 600 passengers in 1st, 2nd and 3rd classes, 200 crew members, and substantial cargo. They had Brown Sulzer diesel engines with a total output of 9,300 hp, turning twin propellers. In wartime, they carried only token armament. On Rangitane's final voyage she was armed with a 4.7-inch gun with only 40 rounds of ammunition."},{"page_url":"https://de.wikipedia.org/wiki/Plein","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2e/Alter_Bahnhof_Plein.jpg","page_title":"Plein","context_page_description":"Plein ist eine Ortsgemeinde im Landkreis Bernkastel-Wittlich in Rheinland-Pfalz. Sie gehört der Verbandsgemeinde Wittlich-Land an."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D1%80%D0%BE%D0%B2%D0%B5%D0%BB%D0%BB_(%D0%A2%D0%B5%D1%85%D0%B0%D1%81)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Foard_County_Courthouse%2C_Crowell%2C_Texas.jpg","page_title":"Кровелл (Техас)","context_page_description":"Кровелл — місто в США, в окрузі Форд штату Техас. Населення — 948 осіб."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D0%B8%D0%B1%D0%BE%D1%80%D1%87%D1%96_%D0%BE%D0%BA%D1%80%D1%83%D0%B3%D0%B8_%D0%91%D1%83%D0%BD%D0%B4%D0%B5%D1%81%D1%82%D0%B0%D0%B3%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/MJK_67286_Kerstin_Vieregge_%28Bundestag_2020%29.jpg","page_title":"Виборчі округи Бундестагу","context_page_description":"В цій статті наведено список виборчих округів Бундестагу, законодавчого органу Німеччини. Німеччина використовує змішану виборчу систему, подібну до тої яка використовується в Україні. За цією системою 299 депутатів Бундестагу з 598 обираються за мажоритарною виборчою системою в кожному з 299 виборчих округів, тобто в кожному окрузі є вибір між декількома кандидатами, і до парламенту потрапляє той, хто отримав найбільше голосів. Інші 299 депутатів обираються за пропорційною виборчою системою із закритими списками, окремо в кожній з 16-ти федеральних земель. Останні на цей момент парламентські вибори в Німеччині відбулись 24 вересня 2017 року, на яких було обране 19-те скликання законодавчого органу."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%BE%D8%B1%D8%B3%DB%8C%D9%85%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Driveway_entrance_to_the_HQ_of_Persimmon_PLC_-_geograph.org.uk_-_278190.jpg","page_title":"پرسیمون","context_page_description":"پرسیمون سهامی عام و یا خالقا آچیق شیرکتدیر."},{"page_url":"https://nl.wikipedia.org/wiki/Th%C3%A9odore_de_Mayerne","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/SirTheodoreDeMayerne.jpg","page_title":"Théodore de Mayerne","context_page_description":"Sir Théodore Turquet De Mayerne was een Zwitserse arts die de koningen van Frankrijk en Engeland behandelde, daarnaast heeft hij bijdragen geleverd aan de theorieën van Paracelsus.\\nMayerne werd geboren in een hugenotenfamilie. Zijn vader, Lodewijk Turquet de Mayerne baron van Aubon die getrouwd was met Louise le Maçon, was een protestantse Franse historicus die was gevlucht vanuit Lyon naar aanleiding van de Bartholomeusnacht en zijn peetoom was Theodorus Beza. Mayernes eerste vrouw was Marguerite de Boetslaer en ze hadden drie kinderen.\\nMayerne studeerde eerst in Genève en verhuisde later naar de Universiteit van Heidelberg. Weer later verhuisde hij naar Montpellier om daar geneeskunde te studeren, hij studeerde af in 1596 en behaalde zijn doctoraat in 1597. Zijn proefschrift onder leiding van Joseph du Chesne verdedigde het gebruik van chemische middelen in de geneeskunde; dit was de eerste duiding van zijn interesse in de theorieën van Paracelsus.\\nHij was getrouwd ca. 1595 met Margretha Elburg van den Boetzelaer. Zij was een dochter van Rutger VI van Boetzelaer heer van Merwede en Agnes de Bailleul. Uit zijn eerste huwelijk zijn drie kinderen geboren."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9A%CE%B7%CE%BB%CE%B9%CE%B4%CE%BF%CE%B2%CE%BF%CF%8D%CF%84%CE%B9","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d4/Juvenile_red_throated_diver.jpg","page_title":"Κηλιδοβούτι","context_page_description":"Το Kηλιδοβούτι είναι υδρόβιο πτηνό της οικογενείας των Κολυμβιδών, που απαντάται και στον ελλαδικό χώρο. Η επιστημονική ονομασία του είδους είναι Gavia stellata και δεν περιλαμβάνει υποείδη."},{"page_url":"https://es.wikipedia.org/wiki/Brazo_Largo","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Argentina%2C_Entre_R%C3%ADos%2C_Brazo_Largo_%289%29%2C_Estaci%C3%B3n.jpg","page_title":"Brazo Largo","context_page_description":"Brazo Largo es un paraje ubicado a 6 km del río Paraná Guazú, uno de los brazos del delta del río Paraná, en el distrito Paranacito del departamento Islas del Ibicuy, al sudeste de la provincia de Entre Ríos, Argentina. Pertenece al ejido municipal de Villa Paranacito.\\nSe halla a 162 km de Buenos Aires ingresando a la provincia por el Puente Zárate-Brazo Largo y bajando en el 2º puente, Ruta Nacional 12; luego se va hacia el sudeste por la ruta provincial 46 hasta el acceso."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A2%D0%B8%D1%82%D0%B0%D0%BD%D0%BE%D0%B7%D0%B0%D0%B2%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Argentinosaurus_digital_clay_reconstruction.png","page_title":"Титанозавр","context_page_description":"Титанозавр — рід рослиноїдних ящеротазових динозаврів з родини титанозаврових, що жили в пізньому крейдяному періоді на території сучасної Індії.\\nТитанозавр традиційно був «сміттєвим таксоном», до якого відносили різні погано збережені залишки завроподів. Найвідоміший вид Titanosaurus, \\"Titanosaurus\\" colberti, тепер виділений у окремий рід Isisaurus."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%B2%D1%82%D0%BE%D0%BC%D0%BE%D0%B1%D0%B8%D0%BB%D1%8C%D0%BD%D0%B0%D1%8F_%D0%BF%D1%80%D0%BE%D0%BC%D1%8B%D1%88%D0%BB%D0%B5%D0%BD%D0%BD%D0%BE%D1%81%D1%82%D1%8C_%D0%A2%D1%83%D1%80%D1%86%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Otovec_1.JPG","page_title":"Автомобильная промышленность Турции","context_page_description":"Автомобильная промышленность Турции производит легковые и малые коммерческие автомобили, грузовые автомобили, спецтехнику, большие и средние автобусы, а также, в больших объёмах, комплектующие к ним и автозапчасти. Автопром является ведущей отраслью машиностроительной промышленности Турции, в настоящее время в нём заняты 400 тыс. человек.\\nСтрана входит в 15 крупнейших автопроизводителей в мире и в пятёрку в Европе, где уступает только Германии, Испании, Франции, Великобритании, но превосходит Чехию, Россию, Италию. Производство автомобилей возросло за 15 лет с 374 тыс. до 1,5 млн. в год.\\nТакже Турция — крупнейший поставщик автомобильных компонентов в Европе.\\nНа автопром приходится 16 % экспорта."},{"page_url":"https://en.wikipedia.org/wiki/University_Square,_Bucharest","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Bucharest_%288273345834%29.jpg","page_title":"University Square, Bucharest","context_page_description":"University Square is located in downtown Bucharest, near the University of Bucharest. It is served by Universitate metro station.\\nFour statues can be found in the University Square, in front of the University; they depict Ion Heliade Rădulescu, Michael the Brave, Gheorghe Lazăr and Spiru Haret.\\nThe Ion Luca Caragiale Bucharest National Theatre and the Intercontinental Hotel are also located near University Square.\\nUniversity Square marks the northeastern boundary of the Old Center of Bucharest.\\nSince the end of 2014, after a project costing up to 65 million euros, the National Theatre has a new face, dominated by futuristic elements."},{"page_url":"https://sv.wikipedia.org/wiki/L%27ange_de_Nisida","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f1/NisidaSeenFromPosillipo.jpg","page_title":"L'ange de Nisida","context_page_description":"L'ange de Nisida är en opera semiseria i fyra akter med musik av Gaetano Donizetti och libretto av Alphonse Royer och Gustave Vaëz.\\nDelar av librettot antas sammanfalla med librettot till Giovanni Pacinis Adelaide e Comingio, och finalscenen bygger på François-Thomas-Marie de Baculard d'Arnauds pjäs Les Amants malheureux, ou le comte de Comminges. Donizetti arbetade på operan i senare delen av 1839. Då ämnesvalet involverar älskarinnan till en neapolitansk kung och operan därför kunde få svårt med den italienska censuren, valde Donizetti att sätta upp operan i Frankrike. Men det operasällskap som var kontrakterat gjorde konkurs och 1840 hade Donizetti omarbetat operan till La favorite. L'ange de Nisida fick slutligen sin premiär den 18 juli 2018 i ett konsertant uppförande på Royal Opera House i London."},{"page_url":"https://en.wikipedia.org/wiki/Occidozyga_magnapustulosa","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Occidozyga_magnapustulosa.jpg","page_title":"Occidozyga magnapustulosa","context_page_description":"Occidozyga magnapustulosa is a species of frog in the family Dicroglossidae. It is known from scattered locations in northern and eastern Thailand, and in Laos and Vietnam.\\nThe biology of this species is poorly known as it has been mixed with Occidozyga martensii and may be conspecific with that species. Specimens allocated to this species are found in seepages, puddles and other shallow waters along streams and rivers."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A1%D0%BF%D1%96%D1%81_%D0%B0%D0%B1%E2%80%99%D0%B5%D0%BA%D1%82%D0%B0%D1%9E,_%D0%BD%D0%B0%D0%B7%D0%B2%D0%B0%D0%BD%D1%8B%D1%85_%D1%83_%D0%B3%D0%BE%D0%BD%D0%B0%D1%80_%D0%94%D0%B6._%D0%A0._%D0%A0._%D0%A2%D0%BE%D0%BB%D0%BA%D1%96%D0%BD%D0%B0_%D1%96_%D1%8F%D0%B3%D0%BE_%D0%BB%D0%B5%D0%B3%D0%B5%D0%BD%D0%B4%D0%B0%D1%80%D1%8B%D1%83%D0%BC%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Hubble_Observes_Glowing%2C_Fiery_Shells_of_Gas.jpg","page_title":"Спіс аб’ектаў, названых у гонар Дж. Р. Р. Толкіна і яго легендарыума","context_page_description":"Брытанскі пісьменнік Джон Рональд Руэл Толкін з’яўляецца стваральнікам цэлага выдуманага сусвету, які між іншага вызначаецца глыбока прапрацаванай анамастыкай. У выніку вялікай папулярнасці твораў Толкіна многія імёны персанажаў, назвы мясцовасцяў і іншых аб’ектаў яго легендарыума далі свае імёны разнастайным аб’ектам рэальнага свету. Спіс аб’ектаў, названых у гонар Дж. Р. Р. Толкіна і яго легендарыума ўключае ў сябе назвы астранамічных і геаграфічных аб’ектаў, віды жывёл і раслін, назвы кампаній і музычных гуртоў, а таксама іншыя вядомыя аб’екты."},{"page_url":"https://en.wikipedia.org/wiki/List_of_works_by_Edwin_Lutyens","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Silver_Street_Bridge%2C_Cambridge_-_panoramio.jpg","page_title":"List of works by Edwin Lutyens","context_page_description":"This list of works by Edwin Lutyens provides brief details of some of the houses, gardens, public buildings and memorials designed by Sir Edwin Landseer Lutyens.\\nLutyens was a British architect known for imaginatively adapting traditional architectural styles to the requirements of his era. The architectural historian Gavin Stamp described him as \\"the greatest British architect of the twentieth century\\" and English Heritage identify him as \\"one of the greatest architects the country has ever produced\\". More than 500 of his creations have been placed on the National Heritage List for England."},{"page_url":"https://az.wikipedia.org/wiki/%C5%9Eah_%C5%9E%C3%BCca","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/74/Shah_Shuja_Shiraz2.JPG","page_title":"Şah Şüca","context_page_description":"Şah Şüca- Müzəffərilər sülaləsindən olan hökmdar,1358-1384-cü illər hakimiyyətdə olmuşdur."},{"page_url":"https://fr.wikipedia.org/wiki/Maison_natale_de_Fran%C3%A7ois_Mitterrand","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/JarnacMitt1.jpg","page_title":"Maison natale de François Mitterrand","context_page_description":"La maison natale de François Mitterrand est un musée français situé à Jarnac, en Charente. François Mitterrand, président de la République française de 1981 à 1995, y naît et y passe son enfance entre 1919 et 1934. Inscrite à l'inventaire supplémentaire des monuments historiques depuis le 20 décembre 2006, elle est labelisée « Maisons des Illustres » depuis 2011."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%97%D0%B0%D0%BC%D0%B0%D0%BA_%D0%A4%D1%83%D0%B6%D0%B8%D0%BD%D0%B5_(%D0%89%D1%83%D0%B1%D1%99%D0%B0%D0%BD%D0%B0)","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fb/Fuzinski_grad-grb.JPG","page_title":"Замак Фужине (Љубљана)","context_page_description":"Замак Фужине (Љубљана) односно Фужински замак је добио име по сл. fužine, што је на словеначком језику означавало железарску радњу, која је била постављена поред града и реке Љубљанице. По њима се назива и део тог места - Фужине. Изградњу града финансирао је Вид Кхисл и његов син Јанж године 1528 - 1557. Град је изграђен у ренесансном стилу.\\nГрад је у својој књизи Слава војводине Крањске описао и нацртао Јанез Вајкард Валвазор у 17. веку, и већ тада је био град у лошем стању, без насељене властеле."},{"page_url":"https://fr.wikipedia.org/wiki/Ligne_36_(Infrabel)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Belgian_Railway_Line_36.png","page_title":"Ligne 36 (Infrabel)","context_page_description":"La ligne 36 est une ligne de chemin de fer belge reliant Bruxelles à Liège capitale économique de la Wallonie.\\nConstruite par les Chemins de fer de l’État belge, elle est l'une des premières lignes de chemin de fer de Belgique, sur l'axe posé entre le port d'Anvers, Malines, Liège et la Prusse.\\nDédiée principalement au trafic voyageur, la ligne est électrifiée en tension continue 3 kV, conformément au principal standard en vigueur sur le réseau belge. Elle est équipée de signalisation lumineuse ainsi que de l'ETCS pilotée par bloc automatique, et parcourable à 160 km/h entre Bruxelles et Louvain, à 200 km/h sur la portion centrale avec le système de signalisation ETCS et 140 km/h au-delà. Aujourd'hui, seul les trains a grande vitesse circulent à 200 km/h entre Bruxelles et Louvain."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D1%8B%D1%80%D0%B4%D0%B0%D1%80%D1%8C%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Syr15.jpg","page_title":"Сырдарья","context_page_description":"Сырдарья́ — длиннейшая и вторая по водности после Амударьи река Средней Азии. Среднемноголетний расход воды — 724 м³/с."},{"page_url":"https://fr.wikipedia.org/wiki/Characiformes","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Curimata_cf_cyprinoides.jpg","page_title":"Characiformes","context_page_description":"Les Characiformes sont un ordre de poissons Actinoptérygiens, comprenant les characins et leurs semblables. Ils sont quelques milliers d'espèces différentes y compris les fameux piranhas et Tétras."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9B%D1%8E%D0%B1%D0%BE%D1%81%D1%82%D0%B8%D0%BD%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Manastir_Ljubostinja_004.jpg","page_title":"Любостиня","context_page_description":"Любостиня е средновековен православен манастир в Сърбия, намиращ се в близост до Тръстеник, Расински окръг и на 9 км североизточно от Врънячка баня, Рашки окръг. Сгушен в долината на малката Любостинска река в полите на Гледачките планини, манастирският комплекс е ктиторски изграден в моравски стил от княгиня Милица в годините от 1388 до 1405 г., като е посветен на „Успение на Пресвета Богородица“.\\nСпоред преданието, в Любостиня прекарват последните си години на този свят като монахини и отдадени в молитви към Бога, княгиня Милица – вдовицата на княз Лазар, и Ефемия – вдовицата на Иван Углеша. Както предава народното поверие, след битката при Чирмен и тази на Косово поле, в манастира се уединяват отдадени в молитви към Бога, вдовиците на загиналите благородници в тези битки. Днес Любостиня е метох, който се обитава и поддържа от около петдесет монахини. По време на второто хабсбургско управление на Смедеревския санджак, мястото е ползвано като пункт за подигане на буна срещу османската власт. След възстановяване на османската власт в района и над Смедеревския санджак, манастирът е изгорен от еничарите, като по този начин повечето от средновековните му стенописи са унищожени."},{"page_url":"https://de.wikipedia.org/wiki/Gl%C3%BChstrumpf","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Gas_mantle_02.jpg","page_title":"Glühstrumpf","context_page_description":"Ein Glühstrumpf oder Gasstrumpf ist ein kuppel- oder birnenförmiges feinmaschiges Gebilde aus Oxiden, das in gasbetriebenen Leuchten die Lichtquelle bildet, indem es durch die Flamme zum Leuchten angeregt wird. Er wird aus einem mit speziellen Salzen seltener Erden präparierten Gewebe aus Baumwolle, Seide oder Kunstseide hergestellt, das durch Aufheizen in einer Gasflamme verbrennt und die Salze als Oxide in Form eines feinen Gerüstes hinterlässt."},{"page_url":"https://sv.wikipedia.org/wiki/Kassettsingel","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/CassetteSingle1.jpg","page_title":"Kassettsingel","context_page_description":"En kassettsingel är en musiksingel utgiven på kassettband."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Waldenburg_(Sachsen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Schlagwitz%2C_Bachstra%C3%9Fe_13_%282%29.jpg","page_title":"Liste der Kulturdenkmale in Waldenburg (Sachsen)","context_page_description":"Die Liste der Kulturdenkmale in Waldenburg enthält die Kulturdenkmale in Waldenburg.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale in Sachsen."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%B4%84%E5%8D%A1%E4%BC%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/M%C3%B3r_J%C3%B3kai.jpg","page_title":"約卡伊","context_page_description":"約卡伊，19世紀匈牙利最重要的小說家。他是個多產作家，1894-1898年間出版的文集就多達100卷，大量的新聞作品尚不計在內。其早年作品如《工作日》，流露出法國浪漫主義的影響，但是，一些成熟的小說卻更反映出現實和個人經歷。《一個匈牙利富豪》和《金人》，是他處理當代匈牙利題材的兩部最主要的小說。\\n約卡伊是匈牙利 戲劇家，小說家和革命家。他是 1848年在佩斯的匈牙利自由革命爆發中的積極參與者和領導人物。Jókai的浪漫小說在維多利亞時代的英國精英中非常受歡迎，他經常在19世紀的英國媒體中與狄更斯相提並論。[2] [3]他最著名的粉絲和崇拜者之一是維多利亞女王本人。[4]"},{"page_url":"https://de.wikipedia.org/wiki/Ben_Lawers","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/29/Lawers.jpg","page_title":"Ben Lawers","context_page_description":"Ben Lawers ist eine der höchsten Erhebungen im südlichen Teil der Schottischen Highlands. Er liegt an der Nordseite von Loch Tay, und ist der höchste Punkt von einem langen Rücken, der sieben Munros einbezieht. Von Ben Lawers wurde lange gedacht, er wäre 4000 Fuß hoch; genaue Messungen in den 1870er Jahren zeigten jedoch, dass er ungefähr fünf Meter kleiner ist. 1878 verbrachte eine Gruppe von 20 Männern einen Tag mit dem Aufbau eines großen Steinhügels, in der Hoffnung, den Gipfel auf eine Höhe von 4000 Fuß zu bringen. Der Steinhügel existiert nicht mehr; in jedem Fall ignorierte das Landesvermessungsamt den Hügel als künstliche Struktur, die nicht wirklich Teil des Berges war."},{"page_url":"https://en.wikipedia.org/wiki/List_of_largest_land_carnivorans","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/81/Kodiak_bear_in_germany.jpg","page_title":"List of largest land carnivorans","context_page_description":"This list contains terrestrial members of the order Carnivora with an average reported mass of 160 kilograms or more."},{"page_url":"https://de.wikipedia.org/wiki/Johann_Melchior_F%C3%BCssli","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e5/Wulp_1268.jpg","page_title":"Johann Melchior Füssli","context_page_description":"Johann Melchior Füssli war ein Schweizer Zeichner, Kupferstecher und Radierer. Bekannt ist er vor allem als Zeichner und Kupferstecher der Bilderbibel von Johann Jakob Scheuchzer, für die er mehr als 700 Vorzeichnungen fertigte.\\nJohann Melchior war der Sohn des Johann Caspar Füssli und der Magdalena Stutz. Bei Johannes Meyer in Zürich und beim kurfürstlichen Hofkupferstecher Samuel Blesendorf in Berlin lernte er die Kunst des Radierens. Noch während seiner Lehre arbeitete er an einer Bibelillustration mit.\\nAb 1697 besass Füssli in Zürich eine Werkstatt mit dazugehörendem Verlag. Er kaufte sich in die Zunft «Zur Meise» ein und brachte David Herrliberger sein Können bei. 1709 malte er zwei Tafeln mit Fischgattungen, die im Zürichsee und in der Limmat vorkommen.\\nZwischen 1709 und 1729 schuf er zahlreiche Neujahrsblätter für Zürcher Gesellschaften. Von 1716 bis 1718 illustrierte er Johann Jakob Scheuchzers «Helvetiae historia naturalis» und 1732 dessen «Untersuchungen des Bads zu Baden». Seine 753 Zeichnungen zu Scheuchzers «Physica sacra» sind ein wesentlicher Beitrag zur wissenschaftlichen Buchillustration des Barock."},{"page_url":"https://it.wikipedia.org/wiki/Se_Wsi_Testamenti","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Se_Wsi_Testamenti.png","page_title":"Se Wsi Testamenti","context_page_description":"Se Wsi Testamenti è la prima traduzione del Nuovo Testamento in finlandese da parte di Mikael Agricola, vescovo di Turku. Normalmente considerato come la sua opera principale, il manoscritto fu completato nel 1543 ma durante i cinque anni successivi ci furono diverse correzioni. In tutto Agricola ci impiegò 11 anni per completare il lavoro. Il Nuovo testamento, stampato a Stoccolma nel 1548, si basava ancora principalmente sul dialetto di Turku.\\nIl Testamenti contiene 718 pagine e diverse illustrazioni. Ha due prefazioni, una per quanto riguarda la pratica e una a livello teologico. Nella prima Agricola descrive le ragioni per cui usò il dialetto del paese e dice come il cristianesimo giunse in Finlandia. In quella teologica Agricola dice che la sua traduzione si basa sulla Bibbia originale in greco, su una collezione di Erasmo da Rotterdam in latino, sulla traduzione in tedesco di Martin Lutero e su quella in svedese di Olaus Petri.\\nAgricola spiegò anche come creò molte nuove parole sperando che esse siano piaciute e utilizzate. In più il Se nel titolo viene utilizzato come articolo determinativo che Agricola tentò di istituzionalizzare senza riuscirci."},{"page_url":"https://en.wikipedia.org/wiki/Mesochorus","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Mesochorus_P1380968a.jpg","page_title":"Mesochorus","context_page_description":"Mesochorus is a genus of ichneumon wasps in the family Ichneumonidae. There are at least 690 described species in Mesochorus."},{"page_url":"https://en.wikipedia.org/wiki/Cullen_Jenkins","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Cullen_Jenkins_signs_autograph.jpg","page_title":"Cullen Jenkins","context_page_description":"Cullen Darome Jenkins is a former American football defensive end. He was signed by the Green Bay Packers as an undrafted free agent in 2003. In his last year as a Packer, he won Super Bowl XLV over the Pittsburgh Steelers. He played college football at Central Michigan University. He has also played for the Philadelphia Eagles, New York Giants, and Washington Redskins."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%97%E0%B8%B0%E0%B9%80%E0%B8%A5%E0%B8%AA%E0%B8%B2%E0%B8%9A%E0%B8%9B%E0%B8%A5%E0%B9%88%E0%B8%AD%E0%B8%87%E0%B8%A0%E0%B8%B9%E0%B9%80%E0%B8%82%E0%B8%B2%E0%B9%84%E0%B8%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Crater_lake_oregon.jpg","page_title":"ทะเลสาบปล่องภูเขาไฟ","context_page_description":"ทะเลสาบปล่องภูเขาไฟ เป็นทะเลสาบที่เกิดขึ้นภายในปล่องภูเขาไฟ อย่างเช่น Maar หรือแคลดีรา บางครั้งอาจเรียกว่า ทะเลสาบแคลดีรา แต่โดยทั่วไปแล้วมักจะไม่เรียกเช่นนั้น ทะเลสาบปล่องภูเขาไฟที่อยู่ในปล่องของภูเขาไฟมีพลังอาจเรียกในอีกชื่อหนึ่งว่า Volcanic lakes และน้ำในทะเลสาบลักษณะนี้มักจะมีสภาพเป็นกรด เต็มไปด้วยแก๊สภูเขาไฟ และมีสีเขียวเข้ม ขณะที่ทะเลสาบที่ตั้งอยู่ในปล่องภูเขาไฟสงบหรือภูเขาไฟดับสนิทมักจะมีน้ำที่ใส และจะยิ่งใสมากเป็นพิเศษถ้าไม่มีธารน้ำและตะกอนไหลเข้ามา\\nทะเลสาบปล่องภูเขาไฟเกิดขึ้นเมื่อหยาดน้ำฟ้าตกลงมาในแอ่ง ความลึกจะเพิ่มมากขึ้นจนกระทั่งเกิดสมดุลระหว่างอัตราของน้ำที่เข้ามาและอัตราของน้ำที่เสียไปซึ่งอาจเกิดจากการระเหย การซึมลงใต้ดิน และอาจรวมถึงการไหลออกบนผิวดินหากระดับน้ำในทะเลสาบสูงถึงจุดที่ต่ำที่สุดของขอบแอ่ง ซึ่งการไหลออกบนผิวดินนี้อาจกัดเซาะสิ่งทับถมที่กั้นทะเลสาบไว้ และถ้าสิ่งทับถมนี้ถูกกัดเซาะอย่างรวดเร็ว ก็จะทำให้เกิด Lake breakout ขึ้นได้"},{"page_url":"https://arz.wikipedia.org/wiki/%DA%86%D9%88%D9%87%D8%A7%D9%86_%D8%A7%D8%B1%D9%8A%D9%83_%D8%B3%D9%88%D8%AF%D9%8A%D8%B1%D9%84%D9%88%D9%86%D8%AF","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7b/Johan_Erik_S%C3%B6derlund_-_from_Svenskt_Portr%C3%A4ttgalleri_XX.png","page_title":"چوهان اريك سوديرلوند","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nچوهان اريك سوديرلوند كان مهندس من السويد."},{"page_url":"https://id.wikipedia.org/wiki/Jembatan_Sabuk_Giok","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Summer_palace_Bridge_3.jpg","page_title":"Jembatan Sabuk Giok","context_page_description":"Jembatan Sabuk Giok atau sering juga disebut Jembatan Punggung Unta merupakan jembatan bulan untuk pejalan kaki pada abad ke-18 yang terletak di Istana Musim Panas, Beijing, Tiongkok. Jembatan ini terkenal akan bentuknya berupa lengkungan tunggal tipis tinggi yang khas. Di bagian sisi jembatan telah dibangun tembok rendah setinggi 1 meter yang berfungsi sebagai pegangan ketika berjalan melintasi jembatan ini.\\nJembatan ini yang paling terkenal dari enam jembatan yang ada di pantai barat Danau Kunming. Dibangun mulai 1751 hingga 1764 pada masa pemerintahan Kaisar Qianlong. Jembatan Sabuk Giok terbuat dari marmer dan batu putih lainnya serta bergaya seperti jembatan pedesaan yang halus di Tiongkok selatan. Pagar jembatan didekorasi dengan ukiran burung jenjang dan hewan lainnya. Pelengkung dibuat sedemikian rupa sehingga ketika ada perayaan acara-acara khusus, para kaisar dan permaisuri serta perahu naga mereka dapat melintas di bawah jembatan ini. Jembatan Sabuk Giok adalah salah satu jembatan terindah di Istana Musim Panas."},{"page_url":"https://zh.wikipedia.org/zh-mo/%E5%A5%A5%E5%9C%B0%E5%88%A9%E6%80%BB%E7%BB%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Bundesarchiv_Bild_119-5243%2C_Wien%2C_Arthur_Sey%C3%9F-Inquart.jpg","page_title":"奥地利总统","context_page_description":"奧地利為聯邦制議會制共和國，總統是象徵性的國家元首，為軍隊的總司令，行使國家最高權力，包括任命總理及內閣官員，以及依總理要求解散國民院，但權力類似立憲君主般，在日常情況並不會擅自使用。此職經民選產生，任期六年，可以連任一次。"},{"page_url":"https://fr.wikipedia.org/wiki/Ghislain_Walravens","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dd/L%27Avenir_%28ship%2C_1908%29_-_SLV_H91.108-1278.jpg","page_title":"Ghislain Walravens","context_page_description":"L'abbé Ghislain Walravens, Biscops en résistance, né à Lombeek-Notre-Dame, le 3 décembre 1880 et mort à Arendonk, le 11 janvier 1955, est un prêtre catholique belge, un résistant et un espion de la Première Guerre mondiale. Il crée, à la demande des Britanniques en 1915, le réseau de renseignement qui portera son nom, le Service Biscops."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%B9%BC%EB%A6%AC%EB%8F%88%EC%9D%98_%EB%A9%A7%EB%8F%BC%EC%A7%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Calydonian_hunt.jpg","page_title":"칼리돈의 멧돼지","context_page_description":"칼리돈의 멧돼지는 그리스 신화에 등장하는 난폭한 멧돼지로 이 멧돼지의 사냥을 둘러싼 일화가 유명하다."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D9%88%D8%BA%D9%88%D8%B4%D9%8A%D8%B4%D8%AA-%D8%B3%D9%8A%D8%B1%D9%8A%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Mogosesti-Siret_judetul_Iasi.jpg","page_title":"موغوشيشت-سيريت","context_page_description":"موغوشيشت-سيريت هي قرية تقع في إقليم ياش في رومانيا وبلغ عدد سكانها 4,061 نسمة في عام 2002م."},{"page_url":"https://en.wikipedia.org/wiki/Wairarapa_Connection","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/DCP4818_and_SW_set_at_Carterton_station_with_Waiararapa_Connection.jpg","page_title":"Wairarapa Connection","context_page_description":"The Wairarapa Connection is a New Zealand interurban commuter rail service along the Wairarapa Line between Masterton, the largest town in the Wairarapa, and Wellington. It is operated by Wellington suburban operator Transdev under contract from the Greater Wellington Regional Council. It is a diesel-hauled carriage service, introduced by the New Zealand Railways Department in 1964 after passenger demand between Masterton to Wellington exceeded the capacity of the diesel railcars then used.\\nThe 91-kilometre service operates five times daily in each direction Monday to Friday, three peak and two off-peak, with an additional service each way on Friday nights and two services each way on weekends and public holidays. It stops at all stations from Masterton to Upper Hutt, then runs express along the Hutt Valley Line to Wellington, stopping only at Waterloo and Petone stations.\\nWhile all other regional passenger trains in New Zealand have been withdrawn, the Wairarapa Connection service continues due to the Wairarapa's proximity to Wellington and the advantage of the 8.8 km Rimutaka Tunnel through the Rimutaka Ranges compared to the narrow and winding Rimutaka Hill Road over them."},{"page_url":"https://nl.wikipedia.org/wiki/Scopula_kagiata","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Scopula_kagiata2.jpg","page_title":"Scopula kagiata","context_page_description":"Scopula kagiata is een vlinder uit de familie van de spanners. De wetenschappelijke naam van de soort is voor het eerst geldig gepubliceerd in 1909 door Bastelberger."},{"page_url":"https://fr.wikipedia.org/wiki/Dee_Gordon","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/20140919_Dee_Gordon_infield_single_in_front_of_Anthony_Rizzo.JPG","page_title":"Dee Gordon","context_page_description":"Devaris « Dee » Strange-Gordon est un joueur de champ centre des Mariners de Seattle de la Ligue majeure de baseball.\\nIl commence sa carrière en 2011 en tant que joueur d'arrêt-court des Dodgers de Los Angeles avant de passer à la position de deuxième but en 2014. Il joue à cette position jusqu'en 2017. Gordon évolue avec les Marlins de Miami de 2015 à 2017 avant d'être transféré à Seattle.\\nIl est le champion voleur de buts de la Ligue nationale en 2014, 2015 et 2017, ainsi que champion frappeur en 2015. Également meneur des majeures avec 205 coups sûrs en 2015, il est le premier joueur à cumuler les titres de champions frappeur et voleur de buts depuis Jackie Robinson en 1949."},{"page_url":"https://fr.wikipedia.org/wiki/Jean-Christophe_Napol%C3%A9on","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Prince_Napol%C3%A9on.JPG","page_title":"Jean-Christophe Napoléon","context_page_description":"Jean-Christophe Napoléon Bonaparte, dit Jean-Christophe Napoléon, né le 11 juillet 1986 à Saint-Raphaël, est un membre de la famille Bonaparte. Il est l’actuel prétendant au trône impérial français et porte le titre de courtoisie de prince Napoléon.\\nDiplômé d'HEC Paris et de Harvard, il réside aujourd'hui à Londres où il travaille comme banquier d'affaires."},{"page_url":"https://en.wikipedia.org/wiki/English_Reformation","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Catalogue_of_Sects.GIF","page_title":"English Reformation","context_page_description":"The English Reformation took place in 16th-century England when the Church of England broke away from the authority of the Pope and the Roman Catholic Church. These events were, in part, associated with the wider European Protestant Reformation, a religious and political movement that affected the practice of Christianity in western and central Europe. Causes included the invention of the printing press, increased circulation of the Bible and the transmission of new knowledge and ideas among scholars, the upper and middle classes and readers in general. The phases of the English Reformation, which also covered Wales and Ireland, were largely driven by changes in government policy, to which public opinion gradually accommodated itself.\\nBased on Henry VIII's desire for an annulment of his marriage, the English Reformation began as more of a political affair than a theological dispute. The reality of political differences between Rome and England allowed growing theological disputes to come to the fore. Until the break with Rome, the Pope and general councils of the church decided doctrine. Church law was governed by canon law with final jurisdiction in Rome."},{"page_url":"https://eu.wikipedia.org/wiki/Stomatepia_pindu","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Stomatepia_pindu_-_Lac_Barombi_Mbo_-_Aqua_porte_dor%C3%A9e_Paris_11.JPG","page_title":"Stomatepia pindu","context_page_description":"Stomatepia pindu Stomatepia generoko animalia da. Arrainen barruko Actinopterygii klasean sailkatzen da, Cichlidae familian."},{"page_url":"https://ur.wikipedia.org/wiki/%D9%81%DB%81%D8%B1%D8%B3%D8%AA_%D8%B4%D9%85%D8%A7%D9%84%DB%8C_%DA%A9%D9%88%D8%B1%DB%8C%D8%A7_%DA%A9%DB%92_%D8%B4%DB%81%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Dandong%2C_Liaoning_Province.jpg","page_title":"فہرست شمالی کوریا کے شہر","context_page_description":"شمالی کوریا کے اہم شہروں کو صوبوں کے برابر حیثیت خود،ختاری حاصل ہے۔"},{"page_url":"https://de.wikipedia.org/wiki/Leichtathletik-Weltmeisterschaften_2017/400_m_der_Frauen","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Chrisann_Gordon_-_Rio_2016.jpg","page_title":"Leichtathletik-Weltmeisterschaften 2017/400 m der Frauen","context_page_description":"Der 400-Meter-Lauf der Frauen bei den Leichtathletik-Weltmeisterschaften 2017 fand zwischen dem 6. und 9. August 2017 in London, Großbritannien, statt.\\nEs siegte die US-Amerikanerin Phyllis Francis. Vizeweltmeisterin wurde Salwa Eid Naser aus Bahrain. Allyson Felix, wie die Weltmeisterin aus den Vereinigten Staaten, gewann die Bronzemedaille."},{"page_url":"https://en.wikipedia.org/wiki/Concours_des_villes_et_villages_fleuris","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/90/Bormes_044.jpg","page_title":"Concours des villes et villages fleuris","context_page_description":"The Concours des villes et villages fleuris is a contest organized annually in France which aims to encourage communes to adopt and implement policies that improve the quality of life of their inhabitants and enhance their attractiveness to visitors through the provision and maintenance of green spaces and the enhancement of their natural environments. Successful communes are awarded the right to display a badge on road signs and in other local promotional material.\\nThe competition was created in 1959 by the French state and it is administered by a distinct national committee since 1972. This committee is still linked to the Ministry of Tourism. All the French communes can take part and there are no application fees. There is not any limitation to the number of awarded communes, so they are not in competition between each other.\\nThe label comprises four awards: one, two, three or four flowers, according to the efforts of the municipality. Each award is given according to strict criteria. The \\"Fleur d'Or\\" is a special prize awarded to a small number of applicants. Labelled communes display their flowers on road signs at their entrances."},{"page_url":"https://war.wikipedia.org/wiki/Yaracuy","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/15/Flag_of_Yaracuy_State.svg","page_title":"Yaracuy","context_page_description":"An Yaracuy amo an usa ka estado han nasod han Venezuela. An kapital hini amo an San Felipe."},{"page_url":"https://en.wikipedia.org/wiki/Friedrichstra%C3%9Fe","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Aufsicht_auf_die_Friedrichstra%C3%9Fe.jpg","page_title":"Friedrichstraße","context_page_description":"The Friedrichstraße is a major culture and shopping street in central Berlin, forming the core of the Friedrichstadt neighborhood and giving the name to Berlin Friedrichstraße station. It runs from the northern part of the old Mitte district to the Hallesches Tor in the district of Kreuzberg.\\nThis downtown area is known for its posh real estate market and the campus of the Hertie School of Governance. Due to its north-southerly direction, it forms important junctions with the east-western axes, most notably with Leipziger Straße and Unter den Linden. The U6 U-Bahn line runs underneath. During the Cold War it was bisected by the Berlin Wall and was the location of Checkpoint Charlie."},{"page_url":"https://ca.wikipedia.org/wiki/Lottie_Dod","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Lottie_Dod_age20.jpg","page_title":"Lottie Dod","context_page_description":"Charlotte \\"Lottie\\" Dod va ser una esportista anglesa, principalment coneguda com a jugadora de tennis. Guanyà cinc edicions del Torneig de Wimbledon individual femení, el primer d'ells amb tan sols 15 anys l'estiu de 1887. Continua sent la tennista més jove a guanyar l'individual femení, tot i que Martina Hingis era tres dies més jove quan guanyà el campionat de dobles femení el 1996.\\nA banda del tennis, Dod va competir en molts altres esports, com ara el golf, l'hoquei sobre herba i el tir amb arc. Guanyà el Campionat Britànic femení de golf amateur, va jugar dos partits amb la selecció anglesa femenina d'hoquei sobre herba, que ajudà a fundar, i guanyà la medalla de plata als Jocs Olímpics de Londres el 1908 en la modalitat de roble ronda Nacional del programa de tir amb arc.\\nEl seu germà William Dod també fou arquer i medallista olímpic."},{"page_url":"https://en.wikipedia.org/wiki/Pueblo_IV_Period","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/40/Pueblos_Rio_Grande_valley.JPG","page_title":"Pueblo IV Period","context_page_description":"The Pueblo IV Period was the fourth period of ancient pueblo life in the American Southwest. At the end of prior Pueblo III Period, Ancestral Puebloans living in the Colorado and Utah regions abandoned their settlements and migrated south to the Pecos River and Rio Grande valleys. As a result, pueblos in those areas saw a significant increase in total population.\\nThe Pueblo IV Period is similar to the \\"Regressive Pueblo Period\\" or, referring to the Ancient Pueblo People of Colorado and Utah, the \\"Post Pueblo Period.\\""},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Pfarrkirchen","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Lindnerstr._9_Pfarrkirchen-1.jpg","page_title":"Liste der Baudenkmäler in Pfarrkirchen","context_page_description":"Auf dieser Seite sind die Baudenkmäler der niederbayerischen Stadt Pfarrkirchen zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Fl%C3%BCsse_in_%C3%84thiopien","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Abbay_OSM.png","page_title":"Liste der Flüsse in Äthiopien","context_page_description":"Dies ist eine Liste der Flüsse in Äthiopien. Äthiopien ist hydrologisch vom Nil dominiert. Der vom Tanasee rührende Blaue Nil spendet 80 % des Wassers des Nil an der Mündung. Die Quellflüsse des Sobat, der in den Weißen Nil mündet, stellen einen weiteren großen Zustrom des Nils dar. Äthiopien Ist zwar nicht die Quelle des Nils, aber der Ursprung des größten Teils des Wassers das schließlich durch ihn ins Mittelmeer fließt.\\nDarüber hinaus entspringen die dem Grabenbruch folgenden endorhëischen Flüsse Awash und Omo in dem ostafrikanischen Staat. Und schließlich die Quellflüsse des Juba, die auf der anderen Seite des Grabenbruchs Richtung Indischer Ozean entwässern."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A0%D1%96%D0%B7%D0%B4%D0%B2%D0%BE_%D0%91%D0%BE%D0%B3%D0%BE%D1%80%D0%BE%D0%B4%D0%B8%D1%86%D1%96_(%D0%93%D1%96%D1%80%D0%BB%D0%B0%D0%BD%D0%B4%D0%B0%D0%B9%D0%BE)","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/52/DetailGeburt.jpg","page_title":"Різдво Богородиці (Гірландайо)","context_page_description":"«Різдво Богородиці» — уславлена фреска, котру створив флорентійський художник Доменіко Гірландайо в церкві Санта-Марія-Новелла, в каплиці Торнабуоні у Флоренції."},{"page_url":"https://fi.wikipedia.org/wiki/Medest%C3%A4j%C3%A4t","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/PurpleSunbird.jpg","page_title":"Medestäjät","context_page_description":"Medestäjät on heimo pienenkokoisissa varpuslinnuissa. Niitä löytyy luonnonvaraisina trooppisilta alueilta Australaasiasta ja Afrikasta. Medestäjät syövät pääasiassa mettä, mutta syövät myös hyönteisiä. Suurin osa medestäjistä pystyy lentämään paikallaan imiessään mettä kuten kolibrit, mutta yleensä ne istuvat oksalla. Lintujen lento on nopeaa ja suoraa, sillä medestäjillä on lyhyet siivet. Koiraiden ja naaraiden välillä on suuria eroja, koiraiden ollessa värikkäämpiä. Medestäjillä on pitkä alaspäin kaartuva nokka ja tahmea putkimainen kieli, mikä on seurausta meden syömiselle. Pesä on laukkumainen ja se riippuu puusta, pesässä on munia yleensä kolme tai enemmän.\\nMedestäjiin kuuluu 16 sukua ja 133 lajia."},{"page_url":"https://ro.wikipedia.org/wiki/Zama,_Kanagawa","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/83/Zama_residential_neighborhood.JPG","page_title":"Zama, Kanagawa","context_page_description":"Zama este un municipiu din Japonia, prefectura Kanagawa."},{"page_url":"https://de.wikipedia.org/wiki/Bra%C5%BEec_(N%C3%A1chod)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Bra%C5%BEec_n%C3%A1vesn%C3%AD_rybn%C3%ADk.jpg","page_title":"Bražec (Náchod)","context_page_description":"Bražec ist ein Ortsteil der Stadt Náchod in Tschechien. Es liegt in den Ausläufern des Adlergebirgsvorlandes."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A5%D0%B0%D0%B9%D0%BD%D1%96%D1%86%D1%8B_(%D0%B3%D0%BC%D1%96%D0%BD%D0%B0)","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/17/Chojnice_%28gmina_wiejska%29_location_map.png","page_title":"Хайніцы (гміна)","context_page_description":"Хайні́цы — вясковая гміна ў Польшчы, уваходзіць у склад Хайніцкага павета Паморскага ваяводства. Сядзіба размешчана ў Хайніцах. Плошча гміны складае 458,34 км². Станам на 2004 год у гміне Хайніцы пражывалі 16,002 чалавекі, шчыльнасць — 34,4 чал./км². Адміністрацыйна падзелена на 34 салецтвы."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%82%98%EC%B0%A8%EB%85%B8","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a0/Nazzano_01.jpg","page_title":"나차노","context_page_description":"나차노는 이탈리아 라치오주 로마현에 위치한 코무네다. 로마로부터 북쪽 40km 거리에 있다."},{"page_url":"https://fr.wikipedia.org/wiki/Mirabelle_de_Lorraine","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Blason_Praye_54.svg","page_title":"Mirabelle de Lorraine","context_page_description":"La Mirabelle de Lorraine est la dénomination géographique d'une production agricole française de mirabelle, qui bénéficie commercialement d'un Label rouge et d'une indication géographique protégée, dans le territoire de la Lorraine. Cette IGP est gérée par l'association « Mirabelles de Lorraine ». Véritable symbole régional, cette filière concentre en effet à elle seule environ 90 % de la production mondiale de mirabelles."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B8%E3%83%A7%E3%83%B3%E3%83%BB%E3%83%9B%E3%82%A4%E3%83%BC%E3%83%A9%E3%83%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Wheeler%2CJohn-Archibald_1963_Kopenhagen.jpg","page_title":"ジョン・ホイーラー","context_page_description":"ジョン・アーチボルト・ホイーラーは、アメリカ合衆国の物理学者である。"},{"page_url":"https://id.wikipedia.org/wiki/Pematang_Sahkuda,_Gunung_Malela,_Simalungun","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Nag._Pematang_Sahkuda%2C_Gunung_Malela%2C_Simalungun.jpg","page_title":"Pematang Sahkuda, Gunung Malela, Simalungun","context_page_description":"Pematang Sah Kuda merupakan salah satu kelurahan yang ada di kecamatan Gunung Malela, kabupaten Simalungun, provinsi Sumatra Utara, Indonesia."},{"page_url":"https://it.wikipedia.org/wiki/Magnesite_(minerale)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Magnesite-t06-203a.jpg","page_title":"Magnesite (minerale)","context_page_description":"La magnesite è un minerale fondamentale per il reperimento del magnesio e di tutti i suoi sali derivati, appartenente al gruppo della calcite."},{"page_url":"https://en.wikipedia.org/wiki/Lancaster,_Pennsylvania","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Lancaster_Central_Market.JPG","page_title":"Lancaster, Pennsylvania","context_page_description":"Lancaster is a city in South Central Pennsylvania, that serves as the seat of Pennsylvania's Lancaster County and is one of the oldest inland towns in the United States. With a population of 59,322, it ranks eighth in population among Pennsylvania's cities. The Lancaster metropolitan area population is 507,766, making it the 101st largest metropolitan area in the U.S. and second largest in the South Central Pennsylvania area.\\nThe city's primary industries include healthcare, tourism, public administration, manufacturing, and both professional and semi-professional services. Lancaster is best known for being the hub of Pennsylvania's Amish Country. Lancaster was home to James Buchanan, the nation's 15th president, and to congressman and abolitionist Thaddeus Stevens."},{"page_url":"https://en.wikipedia.org/wiki/Godsbanen","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Radar_%28stage%29.jpg","page_title":"Godsbanen","context_page_description":"Godsbanen is a cultural centre in central Aarhus, Denmark since 2012. The site and most of the buildings are a former goods station, known as \\"Aarhus Godsbanegård\\", which was in use from 1923 to 2000. It is located at the end of a broad sidetrack to the central railway yard of Aarhus. In December 2010, Realdania announced that the area would be gradually transformed into a modern city district, through a collaborative project with Aarhus Municipality. Apart from the new cultural centre of Godsbanen, there are plans to build several buildings and institutions along the former railway yard, including a new school of architecture."},{"page_url":"https://ms.wikipedia.org/wiki/Politeknik_Tuanku_Sultanah_Bahiyah","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/13/Pemandangan_Pusat_islam.jpg","page_title":"Politeknik Tuanku Sultanah Bahiyah","context_page_description":"Politeknik Tuanku Sultanah Bahiyah yang sebelum ini lebih dikenali sebagai Politeknik Kulim telah memulakan operasinya pada 1 Mac 2002 di kampus sementara yang berpusat di Politeknik Seberang Perai. Setelah setahun beroperasi, PTSB yang merupakan Politeknik yang ke-16 di Malaysia, akhirnya telah berpindah ke kampus tetap pada 3 Mac 2003, yang terletak di Taman Teknologi Tinggi Kulim atau lebih dikenali sebagai Kulim Hi-Tech Park. Tanggal 9 Jun 2003, PTSB beroperasi sepenuhnya dengan pengambilan pertamanya seramai 507 orang pelajar."},{"page_url":"https://en.wikipedia.org/wiki/Goliathus_goliatus","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/2013-03-09_Goliathk%C3%A4fer_Goliathus_goliatus_anagoria.jpg","page_title":"Goliathus goliatus","context_page_description":"Goliathus goliatus is a species of beetles of the family Scarabaeidae."},{"page_url":"https://it.wikipedia.org/wiki/Condensazione_di_Darzens","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Darzens_Reaction_Scheme.png","page_title":"Condensazione di Darzens","context_page_description":"La condensazione di Darzens rappresenta la reazione di un chetone con un α-alogeno estere con formazione di α, β-epossiesteri. Questi esteri, chiamati anche esteri glicidici, per idrolisi producono un epossiacido che per riscaldamento decarbossila producendo chetoni o aldeidi. La reazione è stata riportata dal chimico organico Auguste Georges Darzens nel 1904."},{"page_url":"https://it.wikipedia.org/wiki/Super_Hexagon","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Super_Hexagon_-_iPad_Hexagon_01.png","page_title":"Super Hexagon","context_page_description":"Super Hexagon è un videogioco d'azione indipendente sviluppato da Terry Cavanagh.\\nLa colonna sonora è stata creata da Niamh Houston. Originariamente distribuito per iOS nel settembre 2012, le versioni per Windows e macOS furono commercializzate tre mesi dopo su Steam, e la versione Android è stata pubblicata nel gennaio 2013, mentre le versioni BlackBerry e Linux seguirono nel febbraio 2013. Il gioco si basa su un precedente progetto di Terry Cavanagh, Hexagon, che fu creato appositamente per una game-session di dodici ore all'inizio del 2012."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%8A%D8%A7%D8%A6%D9%8A%D9%84_%D9%85%D8%A7%D8%B1%D9%83%D9%88%D9%81%D9%8A%D8%AA%D8%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Yaelmarkovichsmallheadshot.jpg","page_title":"يائيل ماركوفيتش","context_page_description":"يائيل ماركوفيتش عارضة أزياء وحاملة لقب ملكة جمال إسرائيلية أمريكية. شاركت في مسابقة ملكة جمال الدولية 2012، لكنها تتمكن من الحصول على مراكز متقدمة. ظهرت على عدد من أغلفة المجلات الإسرائيلية. آسكمان"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%BA%D1%83%D0%BB%D0%BE%D0%B2,_%D0%93%D1%80%D0%B8%D0%B3%D0%BE%D1%80%D0%B8%D0%B9_%D0%AF%D0%BA%D0%BE%D0%B2%D0%BB%D0%B5%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/%D0%9C%D1%83%D0%BD%D0%B8%D1%86%D0%B8%D0%BF%D0%B0%D0%BB%D1%8C%D0%BD%D0%BE%D0%B5_%D0%B1%D1%8E%D0%B4%D0%B6%D0%B5%D1%82%D0%BD%D0%BE%D0%B5_%D1%83%D1%87%D1%80%D0%B5%D0%B6%D0%B4%D0%B5%D0%BD%D0%B8%D0%B5_%D0%BA%D1%83%D0%BB%D1%8C%D1%82%D1%83%D1%80%D1%8B_%C2%AB%D0%93%D0%BE%D1%80%D0%BE%D0%B4%D1%81%D0%BA%D0%BE%D0%B9_%D0%B8%D1%81%D1%82%D0%BE%D1%80%D0%B8%D0%BA%D0%BE_%E2%80%93_%D0%BA%D1%80%D0%B0%D0%B5%D0%B2%D0%B5%D0%B4%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B9_%D0%BC%D1%83%D0%B7%D0%B5%D0%B9%22._%D0%B3._%D0%94%D0%BE%D0%BD%D0%B5%D1%86%D0%BA_%D0%A0%D0%BE%D1%81%D1%82%D0%BE%D0%B2%D1%81%D0%BA%D0%BE%D0%B9_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D0%B8.jpg","page_title":"Акулов, Григорий Яковлевич","context_page_description":"Григорий Яковлевич Акулов — юный разведчик, советский школьник школы № 1, которая с 2000 года носит имя юного героя Гриши Акулова."},{"page_url":"https://pt.wikipedia.org/wiki/Erzurum_(prov%C3%ADncia)","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5f/%C3%87ifte_Minareli_Medrese.JPG","page_title":"Erzurum (província)","context_page_description":"Erzurum é uma província do nordeste da Turquia, situada na região da Anatólia Oriental com 25 066 km² de superfície e 774 207 habitantes."},{"page_url":"https://en.wikipedia.org/wiki/Sergey_Shoygu","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/%D0%92%D0%B8%D0%B7%D0%B8%D1%82_%D0%9C%D0%B8%D0%BD%D0%B8%D1%81%D1%82%D1%80%D0%B0_%D0%BE%D0%B1%D0%BE%D1%80%D0%BE%D0%BD%D1%8B_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B8_%D0%B3%D0%B5%D0%BD%D0%B5%D1%80%D0%B0%D0%BB%D0%B0_%D0%B0%D1%80%D0%BC%D0%B8%D0%B8_%D0%A1%D0%B5%D1%80%D0%B3%D0%B5%D1%8F_%D0%A8%D0%BE%D0%B9%D0%B3%D1%83_%D0%B2_%D0%A2%D0%BE%D0%BA%D0%B8%D0%BE_%281%29.jpg","page_title":"Sergey Shoygu","context_page_description":"Sergey Kuzhugetovich Shoygu is a Russian politician and General of the Army who has served as Minister of Defence of the Russian Federation and as Chairman of the Council of Ministers of Defense of the CIS since 2012.\\nPreviously, Shoygu was Minister of Emergency Situations from 1991 to 2012, and briefly served as Governor of Moscow Oblast in 2012. Shoygu holds the military rank of General of the Army. Shoygu is also the President of the International Sport Federation of Firefighters and Rescuers."},{"page_url":"https://sl.wikipedia.org/wiki/Seznam_otokov_v_Sloveniji","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Lucijamarina.JPG","page_title":"Seznam otokov v Sloveniji","context_page_description":"Seznam otokov v Sloveniji vsebuje morske, jezerske in rečne otoke. Razvrščeni so po površini. Podatki o površinah so pridobljeni s pomočjo Atlasa okolja."},{"page_url":"https://de.wikipedia.org/wiki/Luitpoldh%C3%BCgel","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Luitpoldhuegel_Muenchen.jpg","page_title":"Luitpoldhügel","context_page_description":"Der Luitpoldhügel, im Volksmund auch Luitpoldberg und früher auch kleiner Schuttberg genannt, ist ein 37 Meter hoher Schuttberg im Luitpoldpark westlich des Scheidplatz im Münchner Stadtbezirk Schwabing-West."},{"page_url":"https://de.wikipedia.org/wiki/Goi%C3%A1s_EC","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Est%C3%A1dioHail%C3%A9Pinheiro.jpg","page_title":"Goiás EC","context_page_description":"Der Goiás Esporte Clube, für gewöhnlich nur kurz Goiás genannt, ist ein Sportverein aus Goiânia, der rund 1,2 Millionen Einwohner zählenden Hauptstadt des brasilianischen Bundesstaates Goiás, der im Bereich des Fußballs von nationaler Bedeutung ist. Goiás EC ist der führende Verein des Bundesstaates und wurde 1943 gegründet. Seit 1973 ist Goiás, mit insgesamt nur fünf Jahren Unterbrechung, national erstklassig. 1990 stand der Verein im Finale des Brasilianischen Pokals, der Copa do Brasil.\\nDas brasilienübliche Maskottchen ist der Periquito, eine ursprünglich in Australien beheimatete Wellensittich-Art. Gebräuchliche Spitznamen des Vereines sind Verdão und Esmeraldino."},{"page_url":"https://no.wikipedia.org/wiki/Corniche","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Corniche_Kennedy_Fausse_Monnaie.JPG","page_title":"Corniche","context_page_description":"Corniche er et opprinnelig fransk ord for en vei som løper langsmed en klippe eller fjellside, der grunnen stigger på den ene siden av veien og faller unna på den andre. Men begrepet benyttes også om veier som løper langs et hav eller et vassdrag. Etter denne beskrivelsen er Norge full av slike veier – men ordet er ikke i bruk utenom den frankofone sfære og Det nære østen.\\nOrdet kommer fra det franske route à corniche eller route en corniche. Også på engelsk er corniche og med lignende uttale."},{"page_url":"https://pl.wikipedia.org/wiki/Port_morski_Dar%C5%82owo","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Port_Dar%C5%82owo_%281%29.JPG","page_title":"Port morski Darłowo","context_page_description":"Port morski Darłowo – port morski położony na południowym wybrzeżu Morza Bałtyckiego zwanym Wybrzeżem Słowińskim. Port usytuowany w ujściu rzeki Wieprzy w Darłowie, w woj. zachodniopomorskim.\\nPort jest zarówno portem handlowym, rybackim, jak i turystycznym. Rocznie przeładowuje się tu od kilku do kilkunastu tysięcy ton ładunków głównie masowych. Darłowo od kilku już lat posiada stałe, letnie połączenie turystyczne z duńskim Bornholmem realizowane przez statki Żeglugi Gdańskiej."},{"page_url":"https://en.wikipedia.org/wiki/2018_Boston_Marathon","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Marcel_Hug_Boston_Marathon.jpg","page_title":"2018 Boston Marathon","context_page_description":"The 2018 Boston Marathon was the 122nd running of the Boston Athletic Association's Boston Marathon. It took place on Monday, April 16, 2018. Yuki Kawauchi won the men's foot race in 2:15:58 and Desiree Linden won the women's foot race in 2:39:54 The previous year's times were 2:09:37 and 2:21:52, respectively, reflecting the difficult running conditions this year. Wheelchair winners were Marcel Hug, 1:46:26, and Tatyana McFadden, 2:04:39."},{"page_url":"https://en.wikipedia.org/wiki/The_Good_Place","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/%27The_Good_Place%27_cast_and_crew_visit_San_Diego_Comic_Con_for_a_panel_%2843768257142%29.jpg","page_title":"The Good Place","context_page_description":"The Good Place is an American fantasy comedy television series created by Michael Schur. It premiered on NBC on September 19, 2016, and concluded on January 30, 2020 after four seasons and 53 episodes.\\nAlthough the story greatly evolves over the course of the series, the original premise follows Eleanor Shellstrop, a woman welcomed after her death to \\"the Good Place\\", a highly selective Heaven-like utopia designed and run by afterlife \\"architect\\" Michael as a reward for her righteous life. However, she realizes that she was sent there by mistake and must hide her morally imperfect past behavior while trying to become a better and more ethical person. William Jackson Harper, Jameela Jamil, and Manny Jacinto co-star as other residents of the Good Place, alongside D'Arcy Carden as Janet, an artificial being who assists the residents.\\nThe Good Place has received critical acclaim for its writing, acting, originality, setting, and tone. In addition, the first season's twist ending and the show's exploration and creative use of ethics and philosophy have been positively singled out."},{"page_url":"https://fi.wikipedia.org/wiki/Jatkosota","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Pariisin_rauha.png","page_title":"Jatkosota","context_page_description":"Jatkosota käytiin Suomen ja Neuvostoliiton välillä 25. kesäkuuta 1941 – 19. syyskuuta 1944. Jatkosotaa käytiin Suomen rintamalla samaan aikaan kuin Saksa toteutti operaatio Barbarossan nimellä tunnettua laajaa hyökkäystä Neuvostoliittoon. Suomen rintama oli jaettu saksalaisten ja suomalaisten joukkojen kesken siten, että suomalaiset olivat vastuussa eteläisestä rintamasta ja saksalaiset Lapin rintamasta.\\nSuomi ei ollut lain mukaan Saksan liittolainen, sillä mitään liittosopimusta ei ollut. Sen sijaan käytännössä Suomi oli Saksan liittolainen, sillä se antoi aluettaan Saksan käyttöön, alisti joukkojaan Saksalle ja sai aseapua Saksalta.\\nSodan alussa eteläisellä rintamaosalla suomalaiset joukot valtasivat talvisodassa menetetyt alueet ja etenivät yli Syvärin ja Leningradin puolustuslinjojen tuntumaan. Joulukuussa 1941 hyökkäys pysäytettiin ja alkoi yli kaksi vuotta kestänyt asemasotavaihe. Pohjoisilla rintamaosilla ei saatu katkaistua Muurmannin rataa eivätkä saksalaisjoukot kyenneet etenemään Murmanskiin.\\nNeuvostoliiton suurhyökkäys kesäkuussa 1944 mursi suomalaisten etummaiset puolustuslinjat. Raskaiden torjuntataistelujen jälkeen aseet laskettiin 4.–5. syyskuuta."},{"page_url":"https://en.wikipedia.org/wiki/Rajput","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/The_Rajpootnee_Bride.jpg","page_title":"Rajput","context_page_description":"Rajput is a large multi-component cluster of castes, kin bodies, and local groups, sharing social status and ideology of genealogical descent originating from the Indian subcontinent. The term Rajput covers various patrilineal clans historically associated with warriorhood: several clans claim Rajput status, although not all claims are universally accepted. According to modern scholars, almost all Rajputs clans originated from peasant or pastoral origin.\\nThe term \\"Rajput\\" acquired its present meaning only in the 16th century, although it is also anachronistically used to describe the earlier lineages that emerged in northern India from the sixth century onwards. In the 11th century, the term \\"rajaputra\\" appeared as a non-hereditary designation for royal officials. Gradually, the Rajputs emerged as a social class comprising people from a variety of ethnic and geographical backgrounds. During the 16th and 17th centuries, the membership of this class became largely hereditary, although new claims to Rajput status continued to be made in the later centuries. Several Rajput-ruled kingdoms played a significant role in many regions of central and northern India until the 20th century."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%95%84%EC%9C%A0%EB%A5%B4%EC%8B%9C%EB%A6%AC%EB%8B%A4%EB%A5%B4_%EB%B9%8C%EB%A0%88%EA%B7%B8%ED%8A%B8_%EC%B9%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Ayushirdari.jpg","page_title":"아유르시리다르 빌레그트 칸","context_page_description":"원 소종 아유르시리다르은 북원의 제2대 황제이며 원나라로는 12대 황제, 몽골 제국의 대칸으로는 16대 대칸이다. 휘는 보르지긴 아유르시리다르이다. 몽골식 재위명은 빌레그트 칸[必里克圖汗]이고, 시호는 무승화효황제이다."},{"page_url":"https://cs.wikipedia.org/wiki/Kaple_svat%C3%A9ho_Jakuba_apo%C5%A1tola_(C%C3%ADsa%C5%99sk%C3%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Kaple_svat%C3%A9ho_Jakuba_C%C3%ADsa%C5%99sk%C3%BD_11.jpg","page_title":"Kaple svatého Jakuba apoštola (Císařský)","context_page_description":"Kaple svatého Jakuba apoštola v Císařském je novorománská sakrální stavba stojící při hlavní silnici. Postavena byla v letech 1884–1885 a od roku 2016 prochází postupnou rekonstrukcí."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%95%88%EC%96%91%EC%B4%88%EB%93%B1%ED%95%99%EA%B5%90_(%EA%B2%BD%EA%B8%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Anyang_Elementary_School%2C_Photographed_in_the_20th_Floor_of_an_Anyang_1-dong_Seongwon_apartment.jpg","page_title":"안양초등학교 (경기)","context_page_description":"안양초등학교는 경기도 안양시 만안구 안양동에 위치한 공립 초등학교이다. 안양시에 있는 초등학교 중에 가장 역사가 긴 학교이다."},{"page_url":"https://es.wikipedia.org/wiki/Panthera_leo","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Pride_of_lions.JPG","page_title":"Panthera leo","context_page_description":"El león es un mamífero carnívoro de la familia de los félidos y una de las cinco especies del género Panthera. Los leones salvajes viven en poblaciones cada vez más dispersas y fragmentadas del África subsahariana y una pequeña zona del noroeste de India, habiendo desaparecido del resto de Asia del Sur, Asia Occidental, África del Norte y la península balcánica en tiempos históricos. Hasta finales del Pleistoceno, hace aproximadamente 10 000 años, de los grandes mamíferos terrestres, el león era el más extendido tras los humanos. Su distribución cubría la mayor parte de África, gran parte de Eurasia, desde el oeste de Europa hasta la India, y en América, desde el río Yukón hasta el sur de México.​​​\\nSi sobreviven a las dificultades de la infancia, las leonas que viven en un hábitat seguro, como por ejemplo el parque nacional Kruger, a menudo pueden llegar a la edad de 12-14 años, mientras que los leones raramente viven más de ocho años.​ Sin embargo, se conocen casos de leonas que han vivido hasta veinte años en estado salvaje. En cautiverio, tanto los machos como las hembras pueden vivir más de veinte años."},{"page_url":"https://en.wikipedia.org/wiki/Jieshi_Diao_Youlan","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Youlan.jpg","page_title":"Jieshi Diao Youlan","context_page_description":"Jieshi Diao Youlan or just \\"Solitary Orchid\\" is the name of a piece of Chinese music or melody for the guqin which was composed during the 6th or 7th century, with the earliest preserved text dating from the 7th century, and is possibly the oldest surviving piece of written music in the Far East."},{"page_url":"https://de.wikipedia.org/wiki/Runensteine_von_Gunderup","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Gunderup-stenen1.jpg","page_title":"Runensteine von Gunderup","context_page_description":"Die beiden Runensteine von Gunderup befinden sich seit 1895 im Waffenhaus der Kirche von Gunderup, südöstlich von Aalborg in Himmerland in Nordjütland in Dänemark.\\nDer Runenstein 1 aus dem 9. Jahrhundert wurde 1629 in Gunderup gefunden. Ursprünglich befand er sich auf einem Grabhügel in der Fialrø marck, nahe der Straße zwischen Fjellerad und Haals. Der Stein hat wahrscheinlich neben einem Hügel gestanden, der früh zerstört und als Kartoffelmiete verwendet wurde. Der Hügel wurde 1898 ausgegraben, ohne dass etwas anderes als zwei rechteckige Löcher mit Ziegelauskleidung zu finden waren. Die Inschrift lautet:\\nToke errichtete diese Steine und machte dieses Monument nach seinem Stiefvater Abe, einem guten Thegn und Tove, seiner Mutter. Sie liegen beide in diesem Hügel. Toke bekam Abes Nachlass.\\nDie Inschrift ist auf zwei benachbarten Seiten des Steins in Bustrophedonform angeordnet. Sie besagt, dass der Runenstein Teil eines größeren Denkmals war, möglicherweise im Stil der Glavendrupsteine, des Tryggevældesteins und des Runensteins an der Schiffssetzung von Bække. Er ist der einzige dänische Runenstein, der speziell das Erbe erwähnt."},{"page_url":"https://fr.wikipedia.org/wiki/Saint-Cyprien_(Pyr%C3%A9n%C3%A9es-Orientales)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Plage_de_Saint_Cyprien_Plage_%28Pyr%C3%A9n%C3%A9es-Orientales%29.jpg","page_title":"Saint-Cyprien (Pyrénées-Orientales)","context_page_description":"Saint-Cyprien ou Sant Cebrià, juste Sant Cebrià de Rosselló est une commune française, située dans le département des Pyrénées-Orientales en région Occitanie.\\nSaint-Cyprien est l'une des sept stations balnéaires aménagées à partir des années 1960 dans le cadre de la mission interministérielle d'aménagement touristique du littoral du Languedoc-Roussillon pilotée par Pierre Racine. Elle est le troisième port de plaisance en France."},{"page_url":"https://de.wikipedia.org/wiki/Amt_R%C3%BCdersdorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/R%C3%BCdersdorf_Urmesstischblatt_3548-1839.png","page_title":"Amt Rüdersdorf","context_page_description":"Das Amt Rüdersdorf war ein kurfürstlich-brandenburgisches, später königlich-preußisches Domänenamt mit Sitz in Rüdersdorf bei Berlin im Landkreis Märkisch-Oderland. Es wurde 1553 aus den Besitzungen des aufgehobenen Klosters Zinna im Barnim gebildet. Von 1837 bis 1857 war es mit dem Amt Alt-Landsberg vereinigt, wurde danach aber wieder selbständig. Mit der Kreisreform von 1872 wurde es aufgelöst, aber erst 1874 waren alle bisherigen Amtsgeschäfte auf andere Institutionen übertragen."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E8%8F%B1%E9%8E%82%E7%A4%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Magnesite_of_Salem.jpg","page_title":"菱鎂礦","context_page_description":"菱镁矿，主要成分为碳酸镁的矿物。菱镁矿的外观与白云石相似，难以区分，所以碳酸镁与碳酸亚铁混合的矿物被称为铁白云石。这些铁白云石具有层状结构：单层碳酸盐基团与镁单层以及碳酸二价铁单层交替。其矿物常混杂有小量含锰、钴或镍的其他矿物。\\n硬度3.5~5，产地在津巴布韦、巴西、澳大利亚、北朝鲜和中国，其中北朝鲜推估藏量为世界第一，市面上有一些菱镁矿制作的串珠项链是价廉物美的饰物。菱镁矿不易形成好的晶体，通常是以岩块状出现。菱镁矿的特性与方解石相似。菱镁矿有与方解石同样的晶体结构，因此将它归类入方解石矿物组群。但是，菱镁矿MgCO₃不与弱酸反应，而方解石CaCO₃则弱酸起反应。这是区别菱镁矿与方解石的最佳的方法。"},{"page_url":"https://ro.wikipedia.org/wiki/Carpi,_Emilia-Romagna","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Carpi_-_Modena.jpg","page_title":"Carpi, Emilia-Romagna","context_page_description":"Carpi este o comună din provincia Modena, Italia. În 2011 avea o populație de 67441 de locuitori."},{"page_url":"https://hu.wikipedia.org/wiki/M%C5%91cs%C3%A9nyi_Mih%C3%A1ly","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/M%C5%91cs%C3%A9nyi_Mih%C3%A1ly_balatongy%C3%B6r%C3%B6ki_nyaral%C3%B3ja.jpg","page_title":"Mőcsényi Mihály","context_page_description":"Mőcsényi Mihály Kossuth-, Széchenyi-díjas és Sir Geoffrey Jellicoe-díjas magyar kertészmérnök, tájépítész, egyetemi tanár, a tájrendezés magyarországi oktatásának megalapozója, az önálló Tájépítészeti Kar létrehozója. 1991 és 1993 között a Kertészeti Egyetem rektora volt.\\nSokoldalú felkészültségével, a szakágak harmóniája szorgalmazásával, anyanyelvi szintű német és felsőfokú angol nyelvtudásával vált a tájépítészet nemzetközileg elismert tudósává. A nemzetközi kertészeti kiállításokon több díjat nyert „magyar kert” interpretációival. Ő dolgozta ki többek között a budapesti Feneketlen-tó kertépítészeti tervét is. 1976–1986 között a Tájépítészek Nemzetközi Szövetsége alelnöke, majd 1986 és 1990 között elnöke, e tisztségében a világkongresszusok szervezője, vezetője, előadója volt."},{"page_url":"https://vi.wikipedia.org/wiki/%C4%90u%C3%B4i_c%E1%BB%A5t_s%E1%BB%8Dc_Java","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Pitta_guajana-20030531.jpg","page_title":"Đuôi cụt sọc Java","context_page_description":"Đuôi cụt sọc Java là một loài chim trong họ Pittidae. Loài này có ở đảo Java. Trước đây nó gộp cả đuôi cụt sọc Malaya và đuôi cụt sọc Borneo."},{"page_url":"https://de.wikipedia.org/wiki/Babenhausener_Totentanz","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Abraham_a_Sancta_Clara_-_Todtenkapelle_-_Papst_und_Tod.jpg","page_title":"Babenhausener Totentanz","context_page_description":"Der Babenhausener Totentanz ist ein Bilderzyklus in der 1722 erbauten Friedhofskapelle St. Maria in Babenhausen, im Landkreis Unterallgäu in Bayern. Er wurde um das Jahr 1722 geschaffen und besteht aus sieben Bildern an beiden Emporenbrüstungen. Der Maler des Totentanzes und der Fresken in der Kapelle ist nicht eindeutig bekannt. Eventuell wurden die Bilder von Michael Niggl aus Hiltenfingen geschaffen. Als Vorlage für den Totentanz dienten Kupferstiche aus einem Werk des römisch-katholischen Predigers Abraham a Sancta Clara, das posthum 1710 erstmals veröffentlicht wurde."},{"page_url":"https://en.wikipedia.org/wiki/%22Little%22_North_Western_Railway","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Lancaster_%26_Morecambe_Carnforth_RJD_14.jpg","page_title":"\\"Little\\" North Western Railway","context_page_description":"The North Western Railway was an early British railway company in the north-west of England. It was commonly known as the \\"Little\\" North Western Railway, to distinguish it from the larger London and North Western Railway.\\nThe NWR was first leased, and later taken over, by the Midland Railway. The MR used part of the line for its London to Scotland Settle and Carlisle main line.\\nThe NWR main line, which ran from Skipton in the West Riding of Yorkshire to Morecambe on the Lancashire coast, gave the MR access to the west coast in an area dominated by the rival LNWR.\\nPart of the line, between Lancaster and Morecambe, was used in the early twentieth century for pioneering overhead electrification.\\nTwo-thirds of the line, in North Yorkshire, is still in use today, mainly for local services. Of the dismantled Lancashire section, two-thirds has been reused as a combined cyclepath and footpath."},{"page_url":"https://de.wikipedia.org/wiki/Schloss_Hartheim","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Hartheim_1898.jpg","page_title":"Schloss Hartheim","context_page_description":"Das Schloss Hartheim bei Alkoven in Oberösterreich ist vor allem als Ort der Tötung behinderter Menschen durch die Nationalsozialisten zwischen Mai 1940 und Dezember 1944 bekannt.\\nSeit 1995 arbeitet ein Verein die Geschichte auf. Im Jahr 1997 wurde begonnen, das denkmalgeschützte historische Schloss zu restaurieren und eine Ausstellung zum Thema „Wert des Lebens“ zu gestalten. Der Spatenstich dafür erfolgte 1999. Im Jahr 2002 wurden die bei Grabungen des oberösterreichischen Landesarchivs gefundenen sterblichen Überreste der Opfer in einem vom Pregartner Künstler Herbert Friedl errichteten Grabmal beigesetzt. Am 7. Mai 2003 wurde der Lern- und Gedenkort Schloss Hartheim gemeinsam mit der Ausstellung „Wert des Lebens“ eröffnet.\\nSeither dient das Schloss als Stätte der Begegnung und als Lern- und Gedenkort unter der Betreuung und Anleitung des Vereins Schloss Hartheim.\\nDas Gebäude ist eines der bedeutendsten Renaissanceschlösser Österreichs."},{"page_url":"https://eu.wikipedia.org/wiki/Dalserf","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/82/DalserfChurch2.jpg","page_title":"Dalserf","context_page_description":"Dalserf, Eskoziako udalerri bat da, Hegoaldeko Lanarkshire konderrian."},{"page_url":"https://zh.wikipedia.org/zh-tw/DEF_CON","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Contest_area_Def_Con_24.agr.jpg","page_title":"DEF CON","context_page_description":"DEFCON 是全球最大的計算機安全會議之一，自1993年6月起，每年在美國內華達州的拉斯維加斯舉辦。 DEFCON的與會者主要有計算機安全領域的專家、記者、律師、政府雇員、安全研究員、學生和黑客等對安全領域有興趣的成員，涉及的領域主要有軟體安全、計算機架構、無線電竊聽、硬體修改和其他容易受到攻擊的信息領域。會議除了有對前沿技術的分享外，還有多種實踐項目，如Wargames，最遠距離 Wi-Fi 創建比賽，和計算機冷卻系統比賽等等。\\n此外，大會還曾舉辦過其他活動，有些活動直到今天也在舉辦，如技術開鎖比賽, Defcon機器人大賽，黑客藝術展，狂飲咖啡，尋寶遊戲或奪旗賽。 這些比賽中，最為著名的可能就是奪旗賽了。比賽中，各支由計算機黑客組成的隊伍，將使用專用軟體，並利用特殊的網絡結構，對網絡中的計算機進行攻防比賽。CTF比賽在很多其他的學術或軍事技術會議中也被引入。\\n美國聯邦執法部門如聯邦調查局，美國國防部，美國郵政檢查局等，也常會有雇員參加活動。"},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%A3%E0%B8%B2%E0%B8%8A%E0%B8%A7%E0%B8%87%E0%B8%A8%E0%B9%8C%E0%B8%AE%E0%B8%B2%E0%B8%9E%E0%B8%AA%E0%B9%8C%E0%B8%9A%E0%B8%A7%E0%B8%A3%E0%B9%8C%E0%B8%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/HRR_14Jh.jpg","page_title":"ราชวงศ์ฮาพส์บวร์ค","context_page_description":"ราชวงศ์ฮาพส์บวร์ค เป็นราชวงศ์ที่สำคัญที่สุดราชวงศ์หนึ่งในทวีปยุโรป ราชวงศ์นี้ได้ปกครองประเทศสเปนและประเทศออสเตรีย รวมเวลาทั้งหมดถึง 6 ศตวรรษ แต่ที่รู้จักกันดีมากที่สุดคือ การปกครองในตำแหน่งของ จักรพรรดิโรมันอันศักดิ์สิทธิ์ หลังจากได้มีการสถาปนาจักรวรรดิโรมันอันศักดิ์สิทธิ์ขึ้นมา พระราชวงศ์นี้ได้ปกครองรัฐและประเทศต่าง ๆ ถึง 1,800 รัฐ"},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%9D%E0%A5%82%E0%A4%B2%E0%A5%87%E0%A4%B2%E0%A4%BE%E0%A4%B2","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9f/Jhulelal_hindu_deity.jpg","page_title":"झूलेलाल","context_page_description":"झूलेलाल सिन्धी हिन्दुओं के उपास्य देव हैं जिन्हें 'इष्ट देव' कहा जाता है। उनके उपासक उन्हें वरुण का अवतार मानते हैं। वरुण देव को सागर के देवता, सत्य के रक्षक और दिव्य दृष्टि वाले देवता के रूप में सिंधी समाज भी पूजता है। उनका विश्वास है कि जल से सभी सुखों की प्राप्ति होती है और जल ही जीवन है। जल-ज्योति, वरुणावतार, झूलेलाल सिंधियों के ईष्ट देव हैं जिनके बागे दामन फैलाकर सिंधी यही मंगल कामना करते हैं कि सारे विश्व में सुख-शांति, अमन-चैन, कायम रहे और चारों दिशाओं में हरियाली और खुशहाली बने रहे।\\nभगवान झूलेलाल के अवतरण दिवस को सिंधी समाज चेटीचंड के रूप में मनाता है। कुछ विद्वानों के अनुसार सिंध का शासक मिरखशाह अपनी प्रजा पर अत्याचार करने लगा था जिसके कारण सिंधी समाज ने 40 दिनों तक कठिन जप, तप और साधना की। तब सिंधु नदी में से एक बहुत बड़े नर मत्स्य पर बैठे हुए भगवान झूलेलाल प्रकट हुए और कहा मैं 40 दिन बाद जन्म लेकर मिरखशाह के अत्याचारों से प्रजा को मुक्ति दिलाउंगा। चैत्र माह की द्वितीया को एक बालक ने जन्म लिया जिसका नाम उडेरोलाल रखा गया। अपने चमत्कारों के कारण बाद में उन्हें झूलेलाल, लालसांई, के नाम से सिंधी समाज और ख्वाजा खिज्र जिन्दह पीर के नाम से मुसलमान भी पूजने लगे। चेटीचंड के दिन श्रद्धालु बहिराणा साहिब बनाते हैं। शोभा यात्रा में ‘छेज’ के साथ झूलेलाल की महिमा के गीत गाते हैं।"},{"page_url":"https://pt.wikipedia.org/wiki/Picota_(ferramenta)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Tuhala_Witches_Well2_21-03-2013.jpg","page_title":"Picota (ferramenta)","context_page_description":"A picota é uma máquina simples que serve para retirar água de poços. Interpretando obras artísticas e utensílios domésticos de civilizações antigas supõe-se que aplicação mais antiga desse mecanismo deu-se na Antiga Índia e também na Mesopotâmia"},{"page_url":"https://it.wikipedia.org/wiki/Monastero_di_%C5%BDi%C4%8Da","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Manastir_%C5%BDi%C4%8Da%2C_Srbija%2C_045.JPG","page_title":"Monastero di Žiča","context_page_description":"Il monastero di Žiča è un complesso abaziale serbo-ortodosso, dedicato all'Ascensione di Gesù, risalente al XIII secolo, che sorge a circa 6 km dalla città di Kraljevo, in Serbia."},{"page_url":"https://es.wikipedia.org/wiki/Nitrito_de_sodio","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Natriumnitrit_Elementarzelle.png","page_title":"Nitrito de sodio","context_page_description":"El nitrito de sodio es una sal sódica de la familia de los nitritos de fórmula: NaNO₂. Uno de los usos más comunes es en la industria alimentaria, concretamente en la cárnica en la que se emplea como conservante y fijador de color de carnes y sus derivados donde aparece etiquetado con el código E 250. Su empleo como aditivo alimentario se regula debido a la capacidad que posee de generar nitrosaminas en los alimentos, un agente cancerígeno.​"},{"page_url":"https://en.wikipedia.org/wiki/14th_Regiment_Armory","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Park_Slope_armory_SW_jeh.jpg","page_title":"14th Regiment Armory","context_page_description":"The 14th Regiment Armory, also known as the Eighth Avenue Armory and the Park Slope Armory, is a historic National Guard armory building located on Eighth Avenue between 14th and 15th Streets in the South Slope neighborhood of Brooklyn, New York City, United States. The building is a brick and stone castle-like structure, and designed to be reminiscent of medieval military structures in Europe. It was built in 1891–95 and was designed in the Late Victorian style by William A. Mundell.\\nThe structure was originally built for the 14th Regiment of the New York State Militia. Since the 1980s, it has been in use as a women's homeless shelter. A veterans' museum and a YMCA sports facility are also located in the armory.\\nThe armory was listed on the National Register of Historic Places in 1994, and was designated a New York City landmark in 1998."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%9C%AC%E7%94%B0%E6%8A%80%E7%A0%94%E5%B7%A5%E6%A5%AD%E3%81%AE%E8%A3%BD%E5%93%81%E4%B8%80%E8%A6%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Honda_ACCORD_EX_%286AA-CV3%29_front.jpg","page_title":"本田技研工業の製品一覧","context_page_description":"この記事では、本田技研工業が自社製品として現在販売中あるいは過去に販売していたことがある製品、発表済みの試作品や未販売製品およびコンセプトモデルの一覧を示す。"},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A2%D9%86%D8%AA%DB%8C%D9%84%D8%A7_(%DA%A9%D9%88%D8%A8%D8%A7)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Antilla_%28Cuban_municipal_map%29.png","page_title":"آنتیلا (کوبا)","context_page_description":"آنتیلا یک منطقهٔ مسکونی در کوبا است که در استان اولگین واقع شده‌است. آنتیلا ۱۰۱ کیلومتر مربع مساحت و ۱۲٬۵۴۲ نفر جمعیت دارد و ۵ متر بالاتر از سطح دریا واقع شده‌است."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%85%83%E5%AE%B5%E8%8A%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Korea-Daeboreumnal-Full_Moon_Festival-18.jpg","page_title":"元宵节","context_page_description":"元宵節，亦稱為上元節、元夜、元夕、小正月、小年或春燈節，日本稱上元、小正月，朝鮮稱正月大滿月、正月大보름、上元、元宵、元夕、烏忌日，時間是每年的農曆正月十五。\\n元宵節是農曆新年的第一個月圓之夜，是祭月、賞月的日子，也象徵著春天的到來，這是傳統新春定義的最後一天。在中國，元宵節的傳統習俗包括「猜燈謎」，人們會把一些腦筋急轉彎之類的問題寫到紙上，然後用細線把每個問題掛在房頂上，之後讓人們來猜謎。\\n佛教有在正月十五點燈供佛的習俗。而道教中，上元節視為天官大帝誕辰，正月十五為上元，七月十五為中元，十月十五為下元，分別屬天、地、水這三官大帝主管。上元節乃天官華誕，故燃燈以慶。終唐一代，朝廷皆正式祭拜。"},{"page_url":"https://pl.wikipedia.org/wiki/Hiena_jaskiniowa","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Heinrichsh%C3%B6hle_7.jpg","page_title":"Hiena jaskiniowa","context_page_description":"Hiena jaskiniowa – podgatunek temporalny krokuty cętkowanej. Występował od Półwyspu Iberyjskiego do wschodniej Syberii. Należy do najlepiej poznanych zwierząt epoki lodowcowej. Jego pozostałości znaleziono w wielu europejskich jaskiniach. Hiena jaskiniowa była wysoce wyspecjalizowana, z cechami progresywnymi i regresywnymi rozwiniętymi bardziej niż jej współczesna afrykańska krewna. Polowała na megafaunę, czego skutkiem jest akumulacja setek kości wielkich ssaków plejstocenu na obszarach takich jak poziome jaskinie, leje krasowe, doły z błotem i bagniste obszary wzdłuż rzek.\\nPrzyczyna wyginięcia hieny jaskiniowej nie została w pełni zrozumiana. Mogła ją spowodować kombinacja czynników, włączając w to zmiany klimatyczne i konkurencję ze strony innych drapieżników."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%A9%D9%88%D8%B4%E2%80%8C%D8%A2%D8%AF%D8%A7%D8%B3%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Ku%C5%9Fadas%C4%B1_genel.JPG","page_title":"کوش‌آداسی","context_page_description":"کوش‌آداسی یا قوش‌‌آداسی در ۷۱ کیلومتری شهرستان مرکزی استان آیدین و در نوار ساحلی منطقه اژه واقع شده‌است و بر اساس سرشماری سال ۲۰۰۸ میلادی ۵۸٬۶۵۰ نفر و بر اساس برآوردهای سال ۲۰۱۲ میلادی ۷۰٬۱۴۳ نفر جمعیت دارد.\\nاین شهرستان که از شمال با سلجوق و پاموجاک و از جنوب با شبه جزیره دیلک همسایه است در کانون مراکز مهم گردشگری از جمله ازمیر، افسوس، مریم آنا، میلت، دیدیم، پاموک کاله، مارماریس و بودروم قرار دارد. بندر کوش آداسی به علت نزدیکی با جزیره یونانی ساموس برای گردشگران که به ترکیه مسافرت می‌کنند، از جذابیت خاصی برخوردار است. از بندر کوش آداسی در ماه‌های بهار و تابستان سفرهای منظم با قایق‌های موتوری به جزیره یونانی ساموس برگزار می‌شود. قایق‌های تفریحی مدرن که تورهای آبی را برگزار می‌کنند زیبایی خاصی به این بندر بخشیده‌اند. بندر کوش آداسی یکی از بنادر مهم منطقه می‌باشد."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%A1%AB%E6%B0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Thiocyanogen-2D.png","page_title":"硫氰","context_page_description":"硫氰化学式为(SCN)₂，是一种黄色液体，在常温下可以分解，是一种拟卤素。\\n硫氰的空间对称群为C₂，其结构可表示为NCS-SCN。硫氰的氧化能力比溴要大，硫氰会和水反应；\\n(SCN)₂ + H₂O → HSCN + HSCNO\\n硫氰最早是由硫氰酸银与碘在乙醚中制得，但由于碘的弱氧化力，此反应最后会达到平衡，产率不佳。硫氰也可以由硫氰酸铅和Br₂反应产生，而硫氰酸铅可以由硝酸铅和硫氰酸钠混合而成。可以用无水的硫氰酸铅和溴在冰醋酸中反应。另一种方法是将溶于二氯甲烷中的溴滴入悬浮在0℃二氯甲烷的硫氰酸铅中，之后再用氩气保护，会生成硫氰的溶液，但制备的硫氰需立刻使用。\\nPb(SCN)₂ + Br₂ → (SCN)₂ + PbBr₂\\n硫氰会和烯类产生加成反应，生成有1,2-二结构的化合物。硫氰也会和二茂钛杂环戊二烯反应，最后生成1,2-二噻烯。硒氰化学式为(SeCN)₂，可以由硒氰酸银和碘在0度的四氢呋喃中反应制得，其反应和硫氰类似。另外，硫氰能与硝酸反应，产生氢氰酸，一氧化氮，硫酸等；或被彻底氧化成CO₂, NO₂, SO₃等气体。"},{"page_url":"https://id.wikipedia.org/wiki/Aksara_Bali","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Bali_Nga.png","page_title":"Aksara Bali","context_page_description":"Aksara Bali, juga dikenal sebagai Hanacaraka, adalah salah satu aksara tradisional Indonesia yang berkembang di Pulau Bali. Aksara ini terutama digunakan untuk menulis bahasa bahasa Bali, Sanskerta, dan Kawi, namun dalam perkembangannya juga digunakan untuk menulis beberapa bahasa daerah lainnya seperti bahasa Sasak dan Melayu dengan tambahan dan modifikasi. Aksara Bali merupakan turunan dari aksara Brahmi India melalui perantara aksara Kawi dan berkerabat dekat dengan aksara Jawa. Aksara Bali aktif digunakan dalam sastra maupun tulisan sehari-hari masyarakat Bali sejak pertengahan abad ke-15 hingga kini dan masih diajarkan di Bali sebagai bagian dari muatan lokal, meski penerapannya dalam kehidupan sehari-hari telah berkurang.\\nAksara Bali adalah sistem tulisan abugida yang terdiri dari sekitar 18 hingga 33 aksara dasar, tergantung dari penggunaan bahasa yang bersangkutan. Seperti aksara Brahmi lainnya, setiap konsonan merepresentasikan satu suku kata dengan vokal inheren /a/ yang dapat diubah dengan pemberian diakritik tertentu. Arah penulisan aksara Bali adalah kiri ke kanan. Secara tradisional aksara ini ditulis tanpa spasi antarkata dengan sejumlah tanda baca."},{"page_url":"https://en.wikipedia.org/wiki/Objections_to_evolution","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Haeckel-embryos-weeks4-6.jpg","page_title":"Objections to evolution","context_page_description":"Objections to evolution have been raised since evolutionary ideas came to prominence in the 19th century. When Charles Darwin published his 1859 book On the Origin of Species, his theory of evolution initially met opposition from scientists with different theories, but eventually came to receive overwhelming acceptance in the scientific community. The observation of evolutionary processes occurring has been uncontroversial among mainstream biologists since the 1940s.\\nSince then, most criticisms and denials of evolution have come from religious groups, rather than from the scientific community. Although many religious groups have found reconciliation of their beliefs with evolution, such as through theistic evolution, other religious groups continue to reject evolutionary explanations in favor of creationism, the belief that the universe and life were created by supernatural forces. The U.S.-centered creation–evolution controversy has become a focal point of perceived conflict between religion and science."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D1%83%D1%80%D0%BA%D1%83%D0%B0_%D0%9F%D0%B0%3F_(%D0%B1%D0%B0%D1%80%D0%BA)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Le_pourquoi-pas_dans_l%27Antarctique_%28Page_43%29_BHL46836179.jpg","page_title":"Пуркуа Па? (барк)","context_page_description":"«Пуркуа́ Па?» — трёмачтовый барк, построенный в 1908 году во Франции для океанографа Жана-Батиста Шарко, который с 1908 по 1910 год совершил на нём свою вторую антарктическую экспедицию. Корабль потерпел крушение 16 сентября 1936 года у побережья Исландии. Из сорока человек на борту выжил только один."},{"page_url":"https://en.wikipedia.org/wiki/Pleasant_Hill_Church_(Clinton,_Indiana)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Pleasant_Hill_Church_near_Logansport.jpg","page_title":"Pleasant Hill Church (Clinton, Indiana)","context_page_description":"Pleasant Hill Church, also known as Keeps Creek Church, is a historic one-room country church located at the junction of County Roads 400S and 675W, in Clinton Township, Cass County, Indiana. It was built in 1875, and is a red brick building, with Italianate style design elements. It has a front gable roof and white clapboard belfry. It measures 50 feet by 33 feet. It was originally used as a meeting place for three different denominations.\\nIt was listed on the National Register of Historic Places in 1995."},{"page_url":"https://nl.wikipedia.org/wiki/Wildenhain_(Mockrehna)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/WildenhainKirche2.JPG","page_title":"Wildenhain (Mockrehna)","context_page_description":"Wildenhain is een plaats in de gemeente Mockrehna, Saksen. Tot 1999 was Wildenhain een zelfstandige gemeente. De eerste vermelding van de plaats dateert van 1314."},{"page_url":"https://hu.wikipedia.org/wiki/Brassai_S%C3%A1muel","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Brassai_szulohaz.JPG","page_title":"Brassai Sámuel","context_page_description":"Brassai Sámuel nyelvész, filozófus, természettudós, az „utolsó erdélyi polihisztor”, az MTA tagja. Foglalkozott földrajzzal, történelemmel, statisztikával és közgazdaságtannal, a zene elméleti kérdéseivel, esztétikával, valamint műkritikával is. Az oktatásügyben számos reform elindítója és előmozdítója volt; hozzájárult a korabeli tudományos eredmények népszerűsítéséhez.\\nÚgy ismert mint aki tíz nyelvet ismert, tíz tudományágat művelt és 10x10, vagyis száz évig élt."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%8D%9A%E9%98%BF%E7%B6%AD%E6%96%AF%E5%A1%94%E5%B3%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Bela-vista-net-Boa_Vista-map.jpg","page_title":"博阿維斯塔島","context_page_description":"博阿維斯塔島是維德角最東端的島嶼，位於非洲大陸以西455公里，屬於向風群島的一部分，面積620平方公里，是該國第三大島嶼，島上最高點387米，2005年人口3,353，居民主要從事捕魚業和農業。"},{"page_url":"https://en.wikipedia.org/wiki/Sailing","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Symmetrical_spinnaker_with_following_apparent_wind.jpg","page_title":"Sailing","context_page_description":"Sailing\\nemploys the wind—acting on sails, wingsails or kites—to propel a craft on the surface of the water, on ice or on land over a chosen course, which is often part of a larger plan of navigation.\\nA course defined with respect to the true wind direction is called a point of sail.\\nConventional sailing craft cannot derive power from sails on a point of sail that is too close into the wind. On a given point of sail, the sailor adjusts the alignment of each sail with respect to the apparent wind direction to mobilize the power of the wind. The forces transmitted via the sails are resisted by forces from the hull, keel, and rudder of a sailing craft, by forces from skate runners of an iceboat, or by forces from wheels of a land sailing craft to allow steering the course.\\nIn the 21st century, most sailing represents a form of recreation or sport. Recreational sailing or yachting can be divided into racing and cruising. Cruising can include extended offshore and ocean-crossing trips, coastal sailing within sight of land, and daysailing.\\nUntil the mid of the 19th century, sailing ships were the primary means for marine commerce; this period is known as the Age of Sail."},{"page_url":"https://de.wikipedia.org/wiki/Premierminister_(Kanada)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Prime_Ministers_of_Canada_to_1963.jpg","page_title":"Premierminister (Kanada)","context_page_description":"Der Premierminister von Kanada ist der führende Minister der Krone, Vorsitzender des Kabinetts und somit Regierungschef Kanadas. Das Amt ist in keinem der Dokumente festgelegt, aus denen sich der geschriebene Teil der kanadischen Verfassung zusammensetzt. Formal liegt die Exekutivgewalt beim kanadischen Monarchen, der durch den Generalgouverneur vertreten wird. Vielmehr ist das Amt des Premierministers Teil des Gewohnheitsrechts.\\nFast immer ist der Premierminister der Vorsitzende jener politischen Partei, die im Unterhaus die meisten Sitze hält. Er erhält bei Amtsantritt den Prädikatstitel The Right Honourable und behält diesen ein Leben lang. Aktueller Amtsinhaber ist Justin Trudeau von der Liberalen Partei, der am 4. November 2015 durch Generalgouverneur David Johnston zum 23. Premierminister ernannt wurde."},{"page_url":"https://es.wikipedia.org/wiki/Figuras_de_Chladni","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Chladni_plate_08.jpg","page_title":"Figuras de Chladni","context_page_description":"Se denominan figuras de Chladni a los patrones formados por una sustancia granulada sobre una superficie plana vibrando en un modo propio.\\nAl propagarse ondas mecánicas por un objeto extendido, lo hacen en todas direcciones. Dependiendo de las longitudes características del cuerpo, las condiciones de contorno que este impone a las ondas pueden inducir la resonancia de alguno de los componentes en frecuencia de la perturbación incidente.\\nEn el caso de un objeto con geometría tipo membrana, como una tapa de guitarra, las oscilaciones resonantes se manifiestan en la dirección normal al plano del cuerpo. Al tratarse de ondas estacionarias, para cada modo característico, quedan determinadas en la superficie zonas ventrales donde la amplitud de vibración es máxima y nodales donde la amplitud es mínima. Así, si se distribuye una sustancia granular sobre el objeto, esta tenderá a acumularse en los nodos formando lo que se conoce como figuras o patrones de Chladni en honor al físico alemán Ernst Chladni."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AC%D9%8A%D8%B4_%D9%83%D9%88%D9%85%D9%88%D8%B4_%D8%A7%D9%84%D8%B4%D8%B9%D8%A8%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Anticommunist_Logo.png","page_title":"جيش كوموش الشعبي","context_page_description":"جيش كوموش الشعبي ‏، هو جيش قاتل ضد البلاشفة أثناء الحرب الأهلية الروسية؛ في الفترة من يونيو إلي سبتمبر 1918 في منطقة الفولغا."},{"page_url":"https://de.wikipedia.org/wiki/Reuschenberg_(Neuss)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Lage_Neuss-Reuschenberg.png","page_title":"Reuschenberg (Neuss)","context_page_description":"Reuschenberg ist ein Stadtteil von Neuss. Die Einwohnerzahl beträgt 7.372 auf einer Fläche von 3,22 km²."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%9F%D0%BB%D0%B0%D1%81%D1%81%D0%B0%D0%BA-%D0%A0%D1%83%D1%84%D1%8C%D1%8F%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Plassac-Rouffiac_%C3%A9glise_2012.jpg","page_title":"Плассак-Руфьяк","context_page_description":"Плассак-Руфьяк — Францин гӀала-коммуна, лаьтта Керла Аквитани регионехь. Коммунан департамент — Шаранта. Кхузахь климат барамехь ю, аьхка йовха хуьлу, ткъа Ӏа барамехь-шийла хуьлу. ГӀалин бахархой французаш бу. Официалан Французийн мотт бу."},{"page_url":"https://es.wikipedia.org/wiki/Ros%C3%A9ola","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Hhv-6_%281%29.jpg","page_title":"Roséola","context_page_description":"La roséola, también llamada roseola o exantema súbito, ​ es una enfermedad de los niños, especialmente de los menores de dos años, ​ cuyas manifestaciones exteriores se suelen limitar a una erupción transitoria o exantema, que se produce luego de fiebre durante tres días.\\nHasta hace poco, su origen era desconocido, pero ahora se sabe que es causada por dos herpesvirus de los humanos, HHV-6 y HHV-7, los cuales se conocen como virus de la roséola. Hay dos variantes del HHV-6, y los estudios en Estados Unidos, Europa y Japón han demostrado que el exantema súbito es causado principalmente por el HHV-6B, que infecta a más del 90 por ciento de los bebés de 2 años o menos. La investigación indica que la mayoría de los bebés con infección congénita por el virus HHV-6A heredó el virus en un cromosoma.​"},{"page_url":"https://nl.wikipedia.org/wiki/Biografielijst_Ce","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c1/Anders-Celsius.jpeg","page_title":"Biografielijst Ce","context_page_description":null},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9B%D0%BE%D0%B7%D0%BD%D0%B8%D1%86%D0%B0_(%D0%92%D0%B0%D1%99%D0%B5%D0%B2%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Selo_Valjevska_Loznica_-_op%C5%A1tina_Valjevo_-_zapadna_Srbija_-_panorama_3.jpg","page_title":"Лозница (Ваљево)","context_page_description":"Лозница је насељено место града Ваљева у Колубарском округу. Према попису из 2011. било је 516 становника.\\nОвде се налази ОШ „Стеван Филиповић” ИО Ваљевска Лозница."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%81%E0%B8%B2%E0%B8%A3%E0%B8%8A%E0%B8%B3%E0%B8%A3%E0%B8%B0%E0%B9%80%E0%B8%A5%E0%B8%B7%E0%B8%AD%E0%B8%94%E0%B8%9C%E0%B9%88%E0%B8%B2%E0%B8%99%E0%B9%80%E0%B8%A2%E0%B8%B7%E0%B9%88%E0%B8%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Blausen_0050_ArteriovenousGraft.png","page_title":"การชำระเลือดผ่านเยื่อ","context_page_description":"การชำระเลือดผ่านเยื่อ หรือที่นิยมเรียกว่าการฟอกเลือดหรือการฟอกไต เป็นวิธีการทางการแพทย์ที่กระทำภายนอกร่างกายในการกำจัดของเสียส่วนเกิน เช่น สารในกลุ่มครีเอทีนีนและยูเรียและน้ำออกจากเลือดในผู้ป่วยโรคไตวายซึ่งไตไม่สามารถทำงานได้เป็นปกติ ถือเป็นวิธีการรักษาทดแทนไตชนิดหนึ่ง นอกเหนือจากการปลูกถ่ายไตและการชำระเลือดผ่านเยื่อบุช่องท้อง อีกทางเลือกหนึ่งสำหรับแยกส่วนประกอบของเลือดเช่นพลาสม่าหรือเซลล์คือ apheresis\\nการฟอกเลือดสามารถเป็นการบำบัดสำหรับผู้ป่วยนอกหรือผู้ป่วยใน การฟอกเลือดเป็นประจำจะดำเนินการในศูนย์ฟอกไตผู้ป่วยนอกที่เป็นห้องในโรงพยาบาลที่สร้างโดยเฉพาะหรือห้องที่ทำขึ้นเฉพาะในคลินิกที่อยู่ลำพัง การฟอกเลือดที่ทำที่บ้านมีน้อย การฟอกเลือดในคลินิกจะดำเนินการและบริหารจัดการโดยทีมงานพิเศษจากพยาบาลและช่างเทคนิค; การฟอกเลือดที่บ้านสามารถดำเนินการได้เองและบริหารจัดการร่วมกันด้วยความช่วยเหลือของผู้ช่วยที่ผ่านการฝึกอบรมที่มักจะเป็นสมาชิกในครอบครัว"},{"page_url":"https://sv.wikipedia.org/wiki/Bergtandg%C3%A4rdsmyg","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Grey-mantled_Wren.jpg","page_title":"Bergtandgärdsmyg","context_page_description":"Bergtandgärdsmyg är en fågel i familjen gärdsmygar inom ordningen tättingar."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9A%D0%B0%D1%81%D1%82%D0%B5%D0%BB_%D0%93%D0%BE%D1%84%D1%80%D0%B5%D0%B4%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Map_of_comune_of_Castel_Goffredo_%28province_of_Mantua%2C_region_Lombardy%2C_Italy%29.svg","page_title":"Кастел Гофредо","context_page_description":"Кастѐл Гофрѐдо е град и община в Северна Италия, провинция Мантуа, регион Ломбардия. Разположен е на 53 m надморска височина. Населението на общината е 12 506 души."},{"page_url":"https://da.wikipedia.org/wiki/Pete_Doherty","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/PeteDoherty-Madrid2008.jpg","page_title":"Pete Doherty","context_page_description":"Peter Doherty er en engelsk rockmusiker, sangskriver og poet. Han er stifter og forsanger af bandet The Libertines ogforsanger i det engelske band Babyshambles. Doherty voksede op i Hexham i England. Han klarede sig godt i skolen og kom ind på Oxford University og University College London, valgte det sidste, men droppede ud første år. Han flyttede ind i en lejlighed i London med sin gode ven Carl Barât. I 1997 blev Pete spottet af en MTV journalist i en kø til Oasis' nye album Be Here Now. Han blev spurgt hvad han synes om Oasis og svarer, at Noel er en poet, og at Liam er en klokkemand. På det tidspunkt var han ukendt og 18 år. Klippet blev uploadet på YouTube og er set over én million gange.\\nPete Doherty dannede i slutningen af 90'erne bandet The Libertines med Carl Barat og to andre. Bandet fik stor succes og helt utrolige anmeldelser for deres andet og sidste album The Libertines'.\\nDoherty havde i mellemtiden efter en svær skilsmisse udviklet et massivt stofmisbrug af bl.a. heroin og kokain, fik mange skandalesager på halsen, endte i fængsel et par gange og fik bøder."},{"page_url":"https://de.wikipedia.org/wiki/Perspektive","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/EquitableTrustBuildingBiltmoreNYC1921.jpg","page_title":"Perspektive","context_page_description":"Perspektive bezeichnet die räumlichen, insbesondere linearen Verhältnisse von Objekten im Raum: das Abstandsverhältnis von Objekten im Raum in Bezug auf den Standort des Betrachters. Damit ist die Perspektive stets an den Ort des Betrachters gebunden und kann nur durch Veränderung der Orte der Objekte und des Betrachters im Raum verändert werden.\\nDiese Feststellung ist dahingehend wichtig, dass eine andere Perspektive nicht durch bloße Veränderung des Betrachtungsausschnitts ohne Ortswechsel herbeigeführt werden kann.\\nDie perspektivische Darstellung fasst die Möglichkeiten zusammen, dreidimensionale Objekte auf einer zweidimensionalen Fläche so abzubilden, dass dennoch ein räumlicher Eindruck entsteht."},{"page_url":"https://de.wikipedia.org/wiki/Kuhstall_(S%C3%A4chsische_Schweiz)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Aussichtsplattform_Kuhstall_in_der_S%C3%A4chsischen_Schweiz.jpg","page_title":"Kuhstall (Sächsische Schweiz)","context_page_description":"Der Kuhstall ist das nach dem Prebischtor zweitgrößte Felsentor im Elbsandsteingebirge. Es befindet sich auf dem Neuen Wildenstein, einem 337 m hohen, im 15. Jahrhundert von der Burg Wildenstein beherrschten Felsen der Hinteren Sächsischen Schweiz. Der Kuhstall liegt südlich des Lichtenhainer Wasserfalls und oberhalb des Kirnitzschtales bei Lichtenhain, gehört aber zur Gemarkung Ostrau und somit zu Bad Schandau."},{"page_url":"https://fr.wikipedia.org/wiki/Bellville_(Texas)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Bellville_TX_Holland_St.JPG","page_title":"Bellville (Texas)","context_page_description":"La ville de Bellville est le siège du comté d’Austin, dans l’État du Texas, aux États-Unis. Le recensement de 2010 a indiqué une population de 4 097 habitants."},{"page_url":"https://pl.wikipedia.org/wiki/Odrow%C4%85%C5%BC_(herb_szlachecki)","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6f/Herb_odrow%C4%85%C5%BC_na_portalu_ko%C5%9Bcio%C5%82a_%C5%9BwBart%C5%82omieja_w_Krakowie.jpg","page_title":"Odrowąż (herb szlachecki)","context_page_description":"Odrowąż – herb szlachecki pochodzący prawdopodobnie z Moraw."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D1%82%D0%B5%D1%80%D0%B8%D0%B4%D0%B8%D0%BD%D0%B8%D1%83%D0%BC","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/54/Pteridinium.JPG","page_title":"Птеридиниум","context_page_description":"Птеридиниум, или онегия — один из представителей эдиакарской фауны. Отпечатки птеридиниума находят в отложениях эдиакария по всему миру."},{"page_url":"https://fr.wikipedia.org/wiki/Oignies_(Pas-de-Calais)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Ecole_Pantigny.jpg","page_title":"Oignies (Pas-de-Calais)","context_page_description":"Oignies est une commune française située dans le département du Pas-de-Calais en région Hauts-de-France. Elle fait partie de la communauté d'agglomération d'Hénin-Carvin qui regroupe 14 communes, soit 125 000 habitants. Elle fait également partie du Canton d'Hénin-Beaumont-1 et de la quatorzième circonscription du Pas-de-Calais. La dernière gaillette de charbon du bassin minier du Nord-Pas-de-Calais remonte par la fosse 9 - 9 bis le 21 décembre 1990."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E5%BB%BA%E7%AF%89%E5%AD%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/De_architectura.jpg","page_title":"建築學","context_page_description":"建築學，廣東話日常用語有陣時會嗌做「aak¹ ki²」，係一門研究建築物要點設計嘅學問，內容包含咗起建築物嘅過程當中嘅規劃同埋施工等嘅工作，再廣義少少仲可以包埋宏觀啲嘅城市規劃（諗一個城市入面啲建築物要點樣互相配合等等）以至微觀啲嘅室內設計（諗吓啲柱要點安排先至方便間屋嘅主人擺傢俬等等）。\\n作為專用詞嘅「建築學」所研究嘅對象唔淨衹係建築物本身，而仲會著重探討人類對建築物嘅要求同埋一棟建築物要點先至滿足到人類嘅需求－建築學嘅專家會運用柱同牆等嘅基本元素砌想要起嘅建築物出嚟，途中會考慮棟建築物企唔企到喺度、能唔能夠做到人類想佢做嘅功能、仲會諗埋棟嘢有冇美感等多方面嘅問題。因為呢啲多方面嘅考量，建築學上嘅重大作品好多時唔淨衹有實用價值，仲會俾起佢哋嘅族群覺得係佢哋文化嘅象徵。例如係廣州西關嘅陳氏書院噉，啲人喺討論粵文化同粵式建築嗰陣成日都會提起佢。\\n建築學某程度上係一門跨學科領域：要做建築師（粵文又有叫「則師」）要識數學、物理、工程、藝術、以至社會科學等各方面嘅嘢。公元前 1 世紀嘅古羅馬工程師維特魯威（Vitruvius）就講，話建築學係由好多領域嗰度融合誕生出嚟嘅。佢仲主張話建築師應該要識音樂、哲學、同天文學方面嘅知識，而事實係，歷史上好多建築師喺起佢哋嘅大作嗰陣都會參考當代嘅哲學同天文知識。"},{"page_url":"https://en.wikipedia.org/wiki/De_Dannan","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Frankie_Gavin_and_the_new_DeDannan_325-0170-hinnerk-ruemenapf.jpg","page_title":"De Dannan","context_page_description":"De Dannan is an Irish folk music group. It was formed by Frankie Gavin, Alec Finn, Johnny \\"Ringo\\" McDonagh and Charlie Piggott as a result of sessions in Hughes's Pub in An Spidéal, County Galway, with Dolores Keane subsequently being invited to join the band. The fiddler Mickey Finn is also acknowledged to have been a founder member.\\nThe band was named after the legendary Irish tribe Tuatha Dé Danann. In 1985 the spelling of the name was changed from \\"Dé Danann\\" to \\"De Dannan\\" for reasons that have never been made clear. Since 2010, however, Finn and McDonagh have recorded and performed with a line-up named \\"De Danann\\", and, since 2012, Gavin has recorded and performed with another line-up named \\"De Dannan\\"."},{"page_url":"https://pl.wikipedia.org/wiki/Zabytki_w_E%C5%82ku","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/E%C5%82k_Ko%C5%9Bci%C3%B3%C5%82_NSPJ_009.jpg","page_title":"Zabytki w Ełku","context_page_description":"Wykaz zabytków miasta Ełku:"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%91%E3%82%AD%E3%82%B9%E3%82%BF%E3%83%B3%E7%B7%8F%E7%9D%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Jinnah_crop.jpg","page_title":"パキスタン総督","context_page_description":"パキスタン総督 は、イギリス領インド帝国が独立し英連邦王国自治領となった1947年8月15日以降の、パキスタンにおけるイギリス国王の代官。1956年3月23日の共和制移行に伴い、総督職は廃止された。"},{"page_url":"https://en.wikipedia.org/wiki/Belmont,_California","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Belmont_1937.jpg","page_title":"Belmont, California","context_page_description":"Belmont is a city in San Mateo County in the U.S. state of California. It is in the San Francisco Bay Area, on the San Francisco Peninsula halfway between San Francisco and San Jose. It was originally part of Rancho de las Pulgas, for which one of its main roads, the Alameda de las Pulgas, is named. The city was incorporated in 1926. Its population was 25,835 at the 2010 census.\\nRalston Hall is a historic landmark built by Bank of California founder William Chapman Ralston on the campus of Notre Dame de Namur University, and is also home to Notre Dame High School. It was built around a villa formerly owned by Count Cipriani, an Italian aristocrat. The locally famous \\"Waterdog Lake\\" is also located in the foothills and highlands of Belmont.\\nOne of two surviving structures from the Panama-Pacific International Exposition is on Belmont Avenue. The building was brought to Belmont by E.D. Swift shortly after the exposition closed in 1915. Swift owned a large amount of land in the area."},{"page_url":"https://it.wikipedia.org/wiki/San_Sisto_al_Pino","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/CascinaSanSistoalPinoPanorama2.jpg","page_title":"San Sisto al Pino","context_page_description":"San Sisto al Pino è una frazione del comune italiano di Cascina, nella provincia di Pisa, in Toscana."},{"page_url":"https://fr.wikipedia.org/wiki/Marie_Ire_(reine_d%27Angleterre)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Mary_Tudor_by_Horenbout.jpg","page_title":"Marie Ire (reine d'Angleterre)","context_page_description":"Marie Iʳᵉ, également connue sous le nom de Marie Tudor, née le 18 février 1516 et morte le 17 novembre 1558, est la première reine régnante d'Angleterre et d'Irlande, de 1553 à sa mort, et, par son mari Philippe II, reine d'Espagne, de Sicile et de Naples, duchesse de Bourgogne, de Milan, de Brabant, de Luxembourg et de Limbourg, comtesse de Flandre, de Hainaut et comtesse palatine de Bourgogne.\\nIssue du mariage malheureux du roi Henri VIII d'Angleterre et de Catherine d'Aragon, Marie fut écartée de la succession au trône, en 1534, par la 1ʳᵉ loi de succession au trône, après le remariage de son père avec Anne Boleyn. Elle ne redevint éligible à la succession au trône, après son demi-frère Édouard mais avant sa demi-sœur Élisabeth, qu'en 1543, avec la 3ᵉ loi de succession au trône.\\nComme Marie était catholique, Édouard VI d'Angleterre, devenu roi en 1547, tenta de l'évincer de sa succession et, à sa mort en 1553, sa parente Jeanne Grey fut proclamée reine. Marie rassembla une armée en Est-Anglie et déposa Jeanne qui fut décapitée. Elle devint ainsi la première femme de l’histoire à être couronnée reine d’Angleterre et à diriger le pays en son propre nom."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%9C%E1%83%98%E1%83%99%E1%83%9D%E1%83%9A_%E1%83%A4%E1%83%90%E1%83%A8%E1%83%98%E1%83%9C%E1%83%98%E1%83%90%E1%83%9C%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Nikol_Pashinyan_signature.png","page_title":"ნიკოლ ფაშინიანი","context_page_description":"ნიკოლ ფაშინიანი — სომეხი პოლიტიკოსი, ჟურნალისტი და პუბლიცისტი, სომხეთის ეროვნული კრების დეპუტატი 2012-2018 წლებში. სომხეთის პრემიერ-მინისტრი 2018 წლის 8 მაისიდან."},{"page_url":"https://en.wikipedia.org/wiki/Gardens_by_the_Bay","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/SkylinefromGardensbytheBay-23Sep2016-Bimal_Mehta.jpg","page_title":"Gardens by the Bay","context_page_description":"The Gardens by the Bay is a nature park spanning 101 hectares in the Central Region of Singapore, adjacent to the Marina Reservoir. The park consists of three waterfront gardens: Bay South Garden, Bay East Garden and Bay Central Garden. The largest of the gardens is the Bay South Garden at 54 hectares designed by Grant Associates. Its Flower Dome is the largest glass greenhouse in the world.\\nGardens by the Bay was part of the nation's plans to transform its \\"Garden City\\" to a \\"City in a Garden\\", with the aim of raising the quality of life by enhancing greenery and flora in the city. First announced by Prime Minister Lee Hsien Loong at Singapore's National Day Rally in 2005, Gardens by the Bay was intended to be Singapore's premier urban outdoor recreation space, and a national icon.\\nBeing one of the popular tourist attractions in Singapore, the park received 6.4 million visitors in 2014, while topping its 20 millionth visitor mark in November 2015 and over 50 million in 2018."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B2%D5%B8%D6%80%D5%B7%D5%B8%D5%A4%D5%AD%D5%A5%D5%B4_(%D5%A8%D5%B6%D5%AF%D5%A5%D6%80%D5%B8%D6%82%D5%A9%D5%B5%D5%B8%D6%82%D5%B6)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/A_BorsodChem_Rt._f%C5%91bej%C3%A1rata.JPG","page_title":"Բորշոդխեմ (ընկերություն)","context_page_description":"Բորշոդխեմ, պաշտոնական անվանումը\` Wanhua-BorsodChem, հունգարական քիմիական ընկերություն, որը գտնվում է Հունգարիայի Կազինցբարցիկա քաղաքում: Մասնագիտանում է իզոցիանատների, պոլիվինիլքլորիդիև վինիլի արտադրության մեջ: Հիմնական գործարանը գտնվում է Կազինցբարցիկայում, սակայն արտադրությունն իրականացվում է նաև Չեխիայի Օստրավայում և Լեհաստանի Կենձեժին-Կոզլեում: Մասնաճյուղեր կան Հունգարիայում, Բելգիայում, Չեխիայում, Խորվաթիայում, Իտալիայում և Լեհաստանում:\\n2008 թվականից տեխնիկական աջակցության կենտրոնը գտնվում է Գյոդյոլյոյում:"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9D%D1%96%D0%BA%D0%BE%D0%BB%D0%B0%D1%81_%D0%9E%D1%80%D0%B5%D1%88%D0%BA%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Nicholas_Oresko%2C_Army_Medal_of_Honor_recipient_2001.jpg","page_title":"Ніколас Орешко","context_page_description":"Ніколас Орешко — колишній американський військовослужбовець, майстер-сержант армії США, учасник Другої світової війни, був найстарішим живим кавалером Медалі Пошани з січня 2011 по жовтень 2013."},{"page_url":"https://en.wikipedia.org/wiki/Bia%C5%82ystok","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Cerkiew_%C5%9Awi%C4%99tego_Ducha_Bia%C5%82ystok.JPG","page_title":"Białystok","context_page_description":"Białystok is the largest city in northeastern Poland and the capital of the Podlaskie Voivodeship. Białystok is the tenth-largest city in Poland, second in terms of population density, and thirteenth in area.\\nBiałystok is located in the Białystok Uplands of the Podlaskie Plain on the banks of the Biała River. It has historically attracted migrants from elsewhere in Poland and beyond, particularly from Central and Eastern Europe. This is facilitated by the nearby border with Belarus also being the eastern border of the European Union, as well as the Schengen Area. The city and its adjacent municipalities constitute Metropolitan Białystok. The city has a warm summer continental climate, characterized by warm summers and long frosty winters. Forests are an important part of Białystok's character, and occupy around 1,756 ha which places it as the fifth-most forested city in Poland.\\nThe first settlers arrived in the 14th century. A town grew up and received its municipal charter in 1692. Białystok has traditionally been one of the leading centers of academic, cultural, and artistic life in Podlachia and the most important economic center in northeastern Poland."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Notre-Dame-de-Lourdes_de_Romans","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Romans-sur-Is%C3%A8re_Notre_Dame_de_Lourdes.jpg","page_title":"Église Notre-Dame-de-Lourdes de Romans","context_page_description":"L’église Notre-Dame-de-Lourdes est une église catholique située à Romans-sur-Isère dans la Drôme."},{"page_url":"https://fr.wikipedia.org/wiki/Bataille_de_la_mer_de_Corail","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Coral_Sea_Neosho_Burning.jpg","page_title":"Bataille de la mer de Corail","context_page_description":"La bataille de la mer de Corail est une bataille navale de la guerre du Pacifique, durant la Seconde Guerre mondiale, qui opposa du 4 au 8 mai 1942 la marine impériale japonaise et les forces alliées navales et aériennes des États-Unis et de l’Australie. Cet affrontement est la première bataille uniquement aéronavale de l'histoire, dans laquelle les forces navales en présence s'affrontèrent par avions interposés sans jamais être à portée de canon.\\nPour renforcer leur dispositif défensif dans le Pacifique Sud et isoler l'Australie, les Japonais avaient décidé d'envahir Port Moresby, au sud de la Nouvelle-Guinée, et Tulagi, au sud-est des îles Salomon. Les forces déployées par la marine du Japon pour cette opération, de nom de code MO, sous le commandement général de Shigeyoshi Inoue, comprenaient plusieurs éléments importants de la force aéronavale japonaise dont deux porte-avions et un porte-avions léger pour fournir une couverture aérienne aux flottes d'invasion. Les États-Unis, dont les services d'écoute avaient percé le plan ennemi, dépêchèrent deux groupes de porte-avions et une force de croiseurs américains et australiens, sous le commandement de l'amiral Frank J. Fletcher."},{"page_url":"https://en.wikipedia.org/wiki/Curry","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Curry-bun%2Ccurry-pan%2Ckatori-city%2Cjapan.JPG","page_title":"Curry","context_page_description":"Curry is a variety of dishes originating in the Indian subcontinent that use a complex combination of spices or herbs, usually including ground turmeric, cumin, coriander, ginger, and fresh or dried chilies. In southern India, where the word originated, curry leaves, from the curry tree, are also an integral ingredient. Curry is generally prepared in a sauce.\\nThere are many varieties of dishes called 'curries'. For example, in original traditional cuisines, the precise selection of spices for each dish is a matter of national or regional cultural tradition, religious practice, and, to some extent, family preference. Such dishes are called by specific names that refer to their ingredients, spicing, and cooking methods. Spices are used both whole and ground, cooked or raw, and they may be added at different times during the cooking process to produce different results. The main spices found in most curry powders of the Indian subcontinent are coriander, cumin, and turmeric. A wide range of additional spices may be included depending on the geographic region and the foods being included."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kirchen_im_Erzbistum_Paderborn","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Kirche_von_Boke.jpg","page_title":"Liste der Kirchen im Erzbistum Paderborn","context_page_description":"Die Liste der Kirchen im Erzbistum Paderborn zeigt die römisch-katholischen Kirchen und Kapellen im Erzbistum Paderborn sortiert nach Dekanaten und Pfarrverbünden an."},{"page_url":"https://eu.wikipedia.org/wiki/Helena_Nyblom","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Swedish_author_Helena_Nyblom_%281843-1926%29.JPG","page_title":"Helena Nyblom","context_page_description":"Helena Nyblom suediar idazlea izan zen, batik-bat haurrentzako ipuinen egilea. Bere lanik ezagunena ziurrenik Swan-en Jantzia da."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%9F%D0%B8%D1%80%D0%B0%D1%82%D1%81%D1%82%D0%B2%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Dhow_in_Indian_Ocean.jpg","page_title":"Пиратство","context_page_description":"Пиратство — активност на разбојници кои вршат криминал на море, а понекогаш и на бреговите. Името потекнува од старогрчкиот збор за обид/искуство, што имплицитно би значело „да си ја пробаат среќата“, Пиратството се појавило уште во античко време, но својот процут го достигнало во XVII век на Карибите, односно во Новиот Свет. Денес пиратите најмногу дејствуваат на Тихиот и Индискиот Океан и претставуваат голем проблем за одвивањето на меѓународната трговија."},{"page_url":"https://en.wikipedia.org/wiki/Lancia_Augusta","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/76/Lancia_Belna_Roadster_Pourtout.jpg","page_title":"Lancia Augusta","context_page_description":"The Lancia Augusta is a small passenger car produced by Italian car manufacturer Lancia between 1933 and 1936. It made its première at the 1932 Paris Motor Show. The car was powered by a 1,196 cc Lancia V4 engine.\\nDuring the 1920s, Lancia had been known as producers of sports cars and middle sized sedans: the smaller Augusta represented a departure from that tradition, and contributed to a significant growth in Lancia's unit sales during the 1930s. Nevertheless, in terms of volumes sold, the Augusta was overwhelmed by Fiat's much more aggressively priced 508 Ballila."},{"page_url":"https://en.wikipedia.org/wiki/Lancia_Augusta","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/76/Lancia_Belna_Roadster_Pourtout.jpg","page_title":"Lancia Augusta","context_page_description":"The Lancia Augusta is a small passenger car produced by Italian car manufacturer Lancia between 1933 and 1936. It made its première at the 1932 Paris Motor Show. The car was powered by a 1,196 cc Lancia V4 engine.\\nDuring the 1920s, Lancia had been known as producers of sports cars and middle sized sedans: the smaller Augusta represented a departure from that tradition, and contributed to a significant growth in Lancia's unit sales during the 1930s. Nevertheless, in terms of volumes sold, the Augusta was overwhelmed by Fiat's much more aggressively priced 508 Ballila."},{"page_url":"https://cs.wikipedia.org/wiki/Brn%C3%A1_(%C3%9Ast%C3%AD_nad_Labem)","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/88/Blokdiagram-brna-nad-labem.jpg","page_title":"Brná (Ústí nad Labem)","context_page_description":"Brná, názvem katastrálního území Brná nad Labem, je část statutárního a krajského města Ústí nad Labem v České republice, spadající pod městský obvod Ústí nad Labem-Střekov, do roku 1980 byla samostatnou obcí. Nachází se v Českém středohoří na pravém břehu řeky Labe, asi pět kilometrů jižně od centra Ústí nad Labem. Její území je tvořeno jedním celým katastrálním územím o rozloze 4,24 km², ležícím v nadmořské výšce od 140 do 626 m n. m. K roku 2011 zde žilo 1179 obyvatel.\\nNejstarší dochovaná zmínka pochází z roku 1057 a od středověku se ve vsi kromě běžných zemědělských produktů pěstovalo ovoce a vinná réva. Významněji se Brná začala rozvíjet až v 19. století, během něhož se stala rekreačním zázemím Ústí nad Labem. Agrární charakter si udržela až do konce 50. let 20. století, kdy na rozparcelovaných pozemcích zaniklého jednotného zemědělského družstva začala mohutná výstavba rodinných domů a rekreačních objektů. V roce 1980 se Brná stala součástí Ústí nad Labem a od té doby je jeho rezidenční a rekreační oblastí.\\nBrnou prochází silnice II/261 a železniční trať 072."},{"page_url":"https://no.wikipedia.org/wiki/Ikketransitive_terninger","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Standard-Dodekaeder-D_IV.gif","page_title":"Ikketransitive terninger","context_page_description":"En mengde av terninger er ikke-transitiv dersom den inneholder tre terninger A, B og C, slik at A slår B oftere enn B slår A, så A > B, og samtidig er B > C, men også C > A, og ikke A > C. Med andre ord er en mengde terninger ikke-transitiv dersom relasjonen «gir minst like høyt resultat i mer enn halvparten av kastene» ikke er transitiv.\\nDet er mulig å finne mengder av terninger med den sterkere egenskapen at, for hver terning i mengden, så er det en annen terning i mengden som gir et minst like høyt resultat i mer enn halvparten av kastene. Denne sterkere egenskapen er alltid oppfylt for tre ikke-transitive terninger, men ikke nødvendigvis for fire eller flere ikke-transitive terninger.\\nVed å bruke et slikt sett av terninger, er det mulig å finne opp spill som er partiske på måter som folk uten erfaring med ikke-transitive terninger ikke ville forvente."},{"page_url":"https://it.wikipedia.org/wiki/Italo-francesi","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Jean-Paul_Belmondo_2001.jpg","page_title":"Italo-francesi","context_page_description":"Un italo-francese è un cittadino francese di origini italiane. Secondo una pubblicazione del Centre Interdisciplinaire de Recherche sur la Culture des Échanges dell'Università Sorbona - Parigi 3, oggi la comunità francese con ascendenze italiane è stimata intorno ai 4 milioni di individui. Tra gli italo-francesi recensiti non dovrebbero rientrare gli abitanti autoctoni della Corsica e del Nizzardo, nonostante parte di questi siano etnicamente italici e linguisticamente italofoni, anche perché questi territori non hanno mai fatto parte politicamente dell'Italia unita. Secondo dati ufficiali dell'AIRE relativi al 2007, invece i cittadini italiani residenti in Francia risultavano 348.722. Sono 370.000 secondo il “Rapporto Italiani nel mondo 2010” della Fondazione Migrantes."},{"page_url":"https://en.wikipedia.org/wiki/Royal_Doulton","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/William_hodkinson_per_doulton_%26_co.%2C_ltd.%2C_vaso_in_porcellana%2C_staffordshire_UK_1891-1902%2C_02.jpg","page_title":"Royal Doulton","context_page_description":"Royal Doulton is an English ceramic manufacturing company dating from 1815. Operating originally in Vauxhall, London, later moving to Lambeth, in 1882 it opened a factory in Burslem, Stoke-on-Trent, in the centre of English pottery. From the start the backbone of the business was a wide range of utilitarian wares, mostly stonewares, including storage jars, tankards and the like, and later extending to pipes for drains, lavatories and other bathroom ceramics. From 1853 to 1902 its wares were marked Doulton & Co., then from 1902, when a royal warrant was given, Royal Doulton.\\nIt always made some more decorative wares, initially still mostly stoneware, and from the 1860s the firm made considerable efforts to get a reputation for design, in which it was largely successful, as one of the first British makers of art pottery. Initially this was done through artistic stonewares made in Lambeth, but in 1882 the firm bought a Burslem factory, which was mainly intended for making bone china tablewares and decorative items."},{"page_url":"https://en.wikipedia.org/wiki/Cairns_Aquarium","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/AU-cairns-aquarium.jpg","page_title":"Cairns Aquarium","context_page_description":"Cairns Aquarium, the first public aquarium built in Australia in 18 years, is home to more than 16,000 specimens and 10 ecosystems. The $54 million, 7,800sq m, three-level facility in Queensland holds 71 tanks including Australia's largest freshwater tank with 400,000 litres of water, a deep sea tank and the world's first true tidal motion tank.\\nIt has 10 lifelike and recreated habitats and is the only aquarium of its type to display endangered or rarely seen endemic species such as the emerald tree monitors, Jardine River painted turtles, ribboned pipefish and scalloped hammerhead sharks.\\nThe aquarium is also an interactive research and education centre and is home to the Cairns Turtle Rehabilitation Centre."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B4%D6%80%D5%A5%D5%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Draize_%28Ardennes%29_city_limit_sign.JPG","page_title":"Դրեզ","context_page_description":"Դրեզ, համայնք Ֆրանսիայի Շամպայն-Արդեն մարզի Արդեններ գավառում:\\nԲնակչությունը 2008 թվականի դրությամբ կազմում է 102 մարդ, բնակչության խտությունը\` 15.02 մարդ/կմ²: Բնակավայրը զբաղեցնում է 6.79 կմ² տարածք:"},{"page_url":"https://en.wikipedia.org/wiki/Northeast_China_folk_religion","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Shinto_shrine_in_Zhangjiakou%2C_Hebei%2C_China%2C_in_the_1960s_%E8%92%99%E7%96%86%E7%A5%9E%E7%A4%BE.jpg","page_title":"Northeast China folk religion","context_page_description":"Northeast China folk religion is the variety of Chinese folk religion of northeast China, characterised by distinctive cults original to Hebei and Shandong, transplanted and adapted by the Han Chinese settlers of Liaoning, Jilin and Heilongjiang since the Qing dynasty. It is characterised by terminology, deities and practices that are different from those of central and southern Chinese folk religion. Many of these patterns derive from the interaction of Han religion with Manchu shamanism.\\nProminence is given to the worship of zoomorphic deities, of a \\"totemic\\" significance. In the region the terms shen 神 and xian 仙 are synonymous. Figures of ritual specialists or shamans perform various ritual functions for groups of believers and local communities, including chūmǎxiān, dances, healing, exorcism, divination, and communication with ancestors."},{"page_url":"https://ht.wikipedia.org/wiki/Guernsey,_Wyoming","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/RegisterCliffByPhilKonstantin.jpg","page_title":"Guernsey, Wyoming","context_page_description":"Guernsey se yon vil nan eta Wyoming, nan Etazini.\\nLi nan konte, rejyon Platte.\\nNan lane 2000, popilasyon li te genyen 1,147 moun."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%87%D8%A7%D8%AF%DB%8C_%D8%B1%D9%86%D8%AC%DB%8C_%D8%AA%D9%87%D8%B1%D8%A7%D9%86%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Portrait_of_Hadi_Ranji_Tehrani_%28edited%29.png","page_title":"هادی رنجی تهرانی","context_page_description":"هادی پیشرفت متخلص به رنجی شاعر ایرانی بود."},{"page_url":"https://nl.wikipedia.org/wiki/Vlag_van_Californi%C3%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Flag_of_the_Governor_of_California.svg","page_title":"Vlag van Californië","context_page_description":"De vlag van Californië, bijgenaamd de Bear Flag, is de vlag van Californië. De vlag wordt gebruikt sinds de Republiek Californië zich op 14 juni 1846 onafhankelijk van Mexico verklaarde. Deze republiek sloot zich een kleine maand later aan bij de Verenigde Staten en werd in 1850 een staat van de Verenigde Staten. Vanaf 3 februari 1911 is de Bear Flag de officiële vlag van de staat Californië.\\nDe vlag is wit met een rode horizontale baan aan de onderkant. In het witte veld staan een rode ster en een naar de hijszijde kijkende Californische grizzlybeer op een stuk grond boven de naam van de staat."},{"page_url":"https://vi.wikipedia.org/wiki/Treznea","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Treznea_jud_Salaj.png","page_title":"Treznea","context_page_description":"Treznea là một xã thuộc hạt Sălaj, România. Dân số thời điểm năm 2002 là 1034 người."},{"page_url":"https://it.wikipedia.org/wiki/Convento_di_San_Lucchese","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Altare_in_San_Lucchese.jpg","page_title":"Convento di San Lucchese","context_page_description":"Il convento di San Lucchese si trova a Poggibonsi in provincia di Siena, arcidiocesi di Siena-Colle di Val d'Elsa-Montalcino.\\nOriginariamente al suo posto sorgeva la chiesa di Santa Maria in Camaldo. Si tratta di uno dei pochissimi esempi di edifici in stile gotico presenti in Valdelsa, visibile soprattutto nella zona absidale. Nel luglio del 1938 papa Pio XI elevò la chiesa alla dignità di basilica minore."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A8%D7%9E%D7%A7%D7%95_%D7%90%D7%95%D7%95%D7%A0%D7%A4%D7%95%D7%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/EuropeanChampionJersey%282016%29.png","page_title":"רמקו אוונפול","context_page_description":"רמקו אוונפול הוא רוכב אופני כביש בלגי בקבוצת דקונינק קוויק-סטפ.\\nאוונפול נחשב לאחד מהרוכבים הצעירים הטובים בעולם, כבר שהיה בן 19 ניצח את אליפות אירופה בנגד השעון וזכה במדליית כסף באליפות העולם בנגד השעון במקצה העלית גברים וניצח במרוץ קלאסיקה סן סבסטיאן. במרוצי הג'וניורס שלט אוונפול וניצח את אליפות העולם ואליפות אירופה בכביש ובנגד השעון בשנת 2018."},{"page_url":"https://de.wikipedia.org/wiki/Charles_Thomson_(Schriftsteller)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/US_Great_Seal_Charles_Thomson_Preliminary_Design.jpg","page_title":"Charles Thomson (Schriftsteller)","context_page_description":"Charles Thomson war ein US-amerikanischer Schriftsteller und Politiker irischer Herkunft."},{"page_url":"https://ur.wikipedia.org/wiki/%DB%81%DB%8C%D8%B1%DB%8C%D8%B3%D9%86%D8%A8%D8%B1%DA%AF%D8%8C_%D9%88%D8%B1%D8%AC%DB%8C%D9%86%DB%8C%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Rockingham_County_Courthouse.JPG","page_title":"ہیریسنبرگ، ورجینیا","context_page_description":"ہیریسنبرگ، ورجینیا ریاستہائے متحدہ امریکا کا ایک independent city جو ورجینیا میں واقع ہے۔"},{"page_url":"https://de.wikipedia.org/wiki/Christian_Klucker","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Klucker_um_1925.jpg","page_title":"Christian Klucker","context_page_description":"Christian Klucker war ein Schweizer Bergführer aus dem Engadin.\\nKlucker war ein Pionier im Alpinismus der Jahrhundertwende zum 20. Jahrhundert, Wegbereiter einer modernen und umfassenden Form des Bergführerberufs und Kämpfer für die Erhaltung der Natur. Heute gilt er auch als früher Vertreter des Freikletterns. Legendär ist sein Versuch im Alleingang an der Nordkante des Piz Badile, wo er am 11. Juli 1892 in Socken zwei Drittel der Kante hinauf und hinunter kletterte und dabei Stellen im Schwierigkeitsgrad IV meisterte.\\nEr führte eine grosse Zahl von Erstbesteigungen im Bergell und in andern Regionen der Alpen und der Rocky Mountains aus und feierte 1901 sein 25-jähriges Berufsjubiläum, bei dem er auf 3000 Bergtouren ohne den geringsten Unfall zurückschauen konnte.\\nSeine Autobiografie Erinnerungen eines Bergführers erschien nach seinem Tod, wurde ein Bestseller und ins Englische und in jüngster Zeit ins Italienische übersetzt. Eine deutsche Neuausgabe besorgte Emil Zopfi 2010 für den AS Verlag, Zürich."},{"page_url":"https://de.wikipedia.org/wiki/Vidnavsk%C3%A9_Fojtstv%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Z%C3%A1mek_s_parkem_%28Vidnava%29.JPG","page_title":"Vidnavské Fojtství","context_page_description":"Vidnavské Fojtství ist eine Ortslage der Stadt Vidnava in Tschechien. Sie liegt unmittelbar südlich von Vidnava und gehört zum Okres Jeseník."},{"page_url":"https://nn.wikipedia.org/wiki/Hagesalat","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Iceberg_lettuce_in_SB.jpg","page_title":"Hagesalat","context_page_description":"Hagesalat, også kjend som bladsalat eller berre salat, er ein matplante i salatslekta i korgplantefamilien. Han har mange varietetar, som hovudsalat. Ein bruker særleg blada i salatrettar, men også stengel og frø kan brukast.\\nOrdet «salat» kjem via tysk frå italiensk salata, 'rett tilreidd med salt'."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%B6%8A%E7%A7%80%E5%B1%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/%E4%BD%9B%E5%B1%B1%E7%89%8C%E5%9D%8A1.JPG","page_title":"越秀山","context_page_description":"越秀山，亦称粤秀山、越王山、观音山，是广东省广州市中心的一座历史悠久的山脉，海拔70米，是白云山的余脉。"},{"page_url":"https://fr.wikipedia.org/wiki/Arthon","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Arthon-ex.PTT-07.JPG","page_title":"Arthon","context_page_description":"Arthon est une commune française située dans le département de l'Indre, en région Centre-Val de Loire."},{"page_url":"https://pt.wikipedia.org/wiki/Saint_James_Park_(Exeter)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/St_James_Park_-_Away_Terrace.JPG","page_title":"Saint James Park (Exeter)","context_page_description":"O Saint James Park é um estádio de futebol localizado na cidade de Exeter, e é a casa do Exeter City FC. O estádio é servido pela estação ferroviária St James Park, que é bem próxima ao estádio. O clube colabora na manutenção dos trilhos desse trecho, que foram pintados em vermelho e branco, cores do Exeter. O estádio tem capacidade para 8541 espectadores."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%82%D9%88_%D9%87%D8%A7%D8%B1%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/170807_%EA%B5%AC%ED%95%98%EB%9D%BC_%28cropped%29.jpg","page_title":"قو هارا","context_page_description":"قو هارا گونئی کوره‌لی اویونچو، شارکیچی و موسیقیچی - پاپ موسیقی ژانرلاریندا اثرلر یارادیب. قو هارا ۱۳ ژانویه ۱۹۹۱ ‏ تاریخینده Gwangju شهرینده حیاتا گؤز آچیب."},{"page_url":"https://fr.wikipedia.org/wiki/Chapelle_Saint-Sixte_d%27Aubignan","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Aubignan_-_Chapelle_Saint_Sixte_2.jpg","page_title":"Chapelle Saint-Sixte d'Aubignan","context_page_description":"La chapelle Saint-Sixte est une chapelle désaffectée d'architecture romane située dans la commune française d'Aubignan. Elle aurait été, à l'origine, église paroissiale."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%BE%D1%80_%D0%BE_%C2%AB%D0%A1%D0%B8%D0%B4%D0%B5%C2%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Nicolas_Boileau.PNG","page_title":"Спор о «Сиде»","context_page_description":"Спор о «Сиде» — беспрецедентная литературно-эстетическая дискуссия, разгоревшаяся во Франции в 1637—1638 годах после постановки и публикации текста наиболее известной пьесы Пьера Корнеля, трагикомедии «Сид»."},{"page_url":"https://en.wikipedia.org/wiki/Magyar_T%C3%A1virati_Iroda","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f8/MTI_Commemorative_Medal%2C_Budapest_2006.jpeg","page_title":"Magyar Távirati Iroda","context_page_description":"MTI is a Hungarian news agency. One of the oldest news agencies in the world, it was founded in 1880.\\nMTI is owned by MTI Rt., founded by the Parliament. The members of the Owners’ Advisory Body are elected by the National Assembly of Hungary on four-year terms. It's a marketleader, and is considered by some sources to be a ‘balanced and reliable source’. Still, it finds it difficult to raise subscriptions as most major Hungarian newspapers are foreign-owned. It must turn to the government for capital to overcome its technology deficit.\\nAccording to a UNESCO report it faces competition both from independent and specialist news agencies, and from domestic Hungarian news services established by Reuters and AFP.\\nOn 1 July 2015, Magyar Távirati Iroda as well as the three other public media organizations managed by the MTVA were merged into a single organization called Duna Media Service. This organization is the legal successor to Magyar Távirati Iroda."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%BC%E3%83%A0%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Bassarid_relief_from_Zemun.jpg","page_title":"ゼムン","context_page_description":"ゼムンは、セルビアの歴史的な街であり、また現在は同国の首都・ベオグラードを構成する17の区の1つとなっている。歴史上、ゼムンはベオグラードとは別の街として発展してきたが、20世紀後半にノヴィ・ベオグラードの開発によって両者は結ばれて1つの都市となった。"},{"page_url":"https://sv.wikipedia.org/wiki/Hakatabukten","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/View_of_Uminonakamichi_from_Nokonoshima_Island.JPG","page_title":"Hakatabukten","context_page_description":"Hakatabukten är en bukt utanför Fukuoka på norra kusten av den japanska ön Kyushu. Bukten är känd för de mongoliska invasionerna av Japan 1274 och 1281.\\nHakata var förr en stad men utgör numera en del av Fukuoka."},{"page_url":"https://eo.wikipedia.org/wiki/Dezerto_Granda_Sala_Lago","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Bonneville_salt_flats_pilot_peak.jpg","page_title":"Dezerto Granda Sala Lago","context_page_description":"La Dezerto Granda Sala Lago aŭ Granda Sala Dezerto estas regiono okcidente de la Granda Sala Lago en la norda parto de la ŝtato Utaho de Usono. La dezerto ekestis fine de la lasta glaciepoko pro la sekiĝo de la lago Bonneville – prahistoria lago, kiu etendiĝis okcidente de la Roka Montaro sur la plejparto de la Granda Baseno kaj de tiu nuntempe nur restis la Granda Sala Lago.\\nLa lago Bonneville, nomata laŭ Benjamin Louis Eulalie de Bonneville, fine de la plejstoceno dumtempe ampleksis ĝis 52.000 kvadratajn kilometrojn kaj do siatempe ne multe pli malgrandis ol la nuntempa lago Miĉigano. Antaŭ 15.000 jaroj ĝi en iuj lokoj profundis pli ol 300 metrojn. Ekde antaŭ proksimume 14.000 jaroj la lago pro la ŝanĝiĝantaj klimataj cirkonstancoj komencis malgrandiĝi, kaj sen signifaj al- kaj elfluaj riveroj ĝi fine preskaŭ plene sekiĝis kaj lasis salan grundon.\\nNuntempe de la lago Bonneville krom la Granda Sala Lago do restis sala dezerto, kiu etendiĝas okcidente de la Granda Sala Lago sur areo de proksimume 10.360 km² ĝis la limo al la najbara usona ŝtato Nevado. La dezerta sablo pro la alta procentaĵo de sablo aspektas blanke."},{"page_url":"https://de.wikipedia.org/wiki/Mountain_Lake_(Ort,_Minnesota)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Bargen%2C_Isaac%2C_House.jpg","page_title":"Mountain Lake (Ort, Minnesota)","context_page_description":"Mountain Lake ist eine Kleinstadt im Cottonwood County im mittleren Südwesten des US-amerikanischen Bundesstaates Minnesota. Im Jahr 2010 hatte Mountain Lake 2104 Einwohner."},{"page_url":"https://es.wikipedia.org/wiki/FAMAS","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/FAMAS_description.png","page_title":"FAMAS","context_page_description":"El FAMAS es un fusil de asalto con configuración bullpup diseñado y manufacturado en Francia por la fábrica de armas de Saint-Étienne, el cual es miembro de propiedad del complejo francés Nexter. Es uno de los fusiles de servicio que utiliza el ejército francés."},{"page_url":"https://de.wikipedia.org/wiki/Schweinfurt","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Schweinfurt_Burggasse_15-001.JPG","page_title":"Schweinfurt","context_page_description":"Schweinfurt ist eine kreisfreie Stadt im Regierungsbezirk Unterfranken des Freistaats Bayern. Die wichtigste Industriestadt Nordbayerns und Hafenstadt am Main ist Oberzentrum, Verwaltungssitz des Landkreises Schweinfurt, Teilstandort zweier Landesbehörden und Hochschulstadt. Schweinfurt besteht als deutsche Ausnahme fast nur aus der Kernstadt, weshalb die Einwohnerzahl keinen Vergleichsmaßstab bietet. Die Agglomeration hat 100.200 Einwohner und das Einzugsgebiet der Stadt 759.000 Einwohner. Zu ihm gehören die Region Main-Rhön und der mittlere Teil Südthüringens.\\nSchweinfurt war schon in vorgeschichtlicher Zeit besiedelt und wurde 791 erstmals urkundlich erwähnt. Die Markgrafen von Schweinfurt verloren bereits vor 1000 Jahren ihre überregionale Bedeutung. Vom 12. Jahrhundert bis 1802 war Schweinfurt Reichsstadt, in der Frühen Neuzeit ein humanistisches Zentrum und 1770 begann die Industrialisierung. Im Zweiten Weltkrieg war die Stadt wegen ihrer Schlüsselindustrie stark umkämpft, geriet durch die Deutsche Teilung ins Abseits und durch die Wiedervereinigung in die bundesdeutsche Mitte, als neuer Autobahnknoten."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%9D%9C%E7%B4%8D%E4%BC%8A%E5%A4%AB_(%E4%BD%A9%E5%88%97%E6%A2%85%E4%BB%80%E5%88%A9%E4%BA%9E%E5%85%A7%E5%8D%80)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Virgin_Mary_Birth_Dunayiv.jpg","page_title":"杜納伊夫 (佩列梅什利亞內區)","context_page_description":"杜纳伊夫是乌克兰的城镇，位于该国西部利沃夫州，由佩列梅什利亚内区负责管辖，始建于1386年，面积2.84平方公里，海拔高度307米，2001年人口683，人口密度每平方公里240.49人。"},{"page_url":"https://fr.wikipedia.org/wiki/Kisii","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bd/Students_life.jpg","page_title":"Kisii","context_page_description":"Kisii est le chef-lieu du comté de Kisii et du district de Kitutu Chache dans l'ancienne province de Nyanza au Kenya. Elle est peuplée essentiellement de Gusii."},{"page_url":"https://ceb.wikipedia.org/wiki/Ubrique_(kapital_sa_munisipyo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Ubrique_Andalousie_Espagne.jpg","page_title":"Ubrique (kapital sa munisipyo)","context_page_description":"Kapital sa munisipyo ang Ubrique sa Espanya. Nahimutang ni sa lalawigan sa Provincia de Cádiz ug rehiyon sa Andalucía, sa habagatang bahin sa nasod, 400 km sa habagatan sa Madrid ang ulohan sa nasod. 325 metros ibabaw sa dagat kahaboga ang nahimutangan sa Ubrique, ug adunay 16,979 ka molupyo.\\nAng yuta palibot sa Ubrique kay kasagaran medyo kabukiran. Ubrique nahimutang sa usa ka walog. Ang kinahabogang dapit sa palibot dunay gihabogon nga 884 ka metro ug 1.5 km sa sidlakan sa Ubrique. Dunay mga 15 ka tawo kada kilometro kwadrado sa palibot sa Ubrique may gamay nga populasyon. Ubrique ang kinadak-ang lungsod sa maong dapit. Hapit nalukop sa durowan ug kabugangan ang palibot sa Ubrique.\\nAng klima mediteranyo. Ang kasarangang giiniton 15 °C. Ang kinainitan nga bulan Agosto, sa 26 °C, ug ang kinabugnawan Enero, sa 7 °C. Ang kasarangang pag-ulan 718 milimetro matag tuig. Ang kinabasaan nga bulan Nobiyembre, sa 144 milimetro nga ulan, ug ang kinaugahan Hulyo, sa 1 milimetro."},{"page_url":"https://la.wikipedia.org/wiki/Consid%C3%A9rations_sur_les_causes_de_la_grandeur_des_Romains_et_de_leur_d%C3%A9cadence","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Considerations_des_Romains_-_Montesquieu.jpg","page_title":"Considérations sur les causes de la grandeur des Romains et de leur décadence","context_page_description":"Considerationes super causam excellentia Romanorum et occasus suus est opus a Montesquieu scriptum et in 1734 inceptum.\\nHaec opera inspiravit spiritum aetatis, et Eduardus Gibbon auxit argumentum in 1776 in Historiam ruinae et lapsus Imperii Romani.\\nQuattuordecim anni post inceptum erit De l'esprit des lois, ubi Montesquieu cogitas super historiam Romanam.\\nHaec opera contribuit in creatione chronologiam periodorum historiae: Antiquitas, Medium Aevum, Renascentia et Aetas Moderna."},{"page_url":"https://pl.wikipedia.org/wiki/Budynek_Komunalnej_Kasy_Oszcz%C4%99dno%C5%9Bci_w_Chorzowie","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Chorzow_Municipal_Savings_Bank_room.jpg","page_title":"Budynek Komunalnej Kasy Oszczędności w Chorzowie","context_page_description":"Budynek Komunalnej Kasy Oszczędności, Bank Polski, pot. drapacz chmur – stalowo-ceglany wieżowiec z 1937 roku w Chorzowie, wpisany do rejestru zabytków nieruchomych województwa śląskiego; jeden z trzech najwyższych budynków mieszkalnych dwudziestolecia międzywojennego w Polsce, ostatni zrealizowany wieżowiec na Górnym Śląsku za czasów II Rzeczypospolitej."},{"page_url":"https://eo.wikipedia.org/wiki/Markt_Nordheim","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6c/Markt_Nordheim%2C_Herbolzheim_29%2C_001.jpg","page_title":"Markt Nordheim","context_page_description":"Markt Nordheim estas komunumo en Germanio. Ĝi troviĝas en la distrikto Neustadt an der Aisch-Bad Windsheim kaj en la distriktaro Meza Frankonio de la federacia lando Bavario. Fine de decembro 2015 la komunumo havis 1 150 loĝantojn."},{"page_url":"https://de.wikipedia.org/wiki/Mehrkanal-Tonsystem","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/7_1_channels_%28extended_surround_sound%29_label.png","page_title":"Mehrkanal-Tonsystem","context_page_description":"Dieser Artikel gibt eine Übersicht über Mehrkanal-Tonsysteme und deren Vorläufer, vor allem im Kontext der Tonwiedergabe im Kino und der sogenannten Heimkino-Technik. Ziel von Mehrkanal-Tonsystemen ist es, ein möglichst realistisches räumliches Klangerlebnis zu ermöglichen, den Raumklang. In der Heim-Unterhaltungselektronik werden dazu heute AV-Receiver, das sind technisch aufwändige Mehrkanal-Audioverstärker, in Kombination mit mindestens sechs Lautsprecherboxen eingesetzt, die etwa für das DVD-Standard-Tonformat Dolby Digital 5.1 nötig sind."},{"page_url":"https://de.wikipedia.org/wiki/St._Georg_(Pfaffenwiesbach)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Vorkrippe_004.jpg","page_title":"St. Georg (Pfaffenwiesbach)","context_page_description":"Die Sankt-Georgs-Kirche Pfaffenwiesbach ist die Kirche des Kirchorts Pfaffenwiesbach, zu dem die Wehrheimer Ortsteile Pfaffenwiesbach und Friedrichsthal gehören.\\nDer Kirchort Pfaffenwiesbach ist einer der 11 Kirchorte in der am 1. Januar 2014 neu errichteten kath. Pfarrei „St. Franziskus und Klara – Usinger Land“ mit Sitz in Neu-Anspach. Er gehört damit weiterhin zum Bezirk Hochtaunus im Bistum Limburg. Nachdem er bis 1987 selbständig gewesen war, wurde er 1988 dem Kirchengemeindenverbund Pfaffenwiesbach – Friedrichsthal – Kransberg – Wernborn, dann dem Pastoralen Raum Neu-Anspach, dann dem Pastoralen Raum Usinger Land und zum 1. Januar 2012 schließlich dem Pastoralen Raum Usinger Land/Schmitten zugeordnet.\\nMit der Pfarrei-Neugründung hat nicht nur die Kirchengemeinde Pfaffenwiesbach ihren Pfarreistatus, sondern die Georgskirche auch ihren Status als „Pfarrkirche“ verloren und ist heute eine der 10 Filialkirchen der neuen Pfarrei „St. Franziskus und Klara Usinger Land“. Kirchenpatrone sind der Hl. Georg und seit 1711 die Hl. Barbara. Beide gehören zu den Vierzehn Nothelfern und sind christliche Märtyrer des 4. Jahrhunderts."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Anglican_churches_in_the_Diocese_of_Sydney","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Church_of_Holy_Trinity%2C_Baulkham_Hills%2C_New_South_Wales.png","page_title":"List of Anglican churches in the Diocese of Sydney","context_page_description":"This is a list of churches in the Anglican Diocese of Sydney. This includes physical church buildings even if they do not currently have congregations meeting. If a congregation meets in a shared space such as a school hall, it should only be listed if it is the primary meeting site for a parish."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%B8%D1%8F%D0%B2%D0%B0_(%D1%81%D1%82%D0%B0%D0%B4%D1%96%D0%BE%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/StadionMyjava.png","page_title":"Миява (стадіон)","context_page_description":"Штадіон «Спартака Миява» — футбольний стадіон у місті Миява, Словаччина, домашня арена місцевого ФК «Спартак».\\nСтадіон побудований та відкритий 1954 року. У 2012—2014 роках поетапно реконструйований. Споруджено нові трибуни та модернізовано ігрову зону, встановлено систему обігріву поля. Потужність арени становить 2 709 глядачів."},{"page_url":"https://cv.wikipedia.org/wiki/%D0%A3%D0%BB%D0%B0%D1%82%D0%B8%D0%BC%C4%95%D1%80_%D0%A2%D1%83%D1%80%C4%83_%D0%90%D0%BC%C4%83%D1%88_%D1%82%D1%83%D1%80%C4%83%D1%88%C4%95","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/35/Vladimirskaya_ikona_2.jpg","page_title":"Улатимĕр Турă Амăш турăшĕ","context_page_description":"Улатимĕр Турă Амăш турăшĕ — Турамăш турăшĕ, Вырăс Чиркĕвĕн чи хисеплĕ турăшĕсенчен пĕри; асамлă шутланать."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%B8%AF%E9%90%B5%E8%BB%8A%E7%AB%99%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Quarry_Bay_Station_2019_08_part3.jpg","page_title":"港鐵車站列表","context_page_description":"港铁是指2007年12月2日两铁合并而成的香港铁路运输系统，当中包括了95座铁路站及68座轻铁站。当中，有20座铁路站是换乘站。本列表中亦包括2个昂坪360车站以及1个高铁站。\\n本列表列出港铁的车站，其中包括铁路车站及昂坪360车站，并按路线的落成先后排序。轻铁车站已在香港轻铁车站列表列出。部分路线亦有兴建中、建议中及计划中之车站，兴建中之车站会展示其公布的套色，建议中及计划中之车站则以灰色表示。"},{"page_url":"https://de.wikipedia.org/wiki/Camillo_Paolucci","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Camillo_Paolucci.jpg","page_title":"Camillo Paolucci","context_page_description":"Camillo Paolucci war ein päpstlicher Diplomat und Kardinal."},{"page_url":"https://zh.wikipedia.org/wiki/1970%E5%B9%B48%E6%9C%8831%E6%97%A5%E6%97%A5%E9%A3%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/SE1970Aug31A.png","page_title":"1970年8月31日日食","context_page_description":"1970年8月31日日食是一次日環食，發生於1970年8月31日。新月當天，地球上觀測到月球和太陽的角距離極小，此時月球如果恰好在月球交點附近，穿過太陽和地球之間，與地球、太陽接近一直線，則會出現日食。月球穿過太陽和地球之間，但距地球較遠，本影未能接觸地表，而使偽本影覆蓋的區域內看到月球的角直徑小於太陽，就形成日環食，同時在偽本影兩側數千公里的半影範圍內形成日偏食。此次日環食經過了巴布亞紐幾內亞領地、吉爾伯特及埃利斯群島、西薩摩亞、美屬薩摩亞的部分島嶼，日偏食則覆蓋了大洋洲的大部分及周邊部分地區。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%89%E3%83%A9%E3%82%A4%E3%82%A2%E3%82%A4%E3%82%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Dry_ice_in_water.JPG","page_title":"ドライアイス","context_page_description":"ドライアイスは、固体二酸化炭素の商品名である。生鮮食品の冷温保管・輸送などに用いられる。固形炭酸、固体炭酸とも言う。"},{"page_url":"https://en.wikipedia.org/wiki/Gulfstream_V","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/NASA_GulfstreamV_in_wind_tunnel.jpg","page_title":"Gulfstream V","context_page_description":"The Gulfstream V is a long-range, large business jet aircraft produced by Gulfstream Aerospace, derived from the previous Gulfstream IV. It flies up to Mach 0.885, up to 51,000 feet and has a 6,500 nmi range. It typically accommodates four crew and 14 passengers. It first flew on November 28, 1995, and entered service in June 1997. It is used by the US military under the designation C-37A. It is followed by an improved version, the Gulfstream 550."},{"page_url":"https://it.wikipedia.org/wiki/AdLib","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Adlib_Gold_1000.jpg","page_title":"AdLib","context_page_description":"AdLib era il nome di una scheda audio prodotta nel 1987 dalla canadese Ad Lib, Inc., una società fondata da Martin Prevel, un ex professore di musica e vice-decano del dipartimento di musica dell'Università Laval di Quebec. L'AdLib, il cui nome corretto era in realtà Ad Lib Music Synthesizer Card, fu la prima scheda audio per compatibili IBM ad imporsi presso gli sviluppatori di videogiochi come standard audio de facto."},{"page_url":"https://en.wikipedia.org/wiki/Australian_golden_whistler","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Pachycephala_pectoralis_youngi_2.jpg","page_title":"Australian golden whistler","context_page_description":"The Australian golden whistler or golden whistler, is a species of bird found in forest, woodland, mallee, mangrove and scrub in Australia Most populations are resident, but some in south-eastern Australia migrate north during the winter. Its taxonomy is highly complex and remains a matter of dispute, with some authorities including as many as 59 subspecies of the golden whistler, while others treat several of these as separate species."},{"page_url":"https://en.wikipedia.org/wiki/List_of_United_States_Air_Force_installations","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/10/Volk_Field_ANGB_Emblem.png","page_title":"List of United States Air Force installations","context_page_description":"This is a list of United States Air Force installations."},{"page_url":"https://en.wikipedia.org/wiki/Maxwell,_New_Mexico","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8e/Colfax_County_New_Mexico_Incorporated_and_Unincorporated_areas_Maxwell_Highlighted.svg","page_title":"Maxwell, New Mexico","context_page_description":"Maxwell is a village in Colfax County, New Mexico, United States. The population was 254 at the 2010 census, down from 274 at the 2000 census. Maxwell was established in 1879 as a railroad town on the Atchison, Topeka and Santa Fe Railway. It was named in honor of Lucien Maxwell, who provided the land for the original townsite from his Maxwell Land Grant."},{"page_url":"https://ast.wikipedia.org/wiki/Antoni_Gaud%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Farmacia_Gibert.jpg","page_title":"Antoni Gaudí","context_page_description":"Antoni Gaudí i Cornet foi un arquiteutu catalán y máximu representante del modernismu catalán.\\nGaudí foi un arquiteutu con un sentíu innatu de la xeometría y el volume, según una gran capacidá imaxinativa que lu dexaba proyeutar mentalmente la mayoría de les sos obres enantes de pasales a planos. Ello ye que poques vegaes facía planos detallaos de les sos obres; prefería recrealos sobro maquetes tridimensionales, moldiando tolos detalles según diba escurriendo mentalmente. N'otres ocasiones, diba improvisando sobro la marcha, dando instrucciones a los sos collaboradores sobro lo qu'habíen de facer.\\nDotáu d'una fuerte intuición y capacidá creativa, Gaudí concebía los sos edificios d'una forma global, atendiendo mesmo a les soluciones estructurales qu'a les funcionales y decoratives. Estudiaba hasta'l más mínimu detalle de les sos creaciones, integrando na arquiteutura toa una riestra de trabayos artesanales qu'él mesmu llevaba a la perfeición: cerámica, vidriería, forxa de fierro, carpintería, etc. Coles mesmes, introdució nueves téuniques nel tratamientu de los materiales, como'l so famosu “trencadís” fechu con pieces de cerámica de refugaya."},{"page_url":"https://ca.wikipedia.org/wiki/Ucra%C3%AFnesos","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Georgius_Drohobich.jpg","page_title":"Ucraïnesos","context_page_description":"Els ucraïnesos són un grup ètnic eslau oriental d'Ucraïna.\\nEls ucraïnesos són descendents de diversos pobles que van habitar la vasta zona que s'estenia des del nord del Mar Negre fins a les fronteres del que és ara Rússia, Polònia, Moldàvia, Bielorússia i Eslovàquia. El territori de la Ucraïna actual, en temps prehistòrics i antics, estava poblat, entre altres pobles, per nombroses tribus nòmades, com ara els escites, de parla persa, i els sàrmates; gots de parla germànica i variags, i també khàzars turcoparlants, petxenegs i cumans. Tanmateix, sembla que els nòmades no eslaus que habitaven principalment les estepes del sud d'Ucraïna, tingueren poca influència en la conformació dels ucraïnesos moderns.\\nL'ucraïnès és una llengua eslava oriental, junt amb el rus i el bielorús. També està estretament emparentada amb el polonès.\\nEls ucraïnesos han habitat les actuals terres d'Ucraïna des de temps remots. Pel segle V aC, establiren el seu domini allí i fundaren la ciutat de Kíev – més tard capital d'un poderós estat conegut com el Principat de Kíev o la Rus de Kíev. El Kniaz Volodýmyr va adoptar el cristianisme el 988."},{"page_url":"https://en.wikipedia.org/wiki/Mark_Richardson_(musician)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Mark_Richardson.jpg","page_title":"Mark Richardson (musician)","context_page_description":"Mark Richardson is an English drummer, of the UK rock band Skunk Anansie and formerly of Little Angels and Feeder."},{"page_url":"https://it.wikipedia.org/wiki/Timbiras","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Igreja_da_Matriz_em_Timbiras.jpg","page_title":"Timbiras","context_page_description":"Timbiras è un comune del Brasile nello Stato del Maranhão, parte della mesoregione del Leste Maranhense e della microregione di Codó."},{"page_url":"https://sv.wikipedia.org/wiki/Hjulb%C3%B6leviken","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/P%C3%A4lkkitie_Hyvel%C3%A4nviiki.jpg","page_title":"Hjulböleviken","context_page_description":"Hjulböleviken är en stadsdel i norra Björneborg, Finland. Andra bosättningsområden i närheten är: Hjulböle, Slottskär, Toejoki, Borgmästarholmen och Lotsörebacken. Bostadsområdet består av villabebyggelse från 1990-talet. Servicen finns i Toejoki och Borgmästarholmen."},{"page_url":"https://en.wikipedia.org/wiki/Hypelate","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Hypelate_trifoliata.jpg","page_title":"Hypelate","context_page_description":"Hypelate trifoliata, commonly known as white ironwood or inkwood, is a small tree in the soapberry family. It is native to extreme southern Florida and islands of the Caribbean. It has trifoliate leaves and produces small flowers in early summer.\\nHypelate is a monotypic genus."},{"page_url":"https://en.wikipedia.org/wiki/National_Handicrafts_and_Handlooms_Museum","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/%E0%A4%B6%E0%A4%BF%E0%A4%B2%E0%A5%8D%E0%A4%AA_%E0%A4%B8%E0%A4%82%E0%A4%97%E0%A5%8D%E0%A4%B0%E0%A4%B9%E0%A4%BE%E0%A4%B2%E0%A4%AF_%E0%A4%B8%E0%A5%8D%E0%A4%A5%E0%A4%BF%E0%A4%A4%E0%A5%8D_%E0%A4%B5%E0%A5%88%E0%A4%AD%E0%A4%B5%E0%A4%B6%E0%A4%BE%E0%A4%B2%E0%A5%80_%E0%A4%B5%E0%A5%80%E0%A4%A5%E0%A5%80.jpg","page_title":"National Handicrafts and Handlooms Museum","context_page_description":"The National Handicrafts and Handlooms Museum commonly known as National Crafts Museum in New Delhi is one of the largest crafts museums in India.\\nIt is run by the Ministry of Textiles, Government of India. The museum is situated on the corner of the Pragati Maidan, facing the Purana Qila complex."},{"page_url":"https://en.wikipedia.org/wiki/Andr%C3%A9s_Hurtado_de_Mendoza,_3rd_Marquis_of_Ca%C3%B1ete","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/23/Andres_Hurtado_de_Mendoza.jpg","page_title":"Andrés Hurtado de Mendoza, 3rd Marquis of Cañete","context_page_description":"Andrés Hurtado de Mendoza y Cabrera, 3rd Marquis of Cañete was a Spanish military officer and, from June 29, 1556 to his death on March 30, 1561, the fifth Viceroy of Peru."},{"page_url":"https://fr.wikipedia.org/wiki/Miami_Children%27s_Museum","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Miami_Children%27s_Museum.jpg","page_title":"Miami Children's Museum","context_page_description":"Le Miami Children’s Museum est une institution éducative située sur Watson Island, à Miami en Floride."},{"page_url":"https://nl.wikipedia.org/wiki/Vrouwbuurstermolen","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Molen_Vrouwbuurstermolen_kap_kruiwerk_%281%29.jpg","page_title":"Vrouwbuurstermolen","context_page_description":"De Vrouwbuurstermolen is een korenmolen, dat in de Friese buurtschap Vrouwbuurtstermolen staat, ten oosten van het dorp Vrouwenparochie en ten zuiden van Oude Leije in de Nederlandse gemeente Waadhoeke."},{"page_url":"https://sv.wikipedia.org/wiki/Freys_Hotel","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Freys_Hotel%2C_Bryggargatan%2C_Stockholm%2C_2019e.jpg","page_title":"Freys Hotel","context_page_description":"Freys Hotel är ett hotell vid Bryggargatan 12 på Norrmalm i Stockholms innerstad. Hotellet öppnade 1989 och är uppkallat efter hästen Frey som vann distansritten mellan Jönköping och Stockholm 1895."},{"page_url":"https://de.wikipedia.org/wiki/Weidach_(Weitramsdorf)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Weidach_-_Herbststimmung_abends_am_Wasserturm.jpg","page_title":"Weidach (Weitramsdorf)","context_page_description":"Weidach ist ein Ortsteil der oberfränkischen Gemeinde Weitramsdorf im Landkreis Coburg."},{"page_url":"https://en.wikipedia.org/wiki/Diaporthe","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ee/Diaporthe_phaseolorum_var._sojae.jpg","page_title":"Diaporthe","context_page_description":"Diaporthe is a genus of endophytic filamentous fungal plant pathogens.\\nDiaporthe species have been shown to transform the infection-inhibiting factors-catechin and-epicatechin into the 3,4-cis-dihydroxyflavan derivatives.\\nSome species, like Diaporthe toxica, produce secondary metabolites that result in toxicoses of animals such as lupinosis of sheep."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%84%E0%B8%A3%E0%B8%B4%E0%B8%AA_%E0%B9%80%E0%B8%88%E0%B8%A3%E0%B8%B4%E0%B9%82%E0%B8%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Chris_Jericho_unificed.jpg","page_title":"คริส เจริโค","context_page_description":"คริสโตเฟอร์ คีท เออร์วิน เกิดวันที่ 9 พฤศจิกายน ค.ศ. 1970 นักมวยปล้ำอาชีพชาวแคนาดา แต่เกิดที่สหรัฐอเมริกา เซ็นสัญญาปล้ำกับ WWE ในชื่อที่รู้จักกันดี คริส เจริโค เป็นทั้งนักร้องนำของวงฟอซซี และเป็นนักแสดงทางโทรทัศน์, ละครเวที อีกทั้งยังเป็นเจ้าของ สถานีวิทยุ และโทรทัศน์ อีกด้วย นอกจากนี้ยังเป็นที่รู้จักกันดีในฐานะนักมวยปล้ำของสมาคม WCW และ ECW และเขายังปล้ำให้กับสมาคมนานาประเทศอย่าง แคนาดา, เม็กซิโก และญี่ปุ่น อีกด้วย และเป็นหนึ่งในผู้แข่งขันในปี 2011 ประเภทเต้นรำในรายการแดนซิ่งวิชเดอะสตาร์ส ซีซั่น 12 และได้ถูกโหวตออกในสัปดาห์ที่ 5"},{"page_url":"https://ro.wikipedia.org/wiki/Cei_%C8%99apte_samurai","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Dostoevskij_1876.jpg","page_title":"Cei șapte samurai","context_page_description":"Cei șapte samurai este un film epic japonez din 1954, regizat și montat de Akira Kurosawa, după un scenariu scris de cineast în colaborare cu Shinobu Hashimoto și Hideo Oguni. Acțiunea filmului are loc în anul 1586, în perioada Azuchi-Momoyama a istoriei Japoniei, când țara era devastată de un îndelungat război civil între diferitele clanuri feudale.\\nAcest film aparține celei mai înfloritoare epoci a cinematografiei japoneze, care a început după sfârșitul celui de-al Doilea Război Mondial. Cinematografia japoneză începuse să fie cunoscută lumii occidentale cu puțin timp înaintea apariției filmului Cei șapte samurai, iar filme ca Rashomon al lui Akira Kurosawa, Viața curtezanei Oharu, Povestirile lunii palide după ploaie și Guvernatorul Sansho ale lui Kenji Mizoguchi și Poarta infernului al lui Teinosuke Kinugasa obținuseră premii internaționale prestigioase. Cinci companii cinematografice majore activau în Japonia în acei ani: Toho, Shochiku, Daiei, Shintoho și Toei. Alături de Kenji Mizoguchi și Yasujirō Ozu, Kurosawa reprezintă unul dintre stâlpii cinematografiei japoneze din anii 1950, care și-au pus amprenta asupra dezvoltării acestei arte în Japonia."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%98%A4%EC%B4%88%EC%B9%A0%EA%B5%AD%EC%9D%98_%EB%82%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Rebellion_of_the_Seven_States.png","page_title":"오초칠국의 난","context_page_description":"오초칠국의 난은 전한 경제 치세인 기원전 154년 전한의 제후국 오나라의 왕 유비가 주축이 되어 조·교서·초·교동·치천·제남 여섯 나라와 함께 전한 중앙 정부에 일으킨 반란이다. 경제는 어사대부 조조의 과격한 정책을 실행해 제후왕의 죄를 빌미로 조·교서·초나라의 봉토를 삭감했다. 마침내 오나라에도 봉토를 삭감하려 하자, 자신에게 화가 미칠 것을 두려워한 유비는 초·교서·조나라의 제후왕과 공모하여 황제 측근의 간신인 조조를 칠 것을 구실로 선수를 쳐서 군사를 일으켰다.\\n이 제후왕의 반란은 태위 주아부가 거느린 정부군의 교묘한 전략에 의해 오왕은 살해당하고, 오와 공모한 제후왕도 모두 살해당하여 전란은 불과 3개월 만에 평정되었다. 이 싸움에서 한의 조정이 승리를 거둔 것은 제후왕에 대한 조정의 우위를 결정지어 황제의 권력을 강화하게 되었다. 그런 점에서 전한 초기의 정치사상 오초칠국의 난의 평정이 지닌 의의는 크다고 할 수 있다."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AF%DB%8C%D8%B3%D9%86%D9%88%D9%81%D8%A7%D9%86","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6d/Karte_Gemeinde_Diessenhofen_2011.png","page_title":"دیسنوفان","context_page_description":"شهر دیسنوفان در بخش دیسنوفان در ایالت تورگو در کشور سوئیس واقع شده‌است که ۳٬۱۰۰ نفر جمعیت دارد."},{"page_url":"https://de.wikipedia.org/wiki/Bayerische_Staatsbibliothek","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Bamberg_Neue_Residenz.jpg","page_title":"Bayerische Staatsbibliothek","context_page_description":"Die Bayerische Staatsbibliothek in München ist die zentrale Universal- und Landesbibliothek des Freistaats Bayern und eine der bedeutendsten europäischen Forschungs- und Universalbibliotheken mit internationalem Rang. Ihr Medienbestand beläuft sich auf etwa 33,92 Millionen Medien; damit ist sie die größte Universal- und Forschungsbibliothek Deutschlands. Darüber hinaus verfügt sie in ihrem Altbestand über eine der wichtigsten Handschriftensammlungen der Welt, die umfangreichste Sammlung von Inkunabeln in Deutschland, eine der umfangreichsten und wichtigsten Zeitschriftenbibliotheken Europas sowie zahlreiche weitere bedeutende Sondersammlungen, darunter mit knapp 17,3 Millionen Fotos das größte deutsche Bildarchiv in öffentlicher Trägerschaft. Mit ihrem Medienbestand ist die 1558 als Hofbibliothek gegründete Staatsbibliothek heute eine der größten und bedeutendsten Gedächtnisinstitutionen Europas.\\nSeit 1663 existiert ein Pflichtexemplar­recht, das heißt, dass von jedem in Bayern erscheinenden Druckwerk zwei Exemplare an die Bayerische Staatsbibliothek abgeliefert werden müssen."},{"page_url":"https://da.wikipedia.org/wiki/Hugorm","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/ViperaBerusFang.JPG","page_title":"Hugorm","context_page_description":"Hugormen er en kraftig slange med gråbrun bundfarve, mørkt hoved, mørke øjenstriber og siksakformet rygmønster. Hannernes rygmønster er sort. Der findes også ensfarvede hugorme, og den sikreste måde at kende forskel på hugormen og den anden danske slange – den ufarlige snog – er ved at finde de gule nakkepletter. Hugormen har aldrig gule nakkepletter, mens snogen næsten altid har to store gule pletter øverst på nakken lige bag øjnene.\\nLigesom hos snogen bliver hannerne ikke så lange som hunnerne. En han-hugorm kan måle ca. 60-80 cm, hunner kan måle op til 80-105 cm. Den hidtil længste hugorm i Danmark målte 82 cm, mens rekorden for en snog er på omkring halvanden meter. Den lever af mus, fugleunger, frøer, firben og lignende, men ligger i dvale fra oktober til marts. Ved temperaturer under ca. ti grader er den for sløv til at hugge. En hugorm kan blive ca. 10 år gammel. Der findes dog optegnelser på hugorme fra fangenskab, der er blevet endnu ældre. I naturen er gennemsnitsalderen for en hugorm næppe mere end 4-6 år.\\nHugormen har siden 1981 været totalfredet, og i dag er det forbudt at indsamle, aflive eller flytte hugorme."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B0%D0%B1%D0%B0_(%D0%B3%D0%BE%D1%80%D0%B0,_%D0%A2%D1%83%D1%80%D1%86%D0%B8%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Paragliding_near_Parascending%2C_Oludeniz%2C_Turkey_05-2004.jpg","page_title":"Баба (гора, Турция)","context_page_description":"Баба — гора рядом с городом Фетхие в провинции Мугла, на юго-западе Турции.\\nГора имеет основной пик высотой 1969 м. Второй пик, называемый Каратепе, имеет высоту 1400 м. Эти две вершины разделены долиной, поэтому Бабадаг также иногда называют горным хребтом. Гора сложена преимущественно известняком. На её склонах произрастают разнообразные растения, в том числе эндемик Acer undulatum и леса ливанского кедра.\\nВершина также отличается близостью к морю. Это один из факторов, который делает её особенно подходящим и популярным местом для полётов на параплане."},{"page_url":"https://it.wikipedia.org/wiki/Fort_Denison","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/eb/Fort_Denison_1.JPG","page_title":"Fort Denison","context_page_description":"Fort Denison è una piccola fortezza del secolo XIX che occupa l'intera superficie dell'isola di Pinchgut, nell'insenatura di Port Jackson a Sydney, in Australia. La struttura comprende una \\"Torre Martello\\", l'unica costruita in Australia, ed un faro."},{"page_url":"https://sco.wikipedia.org/wiki/Sigismund_II_Augustus","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Sigismundus_Augustus_Rex.PNG","page_title":"Sigismund II Augustus","context_page_description":"Sigismund II Augustus I wis King o Poland an Grand Duke o Lithuanie, the anly son o Sigismund I the Auld, whom Sigismund II succeedit in 1548."},{"page_url":"https://es.wikipedia.org/wiki/Konstantinos_Galanopoulos","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/DK-AEK_%287%29_%28cropped%29.jpg","page_title":"Konstantinos Galanopoulos","context_page_description":"Konstantinos Galanopoulos es un futbolista griego que juega en la demarcación de centrocampista para el AEK Athens FC de la Superliga de Grecia."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Burg_im_Leimental","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5c/Karte_Gemeinde_Burg_im_Leimental_2007.png","page_title":"Burg im Leimental","context_page_description":"Burg im Leimental sī Sūi-se Basel-Landschaft Chiu Laufen Koān ê chi̍t ê chū-tī-thé."},{"page_url":"https://de.wikipedia.org/wiki/Chase_County_(Kansas)","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/08/USA_Chase_County%2C_Kansas_age_pyramid.svg","page_title":"Chase County (Kansas)","context_page_description":"Chase County ist ein County im Bundesstaat Kansas der Vereinigten Staaten. Der Verwaltungssitz ist Cottonwood Falls."},{"page_url":"https://it.wikipedia.org/wiki/Germi_(circoscrizione_elettorale)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Germi_Constituency.png","page_title":"Germi (circoscrizione elettorale)","context_page_description":"La Circoscrizione di Germi è un collegio elettorale iraniano istituito per l'elezione dell'Assemblea consultiva islamica."},{"page_url":"https://en.wikipedia.org/wiki/John_W._Jones_House","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5f/John_W_Jones_House_4.jpg","page_title":"John W. Jones House","context_page_description":"The John W. Jones House currently stands at 1250 Davis Street, Elmira, New York, across from a historic entrance to Woodlawn Cemetery. It is the former home of John W. Jones and current home of the John W. Jones Museum. It stands on part of its original property, though it originally faced College Avenue. Historically, the house was the private residence of John W. Jones and his family, but changed ownership several times since, and was used as rental property that fell into disrepair. Condemned by the City of Elmira in 1997, Lucy Brown brought it to the public's attention and with a group of concerned citizens, saved it from demolition. It is now the home to the John W. Jones Museum."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%B9%D0%BC%D0%BE%D1%80%D0%B5_%D0%9C%D0%BE%D1%80%D0%B5%D0%B9%D1%80%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Aymor%C3%A9_Moreira_%281963%29.png","page_title":"Айморе Морейра","context_page_description":"Айморе Морейра — бразильський футболіст, що грав на позиції флангового півзахисника, воротаря. По завершенні ігрової кар'єри — тренер, найбільш відомий роботою з національною збірною Бразилії, яка під його керівництвом виграла чемпіонату світу 1962 року.\\nВиступав, зокрема, за клуби «Палестра-Італія» та «Ботафогу», а також національну збірну Бразилії.\\nДворазовий переможець Ліги Пауліста. Переможець Ліги Каріока. Володар Кубка Бразилії. Переможець Ліги Пауліста."},{"page_url":"https://nl.wikipedia.org/wiki/Mo%C5%A1nov","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/OSRintl.jpg","page_title":"Mošnov","context_page_description":"Mošnov is een Tsjechische gemeente in de regio Moravië-Silezië, en maakt deel uit van het district Nový Jičín.\\nMošnov telt 676 inwoners."},{"page_url":"https://ceb.wikipedia.org/wiki/Cantherhines_dumerilii","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Cantherhines_dumerili.jpg","page_title":"Cantherhines dumerilii","context_page_description":"Espesye sa isda nga una nga gihulagway ni Hollard ni adtong 1854 ang Cantherhines dumerilii. Ang Cantherhines dumerilii sakop sa kahenera nga Cantherhines sa kabanay nga Monacanthidae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%82%98%EA%B0%80%EB%A0%88%EC%95%BC%EB%A7%88%EC%98%A4%ED%83%80%EC%B9%B4%EB%85%B8%EB%AA%A8%EB%A6%AC_%EC%97%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Nagareyama-Otakanomori-station-TX-ticket-gates.jpg","page_title":"나가레야마오타카노모리 역","context_page_description":"나가레야마오타카노모리 역은 일본 지바현 나가레야마시에 있는 철도역이다."},{"page_url":"https://en.wikipedia.org/wiki/Sebasti%C3%A1n_Alarc%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Alarcon%2C_Sebastian_-2012_f01.JPG","page_title":"Sebastián Alarcón","context_page_description":"Sebastián Alarcón was a Chilean film director and screenwriter. His 1977 film Night Over Chile won the Special Prize at the 10th Moscow International Film Festival. In 2008 he was a member of the jury at the 30th Moscow International Film Festival."},{"page_url":"https://vi.wikipedia.org/wiki/M%C3%B9a_b%C3%A3o_B%E1%BA%AFc_%C4%90%E1%BA%A1i_T%C3%A2y_D%C6%B0%C6%A1ng_2019","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Karen_2019-09-24_1800Z.jpg","page_title":"Mùa bão Bắc Đại Tây Dương 2019","context_page_description":"Mùa bão Bắc Đại Tây Dương 2019 là một sự kiện mà theo đó, các xoáy thuận nhiệt đới/cận nhiệt đới hình thành ở Đại Tây Dương, phía Bắc xích đạo trong năm 2019. Hằng năm mùa bão chủ yếu diễn ra từ khoảng tháng 6 đến tháng 11, trong đó các xoáy thuận nhiệt đới tập trung nhiều nhất vào tháng 9 do môi trường rất thuận lợi như nhiệt độ nước biển nóng nhất trong năm, gió cắt yếu... Có rất ít xoáy thuận nhiệt đới hình thành trong khoảng thời gian từ tháng 12 đến tháng 5 tại đây do môi trường bất lợi để bão có thể phát triển. Mùa bão năm 2019 chính thức bắt đầu bằng sự hình thành của cơn bão cận nhiệt đới Andrea vào ngày 20 tháng 5, đánh dấu năm thứ năm liên tiếp một cơn bão nhiệt đới hoặc cận nhiệt đới phát triển trước khi bắt đầu mùa chính thức, phá vỡ kỷ lục bốn năm trước đó được thiết lập từ năm 1951 đến 1954. Đây cũng là năm thứ hai liên tiếp không có cơn bão nào hình thành trong tháng Sáu."},{"page_url":"https://nl.wikipedia.org/wiki/Hartklep","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Heart_numlabels.svg","page_title":"Hartklep","context_page_description":"Het hart bevat verschillende hartkleppen ter voorkoming van het terugstromen van het bloed. Om deze functie te vervullen, kunnen de kleppen de bloedstroom tussen de hartboezems en de hartkamers, en tussen de hartkamers en de slagaders, afsluiten. De kleppen bestaan uit materiaal van het endocard, de eerste laag van de hartwand.\\nDe geluiden die het hart produceert, stammen van de hartkleppen."},{"page_url":"https://en.wikipedia.org/wiki/List_of_lighthouses_in_China","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Bo%27ao_Lighthouse_in_Hainan.jpg","page_title":"List of lighthouses in China","context_page_description":"This is a list of lighthouses in China which includes the two special administrative regions of Hong Kong, and Macau."},{"page_url":"https://en.wikipedia.org/wiki/Charles_Jervas","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Thomas_Carter_Master_of_the_Rolls.jpg","page_title":"Charles Jervas","context_page_description":"Charles Jervas was an Irish portrait painter, translator, and art collector of the early 18th century."},{"page_url":"https://en.wikipedia.org/wiki/Pud_Galvin","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/PudGalvin.jpg","page_title":"Pud Galvin","context_page_description":"James Francis \\"Pud\\" Galvin was an American Major League Baseball pitcher in the 19th century. He was MLB's first 300-game winner and was inducted into the Baseball Hall of Fame in 1965."},{"page_url":"https://es.wikipedia.org/wiki/Villa_Real_(Mil%C3%A1n)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Villa_reale%2C_Milano_-_Andrea_Appiani_%281754%E2%80%931817%29%2C_il_Parnaso%2C_Apollo_e_le_Muse_%28Carlo_Dell%27Orto%29_19.JPG","page_title":"Villa Real (Milán)","context_page_description":"La Villa Real de Milán, es una villa construida entre 1790 y 1796 por el arquitecto Leopoldo Pollack por encargo del conde Ludovico Barbiano di Belgiojoso.​ La parte posterior del edificio, donde está la entrada a la Galería de Arte Moderno de Milán, da hacia la Via Palestro, por tanto hacia los Jardines Indro Montanelli, en la zona de Porta Venezia. La fachada principal de la villa se dirige hacia el jardín de estilo inglés, también diseñado por Leopoldo Pollack.\\nLa Villa Real de Milán constituye uno de los principales monumentos del neoclasicismo milanés. Entre las obras neoclásicas presentes en la villa se encuentran las de Luigi Acquisti y Antonio Canova."},{"page_url":"https://fi.wikipedia.org/wiki/Libanonin_punta","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/500_Lebanese_Pounds_-_Minted_2009_-_Backside.jpg","page_title":"Libanonin punta","context_page_description":"Libanonin punta on Libanonin rahayksikkö, joka on ollut käytössä vuodesta 1924 lähtien. Tuota ennen Libanonissa käytössä olivat vuorollaan niin Egyptin punta kuin Syyrian puntakin. Libanonin punta jakaantuu 100 piastreen."},{"page_url":"https://vi.wikipedia.org/wiki/Th%C6%B0_vi%E1%BB%87n_Jagiello%C5%84ska","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/De_revolutionibus_orbium_coelestium.jpg","page_title":"Thư viện Jagiellońska","context_page_description":"Thư viện Jagiellonia là thư viện của Đại học Jagiellonia ở Kraków và với gần 6.7 triệu đầu sách, đây là một trong những thư viện lớn nhất Ba Lan, được phục vụ như một thư viện công cộng, thư viện trường đại học và là một phần của hệ thống thư viện quốc gia Ba Lan. Thư viện có một bộ sưu tập lớn các thủ bản Thời kỳ Trung Cổ, chẳng hạn như De Revolutionibus của Copernicus' và Banderia Prutenorum của Jan Długosz, và một bộ sưu tập lớn khác của văn học underground từ thời kỳ Cộng hòa Nhân dân Ba Lan. Thư viện Jagiellonia còn chứa trong mình bộ sưu tập nghệ thuật Berlinka mà tư cách pháp nhân của nó đang bị tranh chấp với nước Đức."},{"page_url":"https://es.wikipedia.org/wiki/Cartuja_de_Marienau","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Carthusian_cloister_monks_cell_%28Marienau%29_2006-01-06.png","page_title":"Cartuja de Marienau","context_page_description":"La Cartuja de Marienau es un monasterio de la Orden de los Cartujos, continuación de la desaparecida Cartuja de Maria Hain en Düsseldorf, localizada desde 1964 cerca de Bad Wurzach, distrito de Ravensburg, en Baden-Württemberg. Es el único monasterio cartujo de Alemania.​"},{"page_url":"https://he.wikipedia.org/wiki/%D7%9C%D7%99%D7%98%D7%90_%D7%91%D7%9E%D7%A9%D7%97%D7%A7%D7%99%D7%9D_%D7%94%D7%90%D7%95%D7%9C%D7%99%D7%9E%D7%A4%D7%99%D7%99%D7%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Aurimas_Did%C5%BEbalis_Rio_2016b.jpg","page_title":"ליטא במשחקים האולימפיים","context_page_description":"ליטא השתתפה בכל המשחקים האולימפיים מאז הכריזה על עצמאותה ב-1991. עוד קודם לכן, השתתפה בשתי אולימפיאדות בתקופה הקצרה בה הייתה מדינה עצמאית בין שתי מלחמות העולם, אולימפיאדת פריז ואולימפיאדת אמסטרדם. בין 1952 ל-1988 התחרו ספורטאים ליטאים במסגרת משלחת ברית המועצות. בשש האולימפיאדות שנערכו מאז אולימפיאדת ברצלונה, זכו הספורטאים הליטאים ב-25 מדליות ב-12 ענפים שונים, מהן שש מדליות זהב. הענפים בהם התבלטה ליטא במיוחד הם אתלטיקה, כדורסל וקרב חמש מודרני.\\nליטא השתתפה גם בכל אולימפיאדות החורף שנערכו מאז אולימפיאדת אלברוויל, וכן באולימפיאדת סנט מוריץ. עד כה, לא זכו ספורטאים ליטאים במדליות באולימפיאדות בחורף."},{"page_url":"https://pl.wikipedia.org/wiki/Eparchia_mo%C5%82odecza%C5%84ska","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/%D0%9C%D0%B0%D0%BB%D0%B0%D0%B4%D0%B7%D0%B5%D1%87%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B5%D0%BF%D0%B0%D1%80%D1%85%D1%96%D1%8F_%D0%91%D0%9F%D0%A6.svg","page_title":"Eparchia mołodeczańska","context_page_description":"Eparchia mołodeczańska – jedna z eparchii Egzarchatu Białoruskiego Patriarchatu Moskiewskiego, z siedzibą w Mołodecznie. Należy do metropolii mińskiej."},{"page_url":"https://fr.wikipedia.org/wiki/Gaustatoppen","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Gaustatoppen_peak.jpg","page_title":"Gaustatoppen","context_page_description":"Le Gaustatoppen est le point culminant du comté de Vestfold og Telemark en Norvège. C'est aussi le huitième plus haut sommet du pays avec 1 883 m d'altitude."},{"page_url":"https://pl.wikipedia.org/wiki/%C5%81abu%C5%84ka","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Labunkarzeka.jpg","page_title":"Łabuńka","context_page_description":"Łabuńka – rzeka, prawy dopływ Wieprza o długości 37,09 km i powierzchni zlewni 557,5 km².\\nRzeka wypływa ze źródeł na Roztoczu Środkowym położonych na północ od wsi Łabunie. Płynie przez Roztocze i Wyżynę Lubelską, w województwie lubelskim. Do Wieprza uchodzi we wsi Ruskie Piaski, około 15 km od Zamościa. Łabuńka jest najszersza w Zamościu – około 7 m, przy ujściu ma szerokość około 5 m. Największa głębokość – 4 m. W Zamościu Łabuńka jest otoczona szczelnymi wałami przeciwpowodziowymi. Na odcinku Zamość-Nielisz pięknie meandruje tworząc liczne mokradła i starorzecza.\\nJej lewymi dopływami są Topornica, Świnia oraz Pniowski Rów, a prawymi Czarny Potok i Farens. Posiada także jeden bezimienny dopływ wypływający z okolicy Starego Zamościa o długości ok. 7 km."},{"page_url":"https://de.wikipedia.org/wiki/Bachta_(Fluss)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Rekabahta.JPG","page_title":"Bachta (Fluss)","context_page_description":"Die Bachta ist ein rechter Nebenfluss des Jenissei in der Region Krasnojarsk in Sibirien.\\nDie Bachta entspringt im Westen des Mittelsibirischen Berglands.\\nSie verläuft anfangs überwiegend in nordwestlicher, im Unterlauf dann in südsüdwestlicher Richtung. Nach 498 km mündet die Bachta nahe der gleichnamigen Siedlung Bachta rechtsseitig in den Jenissei. Das 35.500 km² große Einzugsgebiet der Bachta erstreckt sich zwischen der nördlich verlaufenden Unteren Tunguska und der südlich verlaufenden Steinigen Tunguska. Zwischen Mitte Oktober und Mitte Mai ist der Fluss üblicherweise eisbedeckt. Der Unterlauf der Bachta ist schiffbar."},{"page_url":"https://pt.wikipedia.org/wiki/Bastian_Schweinsteiger","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Bastian_Schweinsteiger_2007-12-15.jpg","page_title":"Bastian Schweinsteiger","context_page_description":"Bastian Schweinsteiger é um ex-futebolista alemão que atuava como meio-campista. Seu último clube foi o Chicago Fire, da MLS.\\nEstreou no time principal do Bayern de Munique aos dezoito anos de idade. Outrora um meia-direito, sob o comando de Louis van Gaal, Schweinsteiger foi implantado numa função mais centralizada, evoluindo ainda mais como jogador. Hoje, é considerado por muitos especialistas um dos melhores jogadores do mundo em sua posição. No Bayern, conquistou cinco \\"dobradinhas\\" em temporadas consecutivas. Pela Seleção Alemã passou a ter uma importância ainda maior após a aposentadoria de Michael Ballack, de quem praticamente herdou posição.\\nA sua transformação pode ser comparada a de outros dois grandes jogadores que se tornaram referência em suas equipes quando passaram a jogar mais recuados, tendo a missão de comandar o time de trás: Freddy Rincón e Andrea Pirlo. O italiano quando chegou ao Milan em 2001, ouviu do técnico Carlo Ancelotti a sugestão para jogar mais recuado e organizar a saída de bola. Ele aceitou, e não demorou a ser reconhecido."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%A8%D0%B0%D2%9B%D1%8B%D0%BB%D0%B4%D0%B0%D2%9B%D1%82%D0%B0%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Ochotona_princeps.jpg","page_title":"Шақылдақтар","context_page_description":"Шақылдақтар — қоянтәрізділер отрядының тұқымдасы.\\nШақылдақтар Оңтүстік-Шығыс Еуропа, Азия, Солтүстік Америкада мекендейтін 18 — 20 түрі бар. Қазақстанда 5 түрі кездеседі, олар республиканың барлық аймақтарындағы далалы, шөлейтті, шөлді, кейде тіпті таулы аймақтарға дейін таралған.\\nДене тұрқы 23 — 25 см, салм. 100 — 300 г. Аяқтары қысқа, алдыңғы және артқы аяқтарының ұзындықтары бірдей. Құлақ қалқаны кішкентай, дөңгеленген. Құйрығы түгінен көрінбейді. Реңі жыл маусымдарына қарай өзгеріп тұрады: жазда — жұқа, қоңыр сұр, қоңыр қызыл, ашық сары не сарғыш; қыста — қалың, ақшылдау болады. Шақылдақтар ашық жазықта, бұталар мен шөптесін өсімдіктер арасында, таулы жерлерде 3000 м биіктікке дейін қоныстанады. Тастар мен қорымдар арасындағы қуыстар мен жарықшақтарда, басқа кеміргіштердің бос індерінде тұрақты тіршілік етеді. Жиі топтанып шоғыр құрады. Бұлардың дыбыс беру қабілеті өте жақсы жетілген. Күндіз белсенді, қысқы ұйқыға жатпайды. өсімдіктердің 100-ге жуық түрімен қоректенеді. Қысқа қарай азық қорын жинайды, өсімдіктерді кептіріп, кейде салмағы 27 кг-дай шөмеле салады. Жыныстық жағынан аталығы мен аналығы 8 — 11 айда жетіледі."},{"page_url":"https://fr.wikipedia.org/wiki/Andr%C3%A9_Campana_(athl%C3%A9tisme)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Andr%C3%A9_Campana_1913.jpg","page_title":"André Campana (athlétisme)","context_page_description":"André Campana, né le 21 mai 1886 à Paris et mort le 12 novembre 1931 à Paris, est un athlète français, spécialiste du saut en longueur."},{"page_url":"https://zh.wikipedia.org/zh-my/%E5%AF%8C%E8%B1%AA%E9%9B%AA%E7%B3%95","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e6/HK_MisterSoftee_VictoriaPark.JPG","page_title":"富豪雪糕","context_page_description":"富豪雪糕是一家在美国东北部非常著名的雪糕公司，利用设有冰箱的卡车贩卖雪糕。"},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B8%AD%E6%B2%B3_(%E6%9D%AD%E5%B7%9E)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Middle_River_Bridges_3.jpg","page_title":"中河 (杭州)","context_page_description":"中河，位于中国浙江省杭州市上城区、下城区境内，南起钱塘江边闸口小桥的双向泵房，北由新横河过新坝注入中河，全程约10千米。今天的中河为古代盐桥河、龙山河、新横河的合称，盐桥河和龙山河的起源众说纷纭，最早可以追溯到唐代，而新横河为晚清开凿以沟通中、东、西三河的河道。杭州中河-龙山河是世界文化遗产大运河杭州段的11处遗产点之一，中河南段古桥及古泉也被列入杭州市文物保护单位。"},{"page_url":"https://arz.wikipedia.org/wiki/%D9%85%D9%8A%D9%87%D8%A7%D9%8A%D9%84%D9%8A%D9%86%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/RO_HR_Mihaileni_%2814%29.jpg","page_title":"ميهايلينى","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nميهايلينى, قريه فى رومانيا."},{"page_url":"https://en.wikipedia.org/wiki/Belize_Bird_Rescue","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Pond_with_egrets.jpg","page_title":"Belize Bird Rescue","context_page_description":"Belize Bird Rescue is an avian rescue and rehabilitation centre in Belize.\\nIt is a non-governmental and non-profit organization, and is Belize's only multi-species avian rescue and rehabilitation centre. It operates wholly within Belize under license and support from the Government of Belize Forest Department. The main focus of the organisation is the rehabilitation for release of wild-caught psittacines liberated from the illegal local pet trade. As of July 2017, Belize Bird Rescue has returned more than 450 ex-captive parrots to the wild. Additionally, the organisation rescues and rehabilitates injured and orphaned resident and migratory birds of all species, and provides sanctuary or long-term care for non-releasable birds.\\nBBR works in close cooperation with the Government of Belize Forest Department and with other NGOs and non-profit organisations in Belize including the Toledo Institute for Environment and Development, Programme for Belize, Belize Bird Conservancy and the Belize Audubon Society.\\nBBR's work includes the rehabilitation of parrots, songbirds, raptors and waterbirds for release."},{"page_url":"https://be.wikipedia.org/wiki/%D0%9E%D1%82%D0%B0_%D0%9F%D0%B0%D1%9E%D0%BB%D1%8C_%D0%93%D0%B5%D1%80%D0%BC%D0%B0%D0%BD_%D0%94%D0%B7%D1%96%D0%BB%D1%8C%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Otto_Paul_Hermann_Diels.jpg","page_title":"Ота Паўль Герман Дзільс","context_page_description":"Ота Паўль Герман Дзільс — нямецкі хімік-арганік."},{"page_url":"https://vi.wikipedia.org/wiki/Conus_sulcatus","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Conus_sulcatus_1.jpg","page_title":"Conus sulcatus","context_page_description":"Conus sulcatus là một loài ốc biển, là động vật thân mềm chân bụng sống ở biển trong họ Conidae, họ ốc cối.\\nGiống như tất cả các loài thuộc chi Conus, chúng là loài săn mồi và có nọc độc. Chúng có khả năng \\"đốt\\" con người, do vậy khi cầm chúng phải hết sức cẩn thận."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D1%80%D0%BE%D0%B4%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%92%D0%B0%D0%B4%D0%B8%D0%BC_%D0%90%D0%B4%D0%BE%D0%BB%D1%8C%D1%84%D0%BE%D0%B2%D0%B8%D1%87","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c1/JKRUK_20080705_VADIM_BRODSKI_PINCZOW_DSC02030.jpg","page_title":"Бродський Вадим Адольфович","context_page_description":"Вадим Адольфович Бродський — український радянський та італійський скрипаль."},{"page_url":"https://tr.wikipedia.org/wiki/Zehdenick","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Wappen_Zehdenick.png","page_title":"Zehdenick","context_page_description":"Zehdenick, Almanya'nın Brandenburg eyaletinde yer alan bir şehirdir. Şehrin nüfusu 31 Aralık 2010 sayımlarına göre 13,830 kişidir."},{"page_url":"https://fr.wikipedia.org/wiki/Le_Tr%C3%A9sor_de_Tarzan","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Tarzan%27s_Secret_Treasure_lobby_card.jpg","page_title":"Le Trésor de Tarzan","context_page_description":"Le Trésor de Tarzan est un film américain réalisé par Richard Thorpe, sorti en 1941."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%BE%D0%BB%D0%B8%D1%86%D1%8B%D0%BD,_%D0%94%D0%BC%D0%B8%D1%82%D1%80%D0%B8%D0%B9_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Tatyana_Golitsyna_by_Reichel.jpg","page_title":"Голицын, Дмитрий Владимирович","context_page_description":"Светлейший князь Дми́трий Влади́мирович Голи́цын — военный деятель Наполеоновских войн, который в течение почти четверти века осуществлял управление Москвой."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%81%D8%B1%D9%88%D8%AF%DA%AF%D8%A7%D9%87_%D9%88%DB%8C%D9%86%D8%AA%D8%B1_%D9%87%D9%88%D9%86%D8%AA%D8%B2_%DA%AF%DB%8C%D9%84%D8%A8%D8%B1%D8%AA","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/ff/Winter_Haven%27s_Gilbert_Airport_FL_30_Jan_1999.jpg","page_title":"فرودگاه وینتر هونتز گیلبرت","context_page_description":"فرودگاه وینتر هونتز گیلبرت یک فرودگاه همگانی باربری با کد یاتا GIF است که یک باند فرود آسفالت دارد و طول باند آن ۱۵۲۶ متر است. این فرودگاه در کشور ایالات متحده آمریکا قرار دارد و در ارتفاع ۴۴ متری از سطح دریا واقع شده است."},{"page_url":"https://pt.wikipedia.org/wiki/Cream_cracker","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/RitzCrackers.jpg","page_title":"Cream cracker","context_page_description":"A cream cracker ou aportuguesado como creme-craque é uma bolacha fina feita usualmente de massa de farinha de trigo não fermentada. Podem ser acrescentados temperos e especiarias como sal, ervas, sementes e queijo antes do cozimento. É um alimento nutritivo e de consumo imediato, mas tem a vantagem de poder ser armazenado por um longo tempo. Antecessores do cream cracker foram as bolachas dos marinheiros e soldados, e as hóstias. Pães achatados, como o lavash, chapati, pita, matzo, flatbrød ou knäckebröd, também fazem parte do mesmo grupo de alimentos.\\nA cream cracker difere levemente da bolacha água e sal, pois esta última não se utiliza de nenhuma gordura na receita original, ao contrário da cream cracker, que leva o óleo de palma. O formato de ambas, contudo, pode ser bastante similar."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BF%D5%A1%D6%80%D5%AC_%D5%8C%D5%AB%D5%BF%D5%BF%D5%A5%D6%80","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ac/Carl_ritter.jpg","page_title":"Կարլ Ռիտտեր","context_page_description":"Կարլ Ռիտտեր, գերմանացի աշխարհագրագետ։ Բեռլինի համալսարանի պրոֆեսոր, Պրուսական ԳԱ անդամ, Պետերբուրգի ԳԱ արտասահմանյան պատվավոր անդամ ։ «Erdkunde» աշխատության մեջ զարգացրել և պրոպագանդել է համեմատական մեթոդը աշխարհագրության մեջ։\\nՌիտտերի կենդանության ժամանակ լույս են տեսել նրա 19 հատոր աշխատությունները՝ նվիրված Ասիայի և Աֆրիկայի երկրներին։ Հասարակական երևույթները բացատրելիս։ Ռիտտեր հետևել է աշխարհագրական դետերմինիզմին։ Ռիտտեր փորձել է ապացուցել բնության որոշիչ ազդեցությունը ժողովուրդների ճակատագրի վրա, «հիմնավորել» եվրոպական ժողովուրդների աշխարհում գերիշխելու իրավունքը, որը նպաստել է գեոպոիտիկայի ձևավորմանը։"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B0%D0%BC%D1%8F%D1%82%D0%BD%D1%8B%D0%B5_%D0%BC%D0%BE%D0%BD%D0%B5%D1%82%D1%8B_%D0%A4%D0%A0%D0%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Hamburg_VS.JPG","page_title":"Памятные монеты ФРГ","context_page_description":"Статья содержит информацию о памятных монетах Немецкого федерального банка, выпущенных в период с 1949 по 2001 год.\\nНемецкая марка была введена в обращение 20 июня 1948 года в американо-британско-французской зоне оккупации Германии. После образования в сентябре 1949 года Федеративной Республики Германии немецкая марка стала её денежной единицей. Чеканка монет немецкой марки была начата в 1948 году, а чеканка памятных монет — в 1953 году.\\nВ ФРГ с 1953 по 2001 год были выпущены 87 памятных монет. Эти монеты выпускались с высоким содержанием серебра или из медно-никелевого сплава. Качество монет анциркулейтед и пруф.\\nПервые пять памятных монет были выпущены в течение 14 лет. Они вышли очень небольшим тиражом и являются наиболее востребованными у коллекционеров, собирающих немецкие памятные марки. Из-за редкости этих монет существуют различные законные имитации, но такие монеты не имеют ценности для нумизматов.\\nВ последующие 34 года монеты выпускались практически каждый год. Монета с портретом Лейбница вышла уже тиражом два миллиона экземпляров. Стоит отметить, что в 1990 году после присоединения ГДР тираж не был увеличен, хотя увеличилось население Германии."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B0%D0%B9%D0%BA%D0%B0_%D1%84%D0%B8%D0%BE%D0%BB%D0%B5%D1%82%D0%BE%D0%B2%D0%B0%D1%8F","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5b/Oleica20120502.jpg","page_title":"Майка фиолетовая","context_page_description":"Ма́йка фиоле́товая, или майка синяя, — вид жуков-нарывников из подсемейства Meloinae. Распространён от Центральной и Южной Европы через Казахстан и Сибирь до Приморья, а также на Кавказе, в Иране, Средней Азии и Афганистане. Обитает в различных биотопах — от пустынь до гор, хотя более обилен в остепнённых склонах предгорий. Взрослые особи питаются на клевере, одуванчике, анемоне, лютике, феруле тонкорассечённой. Иногда вредительствует сельскохозяйственным культурам. Личинки — паразиты пчёл Andrena, Antophora, Panurgus. Длина тела имаго 10—32 мм."},{"page_url":"https://sv.wikipedia.org/wiki/Broddetorps_kyrka","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Broddetorp1.jpg","page_title":"Broddetorps kyrka","context_page_description":"Broddetorps kyrka är en kyrkobyggnad i Hornborga församling i Skara stift. Den ligger i Broddetorp i norra delen av Falköpings kommun."},{"page_url":"https://it.wikipedia.org/wiki/Moschea_di_Ortak%C3%B6y","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/B%C3%BCy%C3%BCk_Mecidiye_Camii_-_Ortak%C3%B6y_Mosque.jpg","page_title":"Moschea di Ortaköy","context_page_description":"La moschea di Ortaköy, ufficialmente Büyük Mecidiye Camii è una moschea di Istanbul, Turchia situata sulle rive del Bosforo. Con la sua vista sul Bosforo e sul ponte, la moschea è una icona del quartiere di Ortaköy e dell'intera Istanbul."},{"page_url":"https://it.wikipedia.org/wiki/Amenemhat_V_in_scisto_(%C3%84S_37)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Amenemhat_V.jpg","page_title":"Amenemhat V in scisto (ÄS 37)","context_page_description":"Il busto di Amenemhat V (ÄS 37), in scisto, è una scultura raffigurante l'antico faraone egizio Amenemhat V, che regnò al principio della XIII dinastia egizia. Una delle migliori creazioni artistiche del periodo, si trova a Vienna, al Kunsthistorisches Museum."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%85%D9%81%DA%A9%DB%8C%D9%86%D9%82_%D9%85%D9%88%D8%AD%D8%A7%D8%B5%DB%8C%D8%B1%D9%87%E2%80%8C%D8%B3%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Boer_trenches_at_the_siege_of_Mafeking_-_The_Graphic_-_1900.jpg","page_title":"مفکینق موحاصیره‌سی","context_page_description":"مفکینق موحاصیره‌سی ترانسوال جومهوریتی و بریتانیا ایمپیراتورلوغو قوشونو آراسیندا باش وئرن دؤیوش.ایکینجی بوئر ساواشینین بیر قیسمی‌دیر. گونئی آفریقا یئرینده اوز وئرمیش‌دیر"},{"page_url":"https://hu.wikipedia.org/wiki/Abonyi_Lajos","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Abonyi_Lajos_%28Ellinger_Ede_felv%C3%A9tele%29.jpg","page_title":"Abonyi Lajos","context_page_description":"Abonyi Lajos, születési nevén zsarolyáni Márton Ferenc József magyar író, földbirtokos."},{"page_url":"https://de.wikipedia.org/wiki/Belize_City","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Swing_Bridge_Belize_City.jpg","page_title":"Belize City","context_page_description":"Belize City ist die größte Stadt und Haupthafen von Belize. Sie hat rund 63.000 Einwohner und ist die Provinzhauptstadt der Region Belize District.\\nBelize City ist der Sitz des Bistums Belize City-Belmopan."},{"page_url":"https://en.wikipedia.org/wiki/Belarusian_minority_in_Poland","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Belarusians_1903.jpg","page_title":"Belarusian minority in Poland","context_page_description":"The Belarusian minority in Poland is composed of 47,000 people according to the Polish census of 2011. This number decreased in the last decades from over 300,000 due to an active process of assimilation. Most of them live in the Podlaskie Voivodeship.\\nA small but unconfirmed Belarusian population remains in the West Pomeranian Voivodeship in western Poland. They may be assimilated into the Polish population, but Belarusian culture has not firmly disappeared in the whole of Poland since World War II.\\nalso Belarusians in Turkey"},{"page_url":"https://it.wikipedia.org/wiki/Napoli","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Palazzo_Reale_di_Napoli_-_Federico_II.jpg","page_title":"Napoli","context_page_description":"Napoli è un comune italiano di 962 589 abitanti, terzo in Italia per popolazione, capoluogo della regione Campania, dell'omonima città metropolitana e centro di una delle più popolose e densamente popolate aree metropolitane d'Europa.\\nFondata dai Cumani nell'VIII secolo a.C., fu tra le città più importanti della Magna Grecia e giocò un notevole ruolo commerciale, culturale e religioso nei confronti delle popolazioni italiche circostanti. Dopo il crollo dell'Impero romano, nell'VIII secolo la città formò un ducato autonomo indipendente dall'Impero bizantino; in seguito, dal XIII secolo e per più di cinquecento anni, fu capitale del Regno di Napoli; con la Restaurazione divenne capitale del Regno delle Due Sicilie sotto i Borbone fino all'Unità d'Italia.\\nSede della Federico II, la più antica università del mondo ad essere nata attraverso un provvedimento statale, ospita, altresì, l'Orientale, la più antica università di studi sinologici e orientalistici del continente, e la Nunziatella, una delle più antiche accademie militari al mondo, eletta patrimonio storico e culturale dei Paesi del Mediterraneo da parte dell'Assemblea parlamentare del Mediterraneo."},{"page_url":"https://fr.wikipedia.org/wiki/Times_Square_de_Saigon","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/SaigonTS_Feb2.jpg","page_title":"Times Square de Saigon","context_page_description":"Le Times Square de Saigon est un édifice construit dans le 1er arrondissement d'Hô-Chi-Minh-Ville au Viêt Nam."},{"page_url":"https://lt.wikipedia.org/wiki/Snorri_Sturluson","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Snorre_Sturluson-Christian_Krohg.jpg","page_title":"Snorri Sturluson","context_page_description":"Snoris Sturlusonas – Islandijos valst. veikėjas, istorikas, rašytojas. Parašė mitologijos ir skaldų poetikos traktatą „Jaunesnioji Eda“, Norvegijos karalių istoriją. Snorio Sturlusono veikalai yra vertingas sen. islandų literatūros ir Islandijos istorijos šaltinis."},{"page_url":"https://en.wikipedia.org/wiki/Ted_Whiteaway","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Ted_Whiteaway.jpg","page_title":"Ted Whiteaway","context_page_description":"Edward N. \\"Ted\\" Whiteaway was a British racing driver from England, who raced from 1951 to 1963. His single World Championship Formula One entry was at the 1955 Monaco Grand Prix in his privately entered HWM, but he failed to qualify. He also competed in some non-Championship Formula One races.\\nAt Le Mans in 1959 he teamed up with John Turner in Mrs. Waugh's ACE Bristol. They won the 2 litre class and came 7th overall."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Stadtkern_(Essen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Altkatholische_Kirche%2C_Essen.jpg","page_title":"Liste der Baudenkmäler in Stadtkern (Essen)","context_page_description":"Die Liste der Baudenkmäler in Stadtkern (Essen) enthält die denkmalgeschützten Bauwerke auf dem Gebiet von Essen-Stadtkern, Stadtbezirk I, in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Stadt Essen eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen.\\nKarte mit allen Koordinaten: OSM | WikiMap"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D0%BE%D0%B6%D0%B5%D0%B6%D0%B0_%D0%B2_%D0%9E%D0%B4%D0%B5%D1%81%D1%96_4_%D0%B3%D1%80%D1%83%D0%B4%D0%BD%D1%8F_2019_%D1%80%D0%BE%D0%BA%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Fire-damaged_Asvadurov_House_19.jpg","page_title":"Пожежа в Одесі 4 грудня 2019 року","context_page_description":"Пожежа в Будинку Асвадурова в Одесі 4 грудня 2019 — велика пожежа, що почалась близько 10:00 UTC+2 в будівлі, де розміщені Інститут морської біології НАН України та Одеський коледж економіки, права та готельно-ресторанного бізнесу, на вулиці Троїцькій, 25, та поширилась на іншу частину будівлі, де розташовано низку державних наукових установ.\\nВ результаті пожежі загинуло 16 осіб та 32 постраждало. Серед загиблих студенти і працівники коледжу, директор Інституту морської біології Борис Александров, співробітниця цього інституту та рятувальник ДСНС. Загиблим викладачці коледжу Ганні Бортюк та рятувальнику Сергію Шатохіну посмертно присвоєне звання Героя України — за героїзм і самопожертву, виявлені при рятуванні людей під час пожежі.\\nВ Інституті морської біології, серед іншого, згоріли унікальні наукові колекції морських організмів, наукові архіви, бази даних і бібліотека.\\nПовністю знищений вогнем архів БТІ Одеси, який знаходився на шостому поверсі.\\nБудівля, де відбулась пожежа, Прибутковий будинок Асвадурова, є пам'яткою архітектури місцевого значення.\\n5 та 6 грудня дні трауру було оголошено в Одесі. 8 грудня в Україні оголошено днем скорботи."},{"page_url":"https://fr.wikipedia.org/wiki/SpaceX_Demo-2","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Crew_Dragon_Demo-2_Bob_and_Doug.jpg","page_title":"SpaceX Demo-2","context_page_description":"SpaceX Demo-2, est une mission spatiale habitée réalisée par la société privée américaine SpaceX dans le cadre du programme Commercial Crew de la NASA. C'est le premier vol avec équipage du vaisseau Dragon 2, et son dernier vol de qualification avant le début de sa carrière opérationnelle. La mission est lancée le 30 mai 2020 par une fusée Falcon 9, et envoie les astronautes américains Douglas Hurley et Robert Behnken vers la Station spatiale internationale pour un séjour de deux mois, avant son retour sur Terre prévu pour le 2 août 2020. C'est la première mission habitée lancée depuis le sol américain depuis le retrait de la navette spatiale américaine en juillet 2011."},{"page_url":"https://nl.wikipedia.org/wiki/La_Femme_et_le_Pantin_(boek)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Goja_Kukla.jpg","page_title":"La Femme et le Pantin (boek)","context_page_description":"La Femme et le Pantin is een korte roman van Pierre Louÿs uit 1898. Hij vertelt het verhaal van een Spaanse schone die door een geraffineerd spel van aantrekken en afstoten haar geliefde herleidt tot een willoze pop."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%A5%BF%E8%97%8F%E3%B9%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/4_Year_Old_Female_Tibetan_Dagny.jpg","page_title":"西藏㹴","context_page_description":"西藏㹴是一種中等體格的犬種，原產自中國西藏。儘管名為㹴犬，但它並非㹴犬組的成員。該犬種因與已知的㹴犬相似而被歐洲的發現者命名為西藏㹴犬。這個犬種的西藏名字是Tsang Apso，大致翻譯為「產於烏思藏的有雜毛和鬍鬚 的犬」。一些年邁的旅行者稱這隻犬為Dokhi Apso或「戶外的」Apso，指的是生活在戶外的毛茸茸的或有鬍鬚的此類工作犬。其在生物分類法中隸屬犬科。"},{"page_url":"https://hu.wikipedia.org/wiki/John_Singer_Sargent","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/John_Singer_Sargent_-_Portrait_of_Mrs_William_Raphael.jpg","page_title":"John Singer Sargent","context_page_description":"John Singer Sargent amerikai festő, szobrász."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E5%85%AB%E6%AE%B5%E9%8C%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Baduanjin_qigong_edit1.jpg","page_title":"八段錦","context_page_description":"八段錦係起源自古代中國嘅一種健身方法，主要由八種肢體動作組成，重涉及到氣息調理。有啲人會將八段錦歸類做氣功一種，所以叫八段錦氣功，亦有歸類做中國武術一種。"},{"page_url":"https://it.wikipedia.org/wiki/Pink_Floyd","image_url":"https://upload.wikimedia.org/wikipedia/it/f/fd/Pink_Floyd%2C_Live_at_Pompeii_%E2%80%93_Echoes_Part_2.jpg","page_title":"Pink Floyd","context_page_description":"I Pink Floyd sono stati un gruppo musicale rock britannico formatosi nella seconda metà degli anni sessanta; nel corso di una lunga carriera, è riuscito a riscrivere le tendenze musicali della propria epoca, diventando uno dei gruppi più importanti della storia.\\nIl gruppo, nato a Londra nel 1965, viene fondato dal cantante e chitarrista Syd Barrett, dal bassista Roger Waters, dal batterista Nick Mason e dal tastierista Richard Wright. Nel dicembre del 1967 si aggiunge al gruppo il chitarrista David Gilmour, che si affianca e poi sostituisce definitivamente Barrett, progressivamente emarginatosi dal gruppo a causa del pesante uso di droghe e di una forma di alienazione."},{"page_url":"https://en.wikipedia.org/wiki/List_of_monuments_in_Qormi","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Niches_in_Qormi_46.jpg","page_title":"List of monuments in Qormi","context_page_description":"This is a list of monuments in Qormi, Malta, which are listed on the National Inventory of the Cultural Property of the Maltese Islands."},{"page_url":"https://de.wikipedia.org/wiki/Bad_Abbach","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Bad_Abbach_Villa_Rustica.JPG","page_title":"Bad Abbach","context_page_description":"Bad Abbach ist ein Markt und Kurort im niederbayerischen Landkreis Kelheim und liegt im Donautal zwischen Kelheim und Regensburg."},{"page_url":"https://en.wikipedia.org/wiki/Gornji_Milanovac","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Stadion_FK_Metalac.jpg","page_title":"Gornji Milanovac","context_page_description":"Gornji Milanovac is a town and municipality located in the Moravica District of central Serbia. The population of the town is 24,216, while the population of the municipality is 44,406.\\nThe city was founded in 1853. Before 1859 the original name of the city was Despotovac, after the Despotovica river passing by the town. In 1859 the name was changed to Gornji Milanovac at the request of the Prince of Serbia Miloš Obrenović. Its name means Upper Milanovac."},{"page_url":"https://uk.wikipedia.org/wiki/HMS_Amazon_(D39)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/HMS_Amazon.jpg","page_title":"HMS Amazon (D39)","context_page_description":"«Амазон» (D39) — військовий корабель, єдиний експериментальний ескадрений міноносець свого типу Королівського військово-морського флоту Великої Британії за часів Другої світової війни.\\n«Амазон» був закладений 29 січня 1925 року на верфі компанії John I. Thornycroft & Company у Вулстоні. 5 травня 1927 року увійшов до складу Королівських ВМС Великої Британії. «Амазон» був прототипом кораблів цього класу, спроектованим з урахуванням набутого досвіду Першої світової війни та новітніх розробок у технологіях. Тривалий час використовувався як дослідний корабель для проектування майбутніх есмінців британського флоту."},{"page_url":"https://cs.wikipedia.org/wiki/Vnit%C5%99n%C3%AD_roviny","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Saskatchewan_-_Grasslands_National_Park_02.JPG","page_title":"Vnitřní roviny","context_page_description":"Vnitřní roviny jsou rozsáhlý fyzickogeografický region uvnitř severoamerického kontinentu, mezi Skalnatými horami na západě a Kanadským štítem, resp. Apalačským pohořím na východě. Zaujímají celou střední část Severní Ameriky od severního pobřeží Kanady přes Spojené státy na jih, malou částí zasahují i do Mexika."},{"page_url":"https://en.wikipedia.org/wiki/Serbian_epic_poetry","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Guslar_singing_of_the_death_of_Lazar%2C_at_an_encampent_in_Javor.jpg","page_title":"Serbian epic poetry","context_page_description":"Serb epic poetry is a form of epic poetry created by Serbs originating in today's Serbia, Bosnia and Herzegovina, Croatia, Montenegro and North Macedonia. The main cycles were composed by unknown Serb authors between the 14th and 19th centuries. They are largely concerned with historical events and personages. The instrument accompanying the epic poetry is the gusle.If it wasn’t for Vuk Karadžić Stefanović, those songs would be forgotten.\\nSerbian epic poetry helped in developing the Serbian national consciousness. The cycles of Prince Marko, the Hajduks and Uskoks inspired the Serbs to restore freedom and their heroic past. The Hajduks in particular, are seen as an integral part of national identity; in stories, the hajduks were heroes: they had played the role of the Serbian elite during Ottoman rule, they had defended the Serbs against Ottoman oppression, and prepared for the national liberation and contributed to it in the Serbian Revolution."},{"page_url":"https://de.wikipedia.org/wiki/Cainsdorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Russkohlenfloez06.JPG","page_title":"Cainsdorf","context_page_description":"Die ehemals selbständige Gemeinde Cainsdorf ist heute ein Stadtteil und eine Ortschaft der Stadt Zwickau, die seit 2008 Kreisstadt des Landkreises Zwickau im Freistaat Sachsen ist. Der Stadtteil Cainsdorf liegt im Stadtbezirk Zwickau-Süd und trägt die amtliche Nummer 59."},{"page_url":"https://hu.wikipedia.org/wiki/Feh%C3%A9rfej%C5%B1_r%C3%A9tisas","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Bald-eagle-USA-status_and_numbers-he.png","page_title":"Fehérfejű rétisas","context_page_description":"A fehérfejű rétisas a madarak osztályának vágómadár-alakúak rendjébe, ezen belül a vágómadárfélék családjába tartozó faj.\\nEz a ragadozó madár az észak-amerikai kontinens egyik legismertebb madara, az Amerikai Egyesült Államok nemzeti szimbóluma. Az Amerikai Egyesült Államok címerében is benne van. Ennek a Haliaeetus-fajnak két alfaja van; a rétisassal fajkomplexumot alkot, vagyis külső vizsgálat alapján nem, vagy alig különböztethetők meg egymástól, azonban nem képesek szaporodni egymással, és a genetikai összehasonlításuk szerint külön fajoknak tekintendők. Előfordulási területe magába foglalja Kanadát és Alaszkát, valamint az Amerikai Egyesült Államok kontinentális területének a legnagyobb részét és Észak-Mexikót. Azokat az élőhelyeket kedveli, ahol nagy, táplálékkal teli nyílt vizek és hatalmas, öreg fák találhatók, melyeken nyugodtan fészkelhet.\\nLegfőbb tápláléka a hal, azonban sok más egyebet is zsákmányol. Vadászat közben „rázuhan” az áldozatra, és karmaival elkapja zsákmányát. Az ivarérettséget 4–5 éves korában éri el. Az észak-amerikai madarak között a fehérfejű rétisas készíti a legnagyobb fészket. A fészek 2 méter széles, 4 méter mély és akár 1 tonnás is lehet."},{"page_url":"https://fr.wikipedia.org/wiki/St%C3%A9phane_Trompille","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Stephane_Trompille_18881_salle_4_colonnes.jpg","page_title":"Stéphane Trompille","context_page_description":"Stéphane Trompille, né le 1ᵉʳ décembre 1982 à Bourg-en-Bresse, est un homme politique français, membre de La République en marche. Il est élu député de la quatrième circonscription de l'Ain en 2017.\\nIl est condamné pour harcèlement sexuel et licenciement abusif en 2020 ; il fait appel de cette décision."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9E%D0%B1%D1%89%D0%B8%D0%BD%D1%8B_%D0%91%D0%BE%D0%BB%D0%B3%D0%B0%D1%80%D0%B8%D0%B8","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c4/Map_of_Varbitsa_municipality_%28Shumen_Province%29.png","page_title":"Общины Болгарии","context_page_description":"Община — административно-территориальная единица Болгарии второго уровня. Обладает местным самоуправлением.\\nОрганом исполнительной власти в общине является кмет, выбираемый гражданами общины путём прямого, равного и тайного голосования, через каждые 4 года. В отличие от руководителей центральной власти — президент, премьер-министр — для кмета нет ограничения числа сроков, на которые он может претендовать.\\nВсего в Болгарии 265 общины.\\nНа местных выборах в Болгарии в 2011 году правом выбирать местные власти обладали 6 514 917 человека из 7,4 млн. населения страны, которые имели постоянную регистрацию в соответственной общине в течение не менее четырёх месяцев до дня выборов. Всего в 265 общинах было 11 382 выборных участков."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A4%D0%BB%D0%B0%D0%B3_%D0%9D%D1%8B%D1%82%D0%B2%D0%B5%D0%BD%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Stroganov_v2_p16.png","page_title":"Флаг Нытвенского района","context_page_description":"Флаг Ны́твенского района — официальный символ муниципального образования «Нытвенский муниципальный район» Пермского края Российской Федерации.\\nФлаг утверждён 22 марта 2007 года и внесён в Государственный геральдический регистр Российской Федерации с присвоением регистрационного номера 3449.\\nФлаг составлен на основании герба Нытвенского муниципального района по правилам и соответствующим традициям вексиллологии и отражает исторические, культурные, социально-экономические, национальные и иные местные традиции."},{"page_url":"https://en.wikipedia.org/wiki/African_military_systems_(1800%E2%80%931900)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Duala_war_canoe.jpg","page_title":"African military systems (1800–1900)","context_page_description":"African military systems (1800–1900) refers to the evolution of military systems on the African continent after 1800, with emphasis on the role of indigenous states and peoples within the African continent. Only major military systems or innovations and their development after 1800 are covered here. Coverage of the 20th century and beyond is provided in African military systems after 1900. See individual battles, empires and leaders for details on activities after 1800."},{"page_url":"https://en.wikipedia.org/wiki/G5_Beijing%E2%80%93Kunming_Expressway","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Taiyuan_Metro_Logo.png","page_title":"G5 Beijing–Kunming Expressway","context_page_description":"The Beijing–Kunming Expressway, commonly referred to as the Jingkun Expressway is an expressway that connects the cities of Beijing, and Kunming, in Yunnan province. It is 2,865 km in length. As of 2018, the expressway has been completed in its entirety."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%90%E3%83%BC%E3%83%AC%E3%82%B9%E3%82%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Bon-Ton_Burlesquers2.jpg","page_title":"バーレスク","context_page_description":"バーレスク とは、有名な作品のスタイルや精神をカリカチュアしたり、その作品のテーマをこっけいに描く文学・戯曲、音楽のジャンルである。バーレスクという言葉はもともとイタリア語のburlesco から来ている。burlesco の語幹burla –は、冗談、嘲りなどの語義をもつ。\\nバーレスクは意味的にはカリカチュア、パロディ、戯作とも重なっており、ヴィクトリア朝時代の演劇がそうであったように、エクストラバガンザの要素も帯びている。文学あるいは戯曲ジャンルとしての「バーレスク」という言葉は17世紀後半から使われており、遡ってチョーサーやシェイクスピア、古代ギリシャやローマ文化における古典の批評にも用いられている。文学におけるバーレスクの例としては、アレキサンダー・ポープの『髪盗人』とサミュエル・バトラーの『ヒューディブラス』という対照的な作品を挙げることが出来る。音楽としてのバーレスクには、例えばリヒャルト・シュトラウスの1890年の『ピアノと管弦楽のためのブルレスケ』がある。戯曲としては、ウィリアム・Ｓ・ギルバートの『悪魔ロバート』やフレッド・レスリーとメイヤー・ラッツの劇作品、『リュイ・ブラースと放蕩者』などがある。\\n時代が下ると、特にアメリカにおいてバラエティ・ショーの形式による見世物を指すようになった。華やかなショーガールが出演するアメリカ式のバーレスクは1860年代から1940年代にかけて人気を博し、劇場だけでなくキャバレーやクラブでもよく上演された。後期のアメリカン・バーレスクは猥雑なコメディと女性のストリップを演目とすることが特徴であった。ハリウッド映画には1930年代から60年代のバーレスクの雰囲気をミュージカルで再現しようとしたり、ストーリー上にバーレスク的なシーンを含んだ作品がある。例えば1972年の『キャバレー』や1979年の『オール・ザット・ジャズ』である。1990年代以降になると衰退していたバーレスクを再評価するニュー・バーレスクの動きがおこった。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9D%D0%B0%D1%86%D1%96%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%BD%D1%96_%D0%B7%D0%B1%D1%80%D0%BE%D0%B9%D0%BD%D1%96_%D1%81%D0%B8%D0%BB%D0%B8_%D0%9B%D0%B0%D1%82%D0%B2%D1%96%D1%97","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7d/Latvian_Navy_logo.jpg","page_title":"Національні збройні сили Латвії","context_page_description":"Національні збройні сили Латвії — сукупність військ Латвійської Республіки, призначених для захисту свободи, незалежності та територіальної цілісності держави."},{"page_url":"https://en.wikipedia.org/wiki/Conus_gubernator","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Conus_gubernator_8.jpg","page_title":"Conus gubernator","context_page_description":"Conus gubernator, common name the governor cone, is a species of sea snail, a marine gastropod mollusk in the family Conidae, the cone snails and their allies.\\nLike all species within the genus Conus, these snails are predatory and venomous. They are capable of \\"stinging\\" humans, therefore live ones should be handled carefully or not at all."},{"page_url":"https://sl.wikipedia.org/wiki/Seznam_mest_v_Litvi","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Eisiskes_COA.png","page_title":"Seznam mest v Litvi","context_page_description":"V Litvi so 103 mesta. Status mesta definira parlament kot naselje z več kot 3000 prebivalci, od katerih več kot dve tretjini delata v sektorju industrije ali storitev. Naselja z manj kot 3000 prebivalci, ki so imela status mesta v zgodovini, ga imajo še zdaj.\\nVečina mest je majhnih, le 19 jih ima več kot 20.000 prebivalcev. Mesta so dokaj enakomerno porazdeljena po državi. To omogoča dobro prometno povezanost. Okrog 66,7 % prebivalstva živi v mestih, odstotek pa narašča."},{"page_url":"https://en.wikipedia.org/wiki/Expo_2015_pavilions","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Expo_Milano_2015_-_Estonia.jpg","page_title":"Expo 2015 pavilions","context_page_description":"The 2015 World Expo Milan covers more than 2.9 square kilometers and contains more than 70 exposition pavilions. More than 145 countries and 50 international organizations registered to participate in the 2015 Milan Expo."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%90%D0%BD%D0%B4%D1%80%D1%8D%D0%B9_%D0%9A%D0%BB%D1%96%D0%BC%D0%B0%D0%B2%D0%B5%D1%86","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/75/Andrej_Klimovets_03.jpg","page_title":"Андрэй Клімавец","context_page_description":"Андрэй Клімавец — беларускі і нямецкі гандбаліст. Чэмпіён сьвету-2007 у складзе зборнай Нямеччыны."},{"page_url":"https://de.wikipedia.org/wiki/Klappt%C3%BCr","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Asko_D3112_dishwasher_open.JPG","page_title":"Klapptür","context_page_description":"Als Klapptür bezeichnet man ein in der Regel an einer horizontalen Achse befestigtes klappbares Türblatt, das mittels Niederfallen bzw. Aufheben den Zugang bzw. Zugriff zu etwas erschließt.\\nAnders als bei dem normalen und verbreitetsten Türentyp, der Schwenktür, ist das Türblatt der Klapptür oben angeschlagen. Es öffnet nach außen oder nach innen. Klapptüren sind Spezialmechanismen, die je nach Ausführung für sehr unterschiedliche Zwecke eingesetzt werden können."},{"page_url":"https://pt.wikipedia.org/wiki/Arica","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Arica_port_%28Jan._2008%29.jpg","page_title":"Arica","context_page_description":"Arica é uma cidade portuária e comuna capital da província homônima e da região de Arica e Parinacota, no Chile. É conhecida naquele país como a \\"\\"Cidade da Eterna Primavera\\"\\", por seus jardins e por ser a porta norte do Chile. Por sua localização, se caracteriza pela diversidade cultural e a riqueza de sua historia, destacándo-se as múmias chinchorro, famosas por serem as mais antigas do mundo."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%91%E3%82%AF%E3%83%BB%E3%83%92%E3%83%A7%E3%83%B3%E3%83%93%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Park_Hyun-Bin.jpg","page_title":"パク・ヒョンビン","context_page_description":"パク・ヒョンビンは、韓国仁川広域市出身のトロット歌手である。秋渓芸術大学声楽学科卒業。女優でタレントのイ・ユンジ は従妹。インウプロダクション所属。"},{"page_url":"https://es.wikipedia.org/wiki/Comando_especial_de_guerra_del_ej%C3%A9rcito_de_la_Rep%C3%BAblica_de_Corea","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Republic_of_Korea_special_forces.jpg","page_title":"Comando especial de guerra del ejército de la República de Corea","context_page_description":"El Comando especial de guerra del ejército de la República de Corea; en coreano, 대한민국 육군 특수전사령부 o 특전사; Hanja: 大韓民國陸軍 特殊戰司令部, también conocido como Fuerzas Especiales del Ejército de la República de Corea \\"Boinas Negras\\" es el comando militar del ejército de Corea del Sur responsable de las operaciones de fuerzas especiales. Las brigadas R.O.K-Fuerzas Especiales trabajan en estrecha relación con su contraparte en los Estados Unidos, los \\"Boinas Verdes\\", quienes también fueron su modelo de organización.​​\\nEn Corea del Sur los U.S. SOF están bajo el mando y control del Comando de Operaciones Especiales de Corea, sub-comando unificado asignado bajo el Comando Combatiente del Comando de Operaciones Especiales de Estados Unidos y delegado del Comando Operacional de las Fuerzas Estados Unidos-Corea.\\nDesde 1993, el ejército surcoreano ha capacitado a expertos mediante el envío de oficiales a varias instituciones de formación, tales como el Northern Europe United Nations Training Corps, en Polonia e Irlanda. Y, desde 1995, los oficiales y funcionarios relacionados con el gobierno han sido enviados a la prueba del Centro Pearson de Pacificación en Canadá."},{"page_url":"https://hr.wikipedia.org/wiki/Ferrari_Mythos","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/26/Ferrari_Mythos_Made_by_Pininfarina.jpg","page_title":"Ferrari Mythos","context_page_description":"Ferrari Mythos je Ferrarijev je prototip visokih performansi. Taj sportski coupe javnosti je prvi puta predstavljen na Tokyo Auto Showu 1989. godine."},{"page_url":"https://la.wikipedia.org/wiki/Cucujoidea","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a2/Asian_multicolored_lady_beetle.jpg","page_title":"Cucujoidea","context_page_description":"Cucujoidea sunt superfamilia coleopterorum, cui sunt multae species notae, inter quas Coccinellidae, praeterea multa \\"coleoptera corticis\\" minime \\"veris\\" coleopteris corticis conecta, quae ad superfamiliam Curculionoidea pertinent."},{"page_url":"https://pl.wikipedia.org/wiki/Biblioteki_prezydenckie_w_Stanach_Zjednoczonych","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/JFK_library_Stitch_Crop.jpg","page_title":"Biblioteki prezydenckie w Stanach Zjednoczonych","context_page_description":"Biblioteki prezydenckie – sieć instytucji naukowo-kulturalnych w Stanach Zjednoczonych, upamiętniających poszczególnych byłych prezydentów USA oraz gromadzących dokumenty, przedmioty i inne zasoby związane z ich prezydenturami. W sensie organizacyjnym większość z nich stanowi część National Archives and Records Administration, choć istnieją też biblioteki działające poza systemem NARA."},{"page_url":"https://en.wikipedia.org/wiki/Teleiodes_luculella","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Teleiodes_luculella.jpg","page_title":"Teleiodes luculella","context_page_description":"Teleiodes luculella, the crescent groundling, is a moth of the family Gelechiidae. It is found from Europe to the southern Ural and Transcaucasia. The habitat consists of woodlands, including oak woodlands.\\nThe wingspan is 9–13 mm. Adults are on wing from May to June.\\nThe larvae feed on Quercus, Castanea sativa, Betula, Acer and Salix eleagnos. They feed between spun leaves of their host plant. Larvae can be found in September. The species overwinters in the pupal stage within a cocoon on the ground."},{"page_url":"https://pl.wikipedia.org/wiki/Pawe%C5%82_Nowak_(rugbysta)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Pawel_Nowak_2009.jpg","page_title":"Paweł Nowak (rugbysta)","context_page_description":"Paweł Nowak – polski rugbysta, występuje w Arce Gdynia od początku jej istnienia, czyli od 1996. Był kapitanem Reprezentacji Polski."},{"page_url":"https://it.wikipedia.org/wiki/Baldassarre_Audiberti","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Colognole_Croce_001.JPG","page_title":"Baldassarre Audiberti","context_page_description":"Baldassarre Audiberti è stato un religioso francese naturalizzato italiano."},{"page_url":"https://en.wikipedia.org/wiki/Roman_Catholic_Diocese_of_Nova_Igua%C3%A7u","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Novaiguacu_santoantoniodejacutinga.jpg","page_title":"Roman Catholic Diocese of Nova Iguaçu","context_page_description":"The Roman Catholic Diocese of Nova Iguaçu is a diocese located in the city of Nova Iguaçu in the Ecclesiastical province of São Sebastião do Rio de Janeiro in Brazil."},{"page_url":"https://nl.wikipedia.org/wiki/Casserres","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Ajuntament_Casserres_IMG_7085.jpg","page_title":"Casserres","context_page_description":"Casserres is een gemeente in de Spaanse provincie Barcelona in de regio Catalonië met een oppervlakte van 29 km². Casserres telt 1.528 inwoners."},{"page_url":"https://fr.wikipedia.org/wiki/Cerro_Lipez","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Cerro_Lipez.jpg","page_title":"Cerro Lipez","context_page_description":"Le Cerro Lipez est un stratovolcan dans la cordillère de Lipez, dans la province de Sud Lípez, dans le département de Potosí, au sud-ouest de la Bolivie.\\nSes deux sommets jumeaux s'élèvent à une altitude de 5 929 mètres.\\nUn sommet secondaire à quatre kilomètres au sud-ouest du Cerro Lipez, culminant à environ 5 500 mètres, est nommé Nuevo Mundo, entraînant une confusion avec le Nuevro Mundo à environ 250 kilomètres au nord-est."},{"page_url":"https://war.wikipedia.org/wiki/Kogia_breviceps","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Pygmy_sperm_whale_size.png","page_title":"Kogia breviceps","context_page_description":"An Kogia breviceps in uska species han Mammalia nga syahan ginhulagway ni Henri Marie Ducrotay de Blainville hadton 1838. An Kogia breviceps in nahilalakip ha genus nga Kogia, ngan familia nga Kogiidae. Ginklasipika han IUCN an species komo kulang hin datos. Waray hini subspecies nga nakalista."},{"page_url":"https://my.wikipedia.org/wiki/%E1%80%99%E1%80%BC%E1%80%BD%E1%80%B1%E1%80%95%E1%80%AB%E1%80%80%E1%80%BC%E1%80%AE%E1%80%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Martes_martes_crop.jpg","page_title":"မြွေပါကြီး","context_page_description":"မြွေပါကြီး မျိုးစိတ် အမျိုးမျိုးကို ဥရောပတိုက်၊ အာရှတိုက်နှင့်\\nမြောက်အမေရိကတိုက်တို့တွင် တွေ့နိုင်သည်။\\nယင်းတို့သည် မြွေပါမြီးတို မျိုးရင်းဝင်ဖြစ်သည်။ နေရပ်ဒေသကို\\nလိုက်၍ ပါဏဗေဒအလိုအားဖြင့် မာတီးအမေရိကာနာ၊ မာတီး\\nပင်နန်တီ၊ မာတီးဖွိုင်န စသည်ဖြင့် အမျိုးမျိုး ခေါ်တွင်လေ\\nသည်။ သေးသွယ်၍ ရှည်လျားသော ကိုယ်နှင့်တိုသည့် ခြေ\\nထောက်များရှိသည်။ အရွယ်မှာ ၁၇ လက်မမှ လက်မ ၄ဝ ထိ\\nရှိတတ်သည်။ မြွေပါကြီးများသည် များသောအားဖြင့် သစ်\\nခေါင်းများတွင် နေလေ့ရှိသော်လည်း၊ တစ်ခါတစ်ရံ ကျောက်\\nတွင်းများလည်း နေလေ့ရှိသည်။ သစ်ပင်တက် အလွန်\\nကျွမ်းကျင်၍ ရှဉ့်များကဲ့သို့ပင် တစ်ပင်မှ တစ်ပင်သို့\\nခုန်ကူးနိုင်သည်။\\nမြွေပါကြီးများသည် ယုန်၊ ရှဉ့်၊ ခါနှင့်အခြားငှက်များ၊\\nကြွက်နှင့် အခွံမာသီးများကို စားသောက်သည်။ တစ်မြုံလျှင်\\nခြောက်ကောင်မှ ရှစ်ကောင်အထိ ရှိတတ်သဖြင့် အပွား\\nမြန်သည်။\\nမြွေပါကြီးများ၏ သားမွေးသည် လူကြိုက်များသောပစ္စည်း\\nဖြစ်၍ တန်ဖိုးကြီးသည်။ အထူးသဖြင့် ကမ္ဘာ့မြောက်ဖက်စွန်း\\nအနီးတွင် နေထိုင်သည့် မြွေပါကြီးများ၏သားမွေးများကို ပို၍\\nကြိုက်နှစ်သက်ကြသည်။ ဆောင်းတွင်း၌ ဖမ်းယူရရှိသော မြွေပါ\\nကြီးများ၏ သားမွေးသည် ပို၍ တန်ဖိုးကြီး၏။ ထိုသို့ ဖြစ်ရ\\nသည်မှာ ထိုအချိန်၌ သားမွေးသည် ပို၍ အမွေးထူပြီးလျှင် ပို၍\\nရှည်သောကြောင့် ဖြစ်သည်။ ထိုသားမွေးများဖြင့် အနွေးထည်\\nများကို ချုပ်ယူကြသည်။"},{"page_url":"https://es.wikipedia.org/wiki/Beaumont-sur-Oise","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Blason_ville_fr_Beaumont-sur-Oise_%28Val-d%27Oise%29.svg","page_title":"Beaumont-sur-Oise","context_page_description":"Beaumont-sur-Oise es una población y comuna francesa, en la región de Isla de Francia, departamento de Valle del Oise, en el distrito de Pontoise y cantón de Beaumont-sur-Oise."},{"page_url":"https://en.wikipedia.org/wiki/Eparchy_of_Banja_Luka","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3c/Episkop_Jefrem.jpg","page_title":"Eparchy of Banja Luka","context_page_description":"The Eparchy of Banja Luka is an eparchy of the Serbian Orthodox Church with its seat in Banja Luka, Bosnia and Herzegovina. It has jurisdiction over the north-western regions of Bosnia and Herzegovina."},{"page_url":"https://io.wikipedia.org/wiki/Papo_Stefanus_la_5ma","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Stephen_V.jpg","page_title":"Papo Stefanus la 5ma","context_page_description":"Stefanus la 5ma esis la 110ma papo dil katolik-eklezio."},{"page_url":"https://eu.wikipedia.org/wiki/Rimpar","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Rimpar-Schloss.jpg","page_title":"Rimpar","context_page_description":"Rimpar Alemaniako udalerria da. Bavariako estatuan kokatuta dago, Würzburg barrutian. 2014an 7.609 biztanle zituen 36,41 kilometro koadrotan banatuta."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D1%80%D0%B8%D0%B0%D1%81_%D0%9C%D0%B0%D0%B4%D1%80%D0%B8%D0%B4,_%D0%90%D1%80%D0%BD%D1%83%D0%BB%D1%8C%D1%84%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Monumento_a_Arnulfo_Arias_Madrid..-.jpg","page_title":"Ариас Мадрид, Арнульфо","context_page_description":"Арнульфо Ариас Мадрид — панамский политик, врач, писатель и президент Панамы в 1940—1941, 1949—1951 годах и в течение 10 дней в октябре 1968 года. Он был известен как президент, который ни разу не исполнял своих обязанностей весь свой срок полномочий в связи с военными переворотами, направленными против него."},{"page_url":"https://cs.wikipedia.org/wiki/Kostel_Nanebevzet%C3%AD_Panny_Marie_(Plze%C5%88)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Kostel_Nanebevzet%C3%AD_Panny_Marie_v_Plzni_07.JPG","page_title":"Kostel Nanebevzetí Panny Marie (Plzeň)","context_page_description":"Kostel Nanebevzetí Panny Marie je součástí bývalého františkánského kláštera a patří mezi nejstarší v Plzni. Dnes je spolu se zmiňovaným bývalým františkánským klášterem chráněn jako nemovitá kulturní památka."},{"page_url":"https://en.wikipedia.org/wiki/MultiCam","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/A_Georgian_soldier_with_Scouts_Platoon%2C_Delta_Company%2C_Special_Mountain_Battalion_conducts_reconnaissance_operations_Feb._14%2C_2014%2C_during_Georgian_Mission_Rehearsal_Exercise_%28MRE%29_14-02B_at_the_Joint_140214-A-HJ139-001.jpg","page_title":"MultiCam","context_page_description":"MultiCam is a camouflage pattern designed for use in a wide range of conditions produced by Crye Precision. Variants of it, some unlicensed, are in use with armed forces worldwide. The pattern is also available for civilian usage."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D1%80%D1%83%D0%B7%D0%BE%D0%B2%D0%BE%D0%B9_%D0%B2%D0%B0%D0%B3%D0%BE%D0%BD","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/32/%D0%9F%D0%BE%D0%BB%D1%83%D0%B2%D0%B0%D0%B3%D0%BE%D0%BD_581.jpg","page_title":"Грузовой вагон","context_page_description":"Грузовой вагон — это единица подвижного состава, предназначенная для перевозки грузов.\\nК вагонам грузового парка относятся: крытые вагоны, полувагоны, вагоны-цистерны, думпкары, хопперы, платформы, фитинговые платформы, вагоны бункерного типа, транспортёры, автомобилевозы, вагоны-кенгуру, изотермические, вагоны-ледники, рефрижераторные, вагоны-термосы.\\nНа раннем этапе развития железнодорожного транспорта большинство грузовых вагонов были всего трёх основных типов: крытые вагоны, полувагоны и платформы. С течением времени появились специализированные вагоны для перевозки того или иного груза, так появились вагоны-цистерны и автомобилевозы, хопперы для перевозки сыпучих грузов, вагоны-ледники, а затем и рефрижераторные вагоны, вагоны для перевозки скота и птицы, живой рыбы.\\nПервые вагоны были двухосными или трёхосными и не имели тележек. На 2010 год большинство вагонов четырёхосные, но также довольно широко распространены шести- и восьмиосные. Двухосные вагоны почти повсеместно были изъяты из эксплуатации в 1950-е годы."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%85%D9%88%D9%83%D8%B3_%D9%85%D9%83%D9%88%D9%8A%D8%B1%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Mox_McQuery.jpg","page_title":"موكس مكويرى","context_page_description":"موكس مكويرى كان لاعب بيسبول من امريكا."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9A%D1%80%D0%B0%D0%B9%D1%86%D0%B5%D1%80%D0%B8_%D0%BF%D1%80%D0%BE%D0%B5%D0%BA%D1%82_26-%D0%B1%D0%B8%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/MaksimGor%27kiy1941.jpg","page_title":"Крайцери проект 26-бис","context_page_description":"Крайцери проект 26-бис „Максим Горки“ са тип леки крайцери на ВМФ на СССР от времето на Втората световна война, развитие на крайцерите от проект 26 „Киров“."},{"page_url":"https://no.wikipedia.org/wiki/Robert_av_Mortain","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Bayeux_Tapestry_scene44_William_Odo_Robert.jpg","page_title":"Robert av Mortain","context_page_description":"Robert, grev av Mortain var halvbror av Vilhelm Erobreren, og sønn av Herluin de Conteville og Herleva av Falaise. Hans andre bror, med samme foreldre, var Odo av Bayeux. Det nøyaktige året da Robert ble født er ukjent, skjønt ca. 1038 er en antagelse, men det er vanligvis antatt at Odo var den eldste av dem, og at Robert var antagelig ikke mer enn et år eller så yngre enn sin bror; det er derfor betydelig tvil om fødselsdatoene til Odo og Robert."},{"page_url":"https://pt.wikipedia.org/wiki/Saales","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/MairieSaales.jpg","page_title":"Saales","context_page_description":"Saales é uma comuna francesa na região administrativa de Grande Leste, no departamento Baixo Reno. Estende-se por uma área de 9,86 km². Em 2010 a comuna tinha 850 habitantes."},{"page_url":"https://en.wikipedia.org/wiki/KKLZ","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/96.3_KKLZ_Logo.png","page_title":"KKLZ","context_page_description":"KKLZ is a commercial radio station located in Las Vegas, Nevada. The station is owned by Beasley Broadcast Group and airs a classic hits music format branded as \\"96-3 KKLZ\\". The KKLZ studios are located in Spring Valley, an unincorporated area of Clark County, while its transmitter is on Black Mountain in Henderson."},{"page_url":"https://es.wikipedia.org/wiki/Guanambi","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Bandeira-guanambi.jpg","page_title":"Guanambi","context_page_description":"Guanambi es un municipio Brasilero el estado de Bahia, distante 796 kilómetros al suroeste de Salvador, que se conecta a la capital por BR-030, BR-242 y BR-324, 45 km de Caetité y el 43 km de Palmas de Monte Alto por BR-030 a 33 km de Pindaí por BR-122 y 29 km de Candiba por BA-262. Su población fue estimada en 2015, de acuerdo con los IBGE en habitantes, ​ ¿qué significa seguir siendo el 20a municipio más poblado de Bahía. Ciudad Polo Microregión Guanambi, el establecimiento de infraestructura comercial y la influencia de una superficie aproximada de 400.000 habitantes. Casas, junto a Caetité y Igaporã, el mayor complejo eólico de América Latina.​"},{"page_url":"https://en.wikipedia.org/wiki/Armenian_eternity_sign","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/%D4%B3%D5%A5%D5%B2%D5%A1%D6%80%D5%A4_%D5%BE%D5%A1%D5%B6%D5%A1%D5%AF%D5%A1%D5%B6_%D5%B0%D5%A1%D5%B4%D5%A1%D5%AC%D5%AB%D6%80174.JPG","page_title":"Armenian eternity sign","context_page_description":"The Armenian eternity sign or Arevakhach is an ancient Armenian national symbol and a symbol of the national identity of the Armenian people. It is one of the most common symbols in Armenian architecture, carved on khachkars and on walls of churches."},{"page_url":"https://it.wikipedia.org/wiki/Friday_Night_in_San_Francisco","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/San_Francisco_Warfield.jpg","page_title":"Friday Night in San Francisco","context_page_description":"Il Friday Night in San Francisco fu una spettacolare jam session di tre tra i più grandi chitarristi viventi, riuniti in concerto al Warfield Theatre di San Francisco il venerdì notte del 5 dicembre 1980: l'americano Al Di Meola, l'inglese John McLaughlin e lo spagnolo Paco de Lucía, i primi due provenienti dal jazz e dalla fusion, il terzo dal flamenco.\\nIl risultato è un album \\"magico\\" con alternanza di sonorità di grande fascino alternate a momenti di eccelso virtuosismo con un susseguirsi di incredibili assoli.\\nL'album raggiunge la quinta posizione in classifica in Austria."},{"page_url":"https://fr.wikipedia.org/wiki/Jardin_de_Versailles","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Gaspard_Marsy%2C_Fontaine_de_l%27Encelade%2C_Mus%C3%A9e_national_des_ch%C3%A2teaux_de_Versailles_et_de_Trianon%2C_Versailles%2C_France_%281675%E2%80%931676%29_-_20080506.jpg","page_title":"Jardin de Versailles","context_page_description":"Le jardin de Versailles, également appelé jardin du château de Versailles ou, au pluriel, les jardins de Versailles ou les jardins du château de Versailles, est situé à l'ouest du château de Versailles.\\nAu cours de l’Ancien Régime, le domaine de Versailles était constitué du Grand Parc – la vaste région boisée aux abords du château et du village de Versailles – et du Petit Parc – la partie entourée d’un mur qui fut développé en jardins à la française près du château.\\nAujourd'hui, la différence entre Grand Parc et Petit Parc persiste sous d'autres appellations. Le Grand Parc est aujourd'hui désigné sous le terme parc de Versailles et comprend l'ensemble des espaces verts appartenant au domaine de Versailles. Le Petit Parc, aujourd'hui désigné sous le terme jardin de Versailles, est la partie de ce parc de Versailles située entre à l'est le château de Versailles, à l'ouest le bassin du char d'Apollon, au nord le bassin de Neptune et au sud l'Orangerie et qui comprend les jardins à la française proches du château.\\nCet article traite du Petit Parc, aujourd'hui appelé jardin de Versailles, et de son évolution."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A8%D1%8C%D0%BE%D0%BA%D1%82%D0%BE%D0%BD_(%D0%92%D1%96%D1%81%D0%BA%D0%BE%D0%BD%D1%81%D0%B8%D0%BD)","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d3/ShioctonWisconsinSignUS76.jpg","page_title":"Шьоктон (Вісконсин)","context_page_description":"Шьоктон — селище в США, в окрузі Автаґемі штату Вісконсин. Населення — 921 особа."},{"page_url":"https://sv.wikipedia.org/wiki/Pipistrellus_tenuis","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Pipistrellus_tenuis_by_Dibyendu_Ash.jpg","page_title":"Pipistrellus tenuis","context_page_description":"Pipistrellus tenuis är en däggdjursart som först beskrevs av den holländske zoologen Coenraad Jacob Temminck 1840. Pipistrellus tenuis ingår i släktet Pipistrellus och familjen läderlappar. IUCN kategoriserar arten globalt som livskraftig."},{"page_url":"https://en.wikipedia.org/wiki/Baseball5","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Baseball5_field.jpg","page_title":"Baseball5","context_page_description":"Baseball5 is variation of the game of baseball. There are five players on each team and each team has five innings. The World Baseball Softball Confederation proposed the game in 2018."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%B5%AB%E7%88%BE%E8%BE%9B%E5%9F%BA%E4%B8%BB%E6%95%99%E5%BA%A7%E5%A0%82%E7%94%B7%E5%AD%A9%E5%90%88%E5%94%B1%E5%9C%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Cantores_Minores_C_IMG_1667.JPG","page_title":"赫爾辛基主教座堂男孩合唱團","context_page_description":"赫爾辛基主教座堂男孩合唱團， 是赫爾辛基主教座堂的一個合唱團，也是芬蘭歷史最久和著名的男孩合唱團。合唱團成立於1952年，其保護人為芬蘭總統夫婦。合唱團成員有大概300個4至25歲的男孩和年輕男人。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D1%8E%D1%80%D0%B3%D0%B5%D1%80%D1%8B_%D0%A8%D1%80%D0%B8-%D0%9B%D0%B0%D0%BD%D0%BA%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Mestiessche_vrouw.gif","page_title":"Бюргеры Шри-Ланки","context_page_description":"Бюргеры Шри-Ланки — этническая группа, сложившаяся на Шри-Ланке в результате смешения португальских, нидерландских и британских переселенцев с местным населением. Общее количество на Шри-Ланке — 39 599 человек. В результате эмиграции бюргерские общины сложились в Австралии, ЮАР, Великобритании и других странах."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%B1%D8%B3%D9%89_%D9%85%D8%B7%D8%B1%D9%88%D8%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Mersa_Matruh04.JPG","page_title":"مرسى مطروح","context_page_description":"مَرْسَىٰ مَطْرُوْح/ مدينة مصرية وعاصمة محافظة مطروح، وميناء بحري متوسطي، ومصيف يرتاده ملايين السياح لشهرة شواطئها ذات الرمال البيضاء الناعمة. وبُنيت المدينة على خليج يحميه من هيجان البحر امتداد من الصخور التي تُشكّل حائلًا طبيعيًا للأمواج، إلّا وابورًا صغيرًا تمرّ من خلاله المراكب الخفيفة."},{"page_url":"https://eu.wikipedia.org/wiki/Medikuntzaren_historia","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Konstantinderafrikaner.jpg","page_title":"Medikuntzaren historia","context_page_description":"Medikuntzaren historia osasunaren ezagutzak eta sendabideak izan duten bilakaera ikertzen duen historiaren adarra da. Bere jatorritik hasita, gizakia errealitatea bera eta bertan gertatzen diren bizia, heriotza edo gaixotasunaren gertaera transzendentalak azaltzen saiatu izan da. Lehenengo giza kultura eta zibilizazioek itxura batean kontrakoak ziruditen bi zutaberen gainean oinarritu zuten beraien praktika medikoa: alde batetik, izaera pragmatikoa zuen enpirismo primitiboan eta, beste alde batetik, medikuntza magiko-erlijioso batean, jainkoengana jotzen zuena adierazezina zena ulertzen saiatzeko. K. a. 500. urtean Alkmeon Krotonakoarekin, tekhné oinarritutako etapa bati hasiera eman zitzaion, non uste zen gaixotasuna, eralda edo konpon zitezkeen fenomeno natural batzuen ondorioz sortzen zela. Hau izan zen medikuntza modernoaren jatorria, nahiz eta hurrengo bi milurtekotan, korronte berri asko sortuko diren eta tradizio luzea duten beste kulturetako modeloak ere presente izango diren.\\nXIX. mendean, honela definitu zuten Auguste Bérard eta Adolphe Marie Gubler medikuek ordura arteko medikuntza: «Gutxitan sendatu, sarritan arindu, beti kontsolatu»."},{"page_url":"https://fi.wikipedia.org/wiki/Club_Atlas","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Atlaszorros.png","page_title":"Club Atlas","context_page_description":"Club Social y Deportivo Atlas de Guadalajara on vuonna 1916 perustettu jalkapalloseura Guadalajarasta, Meksikosta. Seuran edustusjoukkue pelaa maan korkeimmalla sarjatasolla Primera División de Méxicossa. Joukkueen kotistadionina toimii 56 713 -paikkainen Estadio Jalisco.\\nEnsimmäisen kerran joukkue voitti maan pääsarjamestaruuden kaudella 1950–1951."},{"page_url":"https://ko.wikipedia.org/wiki/2006%EB%85%84_FIFA_%EC%9B%94%EB%93%9C%EC%BB%B5_%EA%B2%B0%EC%84%A0_%ED%86%A0%EB%84%88%EB%A8%BC%ED%8A%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Fifa_worldcup_impression_cologne_20060626.jpg","page_title":"2006년 FIFA 월드컵 결선 토너먼트","context_page_description":"2006년 FIFA 월드컵의 결선 토너먼트는 조별 리그 이후에 치러지는 2006년 FIFA 월드컵의 두번째이자 최종 라운드이다. 각 조에서 상위 2개국씩 결선 토너먼트에 진출해 넉아웃 토너먼트를 펼쳤다. 준결승전에서 패한 두팀은 3위 결정전을 치렀다.\\n참고: 모든 시간은 중앙유럽 일광 절약 시간대를 따른다."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%95%A2%E6%AF%94_(%E9%98%BF%E8%82%AF%E8%89%B2%E5%B7%9E)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Beebe%2C_AR_005.jpg","page_title":"畢比 (阿肯色州)","context_page_description":"毕比是一个位于美国阿肯色州怀特县的城市。"},{"page_url":"https://zh.wikipedia.org/zh-my/%E6%9D%8E%E5%9C%A8%E7%8F%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/LEE_Jae-jin.jpg","page_title":"李在珍","context_page_description":"李在珍，韩国男子羽毛球运动员。他曾搭档黄智万参加2008年夏季奥林匹克运动会羽毛球男子双打比赛，最终两人成功为韩国队摘得一枚铜牌。"},{"page_url":"https://en.wikipedia.org/wiki/List_of_female_justice_ministers","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Rachida_dati.jpg","page_title":"List of female justice ministers","context_page_description":"A justice ministry, ministry of justice, or department of justice is a ministry or other government agency in charge of the administration of justice. The ministry or department is often headed by a minister of justice or secretary of justice. In countries where this agency is called a department the head of the department is entitled attorney general, for example in the United States. Some countries have a solicitor general.\\nSpecific duties may relate to organizing the justice system, overseeing the public prosecutor and maintaining the legal system and public order. Some ministries have additional responsibilities in related policy areas overseeing elections, directing the police, law reform. The duties of the ministry of justice may in some countries be split from separate responsibilities of an attorney general and the interior minister. Sometimes the prison system is separated into another government department called Corrective Services.\\nThere have been 122 female justice ministers since 1952, when Adriana Olguín was appointed by the Chilean government to be justice minister. She was also the first female minister in Latin America."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%AE%97%E6%95%99%E9%9A%94%E9%9B%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Christian_Bypass.jpg","page_title":"宗教隔離","context_page_description":"宗教隔離是指人們根據自己的宗教進行隔離的一種社會現象，也指法律規定或隱含的隔離制度。"},{"page_url":"https://bs.wikipedia.org/wiki/Uma_Thurman","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/File-Uma_Thurman_at_the_Tribeca_Film_Festival_4.jpg","page_title":"Uma Thurman","context_page_description":"Uma Karuna Thurman američka je glumica. Među njenim slavnijim filmovima jesu Pakleni šund, Kill Bill 1 i Kill Bill 2."},{"page_url":"https://es.wikipedia.org/wiki/Tom%C3%A1s_de_Melo","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/CondeSLuiz-capa.png","page_title":"Tomás de Melo","context_page_description":"Tomás José Fletcher de Melo, Tomás de Melo o Thomaz de Mello siguiendo la grafía de la época, ​ fue un escritor y bohemio portugués.\\nDe origen noble, su padre era un militar y su madre la hija de un rico comerciante inglés. Tomás regentó varios negocios: restaurantes de lujo, publicaciones, la Agência Universal de Anúncios... arruinándose en medio de una vida bohemia y extravagante en la capital portuguesa. Sobre su conducta de bon vivant y gourmet recogió la revista O António Maria:\\nQuem o não conhece, ao D. Thomaz de Mello, como um dos mais patuscos, mais curiosos, mais attrahentes typos d'essa bohemia de melhores tempos que lhe valeu agora, em boas reminiscencias, um alegre livro?! Quem o não conhece, ao da grande pera e mais o grande bigode, grande chapeu desabado e grande pança cahida, dilatada por quantas ceias e idas ás hortas memoraveis de que nos falla a Historia, e em que elle tomou parte, denodadamente, em tremendissimas pandegas de estalo!\\n​\\nMás conocido en vida por su vida excéntrica que por su obra literaria, alcanzó notoriedad como autor por los escándalos de algunas de sus obras.​"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9B%D0%B0-%D0%93%D1%80%D0%B0%D0%BD%D0%B4-%D0%9C%D0%BE%D1%82%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Fidji_Grande_Motte_011.jpg","page_title":"Ла-Гранд-Мотт","context_page_description":"Ла-Гранд-Мотт, Ла-Ґранд-Мотт — муніципалітет у Франції, у регіоні Лангедок-Руссільйон, департамент Еро. Населення — 8488 осіб.\\nМуніципалітет розташований на відстані близько 610 км на південь від Парижа, 18 км на схід від Монпельє."},{"page_url":"https://en.wikipedia.org/wiki/Pearsonothuria","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Pearsonothuria_graeffei_bassin.JPG","page_title":"Pearsonothuria","context_page_description":"Pearsonothuria is a genus of sea cucumbers in the family Holothuriidae. Pearsonothuria graeffei is the only species in the genus. Graeffe's sea cucumber is found in the tropical Indo-Pacific Ocean and the type locality is Viti Island, Fiji."},{"page_url":"https://en.wikipedia.org/wiki/USS_Pomander_(SP-702)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/USS_Pomander_%28SP-702%29.jpg","page_title":"USS Pomander (SP-702)","context_page_description":"USS Pomander (SP-702) was a United States Navy patrol vessel in commission from 1917 to 1918.\\nPomander was built in 1916 as a private motorboat of the same name by George Lawley & Son at Neponset, Massachusetts. On 29 May 1917, the U.S. Navy chartered her from Bertram B. Conrad of Wareham, Massachusetts, for use as a section patrol boat during World War I. She soon was commissioned as USS Pomander (SP-702).\\nAssigned to the 2nd Naval District in southern New England, Pomander carried out patrol duties for a time but eventually was deemed unfit for naval service and was returned to Lorenzo E. Anderson and Breckinridge Jones on 5 July 1918."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%A4%A7%E8%A5%BF%E6%B4%8B%E5%A5%B4%E9%9A%B8%E8%B2%BF%E6%98%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Slaves_resting_by_Rugendas_01.jpg","page_title":"大西洋奴隸貿易","context_page_description":"大西洋奴隸貿易，或稱為跨大西洋奴隸貿易。是指16世紀至19世紀時期，在環大西洋地區將非洲大陸人民作為廉價勞動力提供給美洲大陸殖民地地區的一種貿易。奴隸的來源主要是非洲西部和中部，黑人被歐洲人通過貿易或襲擊、綁架等手段抓獲販往美洲大陸。這一貿易活動在近代也被稱為黑奴貿易，然後實際上這一說法並不妥當，因為早在中世紀之前，就有黑奴的貿易活動出現了所以應當加上跨大西洋字樣。\\n奴隸貿易者包括：葡萄牙人、英國人、法國人、西班牙人、荷蘭人和美國人。部分貿易者在非洲的海岸擁有前哨，前哨有他們收買的當地的部落首領為他們提供奴隸。在長達約400年的帶有強烈殖民主義色彩的黑奴貿易中，目前估計約有1200萬人從非洲運到美洲的奴隸，部分學者得到的數據相對更高，尤其是從非洲得到的。將航運死亡的一千萬人計算入內後，非洲人口損失數據可以達到三千萬。"},{"page_url":"https://hu.wikipedia.org/wiki/Az_Amerikai_Egyes%C3%BClt_%C3%81llamok_%C3%A1llamai","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Ims_aerial.jpg","page_title":"Az Amerikai Egyesült Államok államai","context_page_description":"Az Amerikai Egyesült Államok tagállamai közé az 50 szövetségi tagállam tartozik, amelyek együtt alkotják az Amerikai Egyesült Államokat.\\nA tagállamok parlamentjeit együtt illeti meg a szuverenitás az Amerikai Egyesült Államok szövetségi törvényhozásával. Az Amerikai Egyesült Államok Alkotmánya szerint a szövetségi törvényhozás csak olyan tárgykörökben alkothat törvényeket, amelyeket az Alkotmány tételesen felsorol, minden más tárgykörben a törvényhozás joga az egyes tagállamokat illeti meg."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Epitaciol%C3%A2ndia","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Epitaciolandia_Acre.jpg","page_title":"Epitaciolândia","context_page_description":"Epitaciolândia sī ūi-tī Pa-se Acre chiu ê chi̍t ê chū-tī-thé."},{"page_url":"https://sv.wikipedia.org/wiki/Pseudencyoposis_bicornis","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Pseudencyoposis_bicornis.jpg","page_title":"Pseudencyoposis bicornis","context_page_description":"Pseudencyoposis bicornis är en insektsart som beskrevs av Van der Weele 1909. Pseudencyoposis bicornis ingår i släktet Pseudencyoposis och familjen fjärilsländor. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://de.wikipedia.org/wiki/Konferenz_von_Konstantinopel","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Constantinople_conference_west.jpg","page_title":"Konferenz von Konstantinopel","context_page_description":"Die Konferenz von Konstantinopel war eine Konferenz von Vertretern der europäischen Großmächte, die vom 12. Dezember 1876 bis 20. Januar 1877 in Konstantinopel, der Hauptstadt des Osmanischen Reichs, auf Drängen Großbritanniens stattfand. Sie war ein Versuch, die Balkankrise auf internationaler bzw. multinationaler Ebene zu lösen und so einen erneuten Russisch-Osmanischen Krieg zu verhindern. Dieser Versuch scheiterte an der wenig kompromissbereiten Haltung des Osmanischen Reiches ebenso wie an bilateralen russisch-österreichischen Absprachen."},{"page_url":"https://fr.wikipedia.org/wiki/Sinotruk","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Sinotruk_Howo_Truck.jpg","page_title":"Sinotruk","context_page_description":"China National Heavy Duty Truck Group Co., Ltd., CNHTC ou Sinotruk Group est un fabricant de camions appartenant à l'état chinois dont le siège est à Jinan, dans la province du Shandong. Il est actuellement le troisième constructeur de camions en Chine continentale. Il est célèbre pour avoir développé et fabriqué le premier camion lourd de Chine - \\"Huanghe\\" JN150."},{"page_url":"https://en.wikipedia.org/wiki/Michelangelo_Morlaiter","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Enrico_Merengo_Altare_di_San_Moise.jpg","page_title":"Michelangelo Morlaiter","context_page_description":"Michelangelo Morlaiter was an Italian painter, active mainly in Venice. He was one of the founding members and professor of the Accademia di Scoltura, Pittura, ed Architettura Civile in Venice in 1766.\\nHis father, Giovanni Maria Morlaiter, was a prominent sculptor. One of Michelangelo's pupils was Francesco Maggiotto."},{"page_url":"https://ca.wikipedia.org/wiki/Humbert_II_d%27It%C3%A0lia","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Umberto_II%2C_1944.jpg","page_title":"Humbert II d'Itàlia","context_page_description":"Humbert II d'Itàlia fou l'últim Rei d'Itàlia. Va ocupar el tron des de l'abdicació del seu pare el mes de maig de 1946 fins al referèndum que proclamà la república el 2 de juny del mateix any."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D1%80%D0%BC%D0%B5%D0%BD%D1%82%D0%B5%D1%80%D0%BE%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Armenteros_panorama.jpg","page_title":"Арментерос","context_page_description":"Арментерос — муниципалитет в Испании, входит в провинцию Саламанка в составе автономного сообщества Кастилия и Леон. Занимает площадь 38,93 км². Население — 467 человек. Расстояние до административного центра провинции — 52 км."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%9F%A2%E5%B7%BE%E7%94%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Yahaba_Station_west_exit.jpg","page_title":"矢巾町","context_page_description":"矢巾町是位于岩手县中部，紫波郡的一町。"},{"page_url":"https://el.wikipedia.org/wiki/%CE%9C%CE%B9%CE%BA%CF%84%CE%BB%CE%B1%CE%BD%CF%84%CE%B5%CE%BA%CE%BF%CF%8D%CF%84%CE%BB%CE%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/MictlantecuhtliTemploMayor_B.jpg","page_title":"Μικτλαντεκούτλι","context_page_description":"Στη μυθολογία των Αζτέκων, ο Μικτλαντεκούτλι είναι ο θεός των Νεκρών και ο Άρχοντας της Μικτλάν, του κατώτερου επιπέδου του Κάτω Κόσμου.\\nΑπεικονίζεται σαν ένας σκελετός γεμάτος αίμα ή σαν άνθρωπος με γυμνό κρανίο. Στο κεφάλι του φοράει φτερά από κουκουβάγια ενώ στο λαιμό του έχει περασμένο ένα περιδέραιο από ανθρώπινα μάτια.\\nΣύζυγός του είναι η Μικτεκασίουατλ. Μαζί διαμένουν σε ένα σπίτι δίχως παράθυρα στη Μικτλάν και εξουσιάζουν τους νεκρούς."},{"page_url":"https://fr.wikipedia.org/wiki/Art_du_Nouvel_Empire_%C3%A9gyptien","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3f/StatueOfHoremhebAndTheGodHorus-Detail2.JPG","page_title":"Art du Nouvel Empire égyptien","context_page_description":"L'art du Nouvel Empire égyptien correspond aux règnes des XVIIIᵉ, XIXᵉ et XXᵉ dynasties, le Nouvel Empire égyptien. Il atteint un apogée dans l'art de l'Égypte antique qu'il ne retrouvera plus ensuite. En effet, après cette longue période de rayonnement, la Troisième Période intermédiaire, puis la Basse époque n'auront plus les moyens de tels investissements dans les arts. Cette époque marque aussi une rupture nette après la Deuxième Période intermédiaire aux productions révélatrices de l'état d'une société bouleversée.\\nC'est la grande période de l'architecture funéraire, après l'époque des pyramides de l'Ancien Empire. Dans la vallée des Rois, ces volumes architecturés sont creusés à flanc de montagne, et pour certains d'entre-eux, construits devant l'ouverture, comme le temple funéraire d'Hatchepsout et son tombeau à Deir-el-Bahari, légèrement au sud de la vallée des Rois, et adossé à la paroi rocheuse d'une montagne, qui fait office de pyramide, immense.\\nLe trésor de Toutânkhamon a révélé aux yeux éblouis du monde, un véritable flot d'or et de pierres, travaillé avec un art sidérant. De magnifiques objets, de marqueterie, de céramique, une accumulation de joyaux."},{"page_url":"https://pl.wikipedia.org/wiki/Ro%C5%BCniat%C3%B3w_(Ukraina)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Rozhnyativ_prapor.png","page_title":"Rożniatów (Ukraina)","context_page_description":"Rożniatów – osiedle typu miejskiego na Ukrainie, stolica rejonu w obwodzie iwanofrankiwskim."},{"page_url":"https://da.wikipedia.org/wiki/Ladoga","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3c/Russia_edcp_relief_location_map.jpg","page_title":"Ladoga","context_page_description":"Ladoga er Europas største ferskvandssø. Den ligger i det nordvestlige Rusland ved den finske grænse. Ladoga har tilløb fra Onega gennem Svir og afløb gennem Neva til Finske Bugt.\\nSøens areal er ca. 17.700 kvadratkilometer.\\nVed søens sydside lå handelsbyen Staraja Ladoga, som i 1703 blev flyttet til Novaja Ladoga.\\nFra 1617 til 1721 gik grænsen mellem Sverige og Rusland igennem søen, og i 1812-1940 var søen grænse mellem Finland og Rusland.\\nLadogasælen Phoca hispida ladogensis er en underart af ringsælen og er endemisk for Ladoga.\\nLangs søens sydkyst går Ladogakanalen, der forbinder Svir og Neva. Kanalen benyttes stort set ikke mere, men havde til formål at undgå sejlads på den åbne sø."},{"page_url":"https://de.wikipedia.org/wiki/Ford_Mustang","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/2010_Ford_Mustang_GT500--DC.jpg","page_title":"Ford Mustang","context_page_description":"Der Ford Mustang ist ein seit Frühjahr 1964 vom amerikanischen Automobilhersteller Ford gebauter Sportwagen und der Vorläufer der Pony-Car-Klasse.\\nDa die Bezeichnung „Mustang“ für die Unternehmen Krupp und Kreidler markenrechtlich geschützt war, wurde der Mustang bis 1979 in Deutschland als „T5“ vertrieben. Der Mustang löste den Thunderbird als Nummer eins der Sportcoupés von Ford ab.\\nIm August 2018 wurde in Dearborn, Michigan der 10-millionste Ford Mustang produziert."},{"page_url":"https://fr.wikipedia.org/wiki/Festival_de_Cannes_2013","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Steven_Spielberg_Cannes_2013.jpg","page_title":"Festival de Cannes 2013","context_page_description":"Le Festival de Cannes 2013, 66ᵉ édition du festival, a lieu du 15 au 26 mai 2013 au palais des festivals. La maîtresse de cérémonie est l’actrice Audrey Tautou et le président du jury est le réalisateur et producteur américain Steven Spielberg.\\nLa Vie d'Adèle d'Abdellatif Kechiche remporte la Palme d’or. Le jury associe exceptionnellement les actrices Adèle Exarchopoulos et Léa Seydoux à cette récompense habituellement décernée au réalisateur."},{"page_url":"https://id.wikipedia.org/wiki/Rambu_lalu_lintas_di_Indonesia","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Indonesia_New_Road_Sign_4b10.png","page_title":"Rambu lalu lintas di Indonesia","context_page_description":"Rambu lalu lintas di Indonesia adalah rambu lalu lintas terstandarisasi yang merupakan kustomisasi dari rambu lalu lintas yang berlaku di wilayah Indonesia. Dasar hukum terkini dalam mengatur rambu lalu lintas di Indonesia merujuk kepada Peraturan Kementerian Perhubungan Nomor 13 Tahun 2014."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%B9%E0%B4%BE%E0%B4%B1%E0%B5%8D%E0%B4%B1%E0%B5%8D_%E0%B4%96%E0%B4%BE%E0%B4%A8%E0%B5%8B%E0%B4%82-%E0%B4%AE%E0%B5%81_%E0%B4%95%E0%B5%8B_%E0%B4%A4%E0%B5%87%E0%B5%BD_%E0%B4%A4%E0%B4%BE%E0%B4%AF%E0%B5%8D_%E0%B4%A6%E0%B5%87%E0%B4%B6%E0%B5%80%E0%B4%AF%E0%B5%8B%E0%B4%A6%E0%B5%8D%E0%B4%AF%E0%B4%BE%E0%B4%A8%E0%B4%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Hat_Khanom-Mu_Ko_Thale_Tai_%283%29.jpg","page_title":"ഹാറ്റ് ഖാനോം-മു കോ തേൽ തായ് ദേശീയോദ്യാനം","context_page_description":"ഹാറ്റ് ഖാനോം-മു കോ തേൽ തായ് ദേശീയോദ്യാനം 2015-ൽ നിലവിൽവന്ന ഒരു ദേശീയോദ്യാനം ആണ്. തെക്കൻ തായ്ലാൻറിലാണ് ഈ ദേശീയോദ്യാനം സ്ഥിതിചെയ്യുന്നത്. നഖോൺ സി ഥമാരാട്ട് പ്രവിശ്യയിലെ ഖനാം, സൈകോൺ ജില്ലകൾ, നഖോൺ സി തിമാരത് പ്രവിശ്യ, ഡോൺ സക്, കോ സാമുയി, സൂററ്റ് തനി പ്രവിശ്യ എന്നിവിടങ്ങളിൽ ഹാറ്റ് ഖാനോം-മു കോ തേൽ തായ് ദേശീയോദ്യാനം വ്യാപിപ്പിച്ചുകിടക്കുന്നു. ജില്ലയുടെ ഭൂരിഭാഗം പ്രദേശങ്ങളും ഹാറ്റ് ഖാനോം-മു കോ തേൽ തായ് ദേശീയോദ്യാനത്തിന്റെ ഭാഗമായി സംരക്ഷിക്കപ്പെട്ടിരിക്കുന്നു -പാർക്കിനെ രണ്ട് പ്രധാന ഭാഗങ്ങളായി കണക്കാക്കുന്നു. ഹാറ്റ് ഖാനോം ഖാനോം ജില്ലയുടെ ബീച്ചുകളെ സൂചിപ്പിക്കുന്നു. തേൽ തായ് ദ്വീപസമൂഹത്തിൽ തായ്ലൻഡ് ഉൾക്കടലിൽ എട്ട് ദ്വീപുകൾ ഖാനോമിനും കോ സാമുയിയ്ക്കുമിടയിൽ ഉൾക്കൊള്ളുന്നു. കോ മത് ടാങ്, കോ മത് കോങ്, കോ റാപ്, കൊ ഹുവ ത ഖേ, കോ വാങ് നായി, കോ വാങ് നക്, കോ നോയി, കോ ത റായി, എല്ലാ ദ്വീപുകളും സെകോൺ, ഖാനോം ജില്ലകളിൽ നഖോൺ സി താമാരത് പ്രവിശ്യയിൽ കോ സാമുയി ജില്ല, സൂററ്റ് തനി എന്നിവിടങ്ങളിലായി കാണപ്പെടുന്നു."},{"page_url":"https://hu.wikipedia.org/wiki/Kong%C3%B3i_Demokratikus_K%C3%B6zt%C3%A1rsas%C3%A1g","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Baptist_Church%2C_Vanga_DRC.jpg","page_title":"Kongói Demokratikus Köztársaság","context_page_description":"A Kongói Demokratikus Köztársaság Közép-Afrikában található. Északon a Közép-afrikai Köztársaság és Dél-Szudán, keleten Uganda, Ruanda, Burundi és Tanzánia, délen Zambia és Angola, nyugaton pedig a Kongói Köztársaság határolja. Az ország 40 km hosszú tengerparttal rendelkezik a Kongó folyó torkolatánál.\\nAz egykori Kongói Szabad Állam, majd mint Belga Kongó megszűnése után függetlenné vált ország a Kongó-Léopoldville, majd a Kongó-Kinshasa nevet vette fel, 1971-től pedig Zaire néven létezett. 1997-ben a neve a jelenleg is használatosra változott."},{"page_url":"https://war.wikipedia.org/wiki/Turnera_oculata","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Turnera_oculata.jpg","page_title":"Turnera oculata","context_page_description":"An Turnera oculata in uska species han Magnoliopsida nga ginhulagway ni Story ngan Fernandes. An Turnera oculata in nahilalakip ha genus nga Turnera, ngan familia nga Passifloraceae. Nag-uusahan nga subspecies: T. o. paucipilosa."},{"page_url":"https://sv.wikipedia.org/wiki/Aureoboletus_auriporus","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Aureoboletus_auriporus_227205.jpg","page_title":"Aureoboletus auriporus","context_page_description":"Aureoboletus auriporus är en svampart som först beskrevs av Peck, och fick sitt nu gällande namn av Zdeněk Pouzar 1957. Aureoboletus auriporus ingår i släktet Aureoboletus och familjen Boletaceae. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://de.wikipedia.org/wiki/31._Oktober","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Hygiene_exhibition_1911%2C_main_entrance.jpg","page_title":"31. Oktober","context_page_description":"Der 31. Oktober ist der 304. Tag des gregorianischen Kalenders, somit bleiben 61 Tage bis zum Jahresende."},{"page_url":"https://hr.wikipedia.org/wiki/Linijski_putni%C4%8Dki_zrakoplov","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Farman-goliath.jpg","page_title":"Linijski putnički zrakoplov","context_page_description":"Linijski putnički zrakoplov je veliki avion prvenstveno namijenjen komercijalnom prijevozu putnika i tereta. U pravilu ga koriste avioprijevoznici. Definicija linijskog putničkog aviona različita je od zemlje do zemlje, ali ona najčešće označava prazni avion s težinom iznad 22.680 kilograma, s dva ili više motora."},{"page_url":"https://en.wikipedia.org/wiki/Grade_II*_listed_buildings_in_Cornwall_(A%E2%80%93G)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Basill_Manor_near_St_Clether_-_geograph.org.uk_-_936135.jpg","page_title":"Grade II* listed buildings in Cornwall (A–G)","context_page_description":"There are over 20,000 Grade II* listed buildings in England."},{"page_url":"https://tr.wikipedia.org/wiki/Justin_Bieber","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Justin_Bieber.jpg","page_title":"Justin Bieber","context_page_description":"Justin Drew Bieber, Kanadalı pop, çağdaş R&B şarkıcısı, oyuncu ve şarkı yazarıdır.\\nKariyeri, video paylaşım sitesi Youtube'a koyduğu videoların 2008 yılında Scooter Braun tarafından keşfedilmesiyle başladı. Sonraki günlerde Braun, Justin Bieber'ın menajeri olmuştur. Braun Atlanta'da, Bieber ve R&B sanatçısı Usher tanıştırmış ve Bieber Usher ve Scooter Braun'nun ortak şirketi Raymond Braun Media Group ile anlaşma imzalamış, ardından Island Records ile albüm kontratı yapmıştır.\\nJustin Bieber'ın ilk single'ı One Time oldukça iyi bir çıkış yakalamış ve One Less Lonely Girl teklisi ile birlikte Kanada Hot 100'de 15'e, Bilboard Hot 100'de ise ilk 20'ye girme başarısı elde etmiştir. Bieber'ın ilk albümü \\"My World\\" 17 Kasım 2009'da çıkmıştır."},{"page_url":"https://pl.wikipedia.org/wiki/Nam_Jie-youn","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/%EB%88%88%EC%9D%B4_%EC%A6%90%EA%B1%B0%EC%9B%A0%EB%8D%98_%EC%B1%94%ED%94%BC%EC%96%B8%EA%B2%B0%EC%A0%95%EC%A0%84.jpg","page_title":"Nam Jie-youn","context_page_description":"Nam Jie-youn – południowokoreańska siatkarka, grająca jako libero, trener. Występowała w drużynie GS Caltex."},{"page_url":"https://ka.wikipedia.org/wiki/Cyphomyrmex_nesiotus","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Cyphomyrmex_nesiotus_jtlc000009386_head_1.jpg","page_title":"Cyphomyrmex nesiotus","context_page_description":"Cyphomyrmex nesiotus — ფეხსახსრიანთა ტიპის მწერთა კლასის ჭიანჭველასებრთა ერთ-ერთი ნაირსახეობა Cyphomyrmex-ის გვარიდან."},{"page_url":"https://en.wikipedia.org/wiki/Sumy","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Sumy_Troyits%27ka_6_Kostel_01_%28YDS_3853%29.JPG","page_title":"Sumy","context_page_description":"Sumy is a city in north-eastern Ukraine, and the capital of Sumy Oblast. Sumy also serves as the administrative center of Sumy Raion of Sumy oblast. Sumy is administratively incorporated as a city of oblast significance and does not belong to the raion. As of 2019 its population is estimated at 265,140."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B5%D0%B1%D0%B5%D1%80,_%D0%9F%D1%91%D1%82%D1%80","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7f/Lw%C3%B3w_-_Cerkiew_Uspie%C5%84ska.jpg","page_title":"Бебер, Пётр","context_page_description":"Пётр Бебер, известный как Пруссак — придворный архитектор короля Речи Посполитой Яна ІІІ Собеского."},{"page_url":"https://cs.wikipedia.org/wiki/Mez%C5%91hegyes","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Mez%C5%91hegyes.jpg","page_title":"Mezőhegyes","context_page_description":"Mezőhegyes [mezéheděš] je město v jihovýchodním Maďarsku v župě Békés, těsně u rumunských hranic, spadající pod okres Mezőkovácsháza. Nachází se asi 49 km jihozápadně od Békéscsaby. V roce 2015 zde žilo 5 339 obyvatel. Podle statistik z roku 2011 zde byli 88,4 % Maďaři, 0,6 % Rumuni, 0,4 % Slováci, 0,2 % Němci a 0,2 % Romové.\\nNejbližšími městy jsou Battonya, Csanádpalota, Mezőkovácsháza, Tótkomlós a rumunská města Arad, Nădlac a Pecica. Blízko jsou též obce Pitvaros a Végegyháza. Ve městě není hraniční přechod, nejbližší je v Csanádpalotě.\\nNachází se zde zemědělské letiště Mezőhegyes mezőgazdasági repülőtér."},{"page_url":"https://oc.wikipedia.org/wiki/Lista_de_personatges_galeses","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Raymond_Williams_At_Saffron_Walden.jpg","page_title":"Lista de personatges galeses","context_page_description":"Aquela lista es eissida de las donadas de Wikidata e periodicament mesa a jorn per un bòt.\\nLas edicions fachas al dintre de la lista seràn escafadas a la mesa a jorn seguenta!"},{"page_url":"https://es.wikipedia.org/wiki/Tr%C3%A8ves_(Gard)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4e/Map_commune_FR_insee_code_30332.png","page_title":"Trèves (Gard)","context_page_description":"Trèves es una población y comuna francesa, situada en la región de Languedoc-Rosellón, departamento de Gard, en el distrito de Le Vigan. Es el chef-lieu de cantón más pequeño del departamento."},{"page_url":"https://ro.wikipedia.org/wiki/Saint_Thomas,_Barbados","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/92/Barbados-Saint_Thomas.png","page_title":"Saint Thomas, Barbados","context_page_description":"Saint Thomas este una din cele unsprezece parohii ale statului caraibian Barbados. Se află în mijlocul insulei, fiind una dintre cele două parohii care nu au deschidere la ocean."},{"page_url":"https://de.wikipedia.org/wiki/Ahja_(P%C3%B5lva)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Ahja_m%C3%B5isahoone_tagantvaade.jpg","page_title":"Ahja (Põlva)","context_page_description":"Ahja ist ein Dorf im Südosten Estlands. Es war 2017 der Hauptort der Landgemeinde Ahja im Kreis Põlva. Seither liegt Ahja in der Gemeinde Põlva."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%B0%D1%80%D1%83%D1%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/BaruchBulla.jpg","page_title":"Варух","context_page_description":"Ва́ру́х, или Ба́ру́х — библейский пророк, писец, друг и секретарь пророка Иеремии. Книга пророка Варуха входит в число неканонических ветхозаветных книг в славянской и русской Библии и в число второканонических книг в католицизме. Один из сынов Нирии, из колена Иудина, по Флавию, из знаменитой фамилии."},{"page_url":"https://es.wikipedia.org/wiki/Bas%C3%ADlica_de_Santa_Mar%C3%ADa_la_Mayor_(B%C3%A9rgamo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Bergamo_santa_maria_maggiore_abside.jpg","page_title":"Basílica de Santa María la Mayor (Bérgamo)","context_page_description":"La basílica de Santa María la Mayor se encuentra en la ciudad italiana de Bérgamo."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%81%D9%87%D8%B1%D8%B3%D8%AA_%D9%86%D8%AE%D8%B3%D8%AA%E2%80%8C%D9%88%D8%B2%DB%8C%D8%B1%D8%A7%D9%86_%D8%A7%D8%B3%D8%AA%D8%B1%D8%A7%D9%84%DB%8C%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/StanleyBruce2.jpg","page_title":"فهرست نخست‌وزیران استرالیا","context_page_description":"فهرست نخست‌وزیران استرالیا"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Ha%C3%9Ffurt","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Ha%C3%9Ffurt%2C_Hauptstra%C3%9Fe_60-001.jpg","page_title":"Liste der Baudenkmäler in Haßfurt","context_page_description":"Auf dieser Seite sind die Baudenkmäler der unterfränkischen Stadt Haßfurt zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde.\\nDiese Liste gibt den Fortschreibungsstand vom 1. Mai 2020 wieder und enthält 223 Baudenkmäler."},{"page_url":"https://en.wikipedia.org/wiki/Crispin_Varquez","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Crispin_Varquez.png","page_title":"Crispin Varquez","context_page_description":"Crispin Barrete Varquez is a prelate of the Catholic Church in the Philippines. He is the current Bishop of Borongan in Eastern Samar. His previous appointment was as Vicar General of the Diocese of Tagbilaran in January 2007."},{"page_url":"https://en.wikipedia.org/wiki/River_Falls,_Alabama","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Covington_County_Alabama_Incorporated_and_Unincorporated_areas_River_Falls_Highlighted_0164776.svg","page_title":"River Falls, Alabama","context_page_description":"River Falls is a town in Covington County, Alabama, United States. At the 2010 census the population was 526."},{"page_url":"https://ca.wikipedia.org/wiki/Llista_de_monuments_de_Ventall%C3%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Can_Salin%C3%A9%2C_Montir%C3%B3.jpg","page_title":"Llista de monuments de Ventalló","context_page_description":"Llista de monuments de Ventalló inclosos en l'Inventari del Patrimoni Arquitectònic de Catalunya al terme municipal de Ventalló. Inclou els inscrits en el Registre de Béns Culturals d'Interès Nacional, catalogats com a monuments històrics, i els béns culturals d'interès local de caràcter arquitectònic."},{"page_url":"https://fi.wikipedia.org/wiki/Ilmajoki","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Ilmajoki_villages.png","page_title":"Ilmajoki","context_page_description":"Ilmajoki on vuonna 1865 perustettu Suomen kunta, joka sijaitsee Etelä-Pohjanmaan maakunnassa. Kunnassa asuu 12 278 ihmistä, ja sen pinta-ala on 579,79 km², josta 2,89 km² on vesistöjä. Väestötiheys on 21,1 asukasta/km². Kunnan asukkaista viidesosa on alle 14-vuotiaita ja sen asukasluku on kasvanut viimeisen kymmenen vuoden aikana noin 700 hengellä. Ilmajoen naapurikunnat ovat Isokyrö, Kurikka, Laihia ja Seinäjoki.\\nEntinen emäpitäjä Ilmajoki on maisemaltaan ja luonnoltaan pohjalaista lakeusmaisemaa. Ilmajoen halki virtaavan Etelä-Pohjanmaan suurimman joen Kyrönjoen rantamaat ovat Suomen vilja-aittoja. Kyrönjoki on valittu yhdeksi Suomen kansallismaisemaksi.\\nIlmajoen kunnan veroprosentti on 21,00 vuonna 2020. Ilmajoen uusiutuvan sähkön tuotanto on suurempaa kuin sähkön kulutus.\\nIlmajokelaisia menestyneitä urheilijoita ovat muiden muassa keihäänheittäjä Tero Pitkämäki sekä painijat Jarkko Ala-Huikku ja Marko Yli-Hannuksela. Paikkakunnalla vuosittain järjestettävät Ilmajoen Musiikkijuhlat keräävät kesäkuussa tuhansia oopperavieraita. Finland Festivals on nimennyt Ilmajoen Musiikkijuhlat vuoden festivaaliksi 2017."},{"page_url":"https://fr.wikipedia.org/wiki/Fjallfoss","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Dynjandi_Iceland.jpg","page_title":"Fjallfoss","context_page_description":"La Fjallfoss, toponyme islandais signifiant littéralement en français « cascade de la montagne », est une cascade dominant l'Arnarfjörður dans le Nord-Ouest de l'Islande, la plus grande des chutes d'eau de la région des Vestfirðir."},{"page_url":"https://nl.wikipedia.org/wiki/Les_Aires","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Les_Aires%2C_H%C3%A9rault_04.jpg","page_title":"Les Aires","context_page_description":"Les Aires is een gemeente in het Franse departement Hérault en telt 544 inwoners. De plaats maakt deel uit van het arrondissement Béziers."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%81%A8%E3%81%A3%E3%81%A8%E3%82%8A%E3%83%A9%E3%82%A4%E3%83%8A%E3%83%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Kiha_58_Wakatori_Liner_19880729.jpg","page_title":"とっとりライナー","context_page_description":"とっとりライナーは、西日本旅客鉄道が山陰本線の鳥取駅 - 米子駅・出雲市駅間で運転している快速列車である。"},{"page_url":"https://zh.wikipedia.org/wiki/2017%E5%B9%B4%E7%B4%A2%E9%A6%AC%E5%88%A9%E8%98%AD%E5%A4%A7%E9%81%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Musabehi1234.jpg","page_title":"2017年索馬利蘭大選","context_page_description":"2017年索馬里蘭議會選舉是於2017年在索馬里蘭舉行的選舉，藉此選出索馬里蘭的議會議員。此次選舉原定的時間是2010年9月，但當時包括議會、總統與選舉委員會皆表示沒有舉辦的可能性，因此將議員的立法職務任期延長至2013年。在野黨則宣稱此項決定違法。然而，2013年時因為登記選民不足的問題，再度宣告延期，至少到2014年才有機會進行投票。\\n2015年9月，索馬里蘭政府宣布將選舉定在2017年3月27日舉行，之後又延至11月13日。"},{"page_url":"https://fr.wikipedia.org/wiki/Augustus_Hervey","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a7/Augustus_Earl_of_Bristol.jpg","page_title":"Augustus Hervey","context_page_description":"Augustus John Hervey, né le 19 mai 1724 dans le Derbyshire, mort le 23 décembre 1779 à Londres, 3ᵉ comte de Bristol, est un officier et amiral de la Royal Navy ainsi que Lord de l'Amitauté britannique. Il s'illustra pendant la guerre de Sept Ans et fit une carrière politique sous les règnes de George II et George III de Grande-Bretagne. Il devint pair de Grande-Bretagne en héritant du titre de comte de Bristol."},{"page_url":"https://en.wikipedia.org/wiki/Sylvania_Heights,_New_South_Wales","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7f/Sylvania_Heights_Plaza.jpg","page_title":"Sylvania Heights, New South Wales","context_page_description":"Sylvania Heights is a locality in southern Sydney, in the state of New South Wales, Australia. Sylvania Heights is located in the north-western part of the suburb of Sylvania.\\nThe main road through the locality is Princes Highway which is lined with shops, including Sylvania Heights Plaza."},{"page_url":"https://en.wikipedia.org/wiki/Divinol%C3%A2ndia","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Divinol%C3%A2ndia-SP_-_panoramio.jpg","page_title":"Divinolândia","context_page_description":"Divinolândia is a municipality in the state of São Paulo in Brazil. The population is 11,492 in an area of 224 km². The elevation is 1,040 m."},{"page_url":"https://it.wikipedia.org/wiki/Bangkok_Love_Stories","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/China_Town%2C_Bangkok%2C_Tailandia%2C_2013-08-22%2C_DD_01.jpg","page_title":"Bangkok Love Stories","context_page_description":"Bangkok Love Stories è una serie televisiva antologica thailandese ideata da Ekachai Uekrongtham, prodotta da GMM BRAVO e andata in onda tra il 2018 e il 2019 sull'emittente GMM 25. Essa è strutturata in quattro stagioni autoconclusive, trasmesse alternativamente a coppie: Innocence, Hey You!, Plead e Object of affection. In Italia le stagioni sono state distribuite Netflix dal 12 marzo al 2 luglio 2019.\\nL'opera ha come prequel Bangkok rak Stories."},{"page_url":"https://de.wikipedia.org/wiki/Kino_in_Dresden","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/20190227_Dresden_051.jpg","page_title":"Kino in Dresden","context_page_description":"Kino in Dresden skizziert auszugsweise die Entwicklung der Dresdner Film- und Kinogeschichte von den ersten kinematographischen Schaubuden, dem ersten Filmprojektor von Heinrich Ernemann hin zu einer Kinostadt der 1920er und 1930er Jahre. Gleichzeitig werden Umfang und Ausmaß einer zerstörten Kinokultur und deren Wiederaufbau nach den Luftangriffen vom 13. Februar 1945 dargestellt."},{"page_url":"https://de.wikipedia.org/wiki/STS-107","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/KSC-107-Rollout.jpg","page_title":"STS-107","context_page_description":"STS-107 ist die Missionsbezeichnung für einen Flug des US-amerikanischen Space Shuttle Columbia der NASA. Der Start erfolgte am 16. Januar 2003. Die Fähre brach nach zweiwöchigem Flug am 1. Februar 2003 beim Wiedereintritt in die Erdatmosphäre auseinander. Alle sieben Besatzungsmitglieder kamen dabei ums Leben.\\nEs war die 113. Space-Shuttle-Mission – die einzige des Jahres 2003 – und der 28. Flug der Raumfähre Columbia."},{"page_url":"https://en.wikipedia.org/wiki/Todd_Kelly","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Todd_Kelly_and_Garth_Tander.jpg","page_title":"Todd Kelly","context_page_description":"Todd Kelly is a retired Australian professional racing driver who competed in the Virgin Australia Supercars Championship. He is the older brother of fellow Supercars driver and former Bathurst 1000 winner, Rick Kelly. He drove for the Holden Racing Team from 2003 until 2007, and Perkins Engineering in 2008. Since 2009, he has been with his family team Kelly Racing. He is the youngest driver to have reached 100 starts in the series."},{"page_url":"https://bs.wikipedia.org/wiki/Asplenium","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Asplenium_trichomanes_subsp_quadrivalens.jpg","page_title":"Asplenium","context_page_description":"Asplenium je rod paprati, sa preko 700 vrsta, često smatran jedinim rodom porodice Aspleniaceae. Drugi autori smatraju da je i Hymenasplenium drugi rod u porodici, zasnovano na molekulskofilogenetičkoj analizi sekvenci DNK, različitom broju hromosoma i strukturnim razlikama u rizomima. Tipska vrsta roda je Asplenium marinum.\\nNajčešći narodni naziv je slezenice ili slezenaste paprati, koji se primjenjuje se za uobičajenije vrste."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%BD%D1%82%D0%B8%D0%BA%D1%80%D1%96%D0%BF%D0%BE%D1%81%D0%BD%D0%B8%D1%86%D1%8C%D0%BA%D0%B8%D0%B9_%D1%80%D1%83%D1%85_%D0%B2_%D0%A3%D0%BA%D1%80%D0%B0%D1%97%D0%BD%D1%96_(1789-1861)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Karmelyuk.JPG","page_title":"Антикріпосницький рух в Україні (1789-1861)","context_page_description":"Антикріпосницький рух в Україні (1789-1861) — масові заворушення на території України спричинені остаточним встановленням всеросійських норм закріпачення на підконтрольних Російській Імперії теренах, які було юридично оформлено пунктом 8 указу Катерини ІІ від 3 травня 1783 року."},{"page_url":"https://hr.wikipedia.org/wiki/Henrik_V.,_kralj_Francuske","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Comte-de-chambord.jpg","page_title":"Henrik V., kralj Francuske","context_page_description":"Henrik V., kralj Francuske i Navarre od 2.-9. kolovoza 1830.\\nPuno ime - Henri-Charles-Ferdinand-Marie-Dieudonné de Bourbon-Artois, duc de Bordeaux, comte de Chambord\\nTijekom srpanjske revolucije 1830. godine najprije kraljevi Karlo X., potom dvadeset minuta kasnije i Luj XIX. su potpisali svoje abdikacije. Kako Luj XIX. nije imao svoje djece on je abdicirao u korist Henrika V. svoga nećaka.\\nNa vijest o pravno valjanoj abdikaciji u njegovu korist on je automatski bio proglašen kraljem Francuske i Navarre čemu su se žestoki usprotivili revolucionari. Tijekom sedam dana manipulacija unutar parlamenta pod kontrolom pobunjenika donesena je retroaktivna, u prijevodu legalno nevažeća odluka da je abdikacija Luja XIX. važeća, ali da je njegovo prenošenje krune na svog najbližeg krvnog nasljednika nevažeće. Ta pravna šuć-muć odluka je zapečaćena proglašenjem Luja Filipa novim kraljem.\\nPoslije pada drugog francuskog carstva 1871. godine Henriku V. je bila ponuđena kruna za čije primanje on u tipično glupom stilu posljednjih Bourbona postavlja ultimatum državi da ona promjeni zastavu ili on neće biti kralj. Pošto mu je taj ultimatum odbijen, Henrik V. je odbio primiti krunu."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A1%D0%B2._%D1%81%D0%B2._%D0%9F%D0%B5%D1%82%D1%8A%D1%80_%D0%B8_%D0%9F%D0%B0%D0%B2%D0%B5%D0%BB_(%D0%A2%D1%80%D0%B5%D1%81%D0%BE%D0%BD%D1%87%D0%B5)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/%D0%A6%D1%80%D0%BA%D0%B2%D0%B0%D1%82%D0%B0_%D0%A1%D0%B2%D0%B5%D1%82%D0%B8_%D0%9F%D0%B5%D1%82%D0%B0%D1%80_%D0%B8_%D0%9F%D0%B0%D0%B2%D0%BB%D0%B5_-_%D1%81._%D0%A2%D1%80%D0%B5%D1%81%D0%BE%D0%BD%D1%87%D0%B5.JPG","page_title":"Св. св. Петър и Павел (Тресонче)","context_page_description":"„Св. св. апостоли Петър и Павел“ е възрожденска църква в дебърското мияшко село Тресонче, Северна Македония. Църквата е част от Дебърско-Реканското архиерейско наместничество на Дебърско-Кичевската епархия на Македонската православна църква - Охридска архиепископия.\\nЦърквата е завършена в 1844 година, след около десетина година пауза в строителството, породена от това, че главният ктитор Сарджо Брадина е на заточение в Призрен. Представлява трикорабна, безкуполна базилика.\\nФреските в църквата са дело на големия възрожденски майстов Дичо Зограф и сина му Аврам Дичов, Заедно с тях в църквата работи и Петър Новев.\\nИзписването на престолните икони започва в 1845 година, когато Дичо Зограф датира и подписва иконите „Света Богородица Одигитрия“, „Исус Христос Вседържител“, „Свети Йоан Предтеча“ и „Събор на Светите Апостоли“. На следната 1846 година изработва иконите „Свети Никола Чудотворец“, „Свети Трима Йерарси“ и „Свети Атанасий“. Престолните икони за този храм са едни от най-впечатляващите му дела.\\nСлед работа на други места Дичо Зограф се връща в „Свети апостоли Петър и Павел“ и изписва светците покровители в цял ръст и с модел на църква в ръцете в нишата над входната врата."},{"page_url":"https://fr.wikipedia.org/wiki/Croissy-Beaubourg","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Etang_de_Croissy2.jpg","page_title":"Croissy-Beaubourg","context_page_description":"Croissy-Beaubourg est une commune française située dans le département de Seine-et-Marne en région Île-de-France.\\nSes habitants sont appelés les Croisséens."},{"page_url":"https://de.wikipedia.org/wiki/Oswald_Mathias_Ungers","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Hamburg.GalerieDerModerne.wmt.jpg","page_title":"Oswald Mathias Ungers","context_page_description":"Oswald Mathias Ungers war ein deutscher Architekt und Architekturtheoretiker. Für den auch außerhalb Deutschlands bekannten Wettbewerbs-Architekten standen in Architekturfachkreisen und Publikationen die Initialen OMU seines Namens als polarisierende „Trademark“ für die Kompromisslosigkeit seiner Baukunst. Er sah sich Entwurfs- und Gestaltungsprinzipien verpflichtet, die er aus der Vergangenheit ableitete, weiterentwickelte und in seinen Bauten jenseits aller Moden und Schulen als in seiner Sicht zeitgemäßen Ausdruck allgemeiner menschlicher Ordnungen zu verwirklichen suchte."},{"page_url":"https://vi.wikipedia.org/wiki/N%C3%BAi_l%E1%BB%ADa","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Olympus_Mons.jpeg","page_title":"Núi lửa","context_page_description":"Núi lửa là một vết đứt gãy trên lớp vỏ của một hành tinh, như là Trái Đất cho phép dung nham, tro núi lửa, và khí thoát ra từ một lò magma ở dưới bề mặt.\\nNúi lửa trên Trái Đất xảy ra vì lớp vỏ của nó được chia thành 17 mảng kiến tạo lớn, cứng rắn nổi trên lớp phủ nóng hơn và mềm hơn. Do đó, trên Trái Đất, núi lửa thường xuất hiện ở ranh giới giữa các mảng kiến tạo, và hầu hết là ở dưới nước. Ví dụ, một sống núi giữa đại dương, như là sống núi giữa Đại Tây Dương, có núi lửa do các mảng kiến tạo phân kỳ, trong khi vành đai lửa Thái Bình Dương có núi lửa do các mảng kiến tạo hội tụ. Núi lửa cũng có thể hình thành nơi các mảng kiến tạo kéo dài và mỏng đi, ví dụ như ở đới tách giãn Đông Phi hay cánh đồng núi lửa Wells Gray-Clearwater và đới tách giãn Rio Grande tại Bắc Mỹ. Loại hoạt động núi lửa này thuộc \\"thuyết mảng\\". This type of volcanism falls under the umbrella of \\"plate hypothesis\\" volcanism. Hoạt động núi lửa không gần ranh giới mảng kiến tạo cũng có xuất hiện, và được giải thích là các chùm manti. Những \\"điểm nóng\\", ví dụ như Hawaii, được cho là hình thành từ nếp trồi với magma dâng lên từ ranh giới lớp lõi – lớp phủ, sâu 3,000 km trong lòng Trái Đất."},{"page_url":"https://eo.wikipedia.org/wiki/Nikolao_Beketov","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/CSIRO_ScienceImage_2893_Crystalised_magnesium.jpg","page_title":"Nikolao Beketov","context_page_description":"Nikolao Nikolajeviĉ Beketov, estis rusa mineralogo, fizikisto kaj kemiisto, fondinto de lernejo pri fiziko-kemio en Rusio, frato de la botanikisto Andreo Beketov kaj Aleksejo Nikolaeviĉ Beketov, profesoro pri kemio en la Universitato de Ĥarkovo, membro de la Akademio pri Sciencoj de Sankt-Peterburgo."},{"page_url":"https://es.wikipedia.org/wiki/Annibale_Bergonzoli","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/The_Campaign_in_North_Africa_1940-1943-_Personalities_E2294.jpg","page_title":"Annibale Bergonzoli","context_page_description":"Annibale Bergonzoli fue un militar italiano, con grado de general, destacado por su actividad durante la Segunda Guerra Mundial y especialmente en diversas actividades de tipo imperialista del fascismo italiano, como su intervención en la Guerra Civil española o la invasión de Etiopía."},{"page_url":"https://fi.wikipedia.org/wiki/Buzz_Lightyear","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Buzz_Lightyear_sculpture_of_Toy_Story_Hotel_Shanghai.jpg","page_title":"Buzz Lightyear","context_page_description":"Buzz Lightyear on fiktiivinen hahmo elokuvassa Toy Story – leluelämää ja sen jatko-osissa Toy Story 2. Toy Story 3 ja Toy Story 4 sekä elokuvassa Buzz Lightyear Avaruusranger: Seikkailu alkaa ja televisiosarjassa Buzz Lightyear of Star Command."},{"page_url":"https://en.wikipedia.org/wiki/Johnson_Symington","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Illustrated_menu_card_for_the_farewell_dinner_to_Professor_J_Wellcome_V0018700.jpg","page_title":"Johnson Symington","context_page_description":"Professor Johnson Symington FRS FRSE FZS LLD was a British anatomist and zoologist. He was President of the Ulster Medical Society for 1896/7. He served as President of the Anatomical Society of Great Britain and Ireland 1904 to 1906. He is noted for his comparative studies of the brain of modern man and prehistoric man, and of man and other primates. From 1923 onwards Queen's University Belfast award a Symington Prize every year to junior anatomists in his honour."},{"page_url":"https://fr.wikipedia.org/wiki/Parc_des_Impressionnistes","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Rueil-Malmaison_Parc_des_Impressionnistes_015.JPG","page_title":"Parc des Impressionnistes","context_page_description":"Le parc des Impressionnistes est un jardin public situé sur le territoire de la commune de Rueil-Malmaison."},{"page_url":"https://cs.wikipedia.org/wiki/Horn%C3%AD_P%C5%99edm%C4%9Bst%C3%AD_(Vala%C5%A1sk%C3%A9_Mezi%C5%99%C3%AD%C4%8D%C3%AD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/%C5%A0kola_-_%C3%BAstav_hluchon%C4%9Bm%C3%BDch_%28Vala%C5%A1sk%C3%A9_Mezi%C5%99%C3%AD%C4%8D%C3%AD%29%2C_Vset%C3%ADnsk%C3%A1_454%2C_Vala%C5%A1sk%C3%A9_Mezi%C5%99%C3%AD%C4%8D%C3%AD.JPG","page_title":"Horní Předměstí (Valašské Meziříčí)","context_page_description":"Horní Předměstí je bývalé předměstí ve Valašském Meziříčí ve Zlínském kraji. Pod názvem Valašské Meziříčí-Horní Předměstí se do roku 1974 také jednalo o samostatné katastrální území."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%95%B7%E5%B2%A1%E5%B8%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Hasegawa_Family_Residence.jpg","page_title":"長岡市","context_page_description":"長岡市は、新潟県の中南部に位置する市である。新潟県下第2位の人口を擁する市で、施行時特例市。"},{"page_url":"https://es.wikipedia.org/wiki/Luz_caracter%C3%ADstica","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/LuzFaroGruposDestellos09.PNG","page_title":"Luz característica","context_page_description":"La luz característica, apariencia, o simplemente, característica, es un código descriptivo que sirve para identificar en las cartas náuticas, o por observación a simple vista, a una determinada señal luminosa de ayuda a la navegación marítima, como pueden ser faros, buques faro, enfilaciones, balizas, boyas o luces de puerto y sirve para reconocerlas y diferenciarlas visualmente entre ellas. La información que proporciona este sistema es muy importante en la navegación marítima, ya que permite conocer el tipo de luz que emite una señal determinada, su color, las características del destello, el número de ellos y su ciclo o ritmo, lo cual permite diferenciarlas de otras próximas.\\nUn ejemplo de característica podría ser GpDBR 10s 41m 25M."},{"page_url":"https://en.wikipedia.org/wiki/Prague_2","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Location_map_municipal_district_Prague_-_Praha_2.PNG","page_title":"Prague 2","context_page_description":"Prague 2, formally the Prague 2 Municipal District, is a second-tier municipality in Prague. It is co-extensive with the national administrative district of the same name.\\nAs of the end of 2004, 48,918 people lived in 34,689 homes in the district. At 4.19 km², Prague 2 is the smallest administrative district in the country.\\nThe district includes all of Vyšehrad and parts of Vinohrady, New Town and Nusle. The district has remained intact since its creation in 1960."},{"page_url":"https://sl.wikipedia.org/wiki/Saillans,_Dr%C3%B4me","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Saillans_%28aper%C3%A7u%29.JPG","page_title":"Saillans, Drôme","context_page_description":"Saillans je naselje in občina v jugovzhodnem francoskem departmaju Drôme regije Rona-Alpe. Leta 2007 je naselje imelo 1.006 prebivalcev."},{"page_url":"https://ms.wikipedia.org/wiki/Bahan_bangunan","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/2008_BeaconHill_Boston_2302897829.jpg","page_title":"Bahan bangunan","context_page_description":"Bahan bangunan ialah sebarang bahan yang digunakan untuk tujuan pembinaan. Banyak bahan yang semulajadi, seperti tanah liat, batu, pasir, dan kayu, bahkan ranting dan daun, telah digunakan untuk membina bangunan. Selain dari bahan-bahan yang semulajadi, banyak produk buatan manusia sedang digunakan, lebih banyak lagi dan kurang sintetik. Pembuatan bahan binaan adalah industri yang mantap di banyak negara dan penggunaan bahan-bahan ini biasanya dibahagikan kepada perdagangan istimewa tertentu, seperti pertukangan kayu, penebat, paip, dan kerja bumbung. Mereka menyediakan habitat dan struktur termasuk rumah."},{"page_url":"https://en.wikipedia.org/wiki/Holden_Commodore_(VE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/2010_Holden_VE_II_Commodore_%28MY11%29_SV6_Sportwagon_04.jpg","page_title":"Holden Commodore (VE)","context_page_description":"The Holden Commodore (VE) is an executive car that was produced by the Australian manufacturer Holden from 2006 to 2013. It was the first iteration of the fourth generation of this Australian-made model. Its range included the luxury variants, Holden Berlina (VE) and Holden Calais (VE); utility models were included as the Holden Ute (VE).\\nAs opposed to the VZ and all models previous which used Opel-sourced platforms adapted both mechanically and in size for the local market, the whole-new VE programme is the first Commodore to be developed exclusively by Holden in Australia. Despite its status as an all-new model, engines—comprising the 3.6-litre V6 and more powerful 6.0-litre V8—have been largely carried over from the VZ series. Innovative features to help minimise export redevelopment costs, such as a symmetrical centre console housing a flush-fitting hand brake lever, facilitate the conversion to left-hand drive. Internationally, the VE was badge engineered as the Chevrolet Lumina, Chevrolet Omega and Pontiac G8.\\nHolden implemented a staged roll-out of the VE variants, releasing the sedan first in July 2006."},{"page_url":"https://cs.wikipedia.org/wiki/Stezka_d%C5%99ev%C4%9Bn%C3%A9_architektury_(Malopolsk%C3%A9_vojvodstv%C3%AD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Church_of_St._Nicolas_in_Ska%C5%82a_3.jpg","page_title":"Stezka dřevěné architektury (Malopolské vojvodství)","context_page_description":"Stezka dřevěné architektury v Malopolském vojvodství v Polsku má délku více jak 1500 km a zahrnuje 253 objektů jako např. kostely, kaple, zvonice, cerkve, chalupy, hospodářské objekty, usedlosti a skanzeny. Vznikla v roce 2001. Osm objektů je zapsáno na Seznamu světového dědictví UNESCO: kostel sv. Archanděla Michala v Binarově, kostel sv. Archanděla Michala v Dębnie Podhalańské, kostel sv. Linharta v Lipnici Murowané, kostel sv. Filipa sv. Jakuba v Sękowé, řeckokatolická cerkev sv. Archanděla Michala v Brunarech Wyżnych, řeckokatolická cerkev sv. Paraskevy v Kwiatoniu, cerkev Ochrany Matky Boží v Owczarech, cerkev sv. Jakuba v Powroźniku.\\nStezka je rozdělena do čtyř tras:\\nTrasa Nowy Sącz a Gorlice\\nTrasa Tarnów a okolí\\nTrasa Orava, Podhale, Spiš a Pieniny\\nTrasa Krakov a okolí"},{"page_url":"https://et.wikipedia.org/wiki/Benediktas_Juodka","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Benediktas_Juodka_by_Augustas_Didzgalvis.jpg","page_title":"Benediktas Juodka","context_page_description":"Benediktas Juodka on Leedu biokeemik ja poliitik.\\nTa oli aastatel 2001–2012 Vilniuse Ülikooli rektor.\\n2012–2016 oli ta Leedu Seimi liige.\\n4. oktoobril 2004 anti talle Maarjamaa Risti IV klassi teenetemärk, tunnustades tema tööd Vilniuse Ülikooli rektorina ja ühtlasi Eesti-Leedu teaduskoostöö arendajana."},{"page_url":"https://nl.wikipedia.org/wiki/Tubiporidae","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Tubipora_musica_Mayotte.jpg","page_title":"Tubiporidae","context_page_description":"Tubiporidae is een familie van zachte koralen uit de klasse der Anthozoa."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_Eferding","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Eferding_-_Keplerstra%C3%9Fe_7_04.jpg","page_title":"Liste der denkmalgeschützten Objekte in Eferding","context_page_description":"Die Liste der denkmalgeschützten Objekte in Eferding enthält die 113 denkmalgeschützten, unbeweglichen Objekte der Gemeinde Eferding in Oberösterreich."},{"page_url":"https://es.wikipedia.org/wiki/Royal_Caribbean_International","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/08/MS_Freedom_of_the_Seas_in_its_maiden_voyage_%28cropped%29.jpg","page_title":"Royal Caribbean International","context_page_description":"Royal Caribbean International es una empresa de cruceros perteneciente a Royal Caribbean Cruises Ltd. fundada en Noruega y con sede en la ciudad de Miami, Florida, Estados Unidos. Actualmente tiene 26 barcos en servicio activo y seis en construcción, uno de ellos entrará en servicio este 2020.​\\nToda la flota Royal Caribbean International es bautizada con la terminación «of the Seas», práctica instaurada desde 1991. Fundadores: John Debvre Thomas Jefferson"},{"page_url":"https://zh.wikipedia.org/zh-cn/%E7%B6%AD%E6%96%AF%E7%93%A6%E6%B2%B3-%E5%A5%A7%E5%BE%B7%E6%B2%B3%E6%94%BB%E5%8B%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Lodz_liberation2.jpg","page_title":"維斯瓦河-奧德河攻勢","context_page_description":"维斯瓦河-奥德河攻势是苏联红军在第二次世界大战中一次成功的军事行动；该行动由1945年1月12日开始至1945年2月2日结束，攻势令苏军将战线由在波兰的维斯瓦河推进至德国境内的奥德河，即距离德国首都柏林只有70公里。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A4%D0%BE%D0%BD%D1%82%D0%B0%D0%BD_%D1%83_%D0%A6%D0%B5%D0%BD%D1%82%D1%80%D0%B0%D0%BB%D1%8C%D0%BD%D0%BE%D0%BC%D1%83_%D0%BF%D0%B0%D1%80%D0%BA%D1%83_(%D0%92%D1%96%D0%BD%D0%BD%D0%B8%D1%86%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Central_Park_in_Vinnytsya_13.JPG","page_title":"Фонтан у Центральному парку (Вінниця)","context_page_description":"Фонтан у Центральному парку Вінниці — реконструйований фонтан 2013 року на Фонтанній площі у Центральному парку Вінниці.\\nУ 1951 році архітектором Самуїлом Ісаакович Рабіном був виконаний проект благоустрою центральної площі парку з великим фонтаном, а побудували його в 1958 році. До його відкриття кілька днів і ночей дружини проектувальників пекли флуден, щоб усіх пригостити.\\n17 жовтня 2013 розпочав роботу реконструйований фонтан, який не працював до того близько 10 років через застарілі системи і руйнування бетонних конструкцій."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E5%8F%B0%E7%81%A3%E5%8D%81%E5%A4%A7%E5%9C%9F%E6%9C%A8%E5%8F%B2%E8%B9%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Liugongjun.jpg","page_title":"台灣十大土木史蹟","context_page_description":"台湾十大土木史迹，是2001年由中华民国的财团法人虞兆中基金会、中国工程师学会、中国土木水利工程学会、财团法人台湾营建研究院、台湾省土木技师公会、财团法人中兴工程科技研究发展基金会等单位发起主办“寻找台湾十大土木史迹”征选活动，2001年11月30日公告入选案例，包括一级古迹淡水红毛城、台北瑠公圳、新店溪上游水力发电设施、龙腾断桥、阿里山森林铁路、下淡水溪铁桥、彰化扇形车库、乌山头水库、日月潭水力发电工程、雾社大坝等。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A3%D1%81%D1%82%D1%8C-%D0%90%D0%BB%D0%B4%D0%B0%D0%BD%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D1%83%D0%BB%D1%83%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Coat_of_Arms_of_Ust-Aldansky_rayon_%28Yakutia%29.png","page_title":"Усть-Алданський улус","context_page_description":"Усть-Алданський улус — муніципальний район в центрі Республіки Саха. Адміністративний центр — село Борогонци."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A1%D7%95%D7%A1_(%D7%A1%D7%95%D7%92)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Juancito.jpg","page_title":"סוס (סוג)","context_page_description":"סוס הוא סוג בעלי חיים במשפחת הסוסיים, הכולל את הסוסים, החמורים, והזברות. זהו הסוג היחיד במשפחת הסוסיים. הסוג סוס כולל גם מינים שנכחדו וידועים רק ממאובנים."},{"page_url":"https://nl.wikipedia.org/wiki/Fabric_(nachtclub)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Fabric%2C_Smithfields%2C_London_in_2008.jpg","page_title":"Fabric (nachtclub)","context_page_description":"Fabric is een nachtclub in Londen, Verenigd Koninkrijk. De club werd opgericht in 1999 in Islington. Fabric werd in 2007 en 2008 door DJ Magazine uitgeroepen tot beste club van de wereld, in de drie jaar erna stond het op de tweede plek op die lijst. In de club worden hiphop, breakbeat, dubstep, drum and bass, electro, house en techno gedraaid. In 2001 begon Fabric met de verkoop van door dj's gemixte cd's. Sindsdien werd eenmaal per maand een cd uitgebracht. In 2013 werd het label Houndstooth opgericht.\\nIn september 2016 werd de vergunning van Fabric ingetrokken na twee doden in de club, die in verband werden gebracht met drugsgebruik. Enkele maanden later kreeg de club zijn vergunning terug nadat deze zijn beleid met betrekking tot identificatie, leeftijd en drugsbezit had verscherpt.\\nFabric is mede bekend door de cd-series die worden uitgegeven met mixes van dj's. Eens in de paar maanden verschijnt een nieuw deel dat in meerdere landen wordt verkocht. De Fabric-serie richt zich vooral op house, techno en progressive. Fabriclive richt zich meer op dubstep, drum-'n-bass, breakbeat en hiphop. De series lopen tot het 100e deel in 2018."},{"page_url":"https://es.wikipedia.org/wiki/Palaeopropithecidae","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/50/Palaeopropithecus_ingens.jpg","page_title":"Palaeopropithecidae","context_page_description":"Los paleopropitécidos, conocidos como lémures perezoso, son una familia extinta de primates lemuriformes que incluye cuatro géneros.​​\\nFilogenia basada en las publicaciones de Horvath et ál. y Orlando et al. ​​"},{"page_url":"https://es.wikipedia.org/wiki/John_Locke","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Otes_Manor_House_in_Harlow%2C_where_John_Locke_spent_the_last_Wellcome_V0018880.jpg","page_title":"John Locke","context_page_description":"John Locke FRS fue un filósofo y médico inglés, considerado como uno de los más influyentes pensadores del empirismo inglés y conocido como el «Padre del Liberalismo Clásico».​​​ Fue uno de los primeros empiristas británicos. Influido por las ideas de Francis Bacon, realizó una importante contribución a la teoría del contrato social. Su trabajo afectó en gran medida el desarrollo de la epistemología y la filosofía política. Sus escritos influyeron en Voltaire y Rousseau, pensadores de la Ilustración francesa, así como los revolucionarios estadounidenses. Sus contribuciones al republicanismo clásico y la teoría liberal se reflejan en la Declaración de Independencia de los Estados Unidos y la Declaración de Derechos de 1689.​\\nLa teoría de la mente de Locke es frecuentemente citada como el origen de las concepciones modernas de la identidad y del yo, que figuran prominentemente en las obras de filósofos posteriores como Hume, Rousseau y Kant. Locke fue el primero en definir el yo como una continuidad de la conciencia. Postuló que, al nacer, la mente era una pizarra o tabula rasa en blanco."},{"page_url":"https://cs.wikipedia.org/wiki/Sv%C4%9Btov%C3%A9_dny_ml%C3%A1de%C5%BEe_2008","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/77/WYD-2008.JPG","page_title":"Světové dny mládeže 2008","context_page_description":"Světové dny mládeže 2008 je mezinárodní setkání mladých pořádané katolickou církví, které se uskutečnilo v australském Sydney 15.–20. července 2008. Součástí setkání byla i návštěva papeže Benedikta XVI. Za téma setkání byl zvolen biblický citát „Dostanete sílu Ducha svatého, který na vás sestoupí, a budete mými svědky“. Jelikož se málokdo z českých a slovenských katolíků rozhodl na toto setkání jet do Sydney přímo, rozhodla se Sekce pro mládež České biskupská konference uspořádat od 18. do 20. 7. na Velehradě česko-slovenské setkání Activ8, které bylo krom vlastního programu také spojeno se Sydney přes obří obrazovku."},{"page_url":"https://lt.wikipedia.org/wiki/%C5%A0arvuotieji_%C5%A1amukai_(gentis)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Corydoras_panda_1.jpg","page_title":"Šarvuotieji šamukai (gentis)","context_page_description":"Šarvuotieji šamukai – šarvuotųjų šamukų šeimos žuvų gentis.\\nTai vienos iš populiariausių akvariumuose auginamų žuvų. Dauguma atsparūs, lengvai prisitaikantys, takingi ir laikosi būrelaisi. Žuvys greitai judina akis. Akiai pasisukant žemyn kurį laiką nesimato rainelės, o trumpam matomi akį supantys audiniai. Akiai grįžtant atgal į įprastą padėtį atrodo, kad žuvis mirksėjo. Tinklalapelekis šamukas dažniausiai laikomas ir pačiu populiariausiu iš visų Corydoras genties rūšių.\\nGentyje 142 rūšys."},{"page_url":"https://fr.wikipedia.org/wiki/Arbre_de_No%C3%ABl_(puits_de_p%C3%A9trole)","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/06/Wellhead-dual_completion.jpg","page_title":"Arbre de Noël (puits de pétrole)","context_page_description":"Dans l'extraction du pétrole et du gaz naturel, un arbre de Noël, ou « arbre » désigne un ensemble de vannes, robinets, bobines et pièces d'ajustages appliqué sur un puits de pétrole, un puits de gaz, un puits d'injection d'eau, un dispositif de forage d'eau, un système d'injection de gaz, un puits de condensation ou tout autre type de puits. Il est ainsi nommé en raison de sa ressemblance avec un arbre de Noël décoratif."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9E%D0%B1%D1%81%D0%B5%D1%80%D0%B2%D0%B0%D1%82%D0%BE%D1%80%D1%96%D1%8F_%D0%9A%D0%B0%D0%BC%D0%B5%D0%BD%D1%81%D1%8C%D0%BA%D0%B5_%D0%BF%D0%BB%D0%B0%D1%82%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/%D0%9C%D0%B5%D0%BD%D0%B8%D1%81%D0%BA%D0%BE%D0%B2%D1%8B%D0%B9_%D1%82%D0%B5%D0%BB%D0%B5%D1%81%D0%BA%D0%BE%D0%BF_%D0%9C%D0%B0%D0%BA%D1%81%D1%83%D1%82%D0%BE%D0%B2%D0%B0.JPG","page_title":"Обсерваторія Каменське плато","context_page_description":"Обсерваторія Каменське плато — астрономічна обсерваторія, заснована в 1947 році при Астрофізичному інституті ім. В. Г. Фесенкова. У 1948 році Г. А. Тихов очолив самостійний заклад — сектор астроботаніки АН КазРСР — і заснував свою окрему обсерваторію. Після смерті Тихова в 1960 році сектор астроботаніки було розформовано. В даний момент обсерваторія і інститут імені Фесенкова знаходяться на одній території."},{"page_url":"https://et.wikipedia.org/wiki/Sievers_(aadlisuguv%C3%B5sa)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Sieversi_suguv%C3%B5sa_vabah%C3%A4rravapp.jpg","page_title":"Sievers (aadlisuguvõsa)","context_page_description":"Sievers on Lübeckist pärit baltisaksa aadlisuguvõsa."},{"page_url":"https://gl.wikipedia.org/wiki/Humberto_Cu%C3%AD%C3%B1as","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Humberto_Cu%C3%AD%C3%B1as_1933.jpg","page_title":"Humberto Cuíñas","context_page_description":"Humberto Cuíñas González, nado en Vigo, foi un xornalista e poeta galego."},{"page_url":"https://te.wikipedia.org/wiki/%E0%B0%A4%E0%B1%86%E0%B0%B2%E0%B0%82%E0%B0%97%E0%B0%BE%E0%B0%A3_%E0%B0%B0%E0%B0%BE%E0%B0%B7%E0%B1%8D%E0%B0%9F%E0%B1%8D%E0%B0%B0_%E0%B0%B8%E0%B0%82%E0%B0%97%E0%B1%8D%E0%B0%B0%E0%B0%B9%E0%B0%BE%E0%B0%B2%E0%B0%AF%E0%B0%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Mummy_at_Hyderabad_museum2.jpg","page_title":"తెలంగాణ రాష్ట్ర సంగ్రహాలయం","context_page_description":"తెలంగాణ రాష్ట్ర సంగ్రహాలయం లేదా హైదరాబాదు మ్యూజియం భారతదేశంలోని తెలంగాణ రాష్ట్ర రాజధాని హైదరాబాదు లోని ఒక ప్రాచీనమైన సంగ్రహాలయం. పురతత్వవేత్త హెన్రీ కోసెన్స్ 19 వ శతాబ్ద ప్రారంభంలో దీని స్థలం గూర్చి అన్వేషించారు. 1940 లలో నిజాం చే ఇది ప్రారంభించబడింది. త్రవ్వకాలలో లభించిన పురాతత్వ వస్తువులను పురాతన స్థలంలో ఉంచేవారు. 1952లో ఈ పురాతత్వ వస్తువులను ఈ సంగ్రహాలయానికి మార్చారు. ఈ సంగ్రహాలయం భారత పురాతత్వ సర్వే విభాగం చే నిర్వహింపబడుతున్నది."},{"page_url":"https://en.wikipedia.org/wiki/Quique_Neira","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Quique_Neira_Lollapalooza_%285585970032%29.jpg","page_title":"Quique Neira","context_page_description":"Enrique \\"Quique\\" Neira Leiva is a Chilean reggae singer and composer. He was the lead vocalist of the band Gondwana and is currently a solo artist. He is the most recognized icon of the reggae en español movement in Chile."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AA%E3%83%8A%E3%82%B7%E3%82%A2%E3%82%B2%E3%83%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Papilio_demoleus_1600X1200.jpg","page_title":"オナシアゲハ","context_page_description":"オナシアゲハは、チョウ目アゲハチョウ科に分類されるチョウの1種。日本では八重山諸島などで採集記録がある迷蝶。"},{"page_url":"https://fr.wikipedia.org/wiki/Riva_del_Garda","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Riva_del_Garda.jpg","page_title":"Riva del Garda","context_page_description":"Riva del Garda est une commune italienne d'environ 17 500 habitants située dans la province autonome de Trente dans la région du Trentin-Haut-Adige dans le nord-est de l'Italie. Elle se trouve au bord du lac de Garde."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A2%D8%AA%D8%B4%DA%A9%D8%AF%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Baze_Hoor_fire_temple.jpg","page_title":"آتشکده","context_page_description":"آتَشکَده، دَربِ مِهر یا دَرِ مِهر، به گونه‌ای از نیایشگاه‌های زرتشتیان گفته می‌شود که در آن آتش در جایگاه ویژه‌ای جای گرفته‌است و مهمترین نیایش‌های دینی در آن و در برابر آتش انجام می‌گیرد.\\nاز جمله نیایش‌ها خواندن اوستا و گاتها است"},{"page_url":"https://ja.wikipedia.org/wiki/%E6%97%A5%E9%87%8E%E3%83%BB%E3%82%BB%E3%83%AC%E3%82%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Higashinippon-express-5513.JPG","page_title":"日野・セレガ","context_page_description":"セレガとは、ジェイ・バスが製造し、日野自動車が販売している大型観光バス車両。車名の由来は「セクシー」&「エレガント」の略語。\\n1990年にブルーリボンRU19/60/63観光をフルモデルチェンジして発売を開始、2000年にセレガRとしてマイナーチェンジを行った。\\nさらに、2005年8月22日にはいすゞ自動車との統合モデルとして車名も新たに“セレガ”にフルモデルチェンジした。これに伴い、いすゞ・ガーラもセレガと基本的に同一のモデルとなった。\\nなお、ここでは現在のセレガシリーズの前身であるブルーリボンRU60/63系観光バス、日本初のスケルトンボディ観光バス・RS系、日野初の本格的な観光バスシリーズRV系、高速バス専用モデルRA100系・RA900系についても紹介する。"},{"page_url":"https://sr.wikipedia.org/wiki/IC_615","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/IC615_-_SDSS_DR14.jpg","page_title":"IC 615","context_page_description":"IC 615 је спирална галаксија у сазвјежђу Лав која се налази на листи објеката дубоког неба у Индекс каталогу.\\nДеклинација објекта је + 11° 4' 50\\" а ректасцензија 10h 27m 21,9s. Привидна величина објекта IC 615 износи 14,1 а фотографска магнитуда 14,9. IC 615 је још познат и под ознакама UGC 5665, MCG 2-27-20, CGCG 65-41, NPM1G +11.0240, PGC 30751."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%97%E3%83%AD%E3%82%A4%E3%82%BB%E3%83%B3%E9%A0%98%E3%83%9D%E3%83%BC%E3%83%A9%E3%83%B3%E3%83%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Jan_Henryk_Dabrowski_entering_Pozna%C5%84.PNG","page_title":"プロイセン領ポーランド","context_page_description":"プロイセン領ポーランド は、旧ポーランド・リトアニア共和国領のうち、18世紀後半のポーランド分割でプロイセン王国が獲得した地域。 プロイセンは西ポーランドの141,400 km² におよぶ領土を獲得した。1772年にロシア帝国主導で第一次分割が、1793年に第二次分割が、そし1795年に第三次分割が行われ、以後123年間にわたり独立国家ポーランドは地上から姿を消した。"},{"page_url":"https://fr.wikipedia.org/wiki/Lecce","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Lecce_from_the_air.jpg","page_title":"Lecce","context_page_description":"Lecce est une ville italienne d'environ 95 140 habitants, capitale de la province de même nom dans les Pouilles, dans le sud de l'Italie.\\nVille importante du sud-est des Pouilles, située au centre du Salento, Lecce a été, pendant des siècles, un centre culturel, religieux et commercial prospère et l'une des villes les plus peuplées du Royaume de Naples. Aujourd'hui, elle reste active dans les secteurs de l'industrie agricole, des services et de la céramique. Elle est le siège d'un archevêché et de l'université du Salento et constitue un haut-lieu touristique et artistique.\\nRéputée pour son patrimoine artistique particulièrement bien conservé, la ville est considérée comme l'une des capitales de l'architecture baroque, du fait de l'originalité et la richesse du style architectural qui y a été développé à partir de la fin du XVIᵉ siècle, et qui fut rendu possible par la malléabilité exceptionnelle de la pierre calcaire locale, appelée « pierre de Lecce ». À cet égard, on parle même d'un barocco leccese, un « baroque de Lecce », qui possède des caractéristiques et un vocabulaire architectural qui lui sont propres."},{"page_url":"https://de.wikipedia.org/wiki/Zagori","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Monastery_of_Saint_Paraskevi_-_rooftops.JPG","page_title":"Zagori","context_page_description":"Zagori ist eine Gemeinde in der nordwestgriechischen Region Epirus. Die flächengrößte und einwohnerärmste Gemeinde der Region wurde zum 1. Januar 2011 gegründet. Namensgebend ist das gleichnamige historische Gebiet mit den als Zagorochoria oder Zagoria bezeichneten Dörfern. Der Verwaltungssitz ist die Kleinstadt Asprangeli."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Hamburg-Harvestehude","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/627_parkallee_57.jpg","page_title":"Liste der Kulturdenkmäler in Hamburg-Harvestehude","context_page_description":"Die Liste der Kulturdenkmäler in Hamburg-Harvestehude enthält die in der Denkmalliste ausgewiesenen Denkmäler auf dem Gebiet des Stadtteils Harvestehude der Freien und Hansestadt Hamburg.\\nBasis ist der Datensatz Denkmalliste Hamburg auf dem Transparenzportal Hamburg. Dieser enthält alle Objekte, die rechtskräftig nach dem Hamburger Denkmalschutzgesetz vom 5. April 2013 unter Denkmalschutz stehen oder zumindest zeitweise standen. Die Denkmalliste steht auch als PDF-Dokument zur Verfügung. Alle Denkmäler in Harvestehude, die schon nach dem Denkmalschutzgesetz vom 3. Dezember 1973, zuletzt geändert am 27. November 2007, unter Denkmalschutz standen, sind auch auf der Liste der Kulturdenkmäler im Hamburger Bezirk Eimsbüttel zu finden."},{"page_url":"https://it.wikipedia.org/wiki/Stufetta_di_Diana_e_Atteone","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Parmigianino%2C_affreschi_di_fontanellato_04.jpg","page_title":"Stufetta di Diana e Atteone","context_page_description":"La Stufetta di Diana e Atteone è un ambiente della Rocca Sanvitale a Fontanellato, celebre per il ciclo di affreschi del Parmigianino, realizzato nel 1524. Si tratta probabilmente del bagno privato di Paola Gonzaga, moglie di Galeazzo Sanvitale, conte di Fontanellato."},{"page_url":"https://nl.wikipedia.org/wiki/Bundesstra%C3%9Fe_484","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b5/B484_Verlauf.png","page_title":"Bundesstraße 484","context_page_description":"De Bundesstraße 484 is een 11,6 kilometer lange weg bundesstraße in de Duitse deelstaat Noordrijn-Westfalen.\\nDe weg begint bij afrit Overath aan de A 4 Kreuz Köln-Ost-Kreuz-Olpe-Süd. De weg loopt door ||Overath, langs Wahlscheid en door het noorden van de stad Lohmar om bij afrit Lohmar-Nord aan te sluiten op de A 3 Elten-Passau en de B 507 naar Neunkirchen.\\nBij Wahlscheid wer in 1990 een rondweg aangelegd.\\nDe B484 werd in de jaren 60 van de 20e eeuw ingesteld."},{"page_url":"https://an.wikipedia.org/wiki/Transilvania","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Transylvania.png","page_title":"Transilvania","context_page_description":"Transilvania ye una rechión historica localizata en o centro de Rumanía, rodeyata por os Carpatos. A capital d'a rechión, Cluj-Napoca, ye situata en a meseta, mientres que Braşov y Sibiu, unas d'as principals ciudatz, son en o semontano d'os Cárpatos.\\nEn a famosa novela de Bram Stoker, Transilvania yera d'on proveniba o Conte Dracula."},{"page_url":"https://fy.wikipedia.org/wiki/Simon_Vestdijk","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Harlingen%2C_Voorstraat_61_-_20697.jpg","page_title":"Simon Vestdijk","context_page_description":"Simon Vestdijk wie in Nederlânsk skriuwer fan romans en koarte ferhalen, dichter, essayist, oersetter, muzykkritikus en dokter. Hy waard benammentlik bekend troch de roman De Koperen Tuin en de boeken fan 'e Anton Wachter-syklus, wêrûnder Terug tot Ina Damman. Syn útsûnderlik grut oeuvre bestiet út 24 dichtbondels, 33 essaybondels, 57 koarte ferhalen en novellen, 52 romans, 2 neilitten romanfragminten, publisearre briefkerijen, gâns oersettings en fierders hûnderten artikels yn kranten en tydskriften."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%B5%B7%E4%B8%B0%E5%8E%BF%E5%86%9C%E6%B0%91%E5%8D%8F%E4%BC%9A%E6%97%A7%E5%9D%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/%E6%B5%B7%E4%B8%B0%E5%86%9C%E6%B0%91%E5%8D%8F%E4%BC%9A%E6%97%A7%E5%9D%80.jpg","page_title":"海丰县农民协会旧址","context_page_description":"海豐縣農民協會舊址，位於中國廣東省汕尾市海豐縣橋東，為海豐縣的一個縣級文物保護單位，類型為近現代重要史跡及代表性建築，公布時間為1963年。\\n海豐縣農民協會舊址的歷史年代為1927-1928年。"},{"page_url":"https://vi.wikipedia.org/wiki/Linh_d%C6%B0%C6%A1ng_Steenbok","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Steenbok.jpg","page_title":"Linh dương Steenbok","context_page_description":"Raphicerus campestris là một loài động vật có vú trong họ Bovidae, bộ Artiodactyla. Loài này được Thunberg mô tả năm 1811."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%B6%D0%B8%D0%BC%D0%BC%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Jimmamosque.jpg","page_title":"Джимма","context_page_description":"Джи́мма — крупнейший город юго-западной части Эфиопии. Расположен в регионе Оромия."},{"page_url":"https://es.wikipedia.org/wiki/Castillo_de_Villavellid","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/01a_Villavellid_castillo_Ni.jpg","page_title":"Castillo de Villavellid","context_page_description":"El Castillo de Villavellid se encuentra en la población de Villavellid, provincia de Valladolid, Castilla y León, España. Se construyó siguiendo el modelo de castillo llamado escuela de Valladolid. En la actualidad todavía se pueden visitar los restos del castillo."},{"page_url":"https://fr.wikipedia.org/wiki/Le_Havre","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/MuMA_-_Boudin_-_Le_Havre%2C_l%27H%C3%B4tel_de_Ville_et_la_tour_Fran%C3%A7ois_Ier.JPG","page_title":"Le Havre","context_page_description":"Le Havre est une commune française du Nord-Ouest de la France située dans le département de la Seine-Maritime en région Normandie, située sur la rive droite de l'estuaire de la Seine. Son port est le deuxième de France après celui de Marseille pour le trafic total et le premier port français pour les conteneurs.\\nAdministrativement, la commune est, avec Dieppe, l'une des deux sous-préfectures du département de la Seine-Maritime. Elle est également chef-lieu de canton et siège d'un évêché. Avec 170 147 habitants au dernier recensement de 2017, Le Havre est la commune la plus peuplée de Normandie, repassant ainsi de la quartorzième place à la quinzième au niveau national et la deuxième sous-préfecture française derrière Reims. Elle occupe le site de l'estuaire de la Seine et se trouve au bord de la Manche, à la pointe sud-ouest du pays de Caux. Elle est reliée à la capitale, située à 200 km au sud-est, par la voie ferrée et l'autoroute.\\nLa ville et le port sont officiellement fondés par le roi François Iᵉʳ en 1517. Le développement économique à l'époque moderne est entravé par les guerres de religion, les conflits avec les Anglais, les épidémies et les tempêtes."},{"page_url":"https://az.wikipedia.org/wiki/The_Beatles","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/The_Beatles_arrive_at_JFK_Airport.jpg","page_title":"The Beatles","context_page_description":"Bitlz, \\"Beatles\\" – Liverpul şəhərindən olan Con Lennon, Pol Makkartni, Corc Harrison və Rinqo Starı özündə birləşdirən, 60-cı illərin məşhur ingilis rok qrupu. Beatles rok-pop musiqisinə misilsiz töhfələr verməklə onu köklü surətdə dəyişdirmişdir. Ötən əsrin 60-cı illərində görünməmiş məşhurluq qazanan qrup XX əsrin musiqi mədəniyyətində ən parlaq fenomenlərdən birinə çevrilir.\\nBeatles bir çox satış rekordlarını qıraraq 50-dən artıq mahnısı ilə dünyanın müxtəlif ölkələrinin musiqi çatlarına liderlik etmişdir. Amerika Səsyazmalar Sənayesi Assosiasiyasının məlumatına görə Beatles ABŞ-da bütün dövrlərin səsyazmaları ən çox satılmış qrupudur. Öz səsyazma studiyalarının, EMİ-nin yaydığı məlumatlara görə isə 1985-ci ilə qədər dünyada qrupun 1 milyarddan artıq diski satılmışdır. 2004-cü ildə tanınmış Rolling Stone jurnalının apardığı sorğular əsasında tərtib edilən \\"Bütün dövrlərin 100 ən yaxşı sənətçisi\\" siyahısında Beatles-i I yerə layiq görmüşdür."},{"page_url":"https://en.wikipedia.org/wiki/Bailey%27s_Marvel","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Original_Bailey%27s_Marvel_Mango_Tree.jpg","page_title":"Bailey's Marvel","context_page_description":"The 'Bailey's Marvel' mango is a named, mid-season mango cultivar that originated in southwest Florida."},{"page_url":"https://en.wikipedia.org/wiki/HM_Prison_Shepton_Mallet","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Sheptonmalletgaol.jpg","page_title":"HM Prison Shepton Mallet","context_page_description":"HMP Shepton Mallet, sometimes known as Cornhill, is a former prison located in Shepton Mallet, Somerset, England. When it closed in 2013, it was the United Kingdom's oldest operating prison, and had been since the closure of HMP Lancaster Castle in 2011. Before closure Shepton Mallet was a category C lifer prison holding 189 prisoners. The prison building is grade II* listed, while the former gatehouse and perimeter walls are grade II.\\nThe prison was opened before 1625 but was already in poor repair by the end of the First English Civil War in 1646. It was expanded in 1790 but conditions were again criticised in a report of 1822 and further building work was undertaken in the 1820s and 1830s. This included the installation of a treadwheel for those sentenced to hard labour. In 1843 the number of cells was increased by adding a second storey to each wing. The prison was damaged during a fire in 1904. In 1930 the number of inmates had fallen and the prison was closed.\\nFollowing the outbreak of the Second World War in 1939 the prison was reopened as a military prison."},{"page_url":"https://es.wikipedia.org/wiki/Boeing_Model_64","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Boeing_Model_64_on_wheels.jpg","page_title":"Boeing Model 64","context_page_description":"El Boeing Model 64 fue un avión de entrenamiento biplano monomotor estadounidense construido por Boeing en los años 20 del siglo XX, que no consiguió órdenes de producción."},{"page_url":"https://en.wikipedia.org/wiki/Brian_To%27o","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Brian_To%27o.jpg","page_title":"Brian To'o","context_page_description":"Brian To'o is a Samoa international rugby league footballer who plays as a wing for the Penrith Panthers in the NRL."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Lokomotiven_und_Triebwagen_der_LBE","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/WP_T1_LBE_Nr_105.jpg","page_title":"Liste der Lokomotiven und Triebwagen der LBE","context_page_description":"In dieser Liste sind die Lokomotiven und Triebwagen der Lübeck-Büchener Eisenbahn zusammengestellt."},{"page_url":"https://eo.wikipedia.org/wiki/Trafikocirklo","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/UK_Roundabout_8_Cars.gif","page_title":"Trafikocirklo","context_page_description":"Trafikocirklo, rondira trafiko, ringotrafiko estas vojkruciĝo aranĝita ĉirkaŭ centra ringo kiu ebligas al ĉiuj aŭtomobiloj elekti siajn veturotajn vojojn kiuj spoke renkontas la ringon. Tiel, la aŭtoj alvenante al la trafikocirklo devas cedi la prioritaton antaŭ giri ĉirkaŭ la ringo. Tiaj vojkruciĝoj estas pli kaj pli preferataj al la komunaj vojkruciĝoj ĉar ili estas pli sekuraj, kaŭzas malpli da trafikŝtopiĝoj kaj devigas la veturilojn halti aŭ almenaŭ ege malrapidigi.\\nTrafikocirklo estas brita eltrovo, farita post la aperoj de rondoplacoj. Ĝi multe disvastiĝis kaj nuntempe ĉie estas en la mondo."},{"page_url":"https://tl.wikipedia.org/wiki/Talaan_ng_mga_munisipalidad_sa_Pennsylvania","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Landis_Montco_PA.jpg","page_title":"Talaan ng mga munisipalidad sa Pennsylvania","context_page_description":"Ito ay isang kompletong talaan ng 2,561 mga munisipalidad sa Pennsylvania na inayos ayon sa populasyon. Sa ilalim ng batas ng Pennsylvania, may apat na mga uri ng mga nasapi munisipalidad sa estado. Maliban sa nag-iisang bayan na Bloomsburg na pinamamahalaan bilang isang boro maliban sa isang kakaibang pamanang ligal, ang mga uring ito ay:\\nMga lungsod\\nMga bayan\\nMga township\\nKasama lamang sa talaang ito ang mga nasapi o nainkorporadang mga pook at hindi kasama ang maraming mga ibang pook na walang pamahalaan, hindi nasapi, o mga magkakapit-bahay."},{"page_url":"https://de.wikipedia.org/wiki/Melodifestivalen_2014","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3e/Sparbanken_Lidk%C3%B6ping_Arena_-_South_west.jpg","page_title":"Melodifestivalen 2014","context_page_description":"Das Melodifestivalen 2014 war der schwedische Vorentscheid für den Eurovision Song Contest 2014 in Kopenhagen. Es war die 54. Ausgabe des von der schwedischen Rundfunkanstalt SVT veranstalteten Wettbewerbs. Insgesamt dauerte der Wettbewerb vom 1. Februar 2014 bis zum 8. März 2014 an.\\nGewonnen wurde der Wettbewerb von Sanna Nielsen mit ihrem Lied Undo, welches von David Kreuger, Fredrik Kempe und Hamed Pirouzpanah geschrieben wurde. Sie gewann allerdings nur mit zwei Punkten Vorsprung vor Ace Wilder, was den knappsten Sieg in der Geschichte des Melodifestivalens darstellte."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_S%C3%B6hnen_und_T%C3%B6chtern_Chicagos","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Dorothy_Malone_-_Written_on_the_Wind_-_Studio_Publicity_Photo.jpg","page_title":"Liste von Söhnen und Töchtern Chicagos","context_page_description":"Liste von Söhnen und Töchtern der Stadt Chicago."},{"page_url":"https://fr.wikipedia.org/wiki/Sid%C3%A9rurgie_dans_les_Landes","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Objets_du_Mus%C3%A9e_des_Forges_de_Brocas_09.JPG","page_title":"Sidérurgie dans les Landes","context_page_description":"La sidérurgie dans les Landes est une page de l'histoire économique et sociale du département. D'abord apparue à une échelle artisanale, elle entame, dès la seconde moitié du XVIIIᵉ siècle, un virage industriel sous l'impulsion de maîtres de forges. Elle répond aux besoins grandissants en fer et en fonte de l'économie locale et nationale pendant la Révolution industrielle pour atteindre un pic de production au milieu du XIXᵉ siècle. Elle se maintient par endroits avant de s'éteindre dans la deuxième moitié du XXᵉ siècle."},{"page_url":"https://es.wikipedia.org/wiki/Doctrina_Drago","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e5/Luis_Mar%C3%ADa_Drago.jpg","page_title":"Doctrina Drago","context_page_description":"La Doctrina Drago fue anunciada el 29 de diciembre de 1902 por el ministro de Relaciones Exteriores argentino durante la segunda presidencia de Julio Roca, Luis María Drago, en respuesta a la renuncia de los Estados Unidos a ejecutar la Doctrina Monroe durante el bloqueo naval contra Venezuela.​ Esta doctrina jurídica establece que ningún Estado extranjero puede utilizar la fuerza contra una nación americana con la finalidad de cobrar una deuda financiera.​​\\nTal doctrina provino de las ideas de Carlos Calvo, en Derecho internacional teórico y práctico de Europa y América. La doctrina Calvo proponía prohibir la intervención diplomática cuando hubiera pleitos entre partes de distintos países, hasta que no estuvieran agotados los recursos locales.\\nLa doctrina Drago resultó ser una respuesta a las acciones del Reino Unido, Alemania e Italia, quienes impusieron un Bloqueo Naval a Venezuela a finales de 1902, en respuesta a la gran deuda externa de Venezuela que el recién llegado presidente Cipriano Castro se negaba a pagar.​"},{"page_url":"https://es.wikipedia.org/wiki/Dovyalis_caffra","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Gardenology.org-IMG_2545_ucla09.jpg","page_title":"Dovyalis caffra","context_page_description":"Dovyalis caffra Warb., el umkokola, o manzana kei, es un árbol de talla mediana a grande, nativo del sur de África. Su distribución se extiende desde el río Kei en el sur, hacia el norte, por el este del continente, hasta Tanzania. Los frutos maduros son sabrosos, reminiscentes de una pequeña manzana."},{"page_url":"https://sv.wikipedia.org/wiki/R%C3%B6nnbergens_naturreservat","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Vaccinium_vitis-idaea_20060824_003.jpg","page_title":"Rönnbergens naturreservat","context_page_description":"Rönnbergen är ett naturreservat i Sävsjö kommun i Jönköpings län.\\nOmrådet är skyddat sedan 2007 och är 32 hektar stort. Det är beläget nordväst om Sävsjö och består av flera olika naturtyper.\\nNaturreservat är beläget mer än 300 meter över havet. Skogen består mest av gran. På marken växer blåbär, lingon och kruståtel. I den västra delen växer tallsumpskog. Där på marken kan man finna tuvull, ljung, missne, kärrviol och lingon. I reservatets norra del ligger en del av Älmhultamossen, som är en öppen högmosse.\\nDe ovanliga arterna västlig hakmossa och vågig sidenmossa förekommer i området liksom kattfotslav och havstulpanlav."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%B6%84%EB%A6%AC_%EB%8F%85%EB%A6%BD_%EC%9A%B4%EB%8F%99_%EB%AA%A9%EB%A1%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Wa_nationality_flag.png","page_title":"분리 독립 운동 목록","context_page_description":"다음은 분리 독립 운동이 있거나, 그에 관한 분쟁이 있는 지역의 목록이다."},{"page_url":"https://fy.wikipedia.org/wiki/Grumman_TBF_Avenger","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/TBF_dropping_torpedo_NAN2-2-44.jpg","page_title":"Grumman TBF Avenger","context_page_description":"De Grumman TBF Avenger wie in Amerikaanske torpedobommesmiter dy't yn de Twadde Wrâldoarloch tsjinne yn de kriten om de Stille Oseaan hinne. De Avengers wien stasjonearre op fleandekskippen en op militêre fleanfjilden dy ûnder de Amerikaanske marine stienen. De Avenger waard ûntwurpen as opfolger fan de Douglas TBD-1 Devastator dy't om 1939 hinne ferâldere rekke.\\nDe Nederlânske Marine Loftfearttsjinst hie yn de jierren 50 78 Avengers yn trije ferskillende útfierings yn tsjinst."},{"page_url":"https://en.wikipedia.org/wiki/Rahul_Dholakia","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Rahul_Dholakia.jpg","page_title":"Rahul Dholakia","context_page_description":"Rahul Dholakia is an Indian film director-producer-screenwriter, most known for his National Film Award-winning film, Parzania, prior to which he also made documentaries like Teenage Parents and New York Taxi Drivers."},{"page_url":"https://hr.wikipedia.org/wiki/Delta_Okavangoa","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Okavango_Delta_map.png","page_title":"Delta Okavangoa","context_page_description":"Delta rijeke Okavango nalazi se u afričkoj državi Bocvani. To je najveća svjetska delta u unutrašnjosti kontinenta ili tzv. endoreička delta.\\nNastala je u prostoru u kojem rijeka Okavango izlijeva svoje vode u močvarni endoreički bazen polupustinje Kalahari. U polupustinji Kalahari, gubi se većina vode uslijed isparavanja i transpiracije umjesto da se ulijeva u more. Svake godine oko 11 kubičnih kilometara vode navodnjavanja prostor površine 15.000 km², a dio poplavnih voda izlučuje se u jezero Ngami. Na istočnoj strani delte prostire se nacionalni park Moremi Game Reserve. Područje je nekada bilo dio drevnog jezera Makgadikgadi, koje je najvećim dijelom presušilo tijekom ranog holocena.\\nDelta Okovangoa je upisana na UNESCO-v popis mjesta svjetske baštine u Africi 2014. godine kao „gotovo nedirnuto vlažno zemljište jedinstvenih odlika koje zbog redovitih poplava tijekom sušnih razdoblja dirigira biološke cikluse mnogih biljaka i životinja, te predstavlja jedinstven primjer interakcije klimatskih, hidroloških i bioloških procesa”."},{"page_url":"https://en.wikipedia.org/wiki/Hamm_AG","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/WIRTGEN_Hamm_Logo.png","page_title":"Hamm AG","context_page_description":"Hamm AG is a German worldwide manufacturer and marketer of road rollers based in Tirschenreuth, Germany. It is a subsidiary of Wirtgen Group.\\nBrothers Anton and Franz Hamm, who were gunsmiths, founded the company in 1878 to build agricultural equipment. The company built their first diesel-powered road roller in 1911, from a design by a second-generation Hamm, Hans Hamm. This was at a time when most rollers where steam powered. In 1928 the company abandoned all other product lines to concentrate on road rollers. Hamm produces the first all-wheel drive-all-wheel steering double-drum. The company introduced an all-wheel steering and all-wheel drive rubber-wheeled roller in 1963, and then rolled out its oscillating vibratory roller in 1989.\\nIn 1999 the Wirtgen Group GmbH announced that it would purchase Hamm AG, and the transaction was completed in March 2000."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AF%D9%87%D9%87_%DB%B2%DB%B0%DB%B2%DB%B0_(%D9%85%DB%8C%D9%84%D8%A7%D8%AF%DB%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Imran_Khan_2019_crop.jpg","page_title":"دهه ۲۰۲۰ (میلادی)","context_page_description":"دهه ۲۰۲۰ (میلادی) دویست و دومین دهه تقویم میلادی است. این دهه در ۱ ژانویه سال ۲۰۲۰ آغاز و در ۳۱ دسامبر سال ۲۰۲۹ به پایان می‌رسد."},{"page_url":"https://ca.wikipedia.org/wiki/Fangdiekgraben","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3f/Fangdiekgraben_-_Industriegebiet.jpg","page_title":"Fangdiekgraben","context_page_description":"El Fangdiekgraben també anomenat Fangdieckgraben és un riu d'Hamburg.\\nNeix a Lurup, sorgeix de la seva vida entubada a prop del carrer Elbgaustraße i desemboca al Mühlenau a Eidelstedt. El seu nom prové del Fangdiek, un mot baix alemany que significa conca de dipòsit. El rierol que va degenerar a l'era industrial del segle passat, va ser adoptat per a una escola veïna, el Goethe Gymnasium i després pel grup Seilmanns Natur-Ranger -que van treure'l de la seva triste sort monofuncional d'evacuador d'aigua excedentària a un medi ambient estimat per a una varietat creixent de fauna i de flora. Van posar-hi grava o blocs erràtics, van plantar verònica beccabunga. El concurs de totes aquestes intervencions va conduir a un èxit ecològic: més diversitat, més espècies, menys de pol·lució.\\nFotos del naixement cap a la desembocadura:"},{"page_url":"https://qu.wikipedia.org/wiki/William_McMahon","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/William_McMahon_1966.jpg","page_title":"William McMahon","context_page_description":"William \\"Billy\\" McMahon, sutiyuq runaqa. huk Awstralya mama llaqtayuq taripay amachaq wan pulitiku qarqan.\\n1969 watamanta 1971 ñawpaq kuti Awstralyapa Hawa ministrunin qarqan.\\n1971 watamanta 1972 ñawpaq kuti Awstralyapa Uma kamayuqnin qarqan.\\nTaytan: William McMahon; Maman: Mary Ann Walder.\\nÑawpaq warmi:\\nSonia Rachel Hopkins\\nChurinkuna: 3.\\nYachaywasi: Sydney Yachay Suntunin."},{"page_url":"https://vi.wikipedia.org/wiki/Qu%E1%BA%A3_m%E1%BB%8Dng","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Lonicera_coerulea_a3.jpg","page_title":"Quả mọng","context_page_description":"Quả mọng là các loại trái cây nhỏ, ăn được, nhiều thịt quả. Thông thường các quả mọng có dạng tròn, nhiều nước, màu sắc bắt mắt, vị ngọt, chua hoặc chua nhẹ, không có quả hạch hoặc hột, dù một số loại vẫn có hột hay hạt mầm. Ví dụ phổ biến là dâu tây, mâm xôi đen, quả việt quất, mâm xôi đỏ, lý chua đỏ, quả lý chua trắng và đen. Tại Anh, soft fruit là một thuật ngữ trong trồng trọt cho các loại trái cây như vậy.\\nTrong cách sử dụng phổ biến, thuật ngữ \\"berry\\" khác với định nghĩa khoa học hoặc thực vật của một loại trái cây được sản xuất từ bầu nhụy của một bông hoa trong đó lớp ngoài của thành bầu nhụy phát triển thành một phần thịt quả có thể ăn được. Định nghĩa thực vật bao gồm nhiều loại trái cây thường không được biết đến hoặc gọi là quả mọng, chẳng hạn như nho, cà chua, dưa chuột, cà tím, chuối và ớt. Trái cây thường được coi là quả mọng nhưng bị loại trừ bởi định nghĩa thực vật bao gồm dâu tây, mâm xôi đỏ và mâm xôi đen, là các quả tụ và dâu tằm, hay còn gọi là quả phức."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AF%D8%A7%D9%86%D8%B4%DA%AF%D8%A7%D9%87_%D9%88%D8%A7%DB%8C%D9%88%D9%85%DB%8C%D9%86%DA%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/EngineeringHallWyomingU1940.jpg","page_title":"دانشگاه وایومینگ","context_page_description":"دانشگاه وایومینگ تأسیس ۱۸۸۶، یکی از دانشگاه‌های ایالات متحده آمریکا بوده و در وایومینگ واقع است.\\nاین دانشگاه در شهر کوچک لارامی واقع گردیده، سیزده هزار دانشجو داشته و در ده‌ها رشته مدارج دکترا نیز ارائه می‌دهد."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AD%E3%83%83%E3%83%91%E3%83%BC_(%E6%B0%91%E6%97%8F%E8%A1%A3%E8%A3%85)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Kippot.jpg","page_title":"キッパー (民族衣装)","context_page_description":"キッパー、キッパとは、ユダヤ教の民族衣装の一種。男性がかぶる帽子のようなもの。イディッシュ語でヤルムルケ 、ヤームルカ ともいう。これはポーランド語ヤルムルカ に由来する。ケップル、ケッペル、カップルともいう。スカルキャップという「頭蓋」類の帽子に分類され、キリスト教徒のカロッタやイスラム教徒のターキーヤに似ている。\\n小さな皿状の形をしており、頭の片隅に乗せるようにしてかぶる。位置はどこでも良いが。小さなものは、ピンで留めるようにしてかぶる。\\nシナゴーグなどユダヤ教の聖所に入る時には、原則として男子はキッパーを被ることとされる。嘆きの壁などでは、入口に外国人観光客向けの貸出し用のキッパーが用意されており、観光客はこれをかぶり入場する。"},{"page_url":"https://en.wikipedia.org/wiki/2019_in_the_United_Kingdom","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Jonathan_Miller_appearing_on_%22After_Dark%22%2C_3_September_1988.jpg","page_title":"2019 in the United Kingdom","context_page_description":"Events from the year 2019 in the United Kingdom. Lack of agreement on how to proceed with withdrawing from the EU led to substantial political turmoil during this year culminating in the 2019 General election in which the pro-Brexit Conservative party achieved a large majority."},{"page_url":"https://ru.wikipedia.org/wiki/Euarchontoglires","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Kaguaani_02.jpg","page_title":"Euarchontoglires","context_page_description":"Euarchontoglires — надотряд плацентарных млекопитающих, в состав которого входят грандотряды грызунообразные и эуархонты.\\nEuarchontoglires возникли ориентировочно от 85 до 99 млн лет назад в позднем меловом периоде, отделившись от сестринской группы Laurasiatheria, вместе с которой они входят в магнотряд Boreoeutheria. Эту гипотезу сегодня подкрепляют многочисленные находки ископаемых эуархонтоглиров."},{"page_url":"https://es.wikipedia.org/wiki/Capilla_Real_(Castillo_de_Dubl%C3%ADn)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/E4395-Dublin-Castle.jpg","page_title":"Capilla Real (Castillo de Dublín)","context_page_description":"La Capilla Real del Castillo de Dublín, ahora Iglesia de la Santísima Trinidad, era la capilla anglicana oficial de la casa del Señor Teniente de Irlanda desde la Edad Media hasta la creación del Estado Libre Irlandés en 1922. La creación del nuevo estado irlandés hizo que desapareciera el cargo de Señor Teniente y el gobierno británico en Irlanda, que había tenido su sede en el Castillo de Dublín.\\nEl templo, de estilo neogótico, fue diseñado por Francis Johnston, el más destacado arquitecto que trabajó en Irlanda a principios del siglo XIX, y arquitecto del Board of Works. La capilla contiene uno de los mejores interiores góticos recuperados de Irlanda. Sustituyendo una mediocre iglesia anterior del siglo XVIII que tenía problemas estructurales al haber sido construida al lado de la original mota feudal, la nueva Capilla Real fue construida usando un armazón de vigas lo más ligero posible. Tan complicada era la naturaleza del lugar, que las obras tardaron siete años: empezaron en 1807 y fueron completadas con retraso en 1814. Los gastos también fueron superiores a los previstos."},{"page_url":"https://pl.wikipedia.org/wiki/Obersteinbach","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Obersteinbach-protestantische_Kirche-02-gje.jpg","page_title":"Obersteinbach","context_page_description":"Obersteinbach – miejscowość i gmina we Francji, w regionie Grand Est, w departamencie Dolny Ren.\\nWedług danych na rok 1990 gminę zamieszkiwało 199 osób, 22 os./km²."},{"page_url":"https://mg.wikipedia.org/wiki/Efra%C3%ADn_Flores","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Efrain_Flores.jpg","page_title":"Efraín Flores","context_page_description":"Efraín Flores dia mpilalao baolina kitra mizaka ny zom-pirenen'i Meksika teraka ny 6 Febroary 1958"},{"page_url":"https://zh.wikipedia.org/wiki/%E6%BA%AB%E5%B0%BC%E7%88%BE%E5%A4%9A%E9%9D%A2%E9%AB%94%E6%A8%A1%E5%9E%8B%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Great_rhombicuboctahedron_vertfig.png","page_title":"溫尼爾多面體模型列表","context_page_description":"這裡列出所有由馬格努斯·J·溫尼爾分類的所有多面體及星形多面體模型。"},{"page_url":"https://pt.wikipedia.org/wiki/Crawford_House","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Crawford_House.JPG","page_title":"Crawford House","context_page_description":"A Crawford House é um edifício localizado na cidade de Steamboat Springs, Colorado, EUA, que está listado no National Register of Historic Places. A residência foi construída em pedra local em 1894 pelo fundador de Steamboat Springs, James Harvey Crawford, que morou ali durante 36 anos com sua esposa, Margaret Emerine Crawford, considerada \\"a mãe do Condado de Routt\\". Os dois juntos estavam entre as famílias pioneiras mais influentes do noroeste do Colorado. A Crawford House também está listada como um raro exemplo local de arquitetura residencial do revivalismo românico. e a única residência dentro dos limites da cidade construída inteiramente de arenito de cantaria nativa."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%9D%BE%E6%9E%9C%E4%BD%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Pineal_gland.png","page_title":"松果体","context_page_description":"松果体は、脳に存在する小さな内分泌器である。松果腺 、上生体 とも呼ばれる。脳内の中央、2つの大脳半球の間に位置し、間脳の一部である2つの視床体が結合する溝にはさみ込まれている。概日リズムを調節するホルモン、メラトニンを分泌することで知られる。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Karlstadt","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Karlstadt%2C_Alte_Bahnhofstra%C3%9Fe_3-001.jpg","page_title":"Liste der Baudenkmäler in Karlstadt","context_page_description":"Auf dieser Seite sind die Baudenkmäler der unterfränkischen Stadt Karlstadt zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde.\\nDiese Liste gibt den Fortschreibungsstand vom 16. April 2020 wieder und enthält 386 Baudenkmäler."},{"page_url":"https://it.wikipedia.org/wiki/Tafea","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/26/Flag_of_Tafea.png","page_title":"Tafea","context_page_description":"Tafea è una provincia di Vanuatu costituita dalle isole di Tanna, Aniwa, Futuna, Erromango e Anatom di cui il nome della provincia è un acronimo. Possiede una popolazione di 27.530 abitanti e una superficie di 1.628 km². La capitale è Isangel."},{"page_url":"https://sv.wikipedia.org/wiki/HMS_Visby_(J11)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Destroyer_HMS_Visby_in_dry_dock.jpg","page_title":"HMS Visby (J11)","context_page_description":"HMS Visby (J11) var en stadsjagare i svenska flottan som byggdes på Götaverken och sjösattes 16 oktober 1942 som den första av fyra jagare i Visby-klassen Visby genomgick flera ombyggnader efter kriget, och blev tillsammans med systerfartyget HMS Sundsvall föremål för de stora förändringarna. Alla fyra fartygen i Visby-klassen byggdes om till fregatter mellan 1964 och 1966. Visby utrangerades 1 juli 1982, och användes senare som mål för skjutning med Robot 15. Fartyget såldes 1984 för skrotning i Spanien."},{"page_url":"https://tr.wikipedia.org/wiki/Jens_Seipenbusch","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Jens_Seipenbusch_Portr%C3%A4t_2009.jpg","page_title":"Jens Seipenbusch","context_page_description":"Jens Seipenbusch, Alman fizikçi ve siyasetçidir. Ayrıca 2009'dan beri Almanya Korsan Partisi'nin lideridir."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A8%E3%83%A0%E3%82%BA%E3%82%BF%E3%82%A6%E3%83%B3%E5%B9%B8%E6%89%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Mstown_Satte_001.JPG","page_title":"エムズタウン幸手","context_page_description":"エムズタウン幸手は、埼玉県幸手市上高野の国道4号線沿いに所在するショッピングセンターである。2005年12月8日開業。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AB%E3%83%97%E3%83%A9%E3%83%BC%E3%83%8B%E3%82%AB","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6d/Map_of_comune_of_Capranica_%28province_of_Viterbo%2C_region_Lazio%2C_Italy%29.svg","page_title":"カプラーニカ","context_page_description":"カプラーニカは、イタリア共和国ラツィオ州ヴィテルボ県にある、人口約6,400人の基礎自治体。"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%95%BF%E6%B2%99%E8%8A%B1%E9%BC%93%E6%88%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Changsha_Flower_Drum_Song_7.jpg","page_title":"长沙花鼓戏","context_page_description":"長沙花鼓戲為中國湖南東部和中部所流行的一個劇種，形成於清朝。由於當時流行的範圍主要是在長沙府各地，並且以長沙話為統一的舞台語言，因此被稱為長沙花鼓戲。\\n花鼓戲在中國各地都有，長沙花鼓戲是湖南地區影響較大的一種。傳統劇目大概有300多個，多取自民間傳說和現實生活，貼近普通群眾。雖然清朝時長沙花鼓戲已經形成，但流行範圍只在鄉下和小城市，直到1946年才進入長沙城。"},{"page_url":"https://lb.wikipedia.org/wiki/Tunnel_Rangwee","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Luxembourg%2C_Tunnel_Rangwee_%28103%29.jpg","page_title":"Tunnel Rangwee","context_page_description":"Den Tunnel Rangwee ass e 60 Meter laangen Tunnel tëscht dem Rond-point Gluck zu Gaasperech an dem Rangwee um Houwald. En ass 2001 opgaangen."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D0%B5%D1%82%D1%80%D0%BE%D0%B2_%D0%92%D1%96%D0%BA%D1%82%D0%BE%D1%80_%D0%9F%D0%BB%D0%B0%D1%82%D0%BE%D0%BD%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Viktor_Domontovych.jpg","page_title":"Петров Віктор Платонович","context_page_description":"Віктор Платонович Петров — український письменник, філософ, соціальний антрополог, літературний критик, археолог, історик і культуролог; доктор історичних та філологічних наук. Разом з Валеріаном Підмогильним, Петров започаткував жанр українського інтелектуального роману, а також жанр романізованої біографії.\\nСвої твори писав також під псевдонімами В. Домонтович, Віктор Бер, Віктор Петренко та Борис Веріґо."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BB%D1%8E%D0%B4%D0%B5%D0%B9,_%D1%8F%D0%BA%D1%96_%D0%B7%D0%B0%D0%B3%D0%B8%D0%BD%D1%83%D0%BB%D0%B8_%D0%BF%D1%96%D0%B4_%D1%87%D0%B0%D1%81_%D1%81%D1%85%D0%BE%D0%B4%D0%B6%D0%B5%D0%BD%D0%BD%D1%8F_%D0%BD%D0%B0_%D0%95%D0%B2%D0%B5%D1%80%D0%B5%D1%81%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Local_village_at_Everest_region.JPG","page_title":"Список людей, які загинули під час сходження на Еверест","context_page_description":"Найвища у світі гора Джомолунгма, або Еверест була й залишається бажаною метою чи не для всіх альпіністів. Але за відому історію підкорення цієї вершини більше 250 людей загинули при спробах сходження. Більшість цих смертей була пов'язана з лавинами, падіннями з висоти, обвалами льоду, а також різними розладами здоров'я, викликаними перебуванням у високогірних умовах.\\nНе всі тіла загиблих виявили. Причини та обставини смерті деяких з них так і залишилися невідомими. Але й серед знайдених тіл більшість, як і раніше, залишається на горі.\\nВерхня частина Евересту розташована у так званій «зоні смерті» — альпіністський термін, яким позначають висоти від приблизно 8000 м н.р.м. і вище, або висоти, на яких атмосферний тиск нижче 35,6 кПа, і рівень кисню в повітрі недостатній для підтримки життя людини. Багато смертельних випадків серед високогірних альпіністів пов'язані з упливом зони смерті: як прямим, так і непрямим.\\nНа відміну від менших висот над рівнем моря, де людина ще може адаптуватися, акліматизуватися в зоні смерті, як правило, неможливо, тому що там організм швидше витрачає кисень, ніж поповнює потребу через подих."},{"page_url":"https://fi.wikipedia.org/wiki/Saksan_valtakunnanpresidentti","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Reichspr%C3%A4sidentenpalais%2C_Berlin.jpg","page_title":"Saksan valtakunnanpresidentti","context_page_description":"Saksan valtakunnanpresidentti oli tasavaltaisen sekä kansallissosialistisen Saksan valtakunnan ja Suur-Saksan valtakunnan valtionpäämies. Vuosina 1949–1990 Länsi-Saksaa ja vuodesta 1990 jälleenyhdistynyttä Saksaa on johtanut liittopresidentti. Itä-Saksaa johti vuosina 1949–1990 presidentti."},{"page_url":"https://eo.wikipedia.org/wiki/Vladislao_la_2-a_Jogajlido","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/W%C5%82adys%C5%82aw_II.png","page_title":"Vladislao la 2-a Jogajlido","context_page_description":"Vladislao la 2-a Jagello, reĝo Vladislao la 2-a de Hungario kaj Bohemio, vivis inter la jaroj 1456 kaj 1516.\\nNe konfuzu lin kun lia preskaŭ samnoma avo, Ladislao la 2-a Jogajlo de Pollando kaj Litovio, aŭ kun lia similnoma onklo, Ladislao la 3-a de Varna, aŭ kun aliaj regantoj nomataj Ladislao, Vladislao, Vladislavo ktp.\\nli naskiĝis la 1-an de marto de 1456.\\ngepatroj: pola reĝo Kazimiro la 4-a Jogajlido kaj Elizabeto Habsburga.\\nfrato: inter alie la posta katolika sanktulo Kazimiro\\nreĝo kaj princo-elektisto ĉeĥa, hungara, kroata kaj dalmatia, margrafo moravia kaj lusatia, duko silezia, aŭstria, stiria, krajna, limburka, brabanta kaj luksemburgia.\\nli parolis ĉeĥe, hungare, pollingve, latine, germane, france.\\n1456 – 1471 li estis edukata en la pola reĝa kortego en Krakovo.\\nla 27-an de majo de 1471 li estis elektita ĉeĥa reĝo. Koncilio tiel respektis deziron de la mortinta reĝo Jiří, kiu agnoskis siajn sekvantojn – pola-latviajn Jagelonojn. Sed parto de nobelaro frunte kun Zdenko el Šternberk senĉese estis agnoskanta kiel reĝon Matiason Korvinon kaj same papo diris sian opinion kontraŭ Vladislao, elektita de husanoj."},{"page_url":"https://sk.wikipedia.org/wiki/Karel_Ign%C3%A1c_Th%C3%A1m","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Karel_Ignac_Tham_1862.jpg","page_title":"Karel Ignác Thám","context_page_description":"Karel Václav Ignác Thám bol český spisovateľ a prekladateľ.\\nV rokoch 1775–1780 navštevoval gymnázium. Potom študoval filozofiu, v ktorej dosiahol doktorát.\\nPo štúdiách pracoval v Národní veřejné knihovně pražské na katalogizácii starej českej literatúry, pravdepodobne sa práve tu stal veľkým vlastencom a bojovníkom za práva češtiny.\\nPotom sa živil ako súkromný učiteľ češtiny, francúzštiny a nemčiny. Pretože v Prahe nezískal stále miesto učiteľa odišiel do Viedne, kde tiež neuspel.\\nSkoro po návrate ochorel – tým sa dostal do veľmi ťažkej finančnej situácie, z ktorej sa mu snažil pomôcť predovšetkým Josef Dobrovský."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E4%B8%80%E5%BC%8F47%E5%85%AC%E5%8E%98%E5%8F%8D%E6%88%B0%E8%BB%8A%E7%A0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Antitank_gun_Japanese_Type_1_rear_3-4_view_right.jpg","page_title":"一式47公厘反戰車砲","context_page_description":"一式47毫米反坦克炮为大日本帝国陆军战争后期的主力反坦克炮。由于日本的技术实力不足，开发的75毫米与105毫米反坦克炮皆因无法量产高膛压长炮管，直到战争结束前都无法服役，故此型装备也成为日本帝国陆军最后一款制式反坦克炮。到第二次世界大战结束前生产了约2,300门。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%86%E3%82%A4%E3%83%87%E5%B1%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Teide_3d_-_version2.gif","page_title":"テイデ山","context_page_description":"テイデもしくはピコ・デル・テイデは、カナリア諸島のテネリフェ島にある、スペイン領内最高峰に当たる火山。テイデ山とその周辺は、「テイデ国立公園」という面積18,900ヘクタール あまりを持つ国立公園になっており、2007年にはユネスコの世界遺産に登録された。\\n海抜の標高は3,718メートルで、近海の海底からの高さはおよそ7,500メートルであり、スペイン領内最高峰であるとともに、大西洋の島にある山としても最高峰である。テネリフェ島それ自体が地球で第三位の規模を持つ火山になっていることから、テネリフェ島は世界第三位の火山島でもある、また、テネリフェは標高も火山島として世界第三位になっている。\\n噴火を繰り返してきた歴史と人口密集地に近いことから、国際火山学地球内部化学会によって、テイデ山は将来起こりうる自然災害に備えるための緊密な研究が要請される防災十年火山 のひとつに指定されていた。"},{"page_url":"https://cs.wikipedia.org/wiki/P%C5%99edlitavsko","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ef/Parlament.jpg","page_title":"Předlitavsko","context_page_description":"Předlitavsko neboli Rakousko byla jedna ze dvou částí Rakousko-Uherska v letech 1867-1918 s hlavním městem Vídní. Od druhé části, Zalitavska neboli Uherska, jej zčásti oddělovala řeka Litava.\\nPojem „Předlitavsko“ byl neoficiální. Do roku 1915 se oficiálně užívalo spojení Království a země na říšské radě zastoupené, v roce 1915 se oficiálně začalo užívat názvu Rakousko. Předlitavsko vzniklo v roce 1867 jako výsledek tzv. rakousko-uherského vyrovnání.\\nPředlitavsko bylo tvořeno těmito korunními zeměmi:\\nHorní Rakousy\\nDolní Rakousy\\nSalcbursko\\nŠtýrsko\\nKorutany\\nTyrolsko\\nVorarlbersko\\nIstrie\\nGorice a Gradiška\\nTerst\\nDalmácie\\nKrakov\\nČechy\\nMorava\\nSlezsko\\nHalič\\nBukovina\\nKraňsko"},{"page_url":"https://sk.wikipedia.org/wiki/Louis_van_Gaal","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Louis-van-gaal2.jpg","page_title":"Louis van Gaal","context_page_description":"Aloysius Paulus Maria van Gaal je holandský futbalový tréner, ktorý v súčasnosti trénuje klub Manchester United. V rokoch 2000 až 2002 bol trénerom holandského národného futbalového mužstva."},{"page_url":"https://en.wikipedia.org/wiki/Zayeltsovsky_City_District,_Novosibirsk","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Zayeltsovsky_Park%2C_Novosibirsk_09.jpg","page_title":"Zayeltsovsky City District, Novosibirsk","context_page_description":"Zayeltsovsky City District is an administrative district of Central Okrug, one of the 10 raions of Novosibirsk, Russia. The area of the district is 83 sq km. Population: 149, 100."},{"page_url":"https://it.wikipedia.org/wiki/Les_grandes_baigneuses","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Paul_C%C3%A9zanne%2C_French_-_The_Large_Bathers_-_Google_Art_Project.jpg","page_title":"Les grandes baigneuses","context_page_description":"Les grandes baigneuses un dipinto a olio su tela di Paul Cézanne, databile al 1894-1905 circa e conservato nella National Gallery."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Bullay","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Bullay%2C_Katholische_Pfarrkirche_St._Maria_Magdalena.JPG","page_title":"Liste der Kulturdenkmäler in Bullay","context_page_description":"In der Liste der Kulturdenkmäler in Bullay sind alle Kulturdenkmäler der rheinland-pfälzischen Ortsgemeinde Bullay aufgeführt. Grundlage ist die Denkmalliste des Landes Rheinland-Pfalz."},{"page_url":"https://nn.wikipedia.org/wiki/Beger","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/The_Votive_Deposit_of_Vicarello_%2810171650146%29.jpg","page_title":"Beger","context_page_description":"Beger eller bekar er eit rundt drikkekar utan hank og ofte også utan fot. Det blir ofte brukt som drikkekar eller matskål, men kan også visa til ein liten pokal."},{"page_url":"https://fi.wikipedia.org/wiki/Henri_Mulet","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/HenriMulet.png","page_title":"Henri Mulet","context_page_description":"Henri Mulet oli ranskalainen urkuri ja säveltäjä. Hän opiskeli muun muassa Charle-Marie Widorin ja Alexandre Guilmantin johdolla ja toimi urkurina ja kuoronjohtajana Pariisissa. Vuonna 1937 Mulet kuitenkin lähti Provenceen poltettuaan ensin suurimman osan käsikirjoituksistaan, mistä syystä hänen säilynyt sävellystuotantonsa ei ole kovin laaja. Hänen merkittävin teoksensa lienee mittava urkusarja Esquisses byzantines, jonka inspiraation lähde oli ollut Sacré-Coeur, eräs Mulet'n työpaikoista Pariisissa. Provencessa Mulet toimi Darguignanin katedraalin urkurina vuoteen 1958; muutoin hän vietti elämänsä viimeiset 30 vuotta hiljaisuudessa ja yksinäisyydessä."},{"page_url":"https://en.wikipedia.org/wiki/Artav_of_Khwarazm","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Artav_%28Artabanus%29.jpg","page_title":"Artav of Khwarazm","context_page_description":"Artav was a Khwarazmian king who ruled the Khwarazm region of Central Asia in the second half of the 2nd-century. He was the second king of an unnamed kingdom in Khwarazm, founded by his predecessor, whose name is unknown. Artav, during his reign, started the construction of a new city, which became his capital."},{"page_url":"https://en.wikipedia.org/wiki/Vja%C4%8Deslavs_Duhanovs","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Vjaceslavs_Duhanovs.jpg","page_title":"Vjačeslavs Duhanovs","context_page_description":"Vjačeslavs Duhanovs is a Latvian modern pentathlete. He competed at the 1992 and 1996 Summer Olympics."},{"page_url":"https://en.wikipedia.org/wiki/Co-Cathedral_of_Guadalajara,_Spain","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Concatedral_Guadalajara.jpg","page_title":"Co-Cathedral of Guadalajara, Spain","context_page_description":"The Co-cathedral of Santa María de la Fuente la Mayor is a co-cathedral located in Guadalajara, in Castile-La Mancha, Spain. It is in the Roman Catholic Diocese of Sigüenza-Guadalajara.\\nThe building is in mudejar style.\\nIt was declared Bien de Interés Cultural in 1941."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D1%80%D0%B0%D0%B4%D0%B8%D0%B7%D0%B0%D0%B2%D1%80%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Bradysaurus_BW.jpg","page_title":"Брадизавры","context_page_description":"Брадизавры — род парарептилий-анапсид из клады парейазавров, живших во времена пермского периода на территории современной ЮАР."},{"page_url":"https://fr.wikipedia.org/wiki/Accident_de_Lakeview","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Lakeview1Gusher4.jpg","page_title":"Accident de Lakeview","context_page_description":"Le jaillissement de Lakeview nᵒ 1 est le nom donné à une immense éruption d'hydrocarbure, non contrôlée provenant d'un puits sous pression, survenue dans le champ pétrolifère de Midway-Sunset, situé dans le comté de Kern, en Californie, lors de l'année 1910.\\nCe processus maintenant bien connu et redouté des chercheurs de l'industrie pétrolière est dénommé blowout.\\nIl donna lieu au plus grand accident de l'histoire lié à une éruption d'hydrocarbures et dura 18 mois, libérant 9 millions de barils de pétrole brut.\\nLe geyser libéra plus de 1,2 million de tonnes de brut, bien plus que toutes autres fuites sur terre ou sur mer. Le site est situé à un demi-mille à l'est la ville de Taft–Maricopa en Californie sur la Highway 33 et marqué par une plaque en bronze désignée comme le lieu 485"},{"page_url":"https://ms.wikipedia.org/wiki/Utusan_Malaysia","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Logo_Utusan_Malaysia_2020.png","page_title":"Utusan Malaysia","context_page_description":"Utusan Malaysia merupakan sebuah akhbar berbahasa Melayu Malaysia dan akhbar berbahasa Melayu tertua negara. Dahulu di bawah pemilikan daripada Utusan Melayu Berhad, kini Utusan diterbitkan di bawah Media Mulia. Menurut laporan Biro Audit Pengedaran pada 2004 jualan harian akhbar Utusan ialah sebanyak 256,247 naskhah tetapi pada 2009 jualan harian akhbar menjunam ke 169,548 naskhah. Sejak 2018, akhbar ini beralih saiz dari format lebar sehelai kepada tabloid.\\nPada awal penerbitannya, Utusan Malaysia merupakan saluran utama penduduk Semenanjung Tanah Melayu untuk menyuarakan pendapat mereka terhadap penjajah British dan ditulis menggunakan tulisan Jawi. Kini ia telah dicetak menggunakan huruf Rumi. Beberapa agensi berita telah melaporkan bahawa Utusan Malaysia akan menutup operasi pada 21 Ogos 2019 akibat masalah kewangan, namun tidak disahkan. Utusan secara rasminya menamatkan operasinya pada 9 Oktober 2019, selepas 80 tahun diterbitkan. Ia telah dilaporkan bahawa Utusan akan diterbitkan semula pada 1 November 2019 selepas syarikat Aurora Mulia milik Syed Mokhtar Al-Bukhary memperoleh majoriti saham dalam anak syarikat Utusan, Dilof Sdn. Bhd., bagaimanapun, ia tidak dilaksanakan."},{"page_url":"https://af.wikipedia.org/wiki/Atlas_of_Peculiar_Galaxies","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/SpiralGalaxy_NGC6946.jpg","page_title":"Atlas of Peculiar Galaxies","context_page_description":"Die Atlas of Peculiar Galaxies is ’n sterrekundekatalogus van ongewone sterrestelsels wat deur die Amerikaanse sterrekundige Halton Arp opgestel is. Daar is altesaam 338 stelsels in die katalogus, wat oorspronklik in 1966 deur die Kaliforniese Instituut vir Tegnologie gepubliseer is.\\nDie hoefdoel daarvan was om foto's van die verskillende soorte nabygeleë, ongewone sterrestelsels te verskaf. Arp het besef die rede hoekom sterrestelsels spiraal- of elliptiese stelsels word, is nie baie duidelik nie. Hy het ongewone stelsels beskou as klein \\"eksperimente\\" wat sterrekundiges kon bestudeer om die fisiese prosesse te verstaan wat spiraal- of elliptiese stelsels verwring. Die atlas is nie ’n algehele oorsig oor al die ongewone stelsels in die ruimte nie, maar verskaf eerder voorbeelde van die verskillende verskynsels soos wat hulle in nabygeleë stelsels gesien kan word.\\nOmdat min destyds bekend was oor die fisiese prosesse wat die verskillende vorms veroorsaak, word die sterrestelsels gerangskik volgens hul voorkoms. Voorwerpe 1-101 is individuele spiraalstelsels wat ongewoon is of oënskynlik klein metgeselle het. Voorwerpe 102-145 is elliptiese en elliptiesagtige stelsels."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%AD%92%E4%BA%95%E7%94%BA%E5%87%BA%E6%9D%A5%E7%94%BA%E5%A4%A9%E7%8E%8B%E7%A5%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Tokugawaendashizoroe1.JPG","page_title":"筒井町出来町天王祭","context_page_description":"筒井町出来町天王祭は、愛知県名古屋市東区で毎年6月第1土曜日・日曜日の例祭日に行われる天王祭である。東区内筒井町地区で行われる天王祭と出来町地区で行われる天王祭があり、両者はそれぞれ独立した祭りではあるが、日曜日午前に徳川園において両地区の計5両の山車が曳き揃えられる「徳川園山車揃え」もあるなど接点もある。\\n以下、本項の記述にあたっては名古屋市公式サイト内『伝統と歴史のある東区の山車』他を参照した。両天王祭を併せた表記および記述順についても名古屋市公式サイトにおける表記・記述順による。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9E%D0%B1%D1%83%D1%85%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D0%B7%D0%B0%D0%B2%D0%BE%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/%D0%A0%D0%B5%D0%BA%D0%BB%D0%B0%D0%BC%D0%B0_%D0%B7%D0%B0%D0%B2%D0%BE%D0%B4%D0%B0_%D0%91%D0%BE%D0%BB%D1%8C%D1%88%D0%B5%D0%B2%D0%B8%D0%BA%2C_1927.jpg","page_title":"Обуховский завод","context_page_description":"АО «ГОЗ Обуховский завод» — российское предприятие, крупный металлургический и машиностроительный завод, расположенный в Санкт-Петербурге. Также был известен как Обуховский сталелитейный завод и Ленинградский государственный завод «Большевик»."},{"page_url":"https://en.wikipedia.org/wiki/List_of_iPod_models","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Ipod_2G.png","page_title":"List of iPod models","context_page_description":"The Apple iPod line has been upgraded many times, and each significant revision is called a \\"generation\\". Only the most recent generation of the iPod Touch line is available from Apple. Each new generation usually had more features and refinements while typically being physically smaller and lighter than its predecessor, while usually retaining the older model's price tag. Notable changes included the touch-sensitive click wheel replacing the mechanical scroll wheel, use of color displays, and flash memory replacing hard disks."},{"page_url":"https://fr.wikipedia.org/wiki/Tavelure_(botanique)","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/80/Floraison-pommier.jpg","page_title":"Tavelure (botanique)","context_page_description":"Les tavelures sont des maladies cryptogamiques provenant de divers champignons et affectant notamment les pommiers, pruniers, poiriers et oliviers. Elles altèrent aussi bien les feuilles que les fruits."},{"page_url":"https://en.wikipedia.org/wiki/Chose_Promise","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Arnaud_Tsamere.jpeg","page_title":"Chose Promise","context_page_description":"Chose Promise is a one-man show performed by the French comedian Arnaud Tsamere from 2007 to 2014. Written by Tsamere, François Rollin and Arnaud Joyet, it features the character Patrice Valenton, a teacher who is performing a comedy show because of a promise he made to his friend Rémi, who died in a car accident. After explaining this, he attempts ventriloquism, shadow puppetry, a vaudeville play and a song about Rémi. Tsamere then comes out of character and does a routine about bulbs around mirrors in dressing rooms.\\nThe show's title comes from the expression chose promise, chose due and it deals with the theme of death; the character of a teacher was chosen to depict failure. Chose Promise was released on DVD on 6 March 2013 after being recorded at the Sébastopol Theatre in Lille, and its final performances were at the Olympia in February 2014—it has been broadcast on the television channels Comédie+ and D17. It was well received by critics, who praised Tsamere's performance, particularly in the vaudeville sequence."},{"page_url":"https://hu.wikipedia.org/wiki/B%C5%91sze_%C3%81d%C3%A1m","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dd/Nincs_szabad_k%C3%A9p_1.svg","page_title":"Bősze Ádám","context_page_description":"Bősze Ádám zenetudós, zenetörténész, zenekritikus, szakújságíró, több rádiós és televíziós adó zenei szerkesztője, zenei antikváriumvezető, 2008 óta a Bartók Rádió műsorvezetője, 2010 óta a Magyar Antikváriusok Egyesületének elnöke, több kulturális rendezvény és zenei közvetítés moderátora, szakkommentátora."},{"page_url":"https://simple.wikipedia.org/wiki/Islam","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/64/Prayermat.jpg","page_title":"Islam","context_page_description":"Islam is an Abrahamic monotheistic religion. All of its teachings and beliefs are written out in the Quran, the holy scripture of Islam. Believers of Islam are called Muslims which means \\"submitter to God\\". They believe that the Quran was spoken to Muhammad by the angel Jibril, and that it is the word of God. They view Muhammad as a prophet and messenger of God. Other beliefs and rules about what Muslims should do come from reports of what Muhammad taught or hadith.\\nMuslims believe that there were many other prophets before Muhammad since dawn of humanity, beginning with the Prophet Adam and including the Prophet Noah, the Prophet Abraham, the Prophet Moses, and the Prophet Jesus. They believe that all these prophets were given messages by God of the oneness of God to their communities at different times in history of mankind, but Satan made the past communities deviate from the message of oneness and other social codes. Muslims believe that the content of the Quran is protected by Allah as mentioned in the Quran and is the final message of God for all of mankind until the day of judgment.\\nMost Muslims belong to one of two groups. The most common is Sunni Islam."},{"page_url":"https://it.wikipedia.org/wiki/Armatura_giapponese","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/K%C3%B4gake_armored_tabi.JPG","page_title":"Armatura giapponese","context_page_description":"In Giappone, l'uso dell'armatura sviluppò relativamente tardi: nel IV secolo. Ciò non di meno, le peculiarità tecniche ed estetiche delle armature prodotte nel Sol Levante, utilizzate sia dalla casta guerriera per eccellenza, i samurai, sia dalle milizie, le rende ad oggi uno dei settori più studiati della tradizione bellica nipponica.\\nLa migliore espressione delle capacità tecnico-artistiche degli armorari giapponesi è costituita dalla Yoroi prodotta a partire dal XII secolo. Non mancarono poi peculiari tipologie di barda per i cavalli dei samurai: le Uma yoroi del Periodo Edo."},{"page_url":"https://de.wikipedia.org/wiki/Rittersitz_Gro%C3%9F-Winkelhausen","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0e/Gro%C3%9Fwinkelhausen_D_Wappen.JPG","page_title":"Rittersitz Groß-Winkelhausen","context_page_description":"Groß-Winkelhausen ist ein mittelalterlicher Rittersitz am nördlichen Stadtrand von Düsseldorf im Stadtteil Düsseldorf-Angermund am Angerbach."},{"page_url":"https://hu.wikipedia.org/wiki/Az_USA_114._kongresszusa_k%C3%A9pvisel%C5%91h%C3%A1zi_tagjainak_list%C3%A1ja","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Lynn_Westmoreland_Official.jpg","page_title":"Az USA 114. kongresszusa képviselőházi tagjainak listája","context_page_description":"Az Amerikai Egyesült Államok Kongresszusának képviselőháza 435 szavazati joggal rendelkező képviselőből, valamint 6 szavazati joggal nem rendelkező delegáltból áll. Az egyes államok képviselőinek számát a tíz évenként lebonyolított népszámlálás adatai, valamint az állam kiterjedése alapján határozzák meg. Ennek megfelelően a 114. kongresszusban Kaliforniának van a legtöbb, 53 képviselője, és mindössze egy képviselővel rendelkezik Alaszka, Delaware, Montana, Dél-Dakota, Észak-Dakota, Vermont, valamint Wyoming állam. A képviselőház tagjait minden páros év novemberében választják meg, mandátumukat a megválasztott képviselők január 3-án kezdik meg. A 114. kongresszus tagjait 2014. november 4-én választották meg, a következő kongresszus tagjainak megválasztására 2016. november 8-án, az elnökválasztással egy időben került sor.\\nA 114. kongresszus 2015. január 3-a 12:00-tól 2017. január 3-án 12:00-ig ülésezett. A képviselőház többségét ebben az időszakban a republikánusok adták. A képviselőház elnöke a republikánus Paul Ryan, aki John Boehnert 2015. október 29-én váltotta a házelnöki székben."},{"page_url":"https://fr.wikipedia.org/wiki/Chich%C3%A9_(Deux-S%C3%A8vres)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Maison_bourgeoise_place_Saint-Martin_%C3%A0_Chich%C3%A9.JPG","page_title":"Chiché (Deux-Sèvres)","context_page_description":"Chiché est une commune du centre-ouest de la France située dans le département des Deux-Sèvres en région Nouvelle-Aquitaine."},{"page_url":"https://en.wikipedia.org/wiki/Vachellia_nilotica","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Babool_%28Acacia_nilotica%29_trunk_at_Hodal_W_IMG_1252.jpg","page_title":"Vachellia nilotica","context_page_description":"Vachellia nilotica is a flowering plant tree in the family Fabaceae. It is native to Africa, the Middle East and the Indian subcontinent. It is also a Weed of National Significance in Australia as well as a Federal Noxious Weed in the United States."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B0%D1%80%D0%B0%D0%BF%D1%83%D0%BB%D1%8C%D1%81%D0%BA%D0%B8%D0%B9_%D1%8D%D0%BB%D0%B5%D0%BA%D1%82%D1%80%D0%BE%D0%B3%D0%B5%D0%BD%D0%B5%D1%80%D0%B0%D1%82%D0%BE%D1%80%D0%BD%D1%8B%D0%B9_%D0%B7%D0%B0%D0%B2%D0%BE%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/EK-SEGZ.jpg","page_title":"Сарапульский электрогенераторный завод","context_page_description":"АО «Сарапульский электрогенераторный завод» — предприятие военно-промышленного комплекса, специализируется на разработке и производстве авиационного электрооборудования. Продукция предприятия поставляется на ОАО \\"РСК «МиГ», ОАО «Сухой», ОАО НПК «Иркут», ОАО «КнААПО», ЗАО «Авиастар-СП», ОАО «ВАСО», ОАО «Московский вертолетный завод им. М. Л. Миля», ОАО «Казанский вертолетный завод», ОАО «Улан-Удэнский авиационный завод», ОАО «Роствертол», другие авиастроительные и авиаремонтные заводы."},{"page_url":"https://hu.wikipedia.org/wiki/F%C3%BCsti_fecske","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Hirundo_rustica_14116.JPG","page_title":"Füsti fecske","context_page_description":"A füsti fecske a verébalakúak rendjébe és a fecskefélék családjába tartozó, apró testű, villámgyors röptű madár. A füsti fecske a fecskefélék villásfecskék nemének legelterjedtebb faja. Jellegzetes külsejű énekesmadár, testének felső részén kékesfekete tollazattal, villás farktollakkal és ívelt, hegyes szárnyakkal. Megtalálható Európában, Ázsiában, Afrikában és az amerikai kontinensen.\\nA füsti fecskéknek hat alfaja van, melyek szerte az északi féltekén költenek. Négy alfajuk vándorol délebbre telelni. Telelési területük a sarkvidéket leszámítva kiterjed Argentína középső és távolabbi déli vidékeire, Dél-Afrikára és az ausztrál kontinens északi vidékeire is. Nagy kiterjedésű élőhelye egyben azt is jelenti, hogy a füsti fecske nem veszélyeztetett madárfaj, ám helyi populációit megtizedelhetik bizonyos, az adott helyen bekövetkező kedvezőtlen folyamatok.\\nA füsti fecske a nyílt vidék madara, mely főleg ember alkotta szerkezetekre építi fészkét, és szinte mindenütt elterjedt, ahol emberek élnek. Csésze formájú fészkét sárgolyókból építi istállókban vagy azokhoz hasonló helyeken. Repülés közben rovarokkal táplálkozik."},{"page_url":"https://sv.wikipedia.org/wiki/Macintosh_Portable","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c3/Macintosh_Portable-IMG_7541.jpg","page_title":"Macintosh Portable","context_page_description":"Macintosh Portable var den första bärbara datorn från Apple som skulle matcha deras stationär datorer.\\nDatorn lanserades den 20 september 1989 och kostade 6 500 dollar. Försäljningssiffrorna blev låga och i oktober 1991 slutade datorn att säljas."},{"page_url":"https://de.wikipedia.org/wiki/Kfz-Kennzeichen_(T%C3%BCrkei)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Plak-diplomatik-TR.png","page_title":"Kfz-Kennzeichen (Türkei)","context_page_description":"Das Kfz-Kennzeichensystem der Türkei besteht aus einer einfachen Nummerierung der Provinzen nach alphabetischer Ordnung. Dieses System ähnelt der Nummerierung der französischen Departements, jedoch steht auf dem türkischen Nummernschild die Identifizierung der Provinz auf der linken Seite.\\nDie Kennzeichen ähneln dem EU-Muster. Sie zeigen am linken Rand einen blauen Balken mit dem Nationalitätskennzeichen TR.\\nDie Türkei ist in 81 Provinzen eingeteilt. Von 01 bis 67 ist die Nummerierung durchgehend alphabetisch geordnet. Des Weiteren gibt es Unregelmäßigkeiten in der alphabetischen Ordnung durch Änderung von Provinznamen: 33 – Mersin, 46 – Kahramanmaraş und 63 – Şanlıurfa. Später hinzugekommene Provinzen erhielten die Kennnummern von 68 bis 81.\\nIm Jahr 2013 wird die Einführung neuer Nummernschilder mit Mikrochips diskutiert."},{"page_url":"https://it.wikipedia.org/wiki/IPTF14hls","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/IPTF14hls.png","page_title":"IPTF14hls","context_page_description":"iPTF14hls è un'insolita supernova che è esplosa continuamente negli ultimi tre anni, dal 2014 al 2017. Dagli archivi del Palomar Sky Survey, è risultato che nello stesso esatto punto del cielo si osservò un'esplosione nel 1954. Nessuna delle teorie e ipotesi proposte spiega completamente la natura dell'oggetto."},{"page_url":"https://en.wikipedia.org/wiki/Santa_Maria_degli_Angeli_alle_Croci","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Angeli_Facciata.jpg","page_title":"Santa Maria degli Angeli alle Croci","context_page_description":"Santa Maria degli Angeli alle Croci is a Baroque style, Roman Catholic church in Naples, Italy, located on via Veterinaria, near the Botanical Gardens. The extramural church gained its name because the road leading up to this hill here passed a series of crosses."},{"page_url":"https://hsb.wikipedia.org/wiki/L%C4%9Bsna_truskalca","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f8/Fragaria_vesca0.jpg","page_title":"Lěsna truskalca","context_page_description":"Lěsna truskalca je rostlina ze swójby róžowych rostlinow. Dalšej serbskej ludowej mjenje stej pódtrawnica a potrjenica.\\nLěsna truskalca je diploidna a njeje dźiwja forma zahrodneje truskalcy."},{"page_url":"https://de.wikipedia.org/wiki/Shakespeare-Klasse","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/HMS_Keppel_1943_IWM_A_15039.jpg","page_title":"Shakespeare-Klasse","context_page_description":"Die Royal Navy erhielt fünf Boote der Shakespeare-Klasse. Es handelte sich um Flottillenführer, die von der Werft John I. Thornycroft & Company zum Ende des Ersten Weltkriegs zwischen 1917 und 1925 für den Einsatz mit den Zerstörern der V- und W- Klasse gebaut worden waren. Von ihnen waren 1939 noch drei im Dienst; die HMS Wallace war allerdings zum Flugabwehr-Geleitboot umgebaut. Nur die HMS Keppel überlebte den Weltkrieg.\\nNach dem Muster der Shakespeare-Klasse entstanden 1929 in Großbritannien die drei Zerstörer der argentinischen Mendoza-Klasse und 1930 in Italien zwei Zerstörer für Rumänien."},{"page_url":"https://it.wikipedia.org/wiki/Provincia_Nord-Occidentale_(Sri_Lanka)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Flag_of_the_North_Western_Province_%28Sri_Lanka%29.PNG","page_title":"Provincia Nord-Occidentale (Sri Lanka)","context_page_description":"La provincia Nord-Occidentale dello Sri Lanka è una delle 9 province dell'isola, famosa soprattutto per le piantagioni di cocco. Le città più importanti sono Kurunegala, che con quasi 30.000 abitanti è il capoluogo, Puttalam, dove la pesca è molto praticata, e Chilaw"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A6%D0%B5%D1%80%D0%BA%D0%BE%D0%B2%D1%8C_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D1%8F_%D0%A7%D1%83%D0%B4%D0%BE%D1%82%D0%B2%D0%BE%D1%80%D1%86%D0%B0_(%D0%9A%D1%83%D0%B9%D0%B1%D1%8B%D1%88%D0%B5%D0%B2%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/%D0%A0%D0%BE%D1%81%D1%82%D0%BE%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C_%D0%9A%D1%83%D0%B9%D0%B1%D1%8B%D1%88%D0%B5%D0%B2%D0%BE_%D1%86%D0%B5%D1%80%D0%BA%D0%BE%D0%B2%D1%8C_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D1%8F_%D0%A7%D1%83%D0%B4%D0%BE%D1%82%D0%B2%D0%BE%D1%80%D1%86%D0%B0.jpg","page_title":"Церковь Николая Чудотворца (Куйбышево)","context_page_description":"Церковь Николая Чудотворца — православный храм в селе Куйбышево Куйбышевского района Ростовской области, Ростовской и Новочеркасской епархии Русской Православной церкви.\\nАдрес: 344048, Ростовская область, село Куйбышево, ул. Ростовская, 24а."},{"page_url":"https://no.wikipedia.org/wiki/Kjeller_skole","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Kjeller_skole_hovedinngang.jpg","page_title":"Kjeller skole","context_page_description":"Kjeller skole er en barne- og ungdomsskole på Kjeller i Lillestrøm kommune i Viken fylke. Skolen ble etablert i 2010, og har idag omtrent 620 elever fordelt på 27 klasser. Det er ca. 90 ansatte på skolen.\\nSkolen er en satsingskole i realfagene matematikk og naturfag, og andre teknologiske fag. Skolen ligger i nærheten av det rike teknologi- og forskningsmiljøet på Kjeller.\\nSkolen ble i 2018 ombygget med tre paviljonger."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-S%C3%A9bastien_de_Palau-del-Vidre","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Palau_crucifixion.jpg","page_title":"Église Saint-Sébastien de Palau-del-Vidre","context_page_description":"L'église Saint-Sébastien de Palau-del-Vidre ou Église Sainte-Marie est l'église paroissiale et l'église principale de Palau-del-Vidre, dans le département des Pyrénées-Orientales. L'église se situe au cœur de l'ancien village, et est bâtie à l'intérieur du périmètre ancien du \\"fort\\" ou château de Palau-del-Vidre."},{"page_url":"https://en.wikipedia.org/wiki/University_of_Zagreb","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Great_Hall_of_the_Rectorate_of_the_University_of_Zagreb.jpg","page_title":"University of Zagreb","context_page_description":"The University of Zagreb is the largest Croatian university and the oldest continuously operating university in the area covering Central Europe south of Vienna and all of Southeastern Europe.\\nThe history of the University began on September 23, 1669, when the Holy Roman Emperor Leopold I issued a decree granting the establishment of the Jesuit Academy of the Royal Free City of Zagreb. The decree was accepted at the Council of the Croatian Kingdom on November 3, 1671. The Academy was run by the Jesuits for more than a century until the order was dissolved by Pope Clement XIV in 1773. In 1776, Empress Maria Theresa issued a decree founding the Royal Academy of Science which succeeded the previous Jesuit Academy. Bishop Josip Juraj Strossmayer proposed the founding of a University to the Croatian Parliament in 1861. Emperor Franz Joseph signed the decree on the establishment of the University of Zagreb in 1869. The Act of Founding was passed by the Parliament in 1874, and was ratified by the Emperor on January 5, 1874. On October 19, 1874, the Royal University of Franz Joseph I was officially opened."},{"page_url":"https://it.wikipedia.org/wiki/Xavier_Novell_Gom%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Mons._Novell_%2830913891995%29.jpg","page_title":"Xavier Novell Gomá","context_page_description":"Xavier Novell Gomá è un vescovo cattolico spagnolo, dal 3 novembre 2010 vescovo di Solsona."},{"page_url":"https://pt.wikipedia.org/wiki/Bustelo_(Amarante)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Amarante_Bustelo_Igreja_Matriz.jpg","page_title":"Bustelo (Amarante)","context_page_description":"Bustelo foi uma freguesia portuguesa do concelho de Amarante, com 7,69 km² de área e 521 habitantes. Densidade: 67,8 hab/km².\\nFoi extinta em 2013, no âmbito de uma reforma administrativa nacional, tendo sido agregada às freguesias de Carneiro e Carvalho de Rei, para formar uma nova freguesia denominada União das Freguesias de Bustelo, Carneiro e Carvalho de Rei com sede em Bustelo."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9D%D0%BE%D0%B2%D0%B8%D0%B9_%D0%9F%D0%B0%D0%BF%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/The_New_Pope.jpg","page_title":"Новий Папа","context_page_description":"Новий Папа — драматичний телесеріал режисера Паоло Соррентіно на замовлення телеканалів Sky Atlantic, HBO та Canal+. Це дев'ятисерійне продовження серіалу Молодий Папа, яке спершу анонсували як його другий сезон. В головних ролях знялись Джуд Лоу та Джон Малкович.\\nПрем'єра серіалу відбулась 10 січня 2020 року на телеканалі Sky Atlantic в Італії."},{"page_url":"https://ro.wikipedia.org/wiki/Julio_Cort%C3%A1zar","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Cort%C3%A1zar.jpg","page_title":"Julio Cortázar","context_page_description":"Julio Cortázar a fost un important romancier din Argentina, unul dintre cei mai importanți autori ai curentului școlii realismului magic sud-american."},{"page_url":"https://br.wikipedia.org/wiki/Anvio%C3%B9-tiegezh_portugalek","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Guimaraes2.JPG","page_title":"Anvioù-tiegezh portugalek","context_page_description":"Sed amañ ur rollad anvioù-tiegezh portugalek.\\nE Portugal eo spisaet gant al lezenn n'haller ket, na war-zigarez doare-skrivañ ofisiel ar portugaleg, nag abalamour da gemmoù an doare-skrivañ, kemm an anvioù-tud nag anvioù-tiegezh. Ar c'hemmoù en doare da skrivañ an anvioù-tiegezh a zo dleet, hervez a zo bet gwelet a-hed an amzerioù, a-wechoù da c'hoant personel an dud a ra gante, pe da ziouiziegezh ar gargidi-stad diwar-benn al lezenn, pa vez diseblant ar geodedourien ouzh ar seurt aferioù. Diwall stumm kozh an anvioù-tiegezh a zo gwarantet gant Direitos de Personalidade keodedourion Portugal, ha mar o c'hemmer e c'hall an den sevel klemm ha mont d'al lez-varn ken na vo adlakaet e anv hervez ar stumm kozh boas."},{"page_url":"https://it.wikipedia.org/wiki/Turismo_in_Abruzzo","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/62/Casoli_01.jpg","page_title":"Turismo in Abruzzo","context_page_description":"Secondo le statistiche dell'ISTAT, nel 2014 gli arrivi sono stati 174.171 e le presenze 870.288, cifre che pongono l'Abruzzo al diciottesimo posto tra le regioni italiane per numero di turisti annui. Nel 2008, sempre secondo l'Istat, il 5,2% della popolazione regionale era occupato nel settore turistico con una crescita relativa a questo tipo di occupazione pari al 1,8%. Per quanto riguarda l'offerta ricettiva, le statistiche collocano la regione tredicesima tra le altre regioni italiane con 81 posti letto ogni 1000 abitanti, seconda regione d'Italia centro-meridionale dietro solo alla Sardegna; infine nel 2012 erano 774 gli agriturismi attivi nella regione con una crescita del 6% per quanto riguarda questo tipo di alloggio e servizio. Nel 2011 la regione ha registrato un forte incremento turistico con un +6,5% sul fronte degli arrivi e un +2,5% sul fronte delle presenze; ciononostante l'Abruzzo resta agli ultimi posti fra le regioni italiane per presenze turistiche."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Glenmoor_(Ohio)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/OHMap-doton-Glenmoor.png","page_title":"Glenmoor (Ohio)","context_page_description":"Glenmoor sī Bí-kok Ohio chiu Columbiana kūn ê chi̍t ê chng-thâu."},{"page_url":"https://en.wikipedia.org/wiki/Charles_Bertier_(journalist)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Charles_Bertier.jpg","page_title":"Charles Bertier (journalist)","context_page_description":"Charles Pierre Bertier was a French lawyer, magistrate, director of the Courrier des Alpes, Master of Requests to the Council of State and Governor of Martinique from 1867 to 1869. He is known for the role he played in defining the terms under which Savoy was annexed to France in 1860."},{"page_url":"https://pt.wikipedia.org/wiki/Ilha_Koshava","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Zed-Islands.jpg","page_title":"Ilha Koshava","context_page_description":"A Ilha Koshava é a ilha mais oriental no grupo Zed fora da Península Varna, a Ilha Livingston no nordeste nas Ilhas Shetland do Sul, Antártica. A ilha está livre de gelo, se estendendo a 340 por 220 m. Situada no lado oeste da entrada norte para o Estreito McFarlane, 140 m a nordeste da Ilha Lesidren, e 1,9 km a norte do Cabo Williams na Ilha Livingston. A área foi visitada por caçadores de foca no início do século 19.\\nA ilha recebeu o nome do assentamento de Koshava na Bulgária do noroeste."},{"page_url":"https://de.wikipedia.org/wiki/Isfahan","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Esfhan_market%281%29.jpg","page_title":"Isfahan","context_page_description":"Isfahan bzw. Esfahan ist die Hauptstadt der gleichnamigen Provinz im Iran mit rund 1,9 Millionen Einwohnern.\\nSeine Glanzzeit erlebte Isfahan unter der Dynastie der Safawiden, die Isfahan 1598 zu ihrer Hauptstadt machten und durch zahlreiche Prachtbauten und Gartenanlagen verschönten. Aus dieser Zeit stammt das persische Wortspiel und Sprichwort „Isfahan ist die Hälfte der Welt“."},{"page_url":"https://en.wikipedia.org/wiki/Grade_II*_listed_buildings_in_Vale_of_White_Horse","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Conduit_House_Harcourt_Hill_Geograph-2162812-by-Des-Blenkinsopp.jpg","page_title":"Grade II* listed buildings in Vale of White Horse","context_page_description":"There are over 20,000 Grade II* listed buildings in England. This page is a list of these buildings in the district of Vale of White Horse in Oxfordshire."},{"page_url":"https://en.wikipedia.org/wiki/Amherst,_Massachusetts","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fb/Amherst_ma_highlight.png","page_title":"Amherst, Massachusetts","context_page_description":"Amherst is a town in Hampshire County, Massachusetts, United States, in the Connecticut River valley. As of the 2010 census, the population was 37,819, making it the highest populated municipality in Hampshire County. The town is home to Amherst College, Hampshire College, and the University of Massachusetts Amherst, three of the Five Colleges. The name of the town is pronounced without the h by natives and long-time residents, giving rise to the local saying, \\"only the 'h' is silent\\", in reference both to the pronunciation and to the town's politically active populace.\\nAmherst has three census-designated places; Amherst Center, North Amherst, and South Amherst.\\nAmherst is part of the Springfield, Massachusetts Metropolitan Statistical Area. Lying 22 miles north of the city of Springfield, Amherst is considered the northernmost town in the Hartford-Springfield Metropolitan Region, \\"The Knowledge Corridor\\". Amherst is also located in the Pioneer Valley, which encompasses the Hampshire, Hampden and Franklin counties."},{"page_url":"https://fi.wikipedia.org/wiki/Aitonevan_liikennepaikka","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Pettukangas.jpg","page_title":"Aitonevan liikennepaikka","context_page_description":"Aitonevan laiturivaihde on lakkautettu liikennepaikka Pori–Haapamäki-radan ja Aitonevan radan risteyksessä Kihniön kunnassa. Se avattiin 24. heinäkuuta 1944. Vuonna 1946 valmistui arkkitehti Jarl Ungernin suunnittelema liikennepaikkarakennus, joka oli toisen maailmansodan jälkeisen jälleenrakennuskauden asemien tapaan vaatimaton.\\nAitonevan laiturivaihde muutettiin miehittämättömäksi seisakevaihteeksi vuonna 1954 ja henkilöliikenne lopetettiin 30. toukokuuta 1965. Henkilöliikenne Porin ja Haapamäen välillä lakkautettiin kokonaisuudessaan vuonna 1981. Aitonevasta tuli radan itäinen päätepiste, kun rataosa Haapamäelle poistettiin käytöstä vuonna 1985. Tavaraliikenne Aitonevan liikennepaikalla lopetettiin 1. tammikuuta 2001. Kihniön ja Aitonevan välisen rataosan kunnossapito lopetettiin vuonna 2003 ja Aitoneva lakkautettiin. Aitonevan liikennepaikkarakennus on purettu, mutta sivuraiteet ovat yhä jäljellä."},{"page_url":"https://sk.wikipedia.org/wiki/%C5%BDelezni%C4%8Dn%C3%A1_stanica_%C5%A0trbsk%C3%A9_Pleso","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/TE%C5%BD_%C5%A0trbsk%C3%A9_Pleso.jpg","page_title":"Železničná stanica Štrbské Pleso","context_page_description":"Železničná stanica Štrbské Pleso je železničná stanica v Štrbe, časti Štrbské Pleso.\\nStanica je terminálom ozubnicovej trate Štrbské Pleso – Štrba ako aj Tatranských elektrických železníc. Rozchod v stanici je 1 000 mm, elektrifikovaná je jednosmernou sústavou 1,5 kV. Svojou nadmorskou výškou je najvyššie položenou stanicou v sieti Železníc Slovenskej republiky."},{"page_url":"https://da.wikipedia.org/wiki/S%C3%A6by_Kirke_(Frederikshavn_Kommune)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Church_Saeby_da_060705.jpg","page_title":"Sæby Kirke (Frederikshavn Kommune)","context_page_description":"Sæby Kirke ligger ved havnen i den lille nordjyske købstad, Sæby. Kirken har været en fløj af karmelitterklostret, Mariested Kloster i perioden 1460 til reformationen i 1536. Dele af kirken er dog af ældre dato, for klosterkirken blev til ved en udvidelse af den eksisterende sognekirke."},{"page_url":"https://es.wikipedia.org/wiki/Fabio_Casartelli","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Fabio_Casartelli.jpg","page_title":"Fabio Casartelli","context_page_description":"Fabio Casartelli fue un ciclista italiano, profesional desde 1993.\\nAnimado por su padre, Casartelli se involucró en el mundo del ciclismo desde los 9 años. Con unas cuantas victorias como amateur, Casartelli consiguió su mayor logro en los Juegos Olímpicos de 1992, al ganar la medalla de oro en la prueba de ciclismo en ruta.\\nPasó a profesionales en 1993, pero solo consiguió victorias y posiciones de honor en carreras menores.\\nEl 18 de julio de 1995, durante la 15ª etapa del Tour de Francia, Fabio Casartelli sufrió un accidente durante el descenso del Col de Portet d'Aspet, en los Pirineos. Casartelli sufrió graves lesiones de cráneo y cara y perdió la consciencia. Durante su traslado en helicóptero al hospital, Casartelli perdió la respiración y falleció tras varios intentos de reanimación.​\\nEn el momento de la caída, Casartelli no llevaba ningún tipo de casco protector. Su muerte causó una conmoción en el ciclismo profesional y surgieron diversos debates acerca de la obligatoriedad del casco por los ciclistas.\\nLa 16ª etapa del Tour fue neutralizada, aunque no suspendida por la organización."},{"page_url":"https://fr.wikipedia.org/wiki/Leeuwergem","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Leeuwergemdorp.jpg","page_title":"Leeuwergem","context_page_description":"Depuis 1977, Leeuwergem est une section de la ville belge de Zottegem dans le Denderstreek sur le Molenbeek située en Région flamande dans la province de Flandre-Orientale.\\nLe village est connu pour son château de Leeuwergem."},{"page_url":"https://fr.wikipedia.org/wiki/Dioc%C3%A8se_de_Nancy-Toul","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Toul%2C_Cath%C3%A9drale_Saint-Etienne-PM_50343.jpg","page_title":"Diocèse de Nancy-Toul","context_page_description":"Le diocèse de Nancy et de Toul est un des quatre diocèses de la Lorraine rattaché à l'Église catholique. Il succède depuis le Concordat de 1801 à l'éphémère diocèse de Nancy, créé en 1777, et à l'ancien diocèse de Toul fondé au Actuellement, l'évêché de Nancy et de Toul est suffragant de la province ecclésiastique de Besançon.\\nPour des questions de prestige et de fidélité mémorielle, les évêques de Nancy, également primats de Lorraine, sont autorisés par le bref apostolique du 20 février 1824 à accoler à leur titre celui d'évêque de Toul. À noter que l'évêque de Nancy et de Toul est le seul évêque en France qui peut se vêtir du surhuméral, attribut historique porté par les évêques de Toul depuis le haut Moyen Âge."},{"page_url":"https://en.wikipedia.org/wiki/Breakin%27_Point_(song)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Pomnik_Chrystusa_w_%C5%9Awiebodzinie.jpg","page_title":"Breakin' Point (song)","context_page_description":"\\"Breakin' Point\\" is a song by Swedish band Peter Bjorn and John from their seventh studio album Breakin' Point. It was released on 25 March 2016 through PBJ Musik and Ingrid as the album's second single. Written by the band and produced by Emile Haynie, \\"Breakin' Point\\" is a midtempo pop song with lyrics alluding to the protagonist's concerns about expecting a child. It features a whistling intro, which the band were initially hesitant to include as their breakthrough single \\"Young Folks\\" had a similar composition. They eventually decided \\"Breakin' Point\\" would represent a fitting tribute as it was conceived near the ten-year anniversary of \\"Young Folks\\".\\nMusic critics were generally positive towards \\"Breakin' Point\\" and noted its catchiness. Commercially, the single only appeared below the top 50 of the Wallonian Ultratip chart. A remix by Swedish band Miike Snow was also released. The song's accompanying music video was shot in Poland on several locations, including Wolin National Park. It was directed by Danish-Norwegian duo HochR, who took inspiration from the rivers of Hades in the underworld from Greek mythology, particularly the river Styx."},{"page_url":"https://he.wikipedia.org/wiki/%D7%99%D7%A2%D7%9C_%D7%91%D7%A8%D7%AA%D7%A0%D7%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Pressekonferenz_zur_Aktion_%E2%80%9EZwei_Minuten_Stillstand%E2%80%9C_von_Yael_Bartana-1482.jpg","page_title":"יעל ברתנא","context_page_description":"יעל ברתנא היא אמנית מולטימדיה ישראלית, החיה בהולנד ובישראל. עבודותיה עוסקות בטקסים של החברה הישראלית ובביקורת על הנראטיב הציוני."},{"page_url":"https://ca.wikipedia.org/wiki/Henrietta_Rae","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Henrietta_Rae.jpg","page_title":"Henrietta Rae","context_page_description":"Henrietta Emma Ratcliffe Rau va ser una pintora anglesa que va néixer en l'últim període de l'era victoriana."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%A1%E1%83%90%E1%83%9B%E1%83%9D%E1%83%97%E1%83%AE%E1%83%98%E1%83%A1_%E1%83%A9%E1%83%98%E1%83%A2%E1%83%98%E1%83%A1_%E1%83%97%E1%83%90%E1%83%9C%E1%83%90%E1%83%95%E1%83%90%E1%83%A0%E1%83%A1%E1%83%99%E1%83%95%E1%83%9A%E1%83%90%E1%83%95%E1%83%94%E1%83%93%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Apus_IAU.svg","page_title":"სამოთხის ჩიტის თანავარსკვლავედი","context_page_description":"სამოთხის ჩიტის თანავარსკვლავედი — ცის სამხრეთ პულუსის ახლოს განლაგებული თანავარსკვლავედი. ყველაზე ბრწყინვალე ვარსკვლავების ვიზუალური ვარსკვლავიერი სიდიდეებია 3,8 და 3,9. შეიცავს 20 ვარსკვლავს, რომელთა ხილვა შეუიარაღებელი თვალითაც არის შესაძლებელი. საქართველოდან არ ჩანს."},{"page_url":"https://sv.wikipedia.org/wiki/Jan_Kot%C4%9Bra","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Divadlo_%28Prost%C4%9Bjov-_czech_republic%29.jpg","page_title":"Jan Kotěra","context_page_description":"Jan Kotěra, född 18 december 1871 i Brno, död 17 april 1923 i Prag, var en tjeckisk arkitekt, designer och grafiker. Han var ansedd som en av Tjeckiens främsta arkitekter från 1900-talets början.\\nKotěra studerade för bland andra Otto Wagner vid Akademie der bildenden Künste, Wiens konstakademi. Kotěra var professor vid Prags konstakademi."},{"page_url":"https://hr.wikipedia.org/wiki/Rorschachov_test_mrlja","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Rorschach_blot_07.jpg","page_title":"Rorschachov test mrlja","context_page_description":"Rorschachov test mrlja, jedan je od projektivnih testova koji se rabe u psihodijagnostičkom procesu kao dio psihološkog pregleda koji obavlja klinički psiholog ili drugi posebno specijalizirani psiholog za primjenu ove tehnike."},{"page_url":"https://fr.wikipedia.org/wiki/Martin_Campbell","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Martin_Campbell.jpg","page_title":"Martin Campbell","context_page_description":"Martin Campbell, né le 24 octobre 1943 à Hastings, en, est un réalisateur, producteur de cinéma et acteur néo-zélandais.\\nIl est surtout connu pour avoir réalisé les deux premiers opus des deux derniers interprètes de la saga James Bond : GoldenEye, avec Pierce Brosnan, en 1995, puis Casino Royale, avec Daniel Craig, en 2006.\\nDeux succès critiques et commerciaux mondiaux.\\nIl est également le réalisateur de trois autres blockbusters : Le Masque de Zorro et sa suite, La Légende de Zorro, puis Green Lantern, ce dernier se révélant être un échec au box-office."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%BB%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%BF%D1%80%D0%BE%D1%81%D0%BF%D0%B5%D0%BA%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Klinsky_Avenue_SPB_01.jpg","page_title":"Клинский проспект","context_page_description":"Кли́нский проспект — проспект в Адмиралтейском районе Санкт-Петербурга. Проходит от Рузовской улицы до Московского проспекта."},{"page_url":"https://de.wikipedia.org/wiki/Gr%C3%A9zian","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Gr%C3%A9zian_-_Eglise_Saint-Just_et_Saint-Pasteur_-_03.jpg","page_title":"Grézian","context_page_description":"Grézian ist eine französische Gemeinde mit 81 Einwohnern im Département Hautes-Pyrénées in der Region Okzitanien. Die Gemeinde gehört zum Arrondissement Bagnères-de-Bigorre und zum Kanton Neste, Aure et Louron.\\nDie Einwohner werden Grézianais und Grézianaises genannt."},{"page_url":"https://sv.wikipedia.org/wiki/Odensvi_distrikt,_Sm%C3%A5land","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Distrikt_V%C3%A4stervik.jpg","page_title":"Odensvi distrikt, Småland","context_page_description":"Odensvi distrikt är ett distrikt i Västerviks kommun och Kalmar län.\\nDistriktet ligger i västra delen av kommunen."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkmale_in_Bunde","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Boen_Boenster_Hauptstra%C3%9Fe_58.JPG","page_title":"Liste der Baudenkmale in Bunde","context_page_description":"Die Liste der Baudenkmale in Bunde enthält die nach dem Niedersächsischen Denkmalschutzgesetz geschützten Baudenkmale in der ostfriesischen Gemeinde Bunde.\\nGrundlage ist die veröffentlichte Denkmalliste des Landkreises.\\nBaudenkmale sind „im Sinne des Gesetzes Bodendenkmale, bewegliche Denkmale und Denkmale der Erdgeschichte.“"},{"page_url":"https://en.wikipedia.org/wiki/Alexander_City,_Alabama","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Old_City_Hall_Alexander_City%2C_Alabama.JPG","page_title":"Alexander City, Alabama","context_page_description":"Alexander City, known to locals as \\"Alex City\\", is a city in Tallapoosa County, Alabama, United States, with a population of some 14,875. It has been the largest community in Tallapoosa County since 1910. It is known for Lake Martin with its 750 miles of wooded shoreline and 44,000 acres of water. Lake Martin stands on the Tallapoosa River and offers boating, swimming, fishing, golfing, and camping. Many neighborhoods and luxury homes are located on the lake.\\nThe city's economy was traditionally based on the textile industry, but in recent times its economic base has become more diversified as textile jobs have gone to India."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%8D%8A%E5%88%86%E3%80%81%E9%9D%92%E3%81%84%E3%80%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Iwamura_hondori1.jpg","page_title":"半分、青い。","context_page_description":"『半分、青い。』は、2018年度上半期放送のNHK「連続テレビ小説」第98作目の作品である。2018年4月2日から9月29日まで放送された。"},{"page_url":"https://ms.wikipedia.org/wiki/2013","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Mohamed_Morsi-05-2013.jpg","page_title":"2013","context_page_description":"2013 merupakan tahun biasa yang bermula pada hari Selasa dalam kalendar Gregory."},{"page_url":"https://da.wikipedia.org/wiki/Err_(Pyr%C3%A9n%C3%A9es-Orientales)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Map_commune_FR_insee_code_66067.png","page_title":"Err (Pyrénées-Orientales)","context_page_description":"Err er en by og kommune i departementet Pyrénées-Orientales i Sydfrankrig."},{"page_url":"https://sv.wikipedia.org/wiki/Metodistkyrkan_i_Sverige","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e4/%C3%96ver%C3%A5s.jpg","page_title":"Metodistkyrkan i Sverige","context_page_description":"Metodistkyrkan i Sverige var ett svenskt kristet frikyrkligt samfund, som numera ingår i Equmeniakyrkan. Det var den svenska delen av Förenade Metodistkyrkan."},{"page_url":"https://en.wikipedia.org/wiki/List_of_historical_harbour_cranes","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Pl_gdansk_zuraw_dlugiepobrzeze2006.jpg","page_title":"List of historical harbour cranes","context_page_description":"The list of historical harbour cranes includes historical harbour cranes from the Middle Ages to the introduction of metal cranes in the Industrial Revolution during the 19th century. Modern reconstructions are also listed."},{"page_url":"https://fr.wikipedia.org/wiki/Troms%C3%B8ya","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/82/Norway_-_Troms%C3%B8ya.png","page_title":"Tromsøya","context_page_description":"Tromsøya est une petite île côtière du nord de la Norvège, dans le comté de Troms og Finnmark située au-delà du cercle polaire, dans le détroit de Tromsøysundet entre le continent à l'est et l'île de Kvaløya à l'ouest. Elle abrite la ville de Tromsø, huitième ville de Norvège et principale ville de la région. D'une superficie de 22,8 km2 et assez plate, l'île a une population de 36 088 habitants.\\nLe lac Prestvannet occupe le milieu de l'île et constitue avec ses abords une réserve naturelle. L'île abrite l'aéroport de Tromsø, une université, l'hôpital universitaire de Norvège du Nord et le musée de Tromsø. L'île est reliée au continent par un pont et un tunnel et à l'île de Kvaløya par le pont Sandnessund."},{"page_url":"https://en.wikipedia.org/wiki/Newspaper","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Old_man_reading_news_paper_early_in_the_morning_at_Basantapur-IMG_6800.jpg","page_title":"Newspaper","context_page_description":"A newspaper is a periodical publication containing written information about current events and is often typed in black ink with a white or gray background.\\nNewspapers can cover a wide variety of fields such as politics, business, sports and art, and often include materials such as opinion columns, weather forecasts, reviews of local services, obituaries, birth notices, crosswords, editorial cartoons, comic strips, and advice columns.\\nMost newspapers are businesses, and they pay their expenses with a mixture of subscription revenue, newsstand sales, and advertising revenue. The journalism organizations that publish newspapers are themselves often metonymically called newspapers.\\nNewspapers have traditionally been published in print. However, today most newspapers are also published on websites as online newspapers, and some have even abandoned their print versions entirely.\\nNewspapers developed in the 17th century, as information sheets for merchants. By the early 19th century, many cities in Europe, as well as North and South America, published newspapers."},{"page_url":"https://fr.wikipedia.org/wiki/Municipalit%C3%A9_(Bosnie-Herz%C3%A9govine)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Bugojno_grb.png","page_title":"Municipalité (Bosnie-Herzégovine)","context_page_description":"La municipalité est une unité administrative de la Bosnie-Herzégovine.\\nAvant la Guerre de Bosnie, le pays comptait 109 municipalités, dont 10 faisaient partie du secteur de Sarajevo, la capitale. Après la guerre, leur nombre a été porté à 142 : 79 municipalités dans la Fédération de Bosnie-et-Herzégovine et 62 dans la République serbe de Bosnie ; le district de Brčko, quant à lui, n'appartient à aucune des deux entités du pays. Dans la Fédération, les municipalités font partie d'un kanton, tandis qu'en Republika Sprska elles font partie de régions qui ne possèdent pas de statut administratif officiel."},{"page_url":"https://es.wikipedia.org/wiki/Martijn_Budding","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Deutschland_Tour_2018_Bonn_026.jpg","page_title":"Martijn Budding","context_page_description":"Martijn Budding es un ciclista profesional neerlandés que actualmente corre para el equipo Riwal Securitas Cycling Team."},{"page_url":"https://de.wikipedia.org/wiki/Schmalspurbahn_Wilischthal%E2%80%93Thum","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Bahnhof_Oberherold_Gleisrest.jpg","page_title":"Schmalspurbahn Wilischthal–Thum","context_page_description":"Die Schmalspurbahn Wilischthal–Thum war eine sächsische Schmalspurbahn im mittleren Erzgebirge. Sie begann im Bahnhof Wilischthal an der Bahnstrecke Annaberg-Buchholz unt Bf–Flöha und führte entlang der Wilisch nach Ehrenfriedersdorf. Eine Zweigbahn führte von Oberherold nach Thum. Der Abschnitt Oberherold–Ehrenfriedersdorf wurde 1906 infolge des Baues der Strecke Geyer–Thum aufgegeben."},{"page_url":"https://fr.wikipedia.org/wiki/Verri%C3%A8res-le-Buisson","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Verrieres-le-Buisson_Centre_Culturel_Andre-Malraux.JPG","page_title":"Verrières-le-Buisson","context_page_description":"Verrières-le-Buisson est une commune française située à quatorze kilomètres au sud-ouest de Paris dans le département de l’Essonne en région Île-de-France.\\nSituée à la limite avec les Hauts-de-Seine et la première couronne parisienne dont elle est proche sociologiquement, Verrières-le-Buisson qui était déjà plébiscitée dès le XVIIIᵉ siècle par les rois de France pour leurs chasses en forêt est aujourd’hui encore connue des Parisiens pour sa forêt de Verrières, poumon vert aux portes de la capitale et sa vallée de la Bièvre au caractère rural.\\nElle est aussi célèbre dans le milieu de l’horticulture et la botanique pour avoir été le site choisi par la famille Vilmorin, fondateur de la compagnie Vilmorin de graines. Cette riche famille a laissé à la ville son arboretum, devenu réserve naturelle régionale, qui lui permet aujourd’hui encore, malgré une urbanisation importante durant les années 1960 de revendiquer le titre de « Ville Arboretum ». Riche de six châteaux et demeures et de nombreux lotissements pavillonnaires, elle cultive son côté « village » en pleine agglomération parisienne.\\nSes habitants sont appelés les Verriérois."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%A5%A7%E6%96%AF%E5%8D%A1%C2%B7%E5%8A%A0%E8%A5%BF%E4%BA%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/FC_Admira_Wacker_M%C3%B6dling_vs._FC_Red_Bull_Salzburg_%28Cup%29_2017-04-26_%28032%29.jpg","page_title":"奧斯卡·加西亞","context_page_description":"奥斯卡·加西亚·祖耶特是一名前西班牙足球运动员，司职前腰，退役后转任教练，曾执教特拉维夫马卡比和英冠俱乐部布莱顿和沃特福德。\\n作为球员时，加西亚是多才多艺的进攻选择，可以担任前腰或影子前锋。在他14年长的职业球员生涯中主要效力母会巴塞罗那，具有一定的影响，亦曾为另外四支国内球队上场。加西亚在西甲的12个赛季总共上场169场及射入31球，除巴塞罗那外，亦曾效力西班牙人4个赛季和阿尔瓦塞特及巴伦西亚各一个赛季。"},{"page_url":"https://hu.wikipedia.org/wiki/D%C3%A9li_Hal_csillagk%C3%A9p","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Piscis_Austrinus_-_Mercator.jpeg","page_title":"Déli Hal csillagkép","context_page_description":"A Déli Hal egy csillagkép."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_in_Groningen_(stad)/Binnenstad","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Groningen_Hoge_der_A_14.JPG","page_title":"Lijst van rijksmonumenten in Groningen (stad)/Binnenstad","context_page_description":"De binnenstad van Groningen telt 398 inschrijvingen in het rijksmonumentenregister; hieronder een overzicht."},{"page_url":"https://de.wikipedia.org/wiki/Ulica_Jana_III_Sobieskiego","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9d/SobeisDSC_1949.JPG","page_title":"Ulica Jana III Sobieskiego","context_page_description":"Die Ulica Jana III Sobieskiego ist eine der großen Nord-Süd-Verkehrsadern Warschaus und befindet sich auf der linken, westlichen Seite der Weichsel. Sie verbindet die Ulica Belwederska mit der Aleja Wilanowska und ist damit Teil des Warschauer Königstraktes. Die nach dem König Jan III. Sobieski benannte Sobieskiego verläuft kurvenfrei über rund vier Kilometer und durchschneidet die Stadtteile Mokotów und Wilanów. Ihren heutigen Namen trägt sie seit 1919, vorher wurde die Strecke als Droga Królewska bezeichnet. Von 1972 bis 1975 wurde sie verbreitert."},{"page_url":"https://da.wikipedia.org/wiki/Blackburn_Olympic_F.C.","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Jack_Southworth.jpg","page_title":"Blackburn Olympic F.C.","context_page_description":"Blackburn Olympic FC var en fodboldklub i Blackburn, England, der eksisterede i slutningen af 1800-tallet. På trods af at klubben kun eksisterede lidt over et årti, satte den markante aftryk i den engelske fodboldhistorie i 1883, da den som den første klub fra Nordengland og den første arbejderklub vandt landets fornemste turnering, FA Cup'en. Turneringen var indtil da udelukkende blevet vundet af rige amatørklubber fra det sydøstlige England, og Olympic's sejr var begyndelsen på fodboldens overgang fra en fritidsbeskæftigelse for overklassen til en professionel sport.\\nKlubben blev dannet i 1878 og deltog i begyndelsen kun i mindre, lokale turneringer. I 1880 tilmeldte klubben sig FA Cup for første gang, og tre år senere besejrede den Old Etonians i finalen på Kennington Oval. Denne sejr var en medvirkende faktor i FA's beslutning to år senere om at tillade professionalisme. Olympic viste sig imidlertid ude af stand til at konkurrere med rigere og bedre støttede klubber i den professionelle æra og lukkede i 1889.\\nDe fleste af Olympics hjemmekampe blev spillet på stadionet Hole-i'-th-Wall, der var opkaldt efter nabopubben."},{"page_url":"https://cs.wikipedia.org/wiki/Mezin%C3%A1rodn%C3%AD_leti%C5%A1t%C4%9B_Tocumen","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/78/Panamaairportmap.png","page_title":"Mezinárodní letiště Tocumen","context_page_description":"Mezinárodní letiště Tocumen je mezinárodní letiště v Panamě, hlavním městě středoamerického státu Panama. Je vzdáleno 24 km od hlavního města. V letech 2006 až 2012 prošlo rozsáhlým modernizačním programem. Je nejvytíženějším letištěm Střední Ameriky a jediným letištěm oblasti se dvěma přistávacími drahami."},{"page_url":"https://mn.wikipedia.org/wiki/%D0%9A%D0%BB%D0%B8%D0%BD%D1%82%D0%BE%D0%BD_%D0%94%D1%8D%D0%B2%D0%B8%D1%81%D1%81%D0%BE%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Clinton_Davisson.jpg","page_title":"Клинтон Дэвиссон","context_page_description":"Клинтон Жозеф Дэвиссон нь Америкийн физикч, электрон дифракцийг нээснийхээ төлөө 1937 оны физикийн салбар дахь Нобелийн шагналыг хүртсэн эрдэмтэн юм. Дэвиссон түүнтэй бараг нэгэн зэрэг, гэхдээ түүнээс тусдаа электрон дифракцийг нээсэн Жорж Пажет Томсонтой хамтдаа уг шагналыг хүртсэн билээ."},{"page_url":"https://eo.wikipedia.org/wiki/Senufoj","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Senufo_languages.png","page_title":"Senufoj","context_page_description":"La senufoj estas etno vivanta en la nordo de Ebur-Bordo, la sudo de Malio kaj en la okcidento de Burkina Faso kun proksimume tri milionoj da homoj. Ili parolas proksimume 20 diversajn senufajn lingvojn apartenantajn al la niĝerkonga lingvaro.\\nLa senufoj en la 15-a kaj 16-a jarcentoj migris el la regiono de la hodiaŭa Malio en sian hodiaŭan loĝregionon."},{"page_url":"https://en.wikipedia.org/wiki/Modern_synthesis_(20th_century)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Fitness-landscape-cartoon.png","page_title":"Modern synthesis (20th century)","context_page_description":"The Modern Synthesis was the early 20th-century synthesis reconciling Charles Darwin's theory of evolution and Gregor Mendel's ideas on heredity in a joint mathematical framework. Julian Huxley coined the term in his 1942 book, Evolution: The Modern Synthesis.\\nThe 19th century ideas of natural selection and Mendelian genetics were put together with population genetics, early in the twentieth century. The modern synthesis also addressed the relationship between the broad-scale changes of macroevolution seen by palaeontologists and the small-scale microevolution of local populations of living organisms. The synthesis was defined differently by its founders, with Ernst Mayr in 1959, G. Ledyard Stebbins in 1966 and Theodosius Dobzhansky in 1974 offering differing numbers of basic postulates, though they all included natural selection, working on heritable variation supplied by mutation. Other major figures in the synthesis included E. B. Ford, Bernhard Rensch, Ivan Schmalhausen, and George Gaylord Simpson. An early event in the modern synthesis was R. A."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_beschermd_erfgoed_in_Fl%C3%A9malle","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Chateau_d%27Aigremont.JPG","page_title":"Lijst van beschermd erfgoed in Flémalle","context_page_description":"Onderstaande tabel geeft een overzicht van de beschermde erfgoederen in de gemeente Flémalle. Het beschermd erfgoed maakt deel uit van het cultureel erfgoed in België."},{"page_url":"https://ro.wikipedia.org/wiki/Saint-Martin-du-Vieux-Bell%C3%AAme","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/ba/FranceNormandieSaintMartinDuVieuxBellemeEglise.jpg","page_title":"Saint-Martin-du-Vieux-Bellême","context_page_description":"Saint-Martin-du-Vieux-Bellême este o comună în departamentul Orne, Franța. În 2009 avea o populație de 625 de locuitori."},{"page_url":"https://de.wikipedia.org/wiki/Stephan_Sarek","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Sarek.JPG","page_title":"Stephan Sarek","context_page_description":"Stephan Sarek ist ein deutscher Schriftsteller und Feuerwehrmann."},{"page_url":"https://de.wikipedia.org/wiki/Hoinkhausen","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/47/Hoinkhausen_Schule.jpg","page_title":"Hoinkhausen","context_page_description":"Hoinkhausen ist ein Stadtteil der Stadt Rüthen im Kreis Soest in Nordrhein-Westfalen. Am 31. Dezember 2014 hatte die Ortschaft 175 Einwohner."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Swisttal","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Morenhoven_Fachwerkhaus_Vivatsgasse_7_%2801%29.png","page_title":"Liste der Baudenkmäler in Swisttal","context_page_description":"Die Liste der Baudenkmäler in Swisttal enthält die denkmalgeschützten Bauwerke auf dem Gebiet der Gemeinde Swisttal im Rhein-Sieg-Kreis in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Gemeinde Swisttal eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen.\\nHinweis: Die Nummerierung der Denkmal wird für jeden Ortsteil separat, beginnend mit \\"1\\" geführt. Der besseren Übersicht wurde der laufenden Nummer deshalb in kursiver Schrift der zugehörige Ortsteil vorangestellt."},{"page_url":"https://cs.wikipedia.org/wiki/Pra%C5%BEsk%C3%A1_tr%C5%BEnice","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Bubensk%C3%A9_n%C3%A1b%C5%99e%C5%BE%C3%AD_13%2C_Pra%C5%BEsk%C3%A1_tr%C5%BEnice%2C_socha_%2801%29.jpg","page_title":"Pražská tržnice","context_page_description":"Pražská tržnice je památkově chráněný areál, který se nachází v prostoru mezi ulicemi Argentinská, Jateční, Komunardů a Bubenským nábřežím. Budovy v areálu nesou prvky secese a novorenesance; byly vybudovány v letech 1893-1895 podle návrhu architekta Josefa Srdínka pro Ústřední jatka královského města Prahy. Svému účelu jatka sloužila až do roku 1983, kdy byla přebudována na tržnici. Od roku 1993 je areál chráněn jako kulturní památka."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8A%A0%E5%B7%A5%E5%87%BA%E5%8F%A3%E5%8D%80%E9%AB%98%E9%9B%84%E5%9C%92%E5%8D%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Industry_park_of_the_harbor.jpg","page_title":"加工出口區高雄園區","context_page_description":"加工出口區高雄園區，為台灣南部由經濟部加工出口區管理處高雄分處管理的加工出口區，位於高雄市前鎮區西北部，凸出於高雄港區因濬港工程所填成之中島半島上。設立於1966年12月，面積達68.36公頃，為中華民國第一個加工出口區、全球第一個加工出口區，吸引許多國家來觀摩學習。"},{"page_url":"https://fi.wikipedia.org/wiki/Tekninen_piirt%C3%A4minen","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/USRA_Light_Santa_Fe_diagram.jpg","page_title":"Tekninen piirtäminen","context_page_description":"Tekninen piirtäminen eli tekninen piirustus on jonkin idean esittämistä piirustusten ja kaavioiden avulla suunnitelmana, jonka avulla idea voidaan toteuttaa. Teknistä piirtämistä käytetään työmenetelmänä useilla tekniikan aloilla, ja se jakaantuu esimerkiksi seuraaviin: talonrakennus ja arkkitehtisuunnittelu, koneenpiirustus, LVIS-suunnittelu, yhdyskuntatekniset piirustukset.\\nPerinteisen käsin piirtämisen sijasta käytetään nykyisin lähes pelkästään tietokoneavusteisesta suunnittelua. Samalla pelkän piirtämisen sijasta on monilla tekniikan aloilla siirrytty suunnittelukohteen kolmiulotteiseen mallintamiseen. Piirustuksia ei välttämättä tuoteta lainkaan, tai ne voidaan useissa suunnitteluohjelmistoissa luoda mallista lähes automaattisesti kuvantojen projektiosuuntien määrittämisen jälkeen.\\nTeknisiä piirustuksia kuitenkin tarvitaan, koska asioiden esittäminen ei yleensä onnistu puhumalla tai kirjoittamalla eikä nykyaikaista tekniikkaa pysty toteuttamaan ilman piirustuksia. Piirustusten on oltava yksikäsitteisiä ja selviä, ettei niitä pysty tulkitsemaan väärin tai ettei piirustusvirheen takia lopputuloksestakin tule virheellinen."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A1%D1%82%D0%BE%D0%BA%D1%85%D0%BE%D0%BB%D0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Riksdagen_June_2011.jpg","page_title":"Стокхолм","context_page_description":"Стокхолм главни је и највећи град Шведске. Стокхолм је такође седиште истоименог Стокхолмског округа, где чини једну од општина. Урбани део Стокхолма броји преко 2 милиона људи и тиме садржи око петину становништва Шведске.\\nГрад Стокхолм је политичко, привредно и управно средиште Шведске. Такође, то је један од градова светског и европског значаја, а у области Скандинавије то је други по величини град, после Копенхагена.\\nУ Стокхолму су смештене бројне установе од државног значаја. Град је седиште је, између осталог, Краљевске шведске академије наука, Каролинског института и Шведске академије, установа које одређују добитнике Нобелове награде из физике, хемије, економије, медицине и књижевности.\\nУ Стокхолму су одржане Летње олимпијске игре 1912."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%AF%D8%B1%D8%A7%D9%81%D9%86%D8%B4%D8%AA%D8%A7%DB%8C%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Wappen_at_grafenstein.png","page_title":"گرافنشتاین","context_page_description":"گرافنستاین یک منطقهٔ مسکونی در اتریش است که در ناحیه کلاگن‌فورت-لاند واقع شده‌است. گرافنستاین ۲٬۷۵۲ نفر جمعیت دارد."},{"page_url":"https://de.wikipedia.org/wiki/Refuge_du_Col_du_Palet","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Auvergne-Rh%C3%B4ne-Alpes_region_relief_location_map.jpg","page_title":"Refuge du Col du Palet","context_page_description":"Das Refuge du Col du Palet ist eine Schutzhütte, die sich im Département Savoie in der Region Auvergne-Rhône-Alpes befindet. Die Schutzhütte, die auf einer Höhe von 2587 m liegt, gehört der Verwaltung des Nationalparks Vanoise. Die Hütte ist außerhalb der Öffnungszeiten auch von Anfang bis Mitte Juni sowie im Monat Oktober zugänglich. Während dieser Zeit steht Holz, Gas sowie Geschirr zur Verfügung – fließendes Wasser ist dann jedoch nicht vorhanden."},{"page_url":"https://fr.wikipedia.org/wiki/Krzy%C5%BC_Wielkopolski","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e0/Ostbahn.jpg","page_title":"Krzyż Wielkopolski","context_page_description":"Krzyż Wielkopolski est une ville de Pologne, située dans la voïvodie de Grande-Pologne. Elle est le chef-lieu de la gmina de Krzyż Wielkopolski, dans le powiat de Czarnków-Trzcianka.\\nElle se situe à 37 kilomètres à l'ouest de Czarnków et à 80 kilomètres au nord-ouest de Poznań.\\nLa ville possède une population de 6161 habitants en 2013."},{"page_url":"https://hu.wikipedia.org/wiki/Swindon_Town_FC","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Mooney%2C_Tommy.jpg","page_title":"Swindon Town FC","context_page_description":"A Swindon Town Football Club egy angol labdarúgócsapat, melyet 1879-ben alapítottak és székhelye Swindonban, Wiltshire megyében található. A csapat jelenleg a League Two-ban, az angol labdarúgás negyedik osztályában szerepel. Hazai mérkőzéseit 1896 óta a County Groundon játssza, a stadion 15 728 szurkoló befogadására alkalmas."},{"page_url":"https://id.wikipedia.org/wiki/Daftar_kota_di_Haiti","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Palacio_presidencial_de_Haiti.jpg","page_title":"Daftar kota di Haiti","context_page_description":"Berikut adalah daftar kota di Haiti:"},{"page_url":"https://ko.wikipedia.org/wiki/%EB%A7%B7_%EB%8F%84%ED%97%88%ED%8B%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Matt_Doherty.jpg","page_title":"맷 도허티","context_page_description":"매슈 제임스 도허티 는 아일랜드의 축구 선수이며, 토트넘 홋스퍼에서 라이트백과 윙백으로 뛰고 있다."},{"page_url":"https://uz.wikipedia.org/wiki/Sovet_Ittifoqi_Madhiyasi","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Flag_of_the_Soviet_Union.svg","page_title":"Sovet Ittifoqi Madhiyasi","context_page_description":"Гимн Советского Союза, Sovet Ittifoqi Madhiyasi.\\nСоюз нерушимый республик свободных\\nСплотила навеки Великая Русь!\\nДа здравствует созданный волей народов\\nЕдиный, могучий Советский Союз!\\nСлавься, Отечество наше свободное,\\nДружбы народов надёжный оплот!\\nПартия Ленина — сила народная\\nНас к торжеству коммунизма ведёт!\\nСквозь грозы сияло нам солнце свободы,\\nИ Ленин великий нам путь озарил:\\nНа правое дело он поднял народы,\\nНа труд и на подвиги нас вдохновил!\\nСлавься, Отечество наше свободное,\\nДружбы народов надёжный оплот!\\nПартия Ленина — сила народная\\nНас к торжеству коммунизма ведёт!\\nВ победе бессмертных идей коммунизма\\nМы видим грядущее нашей страны,\\nИ Красному знамени славной Отчизны\\nМы будем всегда беззаветно верны!\\nСлавься, Отечество наше свободное,\\nДружбы народов надёжный оплот!\\nПартия Ленина — сила народная\\nНас к торжеству коммунизма ведёт!"},{"page_url":"https://ca.wikipedia.org/wiki/Ger%C3%B0r","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Goldgubb.jpg","page_title":"Gerðr","context_page_description":"En la mitologia nòrdica, Gerðr és una jötun, dea, i l'esposa del déu Freyr. Gerðr apareix en l'Edda poètica, compilada al segle XIII a partir de fonts tradicionals anteriors, l'Edda prosaica i l'Heimskringla, escrit al segle XIII per Snorri Sturluson, i en la poesia de scaldes. Gerðr a vegades es cita amb un modern anglicisme com a Gerd o Gerth.\\nTant en l'Edda poètica com en l'Edda prosaica, Freyr veu Gerðr des de la distància, i així n'esdevé profundament enamorat en veure la seva bellesa resplendent, i fa que el seu servent Skírnir vagi a Jötunheimr per guanyar el seu amor. En l'Edda poètica Gerðr en principi es nega, però després d'una sèrie d'amenaces fetes per Skírnir, finalment accepta. En l'Edda prosaica, no es fa esment de les amenaces. En ambdues fonts Gerðr convé a conèixer Freyr en un moment determinat al lloc de Barri; després que Skirnir torna amb la resposta de Gerðr, Freyr es lamenta que no pot ocórrer abans de la reunió. Tant en l'Edda poètica com en l'Edda prosaica, Gerðr es descriu com la filla de Gymir i la jötunn de la muntanya Aurboda.\\nEn l'Heimskringla, Gerðr és coneguda com l'esposa de Freyr, representada com una estimada reina de Suècia."},{"page_url":"https://es.wikipedia.org/wiki/Palacio_Episcopal_de_Murcia","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Edificio_%22el_Contraste%22.jpg","page_title":"Palacio Episcopal de Murcia","context_page_description":"El Palacio Episcopal de Murcia es un edificio histórico situado en el casco antiguo de la ciudad, sede oficial de la Diócesis de Cartagena. Edificado en el siglo XVIII, hoy es uno de los inmuebles más importantes del patrimonio monumental de la ciudad de Murcia. Es Bien de Interés Cultural desde 1992.​"},{"page_url":"https://he.wikipedia.org/wiki/%D7%91%D7%99%D7%AA_%D7%94%D7%9B%D7%A0%D7%A1%D7%AA_%D7%A9%D7%9C_%D7%A1%D7%92%D7%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Szegedzsinagoga2.jpg","page_title":"בית הכנסת של סגד","context_page_description":"בית הכנסת של סגד, או \\"בית הכנסת החדש של סגד\\", הוא בית כנסת נאולוגי בעיר סגד שבדרום הונגריה, בית הכנסת השני בגודלו במדינה והרביעי בגודלו בעולם. נוסד בשנת 1907 ותוכנן על ידי האדריכל ליפוט באומהורן.\\nסגנונו אקלקטי וכולל מגוון אלמנטים, בהם התחייה הגותית, אדריכלות מורית ואר-נובו. גובה הכיפה 48.5 מטרים. בית הכנסת מכיל מקומות ל-806 גברים ו-623 נשים.\\nאת הקמת בית הכנסת יזם ב-1903 רב הקהילה, עמנואל לעף, שהיה גם בוטנאי ומחבר הספר \\"צמחי היהודים\\". הוא השפיע רבות על עיצוב הפנים של בית הכנסת ושזר בעיטוריו מצמחי ארץ ישראל באופן סמלי, כך למשל בנה את ארון הקודש מעצי שיטים שהביא ממצרים, כך שיזכיר את המשכן, אוהל מועד. כל חג מיוצג בחלון ויטראז' ובו צמחים הקשורים בחג."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%A4%E0%A6%BE%E0%A6%B8%E0%A6%AE%E0%A6%BE%E0%A6%A8%E0%A6%BF%E0%A6%AF%E0%A6%BC%E0%A6%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Antarctic_Garden_Hobart_BG.jpg","page_title":"তাসমানিয়া","context_page_description":"তাসমানিয়া বা টাসমেনিয়া অস্ট্রেলিয়ার ছয়টি অঙ্গ রাজ্যের একটি রাজ্য। হোবার্ট তাসমানিয়ার এবং রাজধানী ও সব থেকে বড় শহর। এ রাজ্যের অধিবাসী সংখ্য ৫১৮, ৫০০ । ১৯০১ সালে এটি অস্ট্রেলিয়ার একটি অঙ্গরাজ্য হিসেবে স্থাপিত হয়।\\nতাসমানিয়া একটি দ্বীপ রাজ্য যার আয়তন ৬৮, ৪০১ কিমি২ । এটা অস্ট্রেলিয়ার মূল ভূখন্ড থেকে ২৪০ কিলোমিটার দক্ষিণে অবস্থিত। অস্ট্রেলিয়া থেকে তাসমানিয়াকে পৃথক করেছে ব্যাস প্রণালী। এর আশেপাশে ৩৩৪ টি দ্বীপ আছে। তাসমানিয়ার প্রধান দ্বীপ পৃথিবীর ২৬তম বৃহত্তম দ্বীপ। এর মধ্যে ৪০% জনগণ বাস করে তাসমানিয়ার রাজধানী ও সব থেকে বড় শহর হোবার্ট এ।"},{"page_url":"https://ja.wikipedia.org/wiki/%E6%95%99%E8%82%B2%E9%83%A8_(%E4%B8%AD%E8%8F%AF%E6%B0%91%E5%9B%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/%E4%B8%AD%E8%8F%AF%E6%B0%91%E5%9C%8B%E6%95%99%E8%82%B2%E9%83%A8.JPG","page_title":"教育部 (中華民国)","context_page_description":"教育部は、中華民国の行政院に属する教育文化政策に関する業務全般を担当する官庁。"},{"page_url":"https://simple.wikipedia.org/wiki/William_Henry_Harrison","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/William_Henry_Harrison_daguerreotype_edit_%28cropped%29.jpg","page_title":"William Henry Harrison","context_page_description":"William Henry Harrison was the 9th President of the United States. His nickname was \\"Old Tippecanoe \\" and he was a well-respected war veteran. Harrison served the shortest term of any United States President. His term lasted for exactly one month.\\nHe was elected president in 1840, and took the oath of office on March 4, 1841. His inauguration speech lasted an hour and forty minutes. William Henry Harrison caught a serious case of pneumonia, and on April 4 that same year he died. He was the first President to die in office. Harrison was the oldest president to take office at 68 years, 23 days, until 1981 when Ronald Reagan was a year older than Harrison. He was the last president to be born before the United States Declaration of Independence.\\nHis grandson was the 23rd President of the United States, Benjamin Harrison."},{"page_url":"https://it.wikipedia.org/wiki/Heliozela_sericiella","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Europa-it-politica-coloured.svg","page_title":"Heliozela sericiella","context_page_description":"Heliozela sericiella è un lepidottero appartenente alla famiglia Heliozelidae, diffuso in Europa."},{"page_url":"https://en.wikipedia.org/wiki/List_of_universities_in_Bangladesh","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/AcademicBuildingpart1.jpg","page_title":"List of universities in Bangladesh","context_page_description":"Universities in Bangladesh are mainly categorized into three different types: public, private, and international. Bangladeshi universities are affiliated with the University Grants Commission, a commission created according to the Presidential Order of the Government of the People's Republic of Bangladesh.\\nMost universities focus on general studies, mixing together such areas of study as business, engineering and technology. Twenty two universities have specialized curricula. Two of these are focused on Islamic studies, five on Agricultural science, four on Health science, one on Veterinary medicine, one on Ocean science, six on Engineering, one on Aeronautical science, one on Textile engineering and one on Women's studies."},{"page_url":"https://vi.wikipedia.org/wiki/Mi%C3%B1o_de_Medinaceli","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Mi%C3%B1o_Medinaceli.JPG","page_title":"Miño de Medinaceli","context_page_description":"Miño de Medinaceli là một đô thị ở tỉnh Soria, Castile và León, Tây Ban Nha. Theo điều tra dân số năm 2004 của Viện thống kê quốc gia Tây Ban Nha, đô thị này có dân số 99 người."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Augsburg-Innenstadt,_St._Ulrich%E2%80%93Dom","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Armenhausgasse_2_%28Augsburg%29.JPG","page_title":"Liste der Baudenkmäler in Augsburg-Innenstadt, St. Ulrich–Dom","context_page_description":"In der Liste der Baudenkmäler im Innenstadt, St. Ulrich–Dom sind die Baudenkmäler im Augsburger Stadtbezirk Innenstadt, St. Ulrich–Dom im\\nPlanungsraum Innenstadt\\n(I)\\naufgelistet. Zu diesen Baudenkmälern gibt es auch eine Bildersammlung.\\nDiese Liste ist eine Teilliste der Liste der Baudenkmäler in Augsburg. Grundlage der Liste ist die Bayerische Denkmalliste, die auf Basis des bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt und aktualisiert wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://hu.wikipedia.org/wiki/Valence_(Charente)","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e3/Valence16_vue.JPG","page_title":"Valence (Charente)","context_page_description":"Valence település Franciaországban, Charente megyében. Lakosainak száma 228 fő. Valence Cellefrouin, Saint-Amant-de-Bonnieure, Saint-Front, La Tâche, Ventouse és Saint-Mary községekkel határos."},{"page_url":"https://cs.wikipedia.org/wiki/Pa%C4%8Da","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9a/Pacsa16.JPG","page_title":"Pača","context_page_description":"Pača je obec na Slovensku, v okrese Rožňava v Košickém kraji. V roce 2011 zde žilo 631 obyvatel."},{"page_url":"https://ro.wikipedia.org/wiki/Montaulin","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0b/Map_commune_FR_insee_code_10245.png","page_title":"Montaulin","context_page_description":"Montaulin este o comună în departamentul Aube din nord-estul Franței. În 2009 avea o populație de 752 de locuitori."},{"page_url":"https://en.wikipedia.org/wiki/Dindica","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Dindica_polyphaenaria.jpg","page_title":"Dindica","context_page_description":"Dindica is a genus of moths in the family Geometridae."},{"page_url":"https://de.wikipedia.org/wiki/Junee_Shire","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Australia-Map-NSW-LGA-Junee.png","page_title":"Junee Shire","context_page_description":"Junee Shire ist ein lokales Verwaltungsgebiet im australischen Bundesstaat New South Wales. Das Gebiet ist 2.030,0 km² groß und hat etwa 6.300 Einwohner.\\nJunee liegt im Süden des Staates in der Murrumbidgee-Region etwa 220 km nordwestlich der australischen Hauptstadt Canberra und 430 km südwestlich der Metropole Sydney. Das Gebiet umfasst 28 Ortsteile und Ortschaften: Bendure, Bethungra, Bethungra South, Bute, Coreena, Coursing Park, Dirnaseer, Erin Vale, Eurongilly, Illabo, Ironbong, Junee, Junee North, Junee Reefs, Old Junee, Marinna, Mitta Mitta, Retreat, Retreat East, Rockview, Wantiool, Yathella und Teile von Downside, Harefield, Marrar, Nangus, Wallacetown und Wantabadgery. Der Sitz des Shire Councils befindet sich in Junee im Zentrum der LGA, wo etwa 4.762 Einwohner leben."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A0%D1%83%D1%81%D0%B8%D0%BD%D0%B3%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Rusinga_Island-The_village-2.jpg","page_title":"Русинга","context_page_description":"Русинга е остров, разположен в източната част на африканското езеро Виктория, в близост до входа на залива Уинам.\\nАдминистративно спада към областта Суба на провинция Нянза в Кения. Островът е с продълговата форма с дължина от 16 km, а най-голямата му ширина е 5 km. Населението му е между 20 000 и 30 000 души по данни от 2006 г. Много от наименованията, включително това на самия остров и централния му връх Лунене, са дадени от племето суба. Връх Лунене се издига на 325 m над нивото на езерните води."},{"page_url":"https://no.wikipedia.org/wiki/Loriot","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Loriot_by_Philipp_von_Ostau.jpg","page_title":"Loriot","context_page_description":"Loriot, pseudonym for Bernhard Victor Christoph-Carl von Bülow, kortform Vicco von Bülow er en tysk komiker, tegner, forfatter, skuespiller, regissør og professor i teaterkunst.\\nLoriots verker handler hovedsakelig om menneskelige relasjoner og kommunikasjon, eller snarere misforståelser i kommunikasjonen mennesker imellom. Hans tegninger har som regel en underfundig tekst. Temaene er først og fremst hverdagsliv, familieliv og det borgerlige samfunnet.\\nVicco von Bülow, med kunstnernavnet Loriot, kommer fra den gamle mecklenburgske adelsfamilien Bülow og han er sønn av Johann-Albrecht von Bülow og Charlotte von Roeder. Kunstnernavnet stammer fra fuglen pirol som er å finne på våpenskjoldet til den adelsfamilien han tilhører."},{"page_url":"https://en.wikipedia.org/wiki/Culture_of_the_United_Kingdom","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/A_typical_london_street.jpg","page_title":"Culture of the United Kingdom","context_page_description":"British culture is influenced by the combined nations' history; its historically Christian religious life, its interaction with the cultures of Europe, the traditions of England, Wales and Scotland, and the impact of the British Empire. Although British culture is a distinct entity, the individual cultures of England, Scotland, Wales and Northern Ireland are diverse and have varying degrees of overlap and distinctiveness.\\nBritish literature is particularly esteemed. The novel was invented in Britain, and playwrights, poets, and authors are among its most prominent cultural figures. Britain has also made notable contributions to music, cinema, art, architecture and television. The UK is also the home of the Church of England, the state church and mother church of the Anglican Communion, the third-largest Christian denomination. Britain contains some of the world's oldest universities, has made many contributions to philosophy, science and technology, and is the birthplace of many prominent scientists and inventions. The Industrial Revolution began in the UK and had a profound effect on the family socio-economic and cultural conditions of the world."},{"page_url":"https://en.wikipedia.org/wiki/Ctesibius_(crater)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Ctesibius_crater_AS16-M-0079.jpg","page_title":"Ctesibius (crater)","context_page_description":"Ctesibius is a small lunar impact crater that is located near the equator, on the far side of the Moon. It is named after the ancient Greek-Egyptian inventor Ctesibius. It lies between the larger crater Abul Wáfa to the west and the slightly smaller Heron to the east.\\nThe outer wall of Ctesibius is wide and sharp-edged, with little erosion. A low ridge is attached to the southern rim, and curves to the south-southeast. At the center of the relatively flat interior is a low ridge. Faint traces of ray material lies across the western floor and rim from Necho to the southeast."},{"page_url":"https://la.wikipedia.org/wiki/Velia_(urbs)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Velia_0975.jpg","page_title":"Velia (urbs)","context_page_description":"Velia vel Elea est urbs antiqua in regione Campania Italiae. Condita est anno fere 535 a.C.n. a Graecis Phocaeensibus. Habitabant ibi philosophi Graeci Xenophanes et Eleatici philosophi sicut Parmenides et Zeno Eleates. Urbani Velienses appulsi sunt."},{"page_url":"https://ast.wikipedia.org/wiki/Islla_de_Pascua","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/RAPA_NUI.JPG","page_title":"Islla de Pascua","context_page_description":"Islla de Pascua ye una islla de Chile allugada na Polinesia, en mediu del océanu Pacíficu a 3700 km de Caldera. Tien una superficie de 163,6 km², lo que la convierte na mayor de les islles del Chile insular, y una población de 5035 habitantes, concentraos en Hanga Roa, capital y únicu pobláu esistente na islla. La tierra habitada más cercana ye'l territoriu británicu de les Islles Pitcairn.\\nLa islla ye unu de los principales destinos turísticos del país por cuenta de la so guapura natural y la so misteriosa cultura ancestral de la etnia rapanui, que'l so más notable muerte correspuende a enormes estatues conocíes como moái. Pa caltener felicidaes carauterístiques, el gobiernu alministra al traviés de Conaf el Parque nacional Rapa Nui, ente que la Unesco declaró esti parque como patrimoniu de la humanidá en 1995.\\nAlministrativamente, forma, al pie de la despoblada islla Salas y Gómez, la comuña d'Islla de Pascua que forma la provincia d'Islla de Pascua, perteneciente a la Rexón de Valparaíso."},{"page_url":"https://sk.wikipedia.org/wiki/Hrani%C4%8Dn%C3%A1_ulica_(Bratislava)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Hrani%C4%8Dn%C3%A1%2C_Ru%C5%BEinov%2C_Bratislava.jpg","page_title":"Hraničná ulica (Bratislava)","context_page_description":"Hraničná ulica je ulica v Bratislave, v mestskej časti Ružinov.\\nNa ulici sídli Centrum pre liečbu drogových závislostí."},{"page_url":"https://fr.wikipedia.org/wiki/Sal%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Procession_des_cierges_de_Sal%C3%A9.JPG","page_title":"Salé","context_page_description":"Salé est une ville et commune du Maroc, chef-lieu de la préfecture de Salé, au sein de la région de Rabat-Salé-Kénitra. Elle est située au bord de l'océan Atlantique, sur la rive droite de l'embouchure du Bouregreg, en face de la capitale nationale Rabat. Ceci explique que les deux villes soient parfois qualifiées de « villes jumelles », mais chacune dispose de ses traditions et de son histoire propres. En 2014, la commune comptait 982 163 habitants. Salé est reliée à Rabat par plusieurs ponts dont le pont Hassan II est le plus utilisé.\\nFondée par les explorateurs phéniciens au IIIe siècle avant J.-C, Salé connaît un important développement à l'époque des Almohades et des Mérinides, du fait de sa position stratégique sur la voie terrestre qui relie Fès à Marrakech et grâce à son port, centre d’échanges entre l’Europe et le Maroc.\\nAux XVIᵉ et XVIIᵉ siècles, l’arrivée des musulmans réfugiés d’Espagne donne un nouveau souffle à la cité et crée une rivalité avec la ville mitoyenne de Rabat. Le saadien Mohamed I y implante des colons andalous chargé de labourer le sol et d'aménager les égouts de la ville."},{"page_url":"https://az.wikipedia.org/wiki/Geqard_monast%C4%B1r%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Holy-lance-Echmiadzin.jpg","page_title":"Geqard monastırı","context_page_description":"Geqard və ya Geğard, həmçinin köhnə Əyrivəng adı da istifadə olunur – Ermənistan Respublikasının Kotayk mərzi ərazisində yerləşən unikal memarlıq abidəsi və monastır kompleksidir. Monastır Qoğt çayının vadisində, paytaxt İrəvan şəhərindən təxminən 40 km cənub-şərqdə yerləşir. 2000-ci ildə UNESCO tərəfindən Dünya Mədəniyyət Mirasları siyahısına əlavə edilmişdir.\\nDini tikilinin tam adı Geqardavəngdir, tərcümədə \\"nizə monastırı\\" mənasını verir. Monastır kompleksinin adı ehtimala görə Longin nizəsindən götürülüb; belə ki, məhz bu nizə ilə çarmıxa çəkilmiş İsa sancılmışdı. Deyilənə görə, Ermənistan ərazisinə həmin nizəni bir çox digər müqəddəs əmanətlər ilə birlikdə Həvari Faddey gətirmişdi. Nizə hal-hazırda Eçmiədzin kafedralının muzeyində saxlanılır.\\nMonastırın ətrafındakı qayalıqlar, Qoğt çay dərəsinin tərkib hissəsi sayılır və monastır kompleksi kimi UNESCO-nun Dünya İrsi siyahısına daxil edilib. Kompleksə daxil olan məbədlərin bəziləri tamamilə qayaların içində yonulduğu halda, bəziləri qaya içində yonulmuş tikililərlə hörgü memarlığının mürəkkəb birləşməsi nəticəsində formalaşdırılmışdır."},{"page_url":"https://ceb.wikipedia.org/wiki/Robertsfors_Kommun","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Robertsfors_-_KMB_-_16000300022333.jpg","page_title":"Robertsfors Kommun","context_page_description":"Munisipyo ang Robertsfors Kommun sa Sweden. Nahimutang ni sa lalawigan sa Västerbottens län, sa amihanan-sidlakang bahin sa nasod, 600 km sa amihanan sa Estokolmo ang ulohan sa nasod. Adunay 6,809 ka molupyo. Naglangkob kin og 1,298 ka kilometro kwadrado. Robertsfors Kommun mopakigbahin sa usa ka utlanan sa Skellefteå Kommun, ug Umeå Kommun.\\nAng yuta sa Robertsfors Kommun kay patag sa habagatang-sidlakan, apan sa amihang-kasadpan nga kini mao ang kabungtoran.\\nMga lungsod sa Robertsfors Kommun:\\nRobertsfors\\nBygdeå\\nSörfors\\nAng klima boreal. Ang kasarangang giiniton 0 °C. Ang kinainitan nga bulan Hulyo, sa 16 °C, ug ang kinabugnawan Enero, sa -13 °C."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B9%D8%AF%D9%8A_%D8%A7%D9%84%D8%A8%D9%8A%D8%B7%D8%A7%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Adi_with_the_three_rulers_of_Dubai.jpg","page_title":"عدي البيطار","context_page_description":"عَـدّي نسيب البيطار محام، ومستشار قانوني وقاض عمل في عدة مناطق في الوطن العربي. شارك في صياغة دستور دولة الإمارات العربية المتحدة بطلب مشترك من الشيخ زايد بن سلطان آل نهيان والشيخ راشد بن سعيد آل مكتوم.\\nولد في مدينة القدس في 7 ديسمبر عام 1924، تخرج بتفوق من الثانوية العامة، ثم اتجه لدراسة الحقوق في معهد الحقوق في القدس وتخرج منه عام 1948.\\nكان أحد الناجين الجرحى في عملية تفجير فندق الملك داوود في القدس."},{"page_url":"https://azb.wikipedia.org/wiki/%DA%98%D9%88%D8%A6%D9%84_%D9%85%D8%AA%DB%8C%D9%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Matip_Schalke_2015_%28cropped%29.jpg","page_title":"ژوئل متیپ","context_page_description":"ژوئل متیپ بیر فوتبالیست. لیورپول فوتبال کولوبو و کامرون میلّی تیمی ترکیبینده چیخیش ائدیب و مودافع موقعیتینده اوْیناییب. فیفا دونیا کاپی ۲۰۱۴ و فیفا دونیا کاپی ۲۰۱۰ اوْیونلاریندا مئیدانا گئدیب."},{"page_url":"https://fr.wikipedia.org/wiki/Botryllus","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Botryllus_schlosseri.jpg","page_title":"Botryllus","context_page_description":"Botryllus est un genre d'ascidies de la famille des Styelidae."},{"page_url":"https://sk.wikipedia.org/wiki/Contreuve","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Contreuve-FR-08-mairie-03.JPG","page_title":"Contreuve","context_page_description":"Contreuve je francúzska obec, ktorá sa nachádza v departemente Ardennes, v regióne Champagne-Ardenne."},{"page_url":"https://pt.wikipedia.org/wiki/Andrena_flavipes","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Andrena_flavipes_fg01.jpg","page_title":"Andrena flavipes","context_page_description":"Andrena flavipes é uma espécie de insetos himenópteros, mais especificamente de abelhas pertencente à família Apidae.\\nA autoridade científica da espécie é Panzer, tendo sido descrita no ano de 1799.\\nTrata-se de uma espécie presente no território português."},{"page_url":"https://en.wikipedia.org/wiki/D%C3%BCsseldorf-Unterrath%E2%80%93D%C3%BCsseldorf_Airport_Terminal_railway","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Bf-d-flughafenterm.jpg","page_title":"Düsseldorf-Unterrath–Düsseldorf Airport Terminal railway","context_page_description":"The Düsseldorf-Unterrath–Düsseldorf Airport Terminal railway is a branch line from Düsseldorf-Unterrath station on the Cologne–Duisburg line to Düsseldorf Airport Terminal station in the north of the North Rhine-Westphalian state capital of Düsseldorf in Germany.\\nThe railway line is fully duplicated with overhead electrification. It is also connected to the north from Düsseldorf-Unterrath Karthäuser Weg junction over a single-track electrified line."},{"page_url":"https://sv.wikipedia.org/wiki/M%C3%A9honcourt","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fd/Map_commune_FR_insee_code_54359.png","page_title":"Méhoncourt","context_page_description":"Méhoncourt är en kommun i departementet Meurthe-et-Moselle i regionen Grand Est i nordöstra Frankrike. Kommunen ligger i kantonen Bayon som tillhör arrondissementet Lunéville. År 2009 hade Méhoncourt 256 invånare."},{"page_url":"https://es.wikipedia.org/wiki/Scandal_(serie_de_televisi%C3%B3n)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Scandal_Logo.svg","page_title":"Scandal (serie de televisión)","context_page_description":"Scandal es una serie de televisión estadounidense, creada por Shonda Rhimes y protagonizada por Kerry Washington. La serie comenzó a emitirse el 5 de abril de 2012 en la cadena ABC.​ y terminó de emitirse el 19 de abril de 2018.​ El personaje de la protagonista Kerry Washington está basado parcialmente en Judy Smith, jefa de prensa de la administración de George H. W. Bush y que además es coproductora ejecutiva de la serie.​ La serie tiene lugar en Washington D. C. y se centra en la agencia de gestión de crisis de Olivia Pope, Olivia Pope & Associates, y en su personal, así como en el personal de la Casa Blanca, entre los que destacan el presidente de Estados Unidos, Fitzgerald Grant III, su jefe de gabinete, Cyrus Beene, y la primera dama, Mellie Grant."},{"page_url":"https://en.wikipedia.org/wiki/Bengali_Muslims","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Ostad_Alauddin_Khan_at_Karjon_Hall_1955.png","page_title":"Bengali Muslims","context_page_description":"Bengali Muslims are an ethnic, linguistic and religious population who make up the majority of Bangladesh's citizens and the largest minority in the Indian states of West Bengal and Assam. They are Bengalis who adhere to Islam and speak the Bengali language. They form the largest Bengali and the second largest Muslim ethnic group in the world.\\nBengal was a leading power of the medieval Islamic East. Europeans traders identified the Bengal Sultanate as \\"the richest country to trade with\\". During Emperor Aurangazeb's rule, the Bengal Subah, as the richest region of the Mughal Empire, was described as the Paradise of Nations and its citizens, chiefly Muslims, had the highest standard of living and real wages in the world. Two Bengal viceroys – Muhammad Azam Shah and Azim-us-Shan – assumed the imperial throne. Mughal Bengal became increasingly independent under the Nawabs of Bengal in the 18th century.\\nThe endogamous Bengali Muslim population emerged as a synthesis of Islamic and Bengali cultures. After the Partition of India in 1947, they comprised the demographic majority of Pakistan until the independence of East Pakistan as Bangladesh in 1971."},{"page_url":"https://nl.wikipedia.org/wiki/Pisinna","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Pisinna_chasteri_01.jpg","page_title":"Pisinna","context_page_description":"Pisinna is een geslacht van weekdieren uit de klasse van de Gastropoda."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1981","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Rojer_WM13-003_%289486365966%29.jpg","page_title":"Lijst van personen geboren in 1981","context_page_description":"Dit is een lijst van personen die geboren zijn in 1981.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://en.wikipedia.org/wiki/Jim_Steranko","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/10.12.12JimSterankoByLuigiNovi1.jpg","page_title":"Jim Steranko","context_page_description":"James F. Steranko is an American graphic artist, comic book writer/artist, comics historian, magician, publisher and film production illustrator.\\nHis most famous comic book work was with the 1960s superspy feature \\"Nick Fury, Agent of S.H.I.E.L.D.\\" in Marvel Comics' Strange Tales and in the subsequent eponymous series. Steranko earned lasting acclaim for his innovations in sequential art during the Silver Age of Comic Books, particularly his infusion of surrealism, pop art, and graphic design into the medium. His work has been published in many countries and his influence on the field has remained strong since his comics heyday. He went on to create book covers, become a comics historian who published a pioneering two-volume history of the birth and early years of comic books, and to create conceptual art and character designs for films including Raiders of the Lost Ark and Bram Stoker's Dracula.\\nHe was inducted into the comic-book industry's Will Eisner Comic Book Hall of Fame in 2006."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B3%E3%83%90%E3%82%B7%E3%82%A6%E3%83%9F%E3%82%B9%E3%82%BA%E3%83%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Kittlitzs_murrelet.jpg","page_title":"コバシウミスズメ","context_page_description":"コバシウミスズメ は、チドリ目ウミスズメ科に分類される海鳥。"},{"page_url":"https://en.wikipedia.org/wiki/Horace_William_Petherick","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/HWPetherick_My_Dog_Trey_Girl_at_Doctors_courtesy_of_the_University_of_Florida_via_Proj_Gutenberg.jpg","page_title":"Horace William Petherick","context_page_description":"Horace William Petherick was an artist and illustrator, a violin connoisseur, and a writer. As an artist, four of his works are in public collections in the UK; as an illustrator, he illustrated over 100 books, some of which are still in print, and his work can be found in digital collections at the British Library, the Osborne Collection of Early Children's Books, and the Baldwin Library of Historical Children's Literature; as a violin connoisseur, he owned both a Stradivarius and a del Gesù; and as an author, three of his books are still in print."},{"page_url":"https://be.wikipedia.org/wiki/%D0%93%D0%B0%D1%82%D1%8D%D1%80%D1%81%D0%B3%D0%B0%D0%B9%D0%BC-%D0%BD%D0%B0-%D0%9C%D0%B0%D0%B9%D0%BD%D0%B5","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/43/Wasserwerk_Hattersheim_08_020.jpg","page_title":"Гатэрсгайм-на-Майне","context_page_description":"Гатэрсгайм-на-Майне — горад у Германіі, у зямлі Гесэн. Падпарадкаваны адміністрацыйнай акрузе Дармштат. Уваходзіць у склад раёна Майн-Таўнус. Насельніцтва складае 25524 чалавек. Займае плошчу 15,82 км². Афіцыйны код 06 4 36 005.\\nГорад падзяляецца на 3 гарадскія раёны."},{"page_url":"https://vec.wikipedia.org/wiki/Sarcelles","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Sarcelles_-_Hotel_de_ville_-_Panoramique_01.jpg","page_title":"Sarcelles","context_page_description":"Sarcelles el xé on comun de 58 587 abitanti del departemento de Val-d'Oise che el fa parte del rejon Île-de-France in Fransa."},{"page_url":"https://en.wikipedia.org/wiki/Elvira_T","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Elvira_T_at_New_Wave_Junior_Party.jpg","page_title":"Elvira T","context_page_description":"Elvira Sergeevna Tugusheva, better known by her stage name Elvira T is a Russian singer and songwriter. After the success of Elvira T's YouTube song \\"Всё решено\\" when she was 15, she quickly rose to fame with the song hitting the top 20 charts in Russia, and coming into the top 100 of Europe.\\nShe later moved from Saratov to Moscow, enrolling in MGUKI where she continued to write songs."},{"page_url":"https://nl.wikipedia.org/wiki/Chaise_longue","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Edouard_Manet_032.jpg","page_title":"Chaise longue","context_page_description":"Een chaise longue is een leunstoel met een verlengd voeteneinde. Het Franse begrip betekent 'lange stoel' en wordt ook in omringende Angelsaksische landen gebruikt voor beklede ligstoelen voor 1 persoon."},{"page_url":"https://de.wikipedia.org/wiki/Keir_Hardie","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Keir_Hardie_LOC_ggbain_01224.jpg","page_title":"Keir Hardie","context_page_description":"James Keir Hardie war ein britischer Politiker. Hardie wurde berühmt als einer der Gründer der Labour Party sowie als einer ihrer ersten beiden Abgeordneten im britischen Parlament."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%AC%D9%88%D9%86_%D9%82%D8%B1%DB%8C%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Jon_Gries_by_Gage_Skidmore.jpg","page_title":"جون قریس","context_page_description":"جون قریس آمریکالی فیلمین سناریو یازاری, فیلم یؤنئتمنی و اوْیونچو. ۱۷ ژوئن ۱۹۵۷ ‏ ایلینده کالیفورنیا ایالتینده دۆنیایا گؤز آچیب."},{"page_url":"https://pl.wikipedia.org/wiki/Bernikla_bia%C5%82olica","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/41/Weisswangengans-02.jpg","page_title":"Bernikla białolica","context_page_description":"Bernikla białolica – gatunek ptaka z podrodziny gęsi w rodzinie kaczkowatych, zamieszkujący Grenlandię, Svalbard, północną część Norwegii. Zimuje na wybrzeżach Morza Północnego i Zatoki Biskajskiej, a czasem nawet na Półwyspie Iberyjskim. Na wybrzeżach Bałtyku w Olandii i Gotlandii od lat 70. rośnie populacja lęgowa. W Polsce pojawia się stosunkowo rzadko na przelotach."},{"page_url":"https://simple.wikipedia.org/wiki/Assisted_living","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Flickr_-_DVIDSHUB_-_Soldiers_assist_in_beauty_pageant_%28Image_1_of_4%29.jpg","page_title":"Assisted living","context_page_description":"An assisted living residence is a popular housing alternative to a nursing home for senior citizens. These homes give help or supervision with daily living activities. They also allow services by outside health care providers. They check residents and resident activities to make sure health, safety and well being are maintained. Assistance may include the giving or supervision of medicine or personal care services. \\"The philosophy of assisted living is to treat all residents with dignity; to give privacy and to encourage independence.\\" The gradual shift to assisted living began between 1979 and 1985 in the United States."},{"page_url":"https://sl.wikipedia.org/wiki/Zott","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Neu_Zott_Logo_en.png","page_title":"Zott","context_page_description":"Zott je evropsko dairy podjetje, ustanovljeno v kraju Mertingen, Germany in 1926. Zott proizvaja mlečne produkte, vključno z mlečnimi in sirnimi produkti, sladicami, smetanami in jogurti. Glavni obrat podjetja je v Mertingenu. Drugi proizvodni obrati so v Günzburg, Nemčija, Poljska: Opole, Głogowo blizu Toruńa in Racibórza. Proizvodni obrat v Bosni in Hercegovini je bil ustanovljen leta 2013.\\nZ ocenjeno konsolidirano prodajo v višini 894 milijonov EUR, proizvodnjo 951 milijonov kg mleka in z 2120 zaposlenimi v letu 2013 je Zott eno večjih mlekarn v Evropi in eno vodilnih proizvajalcev mlečnih produktov na Poland."},{"page_url":"https://en.wikipedia.org/wiki/Malaysia_Federal_Route_5","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Jkr-ft5.png","page_title":"Malaysia Federal Route 5","context_page_description":"Federal Route 5 is one of the three north–south oriented backbone federal road running along the west coast of Peninsular Malaysia, Malaysia. The 655.85 kilometres federal highway runs from Jelapang, Perak in the north to Skudai, Johor in the south."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8D%D5%B8%D6%82%D6%80%D5%A2_%D4%B1%D5%BD%D5%BF%D5%BE%D5%A1%D5%AE%D5%A1%D5%AE%D5%B6%D5%AB_%D4%B1%D5%BE%D5%A5%D5%BF%D5%B4%D5%A1%D5%B6_%D5%B4%D5%A1%D5%B5%D6%80_%D5%BF%D5%A1%D5%B3%D5%A1%D6%80_(%D4%BD%D5%A1%D6%80%D5%AF%D5%B8%D5%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Blagoveschensky_church_in_Kharkov.jpg","page_title":"Սուրբ Աստվածածնի Ավետման մայր տաճար (Խարկով)","context_page_description":"Սուրբ Աստվածածնի Ավետման տաճար, Մոսկովյան պատրիարքության Ուկրաինական ուղղափառ եկեղեցու Խարկովա-Բոգոդուխյան թեմի մայր տաճարն է։ Նախագծվել է տեղացի ճարտարապետ Միխայիլ Լովցովի կողմից, իսկ շինարարությունը ավարտվել է 1888թ հոկտեմբերի 2-ին։ Եկեղեցին օծվել է 1901թ-ին:\\nԿոնֆետի տեսք ունեցող այս եկեղեցին փոխկապակցված է հին Ավետարանական եկեղեցու հետ որպես Խարկովի գլխավոր տաճար և Ռուսական կայսրության ամենամեծ և ամենախոշոր եկեղեցիներից մեկը: Պատկերների մակերեսները պատրաստված են եղել Կարարայից բերված մարմարով: Եկեղեցին Կիևում գտնվող Վլադիմիրյան տաճարի ոճով ֆրեսկոյի է ենթարկվել: 1914թ հուլիսի 3-ին եկեղեցին քաղաքի տաճարի կոչում ձեռք բերեց:\\n1930թ հավատացյալների համար եկեղեցին փակվեց, սակայն այն վերաբացվեց 1943թ գերմանական օկուպացիայի ժամանակ: Հետագայում եկեղեցին հայտնվեց ուկրաինացիների ձեռքում որպես ուկրաինական ինքնավար ուղղափառ եկեղեցի՝ դառնալով դպրոց, հետագայում՝ պահեստ:\\n1946թ-ից սկսած տաճարը նստավայր է ծառայում Խարկովի և Բոհոդուխիվի ուկրաինական Օրթոդոքս եկեղեցու հեպարխիայի նստավայր, մինչդեռ բարեխոսության կոնվենտը ծառայել է որպես եպիսկոպոսի նստավայր: Էկոմենիկ պատրիարք Աթանասիուս III Պաթելարոսը և այլ մի քանի սրբեր թաղված են տաճարում:"},{"page_url":"https://ja.wikipedia.org/wiki/%E7%B4%80%E5%85%83%E5%89%8D18%E4%B8%96%E7%B4%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Phoenician_statuettes.jpg","page_title":"紀元前18世紀","context_page_description":"紀元前18世紀は、西暦による紀元前1800年から紀元前1701年までの100年間を指す世紀。"},{"page_url":"https://pl.wikipedia.org/wiki/Historia_o%C5%9Bwiaty_w_Gryficach","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Gryfice_Gimnazjum_nr_1_2008-07.jpg","page_title":"Historia oświaty w Gryficach","context_page_description":"Historia oświaty w Gryficach obejmuje okres działalności oświatowej w mieście od II poł. XIV w. do czasów obecnych.\\nDzieje oświaty gryfickiej rozpoczęły się wraz z utworzeniem szkoły łacińskiej w II poł. XIV w. działającej pod patronatem kościoła Mariackiego oraz średniej szkoły łacińskiej Leordanusa, która była tzw. placówką fundacyjną, a funkcjonowała pod egidą miejscowego magistratu. Przez prawie 150 lat były one jedynymi placówkami oświatowymi do czasu powstania drugiej fundacyjnej szkoły dla dziewcząt. W wieku XIX odnotowano działalność szkolnictwa elementarnego i gimnazjalnego. Powstała również Przygotowawcza Szkoła Podoficerska oraz Prywatna Wyższa Szkoła Żeńska. System oświatowy, jaki był spotykany w Greifenbergu, był dostosowany do lokalnych, kościelnych i państwowych potrzeb.\\nReformy oświatowe przeprowadzone przez Królestwo Prus wprowadziły powszechny obowiązek szkolny dla dzieci w wieku 5–12 lat. Do XIX w. w szkołach kształcono przede wszystkim chłopców, choć na terenie miasta działała szkoła dla dziewcząt."},{"page_url":"https://nl.wikipedia.org/wiki/Thorvald_Lammers","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/41/Thorvald_Lammers.png","page_title":"Thorvald Lammers","context_page_description":"Thorvald Amund Lammers was een Noors componist, muziekpedagoog, koordirigent, zanger en biograaf. Hij was gehuwd met de zangeres Mally Sars. Lammers wordt gezien als een van de belangrijkste Noorse zangers aan het einde van de 19e en de beginnende 20e eeuw."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A1%D0%B5%D1%80%D0%BE%D1%82%D0%BE%D0%BD%D0%B8%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Serotonin_synthesis.png","page_title":"Серотонин","context_page_description":"Серотонин или 5-хидрокситриптамин е моноаминен невротрансмитер, който се синтезира в серотонергичните неврони на централната нервна система, общо около 10%, а също така и в ентерохромафинните клетки на стомашно-чревния тракт за останалите 90 %. Прекурсора му е Триптофан наличен под формата 5HTP като спортна добавка. Серотонинът също се среща в редица гъби и растения, в това число плодове и зеленчуци. Серотонин се произвежда още и от един вид карцином у човека, наречен карциноид."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E6%A9%9F%E5%A0%B4%E5%8C%97%E7%AB%99_(%E5%BB%A3%E5%B7%9E)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Exit_B%2C_Airport_N._Station%2C_GZMTR.jpg","page_title":"機場北站 (廣州)","context_page_description":"機場北站（粵拼：gei¹ coeng⁴ bak¹ zaam⁶；英文：Airport North Station）係廣州地鐵3號綫嘅車站，2018年4月26號開放，位置喺花都區嘅廣州白雲國際機場2號航站樓入面。\\n佢既係3號綫北邊嘅總站，又係3號綫北邊嘅永久終點站。因為3號綫嘅規劃同工程嚟到呢度斷咗頭，唔再繼續延長。雖然佢亦係3號綫其一唔用書法站名嘅車站，但用嘅係6號綫月台嗰啲行楷字體嘅大字品種。\\n另外，喺廣州地鐵（除APM外）同佛山地鐵是旦一個站啲路線牌，都有寫到呢個站附近係白雲機場嘅2號航站樓。"},{"page_url":"https://fr.wikipedia.org/wiki/Douze_ans_d%27esclavage","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Twelve_Years_a_Slave%2C_p273.jpg","page_title":"Douze ans d'esclavage","context_page_description":"Douze ans d'esclavage ou Douze ans dans l'esclavage est l'autobiographie parue en 1853 de Solomon Northup, un Noir né libre à New York, qui a été enlevé et vendu aux esclavagistes. Il fut esclave pendant douze ans en Louisiane avant la Guerre civile américaine. Il fournit des détails sur les marchés d'esclaves de Washington et décrit minutieusement la culture du coton sur une des plus grandes plantations de la Louisiane.\\nPublié peu après le roman de Harriet Beecher Stowe, La Case de l'oncle Tom, le livre de Northup, qui lui dédicacera l'ouvrage, fut considéré comme un best-seller. Les 8 000 premiers exemplaires furent écoulés en quelques mois. Réimprimés plusieurs fois, plus de 30 000 exemplaires avaient été vendus dès 1856. Le livre autobiographique fut édité à plusieurs reprises pendant le XIXᵉ siècle. Partageant les conclusions du récit de Stowe, l'histoire de Northup sur ses douze ans d'esclavage constitua un fait marquant dans le débat politique national sur l'esclavagisme, ce qui mena à la guerre civile aux États-Unis. Le livre eut l'appui de plusieurs journaux importants du Nord, des organisations anti-esclavagistes et des groupes évangéliques."},{"page_url":"https://en.wikipedia.org/wiki/Brian_Fallon","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Brian_Fallon_fronting_The_Gaslight_Anthem%2C_Stuttgart%2C_2014.jpg","page_title":"Brian Fallon","context_page_description":"Brian Fallon is an American singer-songwriter and musician. He is best known as the lead vocalist, rhythm guitarist, and main lyricist of the rock band The Gaslight Anthem, with whom he has recorded five studio albums. He is also a member of the duo the Horrible Crowes alongside the Gaslight Anthem's guitar technician and touring guitarist, Ian Perkins."},{"page_url":"https://pl.wikipedia.org/wiki/Dodge_Shadow","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/%2787-%2788_Dodge_Shadow_With_Plymouth_Sundance_Grille.jpg","page_title":"Dodge Shadow","context_page_description":"Dodge Shadow – samochód osobowy klasy kompaktowej produkowany pod amerykańską firmą Dodge w latach 1986 – 1994."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%83%B4%E3%82%A3%E3%82%A2%E3%83%AA%E3%83%BC%E3%82%B7%E3%83%B3%E3%82%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/41/UK-12005_SRX_AN12_side_view.JPG","page_title":"アヴィアリーシング","context_page_description":"アヴィアリーシング・アヴィエーション・カンパニー はウズベキスタンのタシュケントに本拠を置く貨物航空会社である。アヴィアリーシングはアジアの都市と西ヨーロッパ、東ヨーロッパの都市を結んで貨物運輸を行なっている。拠点としている空港はタシュケントのタシュケント国際空港である。アヴィアリーシングはウズベキスタンとアメリカ合衆国の企業のジョイントベンチャー企業であり、1993年にフロリダ州のSRXグループとの提携が行われた。"},{"page_url":"https://de.wikipedia.org/wiki/Palazzo_Sansedoni","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/17/Palazzo_Sansedoni_Siena.jpg","page_title":"Palazzo Sansedoni","context_page_description":"Der Palazzo Sansedoni ist ein Gebäude im historischen Zentrum von Siena, am Piazza del Campo gelegen."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%BE%D8%B1%D9%88%D8%A7%D8%B2_%D8%B4%D9%85%D8%A7%D8%B1%D9%87_%DB%B9%DB%B4%DB%B5_%D8%A7%DB%8C%D8%B1%D8%A7%D9%86_%D8%A7%DB%8C%D8%B1%D8%AA%D9%88%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Iran_Airtour_Tu-154M_EP-MCR_SVO_2008-9-23.png","page_title":"پرواز شماره ۹۴۵ ایران ایرتور","context_page_description":"پرواز شماره ۹۴۵ ایران ایرتور یک پرواز در کشور ایران بود که با ۱۳۷ مسافر و ۱۱ خدمه بودند، در تاریخ ۱ سپتامبر ۲۰۰۶ میلادی در حین فرود در فرودگاه مشهد دچار سانحه شد و ۲۸ نفر جان باختند."},{"page_url":"https://es.wikipedia.org/wiki/La_Alcarria","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/af/Torres_de_la_Alameda.jpg","page_title":"La Alcarria","context_page_description":"La Alcarria es una comarca natural castellana situada en la submeseta Sur, que comprende la mayor parte del centro y sur de la provincia de Guadalajara, el noroeste de la provincia de Cuenca y el sureste de la provincia de Madrid.\\nGeográficamente está formada por un relieve tabular coronado por la superficie estructural del páramo calizo que se ve continuamente cortado de norte a sur por ríos y arroyos que forman angostos glacis y cuestas margosos y profundos valles fértiles. Esto genera una geomorfología que produce un notable contraste entre los encinares y la agricultura de secano del páramo, y las pequeñas huertas, los olivares y las hierbas aromáticas de las cuestas y valles.\\nPrecisamente, la abundancia de plantas aromáticas como el romero, el tomillo, el espliego o lavanda hacen posible la apicultura de la que resulta la miel de la Alcarria. Otros productos dados en la comarca son el cordero de raza alcarreña, el aceite de la Alcarria y los vinos de denominación de origen de Mondéjar y Sacedón y Arganda."},{"page_url":"https://cs.wikipedia.org/wiki/Doprava_v_Thajsku","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/TrafficInBangkok.jpg","page_title":"Doprava v Thajsku","context_page_description":"Doprava v Thajsku je systém způsobu dopravy lidí a nákladu v této asijské zemi. Je různorodá, přičemž nedominuje žádný konkrétní typ. Autobusová doprava převažuje při přepravě na dlouhé vzdálenosti, zatímco na venkově je dlouhodobě užívána železnice. Thajská vláda v budoucnu plánuje dopravní infrastrukturu rozšířit vybudováním vysokorychlostní železnice. Pro přepravu nákladu se používá hlavně silniční doprava.\\nPro dopravu osob na krátké vzdálenosti jsou běžně používány motocykly. V Bangkoku, Pattaye a jiných velkých městech jsou provozovány motocyklové taxislužby. Ve městech je hojně využívána přeprava tuk-tuky – motorovými tříkolkami se sedátkem za řidičem. Jejich výhodou je nízká cena. První linka nadzemního metra v Bangkoku byla otevřena v roce 1999 a denně tento systému v roce 2018 přepravil kolem 650 000 cestujících.\\nPřeprava soukromými automobily v 21. století prudce vzrostla. V roce 2015 bylo v Bangkoku registrováno 9 milionů automobilů, přičemž zdejší silnice dokáží zvládnout provoz maximálně 1,5 milionu vozidel. Dopravní zácpy jsou ve městě velmi častým jevem."},{"page_url":"https://sv.wikipedia.org/wiki/Walter_Hasenclever","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Les_Milles%2C_Geb%C3%A4ude_des_Lagers.JPG","page_title":"Walter Hasenclever","context_page_description":"Walter Georg Alexander Hasenclever, född den 8 juli 1890 i Aachen, död den 21 juni 1940 i det franska fånglägret Camp des Milles utanför Aix-en-Provence, var en tysk expressionistisk dramatiker, poet, manusförfattare, romanförfattare, översättare och filmskådespelare. Mellan 1916 och 1932 hörde han till de mest spelade pjäsförfattarna i Tyskland. I egenskap av framstående expressionist, uttalad pacifist och meningsmotståndare till den nazistiska regimen utsattes han för förföljelse 1933 och gick därför i exil. Han är inte översatt till svenska."},{"page_url":"https://en.wikipedia.org/wiki/Hey_Violet","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Hey_Violet_12-02-2016_-5_%2831838972675%29.jpg","page_title":"Hey Violet","context_page_description":"Hey Violet is an American pop rock band from Los Angeles, California, consisting of Rena Lovelis, Nia Lovelis and Casey Moreta.\\nFormed in 2008 as Cherri Bomb while its members were still in middle school, the band was originally an all-female hard rock group, consisting of Julia Pierce, Miranda Miller, Rena Lovelis, and Nia Lovelis. In 2013, Pierce left the band and was later replaced by Casey Moreta. In 2015, the group changed their name to Hey Violet and drastically altered their sound. They later signed to Hi or Hey Records, founded by 5 Seconds of Summer, whom they supported on the Rock Out with Your Socks Out and Sounds Live Feels Live tours.\\nIain Shipp joined the band officially in September 2016 but left in 2019. In August 2017, Miller announced her departure from the band via social media."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D9%88%D8%A8%D9%8A_%D9%87%D8%A7%D8%B1%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Bobby_Hart_%28American_football%29.JPG","page_title":"بوبي هارت","context_page_description":"بوبي هارت ‏ هو لاعب كرة قدم أمريكية أمريكي، ولد في 21 أغسطس 1994 في لاودرهيل في الولايات المتحدة."},{"page_url":"https://nl.wikipedia.org/wiki/Bella_en_Hanna,_de_oudste_dochters_van_M._L._Nathanson","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Mendel_Levin_Nathanson_1861_by_Rudolph_Striegler.jpg","page_title":"Bella en Hanna, de oudste dochters van M. L. Nathanson","context_page_description":"Het portret van Bella en Hanna, de oudste dochters van M. L. Nathanson is een schilderij van Christoffer Wilhelm Eckersberg uit 1820. Het is een goed voorbeeld van de portretkunst van de kunstenaar. Sinds 1920 maakt het deel uit van de collectie van het Statens Museum for Kunst in Kopenhagen."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9F%D0%B0%D1%82%D1%80%D0%B8%D1%98%D0%B0%D1%80%D1%85_%D1%81%D1%80%D0%BF%D1%81%D0%BA%D0%B8_%D0%9F%D0%B0%D0%B2%D0%BB%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Patrijarh_Pavle.jpg","page_title":"Патријарх српски Павле","context_page_description":"Патријарх српски Павле био је 44. врховни поглавар Српске православне цркве од 1990. до 2009. године.\\nЊегово пуно име и титула гласили су Његова светост архиепископ пећки, митрополит београдско-карловачки и патријарх српски господин Павле."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%B0%B7%E3%81%A8%E7%82%8E%E3%81%AE%E6%AD%8C%E3%81%AE%E3%83%86%E3%83%BC%E3%83%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Fridolin_Leiber_-_Pater_noster.jpg","page_title":"氷と炎の歌のテーマ","context_page_description":"氷と炎の歌のテーマでは、ジョージ・R・R・マーティン著のファンタジー小説シリーズである『氷と炎の歌』の中で追求される、いくつかのテーマについて述べる。小説に基づき、HBOドラマシリーズ『ゲーム・オブ・スローンズ』が放映されている。\\n『氷と炎の歌』の物語は、ウェスタロスと呼ばれる大陸と、エッソスと呼ばれる大陸を主とした架空世界を舞台としている。物語には3つの主要な筋があり、次第に絡み合うようになる。諸名家によるウェスタロスの王座を巡る争い、ウェスタロスの国境となる巨大な氷の〈壁〉の北での〈異形〉と呼ばれる脅威の増大、13年前の別の内戦で殺された王の娘であるデナーリス・ターガリエンのウェスタロスへの帰還と玉座を求める野望である。なお、ドラマシリーズでは内戦は17年前に起きたことになっている。\\n本シリーズからは以下のテーマが批評の対象になっている：魔法と現実、政治と社会、倫理の多面性、暴力と死、性表現、アイデンティティー、フェミニズム、宗教、そして食である。\\n本シリーズの第1部から第3部には岡部宏之による旧版と、酒井昭伸による新訳語を用いた改訂新版が存在し、両版の間では多くの名称の日本語訳が変更されているため、以下においては新訳語を用い、最初に使用された箇所では括弧内に旧訳語を示す。"},{"page_url":"https://cs.wikipedia.org/wiki/Nakad%C5%BEima_Ki-84","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Ki-84-Right_front_view.jpg","page_title":"Nakadžima Ki-84","context_page_description":"Nakadžima Ki-84 Hajate byl japonský armádní stíhací letoun užívaný ve druhé světové válce. Plný název sériových letounů byl Armádní stíhací letoun Typ 4 Model 1A Hajate, ve spojeneckém kódu byl označen Frank.\\nJednalo se o robustní a rychlý letoun s dobrou pasívní ochranou pilota, se silnou výzbrojí a dlouhým doletem. Když se roku 1944 střetli s Ki-84 Američané, byli nemile překvapeni výkony nového soupeře. Avšak v té době měli již nad Japonci takovou početní převahu, že je nasazení jakéhokoliv moderního stroje nemohlo ohrozit."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%A2%B1%E9%A2%A8%E8%98%87%E8%BF%AA%E7%BE%85_(2015%E5%B9%B4)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Taipei_-_Soudelor_-_Saturday%2C_August_8%2C_2015_04.jpg","page_title":"颱風蘇迪羅 (2015年)","context_page_description":"強烈颱風蘇迪勒為2015年太平洋颱風季第12個命名的風暴。「蘇迪勒」一名是由密克羅尼西亞聯邦所提供，是波納佩島傳說中的酋長。\\n蘇迪勒是2015年西北太平洋地區的最強風暴，大多數官方部門均評定蘇迪勒比同年3月至4月的颱風梅莎及5月颱風紅霞更強，是日本氣象廳年內第3個評定達「猛烈的」程度的颱風，亦是聯合颱風警報中心於年內第6個超級颱風，以及香港天文台於年內第7個超強颱風。其生命史內兩度發展「雙重眼壁」，對近年西北太平洋的熱帶氣旋而言甚為罕見。根據數位颱風網資料顯示，蘇迪勒是繼1983年颱風艾貝後，第一個於8月份經日本氣象廳評估接近中心最高持續風速達115節以上的熱帶氣旋。蘇迪勒橫掃塞班島及臺灣期間造成嚴重破壞，而隨後登陸中國福建省時亦為當地及鄰近的浙江省帶來破紀錄雨量；與此同時，港澳地區受蘇迪勒外圍的下沉氣流影響，令本已持續數日的熱浪加劇，香港更出現破紀錄的酷熱天氣。由於蘇迪勒在北馬里亞納群島、臺灣和中國大陸造成嚴重傷亡及破壞，因此在第48屆世界氣象組織颱風委員會會議中永久退役，並於翌年的第49屆世界氣象組織颱風委員會會議中由「沙德爾」取代。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B5%D0%BB%D0%B5%D0%BD%D0%B5%D0%BD%D1%81%D0%B5%D1%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/1933_Campeonato_de_Portugal_and_1984_Segunda_Divis%C3%A3o_Trophies_at_Museu_Manuel_Bulhosa.jpg","page_title":"Белененсеш","context_page_description":"«Белене́нсеш» — португальский спортивный клуб из города Лиссабон, базирующийся в Санта-Мария-де-Белене, одном из районов столицы. Основан в 1919 году, что делает его одним из старейших португальских клубов. Основными направлениями деятельности клуба являются футбол, гандбол, баскетбол, футзал, регби и лёгкая атлетика. За исключением футзала, клуб выигрывал национальный чемпионат во всех этих видах спорта, но самым известным из всех спортивных направлений клуба является именно футбол.\\nДо основания в 1934 году первого дивизиона Португалии по футболу «Белененсеш» считался самим титулованным клубом страны. Футболисты «Белененсеша» выиграли чемпионат Португалии в сезоне 1945/46. Только двум командам в Португалии, кроме «Большой Тройки», удалось выиграть национальный чемпионат, это «Белененсеш» и «Боавишта». «Белененсеш» несколько раз участвовал в Кубке УЕФА и один раз в кубке обладателей кубков, но не проходил дальше второго раунда турниров. Домашние матчи проводит на стадионе «Ду Рештелу», вмещающем 32 500 зрителей."},{"page_url":"https://war.wikipedia.org/wiki/Pachyramphus_niger","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Jamaican_Becard_%28Pachyramphus_niger%29_%288082132988%29.jpg","page_title":"Pachyramphus niger","context_page_description":"An Pachyramphus niger in uska species han Aves nga syahan ginhulagway ni Gmelin hadton 1788. An Pachyramphus niger in nahilalakip ha genus nga Pachyramphus, ngan familia nga Cotingidae. Ginklasipika han IUCN an species komo diri gud kababarak-an. Waray hini subspecies nga nakalista."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%92%D1%80%D0%B1%D0%B5%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/%D0%A5%D0%95_%D0%92%D1%80%D0%B1%D0%B5%D0%BD.jpg","page_title":"Врбен","context_page_description":"Врбен — село во Општина Маврово и Ростуше, во областа Горна Река, во околината на градот Гостивар."},{"page_url":"https://en.wikipedia.org/wiki/Anna_Schudt","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/120305-uw00866.jpg","page_title":"Anna Schudt","context_page_description":"Anna Schudt is a German Emmy-winning actress. She is internationally best known for playing comedian Gaby Köster in the television film Ein Schnupfen hätte auch gereicht."},{"page_url":"https://pt.wikipedia.org/wiki/Quadri","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a4/Quadri_%28CH%29.jpg","page_title":"Quadri","context_page_description":"Quadri é uma comuna italiana da região dos Abruzos, província de Chieti, com cerca de 942 habitantes. Estende-se por uma área de 7 km², tendo uma densidade populacional de 135 hab/km². Faz fronteira com Borrello, Civitaluparella, Pizzoferrato, Sant'Angelo del Pesco."},{"page_url":"https://en.wikipedia.org/wiki/Prague-East_District","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/OdolenaVoda1.jpg","page_title":"Prague-East District","context_page_description":"Prague-East District is a district within the Central Bohemian Region of the Czech Republic. Its administrative seat is in Prague. The most populated town of the district is Brandýs nad Labem-Stará Boleslav."},{"page_url":"https://es.wikipedia.org/wiki/Asiria","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Sargon_II_palace_in_Dur-Sharrukin.png","page_title":"Asiria","context_page_description":"Asiria es una antigua región del norte de Mesopotamia, que toma su nombre de la ciudad de Aššur —del mismo nombre que Assur, su deidad tutelar—, que data de 2600 a. C. Fundada a orillas del río Tigris, originalmente era una serie de ciudades de habla acadia en la región. En los siglos XXV y XXIV a. C., los reyes asirios fueron líderes pastorales. Desde finales del siglo XXIV a. C., los asirios se convirtieron en súbditos de Sargón de Acad, que unió a todos los pueblos semitas acadios y sumerios de Mesopotamia bajo el Imperio acadio, que duró desde ca. 2334 hasta 2154 a. C.​ A partir de esa región se formó, en el II milenio a. C., un poderoso reino que luego se convirtió en un imperio, que por antonomasia se asocia con Asiria. También fue conocido como Subartu y, tras su declive, como Athura, Syria, Assyria y Asuristán. En el momento de máxima expansión, en los siglos VIII y VII a. C., Asiria controlaba un territorio que hoy son, en todo o en parte, los países de Siria, Líbano, Turquía, Irak e Irán."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BE%D0%B1%27%D1%94%D0%BA%D1%82%D1%96%D0%B2_%D0%A1%D0%B2%D1%96%D1%82%D0%BE%D0%B2%D0%BE%D1%97_%D1%81%D0%BF%D0%B0%D0%B4%D1%89%D0%B8%D0%BD%D0%B8_%D0%AE%D0%9D%D0%95%D0%A1%D0%9A%D0%9E_%D0%B2_%D0%9B%D0%B8%D1%82%D0%B2%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Vilnius_view.jpg","page_title":"Список об'єктів Світової спадщини ЮНЕСКО в Литві","context_page_description":"Список об'єктів Світової спадщини ЮНЕСКО в Литві станом на 2015 рік налічує 4 найменування, що приблизно становить 0,4% від загальної кількості об'єктів Світової спадщини у світі. Всі 4 литовські об'єкти Світової спадщини є пам'ятками культурного типу.\\nЛитва ратифікувала Конвенцію ЮНЕСКО про охорону всесвітньої культурної і природної спадщини 31 березня 1992 року, а перша литовська пам'ятка — Історичний центр Вільнюса — потрапила до переліку Світової спадщини 1994 року. Надалі перелік об'єктів Світової спадщини у Литві розширювався 2000, 2004 та 2005 року; у 2012 році до об'єкту Історичний центр Вільнюса вносилися незначні зміни."},{"page_url":"https://en.wikipedia.org/wiki/SEAT_Le%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/2018_SEAT_Leon_SE_Dynamic_Technology_facelift_1.6_Rear.jpg","page_title":"SEAT León","context_page_description":"The SEAT León is a hatchback compact car built by the Spanish car manufacturer SEAT since October 1998.\\nThe first two Leon generations used two differing variants of the Volkswagen Group A platform, and shared many components with other Volkswagen Group cars. The third and fourth (current) generation use the Volkswagen Group MQB platform, also used by the Audi A3 Mk3 and Mk4, Volkswagen Golf Mk7 and Mk8 and Škoda Octavia Mk3, Mk4."},{"page_url":"https://be.wikipedia.org/wiki/%D0%9F%D1%8F%D1%87%D0%BE%D1%80%D0%B0_%D0%A8%D1%83%D0%BB%D1%8C%D0%B3%D0%B0%D0%BD-%D0%A2%D0%B0%D1%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/%D0%A8%D1%83%D0%BB%D1%8C%D0%B3%D0%B0%D0%BD%D1%82%D0%B0%D1%88.png","page_title":"Пячора Шульган-Таш","context_page_description":"Шульга́н-Таш, Ка́пава пячора — карставая пячора ў Бурзянскім раёне, Башкартастан, Расія. Знаходзіцца ў запаведніку \\"Шульган-Таш\\", на правым беразе р. Белай, за 200 км на паўднёвы ўсход ад Уфы.\\nШырока вядомая дзякуючы знойдзенаму ў ёй палеалітычныму жывапісу, узрост якога ацэнваецца ў 16 тысяч гадоў.\\nПячора ўяўляе сабой слабаразгалінаваную трохпавярховую спелеасістэму працягласцю каля 3 км з вертыкальнай амплітудай 165 м з вялікімі заламі, галерэямі, падземнымі азёрамі і ракой. З трох гіпсаметрычных узроўняў ніжні займае рака Падземны Шульган, якая і ўтварыла гэтую пячору.\\nНаскальныя малюкі былі адкрытая заолагам запаведніка А. В. Руміным у 1959 г. У 1960—1964 гг. жывапіс вывучаўся О. Н. Бадэрам. З пачатку 1980-х гадоў даследаванні працягваюцца В. Е. Шчалінскім з супрацоўнікамі. Агульная працягласць усіх даследаваных хадоў пячоры ў двух ярусах — каля 2 км. Каля 40 малюнкаў мамантаў, насарога, коняў, бізона і розных знакаў, зробленых чырвона-бурай охрай. У пячоры вядуцца раскопкі, пры якіх выяўленыя камякі охры і вапняковая камлыга з малюнкам, якая адвалілася ад сцяны. Радыявугляродная дата пласта — 14680±150.\\nПячора ўваходзіць у спіс аб'ектаў Сусветнай спадчыны ЮНЕСКА ў Расіі."},{"page_url":"https://sh.wikipedia.org/wiki/Cagliari","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Cagliari_Piazza_del_Carmine.jpg","page_title":"Cagliari","context_page_description":"Cagliari je glavni grad Cagliarijskog metropolitanskog područja i regije Sardinije u Italiji. Grad je 2011. imao 149.883 stanovnika. Metropolitanski Cagliari zajedno s predgrađima i još 15 naselja broji sveukupno 453.728 stanovnika."},{"page_url":"https://tr.wikipedia.org/wiki/New_York%27taki_en_y%C3%BCksek_binalar_listesi","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/McGraw-Hill_Building_Rock_Center_by_David_Shankbone.jpg","page_title":"New York'taki en yüksek binalar listesi","context_page_description":"New York'taki en yüksek binalar listesi ABD'nin New York eyaletinde yer alan New York şehrindeki en yüksek binaların listesidir.\\nAşağıdaki liste New York şehrinde yer alan ve en az 183 metreye ulaşmış gökdelenleri kapsamaktadır. Bu yükseklik sınırına kulenin en uç kısmındaki ek yapılar dahildir ama anten kuleleri dahil değildir. Eşittir işareti iki veya daha fazla binanın yüksekliklerinin aynı olduğu anlamına gelmektedir."},{"page_url":"https://de.wikipedia.org/wiki/W%C3%BCstensperling","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/PasserSimplex.svg","page_title":"Wüstensperling","context_page_description":"Der Wüstensperling ist eine Vogelart der Gattung Passer aus der Familie der Sperlinge. Er kommt ausschließlich in Wüstenregionen Afrikas sowie Turkmenistans und Usbekistans vor. Die Anzahl der Unterarten ist umstritten. Einige Autoren unterscheiden drei Unterarten – zwei afrikanische und eine asiatische – andere halten trotz regionaler Unterschiede im Erscheinungsbild eine Aufteilung in Unterarten nicht für gerechtfertigt. Gelegentlich werden die asiatischen Populationen aber sogar als eigene Art Passer zarudnyi angesehen.\\nDie IUCN stuft den Wüstensperling als nicht gefährdet ein."},{"page_url":"https://pt.wikipedia.org/wiki/Coarraze","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Ch%C3%A2teau_de_Coarraze_%28Pyr%C3%A9n%C3%A9es-Atlantiques%2C_France%29.JPG","page_title":"Coarraze","context_page_description":"Coarraze é uma comuna francesa na região administrativa da Nova Aquitânia, no departamento dos Pirenéus Atlânticos. Estende-se por uma área de 14,83 km². Em 2010 a comuna tinha 2 113 habitantes."},{"page_url":"https://pt.wikipedia.org/wiki/Saga_de_Egil_Skallagrimsson","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Egil_Skallagrimsson_17c_manuscript.jpg","page_title":"Saga de Egil Skallagrimsson","context_page_description":"A saga islandesa medieval Egils saga Skalla-Grímssonar é a história da vida de Egil Skallagrimsson e da sua família.\\nFoi escrita na Islândia durante o séc. XIII, possivelmente por Snorri Sturluson.\\nEstá incluída no Möðruvallabók, um manuscrito medieval islandês do séc. XIV, conservado no Instituto Árni Magnússon de Estudos Islandeses, em Reiquiavique."},{"page_url":"https://en.wikipedia.org/wiki/Ball_Boys","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Cast_of_Ball_Boys_LP.jpg","page_title":"Ball Boys","context_page_description":"Ball Boys is an American reality television series that aired on ABC. The series premiered on March 24, 2012."},{"page_url":"https://da.wikipedia.org/wiki/Beethovens_kompositioner","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Beethovensmall.jpg","page_title":"Beethovens kompositioner","context_page_description":"Dette er en liste over Ludwig van Beethovens værker, efter genre."},{"page_url":"https://fr.wikipedia.org/wiki/Nord-Ouest_de_l%27Ontario","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cb/Map_of_Ontario_NORTHWESTERN.svg","page_title":"Nord-Ouest de l'Ontario","context_page_description":"Le Nord-Ouest de l'Ontario est une région de la province canadienne de l'Ontario.\\nElle s'étend au nord et à l'ouest du lac Supérieur, et à l'ouest de la baie d'Hudson et de la baie James. Elle inclut la grande partie de l'Ontario subarctique.\\nSa frontière occidentale est la province canadienne du Manitoba, qui a déjà revendiqué la partie occidentale de la région. Le droit de l'Ontario au Nord-Ouest de l'Ontario fut décidé par le comité judiciaire du Conseil privé en 1884 et confirmé par le Canada Act, 1889 du parlement du Royaume-Uni. En 1912, le parlement du Canada, par le Ontario Boundaries Extension Act donna juridiction sur le district de Patricia à l'Ontario, étendant à ce moment la frontière septentrionale de la province jusqu'à la baie d'Hudson.\\nDans certaines études, le Nord-Ouest de l'Ontario et le Nord-Est de l'Ontario sont traités comme des régions distinctes, alors que parfois ils sont regroupés en tant que Nord de l'Ontario."},{"page_url":"https://eo.wikipedia.org/wiki/Kanisedoj","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Coyote_portrait.jpg","page_title":"Kanisedoj","context_page_description":"Hundedoj aŭ kanisedoj estas familio de mamuloj, al kiu apartenas la hundo, lupo, vulpo, ŝakalo kaj kojoto, inter aliaj.\\ngenro: † ksenociono - Xenocyon\\nspecio: † ksenociono kaverna - Xenocyon spelaeoides\\ngenro: † simociono - Simocyon\\nspecio: † simociono diafora - Simocyon diaphorus\\ngenro: † amficiono - Amphicyon\\nspecio: † amficiono granda - Amphicyon maior\\nspecio: † amficiono steinheima - Amphicyon steinheimensis\\ngenro: † megamficiono - Megamphicyon\\nspecio: † megamficiono giganta - Megamphicyon giganteus\\ngenro: † pseŭdurso - Pseudarctos\\nspecio: † pseŭdurso bavaria - Pseudarctos bavaricus\\ngenro: † ksenalopeko - Xenalopex\\nspecio: † ksenalopeko remenia - Xenalopex remenyi\\ngenro: † ruscinalopeko - Ruscinalopex\\nspecio: † ruscinalopeko donnezana - Ruscinalopex donnezani\\ngenro: Kaniso - Canis\\nspecio: † kaniso kautleja - Canis cautleyi\\nspecio: † kaniso antonia - Canis antonii\\nspecio: † kaniso ĥihlia - Canis chihliensis\\nspecio: † kaniso terura - Canis dirus\\nsubgenro: Hundo - Canis\\nspecio: kaniso doma - Canis familiaris\\nspecio: kaniso Dingo - Canis dingo\\nsubspecio: kaniso dingo novgvinea - Canis dingo hallstromi\\nspecio: kaniso LUPO - Canis lupus"},{"page_url":"https://mk.wikipedia.org/wiki/%D0%98%D1%81%D1%82%D0%BE%D1%80%D0%B8%D1%98%D0%B0_%D0%BD%D0%B0_%D0%98%D1%80%D0%B0%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/PersepolisPanorama2007.jpg","page_title":"Историја на Иран","context_page_description":"Историја на Иран е тесно поврзана со историјата на поголем регион кој се протега од реката Дунав на запад, па на исток до реката Инд и Сирдарја, односно од Кавказ, преку Касписко Море и Аралското Езеро на север па сè до Персиски Залив, Омански Залив и Египет на југ.\\nИран е дом на една од најстарите континуирани големи цивилизации во светот, со историски и урбани населби уште од 7000 п.н.е. Југозападниот дел од Иранската Висорамнина се наоѓа на подрачјето кое се смета за антички Блиски Исток, со неколку цивилизации кои постоеле на тоа подрачје како Еламите во периодот на раното Бронзено време. Хегел ги именува Персијците како „прв историски народ“. Вистинскиот процут на Персија се случило во Железно време, како резултат на на доаѓањето на иранските народи на тоа подрачје. Иранските народи ја формирале Медијанската династија, по кое следувало формирање на поголем број на царства, како Ахеменидско Царство, Партско Царство и Сасанидско Царство кои постоеле во класичниот антички период.\\nНекогаш голема империја, како што отсекогаш била нарекувана како Персија, многу често била освојувана нејзината територија а поради тоа и имала чести промени на територијалните граници."},{"page_url":"https://fr.wikipedia.org/wiki/Histoire_de_la_Suisse_sous_domination_fran%C3%A7aise","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/AduC_025_Necker_%28J.%2C_1732-1804%29.JPG","page_title":"Histoire de la Suisse sous domination française","context_page_description":"L'histoire de la Suisse sous domination française est l'étape de la formation de la Confédération suisse qui suit la Confédération des XIII cantons. Elle est comprise entre le début des manifestations provoquées par la Révolution française de 1789 et la création de la Confédération des XXII cantons le 7 août 1815.\\nLes premières réactions en Suisse face aux événements de la Révolution française sont négatives : l'annonce du massacre des gardes suisses au Palais des Tuileries, la tentative d'invasion française de Genève en 1792 et la prise, la même année, de l'évêché de Bâle rattaché à la France sont autant d’événements qui sont mal perçus localement. À la suite de l'échec d'un soulèvement dans le canton de Vaud contre Berne, les meneurs se réfugient à Paris où ils poussent à la fin 1797 le gouvernement français à envahir la Suisse, qui capitule une année plus tard. Le gouvernement français met alors en place le nouveau régime de la République helvétique, État centralisé et unitaire dont les limites administratives internes sont largement redessinées. Pendant cette période, la Suisse est touchée à la fois par les conflits européens et par des révoltes intérieures."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Lokomotiven_und_Triebwagen_der_SNCF","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/SNCF_BB_16008_Gare_du_Nord.JPG","page_title":"Liste der Lokomotiven und Triebwagen der SNCF","context_page_description":"Die Liste der Lokomotiven und Triebwagen der SNCF beinhaltet alle Triebfahrzeuge der Société nationale des chemins de fer français. Die SNCF bezeichnet ihre Lokomotiven nach Achsfolge sowie einer laufenden Seriennummer. Diese wird für jede Baureihe mit einer neuen 100er oder 1000er Stelle angefangen."},{"page_url":"https://tl.wikipedia.org/wiki/Palarong_Olimpiko_sa_Tag-init_2020","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Sapporo_Dome_moving_pitchjpg.jpg","page_title":"Palarong Olimpiko sa Tag-init 2020","context_page_description":"Ang Palarong Olimpiko sa Tag-Init 2020, na opisyal na kilala bilang Palaro ng Ika-XXXII Olimpiyada at karaniwang kilala bilang Tokyo 2020, ay isang pandaigdigang palarong pampalakasan na itinakdang gaganapin sa lungsod ng Tokyo, Hapon. Ang mga palaro ay unang itinakdang gaganapin mula 24 Hulyo – 9 Agosto 2020, ngunit bilang tugon sa pandemyang COVID-19, ipinahayag ng Pandaigdigang Lupong Olimpiko at ng kumiteng tagapag-ayos ng Lungsod ng Tokyo noong 24 Marso 2020 na ang palaro ay ipagpapaliban hanggang 2021, at gaganapin ng hindi tatagal sa tag-init ng 2021. Ang palaro ay tatawagin at kikilalanin pa rin bilang Tokyo 2020, bagama't may pagbabago sa iskedyul. Napagkasunduan ng IOC at ng kumiteng tagapag-ayos ng lungsod ang mga bagong petsa para sa palaro noong 30 Marso 2020. Ayon sa nabuong palatuntunan, bubuksan ang palaro sa 23 Hulyo 2021, habang ang pagsasara ay magaganap sa ika-8 ng Agosto. Ang kasunod na Palaro sa Taglamig sa Beijing naman ay nakatakdang buksan sa 4 Pebrero 2022, anim na buwan matapos itong palaro.\\nNahalal ang lungsod na ito noong 7 Setyembre 2013 sa ika-125 sesyon ng Pandaigdigang Lupong Olimpiko sa Buenos Aires, Arhentina."},{"page_url":"https://hu.wikipedia.org/wiki/Abigail_Sciuto","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Pauley_Perrette_cropped.jpg","page_title":"Abigail Sciuto","context_page_description":"Abigail \\"Abby\\" Sciuto az NCIS című filmsorozat szereplője, akit Pauley Perrette alakít. Magyar hangja: Böhm Anita."},{"page_url":"https://en.wikipedia.org/wiki/Interstate_15_in_Arizona","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/61/Cedarpkt.jpg","page_title":"Interstate 15 in Arizona","context_page_description":"Interstate 15 is an Interstate Highway, running from San Diego, California, United States, to the Canada–US border, through Mohave County in northwest Arizona. Despite being isolated from the rest of Arizona, in the remote Arizona Strip, and short in length at 29.43 miles, it remains notable for its scenic passage through the Virgin River Gorge. The highway heads in a northeasterly direction from the Nevada border northeast of Mesquite, Nevada, to the Utah border southwest of St. George, Utah.\\nThe south portion of I-15's route was built close to the alignment of the old U.S. Route 91, but the northern section, through the Virgin River Gorge, was built along roadless terrain. The southern section of the highway was complete and open in the early 1960s, but the gorge section was inaccessible until 1973. When it opened, the Virgin River Gorge passage was the most expensive section of rural Interstate per mile."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_kamen%C5%AF_zmizel%C3%BDch_v_Plze%C5%88sk%C3%A9m_kraji","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Stolperstein_f%C3%BCr_Otto_Gutmann_%28Su%C5%A1ice%29.jpg","page_title":"Seznam kamenů zmizelých v Plzeňském kraji","context_page_description":"Seznam kamenů zmizelých v Plzeňském kraji obsahuje pamětní kameny obětem nacismu na území Plzeňského kraje. Jsou součástí celoevropského projektu Stolpersteine německého umělce Guntera Demniga. Kameny zmizelých jsou věnovány osudu těch, kteří byli nacisty deportováni, vyhnáni, zavražděni nebo spáchali sebevraždu.\\nKameny zmizelých se zpravidla nacházejí před posledním místem pobytu obětí."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E4%BB%A5%E5%AE%9E%E7%8E%9B%E5%88%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Navez_Agar_et_Isma%C3%ABl.jpg","page_title":"以实玛利","context_page_description":"以实玛利，基督新教译作以实玛利；天主教译作依市玛耳；伊斯兰教译作易司马仪，按照塔纳赫与古兰经记载。"},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A8%D8%A7%D9%88%D9%89_%D9%86%D8%A7%D8%B3%D8%AA%D9%88%D9%84%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Pawe%C5%82_Nastula_1998.jpg","page_title":"باوى ناستولا","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nباوى ناستولا لاعب جودو من بولندا."},{"page_url":"https://hu.wikipedia.org/wiki/T%C3%B6r%C3%B6korsz%C3%A1g","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Anzer_yaylas%C4%B1.JPG","page_title":"Törökország","context_page_description":"Törökország állam, amelynek területe kisebbik részben Európában, nagyobbik részben Ázsia délnyugati részén fekszik. A Fekete-tenger és a Földközi-tenger között elhelyezkedő Anatóliai-félsziget alkotja az ország fő területét. Északról Grúzia és Örményország, keletről Irán és egy kis részen az Azerbajdzsánhoz tartozó Nahicseván, délről Irak és Szíria, míg nyugatról az Égei-tenger szigetei, Görögország és Bulgária határolja.\\nTörökország kultúrája az ország különleges, európai-ázsiai fekvésének és történelmének köszönhetően igen változatos, ötvözi a keleti és a nyugati tradíciókat. Földrajzi fekvésének köszönhetően az ország mind politikailag, mind gazdaságilag fontos stratégiai pontnak számít.\\nTörökország demokratikus, szekuláris, az alkotmánya szerint magát nemzetállamként meghatározó ország, de élnek más kisebbségek is az ország területén. 1923. október 29. óta köztársaság. Politikai rendszerének alapjai Mustafa Kemal Atatürk irányítása alatt az 1920-as és 30-as években szilárdultak meg, az Oszmán Birodalom felbomlása, illetve az első világháború után."},{"page_url":"https://fr.wikipedia.org/wiki/March%C3%A9_de_Provence","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Melons_de_Cavaillon_au_march%C3%A9_d%27Orange_01.jpg","page_title":"Marché de Provence","context_page_description":"Le marché de Provence est devenu l'un des symboles régionaux en Provence-Alpes-Côte d'Azur. C'est un événement marquant de la vie de la ville ou du village qui se présente comme une célébration de l’identité locale, une cérémonie collective dont chacun est à la fois acteur et spectateur, un lieu de rencontre où tout le monde est traité sur un pied d'égalité et dont personne n'est exclu. Deux principes régissent ce type de marché, le prix des marchandises est secondaire et tout doit rappeler le divertissement."},{"page_url":"https://sh.wikipedia.org/wiki/Rimsko_Carstvo","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Statue-Augustus.jpg","page_title":"Rimsko Carstvo","context_page_description":"Rimsko Carstvo je uobičajeni naziv za rimsku državu nakon što ju je preustrojio Oktavijan August u zadnja tri desetljeća prije Krista.\\nIako je Rim imao imperij stoljećima prije Augustove samovlade, predaugustovska država se obično naziva Rimskom Republikom.\\nRimsko Carstvo je upravljalo svim heleniziranim državama na Sredozemlju, kao i keltskim područjima sjeverne Europe.\\nZadnji zapadni rimski car zbačen je 476. godine, ali tada je istočnim područjima već vladao drugi car sa sjedištem u Konstantinopolu.\\nIstočno Rimsko Carstvo i dalje je postojalo, iako se postupno smanjivalo, sve do 1453. godine, kad su Turci osvojili Konstantinopolj.\\nKasnije države na zapadu i na istoku koristile su rimsko državničko nazivlje sve do modernog doba.\\nGolemo naslijeđe Rimskog Carstva vidi se i danas u zapadnjačkim institucijama, pravu, arhitekturi i mnogim drugim područjima života. Vidi i: Rimska kultura,\\nIstočno rimsko carstvo"},{"page_url":"https://ce.wikipedia.org/wiki/%D0%93%D0%BB%D0%B5%D0%BD%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Glaignes_%2860%29%2C_vue_sur_le_village_depuis_l%27ouest.jpg","page_title":"Глень","context_page_description":"Глень — Францин гӀала-коммуна, лаьтта О-де-Франс регионехь. Коммунан департамент — Уаза. Кхузахь климат барамехь ю, аьхка йовха хуьлу, ткъа Ӏа барамехь-шийла хуьлу. ГӀалин бахархой французаш бу. Официалан Французийн мотт бу."},{"page_url":"https://be.wikipedia.org/wiki/%D0%90%D0%BD%D0%B4%D1%80%D1%8D%D0%B0%D1%81_%D0%9C%D1%91%D0%BB%D0%B5%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Andreas_M%C3%B6ller.jpg","page_title":"Андрэас Мёлер","context_page_description":"Андрэас Мёлер — нямецкі футбаліст, паўабаронца. Чэмпіён свету 1990 у складзе нацыянальнай зборнай ФРГ."},{"page_url":"https://en.wikipedia.org/wiki/Telangana_State_Southern_Power_Distribution_Company_Limited","image_url":"http://upload.wikimedia.org/wikipedia/en/9/9a/TSSPDCL_Map.png","page_title":"Telangana State Southern Power Distribution Company Limited","context_page_description":"The Southern Power Distribution Company of Telangana or TSSPDCL is the Electricity Distribution company owned by the government of Telangana for the five southern districts of Telangana."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%82%AB%E3%83%B3%E3%83%88%E3%82%B9%E3%83%86%E3%82%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Acanthostega_gunnari_-_head.JPG","page_title":"アカントステガ","context_page_description":"アカントステガ は3億6,500万年前のデボン紀後期フィメニアンのグリーンランドに生息していた原始的な四肢動物であり、陸上生活に完全に適した四肢動物と肉鰭綱の間にあたる。絶滅種。イクチオステガと同時代に生きていたが、より原始的な特徴を持っていた。1933年にスウェーデンのグンナル・セヴェセダーベリとエリク・ヤルヴィクによって頭骨の一部分だけが発見され、頭蓋骨板後部の板状骨にある角状の突起から「棘の鎧」を意味する学名を与えられた。その後1987年に保存状態の良好な化石がグリーンランド東部においてジェニファー・クラックによって発見され、一気に研究が進んだ。"},{"page_url":"https://ar.wikipedia.org/wiki/%D9%84%D8%A7%D9%86%D9%8A%D9%86%D8%A8%D9%88%D8%B1%D8%BA_(%D9%85%D8%A7%D8%B3%D8%A7%D8%AA%D8%B4%D9%88%D8%B3%D8%AA%D8%B3)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Lunenburg_Town_Hall_and_Hadwen_Park_Market%2C_Lunenburg_MA.jpg","page_title":"لانينبورغ (ماساتشوستس)","context_page_description":"لانينبورغ ‏ هي بلدة أمريكية تقع في الولايات المتحدة في مقاطعة ووستر (ماساتشوستس). يقدر عدد سكانها بـ 10,086 نسمة ومساحتها 71.7 كم² وترتفع عن سطح البحر 155 متر."},{"page_url":"https://fr.wikipedia.org/wiki/Chapelle_Notre-Dame-des-Fontaines_de_La_Brigue","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/La_Brigue_-_Chapelle_Notre-Dame-des-Fontaines_-4.JPG","page_title":"Chapelle Notre-Dame-des-Fontaines de La Brigue","context_page_description":"La chapelle Notre-Dame-des-Fontaines est une chapelle catholique située en France dans une vallée montagneuse à 5 kilomètres du village médiéval de La Brigue, dans le département des Alpes-Maritimes."},{"page_url":"https://fr.wikipedia.org/wiki/Hwan_sud-cor%C3%A9en","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/01/100_hwan_531218_obverse.jpg","page_title":"Hwan sud-coréen","context_page_description":"Le hwan était la monnaie de la Corée du Sud du 15 février 1953 au 9 juin 1962 et était géré par la banque de Corée. Il a été introduit en remplacement du premier won sud-coréen qui avait trop souffert de l'inflation. Bien que celle-ci ralentisse, la dévaluation se poursuit avec le hwan. Son taux de change avec le dollar US passe de 60 hwans pour 1 dollar lors de son introduction à 180 hwans/$ le 15 décembre 1953, 500 hwans/$ le 15 aout 1955, 650 hwans/$ le 23 février 1960, 1000 hwans/$ le 1ᵉʳ janvier 1961 et finalement 1250 hwans/$ le 2 février 1961. Peu après, il est remplacé par le deuxième won sud-coréen à un taux de 1 won pour 10 hwans. Les pièces de 10 et 50 hwans sont restées en circulation jusqu'au 22 mars 1975."},{"page_url":"https://pl.wikipedia.org/wiki/Ramnefjellsfossen","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Kjenndalen.jpg","page_title":"Ramnefjellsfossen","context_page_description":"Ramnefjellsfossen – trzystopniowy wodospad w pobliżu miasta Stryn w Norwegii. Całkowita wysokość wodospadu wynosi 818 metrów, co czyni go 2 najwyższym wodospadem Europy, po Kjelfossen oraz 7 na świecie."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%BD%D0%BE%D0%B3%D0%BE%D0%BB%D0%B5%D1%82%D0%BD%D0%B8%D0%B5_%D1%81%D0%B5%D1%80%D0%B8%D0%B8_%D0%BA%D0%BE%D0%BC%D0%BC%D0%B5%D0%BC%D0%BE%D1%80%D0%B0%D1%82%D0%B8%D0%B2%D0%BD%D1%8B%D1%85_%D0%BC%D0%B0%D1%80%D0%BE%D0%BA_%D0%A1%D0%A1%D0%A1%D0%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Stamp_Soviet_Union_1931_374.png","page_title":"Многолетние серии коммеморативных марок СССР","context_page_description":"Как известно, почтовые марки одной серии могут иметь разные даты выпуска. Знаки почтовой оплаты с ясными серийными признаками оформления объединяют в единые серии независимо от года выпуска.\\nМноголе́тняя се́рия, или се́рия, выпуска́вшаяся в тече́ние не́скольких лет, — серия почтовых марок, выпуски которой появлялись в течение двух или более лет по датам выпусков. Другими словами, в датах выпусков формально присутствуют по крайней мере два разных года. При этом в каталоге марок имеется соответствующий текст. Многолетние серии обычно больше обычных, однолетних.\\nОсобый интерес представляют отдельные крупные серии, выпуск которых осуществляется на протяжении нескольких лет. Таких серий не так много. Еще более редки очень большие многолетние серии, которые носят специальное название перманентных.\\nМноголетние серии могут быть важной составной частью структуры каталогов почтовых марок, как это имеет место, например, у каталогов японских марок Сакура, JSCA и JSDA. В этих каталогах перманентные серии даже выделены в отдельные разделы, например, 1-я и 2-я перманентные серии национальных парков."},{"page_url":"https://id.wikipedia.org/wiki/Yesaya_36","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Book_of_Isaiah_Chapter_37-3_%28Bible_Illustrations_by_Sweet_Media%29.jpg","page_title":"Yesaya 36","context_page_description":"Yesaya 36 adalah bagian dari Kitab Yesaya dalam Alkitab Ibrani dan Perjanjian Lama di Alkitab Kristen. Berisi Firman Allah yang disampaikan oleh nabi Yesaya bin Amos tentang Yehuda dan Yerusalem. Nabi ini hidup pada zaman raja Uzia, Yotam, Ahas dan Hizkia dari Kerajaan Yehuda sekitar abad ke-8 SM."},{"page_url":"https://sw.wikipedia.org/wiki/Historia_ya_Ufaransa","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Anonymous_-_Prise_de_la_Bastille.jpg","page_title":"Historia ya Ufaransa","context_page_description":"Historia ya Ufaransa inahusu eneo ambalo siku hizi linaunda Jamhuri ya Ufaransa."},{"page_url":"https://en.wikipedia.org/wiki/List_of_highways_numbered_528","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Ontario_Highway_528.png","page_title":"List of highways numbered 528","context_page_description":"The following highways are numbered 528:"},{"page_url":"https://sv.wikipedia.org/wiki/Asplenium_macraei","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Starr_030405-0357_Asplenium_macraei.jpg","page_title":"Asplenium macraei","context_page_description":"Asplenium macraei är en svartbräkenväxtart som beskrevs av William Jackson Hooker och Grev. Asplenium macraei ingår i släktet Asplenium och familjen Aspleniaceae. Inga underarter finns listade."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%8C%80%ED%95%9C%EB%AF%BC%EA%B5%AD%EC%9D%98_%EC%9D%B8%EA%B5%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/South_Korea_1955_09_01.png","page_title":"대한민국의 인구","context_page_description":"대한민국의 인구는 1949년 정부수립 직후 2000만 명, 1967년에 3000만 명, 1983년에 4000만 명, 2012년에 5000만 명을 넘었다.\\n인구피라미드 유형은 유소년인구가 감소하고, 노년인구가 증가함에 따라 인구 구조가 1950~70년대 '피라미드형', 1980~2000년대 '종형', 2010년대 이후로는 초저출산 심화에 따라 '항아리형' 내지 '역피라미드형'으로 변화하고 있다."},{"page_url":"https://cs.wikipedia.org/wiki/Jan_Byrtus","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Beskydy_-_Ko%C5%A1a%C5%99iska._r._1967.jpg","page_title":"Jan Byrtus","context_page_description":"Jan Byrtus byl český fotograf."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9D%D0%BE%D1%80%D0%B8%D0%BB%D1%8C%D1%81%D0%BA%D0%B0%D1%8F_%D1%83%D0%BB%D0%B8%D1%86%D0%B0_(%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Norilsk_Street_%28Moscow%29_01.JPG","page_title":"Норильская улица (Москва)","context_page_description":"Нори́льская улица — улица на северо-востоке Москвы, в Лосиноостровском районе Северо-восточного административного округа. Находится между улицей Коминтерна и Стартовой улицей. Названа по заполярному городу Норильск в связи с расположением улицы в северной части Москвы. До 1964 года — Лесная улица бывшего подмосковного города Бабушкин."},{"page_url":"https://hr.wikipedia.org/wiki/Kota%C4%8D","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d4/Berry_Schools%27_Old_Mill%2C_Floyd_County%2C_Georgia.jpg","page_title":"Kotač","context_page_description":"Kotač, točak ili kolo je mehanička naprava okretanjem koje se omogućuje izvršenje nekog rada uz primjenu manje sile. Tako je na primjer sila trenja vozila pri kotrljanju znatno manja od sile trenja vozila koje kliže podlogom. Par ili niz kotača različita promjera, u međusobnom dodiru ili posredno, preko remena ili užeta, omogućuje prijenos sile u najpovoljnijem iznosu. Primijenjen kao zamašnjak, kotač svojom tromošću ujednačuje nejednolike pogonske sile, čime je rad stroja ili uređaja mirniji, a učinkovitost sustava povećana. Naziva se još i kolo, a osim s prijevoznim sredstvima, razvoj kotača povezan je i s iskorištenjem vodene energije, te za obavljanje različitih poslova. Svrstava se među takozvane jednostavne strojeve, na načelima kojih počiva rad svih današnjih strojeva pa je time i jedan od najznačajnijih tehničkih izuma čovječanstva.\\nKotač može biti jednostavan, u obliku kružne ploče, ili sastavljen od glavine, oglavlja i vijenca. U glavini se nalazi ležaj osovine ili je osovina čvrsto usađena u glavinu. Oglavlje spaja glavinu s vijencem, a može biti izrađeno kao ploča, ili sastavljeno od nekoliko masivnih radijalnih krakova ili od većega broja tankih žičanih žbica."},{"page_url":"https://en.wikipedia.org/wiki/Borovsky_District","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Flag_of_Borovsky_rayon_%28Kaluga_oblast%29.png","page_title":"Borovsky District","context_page_description":"Borovsky District is an administrative and municipal district, one of the twenty-four in Kaluga Oblast, Russia. It is located in the north of the oblast. The area of the district is 759.6 square kilometers. Its administrative center is the town of Borovsk. Population: 61,401; 54,661; 53,698. The population of Borovsk accounts for 20.0% of the district's total population."},{"page_url":"https://ms.wikipedia.org/wiki/Blake_Lively","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Blake_Lively_2010-tweaked_%28cropped%29.jpg","page_title":"Blake Lively","context_page_description":"Blake Lively ialah seorang pelakon dan model Amerika Syarikat. Beliau membintangi sebagai Serena van der Woodsen dalam drama CW Gossip Girl dan telah membintangi filem-filem seperti The Sisterhood of the Traveling Pants, Accepted, The Private Lives of Pippa Lee, The Town, Green Lantern, Savages dan The Age of Adaline."},{"page_url":"https://de.wikipedia.org/wiki/Saalekreis","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Wappen_Schkopau_bis_2004.png","page_title":"Saalekreis","context_page_description":"Der Saalekreis ist ein Landkreis in Sachsen-Anhalt, der im Zuge der zweiten Kreisgebietsreform am 1. Juli 2007 aus dem Saalkreis und dem Landkreis Merseburg-Querfurt entstand."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_Frankfurt-Altstadt","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Stolpersteine_Kurt-Schumacher-Stra%C3%9Fe_35.jpg","page_title":"Liste der Stolpersteine in Frankfurt-Altstadt","context_page_description":"Die Liste der Stolpersteine in Frankfurt am Main führt die vom Künstler Gunter Demnig verlegten Stolpersteine in Frankfurt am Main auf. Die Initiative Stolpersteine in Frankfurt am Main e. V. hat seit November 2003 die Verlegung von fast 1500 Stolpersteinen veranlasst. Die Initiative wird von der Stadt Frankfurt sowie von zahlreichen Institutionen, darunter das Jüdische Museum und das Institut für Stadtgeschichte unterstützt. Mehr Stolpersteine als in Frankfurt gibt es nur in Berlin, Hamburg und Köln.\\nIn der Zeit des Nationalsozialismus wurden 10.231 Juden aus Frankfurt am Main von der Großmarkthalle als Sammelpunkt deportiert. Davon wurden rund 9.500 ermordet. Bei der Verlegung im Oktober 2018 in Frankfurt wurde der siebzigtausendste Stein verlegt.\\nDie Stadtteile sind nach der Liste der Stadtteile von Frankfurt am Main angelegt. Die Ortsteile ohne Verlinkung haben keine Stolpersteine."},{"page_url":"https://en.wikipedia.org/wiki/Trias_(plant)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Trias_picta_Orchi_002.jpg","page_title":"Trias (plant)","context_page_description":"Trias is a genus of orchids native to the Indian Subcontinent, Indochina, Borneo and the Andaman & Nicobar Islands. It is abbreviated as Trias in horticultural trade.\\nSpecies accepted as of June 2014:\\nTrias antheae J.J.Verm. & A.L.Lamb - Sabah\\nTrias bonaccordensis C.S.Kumar - Kerala\\nTrias cambodiana Christenson - Cambodia\\nTrias disciflora Rolfe - Arunachal Pradesh, Laos, Vietnam\\nTrias intermedia Seidenf. & Smitinand - Thailand\\nTrias mollis Seidenf. - Thailand\\nTrias nana Seidenf. - Thailand\\nTrias nasuta Stapf - Arunachal Pradesh, Thailand, Myanmar, Vietnam\\nTrias nummularia Aver. & Averyanova - Vietnam\\nTrias oblonga Lindl. - West Bengal, Assam, Bangladesh, Thailand, Myanmar, Andaman & Nicobar Islands\\nTrias picta C.S.P.Parish ex Hemsl. - Thailand, Myanmar\\nTrias rosea Seidenf. - Thailand, Myanmar\\nTrias stocksii Benth. ex Hook.f. - India\\nTrias tothastes J.J.Wood in J.J.Wood & P.J.Cribb - Borneo"},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89pinay-sur-Seine","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Terroir_de_Stains-Pierrefitte-Villetaneuse-Epinay.jpg","page_title":"Épinay-sur-Seine","context_page_description":"Épinay-sur-Seine est une commune française, située dans le département de la Seine-Saint-Denis en région Île-de-France. Elle se trouve à l'extrémité occidentale du département, à la limite des Hauts-de-Seine et du Val-d'Oise. Ses habitants sont appelés les Spinassiens."},{"page_url":"https://pl.wikipedia.org/wiki/Keeway","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/31/Keeway.JPG","page_title":"Keeway","context_page_description":"Keeway - marka motoryzacyjna chińskiej produkcji Qianjiang Group, założona w 1999, zarejestrowana w Europie z siedzibą na Węgrzech w mieście Szentendre. Keeway to organizacja prowadząca własne badania nad rozwojem produktów, projektowaniem, sprzedażą oraz obsługą skuterów, motocykli i innych produktów mechanicznych. W 2005 roku Keeway przejął włoską firmę Benelli. Keeway swoje silniki wzoruje na uznanej firmie Minarelli."},{"page_url":"https://sk.wikipedia.org/wiki/Podkov%C3%A1r_ve%C4%BEk%C3%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Greater_Horseshoe_Bat_area.png","page_title":"Podkovár veľký","context_page_description":"Podkovár veľký je druh netopiera z rodu podkovár."},{"page_url":"https://es.wikipedia.org/wiki/Steve_Gadd","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Steve_Gadd.jpg","page_title":"Steve Gadd","context_page_description":"Stephen Kendall \\"Steve\\" Gadd es un baterista de estudio y concierto estadounidense. Ha trabajado junto a artistas destacados tales como Paul McCartney, Paul Simon, Steely Dan, Al Jarreau, Joe Cocker, Stuff, Bob James, Chick Corea, Eric Clapton, James Taylor, Jim Croce, Eddie Gomez, The Manhattan Transfer, Michal Urbaniak, Steps Ahead, Al Di Meola, Manhattan Jazz Quintet, Richard Tee, Alex Acuña chet baker y muchos otros."},{"page_url":"https://fr.wikipedia.org/wiki/Shell_Building","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/71/Shell_Building.jpg","page_title":"Shell Building","context_page_description":"Le Shell Building est un gratte-ciel de style néogothique et Art déco de 115 mètres de hauteur construit à San Francisco en 1929.\\nIl abrite des bureaux sur 29 étages.\\nL'immeuble a été construit en 300 jours ce qui est très peu.\\nL'entrée du hall en mezzanine à deux étages comporte des portes en bronze, des murs de marbre, un plafond de 7,6 mètres de hauteur ainsi que des détails ornementaux. Les planchers de bureaux ont été conçus avec des cloisons mobiles. La partie supérieure de la façade du bâtiment est décorée de terre cuite vitrée sépia et comporte des représentations de coquilles en référence au propriétaire initial du bâtiment.\\nLa compagnie Shell a quitté l'immeuble dans les années 1960.\\nEn 1994 les propriétaires du bâtiment ont été récompensés du Prix du patrimoine architectural de San Francisco pour l'excellence de la restauration extérieure."},{"page_url":"https://es.wikipedia.org/wiki/Jos%C3%A9_Gonzalvo_Vives","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Spain.Barcelona.Art.Public.Codi.2036-1.Los_aragoneses_a_Goya.B.jpeg","page_title":"José Gonzalvo Vives","context_page_description":"José Gonzalvo Vives fue un escultor español, nacido en Rubielos de Mora en 1929 y fallecido en Valencia el 22 de noviembre de 2010."},{"page_url":"https://en.wikipedia.org/wiki/Armorial_of_Norway","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Coat_of_arms_of_the_Norwegian_Chief_of_Defence.png","page_title":"Armorial of Norway","context_page_description":"This is an incomplete list of Norwegian coats of arms. Today most municipalities and all counties have their own coats of arms. Many Norwegian military units and other public agencies and some private families have coats of arms."},{"page_url":"https://en.wikipedia.org/wiki/Incheon_National_University","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/%EC%82%B0%ED%95%99%ED%98%91%EB%A0%A5%EB%8B%A8%EC%9D%B4_%EC%9C%84%EC%B9%98%ED%95%9C_%EC%9D%B8%EC%B2%9C%EB%8C%80_%EB%AF%B8%EB%9E%98%EA%B4%80.JPG","page_title":"Incheon National University","context_page_description":"Incheon National University, previously also known as University of Incheon, is a national university operated by the legal entity established by the government of Republic of Korea.\\nINU was first founded as a private college known as the Incheon Technical College in January 1979. Later, it was renamed Incheon College in December 1979 before getting promoted to a comprehensive university in 1988. In 1994, the university was renamed once again to University of Incheon, which was a city council funded university. In addition to these changes, INU also relocated from Dohwa-dong in Nam-gu to a new location in 2009. Now, INU stands in the new and young international city of Songdo which is also known as the New Songdo City, located in IFEZ. A year later, in 2010, INU merged with Incheon City College to expand capacity and open more curricula. The university now operates two campuses at Songdo, main campus, and also at Dohwa-dong, satellite campus.\\nFrom January 2013, the university was rechartered as one of Flagship Korean National Universities in South Korea, representing Gyeonggi Province and Incheon city."},{"page_url":"https://azb.wikipedia.org/wiki/%DA%A9%D8%A7%D9%BE%D9%86%D8%A7","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a6/Via_Fausto_Cecconi.jpg","page_title":"کاپنا","context_page_description":"کاپنا ایتالیا اؤلکه‌سینده بیر یاشاییش منطقه‌سی‌دیر. سوْن نۆفوس ساییمی اساسيندا ۹٬۳۳۶ نفر ایمیش. دنیز سوُلاری سَویه‌سیندن ۱۶۰ متر یۇکسک‏لیکده یئر آلیب. و لاتزیا اوستانیندا دا یئرلشیب."},{"page_url":"https://en.wikipedia.org/wiki/Dewey_Decimal_Classification","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/1885_Decimal_LibraryBureau.png","page_title":"Dewey Decimal Classification","context_page_description":"The Dewey Decimal Classification, colloquially the Dewey Decimal System, is a proprietary library classification system first published in the United States by Melvil Dewey in 1876. Originally described in a four-page pamphlet, it has been expanded to multiple volumes and revised through 23 major editions, the latest printed in 2011. It is also available in an abridged version suitable for smaller libraries. OCLC, a non-profit cooperative that serves libraries, currently maintains the system and licenses online access to WebDewey, a continuously updated version for catalogers.\\nThe Decimal Classification introduced the concepts of relative location and relative index which allow new books to be added to a library in their appropriate location based on subject. Libraries previously had given books permanent shelf locations that were related to the order of acquisition rather than topic. The classification's notation makes use of three-digit numbers for main classes, with fractional decimals allowing expansion for further detail. Numbers are flexible to the degree that they can be expanded in linear fashion to cover special aspects of general subjects."},{"page_url":"https://nn.wikipedia.org/wiki/Ledbury","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/LedburyMarketHouse.JPG","page_title":"Ledbury","context_page_description":"Ledbury er ein by i Herefordshire i England. Byen ligg aust for Hereford og sør for Malvern Hills.\\nI dag er Ledbury ein kjøpstad i det landlege England. Byen har ei lang rekke trebygninger som står langs Church Lane. Ein av dei flottaste bygningane i Ledbury er Market House, som ligg i sentrum av byen."},{"page_url":"https://pl.wikipedia.org/wiki/Wie%C5%BCe_ci%C5%9Bnie%C5%84_we_Wrze%C5%9Bni","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Wie%C5%BCa_ci%C5%9Bnie%C5%84_PWiK_1.JPG","page_title":"Wieże ciśnień we Wrześni","context_page_description":"Wieże ciśnień we Wrześni – we Wrześni w przeszłości znajdowały się trzy wieże ciśnień. Do chwili obecnej zachowały się dwie z nich."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/La_M%C3%A9zi%C3%A8re","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/50/Map_commune_FR_insee_code_35177.png","page_title":"La Mézière","context_page_description":"La Mézière sī ūi-tī Hoat-kok Bretagne toā-khu Ille-et-Vilaine séng ê chi̍t ê commune."},{"page_url":"https://fr.wikipedia.org/wiki/Grupo_Aerom%C3%B3vil_de_Fuerzas_Especiales_del_Alto_Mando","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/OldGAFE.jpg","page_title":"Grupo Aeromóvil de Fuerzas Especiales del Alto Mando","context_page_description":"Force Spéciale de Réaction, est une unité des forces spéciales mexicain appartenant à l'armée de terre mexicaine et dépendant du Corps des forces spéciales.\\nSa fonction première est la sécurité nationale et le contre-terrorisme pour protéger la sécurité du Mexique en cas de menaces étrangères ou internes. Il a également été nécessaire de capturer et d'éliminer les leaders des cartels de la drogue les plus recherchés par le Mexique et ses alliés.\\nSes principales tâches vont de l'action directe à la guerre non conventionnelle, l'unité étant à l'origine inspirée par des unités antiterroristes telles que le SAS britannique, le CAG des États-Unis et le 1ᵉʳ RPIMa de l'armée française."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%98%BF%E5%A1%9E%E6%8B%9C%E7%96%86-%E4%BA%9A%E7%BE%8E%E5%B0%BC%E4%BA%9A%E6%88%98%E4%BA%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Azeri_army_soldiers.jpg","page_title":"阿塞拜疆-亚美尼亚战争","context_page_description":"亞塞拜然-亞美尼亞戰爭在1917年俄國革命後開始，是1918年，1920至1922年的一系列慘烈、難以歸類的戰鬥的總稱。多數戰役都沒有固定的模式，沒有標準的軍隊結構。鄂圖曼帝國和大英帝國也以不同立場捲入：鄂圖曼人在穆德洛斯停戰協定後離開了該地區，但英國人一直保持影響直到1920年代鄧斯特部隊被迫撤離。不同的勢力在哈薩克、贊格祖爾、納希切萬以及卡拉巴赫這些爭議地區發生衝突。由於游擊隊和准游擊隊的使用，造成大量平民傷亡，這些傷亡在建立新國家的過程中發生。直到現在，衝突的原因仍有爭議。\\n此戰爭的過程有不同的表述，亞美尼亞歷史學家稱亞美尼亞民主共和國希望納希切萬和占賈東南部都納入葉里溫省。"},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%AA%E0%AF%8B%E0%AE%9A%E0%AF%8D%E0%AE%9A%E0%AE%AE%E0%AF%8D%E0%AE%AA%E0%AE%B3%E0%AF%8D%E0%AE%B3%E0%AE%BF_%E0%AE%AA%E0%AF%81%E0%AE%9F%E0%AE%B5%E0%AF%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Hermann_Linde_-_Girl_standing_in_a_veranda_wearing_a_Pochampalli_sari_%28ca.1895%29.jpg","page_title":"போச்சம்பள்ளி புடவை","context_page_description":"போச்சம்பள்ளி சேலை அல்லது போச்சம்பள்ளி இகாட் என்பது இந்தியாவின் தெலுங்கானா மாநிலத்தில் உள்ள யாதத்ரி புவனகிரி மாவட்டம், பூதன் போச்சம்பள்ளியில் தயாரிக்கப்பட்ட சேலை வகையாகும். இப்புடவைகள் இகாட் பாணியில் சாயமிடுவதில் பாரம்பரிய வடிவியல் வடிவங்கள் பின்பற்றப்படுகின்றன. அழகிய வேலைப்பாடுகள் அமைஆ வடிவியல் வடிவமைப்புகள் புடவைகள் மற்றும் துணி வகைகள் தனித்துவம் பெற்று விளங்குகின்றன. இந்திய அரசாங்கத்தின் அரசு விமான நிறுவனமான ஏர் இந்தியாவின் கேபின் குழுவினர் சிறப்பாக வடிவமைக்கப்பட்ட போச்சம்பள்ளி பட்டுப் புடவைகளை அணிந்துள்ளனர்."},{"page_url":"https://fr.wikipedia.org/wiki/Cheval_en_Norv%C3%A8ge","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Norsk_fjordhingst_%2801%29.jpg","page_title":"Cheval en Norvège","context_page_description":"Le cheval en Norvège est surtout symbolisé par la race locale du Fjord. Le secteur équestre norvégien comporte une importante industrie de courses de trot attelé. Il se distingue par un développement important de l'équitation de loisir au début du XXIᵉ siècle, une pratique essentiellement féminine."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D1%8E%D1%82%D0%B0_(%D1%80%D0%B5%D0%BA%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Ayuta_River_20130325112018.JPG","page_title":"Аюта (река)","context_page_description":"Аюта́, ба́лка Аюта́ — река в Ростовской области России, правый и крупнейший приток реки Грушевки. Длина 47 км, площадь водосбора 318 км². Питается подземными водами. Наиболее обильные источники расположены к северу от села Аюта."},{"page_url":"https://zh.wikipedia.org/wiki/2013%E5%B9%B4%E4%BA%BF%E4%B8%87%E5%AF%8C%E7%BF%81%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Bill_Gates_in_WEF%2C_2007.jpg","page_title":"2013年亿万富翁列表","context_page_description":"《福布斯》杂志于2013年3月4日发布了2013年全球亿万富翁排行榜，墨西哥卡洛斯·斯利姆·埃卢以730亿美元资产连续第四年蝉联首富宝座，美国的比尔·盖茨和阿曼西奥·奥尔特加分别以670亿美元和570亿美元列二三位，而沃伦·巴菲特则以535亿美元排名第四。这是自2000年以来巴菲特首次被挤出前三甲。尽管如此，巴菲特的财富在去年增加了95亿美元，在所有上榜富豪中位居第二。相比之下，巴西富豪埃克·巴蒂斯塔的财富缩水最严重，减少了194亿美元，从去年的第七掉至第100位。在2013版列表中，李嘉诚排名第8，居华人首位。宗庆后排名第86，居中国内地首位。"},{"page_url":"https://vi.wikipedia.org/wiki/Thuy%E1%BA%BFt_%C4%91%E1%BB%99c_th%E1%BA%A7n","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Western_Wall_In_Old_City_Of_Jerusalem_%2829460529014%29.jpg","page_title":"Thuyết độc thần","context_page_description":"Độc thần giáo hay nhất thần giáo, là niềm tin vào sự tồn tại của một Đấng tối cao duy nhất và có uy quyền phổ quát, hay là tin vào sự duy nhất của Thượng đế. Oxford Dictionary of the Christian Church còn đưa ra một định nghĩa chặt chẽ hơn là: \\"niềm tin vào một Thượng đế có vị cách và siêu việt\\", đối lập với đa thần giáo và phiếm thần giáo.\\nĐộc thần giáo được phân biệt với đơn nhất thần giáo, thờ một thần linh trong khi không phủ nhận rằng người khác có thể thờ các thần linh khác với hiệu lực ngang bằng, và bái nhất thần giáo, thờ nhất quán một thần linh duy nhất dù công nhận sự tồn tại của nhiều thần linh khác nhau.\\nThông thường, tất cả các tôn giáo khởi nguồn từ Abraham đều được xem là độc thần giáo. Theo nghĩa rộng, các tôn giáo độc thần còn bao gồm thần giáo tự nhiên, Hỏa giáo, Mandae giáo, Yazidi giáo, Thiên Đạo giáo, đạo Cao Đài và một số giáo phái thuộc Ấn Độ giáo."},{"page_url":"https://en.wikipedia.org/wiki/Jorma_Kinnunen","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Jorma-Kinnunen-1965.jpg","page_title":"Jorma Kinnunen","context_page_description":"Jorma Vilho Paavali Kinnunen was an athlete from Finland who competed mainly in the javelin throw. He was born in Pihtipudas.\\nHe competed for Finland in the 1968 Summer Olympics held in Mexico City, Mexico in the javelin throw where he won the silver medal.\\nOn 18 June 1969 Kinnunen threw a world record 92,70m in javelin at Tampere stadium, Finland.\\nKinnunen was the father of Kimmo Kinnunen, a world champion javelin thrower. He also had a daughter, Sanna Kinnunen, and another son, Jarkko Kinnunen, who died on 23 February 2019.\\nKinnunen died after a long illness on 25 July 2019, aged 77."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A5%D1%80%D0%B0%D0%BC_%D0%A3%D1%81%D0%BF%D0%B5%D0%BD%D0%B8%D1%8F_%D0%9F%D1%80%D0%B5%D1%81%D0%B2%D1%8F%D1%82%D0%BE%D0%B9_%D0%91%D0%BE%D0%B3%D0%BE%D1%80%D0%BE%D0%B4%D0%B8%D1%86%D1%8B_(%D0%9A%D0%BE%D0%BD%D1%81%D1%82%D0%B0%D0%BD%D1%82%D0%B8%D0%BD%D0%BE%D0%B2%D0%BE)_(%D0%92%D0%BE%D1%81%D0%BA%D1%80%D0%B5%D1%81%D0%B5%D0%BD%D1%81%D0%BA)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/%D0%A5%D1%80%D0%B0%D0%BC_%D0%A3%D1%81%D0%BF%D0%B5%D0%BD%D0%B8%D1%8F_%D0%9F%D1%80%D0%B5%D1%81%D0%B2%D1%8F%D1%82%D0%BE%D0%B9_%D0%91%D0%BE%D0%B3%D0%BE%D1%80%D0%BE%D0%B4%D0%B8%D1%86%D1%8B_%D0%B2_%D1%81%D0%B5%D0%BB%D0%B5_%D0%9A%D0%BE%D0%BD%D1%81%D1%82%D0%B0%D0%BD%D1%82%D0%B8%D0%BD%D0%BE%D0%B2%D0%BE_%D0%92%D0%BE%D1%81%D0%BA%D1%80%D0%B5%D1%81%D0%B5%D0%BD%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD%D0%B0_%D0%9C%D0%BE%D1%81%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%BE%D0%B9_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D0%B8_05.jpg","page_title":"Храм Успения Пресвятой Богородицы (Константиново) (Воскресенск)","context_page_description":"Храм Успения Пресвятой Богородицы в селе Константиново, Воскресенского района — Воскресенское благочиние Московской епархии."},{"page_url":"https://fr.wikipedia.org/wiki/Praskolesy","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Praskolesy%2C_01.jpg","page_title":"Praskolesy","context_page_description":"Praskolesy est une commune du district de Beroun, dans la région de Bohême-Centrale, en Tchéquie. Sa population s'élevait à 908 habitants en 2020."},{"page_url":"https://sv.wikipedia.org/wiki/Nepenthes_murudensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Murud_N._murudensis.jpg","page_title":"Nepenthes murudensis","context_page_description":"Nepenthes murudensis är en tvåhjärtbladig växtart som beskrevs av Culham, Jebb och Martin Roy Cheek. Nepenthes murudensis ingår i släktet Nepenthes och familjen Nepenthaceae. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A2%D0%BE%D1%80%D1%80%D0%B5-%D0%B4%D0%B5%D0%BB%D1%8C-%D0%93%D1%80%D0%B5%D0%BA%D0%BE","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/02/Torre_del_greco_porto.jpg","page_title":"Торре-дель-Греко","context_page_description":"Торре-дель-Греко, Торре-дель-Ґреко — місто та муніципалітет в Італії, у регіоні Кампанія, метрополійне місто Неаполь.\\nТорре-дель-Греко розташоване на відстані близько 210 км на південний схід від Рима, 14 км на південний схід від Неаполя.\\nНаселення — 86 793 особи.\\nЩорічний фестиваль відбувається 8 грудня та 19 вересня. Покровитель — Beata Vergine Maria."},{"page_url":"https://pnb.wikipedia.org/wiki/%D9%88%DB%8C%D9%86%DA%A9%D9%88%D9%88%D8%B1","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/47/Vancouver_Location.png","page_title":"وینکوور","context_page_description":"وینکوور بریٹیش کولمبیا، کینیڈا دی مکھ دھرتی اتے اک ساحلی بندرگاہی شہر ہے۔ میٹرو وینکوور دی آبادی دو لکھ توں ودھ ہے۔ اتھے وکھ-وکھ سبھیاچاراں نال تعلق رکھدے لوک رہندے ہن۔"},{"page_url":"https://ms.wikipedia.org/wiki/Hradec_(Daerah_Havl%C3%AD%C4%8Dk%C5%AFv_Brod)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Hradec_CoA.jpg","page_title":"Hradec (Daerah Havlíčkův Brod)","context_page_description":"Hradec merupakan sebuah kampung dan kawasan perbandaran yang terletak di daerah Havlíčkův Brod, wilayah Vysočina, Republik Czech."},{"page_url":"https://pl.wikipedia.org/wiki/Bazylika_Ecce_Homo","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/PikiWiki_Israel_13396_Ecce_Homo_arch.JPG","page_title":"Bazylika Ecce Homo","context_page_description":"Bazylika Ecce Homo, znajduje się przy Via Dolorosa w Jerozolimie, w miejscu gdzie według Nowego Testamentu i tradycji, Jezus Chrystus został ukazany tłumowi przez Poncjusza Piłata ze słowami: \\"Ecce Homo\\"."},{"page_url":"https://eu.wikipedia.org/wiki/Franco_Battiato","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0c/F_Battiato.jpg","page_title":"Franco Battiato","context_page_description":"Franco Battiato kantugilea eta abeslaria da. Abeslari ospetsuentzako kantak egin zituen hasieran, baina gero bere diskoak grabatzen hasi zen. Battiatoren lehen diskoak oso espresionistak ziren: Festus eta Pollution. Gero, musika sofistikatuagoa eta esperimentalagoa egin zuen: Sulle corde di Aries eta Mademoiselle La Gladiator. 1980ko hamarraldian, arrakasta handiko diskoak plazaratu zituen: L'era del Cinghiale Bianco, Patriots, La voce del padrone eta L'Arca di Noè. Musika elektronikoko diskoak ere grabatu ditu, hala nola Clic. Rocka eta musika klasikoa nahasten dituzten opera batzuk egin ditu: Genesi eta Gilgamesh. Hala ere, pop musika egiten jarraitu zuen. 1995ean Il cavaliere dall'intelletto diskoa argitaratu zuen, Manlio Sgalambró filosofoaren letrekin. Beste disko batzuk: L'imboscata, Gommalacca, Campi magnetici, Ferro battuto, Dieci stratagemmi, Il vuoto, Fleurs 2, Inneres Auge."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%81%D8%B1%D8%A7%D9%86%D9%83%D9%86%D8%A8%D8%B1%D8%BA_(%D9%87%D8%B3%D9%86)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Luftbild_Frankenberg.jpg","page_title":"فرانكنبرغ (هسن)","context_page_description":"فرانكنبرغ هي بلدة، مدينة و بلدة ألمانية تقع في ألمانيا في Waldeck-Frankenberg."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D1%83%D1%85%D0%BE%D0%BF%D1%83%D1%82%D0%BD%D1%96_%D0%B2%D1%96%D0%B9%D1%81%D1%8C%D0%BA%D0%B0_%D0%91%D0%BE%D0%BB%D0%B3%D0%B0%D1%80%D1%96%D1%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Rank_insignia_of_%D0%93%D0%B5%D0%BD%D0%B5%D1%80%D0%B0%D0%BB-%D0%BC%D0%B0%D0%B9%D0%BE%D1%80_of_the_Bulgarian_Army.png","page_title":"Сухопутні війська Болгарії","context_page_description":"Сухопутні війська Болгарії — наземний компонент, найбільший за чисельністю вид збройних сил Збройних сил Болгарії, призначений для ведення активних бойових дій на сухопутних театрах воєнних дій.\\nОдин з трьох видів Збройних сил Болгарії, разом з військово-морськими та повітряними силами."},{"page_url":"https://vi.wikipedia.org/wiki/Coradion_altivelis","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Coradion_altivelis%2C_Osezaki.jpg","page_title":"Coradion altivelis","context_page_description":"Coradion altivelis, thường được gọi là cá bướm vây cao, là một loài cá biển thuộc chi Coradion trong họ Cá bướm. Loài này được mô tả lần đầu tiên vào năm 1916."},{"page_url":"https://de.wikipedia.org/wiki/Demir-Baba-Tekke","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Demir_Baba_Teke_Ehtrance.JPG","page_title":"Demir-Baba-Tekke","context_page_description":"Die Demir-Baba-Tekke ist ein alianisches Mausoleum aus dem 16. Jahrhundert nahe dem Dorf Sweschtari, im Munizip Isperich in der Provinz Rasgrad im nordöstlichen Bulgarien. Als Teil der historischen und archäologischen Stätte Sborjanowo ist die Demir-Baba-Tekke eines der 100 touristischen Objekte Bulgariens."},{"page_url":"https://sv.wikipedia.org/wiki/Dendrothrips_ornatus","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Dendrothrips_ornatus_UGA1243099.jpg","page_title":"Dendrothrips ornatus","context_page_description":"Dendrothrips ornatus är en insektsart som först beskrevs av Jablonowski 1894. Dendrothrips ornatus ingår i släktet Dendrothrips och familjen smaltripsar. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D0%B0%D0%BF%D0%BD%D0%BE%D0%B5_(%D0%BE%D0%B7%D0%B5%D1%80%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/%D0%9E%D0%B7%D0%B5%D1%80%D0%BE_%D0%A0%D0%B0%D0%BF%D0%BD%D0%BE%D0%B5.JPG","page_title":"Рапное (озеро)","context_page_description":"Рапное — озеро, расположенное на территории Славянского горсовета. Площадь — 0,32 км². Тип общей минерализации — солёное. Происхождение — провальное. Группа гидрологического режима — бессточное.\\nЯвляется гидрологическим памятником природы общегосударственного значения, согласно постановлению Совета Министров УССР № 780-р от 14 октября 1975 года. Озеро и памятник природы расположены в границах регионального ландшафтного парка Славянский курорт."},{"page_url":"https://de.wikipedia.org/wiki/Schritth%C3%B6he","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Jeans.jpg","page_title":"Schritthöhe","context_page_description":"Im Schneiderhandwerk bemisst sich die passende Länge der Hosenbeine nach der Schritthöhe. Sie wird oft auch unzutreffend als Schrittlänge bezeichnet. Gemessen wird diese von der Innenseite des Schrittansatzes bis zur Unterkante Hosenbein. An der fertigen Hose ist die Schritthöhe identisch mit der Länge der Innennaht, einer der beiden Nähte, mit denen der vordere und der hintere Zuschnitt eines Hosenbeins zusammengenäht werden. Bei Jeans wird dieses Maß als inseam length bezeichnet.\\nBeim Fahrrad ist die Schritthöhe maßgebend für die Wahl der Rahmengröße und die Einstellung der optimalen Sattelhöhe, wird jedoch direkt am Menschen gemessen. Bei etwa schulterbreitem Stand ist es der Abstand vom Boden bis zum Damm. Daraus ergibt sich für die Sattelhöhe: 0,88 × Schritthöhe = Abstand vom Sattel zum Tretlager.\\nBeim klassischen Straßenrennrad mit waagrechtem Oberrohr wird angenommen, dass es überwiegend auf ebenen Wegen gefahren wird, weshalb nur wenig \\"Luft\\" zwischen Oberrohroberseite und Damm gefordert wird."},{"page_url":"https://fr.wikipedia.org/wiki/Myrmecia_vindex","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Myrmecia_vindex_102013_casent0907095_p_1_high.jpg","page_title":"Myrmecia vindex","context_page_description":"Myrmecia vindex est une espèce de fourmi originaire d'Australie. Les plus fortes populations de cette fourmi géante se trouvent dans le sud-ouest du pays.\\nL'espèce est décrite pour la première fois en 1858."},{"page_url":"https://simple.wikipedia.org/wiki/Elizabeth_Arden","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Elizabeth_Arden_NYWTS.jpg","page_title":"Elizabeth Arden","context_page_description":"Florence Nightingale Graham, better known as Elizabeth Arden, was a Canadian–American business woman who founded what is now known as Elizabeth Arden, Incorporated. She built a cosmetics network in the United States. At the peak of her career, she became one of the richest women in the world. She was born next to Woodbridge in the Province of Ontario."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B1%D9%88%D8%AF_%DA%AF%D8%A7%DA%AF%D8%B1%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Karnali_river.JPG","page_title":"رود گاگرا","context_page_description":"رودخانه گاگرا یا رود کارنالی رودی دائمی است که در نپال و هند جریان دارد. سرچشمه این رودخانه نزدیک دریاچه ماناساروار در منطقه خودمختار تبت قرار دارد و به رودخانه گنگ می‌ریزد."},{"page_url":"https://sco.wikipedia.org/wiki/Toyota","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Toyota_Headquarter_Toyota_City.jpg","page_title":"Toyota","context_page_description":"Toyota Motor Corporation Japanese: トヨタ自動車株式会社; Toyota Jidōsha Kabushiki-gaisha, commonly kent simply as Toyota an abbreviated as TMC, is a multinational corporation headquartered in Japan. In 2016, Toyota employed 348,877 fowk warldwide. TMC is the warld's lairgest automobile maker bi sales an production."},{"page_url":"https://sk.wikipedia.org/wiki/Hru%C5%A1ka_oby%C4%8Dajn%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Pyrus_communis_a1.jpg","page_title":"Hruška obyčajná","context_page_description":"Hruška obyčajná je opadavý listnatý strom z čeľade Ružovité. Pochádza z oblasti strednej a východnej Európy a juhozápadnej Ázie. Hruška obyčajná je jedným z najvýznamnejších ovocných stromov mierneho pásma, predovšetkým hlavne pre plody zvané hrušky. Cenné je tiež drevo hrušky obyčajnej. Hruška obyčajná patrí medzi dlhoveké stromy. Dorastá do výšky 20 metrov a dožíva sa do veku 300 rokov."},{"page_url":"https://de.wikipedia.org/wiki/Weingartener_Stifterb%C3%BCchlein","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Wgt_Stifterb%C3%BCchlein_47r.jpg","page_title":"Weingartener Stifterbüchlein","context_page_description":"Das Weingartener Stifterbüchlein ist eine illuminierte Handschrift, die wohl um 1510 für die Reichsabtei Weingarten in Oberschwaben hergestellt wurde. Der bedeutendste Teil der Sammelhandschrift sind 40 ganzseitige Idealporträts von Mitgliedern der Herrschergeschlechter der Welfen und Staufer."},{"page_url":"https://en.wikipedia.org/wiki/Outer_Hebrides","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Calanais_Standing_Stones_20090610_01.jpg","page_title":"Outer Hebrides","context_page_description":"The Outer Hebrides or Western Isles, sometimes known as Innse Gall or the Long Isle/Long Island, is an island chain off the west coast of mainland Scotland. The islands are geographically coextensive with Comhairle nan Eilean Siar, one of the 32 unitary council areas of Scotland. They form part of the archipelago of the Hebrides, separated from the Scottish mainland and from the Inner Hebrides by the waters of the Minch, the Little Minch, and the Sea of the Hebrides. Scottish Gaelic is the predominant spoken language, although in a few areas English speakers form a majority.\\nMost of the islands have a bedrock formed from ancient metamorphic rocks and the climate is mild and oceanic. The 15 inhabited islands have a total population of 26,830 and there are more than 50 substantial uninhabited islands. From Barra Head to the Butt of Lewis is roughly 210 kilometres.\\nThere are various important prehistoric structures, many of which pre-date the first written references to the islands by Roman and Greek authors."},{"page_url":"https://it.wikipedia.org/wiki/Jawa_(azienda)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Jawa_750.jpg","page_title":"Jawa (azienda)","context_page_description":"La Jawa è una casa motociclistica ceca, la più antica ancora in attività. Fu fondata nel 1929 dall'ing. František Janeček; il suo nome deriva infatti dalle iniziali di Janeček e di Wanderer, azienda che cedette la licenza alla Jawa per alcuni tipi di motore.\\nLa prima sede fu una fabbrica nel quartiere Pankrác di Praga e nel 1931 venne costruita una fabbrica anche a Týnec nad Sázavou.\\nTra il 1934 e il 1941 la Jawa produsse anche modelli di automobili tra i quali la Jawa 700 e la Jawa Minor I."},{"page_url":"https://ceb.wikipedia.org/wiki/Lenzkirch_(kapital_sa_munisipyo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Lenzkirch_Kirche_Rathaus.jpg","page_title":"Lenzkirch (kapital sa munisipyo)","context_page_description":"Kapital sa munisipyo ang Lenzkirch sa Alemanya. Nahimutang ni sa distrito nga gobyerno sa Freiburg Region ug estado pederal sa Baden-Württemberg Region, sa habagatang bahin sa nasod, 600 km sa habagatan-kasadpan sa Berlin ang ulohan sa nasod. 810 metros ibabaw sa dagat kahaboga ang nahimutangan sa Lenzkirch, ug adunay 5,111 ka molupyo.\\nAng yuta palibot sa Lenzkirch kay kasagaran kabungtoran, apan sa sidlakan nga kini mao ang patag. Lenzkirch nahimutang sa usa ka walog. Ang kinahabogang dapit sa palibot dunay gihabogon nga 1,085 ka metro ug 1.5 km sa habagatan sa Lenzkirch. Ang kinadul-ang mas dakong lungsod mao ang Titisee-Neustadt, 5.9 km sa amihanan sa Lenzkirch. Sa rehiyon palibot sa Lenzkirch, kabukiran, ug mga lasang talagsaon komon.\\nHapit nalukop sa lasang nga sagolsagol ang palibot sa Lenzkirch. Dunay mga 166 ka tawo kada kilometro kwadrado sa palibot sa Lenzkirch medyo hilabihan populasyon. Ang klima baybayon. Ang kasarangang giiniton 6 °C. Ang kinainitan nga bulan Hulyo, sa 16 °C, ug ang kinabugnawan Enero, sa -6 °C. Ang kasarangang pag-ulan 1,644 milimetro matag tuig. Ang kinabasaan nga bulan Hulyo, sa 191 milimetro nga ulan, ug ang kinaugahan Marso, sa 60 milimetro."},{"page_url":"https://en.wikipedia.org/wiki/Reykjav%C3%ADk_Cathedral","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Domkirkjan-Reykjav%C3%ADk-Iceland-20030526.jpg","page_title":"Reykjavík Cathedral","context_page_description":"Reykjavík Cathedral is a cathedral church in Reykjavík, Iceland, the seat of the Bishop of Iceland and mother church of the Evangelical Lutheran Church of Iceland, as well as the parish church of the old city centre and environs. It is located at Austurvöllur, and next to it is Alþingishúsið. Since Iceland's parliament, the Alþingi, was resurrected in 1845, each session of parliament has begun with a Mass at the cathedral, and from there the dean of the cathedral leads the members of parliament to the parliament house.\\nThe organ boasts three manuals and thirty-one independent voices and was built in Berlin by Karl Schuke GmbH."},{"page_url":"https://fr.wikipedia.org/wiki/Cap_de_Sable","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2a/Southern_tip_of_Nova_Scotia%2C_showing_Cape_Sable_Island.png","page_title":"Cap de Sable","context_page_description":"L'île du Cap de Sable est une petite île au sud de la Nouvelle-Écosse."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%8Ele_d%27Orl%C3%A9ans","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Raccoon_climbing_in_tree_clipped.jpg","page_title":"Île d'Orléans","context_page_description":"L'île d'Orléans est une île du fleuve Saint-Laurent située à environ 5 km en aval sur le fleuve Saint-Laurent à l'est du centre-ville de la ville de Québec. L'île a été l'un des premiers endroits à être colonisé en Nouvelle-France, et un grand pourcentage des Canadiens français peuvent retracer leur ascendance aux premiers habitants de l'île. Elle a été décrite comme le « microcosme du Québec traditionnel et le lieu de naissance des francophones en Amérique du Nord » et compte environ 7 000 habitants, répartis sur 6 villages. L'Île d'Orléans est jumelée avec Île de Ré en France.\\nL'île est accessible depuis le continent via le pont de l'Île-d'Orléans depuis Beauport. La route 368 est la seule route provinciale de l'île qui traverse le pont et fait le tour du périmètre de l'île. Au village de Sainte-Pétronille vers l'extrémité ouest de l'île, un belvédère surplombe l'impressionnante chute Montmorency, ainsi qu'un panorama du fleuve Saint-Laurent et de la ville de Québec."},{"page_url":"https://fi.wikipedia.org/wiki/K%C3%A4ki","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Cuculus_canorus2.jpg","page_title":"Käki","context_page_description":"Käki on lintu, joka tunnetaan erityisesti luonteenomaisesta ääntelystään: kukkumisesta, joka mainitaan myös lukemattomissa kansanrunoissa ja lastenlauluissa. Vain uros kukkuu, naaras pilittää kiihtyvästi \\"pypypypypypy\\"."},{"page_url":"https://vi.wikipedia.org/wiki/Curtiss_BF2C_Goshawk","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/RTAF_Curtiss_BF2C_Goshawk.jpg","page_title":"Curtiss BF2C Goshawk","context_page_description":"Curtiss Model 67 BF2C-1 Goshawk & Model 68 Hawk III là một loại máy bay hai tầng cánh của Hải quân Hoa Kỳ trong thập niên 1930."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A7%D0%BE%D1%80%D1%82%D0%BE%D1%80%D0%B8%D0%B9%D1%81%D1%8C%D0%BA%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/%D0%AE%D0%B7%D0%B5%D1%84_%D0%86%D2%91%D0%BD%D0%B0%D1%86%D1%96%D0%B9_%D0%9A%D1%80%D0%B0%D1%88%D0%B5%D0%B2%D1%81%D1%8C%D0%BA%D0%B8%D0%B9._%D0%9A%D0%BB%D0%B5%D0%B2%D0%B0%D0%BD%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%B7%D0%B0%D0%BC%D0%BE%D0%BA.jpg","page_title":"Чорторийські","context_page_description":"Чорторийські, Чарториські, Чарторійські, Чарторийські — княжий рід литовсько-руського походження, згодом повністю полонізувався, з 1433 року князі Священної Римської Імперії.\\nЧорторийські походили від династії правителів Великого князівства Литовського Гедиміновичів. В ХХ ст. породнилися з Бурбонами й Габсбургами."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%B5%B7%E8%9B%9F%E5%A4%A7%E9%9A%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/USS_Decker_%28DE-47%29_off_the_Boston_Naval_Shipyard_on_30_August_1944_%2819-N-10567%29.jpg","page_title":"海蛟大隊","context_page_description":"海蛟大隊，是中華民國海軍轄下曾經存在的一支艦隊，主要由快速攻擊艇、飛彈快艇構成，為國軍制海反艦任務的重要角色；後因精粹案實施，海蛟大隊於2014年11月1日被裁併至海軍一三一艦隊。"},{"page_url":"https://fr.wikipedia.org/wiki/Svastika","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Laimas_krusts_Lielvardes_josta.jpg","page_title":"Svastika","context_page_description":"Le svastika ou swastika, 卐, mot sanskrit dérivé de su et de asti, avec la variante orthographique sauvastika parfois attribuée à son symétrique 卍, est un symbole que l'on retrouve en Europe, en Afrique, en Océanie, aux Amériques et en Asie jusqu'en Extrême-Orient. Il apparaît à l'époque néolithique pour la première fois dans la préécriture de la culture de Vinča. Cette ubiquité temporelle et spatiale lui a parfois valu le nom de « symbole universel ». On peut le décrire comme une croix composée de quatre potences prenant chacune la forme d'un gamma grec en capitale, d'où le nom de croix gammée qui lui est parfois donné.\\nLe symbole est actuellement utilisé en Asie et particulièrement en Inde. Dans l'hindouisme, il possède de nombreuses significations sacrées et il représente notamment le dieu Ganesh. Il est toujours un symbole omniprésent chez les bouddhistes. Il est le symbole premier du jaïnisme, considéré par ses adeptes comme le plus favorable de tous les symboles. En Chine, il symbolise l'éternité."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%9D%B0%E5%85%8B%E9%80%8A%E7%8E%AF%E5%BD%A2%E5%B1%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Jackson_sattelite_craters_map.jpg","page_title":"杰克逊环形山","context_page_description":"傑克遜環形山是月球背面北半球一座年輕的大型撞擊坑，約形成於哥白尼紀，其名稱取自蘇格蘭天文學家\\"約翰·傑克遜\\"，1970年被國際天文聯合會批准接受。"},{"page_url":"https://bs.wikipedia.org/wiki/Jim_Clark","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Jim_Clark_1965.jpg","page_title":"Jim Clark","context_page_description":"James Clark, je britanski vozač i dvostruki svjetski prvak Formule 1 u sezonama 1963. i 1965.\\nBio je svestran vozač i takmičio se u različitim takmičenjima i kategorijama, između ostalog i u 500 milja Indianapolisa koje je i osvojio 1965. godine. Do svoje smrti, bio je vozač sa najviše osvojenih utrka i treći vozač u historiji Formule 1 po osvojenom broju pole-pozicija, iza Schumachera i Senne. U 2009. godini, The Times je izabrao Jamesa Clarka u sami vrh liste najvećih vozača Formula 1 ikada.\\nPoginuo je 1968. godine u utrci Formule 2 na stazi u njemačkom Hockenheimu."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%B0%B4%E7%94%B0%E9%A7%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Mizuta_stn.jpg","page_title":"水田駅","context_page_description":"水田駅は、香川県高松市東山崎町にある高松琴平電気鉄道長尾線の駅。高松琴平電気鉄道では唯一の高架駅である。駅番号はN07。\\n水田姓を持つ偉人にちなんで命名されたと言う。\\nかつて平成初期までは朝のラッシュ時同駅始発の瓦町行上り列車も運行されていた。"},{"page_url":"https://en.wikipedia.org/wiki/Grand_Theatre,_Warsaw","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/09/6_Warszawa_095.jpg","page_title":"Grand Theatre, Warsaw","context_page_description":"The Grand Theatre in Warsaw, known in full as the Great Theatre—National Opera, is a theatre and opera complex situated on the historic Theatre Square in central Warsaw, Poland. The Warsaw Grand Theatre is home to the Polish National Ballet and is one of the largest theatrical venues in the world, with a seating capacity of over 2,000.\\nThe Warsaw Grand Theatre was inaugurated on 24 February 1833 with a production of Rossini's The Barber of Seville. After the building's bombing and near-complete destruction in World War II, it was rebuilt and reopened on 19 November 1965 after having been closed for over twenty years. The original building was designed in a neoclassical style by architects Antonio Corazzi and Chrystian Piotr Aigner, and later restored by Bohdan Pniewski."},{"page_url":"https://kk.wikipedia.org/wiki/VI_%D0%93%D0%B5%D0%BE%D1%80%D0%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/StateLibQld_1_67691_Their_Royal_Highnesses%2C_The_Duke_and_Duchess_of_York%2C_visit_Toowoomba%2C_1927.jpg","page_title":"VI Георг","context_page_description":"VI Георг — 1936 жылдың 11 желтоқсанынан бастап Ұлыбритания және Солтүстік Ирландия, Канада, Австралия мен Оңтүстік Африка бірлескен корольдігінің королі. Виндзорлар әулетінен шыққан. Ағасы Эдуард VII тақтан безгесін таққа отырды.Тарихта Ұлыбритания мен Британ империясының Екінші Дүниежүзілік соғыста нацистік Германияға қарсы күресушінің бейнесінде есте қалды. Георг король болып тұрған кезде Британ империясының ыдырап, Ұлттар достастығына айналды. Ол 1936 жылдың 12 желтоқсаннан бастап 1950 жылдың 26 қаңтарына дейін Үндістанның соңғы императоры, ал 1949 жылдың 29 сәуіріне дейін Ирландияның соңғы королі болды. Ол 1949 жылдың 29 сәуірінен бастап «Ұлттар достастығының» басшысы атағына ие болды."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D0%BE%D0%BB%D0%BE%D0%B2%D0%BD%D0%B8%D0%B9_%D0%B1%D1%96%D0%BB%D0%BE%D0%BA_vault","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2d/Protein_MVP_PDB_1y7x.png","page_title":"Головний білок vault","context_page_description":"Головний білок vault – білок, який кодується геном MVP, розташованим у людей на короткому плечі 16-ї хромосоми. Довжина поліпептидного ланцюга білка становить 893 амінокислот, а молекулярна маса — 99 327.\\nЦей білок за функцією належить до рибонуклеопротеїнів.\\nЗадіяний у таких біологічних процесах як транспорт, транспорт білків, транспорт мРНК, транслокація.\\nЛокалізований у цитоплазмі, ядрі, комплексі ядерної пори."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%BB%D0%BE%D1%89%D0%B0%D0%B4%D1%8C_%D0%98%D1%81%D0%BF%D0%B0%D0%BD%D0%B8%D0%B8_(%D0%A5%D0%B0%D0%B3%D0%B0%D1%82%D0%BD%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Chocolate_House_in_Hagatna.JPG","page_title":"Площадь Испании (Хагатна)","context_page_description":"Площадь Испания — площадь, расположенная в центральной части Хагатны, административного центра острова Гуам, где во времена испанского правления на Гуаме располагался дворец губернатора.\\nВ 1974 году площадь была введена в Национальный реестр исторических мест США."},{"page_url":"https://hy.wikipedia.org/wiki/(1301)_%D4%BB%D5%BE%D5%B8%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/1301Yvonne_%28Lightcurve_Inversion%29.png","page_title":"(1301) Իվոն","context_page_description":"(1301) Իվոն, աստերոիդ աստերոիդների հիմնական գոտում։ Հայտնաբերվել է 1934 թվականի մարտի 7-ին Լուի Բոյերի կողմից Ալժիրում։\\nՄիջին հեռավորությունը Արեգակից կազմում է 2,767467 ա. մ., առավելագույնը մոտենում է 2,0231 ա. մ. հեռավորության վրա և հեռանում 3,5118 ա. մ.։ Արեգակի շուրջ մեկ ամբողջական պտույտ է կատարում 1681,6 երկրային օրվա ընթացքում, իր ուղեծրով շարժվելով միջինում 0,214082 աստիճան/օր արագությամբ։ Աստերոիդի ուղեծրի և խավարածրի հարթությունները իրար հետ կազմում են 34,04° անկյուն։"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A5%D0%B0%D0%BD%D0%B4%D0%B7%D0%BE%D0%BC%D0%BE%D0%BD_(%D1%81%D1%82%D0%B0%D0%BD%D1%86%D0%B8%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/TokyoMetro-Z05-Hanzomon-station-platform-20190217-081532.jpg","page_title":"Хандзомон (станция)","context_page_description":"Станция Хандзомон — железнодорожная станция на линии Хандзомон, расположенная в специальном районе Тиёда в Токио. Станция обозначена номером Z-05. Станция расположена неподалёку от ворот Хандзомон Императорского дворца. На станции установлены автоматические платформенные ворота."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%86%E3%82%AA%E3%83%BB%E3%83%95%E3%82%A1%E3%83%B3%E3%83%BB%E3%83%AC%E3%82%A4%E3%82%BB%E3%83%AB%E3%83%99%E3%83%AB%E3%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Th%C3%A9o_van_Rysselberghe_by_Th%C3%A9o_van_Rysselberghe.jpg","page_title":"テオ・ファン・レイセルベルヘ","context_page_description":"テオ・ファン・レイセルベルヘはベルギーの画家である。"},{"page_url":"https://it.wikipedia.org/wiki/Rom_in_Italia","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Milano_Corso_di_Porta_Vittoria.jpg","page_title":"Rom in Italia","context_page_description":"I popoli romaní sono una minoranza etnica in Italia. La loro presenza varia dalle 90.000 alle 140.000 persone, di cui circa 70.000 con cittadinanza italiana, quindi circa lo 0,25% della popolazione italiana. I rom autoctoni sarebbero circa 45.000, mentre gli altri sarebbero di più recente arrivo da altri paesi europei. La maggior parte dei rom italiani è stanziale e urbana. Nei cosiddetti \\"campi nomadi\\", secondo il censimento del 2008, vivono in tutto 12.346 persone, tra le quali 5.436 minori."},{"page_url":"https://en.wikipedia.org/wiki/Notre_Dame_Cristo_Rey_High_School","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Notre_Dame_Cristo_Rey_High_School%2C_Lawrence_MA.jpg","page_title":"Notre Dame Cristo Rey High School","context_page_description":"Notre Dame Cristo Rey High School is a Roman Catholic high school in Lawrence, Massachusetts, United States, in the Roman Catholic Archdiocese of Boston. Founded 2004 by the Sisters of Notre Dame de Namur, it follows the Cristo Rey Network work-study model.\\nA $5-million renovation was completed in 2009. In 2011 the school received accreditation from the New England Association of Schools and Colleges.\\nNinety percent of the 274 students enrolled in 2015–2016 were Hispanic.\\nNotre Dame High School is a member of the Massachusetts Interscholastic Athletic Association, competing in boys' cross country, basketball, and baseball; girls' cross country, basketball, and softball."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E9%87%91%E6%97%A5%E6%88%90%E7%B6%9C%E5%90%88%E5%A4%A7%E5%AD%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Kim_Il-sung_University.jpg","page_title":"金日成綜合大學","context_page_description":"金日成綜合大學，簡稱金日成大學，係北韓一間公立大學，1946年創校，校址喺平壤，係朝鮮半島北部頭一間大學。"},{"page_url":"https://de.wikipedia.org/wiki/Pennsylvania","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Lackawanna_State_Forest.jpg","page_title":"Pennsylvania","context_page_description":"Pennsylvania ist ein von William Penn gegründeter Bundesstaat im Osten der Vereinigten Staaten von Amerika und einer ihrer dreizehn Gründerstaaten. Der offizielle Name ist Commonwealth of Pennsylvania. Gemeinsam mit New York und New Jersey wird Pennsylvania den Mittelatlantikstaaten zugerechnet.\\nDer Name bedeutet wörtlich „Waldland von Penn“. Pennsylvania trägt den Beinamen Keystone State."},{"page_url":"https://lt.wikipedia.org/wiki/Sinclair_ZX_Spectrum","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Zx_interface_1.png","page_title":"Sinclair ZX Spectrum","context_page_description":"ZX Spectrum – asmeninis kompiuteris, išleistas 1982 metais Sinclair Research kompanijos. Iš pradžių kompiuterio kodinis pavadinimas buvo ZX 82, tačiau vėliau, siekdamas pabrėžti mašinos galimybę atvaizduoti spalvas, Klaivo Sinklerio buvo pervadintas į ZX Spectrum.\\nSpectrum buvo pirmasis plačiai paplitęs namų kompiuteris Jungtinėje Karalystėje ir pagal reikšmę prilygo Commodore 64 sėkmei JAV. C64 tuo pačiu buvo pagrindinis konkurentas Spectrum kompiuteriui XX amžiaus devintojo dešimtmečio pradžioje."},{"page_url":"https://da.wikipedia.org/wiki/Chiron","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Palais_Bourbon%2C_Malerei_in_der_Kuppel_der_Poesie%2C_Szene-_Erziehung_des_Achill_%28Eug%C3%A8ne_Delacroix%29.jpg","page_title":"Chiron","context_page_description":"Cheiron er den vise og lægekyndige kentaur som opdrog Achilleus og Asklepios på bjerget Pelion i Thessalien. Han er desuden en af de få navngivne kentaurer. Cheiron blev senere ifølge mytologien forvandlet til stjernebilledet Kentauren."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AE%D8%B7%D9%88%D8%B7_%D9%81%D8%B1%D8%A7%D9%88%D9%86%D9%87%D9%88%D9%81%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Fraunhofer_lines.svg","page_title":"خطوط فراونهوفر","context_page_description":"خطوط فراونهوفر عبارة عن مجموعة من الخطوط الطيفية في طيف الشمس ناشئة عن الامتصاص الرنيني للغازات في الغلاف الضوئي للشمس. سميت هذه الخطوط نسبةً إلى عالم الفيزياء الألماني جوزيف فون فراونهوفر."},{"page_url":"https://en.wikipedia.org/wiki/Augustus_Frederic_Scott","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Attractive_house_-_geograph.org.uk_-_791372.jpg","page_title":"Augustus Frederic Scott","context_page_description":"Augustus Frederic Scott a Norwich-based Architect who was born in 1854 in the Breckland village of Rockland St Peter, Norfolk. His work included both civic and ecclesiastical buildings, in addition to several large hotels and many private commissions."},{"page_url":"https://en.wikipedia.org/wiki/Falkenstein_Castle_(Palatinate)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Falkenstein_Burg_Zisterne.jpg","page_title":"Falkenstein Castle (Palatinate)","context_page_description":"Falkenstein Castle is a ruined hill castle dating to the Middle Ages. It is situated above the eponymous village of Falkenstein on the Donnersberg, the highest point in the Palatinate region, which rises within the German state of Rhineland-Palatinate."},{"page_url":"https://no.wikipedia.org/wiki/Luke_Hemsworth","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Luke_Hemsworth_by_Gage_Skidmore.jpg","page_title":"Luke Hemsworth","context_page_description":"Luke Hemsworth er en australsk skuespiller. Han er best kjent for rollene sine som Nathan Tyson i TV-serien Naboer og som Ashley Stubbs i science fiction-serien Westworld.\\nHan er bror av Chris og Liam Hemsworth, alle skuespillere."},{"page_url":"https://ceb.wikipedia.org/wiki/Morgan_County_(kondado_sa_Tinipong_Bansa,_Georgia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Morgan_County_Georgia_Courthouse.jpg","page_title":"Morgan County (kondado sa Tinipong Bansa, Georgia)","context_page_description":"Kondado ang Morgan County sa Tinipong Bansa. Nahimutang ni sa estado sa Georgia, sa habagatan-sidlakang bahin sa nasod, 800 km sa habagatan-kasadpan sa Washington, D.C. Adunay 17,868 ka molupyo. Naglangkob kin og 919 ka kilometro kwadrado. Morgan County mopakigbahin sa usa ka utlanan sa Oconee County, Jasper County, Greene County, Putnam County, Newton County, ug Walton County ang ulohan sa nasod.\\nAng yuta sa Morgan County kay patag.\\nMga lungsod sa Morgan County:\\nMadison\\nRutledge\\nBostwick\\nBuckhead\\nSa mosunod nga mga natural nga mga bahin makita sa Morgan County:\\nMga suba:\\nApalachee River\\nBeaverdam Creek\\nBig Branch\\nBig Sandy Creek\\nBriar Creek\\nBucks Creek\\nCampbell Creek\\nFourmile Branch\\nGap Creek\\nGoose Creek\\nHard Labor Creek\\nHester Branch\\nHorse Branch\\nHunnicut Creek\\nJacks Creek\\nLittle Creek\\nLittle Indian Creek\\nLittle Sandy Creek\\nLittle Sugar Creek\\nLittle Sugar Creek\\nLong Branch\\nMile Branch\\nMountain Hill Branch\\nNorth Sugar Creek\\nPole Creek\\nRawlings Branch\\nRice Creek\\nRocky Creek\\nShoemaker Branch\\nSouth Sugar Creek\\nSpeeds Branch\\nStill Branch\\nSugar Creek\\nTurkey Creek\\nMga lanaw:\\nBird Lake\\nBowden Lake\\nBrown Lake\\nBruce Lake\\nCallaway Lake\\nCarmichael Lake\\nChambers Lake\\nErvin Lake\\nGreenway Lake"},{"page_url":"https://sv.wikipedia.org/wiki/Penicillaria_jocosatrix","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Penicillaria_jocosatrix_%2813386106865%29.jpg","page_title":"Penicillaria jocosatrix","context_page_description":"Penicillaria jocosatrix är en fjärilsart som beskrevs av Achille Guenée 1852. Penicillaria jocosatrix ingår i släktet Penicillaria och familjen nattflyn. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://en.wikipedia.org/wiki/Spanish_oiler_Cantabria","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2a/RAN-IFR_2013_D2_02.JPG","page_title":"Spanish oiler Cantabria","context_page_description":"Cantabria is a replenishment oiler operated by the Spanish Navy. Acquired to provide logistical support for the Spanish fleet, Cantabria was commissioned in 2010. Cantabria is the second-largest naval ship currently operated by the Spanish, behind Juan Carlos I."},{"page_url":"https://de.wikipedia.org/wiki/Togo","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Faure_Gnassingb%C3%A9_29112006.jpg","page_title":"Togo","context_page_description":"Togo ist ein Staat in Westafrika, am Golf von Guinea gelegen, und grenzt an Ghana im Westen, Benin im Osten und Burkina Faso im Norden. Hauptstadt und Regierungssitz ist Lomé.\\nDas Staatsgebiet von Togo umfasst den östlichen Teil der von 1884 bis 1916 bestehenden deutschen Kolonie Togo. Von 1916 bis 1960 war Togo Mandatsgebiet des Völkerbunds bzw. Treuhandgebiet der Vereinten Nationen unter französischer Verwaltung. Geprägt wurde das Land fast 40 Jahre lang vom autokratisch regierenden Präsidenten Gnassingbé Eyadéma. Nach dessen Tod 2005 wurde sein Sohn Faure Gnassingbé unter Missachtung der Verfassung von der togoischen Armee zum neuen Präsidenten ernannt. Internationaler Druck und Unruhen im Lande führten nicht zur Rückkehr verfassungsgemäßer Zustände. Die folgenden Wahlen konnte Gnassingbé für sich entscheiden, wobei ihm die Opposition und auch die Europäische Union massiven Wahlbetrug vorwarfen. Nach wie vor befinden sich mehrere tausend Flüchtlinge im Ausland. Im Index der menschlichen Entwicklung steht das Land auf dem 167. Platz von 189."},{"page_url":"https://nl.wikipedia.org/wiki/Ra%C4%8Dice-P%C3%ADstovice","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Znak_Ra%C4%8Dice-P%C3%ADstovice.jpg","page_title":"Račice-Pístovice","context_page_description":"Račice-Pístovice is een Tsjechische gemeente in de regio Zuid-Moravië, en maakt deel uit van het district Vyškov. Račice-Pístovice telt 1050 inwoners."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%B5%D0%BD-%D0%A4%D1%80%D0%BE%D0%BD_(%D0%A8%D0%B0%D1%80%D0%B0%D0%BD%D1%82%D0%B0)","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/be/Stfront16_eg1.JPG","page_title":"Сен-Фрон (Шаранта)","context_page_description":"Сен-Фрон — муніципалітет у Франції, у регіоні Нова Аквітанія, департамент Шаранта. Населення — 350 осіб.\\nМуніципалітет розташований на відстані близько 370 км на південний захід від Парижа, 80 км на південь від Пуатьє, 30 км на північ від Ангулема."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A4%D1%80%D0%BE%D0%BC%D0%B0%D0%BD%D1%82%D1%8C%D1%8E,_%D0%A5%D0%B5%D0%BD%D0%B4%D1%80%D0%B8%D0%BA_%D0%B4%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Henri_de_Fromantiou.jpg","page_title":"Фромантью, Хендрик де","context_page_description":"Хендрик де Фромантью — нидерландский художник XVII века."},{"page_url":"https://ru.wikipedia.org/wiki/The_Sun_Comes_Out_World_Tour","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Shakira_-_2011_Singapore_Grand_Prix_%2812%29.jpg","page_title":"The Sun Comes Out World Tour","context_page_description":"The Sun Comes Out World Tour — пятый концертный тур колумбийской певицы Шакиры, в поддержку её восьмого и девятого студийных альбомов, She Wolf и Sale el Sol. В рамках тура концерты проходили в Северной и Латинской Америках, Европе, Азии и Африке. Концерты в Латинской Америке Шакиры были организованы в рамках музыкального фестиваля The Pop Festival 2011 ежегодно проводимого в Южной Америке. В России певица выступила в Санкт-Петербурге 22 мая 2011 года в СКК Петербургский и в Москве 24 мая в СК Олимпийский, а 8 октября дала 40 минутное выступление в Киеве на открытии отреставрированного НСК Олимпийский."},{"page_url":"https://pl.wikipedia.org/wiki/Nissan_300ZX","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/CleanZ31.jpg","page_title":"Nissan 300ZX","context_page_description":"Nissan 300ZX – samochód sportowy, produkowany przez japoński koncern Nissan Motors w latach 1989–2000."},{"page_url":"https://en.wikipedia.org/wiki/Seppois-le-Haut","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Seppois-le-Haut%2C_Mairie.jpg","page_title":"Seppois-le-Haut","context_page_description":"Seppois-le-Haut is a commune in the Haut-Rhin department in Alsace in north-eastern France."},{"page_url":"https://vec.wikipedia.org/wiki/H%C3%A9ming","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Heming_eglise.JPG","page_title":"Héming","context_page_description":"Héming el xé on comun de 498 abitanti del departemento de Moselle che el fa parte del rejon Grand Est in Fransa."},{"page_url":"https://no.wikipedia.org/wiki/Kong_Karls_Land","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/da/Russia_-_Spitsbergen_-_Kong_Karls_Land.PNG","page_title":"Kong Karls Land","context_page_description":"Kong Karls Land er en øygruppe som utgjør en del av Svalbard. Øygruppen ligger i Barentshavet sørøst for Nordaustlandet. Øygruppen består av de tre øyene Svenskøya, Kongsøya og Abeløya samt en rekke mindre øyer, holmer og skjær. Det samlede arealet er 341,2 km². Den største av øyene er Kongsøya med sine 191 km².\\nErik Eriksen oppdaget øygruppen i 1853 fra et fjell på Edgeøya. Eriksen gikk i land på øygruppa som første mann den 27. juli 1859. Kong Karls land er et viktig hiområde for isbjørn. Kong Karls Land er en del av Nordaust-Svalbard naturreservat. Som i naturreservatet for øvrig er det ferdselsforbud på og nær øyene hele året.\\nMellom Svenskeøya og Kongsøya går Rivalensundet.\\nOmrådet er et svært viktig habitat for isbjørn. Det er ferdselsforbud på øya hele året, inkludert en 500 meter lang sone ut i sjøen regnet ved lavvann."},{"page_url":"https://sv.wikipedia.org/wiki/Azillanet","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Azillanet_St-Laurent.JPG","page_title":"Azillanet","context_page_description":"Azillanet är en kommun i departementet Hérault i regionen Occitanien i södra Frankrike. Kommunen ligger i kantonen Olonzac som tillhör arrondissementet Béziers. År 2009 hade Azillanet 415 invånare."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E5%B6%BA%E5%8D%97%E5%BB%BA%E7%AF%89","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5f/Chen_Clan_Academy_5.jpg","page_title":"嶺南建築","context_page_description":"嶺南建築（粵拼：Ling⁵ naam⁴ gin³ zuk¹）係嶺南主要族群－粵人－嘅建築風格。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Wasserf%C3%A4lle_in_Deutschland","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Allerheiligen_Wasserfall_im_Naturpark_Schwarzwald_Mitte-Nord%2C_Baden_W%C3%BCrttemberg%2C_Deutschland.jpg","page_title":"Liste der Wasserfälle in Deutschland","context_page_description":"Die meisten der Wasserfälle in Deutschland sind aufgrund der nur mäßig gebirgigen Topografie relativ klein. Sie werden daher in weltweiten Verzeichnissen und Rangordnungen, wenn überhaupt, in den hinteren Rängen gelistet. Hinsichtlich der Höhe gibt es jedoch bemerkenswerte Ausnahmen.\\nKaum vermeidbar ist, dass Art und Anzahl der erfassten Wasserfälle den regional nicht einheitlichen Gebrauch des Begriffs Wasserfall widerspiegeln. In Regionen mit eher gleichmäßig fließenden Gewässern können bereits Stellen rauschenden Weißwassers in ihrem Namen als Wasserfall bezeichnet sein. Kleinere Wasserfälle können in niedrigeren Mittelgebirgen Besonderheiten darstellen, dagegen in den Alpen oder auch im Schwarzwald unauffällig sein.\\nIn den Listen sind rund 500 Wasserfälle erfasst. Davon entfallen etwa 350 auf Bayern und Baden-Württemberg, wobei die Alpenregion und der Schwarzwald die größten Anteile haben."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B9%80%E0%B8%81%E0%B8%B2%E0%B8%B0%E0%B8%9E%E0%B8%B5%E0%B8%9E%E0%B8%B5%E0%B8%94%E0%B8%AD%E0%B8%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/KohPhiPhiDon_FromLookoutPoint.jpg","page_title":"เกาะพีพีดอน","context_page_description":"​\\nเกาะพีพีดอน เป็นเกาะที่ใหญ่ที่สุดในหมู่เกาะพีพี มีเนื้อที่ประมาณ 28 ตารางกิโลเมตร หรือ 17,500 ไร่ กว้าง 3.5 กิโลเมตร และยาว 8 กิโลเมตร บริเวณอ่าวต้นไทร ที่ตั้งอยู่ทางใต้ของเกาะ เป็นที่ตั้งของท่าเรือราว 2 กิโลเมตร มีหาดทรายสวยงาม น้ำใส บริเวณใจกลางของอ่าวต้นไทร เป็นศูนย์กลางการค้า โรงแรม/รีสอร์ท ส่วนอ่าวอื่นของเกาะเช่น อ่าวโละดาลัม, อ่าวรันตี, อ่าวโละบาเกา, อ่าวยงกาเส็ม, อ่าวโละลานะ, อ่าวนุ้ย และสถานที่ท่องเที่ยวอื่นของเกาะคือ แหลมตง ตั้งอยู่ทางด้านเหนือสุดของเกาะ มีโลกใต้ทะเลที่สวยงาม"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BF%D1%82%D0%B0%D1%85%D1%96%D0%B2_%D0%A0%D0%BE%D1%81%D1%96%D1%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/European_Stonechat.jpg","page_title":"Список птахів Росії","context_page_description":"Список птахів Росії включає близько 780 видів. Серед них ендеміки: дикуша азійська або кам'яний рябчик, казарка червоновола, журавель чорний, журавель білий, мартин рожевий, охотський і попелястий коловодники, лопатень, пісочники — великий, довгопалий, гострохвостий, кроншнеп-малятко, чирянка-квоктун, тинівка сибірська, дрізд Науманна, чечевиця сибірська, вівсянка жовтоброва і сибірський щеврик. Вимерлих або зниклих з території Росії — 7 видів і серед них: ібіс червононогий або японський.\\nВсього фауна птахів Росії включає 1334 географічні форми птахів. Сучасну гніздову фауну складають 657 видів. Близько 110 видів це зальотні птахи, що зустрічаються під час сезонних міграцій або на зимівлі.\\nТеги, що використовуються для виділення охоронного статусу кожного виду за оцінками МСОП:"},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_de_Strasbourg","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Maison_Sar%C3%A9_au_17_rue_du_D%C3%B4me_%C3%A0_Strasbourg.jpg","page_title":"Liste des monuments historiques de Strasbourg","context_page_description":"Ce tableau présente la liste de tous les monuments historiques de Strasbourg, classés ou inscrits."},{"page_url":"https://pt.wikipedia.org/wiki/London_Sinfonietta","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Marius_Neset_and_London_Sinfonietta_Kongsberg_Jazzfestival_2018_%28171602%29.jpg","page_title":"London Sinfonietta","context_page_description":"A London Sinfonietta é uma orquestra de câmara de Londres, especializada em música erudita contemporânea. Nicholas Snowman e David Atherton foram os seu fundadores em 1968.\\nA orquestra encomendou e estreou obras de compositores como Magnus Lindberg, Thomas Adès, Steve Reich ou Sir Harrison Birtwistle. Criou em 1969 The Whale de John Tavener. Interpretou Iannis Xenakis, Luciano Berio, Tansy Davies, Dai Fujikura, Jonny Greenwood, Django Bates, Kenneth Hesketh e Mark-Anthony Turnage."},{"page_url":"https://en.wikipedia.org/wiki/1994_Pacific_typhoon_season","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/1994_Amy_peak.jpg","page_title":"1994 Pacific typhoon season","context_page_description":"The 1994 Pacific typhoon season was an extremely active season in the annual cycle of tropical cyclone formation in the Western North Pacific, with a total of 32 tropical storms, where 19 of them reached typhoon strength, during the course of the season, much like the Pacific hurricane season. The season had no official bounds and it ran year-round in 1994, but most tropical cyclones tend to form in the northwestern Pacific Ocean between May and November. Tropical storms that formed west of the date line were assigned a name by the Joint Typhoon Warning Center. The World Meteorological Organization-designated Regional Specialized Meteorological Centre for tropical cyclones for the region is the Japan Meteorological Agency. Tropical depressions that entered or formed in the Philippine area of responsibility were assigned a name by the Philippine Atmospheric, Geophysical and Astronomical Services Administration or PAGASA. This resulted in some storms having two names."},{"page_url":"https://de.wikipedia.org/wiki/Arnswaldt_(Adelsgeschlecht)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Arnswaldt-Wappen_MK1922.jpg","page_title":"Arnswaldt (Adelsgeschlecht)","context_page_description":"Arnswaldt, auch Arnswald, seltener Arneswalt und Ahrenswald geschrieben, ist der Name eines thüringischen Uradelsgeschlechts mit dem gleichnamigen Stammhaus bei Stolberg im Harz. Die Familie ist eines Stammes und Wappens mit den ausgestorbenen von Ascherode und von Tüticherode. Einige Mitglieder der Familie führten seit dem ausgehenden 19. Jahrhundert den Titel Freiherr oder Baron."},{"page_url":"https://es.wikipedia.org/wiki/Miguel_Servet","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Servet_Christianismi_restitutio.gif","page_title":"Miguel Servet","context_page_description":"Miguel Servet, llamado también Miguel de Villanueva, Michel de Villeneuve o, en latín, Michael Servetus, cuyo nombre auténtico era Miguel Serveto y Conesa, alias «Revés», ​ fue un teólogo y científico español.\\nSus intereses abarcaron muchas ciencias: astronomía, meteorología, geografía, jurisprudencia, teología, física, el estudio de la Biblia, matemáticas, anatomía y medicina. Gran parte de su fama y reconocimiento posterior es debido a su trabajo sobre la circulación pulmonar descrita en su obra Christianismi Restitutio.\\nParticipó en la Reforma Protestante y desarrolló una cristología contraria a la Trinidad. Repudiado tanto por los católicos como por los protestantes, fue arrestado en Ginebra, sometido a juicio y condenado a morir en la hoguera por orden del Consejo de la ciudad y las iglesias Reformadas de los cantones, cuando en ella predominaba la influencia de Juan Calvino."},{"page_url":"https://de.wikipedia.org/wiki/Jab%C5%82o%C5%84ski-Schema","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Jablonski_Diagramm_Deutsch.png","page_title":"Jabłoński-Schema","context_page_description":"Das Jabłoński-Diagramm oder Jabłoński-Termschema veranschaulicht die möglichen Übergänge von Valenzelektronen in die verschiedenen Anregungszustände bei Einstrahlung von Licht und zurück. Es liefert eine anschauliche Darstellung für die Phänomene der Fluoreszenz und Phosphoreszenz, weshalb es für die UV/VIS-Spektroskopie eine große Rolle spielt."},{"page_url":"https://id.wikipedia.org/wiki/Richmond_Olympic_Oval","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Richmond_Olympic_Oval_front_view_2.jpg","page_title":"Richmond Olympic Oval","context_page_description":"Richmond Olympic Oval, atau disebut juga Richmond Oval adalah sebuah fasilitas di Richmond, British Columbia, Kanada. Tempat ini merupakan tempat pertandingan speed-skating dan laboratorium resmi Olimpic andi-doping untuk Olimpiade Musim Dingin 2010. Total biaya untuk proyek ini adalah $178 juta."},{"page_url":"https://ca.wikipedia.org/wiki/Tserkva_de_Sant_Miquel_Arc%C3%A0ngel","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/18/Brunary1%28js%29.jpg","page_title":"Tserkva de Sant Miquel Arcàngel","context_page_description":"La Tserkva de Sant Miquel Arcàngel és una església gòtica de l'any 1797, feta de fusta, situada al poble de Brunary, dins el districte de Gmina Uście Gorlickie, al sud de Polònia, a la frontera eslovaca. Amb d'altres tserkvas forma part del conjunt anomenat «Tserkvas de fusta de la Regió Carpàtica a Polònia i Ucraïna», llistat com a Patrimoni de la Humanitat de la UNESCO des de l'any 2013."},{"page_url":"https://id.wikipedia.org/wiki/Biul_slentek","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Javan_Ferret-badger.jpg","page_title":"Biul slentek","context_page_description":"Biul slentek adalah spesies mamalia kecil dalam keluarga Mustelidae. Hewan ini adalah endemik di Jawa dan Bali. Di Jawa Tengah, hewan ini disebut nyentek; sementara dalam bahasa Inggris dikenal sebagai Javan ferret-badger."},{"page_url":"https://fi.wikipedia.org/wiki/Luettelo_Turkin_presidenteist%C3%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Turkse_chef_Generale_staf_%28Generaal_Sunay%29%2C%2C_Bestanddeelnr_916-7535_%28cropped%29.jpg","page_title":"Luettelo Turkin presidenteistä","context_page_description":"Tämä on luettelo Turkin presidenteistä."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AD%E3%83%A3%E3%83%B3%E3%83%99%E3%83%AB%E9%83%A1_(%E3%83%90%E3%83%BC%E3%82%B8%E3%83%8B%E3%82%A2%E5%B7%9E)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Green_Hill_Plantation_Campbell_County_Virginia.jpg","page_title":"キャンベル郡 (バージニア州)","context_page_description":"キャンベル郡は、アメリカ合衆国バージニア州の中央部に位置する郡である。2010年国勢調査での人口は54,842人であり、2000年の51,078人から7.7%増加した。郡庁所在地は国勢調査指定地域のラストバーグであり、同郡で人口最大の町はやはり国勢調査指定地域のティンバーレイクである。郡名はアメリカ独立戦争時の将軍ウィリアム・キャンベルに因んで名付けられた。\\nキャンベル郡はリンチバーグ大都市圏に属している。"},{"page_url":"https://et.wikipedia.org/wiki/P%C3%A4%C3%A4stet%C3%B6%C3%B6d","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Kalap%C3%BC%C3%BCgileav_TB_kivi_otsas_75.jpg","page_title":"Päästetööd","context_page_description":"Päästetööd on toiming, tegevus ohuolukorras inimeste päästmiseks ja kaitsmiseks ning õnnetuste ja avariide tagajärgede likvideerimiseks.\\nPäästetöödeks kasutatakse muuhulgas tuletõrjemasinaid, helikoptereid, erikoolitusega päästekoeri ja -hobuseid ning mitmesuguseid hüdraulilisi päästeriistu avariilistest sõidukitest inimeste väljatoomiseks."},{"page_url":"https://cy.wikipedia.org/wiki/Wal_yr_Anifeiliaid","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Animal_Wall_1_Cardiff.jpg","page_title":"Wal yr Anifeiliaid","context_page_description":"Adeilad rhestredig Gradd I yng Nghaerdydd yw Wal yr Anifeiliad. Wal ydyw â phymtheg ceflun o anifeiliad a saif ar Stryd y Castell, rhwng canol y ddinas a Parc Bute. Safai yn wreiddiol o flaen Castell Caerdydd, ond fe'i symudwyd pan oedd rhaid lledaenu'r ffordd, ac ar yr adeg yma ychwanegwyd mwy o gerfluniau."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%BB%D1%8C%D0%B1%D0%B5%D1%80-%D0%95%D1%80%D0%BD%D0%B5%D1%81%D1%82_%D0%9A%D0%B0%D1%80%D1%80%27%D1%94-%D0%91%D0%B5%D0%BB%D0%BB%D0%B5%D0%B7","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/77/Caryatids_theatre_Renaissance.jpg","page_title":"Альбер-Ернест Карр'є-Беллез","context_page_description":"Альбер-Ернест Карр'є-Беллез — французький скульптор, представник натуралізму і салонного мистецтва."},{"page_url":"https://fr.wikipedia.org/wiki/Island_Line","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Isle_of_Wight_railway_system_showing_closed_lines_and_stations%2C_open_lines_and_reopened_lines.png","page_title":"Island Line","context_page_description":"Island Line est l'unique ligne de chemin de fer en activité de l'île de Wight. Longue de 8,5 miles, elle relie Ryde à Shanklin dans la partie est de l'île."},{"page_url":"https://cv.wikipedia.org/wiki/%D0%92%D0%BE%D1%80%D0%BA%D1%83%D1%82%D0%B0_(%D1%8E%D1%85%D0%B0%D0%BD%D1%88%D1%8B%D0%B2)","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/51/Vorkuta_river.JPG","page_title":"Воркута (юханшыв)","context_page_description":"Воркута — Раççей территоринчи юханшыв. Коми Республики, Ненец автономи тăрăхĕ территорипе юхать. Юханшыв Уса |Уса юханшыва юхса кĕрет. Юханшыв тăршшĕ 182 км, бассейн лаптăкĕ 4550 км²."},{"page_url":"https://de.wikipedia.org/wiki/Geschichte_der_Metaphysik","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Schedelsche_Weltchronik_-_Kosmologie.jpg","page_title":"Geschichte der Metaphysik","context_page_description":"Bereits bei den Vorsokratikern scheint das zentrale Motiv der Metaphysik in der Frage auf, aus welchem Stoff oder Element alles besteht, d. h., schon am Beginn der Philosophie steht der Versuch, das Weltganze aus einem einzelnen, einigendem Prinzip zu begreifen.\\nParmenides gilt als der Begründer der Ontologie. Er verwendet zum ersten Mal den Begriff des Seienden in seiner abstrakten Form. Für ihn gibt es nur ein Seiendes, das vollständig, einheitlich und erkennbar ist. Denn etwas zu erkennen, heißt zugleich, dass es ist. Nicht-Seiendes ist nicht, man kann es weder erkennen, noch davon sprechen. Das Seiende ist ungeworden und unvergänglich. Vielheit, Veränderung und Bewegung der Seienden sind bloßer Schein; ihre Annahme beruht auf Irrtümern der Sterblichen, denen aber auch die Fähigkeit des Erkennens zuteil ist. Parmenides hatte einen großen Einfluss auf den weiteren Fortgang der metaphysischen Diskussion. Seine Gedanken wirkten weiter über Platon, Aristoteles bis zur christlichen Theologie und Philosophie des Mittelalters.\\nMittelpunkt der Philosophie Platons ist die Idee. In den Platonischen Dialogen fragt Sokrates nach dem, was gerecht, tapfer, fromm, gut usw. ist."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B0%D1%80%D1%82%D0%B8%D0%B7%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B1%D0%BE%D0%BB%D1%8C%D0%BD%D0%B8%D1%86%D0%B0_%D0%A4%D1%80%D0%B0%D0%BD%D1%8C%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/BolnicaFranja15.JPG","page_title":"Партизанская больница Франья","context_page_description":"Партизанская больница Франья — секретный госпиталь времени Второй мировой войны в деревне Долени-Новаки возле Церкно в западной Словении. Она была в ведении югославских партизан с декабря 1943 года до конца войны как часть широкого организованного сопротивления фашистским оккупационным войскам. Там лечились солдаты как воевавшие на стороне союзных держав, так и на стороне стран «оси». Оккупационные войска Вермахта предпринимали безуспешные попытки обнаружить больницу, но это им так и не удалось. Сейчас больница превращена в музей. Она защищена государством как культурный памятник национального значения."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_kulturn%C3%ADch_pam%C3%A1tek_v_K%C5%99i%C5%BE%C3%A1nk%C3%A1ch","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Venkovsk%C3%BD_d%C5%AFm%2C_%C4%8Cesk%C3%A9_K%C5%99i%C5%BE%C3%A1nky_4.jpg","page_title":"Seznam kulturních památek v Křižánkách","context_page_description":"Tento seznam nemovitých kulturních památek v obci Křižánky v okrese Žďár nad Sázavou vychází z Ústředního seznamu kulturních památek ČR, který na základě zákona č. 20/1987 Sb., o státní památkové péči, vede Národní památkový ústav jako ústřední organizace státní památkové péče. Údaje jsou průběžně upřesňovány, přesto mohou obsahovat i řadu věcných a formálních chyb a nepřesností či být neaktuální.\\nPokud byly některé části dotčeného území vyčleněny do samostatných seznamů, měly by být odkazy na tyto dílčí seznamy uvedeny v úvodu tohoto seznamu nebo v úvodu příslušné sekce seznamu."},{"page_url":"https://en.wikipedia.org/wiki/List_of_places_of_worship_on_the_Isle_of_Wight","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Arreton_Methodist_Church%2C_Main_Road%2C_Arreton_%28May_2016%29_%28Datestone%29.JPG","page_title":"List of places of worship on the Isle of Wight","context_page_description":"As of 2019 there are about 130 places of worship in use on the Isle of Wight, England's largest island. A wide range of Christian denominations are represented, and Muslims have a mosque in the island's main town of Newport. The diamond-shaped, 146-square-mile island lies in the English Channel, separated from the county of Hampshire by the Solent. Its population of around 140,000 is spread across several small towns and dozens of villages. Many of the island's churches and chapels are in the ancient ports of Yarmouth and Newport, the Victorian seaside resorts of Ryde, Sandown, Shanklin and Ventnor, and the twin towns of Cowes and East Cowes; but even the smallest villages often have their own Anglican parish churches and sometimes a Nonconformist chapel. Methodism has been particularly strong on the island for over 200 years, and two of England's oldest Roman Catholic churches are also located here.\\nSixty-one churches and chapels have been awarded listed status by Historic England or its predecessor organisations in recognition of their architectural and historical interest."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D1%80%D0%B5%D0%B7%D0%B8%D0%B4%D0%B5%D0%BD%D1%82%D1%81%D1%8C%D0%BA%D1%96_%D0%B2%D0%B8%D0%B1%D0%BE%D1%80%D0%B8_%D1%83_%D0%A1%D0%A8%D0%90_%D0%BD%D0%B0_%D0%90%D0%BB%D1%8F%D1%81%D1%86%D1%96,_2016","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Donald_Trump_August_19%2C_2015_3_by_2.jpg","page_title":"Президентські вибори у США на Алясці, 2016","context_page_description":"Президентські вибори у США на Алясці відбулись 8 листопада 2016 року, як частина загальних президентських виборів, у яких всі 50 Штатів і округ Колумбія взяли участь. На Алясці виборці обирали виборників, які представляли їх в колегії виборщиків шляхом народного голосування, обираючи Республіканську партію з кандидатом, бізнесменом Дональдом Трампом, і його напарником, що є губернатором Індіани, Майком Пенсом, проти кандидата від Демократичної партії, минулого держсекретаря, Гілларі Клінтон і її напарника, сенатора Вірджинії Тіма Кейна.\\nДональд Трамп виграв вибори на Алясці із 51.57% голосів. Гілларі Клінтон отримала 36.39% голосів. Аляска голосувала за республіканців на всіх виборах, починаючи з 1968 року, і з 1959 року, вона тільки голосувала за демократичного кандидата в одному випадку: Президента Ліндона Б. Джонсона, що переміг в 1964.\\nШтат відомий своєю підтримкою й інших кандидатів, в тому числі лібертаріанця Гарі Джонсонана виборах 2012 року, в яких Аляска була його третім за підтримкою штатом. У 2016 році за кандидата від Лібертаріанської партії проголосувало 5.85% виборців."},{"page_url":"https://de.wikipedia.org/wiki/Virale_h%C3%A4morrhagische_Septik%C3%A4mie","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/VHSV.jpg","page_title":"Virale hämorrhagische Septikämie","context_page_description":"Die virale hämorrhagische Septikämie ist eine mit Blutungen in die Organe einhergehende Viruserkrankung, die vor allem Forellenfische, aber auch andere Fischarten befällt. Sie gehört zu den Anzeigepflichtigen Tierseuchen. Der Erreger ist ein Rhabdovirus."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Schutzgebiete_in_der_Region_Provence-Alpes-C%C3%B4te_d%E2%80%99Azur","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Port-cros-nature_2.jpg","page_title":"Liste der Schutzgebiete in der Region Provence-Alpes-Côte d’Azur","context_page_description":"Diese Aufstellung listet alle offiziell ausgewiesenen Schutzgebiete in Natur- und Landschaftsschutz in der französischen Region Provence-Alpes-Côte d’Azur auf. Die Aufstellung folgt der Common Database on Designated Areas der Europäischen Umweltagentur."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%A7%D9%8A%D9%83_%D8%A5%D8%B3%D8%A8%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Mike_Espy.jpg","page_title":"مايك إسبي","context_page_description":"ألفونسو مايكل \\"مايك\\" إسبي هو سياسي ديمقراطي أمريكي. عمل في مجلس النواب الأمريكي من 1987 إلى 1993 ممثلا عن منطقة الكونغرس الثانية في ميسيسيبي. كما شغل منصب وزير التجارة في الفترة من 1993 إلى 1994، بعد أن تم اختياره من قبل الرئيس بيل كلينتون. وكان أول أمريكي من أصل أفريقي في هذا المنصب. وقد تم اتهامه بتلقي رشاوى في عام 1997."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E6%97%A9%E9%A4%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Petit_dejeuner.jpg","page_title":"早餐","context_page_description":"早餐是在早上享用的餐，通常是广义上可以理解为睡醒后的第一餐。“早餐”一词，字面之解释为“打破禁食”。故在英语世界中，会出现如前述的理解，又或代表一种由传统早餐食品所组成，全日均可食用的餐膳。\\n世界各地的早餐食品均有不同，惟通常都会包括一种具丰富碳水化合物的食品，如谷类、麦片、蔬果等，配上一种含高蛋白质的食品，再加上一种饮料。咖啡、茶、果汁、谷类、热香饼、香肠、烟肉、面包、新鲜蔬果、鸡蛋、蘑菇、焗豆、松饼、蛋糕或配上牛油/植物牛油/果酱的吐司，皆为常见的早餐食物。\\n营养专家指出，人从前一天的晚餐到早上起床前，至少有约10小时未进食，因此早餐为一天最重要的餐膳。种种研究亦发现，不吃早餐的人拥有新陈代谢及体重问题的比例远较常人为高。"},{"page_url":"https://it.wikipedia.org/wiki/Museo_archeologico_regionale_eoliano","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Amphoren_Liparisches_Museum_Lipari.jpg","page_title":"Museo archeologico regionale eoliano","context_page_description":"Il Museo archeologico regionale eoliano «Luigi Bernabò Brea» è ubicato nel complesso del Castello che domina l'isola di Lipari ed è intitolato a Luigi Bernabò Brea, grande archeologo e Soprintendente della Sicilia Orientale."},{"page_url":"https://it.wikipedia.org/wiki/Mainit","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Lake_Mainit_Surigao_del_Norte_sunset.JPG","page_title":"Mainit","context_page_description":"Mainit è una municipalità di Quarta classe delle Filippine, situata nella Provincia di Surigao del Norte, nella Regione di Caraga.\\nMainit è formata da 21 baranggay:\\nBinga\\nBobona-on\\nCantugas\\nDayano\\nMabini\\nMagpayang\\nMagsaysay\\nMansayao\\nMarayag\\nMatin-ao\\nPaco\\nQuezon\\nRoxas\\nSan Francisco\\nSan Isidro\\nSan Jose\\nSiana\\nSilop\\nTagbuyawan\\nTapi-an\\nTolingon"},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%86%E0%A4%97%E0%A4%B0%E0%A5%80_%E0%A4%AC%E0%A5%8B%E0%A4%B2%E0%A5%80","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e2/Konkani_languages.png","page_title":"आगरी बोली","context_page_description":"आगरी बोली महाराष्ट्र राज्य के उत्तर में तथा मध्य कोंकण में बोली जाने वाली बोली है। यह आगरी, कोली, कुणबी तथा आगर में रहनेवाले बारा बलुतेदार इस भाषा का प्रयोग करते हैं।"},{"page_url":"https://es.wikipedia.org/wiki/1995","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/1117_V_%28BTS%29_Dispatch_Photo_Shoot_LA_%284%29.png","page_title":"1995","context_page_description":"1995 fue un año normal comenzado en domingo en el calendario gregoriano. La Organización de las Naciones Unidas lo declaró «Año mundial de conmemoración de las víctimas de la Segunda Guerra Mundial» y «Año de las Naciones Unidas para la tolerancia».​"},{"page_url":"https://en.wikipedia.org/wiki/Ainu_music","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Mukkuri.jpg","page_title":"Ainu music","context_page_description":"Ainu music is the musical tradition of the Ainu people of northern Japan.\\nThe oral Ainu culture includes various genres, of which upopo, lighthearted ballads on daily affairs and rituals often accompanied by traditional Ainu instruments, and yukar, a form of rhythmic epic poetry often supported by light percussion, are most prominently covered in writings on this oral Ainu culture.\\nThe contents of these ballads were an important source of understanding daily life as well as various traditions and habits of the Ainu people, and today these remain an important part in protecting the Ainu cultural identity, as seen in efforts by performers such as Oki, the most famous contemporary performer of Ainu music.\\nThe most useful English-language overview of Ainu music is by Chiba Nobuhiko."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D1%85%D0%B2%D0%B5%D1%80%D0%B4%D0%BE%D0%B2,_%D0%90%D0%B1%D0%B4%D1%83%D1%80%D1%80%D0%B0%D0%B3%D0%B8%D0%BC_%D0%90%D1%81%D0%B0%D0%B4%D0%B1%D0%B5%D0%BA_%D0%BE%D0%B3%D0%BB%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Abdurrahim_bey_Hagverdiyev_and_Habib_bey_Mahmudbeyov.jpg","page_title":"Ахвердов, Абдуррагим Асадбек оглы","context_page_description":"Абдуррагим Асадбек оглы Ахвердов — азербайджанский писатель, драматург, переводчик, публицист, театральный и общественный деятель, классик азербайджанской литературы. Заслуженный деятель искусств Азербайджанской ССР, один из первых пяти депутатов Первой Госдумы России от Азербайджана и первый дирижёр в период демонстрации оперы «Лейли и Меджнун», основатель и руководитель театрального общества и общества писателей Азербайджана. Первый Посол Азербайджана в Дагестане а затем в Армении."},{"page_url":"https://eo.wikipedia.org/wiki/Hans_Pleschinski","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/HansPleschinskiP1080733.jpg","page_title":"Hans Pleschinski","context_page_description":"Hans PLESCHINSKI estas germana verkisto kiu furoris pro la romanoj Bildnis eines Unsichtbaren kaj Königsallee. Ekster tio li verkas eseojn, rakontojn, novelojn, radidramojn kaj eldonadas franclingvajn fontojn. Li ekz. tradukis la leterinterŝanĝon kaj la rememorojn de Frederiko la 2-a, Voltaire, Madame de Pompadour kaj Else Sohn-Rethel."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9A%D0%B8%D0%BD%D0%B5%D1%81%D0%BA%D0%B8_%D0%B7%D0%BC%D0%B0%D1%98","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e7/Menbo.JPG","page_title":"Кинески змај","context_page_description":"Кинески змај или лунг је митска животиња. Један је од најзначајнијих симбола традиционалне Кине, симбол среће и просперитета, отелотворење космичке силе јанг, божанство вода у кинеској митологији, и зодијачки знак.\\nКинези себе сматрају потомцима змаја.\\nНа Западу се змај сматра националним симболом Кине. Међутим, он се данас у Кини ретко користи као национални симбол, пре свега због монархистичке конотације, супротне идеологији савремене Кине, а и због агресивне ратничке конотације која је у супротности са државном спољном политиком.\\nЗа разлику од европских представа змаја као ватреног бића, кинески змај је повезан са водом. Змајеви владају свим покретним водама и језерима. Они контролишу време и изазивају кише. Због повезаности са водом били су значајна и дубоко поштована божанства у претежно земљорадничкој Кини."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B9%D8%A7%D8%B5%D9%81%D8%A9_%D9%86%D8%A7%D8%B1%D9%8A%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Tokyo_1945-3-10-1.jpg","page_title":"عاصفة نارية","context_page_description":"عاصفة نارية ‏ هو حريق يبلغ من الشدة بحيث يخلق ويحافظ على نظام الرياح الخاص به. هو ظاهرة طبيعية غالبا، نشئت خلال بعض أكبر حرائق الغابات والحرائق البرية. رغم أن الكلمة تم استخدامها في وصف بعض الحرائق الكبيرة،\\nفالإعصار غالباً ما يحدث في بيئة باردة نسبياً ويترافق مع العواصف الرعدية والأمطار والرياح الشديدة ولا مكان في هذه البيئة للنار. تحديد سمات هذه الظاهرة هو اطلاق النار مع قوة عاصفة سرعة الرياح الخاصة بها من كل نقطة في البوصلة.\\nولكن في السنوات الاخيرة رأى العالم إعصاراً من نوع غريب يضرب غابات البرازيل، ولكن لم يكن المشهد ملفتاً للانتباه كثيراً حتى جاء إعصار أستراليا عام 2012 ليحرق إحدى الغابات ويسبب خسائر بملايين الدولارات، حيث تم تصويره وتحليله ودراسته من قبل العلماء وأظهر شريط الفيديو قوة الإعصار الحارقة حيث التهم مساحات كبيرة من الأشجار خلال زمن قصير جداً."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%8D%97%E8%8D%BB%E5%B3%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Bunkyo_University_Koshigaya_Campus.JPG","page_title":"南荻島","context_page_description":"南荻島は、埼玉県越谷市の大字。郵便番号は343-0804。"},{"page_url":"https://nl.wikipedia.org/wiki/Goudvoorhoofdvireo","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Golden-fronted_Greenlet_-_Panama_MG_2230_%2823040966756%29.jpg","page_title":"Goudvoorhoofdvireo","context_page_description":"De goudvoorhoofdvireo is een zangvogel uit de familie Vireonidae."},{"page_url":"https://de.wikipedia.org/wiki/Schwere-Reiter-Stra%C3%9Fe","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Barbarasiedlung_Muenchen_1.JPG","page_title":"Schwere-Reiter-Straße","context_page_description":"Die Schwere-Reiter-Straße ist eine etwa 1,1 km lange Straße im Münchner Stadtbezirk Schwabing-West im Bereich Oberwiesenfeld, die vom Leonrodplatz bis zur Hohenzollernstraße / Ecke Winzererstraße führt. An ihr zweigt nach Norden die Ackermannstraße ab.\\nNördlich liegt der Olympiapark. An der Ecke Dachauer Straße liegt seit 1993 das Kulturzentrum „Schwere Reiter – Tanz Theater“, daneben das „Munich Center of Community Arts“ und weitere Objekte des Kreativquartiers Schwabing, gemäß Süddeutscher Zeitung „das lebendigste und vielseitigste Künstlerbiotop“ Münchens. Gegenüber soll in einem siebenstöckigen Gebäude, dessen Bau 2016 begann, 2021 das Strafjustizzentrum München einziehen. Daneben an der Schwere-Reiter-Straße 9 befinden sich die Institute und Stallungen der Tierärztlichen Fakultät der Universität München. An der Schwere-Reiter-Straße 15 liegt das Theaterzelt „Das Schloss“. An der Ecke zur Ackermannstraße wurde 2016 ein Boardinghouse fertiggestellt, das 2012 unter sieben Entwürfen für seine Gestaltung prämiert wurde. An der Schwere-Reiter-Straße 35 befindet sich das Studentenwohnheim Schwere-Reiter-Straße."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_in_Roosendaal_(gemeente)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Rijksmonumenten_Roosendaal_442.JPG","page_title":"Lijst van rijksmonumenten in Roosendaal (gemeente)","context_page_description":"De gemeente Roosendaal telt 93 inschrijvingen in het rijksmonumentenregister. Hieronder een overzicht."},{"page_url":"https://hr.wikipedia.org/wiki/Ponferrada","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/23/Castillo_templario_de_Ponferrada_001.jpg","page_title":"Ponferrada","context_page_description":"Ponferrada je grad u pokrajini León, Kastilja i León, Španjolska. Leži na rijeci Sil, pritoci rijeke Miño, u dolini El Bierzo potpuno okružen planinama. To je posljednji veliki grad na francuskoj ruti puta Svetog Jakova prije nego što dođe do končnog odredišta Santiago de Compostela. Godine 2008. u gradu je živjelo 69.769 stanovnika."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B8%D0%BD%D0%BE%D0%B4%D0%BE%D0%B2,_%D0%AE%D1%80%D0%B8%D0%B9_%D0%A1%D0%B5%D1%80%D0%B3%D0%B5%D0%B5%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Yury_Sinodov_and_Seymour_Papert.JPG","page_title":"Синодов, Юрий Сергеевич","context_page_description":"Ю́рий Серге́евич Сино́дов — российский интернет-журналист, создатель сайта Roem.ru."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%AE%E0%A5%88%E0%A4%B0%E0%A5%80_%E0%A4%9C%E0%A5%87%E0%A4%A8_%E0%A4%B5%E0%A4%BE%E0%A4%B0%E0%A4%AB%E0%A5%80%E0%A4%B2%E0%A5%8D%E0%A4%A1_%E0%A4%95%E0%A5%8D%E0%A4%B2%E0%A5%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Mary_Jane_Warfield.jpg","page_title":"मैरी जेन वारफील्ड क्ले","context_page_description":"'मैरी जेन वॉरफील्ड क्ले' केंटकी में मताधिकार आंदोलन में एक शुरुआती नेता थे; उन्होंने 1879 में अपने घर पर एक मताधिकार क्लब का गठन शुरू किया। एक खेत प्रबंधक के रूप में उनके अनुभव और सफलता ने गृह युद्ध के बीच में उनके तीव्र व्यापारिक अर्थों को शामिल किया, जैसे कि उनके खेत से संघ और संघि सेना दोनों को आपूर्ति बेचना जब वे एक-दूसरे के कब्जे में थे। कॉमनवेल्थ। मताधिकार आंदोलन में उनका सबसे सक्रिय काम अपनी बेटियों को प्रोत्साहित करना और उनका समर्थन करना था, जो उन्नीसवीं और बीसवीं शताब्दी के सबसे प्रसिद्ध केंटुकी मताधिकार थे।"},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AF%D8%B1%D9%87_%D8%A2%D8%A8%E2%80%8C%D9%81%D8%B4%D8%A7%D9%86%E2%80%8C%D9%87%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Valley_of_the_Geysers.jpg","page_title":"دره آب‌فشان‌ها","context_page_description":"دره آب‌فشان‌ها دره‌ای دارای آب‌فشان‌های متعدد در شبه‌جزیره کامچاتکا در خاور دور روسیه است.\\nاین دره تنها دشت آب‌فشانی در اوراسیا و دومین آب‌فشانستان بزرگ در جهان است.\\nحوزهٔ آبخیز این دره ۶ کیلومتر درازا دارد و در حدود ۹۰ آب‌فشان و شمار زیادی چشمه آب گرم در این دره موجود است.\\nدسترسی به این دره دشوار است و راه اصلی رسیدن به آن با بالگرد است.\\nآب‌فشان‌های این دره در سال ۱۹۴۱ میلادی توسط یک دانشمند محلی به نام تاتیانا اوستینووا کشف شد."},{"page_url":"https://af.wikipedia.org/wiki/Tartu","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Tartu_Raekoja_plats_6%2C_8_ja_10.jpg","page_title":"Tartu","context_page_description":"Tartu is die tweede grootste stad in Estland wat aan weerskante van die Emajõgi-rivier uitgebrei het en dien vandag as die ekonomiese en kulturele sentrum van Suid-Estland. Tartu het die oudste en grootste Universiteit in Estland met sowat 16 000 studente wat 'n jeugdige karakter aan die stad gee en groot invloed op Tartu se ryk kulturele lewe uitoefen. Kuns, teater en literatuur speel hier al lank 'n sentrale rol.\\nToe Dorpat in die 13de eeu by die magtige Hanseverbond aangesluit het, het die nedersetting tot die beduidendste handelsstad in Lyfland naas Riga gegroei. Die historiese Middeleeuse sentrum van die Hansestad Dorpat is deur oorloë vernietig, tog beskik die stad nog oor 'n 19de eeuse stadskern met oorwegend klassisistiese geboue."},{"page_url":"https://fr.wikipedia.org/wiki/Beffrois_de_Belgique_et_de_France","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Abbeville_Beffroi_2005-09-29.jpg","page_title":"Beffrois de Belgique et de France","context_page_description":"Les beffrois de Belgique et de France sont cinquante-six beffrois inscrits en France et en Belgique sur la liste du patrimoine mondial de l'UNESCO."},{"page_url":"https://es.wikipedia.org/wiki/Magnicharters","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Magnicharters_Boeing_737-322_XA-UNM_%2823836103423%29.jpg","page_title":"Magnicharters","context_page_description":"Grupo Aéreo Monterrey S.A. de C.V., ​ o Magnicharters, es una aerolínea comercial mexicana, subsidiaria de Magnicun y Magnibus, con base principal en el Aeropuerto Internacional de la Cd.de México. Tiene su sede en la Colonia Juárez de esa misma ciudad."},{"page_url":"https://en.wikipedia.org/wiki/History_of_Uppsala","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Uppsala_centralstation.jpg","page_title":"History of Uppsala","context_page_description":"The city of Uppsala is one of the oldest in Sweden. It has played a dominant role in the political, intellectual and historical development of the country. The two main institutions in the history of Uppsala are the Archdiocese which is located in the city, and Uppsala University, founded in the city in 1477. These have long been established on the western banks of the Fyris river with a bourgeois trading town on the other side of the river."},{"page_url":"https://en.wikipedia.org/wiki/Williams_County,_Ohio","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Map_of_Williams_County_Ohio_With_Municipal_and_Township_Labels.PNG","page_title":"Williams County, Ohio","context_page_description":"Williams County is a county located in the U.S. state of Ohio. As of the 2010 census, the population was 37,642. Its county seat is Bryan. The county was created in 1820 and later organized in 1824. It is named for David Williams, one of the captors of John André in the American Revolutionary War."},{"page_url":"https://en.wikipedia.org/wiki/Fulton,_Missouri","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/City_Hall_-_Fulton%2C_Missouri.jpg","page_title":"Fulton, Missouri","context_page_description":"Fulton is the largest city in and the county seat of Callaway County, Missouri, United States. Located about 22 miles northeast of Jefferson City and the Missouri River and 20 miles east of Columbia, the city is part of the Jefferson City, Missouri, Metropolitan Statistical Area. The population was 12,790 in the 2010 census. The city is home to two universities, Westminster College and William Woods University; the Missouri School for the Deaf; the Fulton State Hospital; and the Fulton Reception and Diagnostic Center state prison."},{"page_url":"https://gl.wikipedia.org/wiki/Manat_acerbaixano","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/AzerbaijanP19b-500Manat-%281993%29_f-1.jpg","page_title":"Manat acerbaixano","context_page_description":"O manat acerbaixano é a unidade monetaria de Acerbaixán desde 2006.\\nO seu código ISO 4217 é AZN desde o 1 de xaneiro de 2006, e ata esa data era AZM e como símbolo escolleuse unha especie de letra m estilizada.\\nSubdivídese e 100 qəpik como moeda divisionaria, fracción que non se utilizou entre 1993 e 2005 por mor da forte inflación, mais que se introduciu novamente o 1 de xaneiro de 2006."},{"page_url":"https://af.wikipedia.org/wiki/William_Demarest","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Palm_Beach_Story-Bill_Demarest.JPG","page_title":"William Demarest","context_page_description":"William Demarest was 'n Amerikaanse akteur. Hy was bekend vir sy rolle in die rolprente Mr. Smith Goes to Washington, Hail the Conquering Hero, en It's a Mad Mad Mad Mad World, en in die televisiereeks My Three Sons."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B1%D5%B5%D5%AE%D5%A5%D6%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Nubian_Ibex_in_Negev.JPG","page_title":"Այծեր","context_page_description":"Այծեր կամ այծեր և ոչխարներ՝ երկսմբակավորների ենթաընտանիքի, սնամեջ եղջերավորների ընտանիք։"},{"page_url":"https://fr.wikipedia.org/wiki/Pleyel","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Piano_de_concert_-Pleyel.jpg","page_title":"Pleyel","context_page_description":"Pleyel est une marque de pianos française fondée en 1807 par Ignace Pleyel. C'est l'une des plus anciennes manufactures de pianos. Elle a fait reconnaître son savoir-faire auprès de nombreux artistes parmi lesquels Frédéric Chopin, Camille Saint-Saëns, Maurice Ravel, Igor Stravinsky et Manuel de Falla.\\nDepuis 2017, la marque est la propriété de la société Algam."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E9%98%BF%E6%8B%89%E6%96%AF%E5%8A%A0%E9%B1%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Theragra_chalcogramma.png","page_title":"阿拉斯加鱈","context_page_description":"阿拉斯加鱈（Gadus chalcogrammus），或者叫黃線狹鱈，係鱈科鱈屬其中一種魚，主要分佈喺北太平洋地區。朝鮮同中國東北都將阿拉斯加鱈叫「明太」，佢哋嘅魚子加工過後就整成明太子。"},{"page_url":"https://en.wikipedia.org/wiki/Tennessee_River_Blueway","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Gallery-vulture-800.jpg","page_title":"Tennessee River Blueway","context_page_description":"The Tennessee River Blueway is a 50-mile section of the Tennessee River that flows between the Chickamauga Dam and the Nickajack Dam and through downtown Chattanooga, Tennessee and the Tennessee River Gorge. The city of Chattanooga and the Tennessee River Gorge Trust along with other agencies have designated the section of river as a blueway for a canoe and kayak paddlers to travel and enjoy. Along the way, travelers will find primitive camping areas next to the river, a vibrant mix of museums, restaurants, activities, entertainment and natural attractions.\\nFrom there, the Blueway meanders its way to quieter places like Williams Island State Archaeological Park. Williams Island divides the river channel with a 450-acre tract of land inhabited only by wildlife. From about 1000 to 1650, this area was home to several Native American tribes. It is now managed by the Tennessee River Gorge Trust and has become a haven for birders and naturalists, as well as archaeologists.\\nThen next of course is the 26-mile stretch of the awesome Tennessee River Gorge, a steep canyon formed by the Tennessee River. The scenic terrain of the Tennessee River Gorge creates a unique diversity of land forms."},{"page_url":"https://fr.wikipedia.org/wiki/Antonio_Gherardi","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ad/Antonio_Gherardi_Sans%C3%B3n_y_Dalila.jpg","page_title":"Antonio Gherardi","context_page_description":"Antonio Gherardi est un peintre et un architecte italien baroque du XVIIᵉ siècle."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%9C%A3%E5%A1%9E%E7%93%A6%E6%96%AF%E8%92%82%E5%AE%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/San_Sebastian_at_night_from_Monte_Urgull.jpg","page_title":"圣塞瓦斯蒂安","context_page_description":"圣塞瓦斯蒂安是西班牙吉普斯夸省省会，属于巴斯克自治区。城市面积60.8平方公里，人口186,370。"},{"page_url":"https://vi.wikipedia.org/wiki/%C4%90%C6%B0%E1%BB%9Dng_s%E1%BA%AFt_tr%C3%AAn_cao","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/H_bahn_dortmund1.jpg","page_title":"Đường sắt trên cao","context_page_description":"Đường sắt trên cao là một tuyến tàu tốc hành với các đường ray nằm trên cao so với mặt đường trên một cầu cạn hoặc kết cấu trên cao khác. Đường sắt có thể là đường sắt khổ rộng, tiêu chuẩn hoặc hẹp, đường sắt hạng nhẹ, một ray hoặc đường sắt treo. Đường sắt trên cao thường được tìm thấy ở các khu vực đô thị, nếu không sẽ có các giao lộ đường sắt. Thông thường, các đường ray của đường sắt trên cao chạy trên cầu cạn bằng thép có thể được nhìn thấy từ mặt đường."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%95%E0%B4%AA%E0%B5%82%E0%B5%BC%E0%B4%A4%E0%B5%8D%E0%B4%A4%E0%B4%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Moorish_Mosque_of_Kapurthala_in_the_state_of_Punjab_03.jpg","page_title":"കപൂർത്തല","context_page_description":"പഞ്ചാബിലെ ഒരു നഗരമാണ് കപൂർത്തല കപൂർത്തല ജില്ലയുടെ ഭരണകേന്ദ്രം ഈ നഗരമാണ്. ബ്രിട്ടീഷ് ഇന്ത്യയുടെ സാമന്തരാജ്യമായിരുന്ന കപൂർത്തല രാജ്യത്തിന്റെ തലസ്ഥാനവും ഈ നഗരമായിരുന്നു. കപൂർത്തല കൊട്ടാരങ്ങളുടെയും ഉദ്യാനങ്ങളുടെയും നഗരമായി അറിയപ്പെടുന്നു. 2011 -ലെ സെൻസസ് പ്രകാരം കപൂർത്തലയാണ് ഇന്ത്യയിലെ ഏറ്റവും ജനസംഖ്യ കുറഞ്ഞ നഗരം."},{"page_url":"https://en.wikipedia.org/wiki/Medal_of_Military_Valor","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Medaglia_al_valor_militare_Salo.png","page_title":"Medal of Military Valor","context_page_description":"The Medal of Military Valor is an Italian medal, originally established as a Sardinian award. It is awarded to military personnel, units above the level of company, and civilians for exceptional valor in the face of the enemy.\\nThe medal has three levels:\\nThe Gold Medal of Military Valor, established on 21 May 1793 by King Victor Amadeus III of Sardinia.\\nThe Silver Medal of Military Valor, established in 1833 by King Charles Albert of Sardinia.\\nThe Bronze Medal of Military Valor, established in 1887 by King Umberto I of Italy."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%B5%D0%B6%D0%B8%D1%80%D1%96%D1%87%D1%87%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/N-Mesopotamia_and_Syria_ua.svg","page_title":"Межиріччя","context_page_description":"Межирі́ччя, також Месопота́мія, або Дворіччя — регіон в Азії. У строгому сенсі — це алювіальна рівнина між річками Тигр та Євфрат на території сучасних Іраку та Сирії, однак у звичному вжитку цей термін включає долини обох річок разом із навколишніми низовинами, що обмежені Аравійською і Сирійською пустелями на південному сході та заході, Перською затокою на півдні, горами Кавказу і Загросу на півночі.\\nМежиріччя має давню і сповнену подіями історію — перші держави в цьому регіоні виникли понад 5 тисяч років тому. Месопотамію часто називають колискою цивілізацій. Тут виникла перша в історії людства писемність — клинопис, розвинулись рільництво та іригація, були здійснені численні винаходи, відбувався розвиток домобудівництва і ряду виробів, розвинута астрономія.\\nТакож із Месопотамією пов'язані найважливіші події всесвітньої історії — перехід від полювання і збирання до землеробства і скотарства."},{"page_url":"https://hu.wikipedia.org/wiki/STS%E2%80%9341%E2%80%93C","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/60/STS-41-C_patch.png","page_title":"STS–41–C","context_page_description":"Az STS–41–C az amerikai űrrepülőgép-program 11., a Challenger űrrepülőgép 5. repülése."},{"page_url":"https://he.wikipedia.org/wiki/%D7%94%D7%99%D7%A0%D7%95_HS3KRK","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Hino-HS3KRKA-Cab.jpg","page_title":"הינו HS3KRK","context_page_description":"הינו HS3KRK הוא אוטובוס שיוצר על ידי יצרנית הרכב הכבד הינו מוטורס היפנית בין השנים 1998-1999. לדגם, השייך לסדרת הינו HS, יש 2 דלתות צדדיות והוא משרת כאוטובוס עירוני בסינגפור. מרכב האוטובוס נבנה באוסטרליה על ידי חברת \\"Volgren\\" והוא משמש גם את המרצדס O405‏."},{"page_url":"https://it.wikipedia.org/wiki/Katovice","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Katovice_ST_flag.jpg","page_title":"Katovice","context_page_description":"Katovice è un comune mercato della Repubblica Ceca facente parte del distretto di Strakonice, in Boemia Meridionale."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A0%D0%B0%D0%B4%D0%B5%D1%87%D0%B5_(%D0%BE%D0%B1%D1%89%D0%B8%D0%BD%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Radece1.JPG","page_title":"Радече (община)","context_page_description":"Община Радече — одна з общин південно-східній частині Словенії. Адміністративним центром є місто Радече."},{"page_url":"https://ca.wikipedia.org/wiki/Aquarium_Finisterrae","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/65/Entrada_del_Aquarium_Finisterrae.jpg","page_title":"Aquarium Finisterrae","context_page_description":"L'Aquarium Finisterrae, també conegut com a Acuario da Fin do Mundo o Casa dos Peixes, és un centre interactiu de divulgació científica de la ciutat de la Corunya, sobre aspectes relacionats amb la biologia marina, l'oceanografia i el mar en general. Pretén promoure el coneixement de l'oceà i educar actituds positives de respecte cap al medi marí, així com contribuir al coneixement científic de la vida marina.\\nEs troba al passeig marítim de la Corunya i es va inaugurar el 5 de juny de 1999."},{"page_url":"https://nl.wikipedia.org/wiki/Jamal_Khashoggi","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Jamal_Khashoggi_in_March_2018_%28cropped%29.jpg","page_title":"Jamal Khashoggi","context_page_description":"Jamal Ahmad Khashoggi was een Saoedi-Arabisch journalist en columnist voor The Washington Post. Hij is vermoord door een Saoedisch moordcommando, de Saoedische kroonprins Mohammad bin Salman al-Saoed heeft erkend dat hij medeverantwoordelijkheid draagt voor de moord.\\nJamal Khashoggi verdween op 2 oktober 2018 nadat hij het Saoedi-Arabische consulaat in Istanboel binnen was gegaan. Zijn verdwijning, en enige tijd later, bevestiging van zijn overlijden leidden tot internationale verontwaardiging en diplomatieke commotie."},{"page_url":"https://cs.wikipedia.org/wiki/D%C3%A1nsk%C3%A1_kr%C3%A1lovsk%C3%A1_rodina","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Royal_Standard_of_Denmark.svg","page_title":"Dánská královská rodina","context_page_description":"Členy dánské královské rodiny jsou všichni členové vládnoucí dynastie v Dánském království, kterým náleží titul princ nebo princezna dánská. Jako u jiných evropských monarchií je někdy nesnadné přesně určit, kdo je a kdo není členem národní královské rodiny z důvodu absence striktní právní či formální definice. Královna a její děti náležejí do glücksburské dynastie, jedné z větví oldenburského rodu. Děti královny a mužská linie potomků jsou agnatickými členy rodu de Laborde de Monpezat."},{"page_url":"https://hu.wikipedia.org/wiki/Kallina_M%C3%B3r","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/GellertFotoThalerTamas.jpg","page_title":"Kallina Mór","context_page_description":"Kallina Mór építész."},{"page_url":"https://zh.wikipedia.org/wiki/VAZ-2101","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Lada_Riva_estate_Cambridge.jpg","page_title":"VAZ-2101","context_page_description":"VAZ-2101是一款由苏联汽车厂商AvtoVAZ于1970年制造的紧凑型汽车，并基于快意124改良而成。\\n在第一年共生产了22000辆汽车，至1973年，生产的数量达到66000辆。"},{"page_url":"https://zh.wikipedia.org/wiki/%E5%A8%81%E5%BB%89%C2%B7%E9%98%BF%E9%81%93%E5%A4%AB%C2%B7%E5%B8%83%E6%A0%BC%E7%BD%97%E7%BB%98%E7%94%BB%E4%BD%9C%E5%93%81%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Bergere_W-A_Bouguereau1895.png","page_title":"威廉·阿道夫·布格罗绘画作品列表","context_page_description":"威廉·阿道夫·布格罗是19世纪末的法国学院派画家。已知绘画作品828幅，创作于1845至1905年间。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B0%D1%80%D1%80%D0%B5%D1%82%D1%82,_%D0%A1%D0%B8%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/BarrettHarmonyGuitar.jpg","page_title":"Барретт, Сид","context_page_description":"Ро́джер Кит «Сид» Ба́рретт — британский музыкант, поэт, композитор, художник, основатель рок-группы Pink Floyd, один из родоначальников психоделического направления в рок-музыке и одна из самых загадочных её фигур. Барретт является автором названия «Pink Floyd», а также большинства раннего материала группы, включая первые синглы и первый альбом — The Piper at the Gates of Dawn, он был основным творцом, идеологом и вдохновителем музыкального и стилистического направления ансамбля. Ошеломляющий успех, бешеный гастрольный ритм и употребление наркотиков привели к нервным срывам, неспособности к дальнейшей концертной деятельности и, как следствие, уходу из группы. В результате на второй альбом группы A Saucerful of Secrets попала лишь одна его песня, а его место занял Дэвид Гилмор.\\nБарретт занимался музыкальным творчеством в течение десяти лет: помимо работы с Pink Floyd, в 1969 году он начал сольную карьеру с издания сингла Octopus, далее последовал дебютный диск — The Madcap Laughs, который был записан в течение одного года с четырьмя разными продюсерами."},{"page_url":"https://pl.wikipedia.org/wiki/Ho%C5%99epn%C3%ADk","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Coat_of_arms_of_Ho%C5%99epn%C3%ADk.jpg","page_title":"Hořepník","context_page_description":"Hořepník – gmina w Czechach, w powiecie Pelhřimov, w kraju Wysoczyna. Według danych z dnia 1 stycznia 2014 liczyła 623 mieszkańców."},{"page_url":"https://en.wikipedia.org/wiki/List_of_cities_and_towns_in_Bulgaria","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3f/Church_in_Elhovo%2C_Bulgaria.jpg","page_title":"List of cities and towns in Bulgaria","context_page_description":"This is a complete list of all cities and towns in Bulgaria sorted by population. Province capitals are shown in bold. Primary sources are the National Statistical Institute and the Bulgarian Academy of Sciences.\\nThe largest city is Sofia with about 1.3 million inhabitants and the smallest is Melnik with about 300. Smallest towns are not necessarily larger than all villages as many villages are more populous than many towns, compare Lozen, a large village with more than 5,000 inhabitants."},{"page_url":"https://cs.wikipedia.org/wiki/La_Roche-en-Ardenne","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/La_Roche.jpg","page_title":"La Roche-en-Ardenne","context_page_description":"La Roche-en-Ardenne je frankofonní město v Belgii. Nachází se v provincii Lucemburk ve Valonském regionu a protéká jím řeka Ourthe.\\nObec La Roche-en-Ardenne se skládá z 6 bývalých obcí, mezi které kromě vlastní La Roche-en-Ardenne patří Beausaint, Halleux, Hives, Ortho a Samrée.\\nObec má celkem 4249 obyvatel a rozkládá se na ploše 147,52 km², z toho 58 % tvoří lesy a 34 % připadá na zemědělské plochy. Nejvyšší bod obce leží v nadmořské výšce 652 m.\\nLa Roche-en-Ardene je jedním z oblíbených turistických cílů v Ardenách. Nachází se zde zřícenina středověkého hradu a v okolí je možné provozovat pěší turistiku a jízdu na kajaku a na horském kole. Mezi další ekonomické aktivity města patří zejména zemědělství."},{"page_url":"https://fr.wikipedia.org/wiki/Ch%C3%A2teau_de_Sassenage","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Chateau_de_Sassenage_10.JPG","page_title":"Château de Sassenage","context_page_description":"Le château de Sassenage, autrefois dénommé château Bérenger est un monument historique situé dans la commune de Sassenage, dans le département de l'Isère et la région Auvergne-Rhône-Alpes et, autrefois, dans la province du Dauphiné.\\nConstruit au XVIIᵉ siècle, l'édifice se dresse au cœur d'un vaste domaine arboré. Il est la propriété de la Fondation de France. Aujourd'hui en restauration constante, il a succédé à un ancien château fort du XIIIᵉ siècle.\\nHistoriquement, cette vaste demeure seigneuriale est la troisième à avoir été construite sur le même site, au pied des falaises du Massif du Vercors septentrional par les puissants seigneurs de Sassenage, membres d'une des plus anciennes et prestigieuses familles du Dauphiné, alors territoire rattaché au Saint-Empire Romain germanique, avant de passer sous l'autorité directe du roi de France, après le transport du Dauphiné à la France en 1349. Le château actuel a conservé une grande partie de son mobilier d'origine, ses décors et ses tableaux.\\nLe château et son domaine restent, selon certaines périodes, accessible au public pour des visites guidées."},{"page_url":"https://en.wikipedia.org/wiki/Eleftherias_Square","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Proclamation_of_the_Constitution_of_the_Ottoman_Empire_in_Thessaloniki%2C_24_July_1908.png","page_title":"Eleftherias Square","context_page_description":"Eleftherias Square is a central square in downtown Thessaloniki, Greece. It takes its name from the Young Turk Revolution, which began in the square in 1908. The square is currently a car park, but a public competition was launched by the Municipality of Thessaloniki in 2013 to select a design for its redevelopment into a park. Construction will start in 2018 at a cost of €5.1 million.\\nThe square is bound by Mitropoleos street to the north, Nikis Avenue and the old waterfront of Thessaloniki to the south, Ionos Dragoumi street to the west and Venizelou street to the east. It is trapezoidal in shape and covers an area of approximately 5,087 square metres. The square is surrounded by banks, insurance companies, and offices.\\nIt is of particular importance to the history of the Jews in Thessaloniki. Thousands of male Jews were gathered in the square on 11 July 1942 and publicly tortured and humiliated before being registered for forced labour by the city's Nazi German occupiers."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%90%88%E8%82%A5%E5%B8%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Hefei_yinhe_park1.JPG","page_title":"合肥市","context_page_description":"合肥市は、中華人民共和国安徽省に位置する地級市。安徽省の省人民政府が置かれる省都で、地域の政治・経済・文化の中心である。合肥の日本語読みについては、「ごうひ」が一般的であるが、三国志関連では「がっぴ」と読まれる傾向にある。"},{"page_url":"https://tl.wikipedia.org/wiki/Talaan_ng_mga_Emperador_ng_Roma","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Postumus1.jpg","page_title":"Talaan ng mga Emperador ng Roma","context_page_description":"Isa itong talaan ng mga naging Emperador ng Imperyong Romano mula sa pagtatag ng títulong ito hanggáng sa pagbagsák ng Konstantinopla."},{"page_url":"https://it.wikipedia.org/wiki/Ferrari_410_Superamerica","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/1959_Ferrari_410_Superamerica.jpg","page_title":"Ferrari 410 Superamerica","context_page_description":"La 410 Superamerica è una autovettura sportiva costruita dalla Ferrari dal 1956 al 1959. È stata prodotta in tre serie, e nacque per sostituire la 375 America. Era una biposto costruita in versione coupé e cabriolet, e fu prodotta in serie limitata."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Dahlem_(Nordeifel)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Kronenburgerh%C3%BCtte%2C_Steinertstr._5%3B1.jpg","page_title":"Liste der Baudenkmäler in Dahlem (Nordeifel)","context_page_description":"Die Liste der Baudenkmäler in Dahlem (Nordeifel) enthält die denkmalgeschützten Bauwerke auf dem Gebiet der Gemeinde Dahlem im Kreis Euskirchen in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Gemeinde Dahlem eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen."},{"page_url":"https://en.wikipedia.org/wiki/Red_Brick_School_(Oregon,_Wisconsin)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Oregon_High_School.jpg","page_title":"Red Brick School (Oregon, Wisconsin)","context_page_description":"The Red Brick School is a public school built in 1922 on the north edge of downtown Oregon, Wisconsin, United States. In 1998 it was added to the National Register of Historic Places."},{"page_url":"https://it.wikipedia.org/wiki/Cylindera","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Cylindera_discreta_discreta_Schaum%2C_1863_%283173970012%29.jpg","page_title":"Cylindera","context_page_description":"Cylindera Westwood, 1831 è un genere di coleotteri carabidi della sottofamiglia Cicindelinae."},{"page_url":"https://it.wikipedia.org/wiki/Roasio","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Roasio_san_maurizio_dalla_chesa_omonima.jpg","page_title":"Roasio","context_page_description":"Roasio è un comune italiano di 2 347 abitanti della provincia di Vercelli in Piemonte.\\nSi tratta di un comune sparso e la sede comunale si trova in località San Maurizio. Il territorio si divide in cinque frazioni principali, a loro volta suddivise in località o cantoni."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%9A%D0%B0%D1%81%D1%8C%D1%86%D1%91%D0%BB_%D0%A1%D1%8C%D0%B2%D1%8F%D1%82%D0%BE%D0%B3%D0%B0_%D0%92%D0%BE%D0%B9%D1%86%D0%B5%D1%85%D0%B0_%D1%96_%D0%BA%D0%BB%D1%8F%D1%88%D1%82%D0%B0%D1%80_%D0%B1%D1%8D%D0%BD%D1%8D%D0%B4%D1%8B%D0%BA%D1%82%D1%8B%D0%BD%D0%B0%D0%BA_(%D0%9C%D0%B5%D0%BD%D1%81%D0%BA)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/%D0%9F%D0%BB%D0%B0%D0%BD_%D0%B6%D0%B0%D0%BD%D0%BE%D1%87%D0%B0%D0%B3%D0%B0_%D0%9F%D1%80%D0%B0%D0%B0%D0%B1%D1%80%D0%B0%D0%B6%D1%8D%D0%BD%D1%81%D0%BA%D0%B0%D0%B3%D0%B0_%D0%BC%D0%B0%D0%BD%D0%B0%D1%81%D1%82%D1%8B%D1%80%D0%B0.jpg","page_title":"Касьцёл Сьвятога Войцеха і кляштар бэнэдыктынак (Менск)","context_page_description":"Касьцёл Сьвятога Войцеха і кляштар бэнэдыктынак — помнік архітэктуры XVII—XVIII стагодзьдзяў у Менску. Знаходзіўся на паўднёва-заходнім баку Высокага Рынку, на Зборавай вуліцы. У 2-й палове XIX ст. улады Расейскай імпэрыі гвалтоўна перарабілі касьцёл пад царкву Маскоўскага патрыярхату. Твор архітэктуры віленскага барока.\\nКомплекс складаўся з касьцёла, кляштарнага корпусу з прыбудоваю, капліцы, капэляніі, 2 флігеляў, бровару, сьвірану, стайні і інш. пабудоваў, а таксама саду. Тэрыторыю кляштару атачаў высокі мур, які меў некалькі брамаў. У 2-й палове XIX ст. улады Расейскай імпэрыі часткова зруйнавалі касьцёл, у 1960-я рокі савецкія ўлады дашчэнту зьнішчылі помнік. Да нашага часу захаваліся падмуркі касьцёла."},{"page_url":"https://it.wikipedia.org/wiki/Test_proiettivo","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Rorschach_blot_10.jpg","page_title":"Test proiettivo","context_page_description":"I test proiettivi sono strumenti psicologici di prestazione tipica, costituiti da stimoli visivi intenzionalmente ambigui. Il compito del soggetto è in genere quello di fornire una descrizione o di raccontare una storia ispirata all'immagine rappresentata. Lo scopo del test dovrebbe essere quello di far emergere contenuti psichici inconsci, come emozioni nascoste o conflitti interni.\\nI test proiettivi sono spesso criticati perché non sembrano offrire le garanzie di oggettività della misurazione dei test standardizzati."},{"page_url":"https://id.wikipedia.org/wiki/Ikon_Bunda_Maria_dari_Kazan","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0f/Kazan_monastery.jpg","page_title":"Ikon Bunda Maria dari Kazan","context_page_description":"Bunda Maria dari Kazan adalah sebuah gambar suci pada Gereja Ortodox Rusia, yang menampilkan Perawan Maria sebagai pelindung Kota Kazan. Salinan dari gambar tersebut juga dimuliakan di Gereja Katolik. Ikon ini dianggap sebagai lambang dari Rusia selama berabad-abad, hingga akhirnya dicuri dan sepertinya dihancurkan pada Tahun 1904. Dua Katedral utama Kazan, di Moscow dan St. Petersburg, memuliakan Bunda Maria dari Kazan, sebagaimana banyak gereja lain yang tersebar di sana. Hari sucinya dirayakan setiap tanggal 21 Juli dan 4 November.\\nSalinan yang kuno dan dipuja dipajang pada Katedral Kazan di Moskow, di Yaroslavl, dan di St. Petersburg."},{"page_url":"https://es.wikipedia.org/wiki/Estaci%C3%B3n_de_Sig%C3%BCenza","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Sig%C3%BCenza_Train_station_5858.JPG","page_title":"Estación de Sigüenza","context_page_description":"La estación de Sigüenza es una estación de ferrocarril de Adif situada en la ciudad de Sigüenza el punto kilométrico 139,7 de la línea 200 a su paso por la provincia de Guadalajara. Dispone de servicios de Media Distancia."},{"page_url":"https://de.wikipedia.org/wiki/Dehme","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7f/K-Auferstehungskirche_Dehme_2.JPG","page_title":"Dehme","context_page_description":"Dehme ist ein Stadtteil der Stadt Bad Oeynhausen im Kreis Minden-Lübbecke in Ostwestfalen."},{"page_url":"https://es.wikipedia.org/wiki/Charles_Shaughnessy","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Charles_Shaughnessy_with_Kevin_Tostado_cropped.jpg","page_title":"Charles Shaughnessy","context_page_description":"Charles Shaughnessy, 5.º Baron Shaughnessy es un actor inglés de televisión y cine."},{"page_url":"https://eo.wikipedia.org/wiki/Deuna","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Wappen_Deuna.png","page_title":"Deuna","context_page_description":"Deuna estas komunumo en Germanio. Ĝi troviĝas en la distrikto Eichsfeld de la federacia lando Turingio. Fine de decembro 2015 la komunumo havis 1 176 loĝantojn. Ekde 2014 ankaŭ la antaŭe administre sendependa kaj najbara komunumo Vollenborn apartenas al la komunumo Deuna."},{"page_url":"https://sv.wikipedia.org/wiki/Hohwacht","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Hohwacht_Wappen.png","page_title":"Hohwacht","context_page_description":"Hohwacht är en kommun och ort i Kreis Plön i förbundslandet Schleswig-Holstein i Tyskland.\\nKommunen ingår i kommunalförbundet Amt Lütjenburg tillsammans med ytterligare 14 kommuner."},{"page_url":"https://it.wikipedia.org/wiki/New_Amsterdam_(serie_televisiva_2018)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Ryan_Eggold_2009.jpg","page_title":"New Amsterdam (serie televisiva 2018)","context_page_description":"New Amsterdam è una serie televisiva statunitense ideata da David Schulner e trasmessa sulla NBC dal 25 settembre 2018. È basata sul libro Twelve Patients: Life and Death at Bellevue Hospital di Eric Manheimer.\\nIn Italia, inizialmente prevista su Fox Life, la serie è trasmessa su Canale 5. La prima parte della prima stagione è andata in onda dal 2 dicembre al 23 dicembre 2018, mentre la seconda è andata in onda dal 5 maggio al 2 giugno 2019. La seconda stagione è anch’essa divisa in due parti: la prima parte, composta da 9 episodi, è andata in onda dal 14 gennaio al 28 gennaio 2020; la seconda parte, composta dai rimanenti 9 episodi, è andata in onda dal 4 giugno al 24 giugno 2020."},{"page_url":"https://no.wikipedia.org/wiki/Alapajevsk","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Coat_of_Arms_of_Alapaevsk_%28Sverdlovsk_oblast%29.png","page_title":"Alapajevsk","context_page_description":"Alapajevsk er en by i Sverdlovsk oblast i Russland. Byen ligger ved samløpet av elvene Nejva og Alapaikha. Innbyggertall: 44 263, 50 060.\\nAlapajevsk er et av de eldste sentrene for jernbasert metallurgi i Ural, med den første fabrikken bygget i 1704. Selve byen ble grunnlagt i 1781. Den er kjent for gruvene i området rundt byen, og sine mange fabrikker. Den siste metallurgiske fabrikken ble dog nesten nedlagt på begynnelsen av 1990-tallet.\\nPjotr Tsjajkovskij tilbrakte deler av sin barndom i byen."},{"page_url":"https://es.wikipedia.org/wiki/Preixana","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Bandera_de_Preixana.svg","page_title":"Preixana","context_page_description":"Preixana es un municipio español de la provincia de Lérida, situado en la comarca del Urgel. Según datos de 2008 su población era de 413 habitantes.​ A mediados del siglo XIX se denominaba Preijana.​"},{"page_url":"https://fr.wikipedia.org/wiki/Philip_de_L%C3%A1szl%C3%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Marguerite_de_Rothschild.jpg","page_title":"Philip de László","context_page_description":"Philip Alexius de László, né Fülöp Elek Laub, est un peintre britannique d'origine hongroise né à Pest le 30 avril 1869 et mort à Hampstead le 22 novembre 1937."},{"page_url":"https://pl.wikipedia.org/wiki/Syrop_glukozowo-fruktozowy","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Sugar_from_corn_LCCN2016822131.jpg","page_title":"Syrop glukozowo-fruktozowy","context_page_description":"Syropy glukozowo-fruktozowe, syropy wysokofruktozowe – oczyszczone i zagęszczone wodne roztwory cukrów prostych w różnych proporcjach, uzyskiwane w wyniku hydrolizy enzymatycznej lub kwasowej skrobi.\\nSyropy glukozowo-fruktozowe w handlu występują pod różnymi nazwami: izoglukoza, syrop wysokofruktozowy, wysokofruktozowy syrop kukurydziany, syrop inulinowy. Także syrop z agawy.\\nSyropy glukozowe są często mylone przez konsumentów z syropami glukozowo-fruktozowymi."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%85%B4%E5%8C%96%E5%BA%9C%E5%9F%8E%E9%9A%8D%E5%BA%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Putian_Xinghua_Fu_Chenghuang_Miao_20120302-4.jpg","page_title":"兴化府城隍庙","context_page_description":"兴化府城隍庙位于中国福建省莆田市城厢区，2001年被列为福建省文物保护单位。\\n兴化府城隍庙始建于明洪武三年，祀陈瓒，后经多次修建。现存大门、仪门、戏台、正殿、后殿等建筑，其中仪门、正殿和后殿为明代建筑。仪门建于万历十九年，面阔七间。正殿是城隍庙的主体建筑，建于弘治二年，面阔五间，进深四间，重檐歇山顶。后殿建于天启四年，原奉祀明代敕封淑德夫人，故又称为“夫人妈殿”。"},{"page_url":"https://zh.wikipedia.org/wiki/%E8%B4%9D%E9%98%BF%E6%9C%97%E5%BA%93%E5%B0%94","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ef/Map_commune_FR_insee_code_62090.png","page_title":"贝阿朗库尔","context_page_description":"贝阿朗库尔是法国北部-加来海峡大区加来海峡省的一个市镇，属于蒙特勒伊区帕尔克县。该市镇2009年时的人口为130人。"},{"page_url":"https://arz.wikipedia.org/wiki/%D9%85%D9%8A%D9%83%D8%A7%D9%8A%D9%84_%D9%84_%D8%A8%D9%8A%D9%87%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Stade_rennais_-_Le_Havre_AC_20150708_16.JPG","page_title":"ميكايل ل بيهان","context_page_description":"ميكايل ل بيهان لاعب كورة قدم من فرنسا."},{"page_url":"https://en.wikipedia.org/wiki/Flight_Deck_(Canada%27s_Wonderland)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Feet_dangling_from_Flight_Deck_%2843031157612%29.jpg","page_title":"Flight Deck (Canada's Wonderland)","context_page_description":"Flight Deck is a steel inverted roller coaster located at Canada's Wonderland in Vaughan, Ontario, Canada. It originally opened in 1995 under the name Top Gun until it was renamed in 2008 to Flight Deck, after Paramount Parks sold Wonderland to Cedar Fair which necessitated the gradual removal of all Paramount names and trademarks from the theme park."},{"page_url":"https://br.wikipedia.org/wiki/Gouarnamant_Jean-Marc_Ayrault_(1)","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a5/Genevi%C3%A8ve_Fioraso_-_2011.JPG","page_title":"Gouarnamant Jean-Marc Ayrault (1)","context_page_description":"Gouarnamant Jean-Marc Ayrault eo ar gouarnamant savet gant ar Parti Socialiste a ren ar Frañs abaoe ar 16 Mae 2012 betek an 18 a viz Mezheven 2012. Da heul Gouarnamant François Fillon e teuas. Heuliet gant Gouarnamant Jean-Marc Ayrault e boe."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%BC%80%EC%A0%9C%EB%88%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Kedjenou_poulet_sauce_claire.JPG","page_title":"케제누","context_page_description":"케제누는 코트디부아르를 비롯한 서아프리카 지역에서 먹는 음식이다. 닭이나 큰사탕수수쥐 등 여러 가지 사냥 고기로 만든 스튜이다. 전통적으로는 \\"카나리\\"라 불리는 테라코타 냄비에 담아 장작불에 요리한다. 매운맛이 나는 음식으로, 아체케 또는 쌀밥과 함께 먹는다."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%82%93%E5%8D%8E","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Denghua1955.jpg","page_title":"邓华","context_page_description":"邓华，原名邓多华，字实秋，湖南郴州人，中国人民解放军开国上将。曾任中国解放军副总参谋长，军事科学院副院长。\\n邓华早年参加湘南起义，并担任红一军团第1师第3团、第2团政治委员等职，参与历次中央苏区反围剿战役与长征。抗日战争期间，担任八路军115师685团政治处主任、政委，参与平型关战役；后组建冀东挺进军，发动冀东大暴动，创建冀东抗日根据地，并率部参加百团大战。第二次国共内战期间，他担任辽西军区司令员，参与指挥秀水河子战斗、四平保卫战、辽沈战役、平津战役、湘赣战役、广东战役、海南岛战役等，兼任广东军区第一副司令员。随后，他担任中国人民志愿军第一副司令员兼第一副政治委员，协助彭德怀指挥朝鲜战争全部五次战役。后担任志愿军代理司令员兼政治委员，组织指挥上甘岭战役和1953年夏季战役等。回国后，邓华担任东北军区第一副司令员、代理司令员、中国人民解放军副总参谋长兼沈阳军区司令员。1959年庐山会议上，邓华因彭德怀案株连被撤职批斗，贬任四川省副省长。文革结束后，恢复名誉并任军事科学院副院长、中共中央军委委员。1980年因病于上海去世。"},{"page_url":"https://cs.wikipedia.org/wiki/Pantofel","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Slippers.jpg","page_title":"Pantofel","context_page_description":"Pantofel respektive pantofle či papuče je lehká domácí obuv obvykle bez podpatku s uzavřenou či otevřenou špičkou. Pojem souvisí s českým zvykem přezouvat se v domácím prostředí u vchodových dveří, zaměňovat venkovní obuv za speciální domácí obuv. Někdy se domácí obuvi také říká trepky.\\nVelké nazouvací pantofle, jež se obvykle natahují přes venkovní obuv, bývají občas používány jako ochrana před poškozením podlahy na hradech, zámcích a v jiných památkově chráněných objektech.\\nZvláštním podtypem jsou sandálové pantofle, které připomínají sandály, podobně jako ty vyráběné firmou Birkenstock. Často bývají vybaveny přezkami, které umožňují nastavit obuv tak, aby lépe pasovala na nohy. Jsou vhodné například pro lidi, kteří mají vysoký nárt."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%91%D0%B5%D0%BB%D0%BE%D0%B3%D1%80%D0%B0%D0%B4%D1%87%D0%B8%D1%88%D0%BA%D0%B8_%D0%A1%D1%82%D0%B5%D0%BD%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/%D0%91%D0%B5%D0%BB%D0%BE%D0%B3%D1%80%D0%B0%D0%B4%D1%87%D0%B8%D1%88%D0%BA%D0%B8_%D1%81%D0%BA%D0%B0%D0%BB%D0%B8_09.JPG","page_title":"Белоградчишки Стени","context_page_description":"Белоградчишки Стени – група се песочникповрзани седиментни стени и конгломератски формации кои се наоѓаат на западните падини на Стара Планина, во северозападниот дел на Бугарија во близина на градот Белоградчик, по кој овие стени и го добиле името. Боите на стените варираат од црвена до жолта, а во висина некои достигнуваат и 200 м. Белоградчишките Стени имаат необичен облик, поврзани се со занимливи легенди и често именувани по луѓето и предметите на кои ги потсетуваат. Бугарската влада ги прогласила за природно наследство и тие претставуваат главна туристичка атракција во Видинската Област. На овие стени расте загрозениот ендемски вид во Бугарија, Hieracium belgradense."},{"page_url":"https://en.wikipedia.org/wiki/Rail_transport_in_France","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/TGV_Est_Paris.jpg","page_title":"Rail transport in France","context_page_description":"Rail transport in France is marked by a clear predominance of passenger traffic, driven in particular by high-speed rail. The SNCF, the national state-owned railway company, operates most of the passenger and freight services on the national network managed by its subsidiary SNCF Réseau. France currently operates the second-largest European railway network, with a total of 29,901 kilometres of railway.\\nThe first rail line in the country opened in 1827 from Saint-Étienne to Andrézieux. The network has undergone a major modernization since 1981 with the arrival of the TGV high-speed rail service which has been consistently expanded in subsequent years.\\nIn 2017, there were 1.762 billion journeys on the French national rail network, among which 1.270 billion on SNCF services and 493 million on RATP sections of the RER, the express regional network operating in the Paris area which is shared between both companies. The Paris suburban rail services represents alone 82% of the French rail annual ridership.\\nWith a total of 100.2 billion passenger-kilometres, France has the fifth-most used passenger network worldwide, and second-most used in Europe after that of Russia."},{"page_url":"https://es.wikipedia.org/wiki/Luis_Juan_Mar%C3%ADa_de_Borb%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Louis_Jean_Marie_de_Bourbon%2C_Duke_of_Penthi%C3%A8vre_by_Nattier_or_Tocqu%C3%A9.jpg","page_title":"Luis Juan María de Borbón","context_page_description":"Luis Juan María de Borbón, duque de Penthièvre, hijo de Luis Alejandro de Borbón y su esposa, María Victoria de Noailles. También era nieto de Luis XIV de Francia y de su amante, Madame de Montespan.\\nDesde su nacimiento fue conocido como el Duque de Penthièvre. También poseyó los títulos de Príncipe de Lamballe, Príncipe de Carignano, Duque de Rambouillet, Duque de Aumale, Duque de Gisors, Duque de Châteauvillain, Duque de Arc-en-Barrois, Duque de Amboise, Conde de Eu y Conde de Guingamp.​​"},{"page_url":"https://fr.wikipedia.org/wiki/Coquille_de_gast%C3%A9ropode","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Caracol_snail_Galicia.jpg","page_title":"Coquille de gastéropode","context_page_description":"De nombreuses espèces de gastéropodes sont munies d'une coquille extérieure plus ou moins importante : atrophiée chez les limaces, elle est assez grosse pour abriter l'animal entier chez les escargots par exemple ; elle constitue alors une protection contre les prédateurs et la sécheresse. Ces coquilles, dites univalves, présentent des particularités par rapport aux coquilles des autres mollusques. Ils sont calcicoles facultatifs ou obligatoires, plus rarement calcifuges et dans les régions à sol non calcaire peuvent ronger la coquille d'autres individus, d'os, de coquilles d'œufs.\\nLa coquille est sécrétée par un épais pli de peau, appelé le manteau. Elle est composée principalement de carbonate de calcium. Les gastéropodes ont donc besoin d'une alimentation riche en calcium."},{"page_url":"https://pl.wikipedia.org/wiki/Cieurac","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Chateau_de_Cieurac_-_20140922_3.jpg","page_title":"Cieurac","context_page_description":"Cieurac – miejscowość i gmina we Francji, w regionie Oksytania, w departamencie Lot.\\nWedług danych na rok 1990 gminę zamieszkiwały 264 osoby, a gęstość zaludnienia wynosiła 14 osób/km²."},{"page_url":"https://sv.wikipedia.org/wiki/Lycksj%C3%B6n","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Lycksj%C3%B6n_2015b.jpg","page_title":"Lycksjön","context_page_description":"Lycksjön är en skogssjö i Haninge kommun i Södermanland som ingår i Tyresåns huvudavrinningsområde. Sjön är 12,4 meter djup, har en yta på 0,192 kvadratkilometer och befinner sig 22,3 meter över havet. Sjön gränsar i öster till Tyresta nationalpark.\\nLycksjön ingår i Tyresåns sjösystem och utgör källan till Vendelsån som mynnar ut i Drevviken. Sjön är relativt förskonad från försurning."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D1%8D%D0%BD%D0%BB%D0%B8,_%D0%9C%D0%B0%D0%B9%D0%BA%D0%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Mrs._Michael_Manley%2C_Prime_Minister_Michael_Manley_and_Jimmy_Carter_during_an_Oval_Office_meeting_1977.png","page_title":"Мэнли, Майкл","context_page_description":"Майкл Но́рман Мэ́нли — ямайский политик, премьер-министр Ямайки в, сторонник демократического социализма. Один из популярнейших политиков в истории Ямайки."},{"page_url":"https://de.wikipedia.org/wiki/Sterkuliengew%C3%A4chse","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2a/Firmiana_simplex_-_leaves.jpg","page_title":"Sterkuliengewächse","context_page_description":"Die Unterfamilie Sterkuliengewächse, auch Stinkbaumgewächse genannt, gehören jetzt zur Pflanzenfamilie der Malvengewächse in der Ordnung der Malvenartigen. Sie enthält zwölf Gattungen mit etwa 400 Arten. Die Verbreitung ist pantropisch. Die in Mitteleuropa bekanntesten Gattungen sind die Stinkbäume und Kolabäume."},{"page_url":"https://de.wikipedia.org/wiki/Geschichte_der_Imkerei","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/90/Ludwig_Armbruster_1956.jpg","page_title":"Geschichte der Imkerei","context_page_description":"Die Geschichte der Imkerei ist eng mit der Geschichte der Menschheit verbunden. Seit Jahrtausenden werden Bienen wegen ihrer Produkte wie Wachs und Honig genutzt und gehalten.\\nHonigbienen sind noch Wildtiere, die einer Betreuung durch den Menschen eigentlich nicht bedürfen. Ursprünglich bevorzugten sie zum Errichten ihres Wabenbaus Hohlräume in Bäumen. Zunächst wurden Bienenvölker in hohlen Baumstämmen abgeerntet. Später wurden die betreffenden Baumstücke herausgeschnitten und an einem günstigeren Standort, wie im Hausbereich, aufgestellt. Damit war die Klotzbeute entwickelt. Aus der gelegentlichen Honigsuche entwickelte sich die Tätigkeit des Zeidlers, des Honigsammlers mit Waldbienenhaltung.\\nDie Geschichte der modernen Imkerei begann im 19. Jahrhundert mit der Umstellung von der Korbimkerei zur Kastenimkerei mit beweglichen Waben, die sich zur weitverbreiteten Magazin-Imkerei entwickelt hat. Bei der Korbimkerei wurde nur natürlich anfallenden Bienenschwärmen eine menschengeschaffene Nisthöhle gegeben. Bei der Ernte von Honig und Bienenwachs wurde das Wabenwerk zerstörend herausgeschnitten."},{"page_url":"https://en.wikipedia.org/wiki/Muttom_metro_station","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Muttom_Metro_station.jpg","page_title":"Muttom metro station","context_page_description":"Muttom is a station of Kochi Metro. The station is located between Ambattukavu and Kalamassery. The service line to the Metro Operations Control Centre and the train yard at Muttom branches off from here.\\nIt was inaugurated by the Prime Minister of India Narendra Modi on 17 June and opened for public on 19 June 2017 as a part of the first stretch of the metro system, between Aluva and Palarivattom."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%83%AB%E3%83%8E%E3%83%AB%E3%83%95%E3%82%A3%E3%83%BC%E3%83%8B%E5%A4%AB%E5%A6%BB%E5%83%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/The_Arnolfini_Portrait%2C_d%C3%A9tail_%286%29.jpg","page_title":"アルノルフィーニ夫妻像","context_page_description":"『アルノルフィーニ夫妻像』は、初期フランドル派の画家ヤン・ファン・エイクが1434年に描いた絵画。合計3枚のオークのパネルに油彩で描かれたパネル画である。日本では『アルノルフィーニ夫婦像』、『アルノルフィーニ夫妻の肖像』などと呼ばれることもあり、精緻な油絵の嚆矢として、西欧美術史で極めて重要視されている作品である。\\n二人の人物の全身像が描かれた絵画で、イタリア人商人ジョヴァンニ・ディ・ニコラ・アルノルフィーニ とその妻を、フランドルのブルッヘにあった夫妻の邸宅を背景として描いた作品だとされている。作品にこめられた寓意性、独特の幾何学的直交遠近法、背面の壁にかけられた鏡に映し出される反転した情景など、西洋美術史上でも極めて独創的で複雑な構成を持った作品で、婚姻契約の場面を記録するために描かれた珍しい絵画であると見なす美術史家もいる。\\n美術史家エルンスト・ゴンブリッチは「イタリアのルネサンスにおけるドナテッロやマサッチオの作品と同じように、新たな境地を開いた革命的といえる作品である。魔法のように現実の室内がパネルに再現されている。事物をありのままにとらえることが出来る、完璧な観察眼を持った史上最初の芸術家である」としている。作者ファン・エイクのサインが1434年の日付とともに記され、同じくファン･エイクと兄のフーベルト・ファン・エイクが描いた『ヘントの祭壇画』とともに、パネルに描かれた油絵としてはもっとも古く、かつ有名な絵画である。ロンドンのナショナル・ギャラリーが1842年に購入し、それ以来ナショナル・ギャラリーが所蔵している。\\nファン･エイクは半透明で艶のある薄い顔料を幾層にも塗り重ねる手法で『アルノルフィーニ夫妻像』を仕上げた。生き生きとした色調はこの作品に現実味を与え、アルノルフィーニの世俗的な財産と富裕さを描き出している。ファン・エイクは、それまで主流だったテンペラよりも油彩のほうが乾燥時間が長くかかることを利用して、まだ濡れている絵具層のうえから新たな絵具を乗せて混ぜ合わせる技法を用いた。この技法によって、微妙な陰影を作り出し、三次元の形状を絵画に表現することに成功したのである。さらにファン・エイクは油絵具の使用によって、様々なモチーフの表面が持つ質感を正確に描きあげた。また、『アルノルフィーニ夫妻像』には、画面左側の窓から射し込む光が、直接、あるいは拡散して、室内のモチーフの表面に反射している様子が描かれている。このことから、背景の鏡の脇に吊り下げられているロザリオの珠の一つ一つに表現されているハイライトのような細部の描き分けに、拡大鏡を使用したのではないかと考えられている。\\n『アルノルフィーニ夫妻像』に見られる錯視的技法は、当時の絵画としては懸絶した水準にある。"},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%B5%E0%AE%BE%E0%AE%A9%E0%AE%B5%E0%AE%A9%E0%AF%8D_%E0%AE%AE%E0%AE%BE%E0%AE%A4%E0%AF%87%E0%AE%B5%E0%AE%BF_%E0%AE%88%E0%AE%9A%E0%AF%8D%E0%AE%B5%E0%AE%B0%E0%AE%AE%E0%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Polonnaruwa-palau10.jpg","page_title":"வானவன் மாதேவி ஈச்வரம்","context_page_description":"வானவன் மாதேவி ஈச்வரம் என்பது இலங்கையின் பண்டைய தலைநகரங்களில் ஒன்றாகிய பொலன்னறுவையில் சோழர்களால் கட்டப்பட்ட ஒரு சிவன் கோயில் ஆகும். 10 ஆம் நூற்றாண்டின் இறுதி தொடக்கம், 1070 ஆம் ஆண்டு வரை, இந்த நகரைத் தலைநகரமாகக் கொண்டு ஆட்சி நடத்திய சோழர்கள் அமைத்த கோயில்களுள், முழுமையாக எஞ்சியுள்ளது இதுவேயாகும்."},{"page_url":"https://pl.wikipedia.org/wiki/Holden_Apollo","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/1989-1991_Holden_Apollo_%28JK%29_SLE_sedan_%282011-01-13%29.jpg","page_title":"Holden Apollo","context_page_description":"Holden Apollo − samochód osobowy średniej klasy sprzedawany w latach 1989-1997 przez australijską firmę Holden. Został wprowadzony jako następca dla modelu Camira. Apollo był bliźniaczą wersją Toyoty Camry, która także była sprzedawana na rynku australijskim. Oba modele różniły się między sobą detalami nadwozia.\\nPowstały dwie generacje modelu, obie dostępne jako 4-drzwiowy sedan lub 5-drzwiowe kombi. Pierwsza z nich wytwarzana była w latach 1989–1992 w dwóch seriach, JK i JL, oparto ją na Toyocie Camry V20. Jako źródło napędu dostępne były dwie wersje silnika R4 2.0 produkcji Toyoty. Druga generacja powstawała w latach 1993–1996 także w dwóch seriach, JM i JP. Dostępna była z dwoma silnikami, R4 2.2 i V6 3.0. Następcą modelu został Holden Vectra."},{"page_url":"https://es.wikipedia.org/wiki/Octodontidae","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Degu-Gizzy.jpg","page_title":"Octodontidae","context_page_description":"Los octodóntidos son una familia de roedores histricomorfos propios de Sudamérica. Se reconocen trece especies de octodóntidos, en ocho géneros. La especie más conocida es el degú."},{"page_url":"https://id.wikipedia.org/wiki/Fischbr%C3%B6tchen","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/GT_Bismarckheringfischbr%C3%B6tchen_2.jpg","page_title":"Fischbrötchen","context_page_description":"Fischbrötchen adalah roti lapis yang dibuat dengan ikan dan komponen lainnya seperti bawang putih segar atau kering, acar, saus remoulade, saus lobak krem, kecap, atau saus koktail. Hal ini umumnya dimakan di Jerman Utara, karena wilayah ini dekat dengan Laut Utara dan Laut Baltik.\\nPenyajian yang umum dilakukan dengan ikan jenis bismarck herring atau soused herring. Varietas lain menggunakan Brathering, rollmops, sprat Eropa, salmon, makarel asap Eropa, varian ikan goreng lainnya. Udang kadang-kadang digunakan, begitu pula berbagai jenis makanan laut lainnya. Fischbrötchen biasanya disajikan di restoran cepat saji atau restoran take-out.\\nHanover Fair pada awalnya sehari-hari dikenal sebagai pameran Fischbrötchen karena roti ikan disajikan di sana sebagai camilan."},{"page_url":"https://pl.wikipedia.org/wiki/Brazos","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Brazos_watershed.png","page_title":"Brazos","context_page_description":"Brazos – rzeka w południowo-zachodnich Stanach Zjednoczonych, w stanie Teksas. Jej długość wynosi 1352 km, a dorzecze ma 116 tys. km².\\nJej źródła znajdują się na wyżynie Llano Estacado. Uchodzi do Zatoki Meksykańskiej w mieście Freeport, w okolicach Houston. Główny dopływ to Clear Fork. Bieg rzeki przegrodzony jest w trzech miejscach zaporami. Nad Brazos zlokalizowane są dwie duże elektrownie. Najważniejszym miastem nad rzeką Brazos jest Waco."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%8E%8B%E8%80%81%E5%90%89%E6%B6%BC%E8%8C%B6","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5b/JDB_drink.jpg","page_title":"王老吉涼茶","context_page_description":"王老吉凉茶是中国广东著名凉茶，于清朝道光年间由广东鹤山人王泽邦所创。"},{"page_url":"https://et.wikipedia.org/wiki/Orthriophis_taeniurus","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Orthriophis_taeniurus_friesei_-_serpent-ratier_lignee_de_taiwan_-_M%C3%A9nagerie_Paris-France_01.JPG","page_title":"Orthriophis taeniurus","context_page_description":"Orthriophis taeniurus on Colubridae sugukonna maoliik."},{"page_url":"https://fi.wikipedia.org/wiki/Aleksanteri_II_(patsas,_Helsinki)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Helsinki_Lutheran_Chathedral_and_the_statue.jpg","page_title":"Aleksanteri II (patsas, Helsinki)","context_page_description":"Aleksanteri II on monumentaalinen patsaskokonaisuus, joka sijaitsee Helsingin Senaatintorilla.\\nPatsaan päähahmo kuvaa Suomen suuriruhtinas Aleksanteri II:sta pitämässä puhetta kokoonkutsumillaan Helsingin säätyvaltiopäivillä vuonna 1863 Suomen Kaartin upseerin univormussa. Patsaaseen kuuluu neljä allegorista veistosryhmää, jotka esittävät kukin neljää eri hyvettä - Lakia, Työtä, Rauhaa ja Valoa.\\nSäätyvaltiopäivien tilaama ja Johannes Takasen ja Walter Runebergin suunnittelema muistomerkki paljastettiin huhtikuussa 1894. Paljastustilaisuus oli suuri isänmaallinen mielenosoitus jalona hallitsijana pidetyn ja keisarin itsevaltiutta rajoittamaan pyrkineen keisari Aleksanteri II:n muistolle.\\nKeisari Nikolai II:n – Aleksanteri II:n pojanpojan – vuonna 1899 aloittaman sortokauden aikana patsas vakiintui venäläisvastaisten mielenosoitusten pitopaikaksi, jolla muistettiin \\"vapauttajakeisariksi\\" popularisoitua Aleksanteri II:a.\\nVenäjän ulkopuolella on nykyään vain kaksi Aleksanteri II:lle omistettua muistomerkkiä julkisilla paikoilla. Toinen on Bulgarian pääkaupungissa Sofiassa. Mark Antokolskin veistos on Kiovan Venäläisen taiteen museon pihalla. Odessan Aleksanterinpuistossa on N. I."},{"page_url":"https://br.wikipedia.org/wiki/Reun_Kerviler","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Kerviler_1885.gif","page_title":"Reun Kerviler","context_page_description":"René Mathurin Marie Pocard du Cosquer de Kerviler, anavezetoc'h evel René Kerviler pe Reun Kerviler, ganet d'an 13 a viz Du 1842 e Gwened ha marv d'an 12 a viz Mae 1907 en Oriant, a oa un ijinour, un arkeologour hag un istorour breizhat. Gantañ e voe savet ar Répertoire général de bio-bibliographie bretonne."},{"page_url":"https://fr.wikipedia.org/wiki/6_Heures_du_Castellet_2011","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6b/Oreca03boutsen2011.JPG","page_title":"6 Heures du Castellet 2011","context_page_description":"Les 6 Heures du Castellet 2011, disputées le 3 avril 2011 sur le circuit Paul-Ricard en France, sont la trente-sixième course des Le Mans Series courue depuis 2004. Il s'agit de la dix-huitième édition de cette épreuve, la première sur un format de six heures, et la première manche des Le Mans Series 2011.\\nAprès avoir été reléguée en fond de grille lors des qualifications, en raison d'une non-conformité réglementaire, la Pescarolo 01 nᵒ 16, engagée en catégorie LMP1 et pilotée par Emmanuel Collard, Christophe Tinseau et Julien Jousse déborde l'intégralité des concurrents pour s'en aller décrocher la victoire. Dans la catégorie LMP2, la Zytek nᵒ 42, pilotée par Gary Chalandon, Karim Ojjeh et Tom Kimber-Smith l'emporte. Les pilotes Julien Schell, Mirco Schultis et Patrick Simon remportent la catégorie FLM.\\nLa course est marquée par un départ chaotique en raison de la voiture de sécurité qui est restée en piste pour un second tour alors que les feux sont passés au vert. Cet incident rare sème le trouble au sein du peloton des voitures des catégories GTE Am et Pro, les Porsche 911 GT3 RSR, les plus endommagées, ne peuvent lutter pour la victoire."},{"page_url":"https://es.wikipedia.org/wiki/Sakari_Kukko","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Sakari_Kukko.jpg","page_title":"Sakari Kukko","context_page_description":"Jyrki Sakari Kukko es un músico finlandés. Kukko es especialmente conocido por su música música étnica que ha tocado junto a su banda Piirpauke En la década de 1980 Kukko tocó también junto a la banda de Youssou N'Dour, Étoile du Dakar, en Senegal. También ha colaborado como músico invitado en grupos de música de rock finlandesa, realizando, entre otras cosas, los álbumes Amorphis, y Kingston Wall."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%B4%A5%E4%B9%85%E8%A6%8B%E5%B8%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/%E3%81%86%E3%81%BF%E3%81%9F%E3%81%BE%E4%BD%93%E9%A8%93%E3%83%91%E3%83%BC%E3%82%AF_%E3%81%A4%E3%81%8F%E3%81%BF%E3%82%A4%E3%83%AB%E3%82%AB%E5%B3%B6.jpg","page_title":"津久見市","context_page_description":"津久見市は、大分県の東海岸に位置する市である。大分県の市の中では、最も人口が少ないが、人口密度は、別府市、大分市に次いで3番目に高い。"},{"page_url":"https://es.wikipedia.org/wiki/Camino_de_Santiago_Portugu%C3%A9s","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Pontevedra%2C_Cami%C3%B1o_01-10b.JPG","page_title":"Camino de Santiago Portugués","context_page_description":"Por el Camino Portugués el peregrino recorre la costa portuguesa de sur a norte, partiendo del Algarve. La capital en España del Camino Portugués es la ciudad de Pontevedra en la que se ubica la Iglesia de la Virgen Peregrina, templo barroco y única iglesia circular en España, con planta de concha venera, símbolo de los peregrinos, en la que la Virgen Peregrina acoge a los peregrinos en la etapa española del camino portugués.\\nLagos, capital del Algarve, es el punto inicial del Camino Portugués de la Costa, con su conjunto monumental. Se puede conocer la cultura árabe contrasta en Alcácer do Sal, y se transita por el valle del Tajo, pasando por Setúbal, la capital portuguesa, Lisboa, la ciudad universitaria de Coímbra y Oporto, declarada Patrimonio de la Humanidad. A 50 km de la frontera española se encuentra Viana do Castelo, uno de los puntos de visita más interesantes de este lado del Camino Portugués.\\nLa despedida portuguesa se produce en Valença do Miño, para ya encontrarse con Tuy y posteriormente con Pontevedra. Caldas de Reyes y Padrón son el preámbulo antes de alcanzar Santiago de Compostela.\\nEl Camino Portugués del Norte incluye las siguientes etapas:"},{"page_url":"https://da.wikipedia.org/wiki/Nicolaas_Beets","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Portrait_of_Nicolaas_Beets_by_Th%C3%A9r%C3%A8se_Schwartze_Centraal_Museum_8246.jpg","page_title":"Nicolaas Beets","context_page_description":"Nicolaas Beets var en hollandsk forfatter.\\nBeets blev færdiguddannet som præst i 1854 og blev i 1874 professor i kirkehistorie i Utrecht. Han var i begyndelsen af sin karriere inspireret af Byron for at siden udvikle sig til en blid familiedigter og opnåede som en forfatter af denne type stor popularitet. Mest populær var han under pseudonymet Hildebrand med udgivelserne af de idylliske skildringer Camera obscura. Beets samlede \\"Dichtwerken\\" blev udgivet i 5 bind i perioden 1886-91."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%B2%D0%B3%D1%83%D1%81%D1%82%D0%B0_%D0%93%D0%B5%D1%81%D1%81%D0%B5%D0%BD-%D0%9A%D0%B0%D1%81%D1%81%D0%B5%D0%BB%D1%8C%D1%81%D1%8C%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Arveprins_Frederik.jpg","page_title":"Августа Гессен-Кассельська","context_page_description":"Августа Гессен-Кассельська, повне ім'я Августа Софія Фредеріка Марія Кароліна Юлія Гессен-Кассельська, — принцеса Гессен-Кассельська, донька принца Гессен-Кассельського Вільгельма та принцеси Данії Луїзи Шарлотти, дружина барона Карла Бліксен-Фінеке."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%98%E3%83%B3%E3%83%AA%E3%83%BC3%E4%B8%96_(%E3%82%A4%E3%83%B3%E3%82%B0%E3%83%A9%E3%83%B3%E3%83%89%E7%8E%8B)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Henry_III_of_England_-_Illustration_from_Cassell%27s_History_of_England_-_Century_Edition_-_published_circa_1902.jpg","page_title":"ヘンリー3世 (イングランド王)","context_page_description":"ヘンリー3世は、プランタジネット朝のイングランド王。ジョン王と王妃イザベラ・オブ・アングレームの子。妃はプロヴァンス伯レーモン・ベランジェ4世の娘エリナー・オブ・プロヴァンス。\\n諸侯たちの反乱の中で幼くして王位に就き、フランスの領土問題とマグナ・カルタに象徴される議会問題を解決しようとしたが、50年を超える長い治世において目立った成果を挙げることはできなかった。しかしこの時代は国王裁判所が着実に活動し、コモン・ローが王国に進展した時代とも評される。非常に信心深く、エドワード懺悔王を好み、ウェストミンスター寺院を現在の姿に大改築したことで知られる。"},{"page_url":"https://fr.wikipedia.org/wiki/Beaupuy_(Gers)","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/51/Map_commune_FR_insee_code_32038.png","page_title":"Beaupuy (Gers)","context_page_description":"Beaupuy est une commune française située dans le département du Gers en région Occitanie."},{"page_url":"https://pl.wikipedia.org/wiki/Cunac","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Vue_g%C3%A9n%C3%A9rale%2C_Cunac_%288634781308%29.jpg","page_title":"Cunac","context_page_description":"Cunac – miejscowość i gmina we Francji, w regionie Oksytania, w departamencie Tarn.\\nWedług danych na rok 1990 gminę zamieszkiwały 994 osoby, a gęstość zaludnienia wynosiła 156 osób/km²."},{"page_url":"https://es.wikipedia.org/wiki/La_Serena","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Pileta_del_patio_interior_de_la_Municipalidad_de_La_Serena_-_panoramio.jpg","page_title":"La Serena","context_page_description":"La Serena es una comuna y ciudad del Norte Chico de Chile, capital de la Región de Coquimbo. Es uno de los principales destinos turísticos del país.​ Destaca su centro histórico con una preservada arquitectura neocolonial caracterizada por sus balcones, pequeñas plazas e iglesias de piedra de varios siglos de antigüedad y sus extensas playas. Forma parte de la provincia de Elqui y limita al sur con Coquimbo y Andacollo, al norte con La Higuera, al oeste con el océano Pacífico y al este con Vicuña. Integra junto con las comunas de Andacollo, La Higuera, Paihuano y Vicuña el Distrito Electoral N.º 7 y pertenece a la Circunscripción Senatorial 4.ª, de la IV Región de Coquimbo.\\nFundada en 1544, es la segunda ciudad más antigua de Chile después de la capital del país, Santiago. Por otro lado constituye parte de una conurbación con la vecina ciudad puerto de Coquimbo, que suman una población estimada de más de 486 mil habitantes en 2012, dejándola como la cuarta área urbana más importante del país."},{"page_url":"https://es.wikipedia.org/wiki/Alex_Z%C3%BClle","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Alex_ZUELLE.jpg","page_title":"Alex Zülle","context_page_description":"Alex Zülle es un exciclista profesional suizo. Destacó por su gran calidad en la montaña, pero sobre todo fue un especialista en la contrarreloj."},{"page_url":"https://bs.wikipedia.org/wiki/Korov","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Convolvulus_arvensis.jpg","page_title":"Korov","context_page_description":"Korov su sve biljne vrste koje nisu cilj uzgoja na nekoj uzgojnoj površini."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1993","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Sebasti%C3%A1n_Henao_en_el_campeonato_nacional_de_ciclismo_en_ruta_de_Colombia_2018.png","page_title":"Lijst van personen geboren in 1993","context_page_description":"Dit is een lijst van personen die geboren zijn in 1993.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://vi.wikipedia.org/wiki/Pyrotin","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/55/Pyrrhotite_Mexique.jpg","page_title":"Pyrotin","context_page_description":"Pyrotin, hay nhóm pyrotin hoặc pyrrhotit, là một khoáng vật đa hình sulfua sắt có công thức tổng quát FeₙSₙ₊₁ hay Fe₍₁₋ₓ₎S với x = 0,1 - 0,2 thường gặp hơn cả, hoặc Fe₀ ₈₇₅S, hay Fe²⁺1−nFe³⁺2/3nS."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%B8%D0%B9_%D0%BF%D0%BE%D1%81%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Svyatoy-post.jpg","page_title":"Великий пост","context_page_description":"Вели́кий по́ст — центральный пост во всех исторических церквях, цель которого — подготовка христианина к празднованию Пасхи; соответствующий период литургического года, отмеченный в богослужении молитвами покаяния и воспоминания крестной смерти и воскресения Иисуса Христа. Установлен в память о том, что Христос постился в пустыне сорок дней. Длительность Великого поста так или иначе связана с числом 40, однако фактическая его продолжительность зависит от правил исчисления, принятых в данной конкретной конфессии."},{"page_url":"https://en.wikipedia.org/wiki/Mount_of_Olives","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fc/Jerusalem_-_Pyramide_de_Zacharie.jpg","page_title":"Mount of Olives","context_page_description":"The Mount of Olives or Mount Olivet is a mountain ridge east of and adjacent to Jerusalem's Old City. It is named for the olive groves that once covered its slopes. The southern part of the Mount was the Silwan necropolis, attributed to the ancient Judean kingdom. The mount has been used as a Jewish cemetery for over 3,000 years and holds approximately 150,000 graves, making it central in the tradition of Jewish cemeteries. Several key events in the life of Jesus, as related in the Gospels, took place on the Mount of Olives, and in the Acts of the Apostles it is described as the place from which Jesus ascended to heaven. Because of its association with both Jesus and Mary, the mount has been a site of Christian worship since ancient times and is today a major site of pilgrimage for Catholics, the Eastern Orthodox, and Protestants.\\nMuch of the top of the hill is occupied by At-Tur, a former village that is now a neighbourhood of East Jerusalem."},{"page_url":"https://sk.wikipedia.org/wiki/Ercsi","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Ercsi_-_Temple.jpg","page_title":"Ercsi","context_page_description":"Ercsi je mesto v Maďarsku v Stoličnobelehradskej župe v Martonvásárskom okrese.\\nMá rozlohu 6 531 ha a žije tu 8 115 obyvateľov."},{"page_url":"https://la.wikipedia.org/wiki/Ioannes_Petrus_Altgeld","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/John_Peter_Altgeld.jpg","page_title":"Ioannes Petrus Altgeld","context_page_description":"Ioannes Petrus Altgeld, causidicus, fuit rerum politicarum peritus Americanus factionis Democraticae, qui inter alia ab anno 1893 usque ad annum 1897 Illinoesiae gubernator fuit."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%88%B4%E6%9C%A8%E6%83%A0%E4%B8%80","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d5/Keiichi_Suzuki_1962.jpg","page_title":"鈴木惠一","context_page_description":"鈴木 恵一は、日本スケート連盟理事、元スピードスケート選手。"},{"page_url":"https://nl.wikipedia.org/wiki/Twijzel","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/N.H.Kerk_Twijzel.JPG","page_title":"Twijzel","context_page_description":"Twijzel is een dorp in de gemeente Achtkarspelen, in Nederlandse provincie Friesland.\\nHet ligt ten noorden van Drachten, tussen Buitenpost en De Kooten aan de provinciale weg 355. Het dorp telde in 2019 1.075 inwoners."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A5%D0%B0%D1%82%D1%8C%D0%BC%D0%B0_%D1%82%D1%8E%D1%80%D0%B8%D0%BD%D0%B3%D0%B5%D0%BD%D1%81%D0%BA%D0%B0%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Lavatera_thuringiaca_Uppsala.jpg","page_title":"Хатьма тюрингенская","context_page_description":"Хатьма́ тюри́нгенская — многолетнее растение; вид рода Хатьма семейства Мальвовые."},{"page_url":"https://de.wikipedia.org/wiki/Liliputbahn_Prater","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Wien_02_Liliputbahn_Lok_D1_e_.jpg","page_title":"Liliputbahn Prater","context_page_description":"Die Liliputbahn im Wiener Prater ist eine 3,9 km lange schmalspurige Parkeisenbahn auf einem Rundkurs. Der Name der kleinen Bahn bezieht sich auf den Roman Lilliput von Jonathan Swift, in dem winzige Menschen auf einer Insel Liliput leben."},{"page_url":"https://de.wikipedia.org/wiki/Raublattgew%C3%A4chse","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Ehretia_dicksonii.jpg","page_title":"Raublattgewächse","context_page_description":"Die Raublattgewächse oder Borretschgewächse sind eine Familie der Bedecktsamigen Pflanzen. Die Familie Boraginaceae s. l. enthält 148 bis 156 Gattungen mit etwa 2740 Arten und ist von den gemäßigten Breiten bis in die Tropen weltweit vertreten."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D1%81%D1%82%D0%B8%D0%BB%D1%8C%D0%BE,_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Nicol%C3%A1s_Castillo_%282016%29_%28cropped%29.jpg","page_title":"Кастильо, Николас","context_page_description":"Никола́с Игна́сио Касти́льо Мо́ра — чилийский футболист, нападающий мексиканского клуба «Америка» и национальной сборной Чили."},{"page_url":"https://it.wikipedia.org/wiki/Albergati_(famiglia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Palazzo_Albergati_Bologna.JPG","page_title":"Albergati (famiglia)","context_page_description":"Gli Albergati sono un'antica e prestigiosa famiglia senatoria bolognese."},{"page_url":"https://en.wikipedia.org/wiki/Ford_Falcon_(BF)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/2005_Ford_Falcon_%28BF%29_XR6_Turbo_utility_%282009-02-05%29.jpg","page_title":"Ford Falcon (BF)","context_page_description":"The Ford Falcon (BF) is a full-size car that was produced by Ford Australia from 2005 to 2008. It was the third and final iteration of the sixth generation of this Australian-made model. The station wagon body design continued until 2010, alongside the new seventh generation Falcon range."},{"page_url":"https://de.wikipedia.org/wiki/USS_Newport_News_(CA-148)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/USS_Newport_News_%28CA_148%29%2C_USS_Springfield_%28CLG_7%29_and_USS_Northampton_%28CC_1%29_await_disposal.jpg","page_title":"USS Newport News (CA-148)","context_page_description":"Die 1949 in Dienst gestellte USS Newport News (CA-148) war ein Schwerer Kreuzer der Des-Moines-Klasse. Sie diente als Flaggschiff der Blockadeflotte während der Kubakrise und nahm mit drei Einsätzen am Vietnamkrieg teil. Die Newport News war der letzte nur mit Geschützen bewaffnete Kreuzer im aktiven Dienst der United States Navy, als sich Lenkwaffen bereits als Hauptwaffensystem für Kreuzer durchgesetzt hatten."},{"page_url":"https://no.wikipedia.org/wiki/Yair_Lapid","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Yair_Lapid_-_portrait.jpg","page_title":"Yair Lapid","context_page_description":"Yair Lapid er en israelsk politiker og finansminister i den sittende israelske regjeringen. Han er leder og grunnlegger av partiet Yesh Atid, som ble det nest største i valget i Israel 2013. Yesh Atid ble startet i 2012. Han har tidligere arbeidet som journalist og programleder.\\nHan ble finansminister 15. mars 2013. I hans første tale til Knesset havnet han i en ordkrig med ultra-ortodokse representanter, som blant annet lurte på hvorfor han postet et innlegg på Facebook under sabbaten. I det foreløpige budsjettet kutter Lapid mye i poster som går til ultra-ortodokse institusjoner.\\nYair Lapid er sønn av Tommy Lapid, som blant annet var visestatsmininister i 2003-04."},{"page_url":"https://de.wikipedia.org/wiki/Talstufe","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Baergacht-Wasserfall_Alplsee.JPG","page_title":"Talstufe","context_page_description":"Eine Talstufe oder Talschwelle ist ein markanter Gefällebruch im Längsprofil von Tälern, zumeist von durch Gletscher geformten Trogtälern.\\nTypischerweise weist ein durch Gletscher geformtes Tal eine Folge von Beckenformen und dazwischen liegenden Schwellen auf, die durch die örtlich variierende Tiefenerosion von Talgletschern entsteht. Nach dem Abschmelzen des Eises tritt dies zunächst als Abfolge von Seen mit dazwischen liegenden Stromschnellen oder Wasserfällen in Erscheinung. Gerölltransport, Erosions- und Ablagerungsvorgänge der Fließgewässer lassen daraus schließlich Abfolgen von Talböden und Schluchten entstehen.\\nDerartige Beckenformen mit abruptem Beginn erscheinen oft als markante Stufen, die die ebeneren Talabschnitte voneinander trennen können. Deutliche Stufen entstanden oft dort, wo die Erosionsleistung des einstigen, das Tal erfüllenden Gletschers plötzlich erhöht war, etwa beim Zusammenströmen großer Gletscher. Sie werden dann als Konfluenzstufen bezeichnet. Ähnliche Stufen entstehen auch, wenn sich flächenhaft aufeinander zubewegendes Eís zu Gletscherströmen formiert, die die Gesteinsoberflächen intensiver ausschürfen können."},{"page_url":"https://de.wikipedia.org/wiki/John_Altman_(Komponist)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/John_Altman.jpg","page_title":"John Altman (Komponist)","context_page_description":"John Altman ist ein britischer Komponist und Dirigent."},{"page_url":"https://fr.wikipedia.org/wiki/Gravures_rupestres_de_la_r%C3%A9gion_d%27Ain_Sefra","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Thyout.cl.1.jpg","page_title":"Gravures rupestres de la région d'Ain Sefra","context_page_description":"Les gravures rupestres de la région d'Ain Sefra sont des gravures préhistoriques d'âge néolithique du Sud-oranais. Au long de l'Atlas saharien elles font suite à celles, à l'ouest, de la région de Figuig et précèdent celles, à l'est, des régions d'El-Bayadh, d'Aflou puis de Tiaret. Des gravures comparables ont été décrites, plus à l'est encore, autour de Djelfa et dans le constantinois."},{"page_url":"https://ca.wikipedia.org/wiki/Steve_Carell","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Steve_Carell_2_2013.jpg","page_title":"Steve Carell","context_page_description":"Steve John Carello, més conegut com Steve Carell és un actor, còmic, productor i director estatunidenc.\\nVa fer-se famós per les seves aparicions còmiques a la televisió gràcies a The Daily Show, diari televisiu satíric. Però va ser al cinema, després d'un paper secundari a la pel·lícula Bruce Almighty i Anchorman: The Legend of Ron Burgundy, que va tenir èxit a 40 anys.\\nTambé és l'actor principal de l'adaptació americana de la sèrie de televisió britànica The Office, emesa per la cadena americana NBC des del 2005. Ha guanyat el Premi Globus d'Or al millor actor de sèrie còmica el 2006."},{"page_url":"https://it.wikipedia.org/wiki/Stazione_di_Laveno_Mombello_Lago","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Laveno_staz_FNM_panoramica.jpg","page_title":"Stazione di Laveno Mombello Lago","context_page_description":"La stazione di Laveno Mombello Lago è la stazione terminale della ferrovia Saronno-Laveno. Si trova in Via Garibaldi, a pochi passi dal centro cittadino e dal Lago Maggiore, dove si trova anche un imbarcadero traghetti, con trasporto auto, della Navigazione Lago Maggiore. Nelle vicinanze è presente inoltre la Stazione di Laveno-Mombello delle Ferrovie dello Stato."},{"page_url":"https://es.wikipedia.org/wiki/Sepultura_(banda)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Andreas_Kisser_2.jpg","page_title":"Sepultura (banda)","context_page_description":"Sepultura es una banda brasileña de thrash metal formada en 1984 en Belo Horizonte por los hermanos Max e Igor Cavalera.​ Está considerado como el grupo de heavy metal más exitoso de Brasil y uno de los más influyentes de dicho género en todo el mundo, ​​​​ aunque su música se orientaría originalmente al thrash, death y groove metal y posteriormente al hardcore, metal alternativo, nu metal y metal industrial.​\\nFormada en el contexto de la represión policial que marcó los últimos años de la dictadura militar brasileña, ​ Sepultura ha disfrutado de éxito internacional desde finales de la década de 1980 con un estilo principalmente orientado hacia el thrash metal gracias a trabajos como Arise Chaos A.D. o Roots.​\\nEl fundador y principal compositor del conjunto, Max Cavalera, dejó la agrupación abruptamente en 1996 como resultado de desacuerdos personales y posteriormente fundó Soulfly.​ Su hermano Igor hizo lo mismo en 2006 y ambos volvieron a unirse en el proyecto Cavalera Conspiracy.​"},{"page_url":"https://en.wikipedia.org/wiki/Kompoloi","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Kompoloi_Gutshof.jpg","page_title":"Kompoloi","context_page_description":"In the plain of Leivithra in 1997 began the excavation work on the ancient winery Kompoloi. They lasted until October 2000."},{"page_url":"https://it.wikipedia.org/wiki/John_Lubbock","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b6/John_Lubbock72.jpg","page_title":"John Lubbock","context_page_description":"John Lubbock, 1º Barone di Avebury, è stato un archeologo britannico."},{"page_url":"https://fr.wikipedia.org/wiki/Village_d%27Ast%C3%A9rix_et_Ob%C3%A9lix","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/RoemermuseumHaltern001.JPG","page_title":"Village d'Astérix et Obélix","context_page_description":"Le Village d'Astérix et Obélix est un village fictif situé en Armorique et jouant un rôle central dans la série de bande dessinée française Astérix. C'est dans ce village où vivent les héros de la série Astérix et Obélix, ainsi que d'autres personnages principaux."},{"page_url":"https://be.wikipedia.org/wiki/%D0%9C%D0%BE%D1%80%D1%8B%D1%86_%D0%91%D0%BB%D1%8F%D0%B9%D0%B1%D1%82%D1%80%D0%BE%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Flickr_-_Siebbi_-_Moritz_Bleibtreu_%281%29.jpg","page_title":"Морыц Бляйбтрой","context_page_description":"Морыц Бляйбтрой — нямецкі акцёр, сын актрысы Монікі Бляйбтрой і акцёра Ганса Брэнера."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D1%80%D0%B5%D0%BD%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Treny_normal.jpg","page_title":"Трены","context_page_description":"«Трены» — цикл из 19 стихотворений-плачей польского поэта Яна Кохановского, изданный в 1580 году. Стихотворения посвящены дочери поэта Уршуле, умершей в 1579 году."},{"page_url":"https://ro.wikipedia.org/wiki/Brake_(Unterweser)","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ea/Brake_Schifffahrtsmuseum_%2801%29.JPG","page_title":"Brake (Unterweser)","context_page_description":"Brake este, printre altele, un oraș din landul Saxonia Inferioară, Germania. Deoarece în Germania există mai multe localități cu acest nume, la nevoie se precizează astfel: Brake (Unterweser)."},{"page_url":"https://en.wikipedia.org/wiki/Ciudad_Universitaria_(Madrid_Metro)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Estaci%C3%B3n_de_Ciudad_Universitaria.JPG","page_title":"Ciudad Universitaria (Madrid Metro)","context_page_description":"Ciudad Universitaria is a station on Line 6 of the Madrid Metro, located beneath Complutense avenue in the Ciudad Universitaria ward in the Moncloa-Aravaca district in fare Zone A. It is named after the Ciudad Universitaria, which is home to the Complutense University of Madrid, the Technical University of Madrid, and the National University of Distance Education. The station's platforms feature tilework representing the bear and the strawberry tree, which is a symbol of Madrid. The station is located next to the Ciudad Universitaria underground train storage depot, where most of Line 6's 5000 series trains are stored."},{"page_url":"https://zh.wikipedia.org/wiki/CNA%E7%AB%B6%E6%8A%80%E9%A4%A8%E7%A7%8B%E7%94%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/CNA_Arena_Akita.jpg","page_title":"CNA競技館秋田","context_page_description":"CNA竞技馆秋田位于秋田县秋田市，可容纳4556人，修建于1994年。是秋田的一个竞技场，由当地城市所有和经营。有线电视公司秋田公司在2015年获得了命名权。内部有一个圆顶形状的154英尺高的天花板，在2016年增加了2088个额外的座位。这里是日本职业篮球联盟北秋田喜悦的主场。秋田最大的篮球场是秋田县体育馆。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%BB%D0%BE%D1%89%D0%B0%D0%B4%D1%8C_%D0%9C%D0%B0%D1%8F_(%D1%81%D1%82%D0%B0%D0%BD%D1%86%D0%B8%D1%8F_%D0%BC%D0%B5%D1%82%D1%80%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Boca_de_acceso_Pza_de_Mayo_y_Casa_Rosada_03.jpg","page_title":"Площадь Мая (станция метро)","context_page_description":"«Площадь Мая» — станция Линии A метрополитена Буэнос-Айреса. В настоящее время станция является конечной остановкой Линии A. Она расположена на площади с одноименным названием, в общественном и финансовом центре города. Эта станция является частью первой линии, открытой 1 декабря 1913 года между ней и станцией Пласа Мисерере."},{"page_url":"https://nl.wikipedia.org/wiki/Ant%C3%B3nio_de_Oliveira_Salazar","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Dr._Salazar_square_2009_in_Santa_Comba_D%C3%A3o%2C_Portugal.jpg","page_title":"António de Oliveira Salazar","context_page_description":"António de Oliveira Salazar was tussen 1932 en 1968 de minister-president van Portugal. Hij gaf leiding aan het autoritaire bewind van de Estado Novo."},{"page_url":"https://it.wikipedia.org/wiki/Via_de%27_Cerretani","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Via_de_cerretani_11.JPG","page_title":"Via de' Cerretani","context_page_description":"Via de' Cerretani si trova a Firenze, tra via Panzani e piazza San Giovanni.\\nLa strada, tra le più trafficate del centro storico, è nel tragitto che va dalla stazione di Santa Maria Novella al Duomo."},{"page_url":"https://en.wikipedia.org/wiki/List_of_mayors_of_Gloucester,_Massachusetts","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Robert_R_Fears_of_Gloucester_Massachusetts.png","page_title":"List of mayors of Gloucester, Massachusetts","context_page_description":"The Mayor of Gloucester, Massachusetts has been the head of the municipal government in Gloucester, Massachusetts since 1874, with the exception of February 10, 1954 to July 1, 1976 when the head of government was the city manager and the mayor was a ceremonial position appointed by the city council."},{"page_url":"https://fr.wikipedia.org/wiki/Transports_en_commun_de_Valserh%C3%B4ne","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Dietrich_Noventis_n%C2%B01054_-_Stac_%28m%C3%A9canisme_d%27urgence_pour_l%27ouverture_des_portes%29.jpg","page_title":"Transports en commun de Valserhône","context_page_description":"Mobi’Vals, anciennement TUB, est le nom commercial du réseau de transport en commun d’autobus desservant la commune nouvelle de Valserhône à l’aide d’un réseau composé de 9 lignes, dont trois à vocation scolaire et quatre assurées uniquement à la demande.\\nCréé en 1986, son exploitation est assuré depuis 2005 par la Régie Départementale des Transports de l’Ain pour le compte de la mairie de Valserhône."},{"page_url":"https://eo.wikipedia.org/wiki/Friedrich_Diez","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Friedrich_Christian_Diez.png","page_title":"Friedrich Diez","context_page_description":"Friedrich Christian DIEZ estis germana filologo kaj fondinto de la moderna scienco pri la latinida lingvaro."},{"page_url":"https://simple.wikipedia.org/wiki/Amritlal_Vegad","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Amritlal_Vegad.jpg","page_title":"Amritlal Vegad","context_page_description":"Amritlal Vegad was an Indian writer and poet. He was born in Madhapar, India. He wrote in Gujarati and Hindi from Jabalpur. Amritlal Vegad was awarded in 2004 with Sahitya Akademi Award for his travelogue – Saundaryani Nadi Narmada and also Madhya Pradesh Rajya Sahitya Award & Rashtrapati Award for his various works. He was best known for his novel Narmada-ki-pari-krama written in Hindi language and Saundaryani Nadi Narmada & Parikramā Narmadā maiyānī in Gujarati language.\\nVegad died on 6 July 2018 from respiratory failure at the age of 89."},{"page_url":"https://de.wikipedia.org/wiki/Jitzchak_Rafa%E2%80%99el","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Yitzhak_Refael.jpg","page_title":"Jitzchak Rafa’el","context_page_description":"Jitzchak Rafa’el war ein israelischer Politiker, der als Religionsminister Mitte der 1970er Jahre in Israel tätig war."},{"page_url":"https://en.wikipedia.org/wiki/Maryland%27s_5th_congressional_district","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2c/Hervey_G_Machen_at_desk_US_Congress_photo.jpg","page_title":"Maryland's 5th congressional district","context_page_description":"Maryland's 5th congressional district comprises all of Charles, St. Mary's, and Calvert counties, as well as portions of Prince George's and Anne Arundel counties. The district is currently represented by Democrat Steny Hoyer, the current House Majority Leader."},{"page_url":"https://cs.wikipedia.org/wiki/Slezin%C3%ADkovit%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Asplenium_hemionitis.jpg","page_title":"Sleziníkovité","context_page_description":"Sleziníkovité je čeleď kapradin z řádu osladičotvaré. Jsou to pozemní, skalní i epifytní kapradiny s listy v růžici, rozšířené po celém světě. V květeně České republiky se vyskytuje několik druhů sleziníku, jelení jazyk celolistý a velmi vzácně i kyvor lékařský."},{"page_url":"https://da.wikipedia.org/wiki/Bodybuilding","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/2001_Extravaganza_Strength_Contest.jpg","page_title":"Bodybuilding","context_page_description":"Bodybuilding er en gymnastikform, hvor man via vægttræning efterstræber en harmonisk udvikling af den menneskelige muskulatur, oprindeligt inspireret af græsk skulpturkunst.\\nLigesom andre sportsgrene, er bodybuilding ofte blevet sat sammen med et misbrug af medicin, f.eks. anabole steroider."},{"page_url":"https://sw.wikipedia.org/wiki/Paul_Berg","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Paul_Berg_in_1980.jpg","page_title":"Paul Berg","context_page_description":"Paul Berg ni mwanakemia kutoka nchi ya Marekani. Hasa anajulikana kwa uchunguzi wake wa DNA. Mwaka wa 1980, pamoja na Walter Gilbert na Frederick Sanger alikuwa mshindi wa Tuzo ya Nobel ya Kemia."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%B5%D1%80%D0%B1_%D0%9B%D1%83%D0%B3%D0%B0%D0%BD%D1%81%D0%BA%D0%BE%D0%B9_%D0%9D%D0%B0%D1%80%D0%BE%D0%B4%D0%BD%D0%BE%D0%B9_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/%D0%93%D0%B5%D1%80%D0%B1_%D0%9B%D0%9D%D0%A0.jpg","page_title":"Герб Луганской Народной Республики","context_page_description":"Герб Луганской Народной Республики — один из государственных символов непризнанной Луганской Народной Республики, наряду с флагом и гимном."},{"page_url":"https://es.wikipedia.org/wiki/Hugh_Nibley","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Nibley_faculty_photo.png","page_title":"Hugh Nibley","context_page_description":"Hugh Winder Nibley fue un profesor de la Universidad Brigham Young. Sus trabajos -los cuales en su mayoría intentaron dar evidencias arqueológicas, lingüísticas e históricas de las propuestas de Joseph Smith Jr.- aunque no sean posición oficial de la Iglesia Mormona, son muy tenidas en cuenta por la comunidad mormona.\\nEscritor y profesor prolífico, de la Biblia y del Libro de Mormón en BYU, tenía fluidez en numerosas lenguas, ​ incluyendo el latín clásico, griego, hebreo, egipcio, copto, árabe, alemán, francés, inglés, italiano y español. Estudió neerlandés y ruso durante la Segunda Guerra Mundial. También estudió inglés antiguo y búlgaro antiguo, y su fluidez en antiguo norse le permitió leer un enciclopedia entera en noruego.\\nEscribió y dio charlas sobre las escrituras mormonas y sobre temas doctrinales, publicó numerosos artículos en las revistas de La Iglesia de Jesucristo de los Santos de los Últimos Días. Su An Approach to the Book of Mormon lo tomó la Iglesia SUD en 1957 como un manual de estudio religioso."},{"page_url":"https://fr.wikipedia.org/wiki/Baie_Burrard","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/PortOVan.jpg","page_title":"Baie Burrard","context_page_description":"La baie Burrard, également appelée passage Burrard ou parfois anse Burrard, est un bras de mer relativement peu profond au sud-ouest de la Colombie-Britannique. Cette baie, formée durant la dernière période glaciaire, sépare d'une part la ville de Vancouver et le reste de la péninsule Burrard et d'autre part les pentes des montagnes North Shore, contreforts de la Chaîne Côtière, où se situent la ville de Vancouver Ouest et la ville et le district de Vancouver Nord.\\nLa baie Burrard, ainsi nommée par le capitaine George Vancouver en l'honneur de Sir Harry Burrard-Neale, abrite le port de Vancouver et est renommée pour ses paysages spectaculaires qui ont notamment inspiré le poète et romancier britannique Malcolm Lowry, auteur du fameux roman Under the volcano."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D0%BE%D0%B7%D0%B0%D0%BD%D0%BE%D0%B2,_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B5%D0%B9_%D0%9C%D0%B8%D1%85%D0%B0%D0%B9%D0%BB%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Rozanov_AM.jpg","page_title":"Розанов, Алексей Михайлович","context_page_description":"Алексе́й Миха́йлович Роза́нов — деятель госбезопасности СССР, лейтенант государственной безопасности; депутат Верховного Совета СССР 1-го созыва. Член РКП с 1919 г. Нарком внутренних дел Чувашской АССР. Входил в состав особой тройки НКВД СССР."},{"page_url":"https://tt.wikipedia.org/wiki/%D0%9C%D1%83%D1%80%D1%82%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Durga%2C_Burdwan%2C_West_Bengal%2C_India_21_10_2012_02.jpg","page_title":"Мурти","context_page_description":"Мурти Санскрит телендә: मूर्ति, ISO: Mūrti; турыдан-туры мәгънәдә: форма, гәүдәләнеш яки каты җисем ул Һинд мәдәниятендә Илаһның сурәте яки поты өчен гомуми төшенчә. Һинд дине гыйбадәтханәләрендә ул символик икона булып тора. Мурти үзе Һинд динендә Ходай түгел, ә Илаһның формасы, гәүдәләнеше яки манифестациясе. Мурти шулай ук кайбер теистик булмаган Җәйничелек традицияләрендә бар, анда алар Җәйничелек гыйбадәтханәләре эчендә символлар яки ихтирам ителгән үлемлеләр буларак хезмәт итәләр һәм муртипуджака ритуалларында табынылалар. Мурти типик рәвештә таштан, агачтан, металлдан коеп яки балчыктан ясала. Борынгы чор текстларында аларның тиешле пропорцияләре, позицияләре һәм ишарәләре тасвирлана, аларга Пураналар, Агамалар һәм Самхиталар керә. Муртиның кыяфәте төрле Һинд дине традицияләрендә төрле, алар җимерүне, куркуны һәм рәхимсезлекне чагылдыручы Угра символизмыннан (Дурга, Кали Алиһәсе), һәм шулай ук Саумья символизмы, ул шатлыкны, белемне һәм гармонияне чагылдыра (Сарасвати, Лакшми). Саумья сурәтләре Һинд дине гыйбадәтханәләрендә киң таралган. Һинд динендә башка мурти формаларына линга керә."},{"page_url":"https://es.wikipedia.org/wiki/Manuscritos_de_hoja_de_palma","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Odia_palm_leaf_manuscript.JPG","page_title":"Manuscritos de hoja de palma","context_page_description":"Los manuscritos de hojas de palma son manuscritos hechos de hojas de palma secas. Las hojas de palma se utilizaron como material de escritura en el subcontinente indio y en el sudeste asiático desde el siglo V a. C. ​ y posiblemente mucho antes.​ Su uso comenzó en el sur de Asia y se extendió a otros lugares, como textos sobre hojas de palma secas, tratadas con humo de la especie Borassus o la hoja Ola.​\\nUno de los más antiguos manuscritos de hojas de palma que se conservan de un tratado completo es un texto sánscrito del shivaísmo del siglo IX, descubierto en Nepal, que actualmente se preserva en la Biblioteca de la Universidad de Cambridge.​ El Manuscrito de Spitzer es una colección de fragmentos de hojas de palma encontrados en las Cuevas de Kizil, China. Se han datado en torno al siglo II d. C. y son el manuscrito filosófico más antiguo conocido en sánscrito.​​"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Detmold-Kernstadt","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Detmold_-_446_-_Meierstra%C3%9Fe_21.jpg","page_title":"Liste der Baudenkmäler in Detmold-Kernstadt","context_page_description":"Die Liste der Baudenkmäler in Detmold-Kernstadt enthält die denkmalgeschützten Bauwerke auf dem Gebiet von Detmold-Kernstadt in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Stadt Detmold eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%A0%B8%E6%A4%8E","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Cervical_vertebra_english.png","page_title":"頸椎","context_page_description":"頸椎は、椎骨の一部で、頭を支えるための骨である。\\nナマケモノなど一部の例外を除き、人間やキリンを含むほとんどの哺乳類の頸椎は七つの骨で構成されている。脊椎の中でも最も可動性が高く上下左右など様々な方向へ動かすことができる。\\n第一頸椎から第七頸椎まで上から順にC1、C2、...、C7と略されることが多い。\\n第一頸椎、第二頸椎は他の五つと比べ特徴的な形態をしており、それぞれ環椎、軸椎とも呼ばれる。第三頸椎から第七頸椎までは似た形をしているが下にある椎体ほど大きく、特に第七頸椎は長く大きな棘突起を持ち、体表から容易に観察したり触れることができるため隆椎とも呼ばれる。\\n頸椎の中で最も運動が起こりやすいのは第一頸椎と第二頸椎の間であり、これを環軸関節と呼ぶ。"},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A1%D0%B0%D0%B2%D0%B5%D1%82_%D0%95%D0%B2%D1%80%D0%BE%D0%BF%D1%81%D0%BA%D0%B5_%D1%83%D0%BD%D0%B8%D1%98%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Europa_building_February_2016.jpg","page_title":"Савет Европске уније","context_page_description":"Савет Европске уније или Савет министара Европске уније је главни орган за доношење одлука у Европској унији. Оличење је земаља чланица, чије представнике окупља регуларно на министарском нивоу.\\nНа основу дневног реда, Савет се састаје у различитом саставу: инострани послови, финансије, образовање, телекомуникације итд.\\nСавет има известан број обавеза:\\nОн је законодавни орган Уније; за широк домен питања, практикује ту законодавну моћ заједно са Европским парламентом;\\nКоординира економским смеровима земаља чланица;\\nЗакључује, у име ЕУ, међународне договоре са једном или више држава или међународних организација;\\nЗаједно са Парламентом, руководи буџетом;\\nДоноси одлуке потребне за утврђивање и спровођење заједничке међународне и безбедносне политике, на основу општих регулација које је донео Савет Европе;\\nКоординира активностима земаља чланица и усваја мерила у полицијској и правосудној сарадњи у питањима криминала\\nСедиште Савета је у Бриселу.\\nСавет Европске уније не треба мешати са Европским саветом, засебним органом Европске уније, нити са Саветом Европе, засебном пан-европском институцијом са седиштем у Стразбуру, независном од ЕУ."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-Martin_de_Clamecy","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/da/8881_vitrail_Clamecy.JPG","page_title":"Église Saint-Martin de Clamecy","context_page_description":"L'église Saint-Martin est une église catholique située dans le département français de la Nièvre, sur la commune de Clamecy en France. L'édifice est classé monument historique depuis 1840."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%91%9E%E5%A3%AB%E7%A9%BA%E8%BB%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Alfred_Comte_AC-1.jpg","page_title":"瑞士空軍","context_page_description":"瑞士空军是瑞士军队一部分。本部门原先隶属于陆军，但基于1930年代欧洲政局及军事扩张，1936年10月起独立成军。\\n迪本多夫为和平时期空军总部所在地，同时各地亦设有空军基地。虽然如此，但瑞士空军具备以高速公路起降战机之能力，以备战时不时之须。"},{"page_url":"https://de.wikipedia.org/wiki/Daniel_Halfar","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2b/Daniel_Halfar_1860_2010_5.JPG","page_title":"Daniel Halfar","context_page_description":"Daniel Halfar ist ein ehemaliger deutscher Fußballspieler und heutiger -trainer."},{"page_url":"https://en.wikipedia.org/wiki/Cincinnati_Bengals","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Carson_Palmer_under_center.jpg","page_title":"Cincinnati Bengals","context_page_description":"The Cincinnati Bengals are a professional American football franchise based in Cincinnati. The Bengals compete in the National Football League as a member club of the league's American Football Conference North division. Their home stadium is Paul Brown Stadium, located in downtown Cincinnati. Their divisional opponents are the Baltimore Ravens, Cleveland Browns and Pittsburgh Steelers.\\nThe Bengals were founded in 1966 as a member of the American Football League by former Cleveland Browns head coach Paul Brown, and began play in the 1968 season. Brown was the Bengals' head coach from their inception to 1975. After being dismissed as the Browns' head coach by Art Modell in January 1963, Brown had shown interest in establishing another NFL franchise in Ohio and looked at both Cincinnati and Columbus. He ultimately chose the former when a deal between the city, Hamilton County, and Major League Baseball's Cincinnati Reds was struck that resulted in an agreement to build a multipurpose stadium which could host both baseball and football games."},{"page_url":"https://nl.wikipedia.org/wiki/Gliese_876_c","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Galilean_moon_Laplace_resonance_animation.gif","page_title":"Gliese 876 c","context_page_description":"Gliese 876 c is een exoplaneet, die elke 30 dagen om de rode dwerg Gliese 876 draait. De planeet was in april 2001 ontdekt en is de tweede planeet in volgorde van toenemende afstand van zijn ster."},{"page_url":"https://sv.wikipedia.org/wiki/Psylliodes_chalcomerus","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Psylliodes.chalcomerus.-.lindsey.jpg","page_title":"Psylliodes chalcomerus","context_page_description":"Psylliodes chalcomerus är en skalbaggsart som först beskrevs av Johann Karl Wilhelm Illiger 1807. I den svenska databasen Dyntaxa används istället namnet Psylliodes chalcomera. Psylliodes chalcomerus ingår i släktet Psylliodes och familjen bladbaggar. Artens livsmiljö är jordbrukslandskap, stadsmiljö. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://sl.wikipedia.org/wiki/Antropozofska_medicina","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Ita_Wegman_vor1900.jpg","page_title":"Antropozofska medicina","context_page_description":"Antropozofska medicina je zdravilska metoda, ki jo je v začetku 20. stoletja utemeljil avstrijski filozof Rudolf Steiner, skupaj z zdravnico Ito Wegman.\\nČloveka obravnava v njegovi celoti kot telo, življenje, dušo in duha ter ima zdravilne pripravke za vse te plasti človeka. Trdi da klasična medicina ne zajema človeka v vsej njegovi polnosti, ker se življenja, čustev, misli ne da meriti ali tehtati. Filozofija antropozofske medicine je, da išče podobnost v naravi in pri človeku, s tem pa sklepa tudi na zdravilne učinke teh podobnih snovi. Po SSKJ je antropozofija filozofski nauk, po katerem je človek sam sposoben priti do spoznanja. Pravila antropozofske medicine zahtevajo, da imajo vsi njihovi terapevti končano tudi konvencionalno medicinsko fakulteto."},{"page_url":"https://pl.wikipedia.org/wiki/Zamek_w_Muszynie","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Muszyna_ruiny_zamku_16.08.08_p.jpg","page_title":"Zamek w Muszynie","context_page_description":"Zamek w Muszynie – ruiny średniowiecznego zamku w Muszynie w powiecie nowosądeckim w województwie małopolskim."},{"page_url":"https://it.wikipedia.org/wiki/Pala_di_Perugia","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Fra_Angelico_089.jpg","page_title":"Pala di Perugia","context_page_description":"La Pala di Perugia è un dipinto tempera su tavola di Beato Angelico, databile al 1438 e conservato nella Galleria nazionale dell'Umbria a Perugia, tranne i primi due scomparti originali della predella che sono alla Pinacoteca vaticana."},{"page_url":"https://fr.wikipedia.org/wiki/Jane_Monheit","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Jane_Monheit.jpg","page_title":"Jane Monheit","context_page_description":"Jane Monheit est une chanteuse de jazz américaine née le 3 novembre 1977 à Oakdale, sur l'île de Long Island. Elle a collaboré avec des artistes comme Michael Bublé et deux de ses albums ont été nommés aux Grammy Awards."},{"page_url":"https://be.wikipedia.org/wiki/%D0%94%D1%8B%D0%B5%D0%B3%D0%B0_%D0%91%D0%B5%D0%BD%D0%B0%D0%BB%D1%8C%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/080603_benaglio01.jpg","page_title":"Дыега Беналья","context_page_description":"Дые́га Арла́нда Бена́лья — швейцарскі футбаліст італьянскага паходжання, брамнік. Ігрок нацыянальнай зборнай Швейцарыі."},{"page_url":"https://de.wikipedia.org/wiki/Nannup_Shire","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Nannup_LGA_WA.png","page_title":"Nannup Shire","context_page_description":"Das Shire of Nannup ist ein lokales Verwaltungsgebiet im australischen Bundesstaat Western Australia. Das Gebiet ist 2.935 km² groß und hat etwa 1300 Einwohner.\\nNannup liegt an der Südwestküste des Staats etwa 250 Kilometer südlich der Hauptstadt Perth. Der Sitz des Shire Councils befindet sich in der Ortschaft Nannup, wo etwa 600 Einwohner leben."},{"page_url":"https://it.wikipedia.org/wiki/Pterophyllum","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cc/Pterophyllum_scalare_China.jpg","page_title":"Pterophyllum","context_page_description":"Pterophyllum è un genere di pesci d'acqua dolce appartenenti alla famiglia Cichlidae, sottofamiglia Cichlasomatinae, conosciuti comunemente come pesci angelo."},{"page_url":"https://en.wikipedia.org/wiki/Adoration_of_the_Magi_(Bosch,_Madrid)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Hieronymus_Bosch_062.jpg","page_title":"Adoration of the Magi (Bosch, Madrid)","context_page_description":"The Adoration of the Magi or The Epiphany is a triptych oil painting on wood panel by the Netherlandish artist Hieronymus Bosch, executed around 1485–1500. It is housed in the Museo del Prado of Madrid, Spain."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%89%8D%E5%8D%97%E8%8F%9C%E5%9C%92%E6%97%A5%E5%BC%8F%E5%AE%BF%E8%88%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/%E5%89%8D%E5%8D%97%E8%8F%9C%E5%9C%92%E6%97%A5%E5%BC%8F%E5%AE%BF%E8%88%8D_03.jpg","page_title":"前南菜園日式宿舍","context_page_description":"前南菜園日式宿舍，位於前台灣總督兒玉源太郎別院「南菜園」附近，為前南菜園日人宿舍區的一部分，住宅多以南北向規劃，前後配置有庭院，以植栽營造優美的環境，保有日治時期公務員宿舍群之特色。本宿舍群含有歷史建築與直轄市定古蹟共四處。"},{"page_url":"https://en.wikipedia.org/wiki/Gliese_581g","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/46/Gliese_581_-_2010.jpg","page_title":"Gliese 581g","context_page_description":"Gliese 581g, unofficially known as Zarmina, is an unconfirmed exoplanet claimed to orbit within the Gliese 581 system, twenty light-years from Earth. It was discovered by the Lick–Carnegie Exoplanet Survey, and is the sixth planet orbiting the star; however, its existence could not be confirmed by the European Southern Observatory / High Accuracy Radial Velocity Planet Searcher survey team, and its existence remains controversial. It is thought to be near the middle of the habitable zone of its star. That means it could sustain liquid water—a necessity for all known life—on its surface, if there are favorable atmospheric conditions on the planet.\\nGliese 581g was claimed to be detected by astronomers of the Lick–Carnegie Exoplanet Survey. The authors stated that data sets from both the High Resolution Echelle Spectrometer and HARPS were needed to sense the planet; however, the ESO/HARPS survey team could not confirm its existence. The planet remained unconfirmed as consensus for its existence could not be reached. Additional reanalysis only found evidence for four planets, but the discoverer, Steven S."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9C%D1%83%D1%85%D0%B0%D0%BB%D0%BD%D0%B8%D1%86%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Shema_migracia.jpg","page_title":"Мухалница","context_page_description":"„Муха̀лница“ е защитена местност, намираща се на 1 км южно от Ботевград и на 63 км североизточно от София. Създадена е през 1992 г. с цел опазване на уникална по своите мащаби миграция на планинска жаба."},{"page_url":"https://vi.wikipedia.org/wiki/Danh_s%C3%A1ch_di_s%E1%BA%A3n_th%E1%BA%BF_gi%E1%BB%9Bi_t%E1%BA%A1i_Nh%E1%BA%ADt_B%E1%BA%A3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Horyu-ji11s3200.jpg","page_title":"Danh sách di sản thế giới tại Nhật Bản","context_page_description":"Nhật Bản đã chấp nhận Công ước Di sản thế giới của UNESCO vào ngày 30 tháng 6 năm 1992. Tính đến hết năm 2016, Nhật Bản đã có 20 di sản thế giới được công nhận, trong đó bao gồm 17 di sản văn hóa, 4 di sản tự nhiên. Ngoài ra, quốc gia này còn có 7 địa danh nằm trong danh sách di sản dự kiến được đệ trình xem xét công nhận trong tương lai."},{"page_url":"https://el.wikipedia.org/wiki/%CE%8C%CF%81%CE%B7_%CF%84%CE%BF%CF%85_%CE%9A%CE%B1%CE%BD%CF%84%CE%AC%CE%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Senezergues_24.jpg","page_title":"Όρη του Καντάλ","context_page_description":"Τα όρη Καντάλ, είναι μια οροσειρά που βρίσκεται στα κέντρο-δυτικά του Μασίφ Σαντράλ, στο νομό Καντάλ της περιοχής Ωβέρνη-Ρον-Αλπ. Αποτελούν τμήμα του Φυσικού περιφερειακού πάρκου των ηφαιστείων της Ωβέρνης και δημιουργήθηκαν από το μεγαλύτερο ορατό στρωματοηφαίστειο στην Ευρώπη.\\nΟ ορεινός όγκος έδωσε το όνομά του σε ένα νομό, σε ένα τυρί που παράγεται στην περιοχή και στο άλογο του Ναπολέοντα Α΄ στη μάχη του Αούστερλιτς."},{"page_url":"https://pl.wikipedia.org/wiki/Wzg%C3%B3rze_Kapitulne","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/24/Panoramy_Zagorze_Poznan.JPG","page_title":"Wzgórze Kapitulne","context_page_description":"Wzgórze Kapitulne – nieistniejące wzgórze ostańcowe zlokalizowane w Poznaniu, na terenie Zagórza\\nWzgórze zbudowane z glin zwałowych, o wysokości około 60 m n.p.m. wznosiło się pomiędzy grodem na Ostrowiu Tumskim, a osadą Zagórze, która właśnie z tego położenia zaczerpnęła swoją nazwę. Na szczycie wzniesienia wybudowano w XII wieku kościół św. Mikołaja, rozebrany w 1805. Świątynię nazywano niekiedy in monte Capituli. W XV i XVI wieku wzgórze było intensywnie eksploatowane dla produkcji cegieł w związku z budową systemu obronnego na Ostrowie Tumskim. Po rozbiórce kościoła zostało całkowicie splantowane.\\nPamiątkami toponimicznymi są nazwy ulic: Zagórze i Nowe Zagórze."},{"page_url":"https://en.wikipedia.org/wiki/Alexander_Adams_(sailor)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Alexander_Adams_%28Hawaii%29.jpg","page_title":"Alexander Adams (sailor)","context_page_description":"Captain Alexander Adams was a Scotsman who served in the British Royal Navy and then came to the Hawaiian islands and served in the navy of the Kingdom of Hawaii. Known to the Hawaiians as Alika Napunako Adams."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%81%D8%B1%D9%8A%D8%AA%D8%B2%D9%8A%D9%86%D8%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Fritzing_breadboard_view.jpg","page_title":"فريتزينج","context_page_description":"فريتزينج ‏ مشروع مفتوح المصدر لتطوير برمجية للتصميم بمساعدة الحاسوب للمحترفين وهواة تصميم الدارات الإلكترونية ويساعد المصممين والفنيين على رسم وتركيب نماذج للدارات الإلكترونية بكيفية سهلة مع تصحيح آلي للمسارات ويدعم كذلك الربط على الشبكة للمشروعات المشتركة. تم تطويره في جامعة بوتسدام للعلوم التطبيقية."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Eschau_(Unterfranken)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Wasserschloss_Oberaulenbach_01.JPG","page_title":"Liste der Baudenkmäler in Eschau (Unterfranken)","context_page_description":"Auf dieser Seite sind die Baudenkmäler des unterfränkischen Marktes Eschau zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde.\\nDiese Liste gibt den Fortschreibungsstand vom 16. April 2020 wieder und enthält 28 Baudenkmäler."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%9F%83%E6%9B%BC%E5%8A%AA%E5%9F%83%E8%8E%B1%C2%B7%E8%8F%B2%E5%88%A9%E8%B4%9D%E6%89%98_(%E5%A5%A5%E6%96%AF%E5%A1%94%E5%85%AC%E7%88%B5)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Emanuele_Filiberto%2C_II_duca_d%27Aosta.jpg","page_title":"埃曼努埃莱·菲利贝托 (奥斯塔公爵)","context_page_description":"埃曼努埃萊·菲利貝托·維托里奧·歐亨尼奧·阿爾貝托·熱那亞·朱塞佩·瑪利亞，出生於熱那亞。第二代奧斯塔公爵，西班牙王儲，薩伏伊王子。是奧斯塔公爵、西班牙國王阿瑪迪奧一世的長子。義大利國王維托里奧·埃馬努埃萊三世的堂兄。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_W%C3%B6rth_an_der_Donau","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Zinzendorf_%281%29.JPG","page_title":"Liste der Baudenkmäler in Wörth an der Donau","context_page_description":"Auf dieser Seite sind die Baudenkmäler der Oberpfälzer Stadt Wörth an der Donau zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://de.wikipedia.org/wiki/Schwarze-Elster-Radweg","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Jessen_church.jpg","page_title":"Schwarze-Elster-Radweg","context_page_description":"Der Schwarze-Elster-Radweg ist ein 190 Kilometer langer Radfernweg im Süden von Brandenburg und Norden von Sachsen sowie auf kurzen Teilstrecken auch im Osten Sachsen-Anhalts. Der Radweg verläuft von der Quelle der Schwarzen Elster auf 317 m ü. NHN bis zu deren Mündung in die Elbe auf 69 m ü. NHN durch die Ausläufer des Lausitzer Berglandes bei Kamenz und später größtenteils direkt auf dem Deich der Schwarzen Elster. Er ist mit der Abbildung einer Elster gekennzeichnet."},{"page_url":"https://nl.wikipedia.org/wiki/Secessionsgebouw","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Secession01.jpg","page_title":"Secessionsgebouw","context_page_description":"Het Secessionsgebouw in Wenen werd in 1898 ontworpen door de architect Joseph Maria Olbrich. Het was de plek waar de kunstenaars van de Secession-stroming, de Oostenrijkse variant van de jugendstil, bij elkaar kwamen. Het Secessionsgebouw bevindt zich ongeveer aan de rand van de Karlsplatz en het begin van de Naschmarkt.\\nAangezien dit mensen waren die zich van de “Academie” hadden afgescheiden was het ontwerp bedoeld om de draak te steken met de ideeën van het classicisme. In het decoratieprogramma is de laurier het centrale thema. Zo bestaat de koepel uit duizenden vergulde laurierbladeren en honderden laurierbessen. In de volksmond kreeg de koepel al gauw de bijnaam 'de vergulde kool'.\\nOp de buitenkant van het gebouw is het motto van de Wiener Secessioniten aangebracht. Deze spreuk is afkomstig van Ludwig Hevesi, een Oostenrijks schrijver en journalist. Ook staat links van de ingang een verwijzing naar het blad van de vereniging. Naar verluidt heeft Gustav Klimt de naam van dit tijdschrift ontleend aan het gelijknamige gedicht uit 1820 van Ludwig Uhland.\\nOp de muren van een van de binnenruimtes schilderde Gustav Klimt in 1902 het Beethovenfries."},{"page_url":"https://en.wikipedia.org/wiki/Wardour_Castle","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Wardourcastlecopurtyard.JPG","page_title":"Wardour Castle","context_page_description":"Wardour Castle is a ruined 14th-century castle at Wardour, on the boundaries of Tisbury and Donhead St Andrew in the English county of Wiltshire, about 15 miles west of Salisbury. The castle was built in the 1390s, came into the ownership of the Arundells in the 16th century and was rendered uninhabitable in 1643 and 1644 during the English Civil War. A Grade I listed building, it is managed by English Heritage and open to the public."},{"page_url":"https://pt.wikipedia.org/wiki/Calocera","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1a/Geel_hoorntje.jpg","page_title":"Calocera","context_page_description":"Calocera é um gênero de fungos da família Dacrymycetaceae."},{"page_url":"https://de.wikipedia.org/wiki/Till_Butterbach","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Till_Butterbach.jpg","page_title":"Till Butterbach","context_page_description":"Till Butterbach ist ein deutscher Schauspieler."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9A%D1%80%D0%B0%D1%98%D0%B1%D1%83%D1%80%D0%B3_%D0%B0%D0%BC_%D0%98%D0%BD","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bb/Kraiburg_am_Inn_in_M%C3%9C.svg","page_title":"Крајбург ам Ин","context_page_description":"Крајбург ам Ин град је у њемачкој савезној држави Баварска. Једно је од 31 општинског средишта округа Милдорф ам Ин. Према процјени из 2010. у граду је живјело 4.020 становника. Посједује регионалну шифру 9183124."},{"page_url":"https://es.wikipedia.org/wiki/Saig%C5%8D_Tanomo","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Takeaki_Enomoto_2.jpg","page_title":"Saigō Tanomo","context_page_description":"Saigō Tanomo fue un samurái japonés del fin del período Edo hijo del Saigo Kon del clan Masayuki Hoshina, jefe del Consejo del Clan Aizu y la segunda hija de un samurái del clan Ritsuko Kobayashi. ​Llega a ser como su padre, jefe mayor del consejo del clan de Aizu a los 32 años, adquirió fama por sus distinguidas acciones en la Guerra Boshin. Sobrevivió a la guerra y se convirtió en monje Shinto adoptando el nombre Hoshina Genshin y en otras ocasiones Chikanori Genzo, alcanzó gran renombre como artista marcial siendo maestro de Sōkaku Takeda en las técnicas del Daito Ryu Aiki jujutsu.​"},{"page_url":"https://pl.wikipedia.org/wiki/Marty_Balin","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/MartyBalinPerforming.jpg","page_title":"Marty Balin","context_page_description":"Marty Balin, właśc. Martyn Jerel Buchwald – amerykański muzyk rockowy, wokalista, gitarzysta rytmiczny, kompozytor i autor tekstów. Związany głównie z psychodelicznym rockiem, acid rockiem, folk rockiem, soft rockiem oraz pop rockiem.\\nNa scenie muzycznej pojawił się jako wokalista popowej grupy Bodacious, która nagrała zaledwie jeden album. Był następnie współzałożycielem zespołu rockowego Jefferson Airplane, którego na krótko był liderem i głównym wokalistą. Po jego rozwiązaniu poświęcił się karierze solowej. Uczestniczył w kontynuacjach zespołu Jefferson Airplane istniejących pod innymi nazwami: Jefferson Starship i TNG. Założył również grupę KBC, w której u jego boku zagrali dwaj inni czołowi muzycy Jefferson Airplane – Paul Kantner i Jorma Kaukonen.\\nGłos Marty’ego był bardzo „rozemocjonowany”, Balin wyrażał w piosenkach całego siebie. Gdy do Jefferson Airplane dołączyła Grace Slick, to ona skoncentrowała na sobie całą uwagę publiczności i fanów. Marty odszedł w jej cień, co było powodem narastającego konfliktu między nim a zespołem."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%85%D8%A7%DA%86%D8%B1%D8%A7%D8%AA%D8%A7","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a8/University_of_Macerata_Aula_Magna.jpg","page_title":"ماچراتا","context_page_description":"ماچراتا ایتالیا اؤلکه‌سینده بیر یاشاییش منطقه‌سی‌دیر. سوْن نۆفوس ساییمی اساسيندا ۴۱۷۷۶ نفر ایمیش. دنیز سوُلاری سَویه‌سیندن ۳۱۵ متر یۇکسک‏لیکده یئر آلیب. و مارکه اوستانیندا یئرلشیب."},{"page_url":"https://ht.wikipedia.org/wiki/Whittier,_Kalif%C3%B2ni","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Whittier_CA_seen_from_Hellman_park_%28Peppergrass%29_trail.jpg","page_title":"Whittier, Kalifòni","context_page_description":"Whittier, Kalifòni se yon vil Etazini. Li sitye nan leta Kalifòni.\\nChèf-lye li se Los Angeles."},{"page_url":"https://de.wikipedia.org/wiki/Gliederung_des_Feldheeres_(Bundeswehr,_Heeresstruktur_4)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/InstAusbKp_9-III.png","page_title":"Gliederung des Feldheeres (Bundeswehr, Heeresstruktur 4)","context_page_description":"Die Gliederung des Feldheeres der Bundeswehr in der Heeresstruktur 4 beschreibt die Truppenteile des Feldheeres im Zeitraum von 1980 bis 1992. Die Heeresstruktur 4 beschreibt damit die Aufstellung des Feldheeres zum Ende des Kalten Krieges.\\nDas Feldheer ist Teil des Heeres der Bundeswehr. Die weitere Gliederung der anderen Teilbereiche des Heeres finden sich in:\\nTeil 1 – Einleitung und Aufbau der Listen, Führung des Heeres, Gliederung des Heeresamtes und nachgeordneter Bereich\\nTeil 2 – Feldheer: Gliederung des Feldheeres (Bundeswehr, Heeresstruktur 4)\\nTeil 3 – Territorialheer: Gliederung des Territorialheeres (Bundeswehr, Heeresstruktur 4)"},{"page_url":"https://bg.wikipedia.org/wiki/%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80_%D0%A2%D1%80%D0%B0%D0%BD%D0%B4%D0%B0%D1%84%D0%B8%D0%BB%D0%BE%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/BASA_690K-1-40_Vladimir_Trendafilov%2C_BG_Scenic_Art_1900-1932_%28crop%29.jpg","page_title":"Владимир Трандафилов","context_page_description":"Владимир Анастасов Трандафилов е български драматичен актьор и педагог, професор."},{"page_url":"https://en.wikipedia.org/wiki/Pop_Warner","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/DaviesPittGT1918.jpg","page_title":"Pop Warner","context_page_description":"Glenn Scobey Warner, most commonly known as Pop Warner, was an American college football coach at various institutions who is responsible for several key aspects of the modern game. Included among his innovations are the single and double wing formations, the three point stance and the body blocking technique. Fellow pioneer coach Amos Alonzo Stagg called Warner \\"one of the excellent creators\\". He was inducted as a coach into the College Football Hall of Fame as part of its inaugural class in 1951. He also contributed to a junior football program which became known as Pop Warner Little Scholars, a popular youth American football organization.\\nIn the early 1900s, he created a premier football program at the Carlisle Indian Industrial School—a federally-funded, off-reservation Indian boarding school. He also coached teams to four national championships: Pittsburgh in 1915, 1916, and 1918 and Stanford in 1926. In all, he was head coach at the University of Georgia, Iowa Agricultural College and Model Farm, Cornell University, Carlisle, Pittsburgh, Stanford and Temple University, compiling a career college football record of 319–106–32."},{"page_url":"https://fi.wikipedia.org/wiki/Austin_A40_Farina","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Austin_A40_MkII_front.jpg","page_title":"Austin A40 Farina","context_page_description":"Austin A40 Farina oli oman aikansa mittapuun mukaan alemman keskiluokan henkilöautomalli, jonka British Motor Corporation toi markkinoille saloon-korisena versiona vuonna 1958. Takaistuimen jälkeen avoimella tavaratilalla ja kaksiosaisella takaluukulla varustettu Countryman-van seurasi vuonna 1959. Aiemmasta käytännöstään poiketen valmistaja ei antanut mallille mitään lisänimeä, vaan auto oli yksinkertaisesti Austin A40. Jo omana aikanaan auton mallinimenä oli yleisesti käytössä A40 Farina, jolla se saatiin erotettua edeltäneistä malleista. BMC:lle epätyypilliseen tapaan mallista ei tehty ns. \\"badge-engineering\\"-versioita, vaan sitä valmistettiin ainoastaan Austin-brändin alla."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%AF%D8%A7%D8%B1%D8%AA%D9%85%D9%88%D8%AB%D8%8C_%D8%AF%D9%88%D9%88%D9%86","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/53/Eastgate_Topshop.jpg","page_title":"دارتموث، دوون","context_page_description":"دارتموث، دوون بریتانیادا بیر یاشاییش منطقه‌سی‌دیر سوْن نۆفوس تخمین‌لرینه گؤره 5064 نفر دیر. بۇ شهر اینگیلیس اؤلکه‌سینده یئرلشیب."},{"page_url":"https://ms.wikipedia.org/wiki/Ghurab","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Miller_Atlas_Ottoman_fleet_Indian_Ocean.png","page_title":"Ghurab","context_page_description":"Ghurab atau gurab adalah jenis kapal dagang dan kapal perang dari Nusantara. Kapal ini adalah akibat pengaruh Mediterranean di kawasan ini, terutamanya diperkenalkan oleh orang Arab, Persia dan Uthmaniyyah."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B0%D0%BC%D1%8F%D1%82%D0%BD%D0%B8%D0%BA%D0%B8_%D0%A1%D1%82%D0%B0%D0%BB%D0%B8%D0%BD%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Lenin_Stalin_Planetarium.jpg","page_title":"Памятники Сталину","context_page_description":"Памятники Сталину — категория скульптурных произведений, бывших неотъемлемой частью советской традиции монументального искусства 1930-х — середины 1950-х годов, один из символов того времени в СССР и в большинстве социалистических стран."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%98%BF%E5%AF%92%E6%91%A9%E5%91%A8%E5%9B%BD%E7%AB%8B%E5%85%AC%E5%9C%92","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Penketo%26panketo.JPG","page_title":"阿寒摩周国立公園","context_page_description":"阿寒摩周国立公園は、北海道にある国立公園。2017年の「阿寒国立公園」からの名称変更に伴い、摩周湖・神の子池周辺まで区域が拡がり、1市10町に跨る総面積9万1000ヘクタールとなった。国立公園内のほぼ9割以上が未開発地域として手つかずの自然保護地域として保全された。"},{"page_url":"https://id.wikipedia.org/wiki/Bagindo_Aziz_Chan","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/MuseumAdityawarman.jpg","page_title":"Bagindo Aziz Chan","context_page_description":"Bagindo Aziz Chan atau juga dikenal dengan sebutan Bagindo Azizchan merupakan Wali Kota Padang kedua setelah kemerdekaan, yang dilantik pada tanggal 15 Agustus 1946 menggantikan Mr. Abubakar Jaar. Ia meninggal dalam usia 36 tahun setelah terlibat dalam sebuah pertempuran melawan Belanda. Jasadnya dikebumikan di Taman Makam Pahlawan Bahagia, Bukittinggi. Melalui Surat Keputusan Presiden Republik Indonesia Nomor 082/TK/2005, tanggal 7 November 2005, Bagindo Aziz Chan menerima Bintang Maha Putera Adipradana dan Gelar Pahlawan Nasional Indonesia pada 9 November 2005."},{"page_url":"https://nl.wikipedia.org/wiki/D%27Yve","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Armes_d%27Yve.png","page_title":"D'Yve","context_page_description":"D'Yve was een Zuid-Nederlandse adellijke familie."},{"page_url":"https://ro.wikipedia.org/wiki/Villelaure","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b1/Villelaure_Casttle_by_JM_Rosier.jpg","page_title":"Villelaure","context_page_description":"Villelaure este o comună în departamentul Vaucluse din sud-estul Franței. În 2009 avea o populație de 3.176 de locuitori."},{"page_url":"https://no.wikipedia.org/wiki/Ingeborg_Motzfeldt_L%C3%B8chen","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/No-nb_bldsa_2a017.jpg","page_title":"Ingeborg Motzfeldt Løchen","context_page_description":"Ingeborg Mathia Motzfeldt Løchen var en norsk fotograf og forfatter. Hun er kjent for sine portrettfotografier av blant andre Fridtjof Nansen og Erik Werenskiold."},{"page_url":"https://lt.wikipedia.org/wiki/%C5%BDitai%C4%8Diai","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/80/%C5%BDitai%C4%8Diai_1.JPG","page_title":"Žitaičiai","context_page_description":"Žitaičiai – kaimas šiaurės vakarinėje Kėdainių rajono dalyje, 1 km į pietus nuo Pašušvio, prie Šušvės upės.\\nTarpukariu buvo palivarkas."},{"page_url":"https://en.wikipedia.org/wiki/Swi%C4%99tej_Trojcy_street_in_Bydgoszcz","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Map_bydg_Sw_trjc.jpg","page_title":"Swiętej Trojcy street in Bydgoszcz","context_page_description":"Świętej Trójcy street is a historical street of downtown Bydgoszcz, Poland, bearing several buildings registered on the Kuyavian-Pomeranian Voivodeship Heritage List."},{"page_url":"https://vec.wikipedia.org/wiki/Strengelbach","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f6/Strengelbach_reformita_preghejo_031.jpg","page_title":"Strengelbach","context_page_description":"Strengelbach el xé on comun del distreto de Zofingen che el fa parte del canton Argovia in Svisara"},{"page_url":"https://fr.wikipedia.org/wiki/Kensington_Church_Street","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Kensington_Church_Street_Londres_2019.jpg","page_title":"Kensington Church Street","context_page_description":"Kensington Church Street est une rue de la ville de Londres, Royaume-Uni."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%9F%B3%E6%9B%B4%E7%94%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/%E3%83%9E%E3%83%83%E3%82%B5%E3%83%B3_%E7%99%BD%E6%A8%BA%E4%B8%A6%E6%9C%A82014.jpg","page_title":"音更町","context_page_description":"音更町は、北海道十勝総合振興局にある町。北海道内の町村の中で最も人口が多い。"},{"page_url":"https://pt.wikipedia.org/wiki/For%C3%A7a_A%C3%A9rea_Italiana","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/MinisteroAeronautica.jpg","page_title":"Força Aérea Italiana","context_page_description":"A Força Aérea Italiana, é a força aérea da República da Itália. A Força Aérea foi fundada como um ramo independente das forças armadas em 28 de março de 1923 por Victor Emmanuel III da Itália como a Regia Aeronautica. Depois da Segunda Guerra Mundial, quando a Itália virou uma república por referendo, a Regia Aeronautica recebeu o nome atual. Ela teve um papel promissor na moderna história militar da Itália e seu time de exibição acrobático é a Frecce Tricolori."},{"page_url":"https://cs.wikipedia.org/wiki/Skalni%C4%8Dkov%C3%A1_zahrada_Hlubo%C4%8Depy","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Provozni_Rad_Skalnickova_Zahrady_Hlubo%C4%8Depy_Praha_CZ.jpg","page_title":"Skalničková zahrada Hlubočepy","context_page_description":"Skalničková zahrada Hlubočepy je unikátní, veřejně přístupná botanická zahrada s rozlohou cca 2 000 m² s více jak 2 tisíci skalniček, alpínek a dalších dřevin. Byla založena v 50. letech 20. století manželi Haladovými v místě bývalého vápencového lomu na okraji Prokopského údolí, je průběžně udržována jejich synem Milanem Haladou a v roce 2019 byla revitalizována za finanční podpory Městské části Praha 5."},{"page_url":"https://et.wikipedia.org/wiki/Salorno","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Aussichtsplattform_Harderburg%2C_Blick_%C3%BCber_Salurn.jpg","page_title":"Salorno","context_page_description":"Salorno on lõunapoolseim vald Lõuna-Tiroolis Põhja-Itaalias, paiknedes umbes 30 km Bolzanost edelas. See on üks viiest vaid peamiselt itaaliakeelsest vallast Lõuna-Tiroolis."},{"page_url":"https://it.wikipedia.org/wiki/Peugeot_908_HDi_FAP","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/PLM08_sarrazin_peugeot.jpg","page_title":"Peugeot 908 HDi FAP","context_page_description":"La Peugeot 908 HDi FAP è una vettura Sport Prototipo da competizione, costruita dalla casa automobilistica francese Peugeot secondo le norme ACO classe LM-P1 per gareggiare nella 24 Ore di Le Mans; ha partecipato al campionato Le Mans Series e ha preso parte occasionalmente ad alcune prove dell'American Le Mans Series."},{"page_url":"https://en.wikipedia.org/wiki/Centre_for_the_Study_of_the_Legacies_of_British_Slave-ownership","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Greys_Court_House.jpg","page_title":"Centre for the Study of the Legacies of British Slave-ownership","context_page_description":"The Centre for the Study of the Legacies of British Slave-ownership is a research centre of the University College, London which focuses on revealing the impact of British slavery and, in particular, the implications of the Slave Compensation Act 1837. It is based on \\"two earlier projects based at UCL tracing the impact of slave-ownership on the formation of modern Britain: the ESRC-funded Legacies of British Slave-ownership project, and the ESRC and AHRC-funded Structure and Significance of British Caribbean Slave-ownership 1763-1833\\""},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%A3%E0%B8%B2%E0%B8%9F%E0%B8%B2%E0%B9%80%E0%B8%AD%E0%B8%A5_%E0%B8%99%E0%B8%B2%E0%B8%94%E0%B8%B1%E0%B8%A5","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/236_-_Centre_Court_-_R_Nadal.JPG","page_title":"ราฟาเอล นาดัล","context_page_description":"ราฟาเอล นาดัล ปาเรรา เกิดวันที่ 3 มิถุนายน ค.ศ. 1986 เป็นนักเทนนิสอาชีพชาวสเปน เขาเกิดที่เมืองมายอร์กา ประเทศสเปน และเริ่มเล่นเทนนิสเมื่ออายุได้ 4 ปี โตนิ นาดัล ลุงของเขา ได้ทำหน้าที่เป็นโค้ชและดูแลเขามาโดยตลอดจนถึงปัจจุบัน เขาเริ่มการแข่งขันเทนนิสอาชีพในปี ค.ศ. 2001 ปัจจุบันเขาเป็นนักเทนนิสมืออันดับ 1 ของโลก เขาได้รับการยกย่องให้เป็นหนึ่งในนักเทนนิสที่ดีที่สุดตลอดกาล\\nตั้งแต่ปี ค.ศ. 2004 เป็นต้นมา นาดัลได้กลายเป็นคู่แข่งคนสำคัญของ โรเจอร์ เฟเดอเรอร์ ทั้งคู่ได้รับการยอมรับว่าเป็นคู่แข่งขันที่สร้างความยิ่งใหญ่ที่สุดในประวัติศาสตร์วงการเทนนิสโลก โดยพบกันในรอบชิงชนะเลิศเทนนิสระดับแกรนด์สแลมถึง 9 ครั้งด้วยกัน ซึ่งนาดัลเป็นฝ่ายเอาชนะเฟเดอเรอร์ได้ถึง 6 ครั้ง สำหรับสถิติการเล่นเทนนิสอาชีพของทั้งคู่นั้น พบกันทั้งหมด 40 ครั้ง โดยเป็นชัยชนะของนาดัล 24 ครั้ง และเป็นชัยชนะของเฟเดอเรอร์ 16 ครั้ง\\nนาดัลประสบความสำเร็จในการเล่นบนคอร์ตดินเป็นอย่างมาก เขามีสถิติชนะบนคอร์ตดินในรอบชิงชนะเลิศ 32-4 นอกจากนี้ยังทำสถิติชนะติดต่อกันบนคอร์ตดินมากที่สุดในยุคโอเพน คือ 81 แมตช์ติดต่อกันตั้งแต่เดือนเมษายน ค.ศ. 2005 ถึงเดือนพฤษภาคม ค.ศ. 2007 จากผลงานดังกล่าว เขาจึงได้รับการขนานนามว่าเป็นนักเทนนิสที่เล่นบนคอร์ตดินได้ดีที่สุดตลอดกาล หรือเป็นราชาของคอร์ตดินนั่นเอง\\nในปี ค.ศ."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%97%A3%E5%BE%B7%E8%81%96%E8%A3%BD%E5%AD%97%E5%AD%B8%E8%A7%A3%E7%BE%A9%E6%AD%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Vua_Tu_Duc.jpg","page_title":"嗣德聖製字學解義歌","context_page_description":"《嗣德圣制字学解义歌》，越南阮朝嗣德帝所编的一部汉越字典。本书名为“字学解义歌”，是特别采用了“六八体演歌”的安排，在文中列出汉字及喃文，并解释字义。嗣德帝死后，本书的体裁复经由阮朝国史馆修书所的黄有秤、吴惠达等人的复检及整理，然后才刻印出版。学者陈荆和认为，嗣德帝编写此书，用意是要作成一部官方的汉越字典来作教学基准，以及促进汉学在越南民间之流传，使学问得以民众化。"},{"page_url":"https://ro.wikipedia.org/wiki/Maya%C8%99i","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Maya.svg","page_title":"Mayași","context_page_description":"Maya este o etnie indigenă din America Centrală, care a avut o civilizație veche și un imperiu în perioada precolumbiană. În perioada de înflorire a imperiului s-a dezvoltat o cultură impresionantă. Cultura Maya și limba maya fiind atestată prin o serie de descoperiri arheologice. Leagănul acestei culturi a fost situat între podișul statului federal Chiapas din sudul Mexicului și Guatemala precum și depresiunea din peninsula Yucatan, departamentul El Petén și Belize.\\nCentrul cultural al regiunii se mută cu timpul din zonele înalte, spre depresiunile situate în nordul Yucatanului. Cultura maya este renumită mai ales pentru cunoștințele lor avansate în domeniul matematicii, și calendarului lor precis precum și prin scrisul maya, care între timp a fost descifrat ca fiind un scris bazat pe figuri simbolice. Mayașii cunoșteau arta ceramică, tehnica prelucrării textilelor, metalelor ca aur, argint sau cupru.\\nLa începutul secolului XXI populația mayașă este estimată la aproximativ 6 milioane de persoane. Câțiva dintre ei erau deja integrați in cultura moderna a națiunilor unde locuiau, în timp ce alții incă mai păstrează stilul de viață legat la propriile tradiții."},{"page_url":"https://en.wikipedia.org/wiki/Romanian_Revolution","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Romania%2C_Transylvania%2C_Timisoara_Fortepan_31879.jpg","page_title":"Romanian Revolution","context_page_description":"The Romanian Revolution was a period of violent civil unrest in Socialist Romania during December 1989 as a part of the Revolutions of 1989 that occurred in several countries. The Romanian Revolution started in the city of Timișoara and soon spread throughout the country, ultimately culminating in the show trial and execution of longtime Communist Party General Secretary Nicolae Ceaușescu and his wife Elena, and the end of 42 years of Communist rule in Romania. It was also the last removal of a Marxist-Leninist government in a Warsaw Pact country during the events of 1989, and the only one that violently overthrew a country's government and executed its leader.\\nEarly protests occurred in the city of Timișoara in mid-December on the part of the Hungarian minority in response to an attempt by the government to evict Hungarian Reformed church pastor László Tőkés. In response, Romanians sought revolution and a change in government in light of similar recent events in neighbouring nations."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%9E%E3%83%B3%E3%82%AF%E3%82%B9%E3%83%9F%E3%82%BA%E3%83%8A%E3%82%AE%E3%83%89%E3%83%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Puffinus_puffinus_-Iceland_-flying-6_%282%29.jpg","page_title":"マンクスミズナギドリ","context_page_description":"マンクスミズナギドリは、ミズナギドリ目ミズナギドリ科のなかで小形となる海鳥である。別名ヒメミズナギドリ。\\nマンクス は「マン島の」という意味で、かつて、カーフ・オブ・マンにおいて、マンクスミズナギドリの大繁殖地が見られたことに由来する。だが、ここでの種は18世紀後半に、船の難破による偶発的なネズミの移入により減衰した。しかし近年、ミズナギドリの数を増加させるため、カーフ・オブ・マンからネズミが除去されている。"},{"page_url":"https://th.wikipedia.org/wiki/%E0%B9%80%E0%B8%84%E0%B8%A3%E0%B8%B7%E0%B9%88%E0%B8%AD%E0%B8%87%E0%B8%81%E0%B8%B3%E0%B9%80%E0%B8%99%E0%B8%B4%E0%B8%94%E0%B8%AA%E0%B8%B1%E0%B8%8D%E0%B8%8D%E0%B8%B2%E0%B8%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Leader_LSG-15_signal_generator.jpg","page_title":"เครื่องกำเนิดสัญญาณ","context_page_description":"เครื่องกำเนิดสัญญาณ คือเครื่องมืออิเล็กทรอนิกส์ชนิดหนึ่งที่สร้างสัญญาณไฟฟ้าโดยมีแอมพลิจูด, ความถี่ และรูปคลื่น โดยสัญญานที่ถูกสร้างขึ้นจะถูกนำไปใช้เพื่อเป็นตัวกระตุ้นสำหรับการวัดค่าทางอิเล็กทรอนิกส์ เพื่อใช้ในการออกแบบ, ทดสอบ, แก้ปัญหา และ ซ่อมแซมเครื่องมืออิเล็กทรอนิกส์ที่เสียหาย กระนั้นบางครั้งสัญญาณดังกล่าวก็สามารถนำไปใช้เพื่อทำผลงานศิลปะได้เช่นกัน\\nเครื่องกำเนิดสัญญาณมีอยู่หลายประเภท มีจุดประสงค์การใช้งานที่แตกต่างกันไป และมีราคาที่แตกต่างเช่นกัน ประเภทของเครื่องกำเนิดสัญญาณ ประกอบด้วย เครื่องกำเนิดสัญญาณรูปคลื่นไฟฟ้า, เครื่องกำเนิดสัญญานคลื่น RF และ คลื่นไมโครเวฟ, เครื่องกําเนิดสัญญาณความถี่เสียง, เครื่องกำเนิดสัญญาณคลื่นตามต้องการ, เครื่องกำเนิดสัญญาณดิจิตัล และเครื่องกำเนิดคลื่นความถี่ โดยปรกติแล้วไม่มีเครื่องกำเนิดสัญญาณที่เหมาะสมกับงานทุกอย่าง\\nเครื่องกำเนิดสัญญาณอาจมีความเรียบง่ายแบบออสซิลเลเตอร์ ที่สามาตรสอบเทียบความถี่และแอมพลิจูดของสัญญาน ไปจนถึงเครื่องกำเนิดสัญญาณสำหรับการใข้งานทั่วไปที่ควบคุมคุณสมบัติของสัญญาณทั้งหมดได้ เครื่องกำเนิดสัญญาณสำหรับการใข้งานทั่วไปที่ทันสมัยจะมีไมโครโปรเซสเซอร์ สำหรับควบคุม และ อนุญาตให้ควบคุมสัญญาณได้จากคอมพิวเตอร์ส่วนบุคคล เครื่องกำเนิดสัญญาณอาจเป็นเครื่องมือเฉพาะสำหรับกำเนิดสัญญาณ หรือเป็นส่วนประกอบของระบบทดสอบอัตโนมัติที่ซับซ้อน"},{"page_url":"https://fi.wikipedia.org/wiki/Tapio_Puolimatka","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Tapio_Puolimatka.jpg","page_title":"Tapio Puolimatka","context_page_description":"Timo Tapio Puolimatka on suomalainen filosofi ja kasvatustieteilijä, joka toimii kasvatuksen teorian ja tradition professorina Jyväskylän yliopistossa.\\nTeoksissaan Puolimatka on käsitellyt kasvatuksen, uskonnon ja tieteen aiheita filosofisesta näkökulmasta, ja hän on arvostellut evoluutioteorian ateistista tulkintaa. Puolimatka on kirjoittanut lukuisia mielipidekirjoituksia avioliittoon, transsukupuolisten oikeuksiin ja poliittiseen korrektiuteen liittyen muun muassa eri kristillisille medioille, paikallislehtiin ja oikeistokonservatiiviseen vastamedia Oikeaan Mediaan. Puolimatka pitää esimerkiksi lapsille annettavia sukupuolenkorjaushoitoja ongelmallisina, koska lapsi ei ole henkisesti vielä valmis päättämään tällaisista asioista. Monia hänen näkemyksiään pidetään useilla tahoilla kiistanalaisina."},{"page_url":"https://hu.wikipedia.org/wiki/Szerelmesek_lakatjai","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Love_padlocks%2C_Erzs%C3%A9bet_Square%2C_Budapest.JPG","page_title":"Szerelmesek lakatjai","context_page_description":"A szerelmesek lakatjai több településen előforduló látványosság; legtöbb helyen egy kerítésre akasztanak fel szerelmesek összetartozásuk jeléül olyan lakatot, melybe belevésték vagy belegravírozták nevüket vagy nevük kezdőbetűit. Az összetartozást kifejező lakat felhelyezését követően a szerelemesek rendszerint eldobják a lakat kulcsát, mintegy kifejezve, hogy többé soha nem kívánják levenni."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A5%D0%B8%D1%81%D1%82%D0%B8%D0%B4%D0%B8%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/L-histidine-zwitterion-from-xtal-1993-3D-balls-B.png","page_title":"Хистидин","context_page_description":"Хистидин е органско соединение, од групата на аминокиселини."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%BA%D8%AF%D8%A7%D9%85%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Libya_Ghadames_Old_Town_Rooftop_View.JPG","page_title":"غدامس","context_page_description":"غدامس مدينة ليبية تقع قرب مثلث حدود ليبيا مع كل من تونس والجزائر في الجزء الغربي من البلاد على خط عرض 30,08 شمالاً وخط طول 9,03 شرقاً، وترتفع عن مستوى سطح البحر 357 متراً. وتبعد 543 كيلومتراً جنوب غرب العاصمة طرابلس.\\nوغدامس هي واحة نخيل، سكانها 25 ألف نسمة، ويقال لها مدينة القوافل لمحطتها الرئيسية من الزمن البعيد، وتعد من أشهر المدن على خط التجارة بين شمال وجنوب الصحراء الكبرى ولها علاقة تاريخية مزدهرة في التجارة مع تمبكتو في مالي.\\nترتبط مدينة غدامس بالعاصمة طرابلس بطريق بري يمتد لمسافة 600 كم ويمر تحت جبل نفوسة وهي السلسلة الجبلية الممتدة من الخمس إلى نالوت ويوجد بالقرب من المدينة مهبط للطائرات تربطها رحلات دورية مع مدينة طرابلس وسبها.\\nوصنّفت منظمة التربية والعلوم والثقافة التابعة للأمم المتحدة \\"اليونسكو\\" غدامس القديمة مدينة تاريخية ومحمية من قبل المنظمة، وقد كانت غدامس قديماً واحدة من أشهر المدن الأفريقية الشمالية التي لعبت دورا تجارياً مهماً بين شمال وجنوب الصحراء الكبرى بكونها محطة للقوافل، ودخل الإسلام غدامس سنة 44 هجرية على يد الفاتح الصحابي عقبة بن نافع الفهري."},{"page_url":"https://lmo.wikipedia.org/wiki/Cimiteri_de_Bagg","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Cimitero_di_Baggio_03.jpg","page_title":"Cimiteri de Bagg","context_page_description":"El Cimiteri de Bagg a l'è 'n foppon de Milan, finna al 1923 a servizzi del comun de Bagg. El gh'ha 'na gesetta per i celebrazion religios e anca 'na sezion per quej che hinn minga de fed cattòlega. L'è anca sed del sacrari di mazzaa in la prima guerra mondial del comun de Bagg. El gh'ha 'me ingress principal quell in Via Romero, menter che 'l gh'è 'n vegg ingress, al dì d'incoeu saraa, in Via Segur.\\nDenanz la gh'è la prima \\"cà funeraria\\" d'Italia, indova che se pòden tegnì di fonzion minga religios."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%B6%8A%E5%8D%8E%E8%B7%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Nationalist_Government_of_the_R.O.C_Canton.jpg","page_title":"越华路","context_page_description":"越華路是中國廣州市越秀區的一條東西走向的道路，位於倉邊路以西，吉祥路以東。長633米，寬13米。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A4%D1%8D%D0%B9_%D0%A1%D1%8F%D0%BE%D1%82%D1%83%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Xiaotong.jpg","page_title":"Фэй Сяотун","context_page_description":"Фэй Сяоту́н — китайский антрополог, социолог, политический деятель."},{"page_url":"https://de.wikipedia.org/wiki/IC_5305","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/IC5305_-_SDSS_DR14.jpg","page_title":"IC 5305","context_page_description":"IC 5305 ist eine Spiralgalaxie vom Hubble-Typ S im Sternbild Pegasus am Nordsternhimmel. Sie ist schätzungsweise 476 Millionen Lichtjahre von der Milchstraße entfernt und hat einen Durchmesser von etwa 55.000 Lj.\\nIm selben Himmelsareal befinden sich u. a. die Galaxien NGC 7594, NGC 7595, IC 5306, IC 5307.\\nDas Objekt wurde am 26. Oktober 1897 von Hermann Kobold entdeckt."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B2%D0%B8%D1%82%D0%BE%D0%BA_%D0%B8_%D0%BA%D0%BB%D1%8E%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Benjamin_McLane_Spock_%281976%29.jpg","page_title":"Свиток и ключ","context_page_description":"Свиток и Ключ — тайное общество старшекурсников Йельского университета, основанное в 1841 году. Это второе старейшее тайное общество университета."},{"page_url":"https://no.wikipedia.org/wiki/Dochmonota","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Dochmonota_rudiventris.jpg","page_title":"Dochmonota","context_page_description":"Dochmonota er en slekt av biller som hører til den store underfamilien Aleocharinae i familien kortvinger. Det er beskrevet arter, to av dem er funnet i Norge."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%A4%A9%E4%B8%BB%E6%95%99%E5%AE%97%E5%BA%A7%E5%9C%A3%E6%AE%BF%E5%88%97%E8%A1%A8/N-Z","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Puno_Cathedral.jpg","page_title":"天主教宗座圣殿列表/N-Z","context_page_description":"天主教宗座聖殿列表\\n天主教宗座聖殿列表/A-E | 天主教宗座聖殿列表/F-M | 天主教宗座聖殿列表/N-Z"},{"page_url":"https://sv.wikipedia.org/wiki/Akatsi","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Akatsi_-_Dzodze_-_Aflao_Road_pano.jpg","page_title":"Akatsi","context_page_description":"Akatsi är en ort i sydöstra Ghana. Den är huvudort för distriktet Akatsi South, och folkmängden uppgick till 31 884 invånare vid folkräkningen 2010."},{"page_url":"https://de.wikipedia.org/wiki/Wendeltreppe","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a6/Killesbergturm.JPG","page_title":"Wendeltreppe","context_page_description":"Eine Wendeltreppe, in der Schweiz und alemannisch Schnegge bzw. Schnecke, ist eine gewendelte Treppenform, bei der die Wegführung einer Helix entspricht. Die Wendeltreppe windet sich schraubenförmig um ein zentrales Treppenauge. Die Treppe wird dann auch Hohltreppe genannt.\\nWird die Treppe durch eine zentrale Säule getragen, spricht man von einer Spindeltreppe. Die Treppenspindel kann sich aus zylindrischen Teilen der einzelnen Stufen zusammensetzen, oder es kann sich um eine durchgehende Säule handeln, an der die Stufen im Nachhinein befestigt sind. Die meisten Spindeltreppen sind heute aus Stahl gefertigt; mögliche andere Materialien waren und sind Naturstein, Betonwerkstein, Gusseisen oder Holz.\\nEine doppelläufige Wendeltreppe ist eine zweiarmige Wendeltreppe, bei der die Antritte und Austritte der Treppenarme um 180° versetzt liegen. Die Treppenläufe sind teilweise übereinander angeordnet. Die bekannteste doppelläufige Wendeltreppe befindet sich im Loireschloss Chambord. Die Erfindung dieser Treppenform wird Leonardo da Vinci zugeschrieben. Ein Beispiel aus neuerer Zeit ist die Treppe zur Aussichtsplattform des Killesbergturmes in Stuttgart."},{"page_url":"https://en.wikipedia.org/wiki/Lieveren","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/HartVanLieveren.JPG","page_title":"Lieveren","context_page_description":"Lieveren is a village in the Netherlands and it is part of the Noordenveld municipality in Drenthe. Lieveren has an altitude of about 4 meters."},{"page_url":"https://tg.wikipedia.org/wiki/%D0%A4%D1%83%D1%80%D1%83%D0%B4%D0%B3%D0%BE%D2%B3%D0%B8_%D0%A4%D1%80%D0%B0%D0%BD%D0%BA%D1%84%D1%83%D1%80%D1%82_%D0%95%D0%B3%D0%B5%D0%BB%D1%81%D0%B1%D0%B0%D1%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Luftaufnahme_Flugplatz_Egelsbach.jpg","page_title":"Фурудгоҳи Франкфурт Егелсбах","context_page_description":"Фурудгоҳи Франкфурт Егелсбах — фурудгоҳи ҳамагона бо Коди ИОТОи QEF аст, ки як бонди фуруди асфалт дорад, ва тӯли бонди он 1400 метр аст. Ин фурудгоҳ дар кишвари Микронезия қарор дорад, ва дар баландии 117 метр аз сатҳи баҳр воқеъ шудааст."},{"page_url":"https://simple.wikipedia.org/wiki/Mal%C3%A9","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/67/Male_maldives.jpg","page_title":"Malé","context_page_description":"Malé is the capital city of the Maldives. It has a population of 133,412. The city is on Malé Island in the Kaafu Atoll. Although Malé is in Kaafu Atoll, administratively it is not considered part of it. There is a commercial harbor in the Island. It is the center of all commercial activities in the country. Many government buildings and agencies are on the waterfront. Malé International Airport is close to Hulhule Island which includes a seaplane base for internal transportation.\\nand male' has the most beautiful reefs on earth. Male's current president is Ibrahim Solih and it is known as the smallest city on earth. It is quite a dense city."},{"page_url":"https://en.wikipedia.org/wiki/Jannine_Weigel","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Jannine_weigel_2018-9-21.jpg","page_title":"Jannine Weigel","context_page_description":"Jannine Parawie Weigel, also known by the Thai nickname Ploychompoo, is a Thai singer, songwriter, actress, model, influencer, gamer, ambassador and YouTuber. She is of German and Thai descent."},{"page_url":"https://ro.wikipedia.org/wiki/Vaccin","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Defense.gov_News_Photo_041028-N-9864S-021.jpg","page_title":"Vaccin","context_page_description":"Un vaccin este un produs medicamentos biologic care are ca scop inducerea unui răspuns imun și implicit protecție imună dobândită față de o anumită boală infecțioasă. Vaccinurile pot conține agentul patogen întreg, atenuat sau dezactivat, toxinele produse de agent care sunt responsabile de producerea patologiei la om sau diferite fragmente moleculare. Ajuns în organism, principiul activ din vaccin induce un răspuns imun prin stimularea sistemului imunitar, cu inducerea unei memorii imune ce va avea ca scop recunoaștera ulterioară și distrugerea agentului patogen, odată intrat în organism. Vaccinurile pot fi utilizate în scop profilactic sau curativ.\\nVaccinarea este o metodă de imunizare activă, profilactică, împotriva unor boli, prin inocularea unui vaccin.\\nProtecția imunologică se instalează după un interval de timp variabil de la inoculare, în funcție de vaccin, și este de lungă durată.\\nVaccinarea și termenul de vaccin au fost introduse în medicină de medicul generalist englez Edward Jenner, în anul 1796, cu ocazia descoperirii primului vaccin, împotriva variolei.\\nÎn prezent toate țările și-au elaborat propriile scheme naționale de vaccinare împotriva bolilor infecțioase."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%9C%AC%E7%94%B0%E6%8A%80%E7%A0%94%E5%B7%A5%E6%A5%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Paris_Motor_Show_2018%2C_Paris_%281Y7A0992%29.jpg","page_title":"本田技研工業","context_page_description":"本田技研工業株式会社は、東京都港区に本社を置く日本の大手輸送機器メーカーである。通称「ホンダ」、「Honda」。オートバイの販売台数、売上高は世界首位。自動車の販売台数は世界第7位。TOPIX Core30の構成銘柄の1つ。"},{"page_url":"https://ce.wikipedia.org/wiki/%D0%90%D1%80%D0%BD%D0%B0%D1%83%D1%82%D0%B0%D1%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Arvanites-Gallery.jpg","page_title":"Арнауташ","context_page_description":"Арвани́таш, арнау́таш — албанхойн православин дин лело субэтносан тоба, XIV—XV бӀешерашкахь Албани йитина, балканехь къаьмнаш кхалхарца доьзна. Кхалхарш хилира франкократи чӀагӀъяларца, Византийн импери гӀелъяларца, Европе Туркой-Ӏусманхой чубахкарца. XX бӀешо доладаллалц арваниташ доккхаха дакъа дара Желтойчоь паччахьаллин бахархойн. Юккъера бӀешерашкахь арванитийн ненан мотт албанийн меттан башха меттадакъа дара — арванитийн мотт, тахана байна ала мегар ду. Ярташкара арнауташ, тӀаккха а, Ӏалашдина желтойн этносан къастар. Желтойн-албанхойн дозанера Корча гӀалан йисташкарчу арнаутийн жимачу тобанех схьаевлла Российн имперера а, ССРС хиллачура а албанхойн ерриг тобанаш барам 5 эз. ст. гергга волуш."},{"page_url":"https://en.wikipedia.org/wiki/Schleswig-Holstein-Sonderburg-Pl%C3%B6n","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Traventhal_Wappenkartusche_retouched.jpg","page_title":"Schleswig-Holstein-Sonderburg-Plön","context_page_description":"The Duchy of Schleswig-Holstein-Sonderburg-Plön, also Schleswig-Holstein-Plön, Holstein-Plön or just Duchy of Plön, was a small sub-duchy created by the physical division of the Duchy of Schleswig-Holstein-Sonderburg. Today, its remaining significance is primarily the building of Plön Castle. The Duchy of Plön was not a territorial dukedom in its own right, but a sub-division within the state structure of the duchies of Schleswig and Holstein. The scattered territorial dominion lay mostly in the southeast part of present-day German state of Schleswig-Holstein."},{"page_url":"https://en.wikipedia.org/wiki/Aetolian_War","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Vergina_Sun_-_Golden_Larnax.png","page_title":"Aetolian War","context_page_description":"The Aetolian War was fought between the Romans and their Achaean and Macedonian allies and the Aetolian League and their allies, the kingdom of Athamania. The Aetolians had invited Antiochus III the Great to Greece, who after his defeat by the Romans had returned to Asia. This left the Aetolians and the Athamanians without any allies. With Antiochus out of Europe the Romans and their allies attacked the Aetolians. After a year of fighting the Aetolians were defeated and forced to pay 1,000 talents of silver to the Romans."},{"page_url":"https://sv.wikipedia.org/wiki/%C3%85rstid","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/North_season.jpg","page_title":"Årstid","context_page_description":"Årstiderna är inom väderförhållandena årets fyra delar, nämligen vår, sommar, höst och vinter. Dessa fyra årstider kan delas in på flera olika sätt, till exempel astronomiskt, kalendariskt eller klimatologiskt."},{"page_url":"https://hsb.wikipedia.org/wiki/P%C5%82%C3%B3tna_wijawka","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Calystegia_pulchra_bluete.jpeg","page_title":"Płótna wijawka","context_page_description":"Płótna wijawka je ród ze swójby wijawkowych rostlinow.\\nWobsahuje sćěhowace družiny:\\nblušćojta wijawka\\nkrasna wijawka\\nlěsna wijawka\\npřimórska wijawka\\nwšědna wijawka"},{"page_url":"https://it.wikipedia.org/wiki/Marcella_Althaus-Reid","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Marcella_Althaus-Reid.jpg","page_title":"Marcella Althaus-Reid","context_page_description":"Marcella Maria Althaus-Reid è stata una teologa argentina, impegnata nei movimenti di liberazione femminista e glbt."},{"page_url":"https://it.wikipedia.org/wiki/Necrosyrtes_monachus","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Necrosyrtes_monachus.jpg","page_title":"Necrosyrtes monachus","context_page_description":"Il capovaccaio pileato, unica specie del genere Necrosyrtes Gloger, 1841, è un rapace della famiglia degli Accipitridi originario dell'Africa sub-sahariana. Nonostante il nome e una certa somiglianza esteriore, non è affatto imparentato con il capovaccaio, che appartiene a un'altra sottofamiglia, i Gipetini."},{"page_url":"https://de.wikipedia.org/wiki/Windpark_Neuss","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Windpark-Neuss-1.jpg","page_title":"Windpark Neuss","context_page_description":"Der Windpark Neuss befindet sich bei Röckrath im Südwesten des Stadtgebietes von Neuss, nahe dem Buscherhof, und besteht aus vier Windenergieanlagen. Die Windkraft-Konzentrationszone liegt am äußersten Rand des Stadtgebietes an der Grenze zu Korschenbroich. Direkt angrenzend befindet sich der Windpark Korschenbroich-Süd."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A0%D1%8F%D0%B1%D0%B5%D1%86%D1%8C_%D1%80%D1%83%D0%B4%D0%B8%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Melitaea_cinxia_MHNT_CUT_2013_3_27_Avilly-Saint-L%C3%A9onard_dorsal.jpg","page_title":"Рябець рудий","context_page_description":"Рябець рудий — вид денних метеликів родини сонцевиків."},{"page_url":"https://es.wikipedia.org/wiki/Edicto_de_Potsdam","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/EdiktPotsdam.jpg","page_title":"Edicto de Potsdam","context_page_description":"El edicto de Potsdam fue un decreto publicado el 29 de octubre de 1685 en Potsdam por el príncipe elector de Brandenburgo y rey de Prusia Federico Guillermo I.\\nEn respuesta al edicto de Fontainebleau publicado por Luis XIV de Francia pocos días antes, en el cual se establecía la prohibición de profesar cualquier religión que no fuera la católica y se ordenaba el cierre de las escuelas e iglesias protestantes, Federico Guillermo se comprometía a acoger a los franceses exiliados por motivos religiosos, dándoles facilidades para establecerse en sus dominios: los inmigrantes estarían exentos del pago de impuestos de aduana sobre sus bienes, tendrían ayudas económicas para construir sus viviendas, se les cederían terrenos para cultivar y tras su establecimiento serían admitidos como ciudadanos del electorado.\\n​"},{"page_url":"https://pt.wikipedia.org/wiki/Auguste_Fran%C3%A7ois_Marie_Glaziou","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Acta_Horti_berg._-_1905_-_tafl._139_-_Auguste_Fran%C3%A7ois_Marie_Glaziou.jpg","page_title":"Auguste François Marie Glaziou","context_page_description":"Auguste François Marie Glaziou foi engenheiro civil e botânico formado pelo Museu de História Natural de Paris, tendo aprofundando seus estudos em agricultura e horticultura com a orientação de renomados professores: Adolphe-Théodore Brongniart e Joseph Decaisne. Filho de um jardineiro, agricultor e horticultor, François aprendeu a trabalhar com jardinagem e se aperfeiçoou na profissão do pai.\\nGlaziou chegou ao Brasil - mais especificamente no Rio de Janeiro - em 1858 em busca de novas oportunidades. Foi nesse momento que o botânico adiciona o prenome Auguste, em uma possível homenagem ao botânico Auguste Saint-Hilaire, grande pesquisador da flora brasileira.\\nO paisagista foi o responsável por desenvolver diversos projetos na Corte, como as reformas do Passeio Público, da Quinta da Boa Vista e do Campo de Santana. O trabalho de Glaziou, no entanto, não se resumiu apenas aos espaços públicos. Famoso por seu trabalho, o paisagista também foi convidado a realizar seu trabalhos em casa de grandes personalidades, como o Barão de Nova Friburgo e o Barão de Mauá, no Rio de Janeiro, e de Tavares Guerra, em Petrópolis."},{"page_url":"https://de.wikipedia.org/wiki/Ostseeland_II","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Bundesarchiv_Bild_183-F0615-0001-011%2C_Rostock%2C_%C3%9Cberseehafen%2C_Hafenrundfahrt%2C_Yacht%2C_Ausflugsschiff.jpg","page_title":"Ostseeland II","context_page_description":"Die Ostseeland II war als Ostseeland die erste Staatsyacht der Deutschen Demokratischen Republik."},{"page_url":"https://en.wikipedia.org/wiki/Monotype_typefaces","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Monotype-machine.jpg","page_title":"Monotype typefaces","context_page_description":"Monotype fonts were developed by the Monotype company. This name has been used by three firms. Two of them had their roots in \\"hot metal\\" or lead type in the printing industry. They could not adapt when the market changed as computer, offset and photographic systems became dominant. These were\\nLanston Monotype Cooperation in Philadelphia, USA\\nThe Monotype Corporation Limited in Salfords, UK\\nA third firm produces fonts for computer use:\\nMonotype Imaging Inc.\\nThe latter firm is in a sense the successor to the English Monotype factory. It has the rights to the original designs, and later obtained rights to many more designs from other sources. The remains of the production archive and what is left of the machines are at the Type Museum in London, England. There the original matrices can still be accessed and parts of the old machines ordered. The collection itself is the property of the British Science Museum. The survival of the Type Museum is threatened since the building is no longer owned by the Science Museum, is in a very poor state of repair, and the new owner intends other uses for the property."},{"page_url":"https://ca.wikipedia.org/wiki/Gr%C3%A8cia","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Stavronikita_Aug2006.jpg","page_title":"Grècia","context_page_description":"Grècia, oficialment la República Hel·lènica, és un estat del sud-est d'Europa, situat a la punta meridional de la península Balcànica. Té frontera amb Albània, Macedònia del Nord i Bulgària al nord, i Turquia a l'est. El mar Egeu és a l'est de Grècia, el mar Jònic a l'oest i el mar Mediterrani al sud. Grècia inclou un vast nombre d'illes, incloent-hi Creta, Dodecanès, les Cíclades i les Illes Jòniques, entre d'altres. El 80% del territori és muntanyenc; el pic més alt n'és l'Olimp, amb 2.917 msnm.\\nLa Grècia moderna té les seves arrels en la civilització de l'antiga Grècia, sovint considerada el bressol de la cultura occidental i, com a tal, el lloc de naixement de la democràcia, la filosofia occidental, els Jocs Olímpics, la literatura occidental, la historiografia, les ciències polítiques, els principis científics i matemàtics i el teatre. La Grècia moderna va establir-se el 1830, després de la revolta independentista victoriosa contra l'Imperi otomà.\\nEn l'actualitat, Grècia és un país desenvolupat, de renda alta, amb un índex de desenvolupament humà i qualitat de vida elevats. Grècia és membre de la Unió Europea des del 1981, i de la zona euro des del 2001."},{"page_url":"https://ro.wikipedia.org/wiki/B%C3%BCddenstedt","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0c/Wappen_Bueddenstedt.png","page_title":"Büddenstedt","context_page_description":"Büddenstedt este o comună din landul Saxonia Inferioară, Germania."},{"page_url":"https://cs.wikipedia.org/wiki/R%C5%AF%C5%BEe_ze_Saint-Flouru","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Offenbach-Laroseimage1.jpg","page_title":"Růže ze Saint-Flouru","context_page_description":"Růže ze Saint-Flouru je opereta o jednom dějství francouzského skladatele Jacquese Offenbacha na libreto Michela Carrého a Charlese Nuittera z roku 1856. Její premiéra se konala 12. června 1856 v Offenbachově divadle Théâtre des Bouffes-Parisiens na jeho prvním působišti na Avenue des Champs-Élysées."},{"page_url":"https://fr.wikipedia.org/wiki/Occupation_de_la_Gr%C3%A8ce_pendant_la_Seconde_Guerre_mondiale","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f9/FamineGr%C3%A8ce1941-1944.png","page_title":"Occupation de la Grèce pendant la Seconde Guerre mondiale","context_page_description":"La Grèce, qui résistait victorieusement aux Italiens depuis 1940, doit capituler en avril 1941 devant l’invasion conjuguée de la Wehrmacht et des troupes mussoliniennes. Commence alors une période d’occupation de la Grèce par les forces de l’Axe : l’Allemagne nazie, Italie fasciste et Bulgarie. L’occupation prend fin en octobre 1944 avec le retrait des troupes allemandes de la partie continentale du pays. Cependant, dans quelques îles, comme en Crète, les garnisons allemandes restent présentes jusqu'en mai-juin 1945.\\nLe 28 octobre 1940, l’Italie envahit la Grèce à partir de l'Albanie qu'elle occupe déjà depuis avril 1939. Cependant, l'armée grecque résiste et contre-attaque, forçant l'armée italienne à battre en retraite. En mars 1941, une nouvelle offensive italienne échoue, mettant fin aux prétentions italiennes en Grèce, et obligeant l'Allemagne à intervenir pour venir en aide à son allié. Le 6 avril 1941, l'Allemagne envahit la Grèce depuis la Bulgarie : la bataille de Grèce s'achève le 28 avril 1941 avec la chute de Kalamata, et la Grèce est divisée en trois zones d'occupation entre les Allemands, les Bulgares et les Italiens."},{"page_url":"https://de.wikipedia.org/wiki/Sch%C3%B6nungsteich","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/51/Bochum_-_Oelbach_10-2006.jpg","page_title":"Schönungsteich","context_page_description":"Ein Schönungsteich dient der Verbesserung der Abwasserqualität aus Kläranlagen. Gleichzeitig bilden die Teiche oft Feuchtbiotope und aufgrund ihrer Abgeschiedenheit wichtige Rückzugsorte für entsprechende Pflanzen und Tiere.\\nDer Teich ist typischerweise der biologischen oder Pflanzenkläranlage nachgeschaltet, er liegt außerhalb deren Betriebsgeländes und hat auch keinerlei Ausstattung, wie sie in einer Kläranlage üblich wäre. Die Reinigung des Wassers von Schwebstoffen und die Angleichung der Wasserqualität hinsichtlich Sauerstoffgehalt sowie hygienischer und ästhetischer Eigenschaften an den nachfolgenden Vorfluter geschieht durch die lange Verweildauer im natürlichen Teich. Sie beträgt normalerweise einige Tage, kann aber bei starkem Niederschlag auch kürzer sein. Hierbei wirkt der Schönungsteich auch teilweise als Regenrückhaltebecken. Auch weitere Zusatznutzungen als Viehtränke oder Löschwasserteich sind üblich.\\nDer Teich hat eine offene Oberfläche, ist mit Wasserpflanzen bewachsen und mit Fischen besetzt, er kann auch als Angelplatz genutzt werden. Seine Geometrie sollte so aufgebaut sein, dass er vom durchgeleiteten Wasser vollständig durchströmt wird."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AC%E3%83%BC%E3%83%A9%E3%83%83%E3%83%88%E5%BC%8F%E6%A9%9F%E9%96%A2%E8%BB%8A","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4d/Ya-01.jpg","page_title":"ガーラット式機関車","context_page_description":"ガーラット式機関車は、関節式蒸気機関車の一形式。名前は、考案者のイギリスの機関車技術者であるハーバート・ウィリアム・ガーラットに由来する。なお、日本語では表記揺れで「ガラット」や「ギャラット」などと表記されることもある。\\n特徴は、車体が3分割構成でボイラーは中心の台枠上にあり浮いており、その前後に動輪がついた首を振る台枠が置かれて中央の台枠を支え、それぞれが別々のシリンダーで駆動され、足回りが2台分あることで通常型蒸気機関車を背中合わせに重連にしたような動きとなるが、1人の機関士が操縦できるので操作性自体は重連より楽になる。\\n同じ関節式蒸気機関車のメイヤー式には一見似ているが、メイヤー式はボイラー自身には独自の台枠がなく前後の首を振る台枠2つで構成されているのに対し、ガーラット式は足回り2つとボイラー用の3つ目の台枠があるのが異なる。"},{"page_url":"https://it.wikipedia.org/wiki/Thutmose_(scultore)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/PortraitStudyOfNefertiti-ThutmoseWorkshop_EgyptianMuseumBerlin.png","page_title":"Thutmose (scultore)","context_page_description":"Thutmose è stato un capo-scultore egizio durante il tardo periodo del regno di Akhenaton, faraone della XVIII dinastia egizia."},{"page_url":"https://sk.wikipedia.org/wiki/SeaBus","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/North_Vancouver_Ferry_No_3.jpg","page_title":"SeaBus","context_page_description":"SeaBus je názov kompy pre pasažierov, spájajúcej Downtown Vancouveru s mestom North Vancouver, ktoré od seba oddeľuje fjord Burrard Inlet. Prevádzkuje ju spoločnosť Coast Mountain Bus Company. Kompa je dôležitou súčasťou integrovanej mestskej hromadnej dopravy TransLink, ktorá zaisťuje služby obyvateľom regionálneho okresu Metro Vancouver v kanadskej provincii Britská Kolumbia."},{"page_url":"https://cs.wikipedia.org/wiki/Elektroizola%C4%8Dn%C3%AD_p%C3%A1ska","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3b/Electrical-tape_green-yellow.jpg","page_title":"Elektroizolační páska","context_page_description":"Elektroizolační páska je druh izolepy, kterým se opravují porušené elektrické kabely. Obvykle bývá vyrobena z plastu či ethenylu."},{"page_url":"https://da.wikipedia.org/wiki/Malawi","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Malawi-demography.png","page_title":"Malawi","context_page_description":"Malawi, officielt Republikken Malawi, er en indlandsstat i det sydøstlige Afrika, der tidligere var kendt som Nyasaland. Det grænser til Zambia mod nordvest, Tanzania mod nordøst, og Mozambique mod øst, syd og vest. Landet er adskilt fra Tanzania og Mozambique ved Malawisøen. Malawi er over 118.000 km² med en anslået befolkning på 16.777.547. Dens hovedstad er Lilongwe, som også er Malawis største by; den næststørste er Blantyre og den tredje er Mzuzu. Navnet Malawi kommer fra Maravi, et gammelt navn på de nyanja mennesker, der bebor området. Landet bærer også tilnavnet \\"Afrikas varme hjerte\\".\\nMalawi er blandt de mindste lande i Afrika. Malawisøen optager omkring en tredjedel af Malawis område.\\nDet område af Afrika, der nu kendt som Malawi, blev befolket af migrerende bantu-grupper omkring det 10. århundrede. Århundreder senere i 1891 blev området koloniseret af briterne. I 1953 blev Malawi, dengang kendt som Nyasaland, et protektorat under britisk, et protektorat i den semi-uafhængige føderation bestående af Rhodesia og Nyasaland. Forbundet blev opløst i 1963."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%BE%D1%81%D1%81%D1%82%D0%B0%D0%BD%D0%B8%D0%B5_%D0%B2_%D0%9A%D0%B0%D0%B3%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Tyoufukuj3.jpg","page_title":"Восстание в Каге","context_page_description":"Восстание в Каге — восстание монахов, крестьян и самураев буддистской секты дзёдо-синсю в Японии, вспыхнувшее в 1488 году в провинции Кага. В результате восстания было создано самоуправляющееся «народное государство», просуществовавшее более 90 лет."},{"page_url":"https://it.wikipedia.org/wiki/Enrico_Micheli","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Enrico_Luigi_Micheli.jpg","page_title":"Enrico Micheli","context_page_description":"Enrico Luigi Micheli è stato un politico e scrittore italiano, già Ministro dei lavori pubblici nel governo D'Alema I."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D0%BE%D0%BB%D0%BE%D0%BA%D0%BD%D1%8F%D0%BD%D0%BA%D0%B0_%D0%BE%D0%B1%D1%8B%D0%BA%D0%BD%D0%BE%D0%B2%D0%B5%D0%BD%D0%BD%D0%B0%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/K%C3%B6hler%27s_Medizinal-Pflanzen_in_naturgetreuen_Abbildungen_mit_kurz_erl%C3%A4uterndem_Texte_%28Plate_137%29_%288232797222%29.jpg","page_title":"Толокнянка обыкновенная","context_page_description":"Толокня́нка обыкнове́нная — кустарник семейства Вересковые, типовой вид рода Толокнянка."},{"page_url":"https://sv.wikipedia.org/wiki/Saint-Victor-et-Melvieu","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d1/Map_commune_FR_insee_code_12251.png","page_title":"Saint-Victor-et-Melvieu","context_page_description":"Saint-Victor-et-Melvieu är en kommun i departementet Aveyron i regionen Occitanien i södra Frankrike. Kommunen ligger i kantonen Saint-Rome-de-Tarn som ligger i arrondissementet Millau. År 2009 hade Saint-Victor-et-Melvieu 378 invånare."},{"page_url":"https://de.wikipedia.org/wiki/Heilig_Kreuz_(Mindelaltheim)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Arma_christi_ohne_Schmuck.jpg","page_title":"Heilig Kreuz (Mindelaltheim)","context_page_description":"Heilig Kreuz ist eine römisch-katholische Wallfahrts- und Friedhofskirche in Mindelaltheim, im bayerisch-schwäbischen Landkreis Günzburg. Die Geschichte des Sakralbaus geht zurück auf die Aufstellung eines Kruzifixes im Jahr 1604, welche die Entstehung eines Pilgerortes und die damit verbundene Errichtung eines Kirchengebäudes 1698 zur Folge hatte. Die heutige Gestalt des kreuzförmigen Gotteshauses ist Ergebnis einer Umgestaltung bzw. Erweiterung durch den Rokoko-Baumeister Joseph Dossenberger d. J. 1753–54. Das zu dieser Zeit gefertigte, 29-teilige Freskenprogramm stammt vom Günzburger Maler Anton Enderle. Die Geschichte der Kirche während der letzten zwei Jahrhunderte war geprägt von Perioden der Baufälligkeit und Schließung, wie auch von einer grundlegenden Renovierung in den Jahren 1986–1990. Das Denkmal ist eines von 28 durch die Haager Konvention geschützten Kulturgütern des Landkreises.\\nIm Chor befindet sich eine achtteilige Kreuzigungsgruppe, deren älteste Figuren in die erste Hälfte des 17. Jahrhunderts datiert werden. Kunsthistorisch beachtenswert ist außerdem eine spätgotische Sitzmadonna mit Jesuskind."},{"page_url":"https://en.wikipedia.org/wiki/List_of_birds_of_Oman","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/47/Egyptian_vulture.jpg","page_title":"List of birds of Oman","context_page_description":"This is a list of the bird species recorded in Oman. The avifauna of Oman include a total of 543 species, of which 7 have been introduced by humans. 27 species are globally threatened.\\nThis list's taxonomic treatment and nomenclature generally follow the conventions of The Clements Checklist of Birds of the World, 2019 edition with a few changes based on the list of the Ornithological Society of the Middle East. The family accounts at the beginning of each heading reflect the Clements taxonomy, as do the species counts found in each family account. Introduced and accidental species are included in the total counts for Oman.\\nThe following tags have been used to highlight several categories, but not all species fall into one of these categories. Those that do not are commonly occurring native species.\\nAccidental - a species that rarely or accidentally occurs in Oman\\n(I) Introduced - a species introduced to Oman as a consequence, direct or indirect, of human actions\\nExtirpated - a species that no longer occurs in Oman although populations exist elsewhere\\n(X) Extinct - a species or subspecies that no longer exists"},{"page_url":"https://fa.wikipedia.org/wiki/%DA%A9%D9%BE%D9%84%DA%A9_%D8%AC%DA%AF%D8%B1_%D9%86%DB%8C%D8%B4%D8%AA%D8%B1%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Dircrocoelimegg.jpg","page_title":"کپلک جگر نیشتری","context_page_description":"دیکروسلیوم دندرتیکوم جزو مهم‌ترین ترماتودهای انگلی است. این کرم در داخل مجاری صفراوی کبد در گاو و گوسفند و بز، خوک و گراز و به ندرت انسان زندگی می‌کند. کم‌خونی، التهاب، یرقان و لاغری یا کاشکسی و سندرم هالزون از جمله عوارض مبتلا شدن به این انگل می‌باشد.\\nابن انگل انتشار جهانی دارد."},{"page_url":"https://ca.wikipedia.org/wiki/L%27Espaud","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/L%C3%A9paud_%C3%A9glise.jpg","page_title":"L'Espaud","context_page_description":"L'Espaud és una comuna de França, a la regió de la Nova Aquitània, departament de la Cruesa.\\nLa seva població al cens de 1999 era de 342 habitants. Està integrada a la Communauté de communes d'Évaux-les-Bains et de Chambon-sud-Voueize."},{"page_url":"https://es.wikipedia.org/wiki/Ramal_ferroviario_Ingeniero_Maschwitz-Dique_Luj%C3%A1n","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0e/Estacion_Maschwitz.JPG","page_title":"Ramal ferroviario Ingeniero Maschwitz-Dique Luján","context_page_description":"El Ramal Ingeniero Maschwitz - Dique Luján fue un ramal secundario perteneciente al Ferrocarril General Bartolomé Mitre. Actualmente se encuentra clausurado y sus vías fueron removidas."},{"page_url":"https://pl.wikipedia.org/wiki/Elbl%C4%85g","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Elbl%C4%85g_-_Nocny_widok_zza_rzeki_-_foto_%C5%81ukasz_Koty%C5%84ski.jpg","page_title":"Elbląg","context_page_description":"Elbląg – miasto na prawach powiatu w województwie warmińsko-mazurskim, siedziba władz powiatu elbląskiego i gminy wiejskiej Elbląg, ale miasto nie wchodzi w ich skład, stanowiąc odrębną jednostkę samorządu terytorialnego. Od 1992 stolica diecezji elbląskiej. Najstarsze miasto w województwie, jedno z najstarszych w Polsce i Niemczech. Miasto posiadało prawo do czynnego uczestnictwa w akcie wyboru króla. Także najniżej położone miasto w Polsce. Leży u ujścia rzeki Elbląg do Zalewu Wiślanego. Według danych GUS na dzień 31 grudnia 2019 roku populacja Elbląga wynosiła 119 317 mieszkańców.\\nElbląg to ośrodek przemysłu ciężkiego, przemysłu spożywczego, przemysłu meblarskiego, również turystycznego. Największy jednak rozwój miasta przypadał na okres od 1 czerwca 1975 do 31 grudnia 1998, kiedy Elbląg był stolicą województwa. Miał wtedy miejsce znaczny napływ ludności do miasta.\\nPrzez obwodnicę Elbląga przebiegają dwie drogi krajowe: S7 łącząca Elbląg z Gdańskiem, Warszawą i Krakowem oraz S22 będąca najkrótszą drogą łączącą zachód i wschód Europy. Od Elbląga na wschód obie drogi mają status drogi ekspresowej."},{"page_url":"https://ro.wikipedia.org/wiki/Charles_Barry","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Charles-Barry.jpg","page_title":"Charles Barry","context_page_description":"Sir Charles Barry a fost un arhitect și constructor englez. Este cunoscut pentru proiectul Casei Parlamentului din Londra, constriută în stil neogotic."},{"page_url":"https://fr.wikipedia.org/wiki/Serres_(Hautes-Alpes)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Serres_-291.jpg","page_title":"Serres (Hautes-Alpes)","context_page_description":"Serres est une commune française située dans le département des Hautes-Alpes en région Provence-Alpes-Côte d'Azur. La commune fait partie du parc naturel régional des Baronnies provençales créé en 2015.\\nAvec Callac, Èze, Laval, Noyon, Sarras, Savas, Senones et Sées, Serres est une des rares communes françaises à porter un nom palindrome.\\nSes habitants sont appelés les Serrois."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AA%D9%8A%D9%85_%D8%A8%D8%A7%D9%84%D9%85%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Tim_Palmer_World_Economic_Forum_2013.jpg","page_title":"تيم بالمر","context_page_description":"تيم بالمر ‏ هو فيزيائي، وعالم أرصاد، وأستاذ جامعي، من المملكة المتحدة، هو عضوٌ في الجمعية الملكية."},{"page_url":"https://lv.wikipedia.org/wiki/Airbus_A350_XWB","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/A350_First_Flight_-_Low_pass_02.jpg","page_title":"Airbus A350 XWB","context_page_description":"Airbus A350 XWB ir pasažieru divu dzinēju platas fizelāžas reaktīvo lidmašīnu saime. To kopš 2010. gada ražo Airbus.\\nA350 ir pirmā Airbus lidmašīna, kurai gan fizelāža gan spārnu struktūra izgatavota no oglekļa šķiedru polimēra.\\nA350 versiju lidojuma attālums var būt no 15 000 līdz 15 600 km. Tās var uzņemt līdz 350 pasažieriem.\\nPirmā lidsabiedrība, kurā A350 sāka lidojumus 2015. gada janvārī, bija Qatar Airways."},{"page_url":"https://fr.wikipedia.org/wiki/Phare_arri%C3%A8re_de_Northport","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Northport_Back_Range_Lighthouse_%2822263567286%29.jpg","page_title":"Phare arrière de Northport","context_page_description":"Le phare arrière de Northport est un phare d'alignement actif qui est situé à Alberton dans le Comté de Prince, au Canada.\\nCe phare est géré par la Garde côtière canadienne.\\nCe phare patrimonial a été reconnu édifice fédéral du patrimoine le 16 avril 2015 par le bureau d'examen des édifices fédéraux du patrimoine canadien."},{"page_url":"https://simple.wikipedia.org/wiki/Bogus%C5%82aw_Kaczy%C5%84ski","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Bogus%C5%82aw_Kaczy%C5%84ski.jpg","page_title":"Bogusław Kaczyński","context_page_description":"Bogusław Kaczyński was a Polish classical music journalist. He was born in Biała Podlaska, Poland."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%8C%94%EB%9D%BC%EC%99%84%EB%82%98%EB%AC%B4%EB%91%90%EB%8D%94%EC%A7%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Palawan_Treeshrew_area.png","page_title":"팔라완나무두더지","context_page_description":"팔라완나무두더지는 청서번티기과에 속하는 나무두더지의 일종이다. 필리핀의 토착종이다. 서식지 감소로 멸종 위협을 받고 있다."},{"page_url":"https://en.wikipedia.org/wiki/Joachim_Radkau","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3d/Joachim_Radkau_Frankfurter_Buchmesse_2013_1.JPG","page_title":"Joachim Radkau","context_page_description":"Joachim Radkau is a German historian."},{"page_url":"https://nl.wikipedia.org/wiki/Philippus_Lansbergen","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Philip_van_Lansberge.jpeg","page_title":"Philippus Lansbergen","context_page_description":"Philippus Lansbergen was een Vlaams-Nederlandse predikant, wiskundige en natuurkundige/astronoom. Hij is bekend als auteur van Tabulae motum coelestium, een verzameling astronomische tabellen die voorspellingen omtrent de posities van planeten bevatten."},{"page_url":"https://es.wikipedia.org/wiki/Ouahigouya","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/80/Ouahigouya_BurkinaFaso.JPG","page_title":"Ouahigouya","context_page_description":"Ouahigouya es una ciudad del norte de Burkina Faso. Es la capital de la Región Norte."},{"page_url":"https://de.wikipedia.org/wiki/29._Dezember","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/94/Arp_147.jpg","page_title":"29. Dezember","context_page_description":"Der 29. Dezember ist der 363. Tag des gregorianischen Kalenders, somit bleiben 2 Tage bis zum Jahresende."},{"page_url":"https://en.wikipedia.org/wiki/Pearl_Jam_2008_United_States_Tour","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/PearlJam-Bonnaroo2008-8.jpg","page_title":"Pearl Jam 2008 United States Tour","context_page_description":"The Pearl Jam 2008 United States Tour was a concert tour by the American rock band Pearl Jam."},{"page_url":"https://it.wikipedia.org/wiki/Specie_invasive_in_Europa","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Jussiaea_grandiflora.jpg","page_title":"Specie invasive in Europa","context_page_description":"Questa è una lista parziale di specie invasive in Europa.\\nUna specie può considerarsi invasiva se è stata introdotta tramite azione umana in una determinata regione, è divenuta capace di stabilire una popolazione riproduttiva nel nuovo habitat senza ulteriori interventi da parte dell'uomo, minacciando direttamente l'agricoltura o la biodiversità locale. Se una specie è stata introdotta, ma non ha prosperato ai danni delle specie autoctone, infettandole oppure soppiantandole nella competizione per il cibo, non può essere considerata invasiva, e non compare in questa lista.\\nIl Regolamento UE 1143/2014 del 22 ottobre 2014 obbliga gli organi competenti dell'UE a costituire e aggiornare ogni sei mesi una lista delle specie invasive di rilevanza comunitaria. Nel mese di luglio 2016, è stato pubblicato il primo elenco ufficiale di tali specie con il Regolamento della Commissione 2016/1141."},{"page_url":"https://ht.wikipedia.org/wiki/Thornton,_Texas","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4d/TXMap-doton-Thornton.PNG","page_title":"Thornton, Texas","context_page_description":"Thornton se yon vil nan eta Texas, nan Etazini.\\nNan lane 2000 li te genyen 525 moun."},{"page_url":"https://de.wikipedia.org/wiki/FV_L%C3%B6rrach","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/FV_L%C3%B6rrach-Brombach.png","page_title":"FV Lörrach","context_page_description":"Der FV Lörrach ist ein 1902 gegründeter Fußballverein aus Lörrach. Bekannte Spieler und spätere Trainer wie Christian Streich, Ottmar Hitzfeld, Sebastian Deisler und Oliver Freund spielten zu einer frühen Phase ihrer Karriere bei diesem Verein.\\n2011 fusionierte der Verein mit dem FV Brombach und spielt seither unter dem Vereinsnamen FV Lörrach-Brombach in der Verbandsliga Südbaden.\\nHeimspielstätte des FV Lörrach-Brombach ist das Grüttpark-Stadion. Der alte Sportplatz des FV Brombach im Hugenmatt wird ebenfalls von dem FV Lörrach-Brombach benutzt."},{"page_url":"https://zh.wikipedia.org/wiki/2008%EF%BC%8D2009%E5%B9%B4%E6%BE%B3%E6%B4%B2%E5%9C%B0%E5%8D%80%E7%86%B1%E5%B8%B6%E6%B0%A3%E6%97%8B%E5%AD%A3","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ec/Kirrily_27_April_2009.jpg","page_title":"2008－2009年澳洲地區熱帶氣旋季","context_page_description":"2008－09年澳洲地區熱帶氣旋季泛指在2008年七月至2009年六月內的任何時間，於澳洲地區所產生的熱帶氣旋。大部份於澳洲地區的熱帶氣旋通常都會於十一月至四月期間形成。首個被命名的風暴Anika在11月18日被澳洲氣象局升為1級熱帶氣旋。\\n本條目的範圍僅侷限於赤道以南，東徑90度和西徑160度以內的澳洲地區水域。這範圍包括了澳大利亞，巴布亞紐幾內亞，索羅門群島的西部地區，東帝汶和印度尼西亞的南部地區。在澳洲地區產生的熱帶氣旋是由澳洲、印尼和巴布亞新畿內亞命名，而美國聯合颱風警報中心會把在該地區的熱帶低氣壓的編號以U字母作結。\\n以下各熱帶氣旋資訊以熱帶氣旋存在期間的最強形態為準。"},{"page_url":"https://hu.wikipedia.org/wiki/D%C5%BEenis_Burni%C4%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Dzenis_burnic.jpg","page_title":"Dženis Burnić","context_page_description":"Dženis Burnić német utánpótlás-válogatott labdarúgó, jelenleg a VfB Stuttgart csapatában szerepel kölcsönben a Borussia Dortmund együttesétől."},{"page_url":"https://de.wikipedia.org/wiki/Dassel","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Sunnydasselday.jpg","page_title":"Dassel","context_page_description":"Dassel ist eine Kleinstadt im Landkreis Northeim im Süden des Landes Niedersachsen.\\nDer urkundlich bereits im Frühmittelalter erwähnte Ort wurde um 1100 zum Namensgeber eines Grafengeschlechts, das Rainald von Dassel europaweit bekannt machte, und bekam 1315 Stadtrechte. Heute ist Dassel als Grundzentrum klassifiziert, das in dem Teilbereich der schulischen Bildung die Aufgaben eines Mittelzentrums wahrnimmt.\\nFünf Höhenzüge liegen im oder am Stadtgebiet. Damit geht eines der vielfältigsten Landschaftsbilder Niedersachsens einher."},{"page_url":"https://de.wikipedia.org/wiki/Nationalpark_B%E1%BA%BFn_En","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Lake_Song_Muc.jpg","page_title":"Nationalpark Bến En","context_page_description":"Der Nationalpark Ben En ist der einzige Nationalpark in der Provinz Thanh Hóa, Vietnam. Der Park wurde im Jahr 1992 gegründet."},{"page_url":"https://nl.wikipedia.org/wiki/Trigram_(I_Tjing)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Trigram_berg.png","page_title":"Trigram (I Tjing)","context_page_description":"De acht trigrammen van de I Tjing zijn gebaseerd op de vijf Chinese elementen. Deze trigrammen staan in het Boek van Veranderingen. Volgens de overlevering zijn de trigrammen lang geleden door Fu Xi, de legendarische grondlegger van de Chinese cultuur, overgetekend naar de tekening op het schild van een schildpad."},{"page_url":"https://ro.wikipedia.org/wiki/Ch%C3%A2tonnay","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bb/Map_commune_FR_insee_code_38094.png","page_title":"Châtonnay","context_page_description":"Châtonnay este o comună în departamentul Isère din sud-estul Franței. În 2009 avea o populație de 1.813 de locuitori."},{"page_url":"https://de.wikipedia.org/wiki/St._Severi_(Kleinrettbach)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Kleinrettbach-Kirche-4-Turmknopf.jpg","page_title":"St. Severi (Kleinrettbach)","context_page_description":"Die mittelalterliche Kirche St. Severi ist der Mittelpunkt von Kleinrettbach im thüringischen Landkreis Gotha. Sie gehört zum Kirchspiel Frienstedt im Kirchenkreis Erfurt der Evangelischen Kirche in Mitteldeutschland."},{"page_url":"https://en.wikipedia.org/wiki/Marek_%C5%9Anieci%C5%84ski","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Orpheus-Festival_Zgorzelec.jpg","page_title":"Marek Śnieciński","context_page_description":"Marek Śnieciński is a Polish poet, narrator, essayist, art critic, curator, documentary and translator German and English literature."},{"page_url":"https://en.wikipedia.org/wiki/Oskar_Maria_Graf","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Oskar_maria_graf_denkmal.jpg","page_title":"Oskar Maria Graf","context_page_description":"Oskar Maria Graf was a German-American author who wrote several narratives about life in Bavaria, mostly autobiographical.\\nIn the beginning, Graf wrote under his real name Oskar Graf. After 1918, his works for newspapers were signed with the pseudonym Oskar Graf-Berg; only for those of his works he regarded as \\"worth reading\\", he used the name Oskar Maria Graf."},{"page_url":"https://de.wikipedia.org/wiki/Will_Power","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Will_Power_Car_2010_Indy_500_Practice_Day_7.JPG","page_title":"Will Power","context_page_description":"Will Power ist ein australischer Automobilrennfahrer. Seit 2008 startet er in der IndyCar Series und gewann dort 2014 die Meisterschaft. 2018 konnte er die 500 Meilen von Indianapolis gewinnen. Seit 2009 steht er beim Team Penske unter Vertrag."},{"page_url":"https://it.wikipedia.org/wiki/Gimli","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Gimli_son_of_Gloin_by_Perrie_Nicholas_Smith.jpg","page_title":"Gimli","context_page_description":"Gimli è un personaggio di Arda, l'universo immaginario fantasy creato dallo scrittore inglese J. R. R. Tolkien. È uno dei protagonisti del famoso romanzo Il Signore degli Anelli.\\nÈ un Nano della dinastia di Durin, figlio di Glóin e membro della Compagnia dell'Anello dal 3018. In seguito viene chiamato \\"Amico degli Elfi\\" per via della profonda amicizia che lo lega all'elfo Legolas. Gimli porta con sé un'ascia, un'arma che brandisce con destrezza. In seguito Glóin, suo padre, gli dona la propria ascia."},{"page_url":"https://nl.wikipedia.org/wiki/Callichthys","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Callichthys_callichthys.JPG","page_title":"Callichthys","context_page_description":"Callichthys is een geslacht van straalvinnige vissen uit de familie van de pantsermeervallen."},{"page_url":"https://en.wikipedia.org/wiki/Grade_I_listed_buildings_in_Anglesey","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Penmon_Priory_-_geograph.org.uk_-_1287345.jpg","page_title":"Grade I listed buildings in Anglesey","context_page_description":"In the United Kingdom, the term listed building refers to a building or other structure officially designated as being of special architectural, historical, or cultural significance; Grade I structures are those considered to be \\"buildings of exceptional interest\\". Listing was begun by a provision in the Town and Country Planning Act 1947. Once listed, strict limitations are imposed on the modifications allowed to a building's structure or fittings. In Wales, the authority for listing under the Planning Act 1990 rests with Cadw."},{"page_url":"https://pt.wikipedia.org/wiki/Qualcomm","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Qualcomm_headquarters.jpg","page_title":"Qualcomm","context_page_description":"Qualcomm é uma empresa americana fundada em 1985 que produz os chipsets dos celulares de tecnologia CDMA e W-CDMA.\\nA empresa é também responsável pelo cliente de e-mail Eudora e pela plataforma de criação de aplicativos para celulares Brew. É proprietária da marca Snapdragon, que produz processadores para smartphones. Teve uma parceria com a Tectoy na produção do console de videogame Zeebo. Em Outubro de 2016 adquiriu a NXP Semiconductors por 47 bilhões de dólares.\\nA Qualcomm anunciou em 27 de dezembro de 2017 que o brasileiro Cristiano R. Amon foi promovido a presidente da empresa.\\nAmon, que foi vice-presidente executivo da companhia e presidente da divisão CDMA Technologies, assumiu o cargo de presidente da empresa em 4 de janeiro de 2018. “Em seu novo papel, Amon irá formular e gerar estratégias-chave para o crescimento da empresa nos negócios principais, bem como novas oportunidades de negócios”, diz o comunicado oficial."},{"page_url":"https://en.wikipedia.org/wiki/Kintetsu_16200_series","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Bluesymphony16200.jpg","page_title":"Kintetsu 16200 series","context_page_description":"The Kintetsu 16200 series, branded Blue Symphony is a limited express electric multiple unit train type operated by the private railway operator Kintetsu Railway in Japan since September 2016. The train was converted from a 6200 series commuter train."},{"page_url":"https://en.wikipedia.org/wiki/Magnuson_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Magnuson_Park-1.jpg","page_title":"Magnuson Park","context_page_description":"Magnuson Park is a 350-acre park on Sand Point, Lake Washington, in the Sand Point neighborhood of Seattle, Washington. The park is the second largest in Seattle, after 534-acre Discovery Park in Magnolia. It is located on the spot of the former Naval Station Puget Sound. Sand Point is the peninsula with Pontiac and Wolf bays that juts into Lake Washington in northeast Seattle."},{"page_url":"https://ro.wikipedia.org/wiki/Budism","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Buddha-Footprint.jpeg","page_title":"Budism","context_page_description":"Budismul este o religie și o filozofie orientală. Ea își are originea în India în secolul al VI-lea î.Hr. și s-a răspândit într-o mare parte a Asiei Centrale și de Sud-Est. Se bazează pe învățăturile lui Gautama Siddhartha, un gânditor indian care se crede că ar fi trăit între 560 î.Hr. și 480 î.Hr.. De-a lungul timpului, budismul a suferit numeroase schimbări, în prezent fiind o religie foarte divizată, fără o limbă sacră comună și fără o dogmă strictă, clar formulată. Răspândit în China, Japonia, Sri Lanka, Coreea, Mongolia, Uniunea Myanmar, Thailanda si Vietnam si Malaezia.\\nBudismul aparține grupului de religii dharmice alături de hinduism și de jainism, păstrând o puternică influență a elementelor constituente ale acestor două religii. Mai este numit și „Buddha Dharma”, ceea ce înseamnă în limbile sanscrită și pali „învățăturile Celui Luminat”."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BB%D0%B0%D1%83%D1%80%D0%B5%D0%B0%D1%82%D1%96%D0%B2_%D0%9D%D0%BE%D0%B1%D0%B5%D0%BB%D1%96%D0%B2%D1%81%D1%8C%D0%BA%D0%BE%D1%97_%D0%BF%D1%80%D0%B5%D0%BC%D1%96%D1%97_%D0%B7_%D0%BB%D1%96%D1%82%D0%B5%D1%80%D0%B0%D1%82%D1%83%D1%80%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Soyinka%2C_Wole_%281934%29.jpg","page_title":"Список лауреатів Нобелівської премії з літератури","context_page_description":"Нобелівська премія з літератури — одна з п'яти премій, започаткованих у 1895 Альфредом Нобелем, що присуджується щорічно за видатний внесок у розвиток світової літератури. Лауреат премії визначається щороку в жовтні Комітетом з присудження Нобелівської премії з літератури, що складається з 5 осіб — членів Шведської академії. Нагородження лауреата Премії з літератури відбувається разом з лауреатами в інших галузях в річницю смерті Альфреда Нобеля 10 грудня кожного року у Стокгольмі. Кожному лауреату вручається медаль, диплом та грошова винагорода."},{"page_url":"https://nl.wikipedia.org/wiki/Provinciale_weg_863","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/af/Kaart_Provinciale_weg_863.png","page_title":"Provinciale weg 863","context_page_description":"De provinciale weg 863 is een provinciale weg in de provincie Drenthe tussen Nieuw-Schoonebeek en Coevorden. De weg is ook bekend onder de naam Europaweg. De weg loopt parallel aan de grens met Duitsland."},{"page_url":"https://vi.wikipedia.org/wiki/%E1%BB%90c_%C4%91%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Cipangopaludina_chinensis_shell.jpg","page_title":"Ốc đá","context_page_description":"Ốc đá hay còn gọi là ốc suối hay ốc thuốc hay còn gọi là ốc Campuchia thuộc họ Viviparidae là một loài ốc trong các loài ốc nước ngọt sinh sống dưới nước, thở bằng mang, đẻ con và là loài ốc sống trong các gộp đá ở các suối trên núi cao, trong hang núi đá, khe suối."},{"page_url":"https://en.wikipedia.org/wiki/List_of_waterfalls_by_type","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Soochipara_Waterfalls.jpg","page_title":"List of waterfalls by type","context_page_description":"The following is a list of waterfalls by type.\\nPlunge: Water descends vertically, losing contact with the bedrock surface.\\nHorsetail: Descending water maintains some contact with bedrock.\\nCataract: A large, powerful waterfall.\\nMulti-step: A series of waterfalls one after another of roughly the same size each with its own sunken plunge pool.\\nBlock: Water descends from a relatively wide stream or river.\\nCascade: Water descends a series of rock steps.\\nSegmented: Distinctly separate flows of water form as it descends.\\nTiered: Water drops in a series of distinct steps or falls.\\nPunchbowl: Water descends in a constricted form and then spreads out in a wider pool.\\nFan: Water spreads horizontally as it descends while remaining in contact with bedrock.\\nSome waterfalls are also distinct in that they do not flow continuously. Ephemeral waterfalls only flow after a rain or a significant snowmelt."},{"page_url":"https://cs.wikipedia.org/wiki/Laura_Lammer","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/2018-10-09_Sport_climbing_Girls%27_combined_at_2018_Summer_Youth_Olympics_%E2%80%93_Victory_ceremony_%28Martin_Rulsch%29_12.jpg","page_title":"Laura Lammer","context_page_description":"Laura Lammer je rakouská reprezentantka ve sportovním lezení, medailistka z letních olympijských her mládeže a mistryně Rakouska v kombinaci."},{"page_url":"https://pl.wikipedia.org/wiki/Lista_ameryka%C5%84skich_senator%C3%B3w_ze_stanu_Wisconsin","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/John_L._Mitchell.jpg","page_title":"Lista amerykańskich senatorów ze stanu Wisconsin","context_page_description":"Lista amerykańskich senatorów ze stanu Wisconsin – senatorzy wybrani ze stanu Wisconsin.\\nStan Wisconsin został włączony do Unii 29 maja 1848 roku. Posiada prawo do mandatów senatorskich 1. i 3. klasy. Do 8 kwietnia 1913 roku senatorowie byli wybierani przez stanowy parlament. Od tego czasu wybierani są w wyborach powszechnych."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Notre-Dame-du-Calvaire_de_Ch%C3%A2tillon","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Le_Fils.jpg","page_title":"Église Notre-Dame-du-Calvaire de Châtillon","context_page_description":"L'église Notre-Dame-du-Calvaire est l'une des deux églises de la commune de Châtillon.\\nCette église, à l'exclusion de son sol, fait l’objet d’une inscription au titre des monuments historiques depuis le 24 juin 2004."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B8%E3%83%A5%E3%83%AA%E3%82%A2%E3%83%B3%E3%83%BB%E3%83%8F%E3%82%AF%E3%82%B9%E3%83%AA%E3%83%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/GreatCrestedGrebes.jpg","page_title":"ジュリアン・ハクスリー","context_page_description":"サー・ジュリアン・ソレル・ハクスリーは、イギリスの進化生物学者、ヒューマニスト、国際間協力の推進者。自然選択説を強力に擁護し20世紀中盤の 総合進化説の形成を主導した。1935年から1942年までロンドン動物学会の事務局長、1946年から1948年までユネスコの初代事務局長を勤めた。世界自然保護基金の創設メンバーでもある。\\nハクスリーは書籍や記事、ラジオ、テレビで科学啓蒙活動を続けたことでよく知られていた。1953年にユネスコから科学普及の功績に対してカリンガ賞を贈られた。1956年にはロンドン王立協会からダーウィンメダルを受賞した。ダーウィンとウォレスが自然選択説を発表してからちょうど100年後の1958年にはロンドン・リンネ学会からダーウィン＝ウォレス・メダルが贈られ、同年ナイトに叙された。1959年に人口問題に関する家族計画分野でラスカー財団から特別賞を受賞した。"},{"page_url":"https://eo.wikipedia.org/wiki/Ludoviko_la_14-a_(Francio)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/LouisXIV-child.jpg","page_title":"Ludoviko la 14-a (Francio)","context_page_description":"Ludoviko la 14-a, franclingve Louis XIV [lui katorz], reĝis kiel burbona monarko de Francio kaj de Navaro ekde la 14-a de majo 1643 ĝis sia morto, kiam li estis 77 jarojn aĝa. Li heredis la tronon nur kelkaj monatoj antaŭ sia kvina datreveno, sed ne posedis efektivan potencon antaŭ la morto de sia ĉefministro, kardinalo Jules Mazarin, en 1661. Ludoviko la 14-a, ankaŭ konata kiel la Suno-reĝo aŭ kiel Ludoviko la Granda, regis Francion dum sepdek du jaroj, tio estas la plej longa reĝado en tiu lando kaj eĉ en iu ajn alia grava reĝlando. Ludoviko la 14-a grandege plifortigis la potencon kaj la influon de Francio en Eŭropo, ĉefe per tri gravaj militoj - la Franca-Nederlanda milito, la Milito de la ligo de Augsburg kaj la Sukceda Milito de Hispanio - sed ankaŭ per aktiva subteno de arto, scienco kaj ekonomio. Post multaj jarcentoj, la reĝo plie finpretigis la submeton de la plej tumultemaj feŭdaj sinjoroj per la kunvenigo de ili ĉe la kastelo de Versailles, kaj tiel asertis la ĉiopovan aŭtoritaton de la franca monarĥio.\\nLudoviko la 14-a, nediskuteble unu el la plej gloraj estroj de Francio, sukcese klopodis por starigi absolutan kaj centralizitan ŝtaton."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%87%D9%88%D9%86%D8%AF%D8%A7_%D8%A2%DA%A9%D9%88%D8%B1%D8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/1993_Honda_Accord_SE_coupe_02.jpg","page_title":"هوندا آکورد","context_page_description":"هوندا آکورد یک سری خودرو است که از سال ۱۹۷۶ تا کنون توسط شرکت هوندا ساخته می‌شود و بیشتر با مدل سدان شناخته شده‌است. این خودرو یکی از پرفروش‌ترین خودروهای ایالات متحده از سال ۱۹۸۹ تا کنون بوده‌است. نام آکورد در سراسر جهان بر روی طیف متنوعی از خودروها شامل کوپه‌ها، استیشن‌ها، هاچ‌بک‌ها و یک مدل کراس‌اوور استفاده شده‌است.\\nاین خودرو علاوه بر کسب چندین جایزه با عنوان‌های خودروی سال، بهترین خودرو در کلاس خود و خودروی سبز سال، از ابتدای تولید نسل اول تاکنون، در ارائه امکانات و فناوری‌های جدید پیشرو بوده‌است. از جملهٔ این فناوری‌ها که برخی از آن‌ها برای اولین بار در بازار خودرو یا در یک کلاس خاص ارائه شدند، می‌توان به فرمان هیدرولیک برای خودروهایی با حجم موتور کمتر از ۲ لیتر، اولین سیستم مسیریاب برای خودروها، ترمز ضد قفل با دیسک ترمز برای هر چهار چرخ، اولین چراغ لنزی برای خودروهای تولید شده در آمریکا، و چندین فناوری و نوآوری دیگر اشاره کرد.\\nدر دههٔ ۲۰۱۰ میلادی، و با وجود افزایش تقاضا برای خودروهای شاسی‌بلند در بازار خودرو، فروش خودروهای سدان کاهش چشمگیری داشت. با این حال نسل نهم هوندا آکورد در سال ۲۰۱۶ با فروش بیش از ۳۴۵٬۰۰۰ دستگاه در ایالات متحده، در مقایسه با مدل سی‌آر-وی با فروش ۳۵۷٬۳۳۵ دستگاه، آمار خوبی را نسبت به رقبای خود در این بازار به نام خود ثبت نمود."},{"page_url":"https://de.wikipedia.org/wiki/Park_an_der_Spree","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/65/Spreepark_F%27hain_2015-05-20_ama_fec_%283%29.JPG","page_title":"Park an der Spree","context_page_description":"Der Park an der Spree ist ein in Planung befindlicher Park im Berliner Ortsteil Friedrichshain am Stralauer Platz. Er ist Teil des Investorenprojektes Mediaspree."},{"page_url":"https://de.wikipedia.org/wiki/Mostyska","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/%D0%9C%D0%BE%D1%81%D1%82%D0%B8%D1%81%D1%8C%D0%BA%D0%B0_%D0%B3%D0%B5%D1%80%D0%B1.png","page_title":"Mostyska","context_page_description":"Mostyska ist eine in der Westukraine liegende Stadt etwa 61 Kilometer westlich der Oblasthauptstadt Lemberg am Flüsschen Sitschna gelegen.\\nDie Grenze zu Polen befindet sich etwa 12 Kilometer entfernt. Durch den Ort führt die Europastraße 40/M 11.\\nAm 18. Dezember 2016 wurde die Stadt zum Zentrum der neu gegründeten Stadtgemeinde Mostyska, zu dieser zählen auch noch die 27 Dörfer Arlamiwska Wolja, Berehowe, Buchowytschi, Chatky, Chorosnyzja, Doboschtschiwka, Hodyni, Korolyn, Kryssowytschi, Lypnyky, Mystytschi, Nahirne, Pidlisky, Pissok, Pnikut, Radenytschi, Sannyky, Saritschtschja, Sawadiw, Slabasch, Stojanzi, Strilezke, Tschyschewytschi, Tschyschky, Twirscha, Wyjkowytschi und Wyschenka, bis dahin bildete sie die Stadtgemeinde Mostyska."},{"page_url":"https://it.wikipedia.org/wiki/Suree_Sukha","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d4/Suree_Sukha_after_THA-OMA.jpg","page_title":"Suree Sukha","context_page_description":"Suree Sukha Sukha è un calciatore thailandese, difensore dell'Ubon UMT."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%AE%E0%A5%87%E0%A4%A5%E0%A5%80","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6a/Fenugreek-methi-seeds.jpg","page_title":"मेथी","context_page_description":"मेथी एक वनस्पति है जिसका पौधा १ फुट से छोटा होता है। इसकी पत्तियाँ साग बनाने के काम आतीं हैं तथा इसके दाने मसाले के रूप में प्रयुक्त होते हैं। स्वास्थ्य की दृष्टि से यह बहुत गुणकारी है।"},{"page_url":"https://id.wikipedia.org/wiki/Museum_Arkeologi_Tyrol_Selatan","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/BozenArchMuseum.jpg","page_title":"Museum Arkeologi Tyrol Selatan","context_page_description":"Museum Arkeologi Tyrol Selatan yang dikenal pula dengan nama Museo Archeologico dell'Alto Adige adalah sebuah museum yang mengkhususkan dalam bidang arkeologi. Museum ini terletak di Kota Bolzano, ibu kota dari Tyrol Selatan, Italia Utara. Ini merupakan rumah bagi mumi Ötzi."},{"page_url":"https://pt.wikipedia.org/wiki/Palazzo_Budini_Gattai","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Palazzo_Budini_Gattai%2C_loggetta.JPG","page_title":"Palazzo Budini Gattai","context_page_description":"O Palazzo Budini Gattai, antigo Palazzo Grifoni, é um palácio italiano localizado em Florença, na Via dei Servi nº 51, esquina com a Piazza Santíssima Annunziata."},{"page_url":"https://ast.wikipedia.org/wiki/Esther_Rolle","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Esther_Rolle_and_John_Amos._Good_Times%2C_1974.JPG","page_title":"Esther Rolle","context_page_description":"Esther Rolle foi una actriz estauxunidense. Ye reconocida pol so papel de Florida Evans na comedia de situación Maude y la so derivada Good Times."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%AE%E0%A4%82%E0%A4%A6%E0%A4%BF%E0%A4%B0%E0%A4%BE_%E0%A4%AC%E0%A5%87%E0%A4%A6%E0%A5%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Mandira_Bedi_at_the_launch_of_Kotak_Junior.jpg","page_title":"मंदिरा बेदी","context_page_description":"मंदिरा बेदी हिन्दी फिल्मों की एक प्रसिद्ध अभिनेत्री हैं।"},{"page_url":"https://en.wikipedia.org/wiki/Brent_railway_station","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Brent_3_railway_station_1892528_ff782f95.jpg","page_title":"Brent railway station","context_page_description":"Brent railway station was on the South Devon Railway, serving the village of South Brent on the southern edge of Dartmoor in Devon, England.\\nThe line through Brent opened on 5 May 1848 but the station was not ready to open until 15 June 1848.\\nThe South Devon Railway was amalgamated with the Great Western Railway on 1 February 1876. On 19 December 1893 the station became a junction, with the opening of the branch to Kingsbridge. The first station on the branch was at Avonwick.\\nThe station has since been closed."},{"page_url":"https://pl.wikipedia.org/wiki/Janta_II","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/POL_COA_Janta_II.svg","page_title":"Janta II","context_page_description":"Janta II – polski herb szlachecki, używany przez rodzinę wywodzącą się z Kaszub."},{"page_url":"https://fr.wikipedia.org/wiki/Caroline_Merola","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Caroline_Merola_%C3%A0_librairie_la_Fureteur_St-Lambert.jpg","page_title":"Caroline Merola","context_page_description":"Caroline Merola est une illustratrice et auteur de bandes dessinées québécoise née à Montréal en 1962."},{"page_url":"https://es.wikipedia.org/wiki/Comercio_de_pieles_en_Siberia","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Sable_skins_Bargusinski.jpg","page_title":"Comercio de pieles en Siberia","context_page_description":"El Comercio de pieles en Siberia es un intercambio que se ocupa de la recolección, compra y venta de valiosas pieles de animales procedentes de Siberia. El comercio de pieles de Siberia se expandió a partir del comercio localizado, y las pieles de Siberia se comercializan ahora en todo el mundo. Este comercio tuvo un impacto significativo en el desarrollo de Siberia a través de la exploración y la colonización. El comercio de pieles también precipitó una disminución en el número de animales de peletería y resultó con la conquista de Siberia por parte de Rusia.​\\nTradicionalmente, los siberianos cazaban como medio de subsistencia y únicamente utilizaban la piel de los animales que cazaban y consumían como guantes y sombreros. La práctica de cazar animales para la obtención de pieles comenzó después de la llegada de los rusos a Siberia, ​ convirtiéndose rápidamente en el tipo más valioso y popular de pieles siberianas, y todavía hoy en día mantiene la distinción.\\nEl comercio de pieles de Siberia comenzó en el siglo XVI, alcanzó su punto álgido en el siglo XVII y continúa hasta la actualidad.​"},{"page_url":"https://vi.wikipedia.org/wiki/%C4%90%C3%B4ng_Nam_B%E1%BB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Mot_khuc_song_tai_Huyen_Nha_Be.jpg","page_title":"Đông Nam Bộ","context_page_description":"Đông Nam Bộ là một trong hai phần của Nam Bộ Việt Nam, có tên gọi khác ngắn gọn được người dân miền Nam Việt Nam thường gọi là Miền Đông. Vùng Đông Nam Bộ có 1 thành phố trực thuộc Trung ương và 5 tỉnh.\\nTheo kết quả điều tra dân số ngày 1 tháng 4 năm 2009, dân số vùng Đông Nam Bộ là 14.025.387 người, chiếm 16.34% dân số Việt Nam, là vùng có tốc độ tăng dân số cao nhất nước, do thu hút nhiều dân nhập cư từ các vùng khác đến sinh sống. Tuy nhiên chỉ sau 10 năm, theo số liệu mới đây năm 2019 của Tổng cục Thống kê VN, tổng dân số của vùng Đông Nam Bộ là 17.828.907 người trên một diện tích là 23.564,4 km², với mật độ dân số bình quân 706 người/km², chiếm 18.5% dân số cả nước.\\nRiêng tài liệu trước đây của Tổng cục Thống kê Việt Nam và một số ít tài liệu khác dựa theo số liệu thống kê của Tổng cục Thống kê lại xếp 2 tỉnh Ninh Thuận, Bình Thuận vào vùng Đông Nam Bộ. Hiện nay Tổng cục Thống kê đã xếp Bình Thuận cùng Ninh Thuận vào vùng Nam Trung Bộ.\\nĐông Nam Bộ là khu vực kinh tế phát triển nhất ở Việt Nam, đóng góp hơn 2/3 thu ngân sách hằng năm, có tỉ lệ đô thị hóa 62.8%."},{"page_url":"https://ca.wikipedia.org/wiki/Gradeta","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bb/Test_tubes.jpg","page_title":"Gradeta","context_page_description":"Una gradeta és un instrument de laboratori que té per finalitat mantenir-hi drets tot tipus de tubs o vials, incloent tubs d'assaig, tubs d'hemòlisi, tubs de centrífuga, tubs eppendorf, criovials, etc. Existeixen diversos tipus de gradetes adaptades a les dimensions dels tubs i als seus usos.\\nGràcies a les gradetes s'aconsegueix una major comoditat en treballar al laboratori, ja que sense elles es necessitaria un altre sistema per a sostenir els tubs per tal de prevenir la seva caiguda, el vessament del seu contingut o altres incidents."},{"page_url":"https://es.wikipedia.org/wiki/Maria_Veleda","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Maria_Veleda%2C_1912.png","page_title":"Maria Veleda","context_page_description":"Maria Veleda, pseudónimo artístico de Maria Carolina Frederico Crispim fue una profesora, periodista, feminista, republicanista, librepensadora y espiritista portuguesa. Fue pionera en la lucha por la educación en la infancia y por los derechos de las mujeres y en la propagación de los ideales republicanos, siendo una de las más importantes dirigentes del primer movimiento feminista portugués.​"},{"page_url":"https://fi.wikipedia.org/wiki/Karen_Asrian","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Asrian_Karen.jpg","page_title":"Karen Asrian","context_page_description":"Karen Asrian oli armenialainen shakin suurmestari. Hän voitti Armenian-mestaruuden vuosina 1999, 2007 ja 2008. Hän saavutti voiton myös 37. shakkiolympialaistapahtumassa Torinossa 2006.\\nAsrian kuoli sairauskohtaukseen 28-vuotiaana."},{"page_url":"https://en.wikipedia.org/wiki/Guy_Fawkes_River","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/32/Ebor_Falls.JPG","page_title":"Guy Fawkes River","context_page_description":"Guy Fawkes River, a perennial stream that is part of the Clarence River catchment, is in the New England and Northern Tablelands districts of New South Wales, Australia."},{"page_url":"https://pt.wikipedia.org/wiki/Marialva_(M%C3%AAda)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/MDA-m%C3%AAda.JPG","page_title":"Marialva (Mêda)","context_page_description":"Marialva é uma freguesia portuguesa do concelho da Mêda, no distrito da Guarda, Beira Interior Norte. Tem 19,15 km² de área e 255 habitantes. A sua densidade populacional é de 13,3 hab/km²."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%BC%80%E6%BA%90%E6%B8%B8%E6%88%8F%E5%88%97%E8%A1%A8","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/95/Route_openbve4.PNG","page_title":"开源游戏列表","context_page_description":"开源游戏是电子游戏中开放源代码的游戏。"},{"page_url":"https://en.wikipedia.org/wiki/Von_der_Leyen_Commission","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Hearing_of_Virginijus_Sinkevi%C4%8Dius.jpg","page_title":"Von der Leyen Commission","context_page_description":"The von der Leyen Commission is the current European Commission, in office since 1 December 2019. Its president is Ursula von der Leyen, who presides over a commission composed of one commissioner from each of the states composing the European Union, except Germany, which is von der Leyen's member state.\\nThe Commission was scheduled to take office on 1 November 2019; however, the French, Hungarian and Romanian commissioner-candidates lost their confirmation votes by the European Parliament in early October 2019, so new commissioners had to be selected from those three member states by the President-elect and subsequently confirmed by the Parliament. This process took place in November 2019 and the Commission eventually took office in its entirety on 1 December 2019."},{"page_url":"https://nl.wikipedia.org/wiki/Onze-Lieve-Vrouwebasiliek_(Tongeren)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Christus_op_de_koude_steen_%2815e_E%29_Onze-Lieve-Vrouwebasiliek_%28Tongeren%29_24-3-2018.JPG","page_title":"Onze-Lieve-Vrouwebasiliek (Tongeren)","context_page_description":"De Onze-Lieve-Vrouwebasiliek is een kerk in de Belgische stad Tongeren. Het is de grootste kerk van deze stad in het uiterste zuiden van de Belgische provincie Limburg. De kerk kent een zeer lange geschiedenis. De huidige benaming van deze kerk is de Onze-Lieve-Vrouw-Geboortebasiliek. Het bouwwerk staat op de werelderfgoedlijst van UNESCO als onderdeel van de groepsinschrijving Belforten in België en Frankrijk."},{"page_url":"https://de.wikipedia.org/wiki/Dreheisenmesswerk","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Moving_Iron_Instrument_Symbol.svg","page_title":"Dreheisenmesswerk","context_page_description":"Ein Dreheisen- oder Weicheisenmesswerk dient zur Anzeige von Strömen und wird in analogen Strommessgeräten eingesetzt. Es wandelt die Stromstärke in einen entsprechenden Zeigerausschlag um.\\nDreheisenmesswerke werden bis heute produziert, wobei sie hauptsächlich als Kontrollinstrumente im Anlagen- und Schaltschrankbau zum Einsatz kommen. In anderen Anwendungen sind sie weitgehend durch digitale Messgeräte wie das Digitalmultimeter ersetzt worden."},{"page_url":"https://ca.wikipedia.org/wiki/M%C3%BAsica_tibetana","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Bundesarchiv_Bild_135-S-16-09-12%2C_Tibetexpedition%2C_M%C3%B6nche_blasen_Tuben.jpg","page_title":"Música tibetana","context_page_description":"La música de Tibet reflecteix el patrimoni cultural de la regió del Transhimàlaia, centrada en el Tibet però també és coneguda allà on hi hagi ètnies tibetanes com a Nepal, Bhutan, Índia i més enllà. La música tibetana és sobretot música religiosa, reflectint la influència profunda del budisme tibetà en la cultura."},{"page_url":"https://no.wikipedia.org/wiki/Hans_%C3%98sterholt","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/15/Hans_%C3%98sterholt.jpg","page_title":"Hans Østerholt","context_page_description":"Hans Østerholt var redaktør og tillitsvalgt i norsk fagbevegelse. Blant tillitsvervene var forretningsfører i Den Nye Social-Demokraten i 1924-25. Fra 1926 til 1930 var han bestyrer av Bryn samvirkelag i Oslo.\\nHan er likevel kanskje best kjent som initiativtaker og redaktør i vittighetsbladet Hvepsen.\\nHan skrev selv flere bygdefortellinger som gikk som føljetonger. Østerholt redigerte lenge juleheftet Julehygge samt det litterære magasinet Blinken."},{"page_url":"https://en.wikipedia.org/wiki/Itoigawa,_Niigata","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Hokuriku_Expressway_and_Route_8_Oyashirazu_Niigata_JPN_001.jpg","page_title":"Itoigawa, Niigata","context_page_description":"Itoigawa is a city located in Niigata Prefecture, Japan. As of 1 July 2019, the city had an estimated population of 41,513, and a population density of 55.6 persons per km². The total area of the city is 746.24 square kilometres."},{"page_url":"https://en.wikipedia.org/wiki/Degol_Woyane","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Access_to_Dabba_Selama.jpg","page_title":"Degol Woyane","context_page_description":"Degol Woyane is a tabia or municipality in the Dogu'a Tembien district of the Tigray Region of Ethiopia. It includes Dabba Selama, the oldest monastery of Ethiopia, and the most inaccessible in the world. The tabia centre is in Zala village, located approximately 10 km to the west of the woreda town Hagere Selam."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A4%E3%83%B3%E3%83%95%E3%82%A3%E3%83%8B%E3%83%86%E3%82%A3%E3%83%BBG","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2a/Infiniti-G35C.jpg","page_title":"インフィニティ・G","context_page_description":"Gは、日産自動車が製造しインフィニティブランドで販売していた高級乗用車である。"},{"page_url":"https://de.wikipedia.org/wiki/Winkerkelle","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Alte_Polizei-Winkerkelle.JPG","page_title":"Winkerkelle","context_page_description":"Die Winkerkelle ist ein Verkehrsleitgerät, das unter anderem von der Polizei, vom Zoll, vom THW, den Feldjägern und der Feuerwehr sowie teilweise von Schülerlotsen im Straßenverkehr eingesetzt wird.\\nAußerdem können Führungshandzeichen mit ihnen übermittelt werden.\\nEs handelt sich dabei um eine Scheibe mit einem Stab als Handgriff, welche meist auf der einen Seite mit einem roten und auf der anderen Seite mit einem grünen Kreis versehen ist. In der Mitte des jeweiligen Kreises befindet sich eine Lampe in der entsprechenden Farbe oder eine neutrale Lampe mit gefärbter Lampenabdeckung, die über einen Schalter am Haltegriff bedient werden kann. Zur besseren Sichtbarkeit bei Nacht sind die Kreise meist retroreflektierend ausgeführt. Die Winkerkellen tragen manchmal zusätzlich eindeutige Aufforderungen bzw. Hinweise wie etwa HALT oder STOP und die Bezeichnung der Organisation, wie Polizei, Zoll oder Feuerwehr.\\nEs gibt aber auch einfachere, die jeweils ein rotes und grünes Katzenauge an einem Holzstab befestigt haben."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_in_Hoorn_(plaats)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Hoorn%2C_brug_Nieuwland.jpg","page_title":"Lijst van rijksmonumenten in Hoorn (plaats)","context_page_description":"De stad Hoorn telt 369 inschrijvingen in het rijksmonumentenregister. Hieronder een compleet overzicht.\\nEen groot aantal monumenten bevindt zich aan of bij de Grote Oost, deze zijn afgesplitst naar de lijst van rijksmonumenten aan het Grote Oost.\\nBij de overige straten bevinden zich de volgende rijksmonumenten:"},{"page_url":"https://ceb.wikipedia.org/wiki/Barnegat_Lighthouse_State_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/NJ_LBI_Lighthouse_08a_%28June_2004%29.JPG","page_title":"Barnegat Lighthouse State Park","context_page_description":"Parke ang Barnegat Lighthouse State Park sa Tinipong Bansa. Nahimutang ni sa kondado sa Ocean County ug estado sa New Jersey, sa sidlakang bahin sa nasod, 270 km sa sidlakan sa Washington, D.C. 8 metros ibabaw sa dagat kahaboga ang nahimutangan sa Barnegat Lighthouse State Park. Ang Barnegat Lighthouse State Park nahimutang sa pulo sa High Bar Island ang ulohan sa nasod.\\nAng yuta palibot sa Barnegat Lighthouse State Park kay daghan kaayong patag. Ang kinahabogang dapit sa palibot dunay gihabogon nga 43 ka metro ug 12.1 km sa kasadpan sa Barnegat Lighthouse State Park. Ang kinadul-ang mas dakong lungsod mao ang Bayville, 16.7 km sa amihanan sa Barnegat Lighthouse State Park. Sa rehiyon palibot sa Barnegat Lighthouse State Park, mga luuk, mga estretso, ug kapuloan talagsaon komon.\\nAng klima kasarangan. Ang kasarangang giiniton 12 °C. Ang kinainitan nga bulan Hulyo, sa 24 °C, ug ang kinabugnawan Marso, sa 3 °C. Ang kasarangang pag-ulan 1,523 milimetro matag tuig. Ang kinabasaan nga bulan Disyembre, sa 195 milimetro nga ulan, ug ang kinaugahan Mayo, sa 96 milimetro."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B5%D1%81%D1%87%D0%B0%D0%BD%D1%8B%D0%B5_%D1%81%D0%BA%D0%B0%D1%82%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Psammobatis_rutrum.jpg","page_title":"Песчаные скаты","context_page_description":"Песчаные скаты — род скатов семейства Arhynchobatidae отряда скатообразных. Это хрящевые рыбы, ведущие донный образ жизни, с крупными, уплощёнными грудными плавниками в форме ромба и выступающим округлым рылом. Рот поперечный или выгнут в виде арки. На вентральной стороне диска расположены 5 жаберных щелей, ноздри и рот. На тонком хвосте имеются латеральные складки. У этих скатов 2 редуцированных спинных плавника и редуцированный хвостовой плавник. Обитают в Атлантическом океане и в юго-восточной части Тихого океана. Встречаются на глубине до 450 м. Достигают длины 60,5 см. Откладывают яйца, заключённые в четырёхконечную роговую капсулу.\\nНазвание рода происходит от др.-греч. ψάμμος — «песок» и лат. batis — «скат»."},{"page_url":"https://es.wikipedia.org/wiki/Rep%C3%BAblicas_aut%C3%B3nomas_de_la_Uni%C3%B3n_Sovi%C3%A9tica","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/USSR_map_Europe.jpg","page_title":"Repúblicas autónomas de la Unión Soviética","context_page_description":"Las Repúblicas Autónomas Socialistas Soviéticas de la Unión Soviética eran entidades administrativas creadas para algunas naciones. Las RASS tenían un rango menor que las repúblicas de la Unión Soviética pero mayor que los óblasts autónomos y los ókrugs autónomos. En la República Socialista Federativa Soviética de Rusia, por ejemplo, el Secretario General del Gobierno de las RASS eran oficialmente miembros del gobierno de la RSFSR. Al contrario que las Repúblicas de la Unión, las RASS no tenían derecho a desafiliarse de la Unión. El nivel de autonomía política, administrativa y cultural del que disponían variaba con el tiempo y fue especialmente grande en los años 1920 con la Korenización, en los años 1950 tras la muerte de Stalin y en la era Brézhnev.​"},{"page_url":"https://ja.wikipedia.org/wiki/%E6%9D%91%E4%BA%95%E5%8F%A4%E9%81%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Old_Isagawa-Awa_Shrine_%28NishiJodo-cho%2C_Nara%29_2.jpg","page_title":"村井古道","context_page_description":"村井 古道は、江戸時代の奈良の郷土史家、外科医、俳人である。代表作に『奈良坊目拙解』がある。"},{"page_url":"https://ko.wikipedia.org/wiki/%EB%B0%94%ED%83%80%EC%95%88%EC%A3%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Balanga%2CBataanjf2820_11.JPG","page_title":"바타안주","context_page_description":"바타안 주는 필리핀 루손 섬에 있는 지방인 중앙루손 지방에 속한 주로 주도는 발랑가이며 인구는 662,153명, 면적은 1,372.98km²이다. 루손 섬 서쪽에 위치하며 바탄 반도 전체를 차지한다. 북쪽으로는 삼발레스 주와 팜팡가 주, 서쪽으로는 남중국해와 접하며 북서쪽으로는 수빅 만, 동쪽으로는 마닐라 만과 접한다."},{"page_url":"https://ca.wikipedia.org/wiki/Colibr%C3%AD_de_Bouguer","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Urochroa_bougueri_%28Colibr%C3%AD_nag%C3%BCiblanco%29_%2814144500332%29.jpg","page_title":"Colibrí de Bouguer","context_page_description":"El colibrí de Bouguer és una espècie d'ocell de la família dels troquílids tradicionalment considerat l'única espècie del gènere Urochroa."},{"page_url":"https://sv.wikipedia.org/wiki/Pempelia","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Pempelia_morosalis-10mm.jpg","page_title":"Pempelia","context_page_description":"Pempelia är ett släkte av fjärilar som beskrevs av Hübner 1825. Pempelia ingår i familjen mott."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Iowa","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c4/Council_on_the_Iowa_Site_at_Florence.jpg","page_title":"National Register of Historic Places listings in Iowa","context_page_description":"This is a list of properties and historic districts in Iowa that are listed on the National Register of Historic Places. There are listings in all of Iowa's 99 counties, adding up to over 2,300 total.\\nThis National Park Service list is complete through NPS recent listings posted August 21, 2020."},{"page_url":"https://en.wikipedia.org/wiki/Associa%C3%A7%C3%A3o_Esportiva_Tiradentes","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/PresidenteVargasCE.JPG","page_title":"Associação Esportiva Tiradentes","context_page_description":"Associação Esportiva Tiradentes, commonly known as Tiradentes, is a Brazilian football club based in Fortaleza, Ceará state. They competed in the Série C once."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AF%D9%86%D8%AA%D8%8C_%D8%A7%D9%88%D9%87%D8%A7%DB%8C%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Green_Township_Municipal_Building.jpg","page_title":"دنت، اوهایو","context_page_description":"دنت یک منطقهٔ مسکونی در ایالات متحده آمریکا است که در شهرستان همیلتون، اوهایو واقع شده‌است. دنت ۱۵٫۴ کیلومتر مربع مساحت و ۱۰٬۴۹۷ نفر جمعیت دارد و ۲۵۷ متر بالاتر از سطح دریا واقع شده‌است."},{"page_url":"https://it.wikipedia.org/wiki/Storia_di_Marino","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Interno-Palazzo-Colonna_anniventi.jpg","page_title":"Storia di Marino","context_page_description":"La storia della città di Marino, in provincia di Roma, nell'area dei Castelli Romani, inizia con la comparsa dei primi insediamenti umani nel territorio comunale durante l'età del bronzo. Nel Medioevo il castello conosce il suo periodo di maggior splendore, sotto la signoria a turno dei Conti di Tuscolo, dei Frangipane, degli Orsini, della Camera Apostolica, dei Caetani, ed infine dei Colonna, di cui fu storica roccaforte. I fatti marinesi hanno avuto un'importanza spesso notevole nel contesto storico locale e, a volte, anche internazionale, tanto che diversi studiosi in varie epoche si sono cimentati nel raccogliere le memorie storiche di questa cittadina. Il castello è stato assediato svariate volte, con esiti alterni, subendo almeno quattro saccheggi e due distruzioni a fundamentis. Tuttavia, i feudatari e la Comunità si sono preoccupati in ogni epoca di erigere monumenti ad ornamento pubblico, come l'unico esempio di gotico nei Castelli Romani, l'ex-chiesa di Santa Lucia, il santuario di Santa Maria dell'Acquasanta, le rocche Frangipane e Orsini, Palazzo Colonna, la basilica collegiata di San Barnaba, Palazzo Matteotti, e molte altre opere pubbliche."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%85%D8%A7%D8%B1%DB%8C%D8%B3%D8%A7_%D8%B3%DB%8C%D9%84%D9%88%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Marisa_Silver_2016.jpg","page_title":"ماریسا سیلور","context_page_description":"ماریسا سیلور یک نویسنده، کارگردان و فیلم‌نامه‌نویس اهل ایالات متحده آمریکا است."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%A6%8F%E4%BA%95%E9%89%84%E9%81%93F1000%E5%BD%A2%E9%9B%BB%E8%BB%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Fukui_Railway_F1003.jpg","page_title":"福井鉄道F1000形電車","context_page_description":"福井鉄道F1000形電車は、福井鉄道が保有する路面電車車両である。3車体連接・3台車方式の超低床電車で、「FUKURAM」の愛称を持つ。2013年から2016年にかけて4編成計12両導入された。営業運転の開始は2013年3月。\\n福井鉄道の路線である福武線で運用されるほか、えちぜん鉄道三国芦原線との相互直通運転でも使用されている。"},{"page_url":"https://fr.wikipedia.org/wiki/Ibrahim_al-Harbi","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Ibrahim_Al-Harbi.jpg","page_title":"Ibrahim al-Harbi","context_page_description":"Ibrahim al-Harbi est un footballeur saoudien né le 10 juillet 1975 à Riyad."},{"page_url":"https://de.wikipedia.org/wiki/Giuseppe_Pinto","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/GiuseppePintoajf2211.JPG","page_title":"Giuseppe Pinto","context_page_description":"Giuseppe Pinto ist ein italienischer Geistlicher, römisch-katholischer Erzbischof und Diplomat des Heiligen Stuhls. Er wirkte bis 2019 als Apostolischer Nuntius u. a. in Chile und Kroatien."},{"page_url":"https://fr.wikipedia.org/wiki/Louis-Camille_Maillard","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Louis_Camille_Maillard.jpg","page_title":"Louis-Camille Maillard","context_page_description":"Louis Camille Maillard, né le 4 février 1878 à Pont-à-Mousson et mort le 12 mai 1936 à Paris, est un médecin et chimiste français, dont le nom est parfois donné à des réactions de glycation."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%87%E0%A6%B0%E0%A6%AE_%E0%A6%B6%E0%A6%B0%E0%A7%8D%E0%A6%AE%E0%A6%BF%E0%A6%B2%E0%A6%BE_%E0%A6%9A%E0%A6%BE%E0%A6%A8%E0%A7%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Irom_sharmila_at_calicut.jpg","page_title":"ইরম শর্মিলা চানু","context_page_description":"ইরম শর্মিলা চানু ১৯৭২ সনের ১৪ মার্চ মণিপুরে জন্মগ্রহণ করেন৷ তাকে মণিপুরের লৌহমানবী \\"Iron Lady of Manipur\\" বলা হয়। তিনি ২০০০ সনের ২ নভেম্বরের পর থেকে মণিপুরে সৈন্য বাহিনীর বিশেষ ক্ষমতা আইন, ১৯৫৮ বাতিল করার জন্য অনশন করছেন৷ তার মতে মণিপুর এবং উত্তর-পূর্ব ভারতে এটিই হিংসার মূল কারণ। বর্তমানে অনশনের দশ বছর অতিক্রম করা শর্মিলাকে পৃথিবীর সবচেয়ে দীর্ঘ সময় অনশন করা নারী হিসেবে ধরা হচ্ছে।"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Bahnh%C3%B6fe_und_Haltepunkte_in_Sachsen","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Haltepunkt_Chemnitz-Erfenschlag_%281%29.JPG","page_title":"Liste der Bahnhöfe und Haltepunkte in Sachsen","context_page_description":"Die Liste der Bahnhöfe und Haltepunkte in Sachsen führt alle Eisenbahnbetriebsstellen des öffentlichen Verkehrs auf, die auf dem Territorium des 1990 neu begründeten Freistaats Sachsen bestehen. Enthalten sind auch alle aufgelassenen und abgebauten Stationen."},{"page_url":"https://en.wikipedia.org/wiki/RRRecords","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/SICKNESS_performing_in_RRRecords.jpg","page_title":"RRRecords","context_page_description":"RRRecords is a record label and used and new record shop based in Lowell, Massachusetts. RRRecords is distinguished as being the first American record label to specifically publish underground noise music in the early 1980s, and published the first American vinyl by Merzbow, Masonna, The Hanatarash, Violent Onsen Geisha, and many more artists who have subsequently become well known in the world of noise music. In its first 20 years, RRR has issued hundreds of releases. The label's owner, Ron Lessard, is a tireless supporter of new artists, and created several sub-labels and series to specifically highlight unknown and underground musicians."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B9%80%E0%B8%99%E0%B8%B7%E0%B9%89%E0%B8%AD%E0%B8%A1%E0%B8%B1%E0%B8%95%E0%B8%AA%E0%B8%B6%E0%B8%8B%E0%B8%B2%E0%B8%81%E0%B8%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/ba/Sliced_Matsusaka_wagyu_beef.jpg","page_title":"เนื้อมัตสึซากะ","context_page_description":"เนื้อมัตสึซากะ เป็นเนื้อวัวจากวัวที่เลี้ยงบริเวณเมืองมัตสึซากะ จังหวัดมิเอะ เนื้อมัตสึซากะเป็นเนื้อที่ได้รับการยอมรับให้เป็นหนึ่งในเนื้อวัวคุณภาพสูงสามชนิดของญี่ปุ่นร่วมกับเนื้อโคเบะจากจังหวัดเฮียวโงะและเนื้อโอมิจากจังหวัดชิงะ"},{"page_url":"https://fr.wikipedia.org/wiki/Liste_de_pr%C3%A9historiens","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/%C3%89mile_Cartailhac_Mus%C3%A9um_de_Toulouse.jpg","page_title":"Liste de préhistoriens","context_page_description":"Cette liste rassemble aussi bien des préhistoriens, qui sont des archéologues étudiant la Préhistoire, que des paléoanthropologues, qui sont des paléontologues étudiant les fossiles humains ou pré-humains.\\nLa distinction entre ces deux branches de la préhistoire est relativement récente, et la plupart des personnalités de la première moitié du XXᵉ siècle qui suivent ne peuvent guère être affectées exclusivement à l'une ou à l'autre.\\nCette liste recense tous les préhistoriens et paléoanthropologues bénéficiant d'un article en français sur Wikipédia, et une partie de ceux dotés d'un article en anglais ou en allemand."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%B3%D9%8A%D8%B1%D8%AC%D9%8A%D9%88_%D9%81%D9%8A%D8%AC%D8%A7_%D8%AC%D9%88%D9%85%D9%8A%D8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Viko1953.jpg","page_title":"سيرجيو فيجا جوميز","context_page_description":"سيرجيو فيجا جوميز لاعب كورة قدم من الميكسيك."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9B%D0%B0%D1%81%D1%84%D0%B0%D1%8F%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Bouisset_%28Lasfaillades%2C_Tarn%2C_Fr%29_%C3%A9glise.JPG","page_title":"Ласфаяд","context_page_description":"Ласфая́д — муніципалітет у Франції, у регіоні Південь-Піренеї, департамент Тарн. Населення — 76 осіб.\\nМуніципалітет розташований на відстані близько 590 км на південь від Парижа, 85 км на схід від Тулузи, 50 км на південний схід від Альбі."},{"page_url":"https://es.wikipedia.org/wiki/Carahue","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Antiguos_locom%C3%B3viles_agr%C3%ADcolas._Museo_de_M%C3%A1quinas_a_Vapor._Carahue._Regi%C3%B3n_de_La_Araucan%C3%ADa._Chile.jpg","page_title":"Carahue","context_page_description":"Carahue es una ciudad y comuna de Chile, de la provincia de Cautín en la región de la Araucanía.\\nIntegra junto a las comunas de Nueva Imperial, Saavedra, Teodoro Schmidt y Toltén la Asociación de Municipios Costa Araucanía, iniciativa corporativa de desarrollo comunal cooperativo, liderado y gestado por el exalcalde de la comuna de Carahue, don Ricardo Herrera Floody, quien además, desde 2014 se desempeña como consejero regional de la región de La Araucanía."},{"page_url":"https://id.wikipedia.org/wiki/Sistem_kristal","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Hanksite.JPG","page_title":"Sistem kristal","context_page_description":"Dalam kristalografi, istilah sistem kristal, keluarga kristal dan sistem kisi masing-masing mengacu pada salah satu dari beberapa kelas grup ruang, kisi, grup titik atau kristal. Secara informal, dua kristal berada dalam sistem kristal yang sama jika memiliki simetri yang sama, walaupun terfapat banyak pengecualian untuk ini.\\nSistem kristal, keluarga kristal dan sistem kisi serupa tapi sedikit berbeda, dan terdapat kebingungan luas di antara mereka: khususnya sistem kristal trigonal sering dikacaukan dengan sistem kisi rombohedral, dan istilah \\"sistem kristal\\" terkadang digunakan untuk mendefinisikan \\"sistem kisi\\" atau \\"keluarga kristal\\".\\nGrup ruang dan kristal dibagi menjadi tujuh sistem kristal sesuai dengan grup titik mereka, dan ke dalam tujuh sistem kisi sesuai dengan kisi Bravais mereka. Lima dari sistem kristal pada dasarnya sama dengan lima sistem kisi, namun sistem kristal heksagonal dan trigonal berbeda dari sistem kisi heksagonal dan rombohedral. Enam keluarga kristal dibentuk dengan menggabungkan sistem kristal heksagonal dan trigonal menjadi satu keluarga heksagonal, untuk menghilangkan kebingungan ini."},{"page_url":"https://de.wikipedia.org/wiki/Saab_35","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Draken_im_Kreisel_bei_Tulln.jpg","page_title":"Saab 35","context_page_description":"Die Saab 35 Draken, auf Deutsch übersetzt sowohl als Drachen als auch als Drache, ist ein einstrahliges Überschallkampfflugzeug, das von Saab für die schwedischen Luftstreitkräfte entwickelt wurde. Sie löste dort die Vorgängermuster Saab 29 Tunnan und Saab 32 Lansen ab."},{"page_url":"https://id.wikipedia.org/wiki/Qanaqer-Zeytun","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Yerevan_Kanaker-Zeytun_district.png","page_title":"Qanaqer-Zeytun","context_page_description":"Qanaqer-Zeytun adalah kota yang terletak di distrik Yerevan, Armenia.\\nKota ini memiliki luas sebesar 8 km².\\nPada tahun 2002, kota ini memiliki populasi sebesar 102.700 jiwa."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%B5%E0%B4%A4%E0%B5%8D%E0%B4%B8%E0%B4%A8%E0%B4%BE%E0%B4%AD%E0%B4%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Aconitum_napellus_MHNT.BOT.2007.52.9.jpg","page_title":"വത്സനാഭി","context_page_description":"അരമീറ്ററോളം ഉയരത്തിൽ വളരന്നതും വിഷമായതുമായ ഒരു ഔഷധ സസ്യമാണ് വത്സനാഭി. വിഷമായതിനാൽ ശുദ്ധിചെയ്ത് നിയന്ത്രിതമായെ ഉപയോഗിക്കാറുള്ളു. സംസ്കൃതത്തിൽ വത്സനാഭഃ, വിഷം, ഗരലം, ജാംഗുലം എന്നൊക്കെ പേരുകളുണ്ട് ഇവയ്ക്ക്. ഇംഗ്ലീഷിൽ ഇന്ത്യൻ അക്കോനൈറ്റ് എന്നറിയുന്നു. വേര് മാത്രമാണ് ഔഷധയോഗ്യമായ ഭാഗം. പഞ്ചാബ്, സിക്കിം, ഹിമാചൽ പ്രദേശ് എന്നിവിടങ്ങളിൽ ഇവ കാണപ്പെടുന്നത്."},{"page_url":"https://nl.wikipedia.org/wiki/Sint-Bavokerk_(Raamsdonk)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/32280_Sint_Bavokerk_%282%29.jpg","page_title":"Sint-Bavokerk (Raamsdonk)","context_page_description":"De Sint-Bavokerk is de katholieke parochiekerk van Raamsdonk. Architect was Carl Weber. Ze stamt uit 1888 en is gelegen aan Kerkplein 2."},{"page_url":"https://vi.wikipedia.org/wiki/Joanna_Baillie","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Joanna_Baillie_1762_-_1851_Dramatist_by_Mary_Ann_Knight.jpg","page_title":"Joanna Baillie","context_page_description":"Joanna Baillie là một nhà thơ và nhà soạn kịch người Scotland, được biết đến với các tác phẩm bao gồm Plays on the Passions và Câu truyện ngụ ngôn. Tác phẩm của bà thể hiện sự quan tâm đến triết học đạo đức và Gothic. Bà được đánh giá cao trong suốt cuộc đời, và bà đã gắn kết với những người viết văn nổi tiếng đương thời, bao gồm Anna Barbauld, Lucy Aikin và Walter Scott khi sống ở Hampstead. Baillie qua đời ở tuổi 88."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_basiliques_de_Rome","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Sant_andrea_della_valle_051211-01.JPG","page_title":"Liste des basiliques de Rome","context_page_description":"Cet article recense les basiliques de Rome, Italie."},{"page_url":"https://hu.wikipedia.org/wiki/Gal%C3%A3o","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Gal%C3%A3o.jpg","page_title":"Galão","context_page_description":"A Galão egy Portugáliában elterjedt forró ital, mely eszpresszóból és felhabosított tejből készül. Gyakorlatilag megegyezik a café latte, vagy a café au lait kávéitalokkal. Szervírozására hosszúkás üvegpoharat használnak, melyben egynegyed rész kávé és háromnegyed rész felhabosított tej található, szemben a Garotóval, amely pont fordítva tartalmazza ezen arányokat, illetve a Garotót hagyományos demitasse-csészében szolgálják fel. Amikor 1:1-es arányban tartalmazza összetevőit, akkor '\\"meia de leite, azaz félig tej néven illetik és normál kávéscsészében szolgálják fel. Azt mondják, hogy hasonlatos a cortadóhoz, de mivel nagyobb arányban tartalmaz tejet, ezért inkább a caffè lattéhoz áll közelebb."},{"page_url":"https://it.wikipedia.org/wiki/Rondella_(meccanica)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Rondelle_07.jpg","page_title":"Rondella (meccanica)","context_page_description":"Una rondella, in meccanica, è un dischetto con un foro centrale generalmente metallico che viene inserito fra un dado di un bullone, o la testa di una vite, e l'oggetto contro il quale deve essere stretto al fine di migliorarne il bloccaggio. Altri usi dipendono dal tipo di rondella utilizzata."},{"page_url":"https://ca.wikipedia.org/wiki/Regne_dels_sueus","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Sueben-Reich.jpg","page_title":"Regne dels sueus","context_page_description":"El Regne dels sueus fou un estat que va existir de facto al nord-oest de la península Ibèrica del 410 al 585, si bé del 410 al final de l'Imperi Romà els sueus només van tenir la consideració de federats."},{"page_url":"https://la.wikipedia.org/wiki/Holly_Hunter","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Holly_HunterA.jpg","page_title":"Holly Hunter","context_page_description":"Holly Hunter est actrix Americana."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D1%83%D1%88%D0%B8%D0%BD%D0%B0%D0%B3%D0%B0%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Kusinara.jpg","page_title":"Кушинагар","context_page_description":"Кушинагар — невелике місто на півночі Індії в штаті Уттар-Прадеш, одне з чотирьох головних священних місць, центр паломництва буддистів. Місце переходу Гаутами Будди в парінірвану."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E5%85%B1%E7%94%A8%E9%9A%A7%E9%81%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Toyen_stasjon_2009.jpg","page_title":"共用隧道","context_page_description":"共用隧道，有时也称为共用线，是奥斯陆地铁营运中的一条隧道。该隧道穿越挪威奥斯陆的市中心地下，全长7.3千米，共有6座车站。该隧道得名自奥斯陆地铁的所有路线皆经过此隧道的缘故。隧道自从开通后便是奥斯陆地铁的瓶颈：由于只有双线，每小时只能通行52辆列车。\\n此隧道兴建时拆分为2部分：西段和东段。西段首先于1928年通车，东段则于1966年通车。连接西段和东段的隧道和市中心站一同于1977年通车，但在1983年因为车站的渗漏问题严重而关闭改建，同时西段和东段分别营运。1987年重新开放并更名为挪威议会站，并在1993年地铁升级的过程中关闭了沃基里广场站。\\n隧道的两端分别为少校宫站和泰恩和恩舍站之间的轨道。从少校宫站可连接霍尔门科伦线、勒阿线和松恩湖线；从泰恩站可连接兰伯斯特线和格鲁吕线。"},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A8%D8%B1%D8%A7%D9%86%D8%AA%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Newborn_Canadian_Goslings.jpg","page_title":"برانتا","context_page_description":"برانتا قاز کیمی‌لر دسته‌سینه عایید حئیوان نؤعو."},{"page_url":"https://de.wikipedia.org/wiki/Rosenberg_(fr%C3%A4nkisches_Adelsgeschlecht)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Aub04.jpg","page_title":"Rosenberg (fränkisches Adelsgeschlecht)","context_page_description":"Die Familie von Rosenberg war ein fränkisch-schwäbisches Adelsgeschlecht."},{"page_url":"https://cs.wikipedia.org/wiki/Krasnovi%C5%A1ersk","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a4/Krasnovishersk_from_helicopter.jpg","page_title":"Krasnovišersk","context_page_description":"Krasnovišersk je město v Permském kraji v Ruské federaci. Při sčítání lidu v roce 2010 mělo zhruba šestnáct tisíc obyvatel."},{"page_url":"https://de.wikipedia.org/wiki/%C6%8Fzim_%C6%8Fzimzad%C9%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/At_Baku_summer_cottages.jpg","page_title":"Əzim Əzimzadə","context_page_description":"Əzim Əzimzadə war ein aserbaidschanischer Künstler und Karikaturist, der mit dem Titel Künstler des Volkes der Aserbaidschanischen SSR von der Sowjetunion ausgezeichnet wurde."},{"page_url":"https://nl.wikipedia.org/wiki/Diconne","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Map_commune_FR_insee_code_71175.png","page_title":"Diconne","context_page_description":"Diconne is een gemeente in het Franse departement Saône-et-Loire en telt 215 inwoners. De plaats maakt deel uit van het arrondissement Louhans."},{"page_url":"https://cs.wikipedia.org/wiki/W%C5%82adys%C5%82awowo","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/94/W%C5%82adys%C5%82awowo_-_Lunapark_Sowi%C5%84ski.jpg","page_title":"Władysławowo","context_page_description":"Władysławowo je město v severním Polsku, ležící na pobřeží Baltského moře. Administrativně náleží k Okresu Puck v Pomořském vojvodství. Rozloha města je asi 38 km². Na jeho jihovýchodním okraji začíná Helská kosa."},{"page_url":"https://tt.wikipedia.org/wiki/%D0%A3%D0%BE%D0%BF%D0%B0%D0%BA%D0%B0_(%D0%BE%D0%BA%D1%80%D1%83%D0%B3,_%D0%92%D0%B8%D1%81%D0%BA%D0%BE%D0%BD%D1%81%D0%B8%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/WaupacaCountyWisconsinCourthouse.jpg","page_title":"Уопака (округ, Висконсин)","context_page_description":"Уопака — Америка Кушма Штатларының Висконсин штатында урнашкан округ. Үзәге - Уопака шәһәре."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%BC%A2%E5%AD%97%E6%96%87%E5%8C%96%E5%9C%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Azure_Clouds_Temple_3.jpg","page_title":"漢字文化圈","context_page_description":"漢字文化圈，或稱為東亞文化圈、儒家文化圈、中華文化圈，是指歷史上受中國及漢文化影響、過去或現在共同使用漢字與文言文做為書面語之文化圈。日韓越大多不使用漢語雅言作為口頭語言交流媒介，故漢字文化圈範圍大於漢語圈。\\n涵蓋國家包括中國以及歷史上曾受中國君主冊封或曾向中原王朝朝貢之周邊國家或民族。這些地域在古代主要是農耕民族，存在冊封體制，從中原歷代王朝引進國家制度、政治思想、中華法系，並發展出相似之文化和價值觀，但與中原保持著相對政治獨立。漢字文化圈所覆蓋地域與現代劃分之東洋地區很大程度重合，包括了大中華地區中的中國大陸、澳門、香港、臺灣島、越南、朝鮮半島、日本列島、琉球群島、菲律賓、馬來西亞及新加坡等。日本歷史學者西嶋定生提出之「東亜世界論」，形成了歷史學上之「文化圈」概念模型。\\n漢字誕生地中原以及周邊的越南、朝鮮半島、日本、蒙古等地，歷史上完全使用漢字或與中原固有文字混合使用，古代官方及知識分子多使用文言文作為書面語言，但漢字文化圈並不使用漢語雅言作為口頭媒體。另外，有些遊牧民族如蒙古族、藏族，雖然位於漢字文化圈地區內，但不使用漢字。在現代韓語、越南語和日本語中，六成以上詞彙都是由古漢語派生出之漢字詞所組成。另外日本假名和越南喃字皆是從漢字衍生之文字，朝鮮半島諺文雖為自創文字但亦能跟日文假名一樣和漢字一同混合使用。東洋世界各國歷史上都曾經使用過漢字。聯合國成立後，漢語為聯合國六種正式語言之一。"},{"page_url":"https://ja.wikipedia.org/wiki/%E6%9D%B1%E5%A4%A7%E9%98%AA%E5%B8%82%E7%AB%8B%E7%8E%89%E5%B7%9D%E5%B0%8F%E5%AD%A6%E6%A0%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Higashiosaka_City_Tamagawa_elementary_school.jpg","page_title":"東大阪市立玉川小学校","context_page_description":"東大阪市立玉川小学校は、大阪府東大阪市稲葉にある公立小学校。"},{"page_url":"https://en.wikipedia.org/wiki/Branchiopoda","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/81/Artemia_salina_3.jpg","page_title":"Branchiopoda","context_page_description":"Branchiopoda is a class of crustaceans. It comprises fairy shrimp, clam shrimp, Cladocera, Notostraca and the Devonian Lepidocaris. They are mostly small, freshwater animals that feed on plankton and detritus."},{"page_url":"https://br.wikipedia.org/wiki/Kerglof","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a4/Church_Saint-Tr%C3%A9meur_kergloff.JPG","page_title":"Kerglof","context_page_description":"Kerglof a zo ur gumun eus Bro-Gerne e kanton Karaez, e departamant Penn-ar-Bed, e kornôg Breizh."},{"page_url":"https://en.wikipedia.org/wiki/Ayub_Thakur","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Dr._Ayub_Thakur.jpg","page_title":"Ayub Thakur","context_page_description":"Muhammad Ayyub Thakur was a Kashmiri political activist and founder of London-based World Kashmir Freedom Movement, an organisation that claimed to seek a \\"peaceful political solution\\" to the Kashmir Conflict.\\nHe founded a charity organization, 'Mercy Universal', which was investigated by the British Charity Commission for links to Kashmiri militant groups including Hizbul Mujahideen in Kashmir after Indian government raised concerns. However, Thakur claimed that he had sent money for the destitute and had documents and video evidence to prove it. The money was sent to purchase 800 sewing machines for the widows. Thakur also struggled for the right of self-determination for the people of Jammu and Kashmir. After Thakur's death in 2004, both WKFM and Mercy Universal became largely inactive. Neither has any employees as of 2011, nor does either have any regular source of funds.\\nThakur lectured 'extensively' on the Kashmir issue. He claimed to have attended \\"hundreds of seminars and conferences around the world\\" in universities, think tanks and other institutions, including the universities of Oxford and Cambridge and United Nations bodies."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%96%A9%E6%B0%8F%E5%B7%A8%E8%9C%A5","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Varanus_salvadorii.005_-_Zoo_Aquarium_de_Madrid.JPG","page_title":"薩氏巨蜥","context_page_description":"萨氏巨蜥是一种在新几内亚发现的巨蜥，又称萨尔瓦多巨蜥、鳄鱼巨蜥。萨氏巨蜥被认为是最长的巨蜥，但是可靠的记录只有244厘米长，比最大的科莫多巨蜥要短。"},{"page_url":"https://en.wikipedia.org/wiki/Stadion_Ro%C4%91eni","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/FKVelez_stadion_ro%C4%91eni.jpg","page_title":"Stadion Rođeni","context_page_description":"Stadion Rođeni, previously known as Stadion Vrapčići, is FK Velež Mostar owned football stadium in Mostar, Bosnia and Herzegovina, which is in slow process of development since 1995. It is located in the northeastern part of the city, namely the Vrapčići suburb, and is principal stadium and the home-ground of FK Velež Mostar football club. The stadium takes its name from FK Velež's and its supporters' nickname \\"Rođeni\\", and it was decided after an online poll."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%96%87%E5%8C%96%E5%85%AC%E5%9B%AD%E7%AB%99_(%E5%B9%BF%E5%B7%9E)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Exit_E%2C_Cultural_Park_Station%2C_Guangzhou_Metro.JPG","page_title":"文化公园站 (广州)","context_page_description":"文化公園站是廣州地鐵6號綫和8號綫的換乘車站，亦是目前8號線的北端終點站。車站位於中國廣東省廣州市荔灣區鎮安路西堤二馬路口東北側，文化公園西南方的地底。車站於2013年12月28日隨6號線開通而啟用，2019年12月28日隨8號線鳳凰新村至文化公園段開通而成為換乘車站。\\n在8號線北延段開通前，目前本站是8號線唯一一座設於海珠區外的車站。"},{"page_url":"https://pl.wikipedia.org/wiki/Santos-Dumont_14-bis","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/14-bis_de_Alberto_Santos_Dumont.jpg","page_title":"Santos-Dumont 14-bis","context_page_description":"14-bis, znany też jako Oiseau de proie – pionierski samolot, dwupłat w układzie kaczki, zaprojektowany i zbudowany przez brazylijskiego pioniera lotnictwa Alberto Santosa-Dumonta. W 1906 r. pod Paryżem 14-bis wykonał pierwszy obserwowany przez tłum kontrolowany lot z napędem, będący jednocześnie pierwszym lotem samolotu poza USA."},{"page_url":"https://fr.wikipedia.org/wiki/Osselets_(jeu)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Osselets_m%C3%A9talliques_02.jpg","page_title":"Osselets (jeu)","context_page_description":"Le jeu des osselets sont un jeu d'adresse ancêtre des jeux du lancer qui remonte à l'Antiquité."},{"page_url":"https://es.wikipedia.org/wiki/Pugnac","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Blason_ville_fr_Pugnac_%28Gironde%29.svg","page_title":"Pugnac","context_page_description":"Pugnac es una población y comuna francesa del departamento de Gironda en la región de Nueva Aquitania."},{"page_url":"https://bs.wikipedia.org/wiki/Translokacija_(genetika)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Translocation-4-20.png","page_title":"Translokacija (genetika)","context_page_description":"U genetici, hromosomska translokacija je hromosomska abnormalnost prozrokovana međuhromosomskom reorganizacijom dijelova nehomolognih hromosoma. Genska uloga može nestati kada se premještanju pridružuju i dva odvojena gena, čija je pojava česta u kanceroznim stanjima. To je otkriveno u citogenetičkim ili kariotipskim analizama pogođenih ćelija.\\nTranslokacije mogu biti uravnotežene čak i u razmjeni materijala bez dodatka ili nedostatka genetičke informacije, a u idealnoj definiciji - sa punom funkcionalnošću.\\nNeuravnotežena translokacija nastaje onda kada je nejednaka razmjena hromosomskog materijala uz pojavu viška ili nedostatka određenih gena."},{"page_url":"https://cs.wikipedia.org/wiki/Mediatizovan%C3%A1_%C3%BAzem%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Wappen_Lstein.jpg","page_title":"Mediatizovaná území","context_page_description":"Mediatizovaná území jsou území bývalé Svaté říše římské, která byla přinejmenším do roku 1803 suverénními státy v rámci říše a o svou nezávislost přišla v l. 1803-1815"},{"page_url":"https://nl.wikipedia.org/wiki/Bundesautobahn_8","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Ank%C3%BCndigungstafel_Schengen_DxOPsp.jpg","page_title":"Bundesautobahn 8","context_page_description":"De Bundesautobahn 8 is een Duitse autosnelweg die loopt vanaf de Luxemburgse grens via Dillingen, Saarlouis, Neunkirchen naar Pirmasens. Na een onderbreking zet de weg zich bij Karlsruhe voort. Vanaf Dreieck Karlsruhe loopt de snelweg via Stuttgart, Ulm, Augsburg, München, Rosenheim naar de grens met Oostenrijk bij Salzburg.\\nDe A8 doorsnijdt het zuiden van Duitsland van west naar oost; de weg is echter op meerdere plekken onderbroken. Hetzelfde geldt voor de in het grensgebied met Zwitserland gelegen A98.\\nGrote delen van de weg werd al tijdens de tijd van het Nationaalsocialisme gebouwd en geopend. Met de toename van het verkeer voldoet het oude tracé niet meer aan de eisen, waardoor regelmatig file optreedt. In het bijzonder de hellingen van het noordelijke Zwarte Woud tussen Karlsruhe en Stuttgart evenals de Albaufstieg tussen Stuttgart en Ulm komt het door het steile en bochtige tracé en een smalle rijbaan in combinatie met slecht weer vaak tot zware ongevallen, waardoor de snelweg tussen Karlsruhe en München tegenwoordig volledig gerenoveerd wordt. Het tracé van München tot de Oostenrijkse grens volgt nog de oude route van voor de oorlog."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%84%D9%88%D8%B1%D9%86_%D9%BE%D8%A7%D9%88%D9%84_%D8%AC%D8%A7%D8%A8%D8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Laurene_Powell_Jobs.jpg","page_title":"لورن پاول جابز","context_page_description":"لورن پاول جابز، کارآفرین، سرمایه‌دار و مدیر ارشد اجرایی آمریکایی است، که هم‌اکنون بزرگترین سهام‌دار شرکت اپل می‌باشد، همچنین ۸٪ از سهام شرکت والت دیزنی را نیز در اختیار دارد.\\nوی در سال ۱۹۹۱ با بنیانگذار اپل؛ استیو جابز ازدواج کرد و پس از درگذشت جابز در سال ۲۰۱۱ وارث کلیه دارایی‌های او شد. لورن پاول جابز در سال ۲۰۱۴ در رتبه‌بندی انجام شده توسط مجله فوربز در رتبه ۲۹ از فهرست قدرتمندترین زنان جهان قرار گرفت."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89coduc","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/31/A71-Thalwassertalbruecke.jpg","page_title":"Écoduc","context_page_description":"Les écoducs sont des passages construits ou « réservés » dans un milieu aménagé, pour permettre aux espèces animales, végétales, fongiques, etc. de traverser des obstacles construits par l'être humain ou résultant de ses activités. On parle souvent de passages « supérieurs » ou « inférieurs » selon qu'ils passent au-dessus ou en dessous de l'infrastructure fragmentante. Celle-ci est le plus souvent une infrastructure de transport de personnes, de biens ou d'énergie, mais il peut s'agir d'autres éléments fragmentants du paysage.\\nLes écoducs sont souvent construits en guise de mesures compensatoires résultant d'une étude d'impact."},{"page_url":"https://de.wikipedia.org/wiki/Nahverkehr_in_Hannover","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Enno-1440-118_Hannover.jpg","page_title":"Nahverkehr in Hannover","context_page_description":"Der öffentliche Personennahverkehr in Hannover wird von verschiedenen Verkehrsträgern erbracht: Innerhalb von Hannover sind dies die Stadtbahn und die Stadtbusse der ÜSTRA. Die Region Hannover wird von Regionalzügen, der S-Bahn und von Regionalbussen der RegioBus Hannover erschlossen.\\nAufgabenträger für den ÖPNV ist die Region Hannover. Die Region Hannover hat sich mit den in der Region Hannover verkehrenden Verkehrsunternehmen zu dem Verkehrsverbund Großraum-Verkehr Hannover zusammengeschlossen. Der aktuelle Nahverkehrsplan 2015 läuft bis Ende 2019."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%96%B0%E5%AE%BF%E3%82%A4%E3%83%BC%E3%82%B9%E3%83%88%E3%82%B5%E3%82%A4%E3%83%89%E3%82%B9%E3%82%AF%E3%82%A8%E3%82%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Sunken_garden_in_shinjuku_eastside02.JPG","page_title":"新宿イーストサイドスクエア","context_page_description":"新宿イーストサイドスクエアは、新宿区新宿六丁目に位置するオフィス・商業の複合施設である。東新宿駅に直結している。スクウェア・エニックスや東急ハンズなどの本社がテナントとして入り、都内最大級の1フロア床面積を有する一方、2014年ランドスケープコンサルタンツ協会賞設計部門で最優秀賞を受賞するなど、周辺地域の土地利用とも一体化した回遊空間を形成している。隣接地には超高層高級賃貸マンションコンフォリア新宿イーストサイドタワーも建築され、街区全体で新宿イーストサイドと称する。"},{"page_url":"https://es.wikipedia.org/wiki/Carola_Rackete","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Carola_Rackete.jpg","page_title":"Carola Rackete","context_page_description":"Carola Rackete es una capitana de barco alemana que ha trabajado para la organización alemana de rescate marítimo Sea-Watch. A principios de 2020 formaba parte de la tripulación del barco Arctic Sunrise, de la organización Greenpeace, que recorría la Antártida.​"},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%9C%E1%83%9D%E1%83%A0%E1%83%95%E1%83%94%E1%83%92%E1%83%98%E1%83%98%E1%83%A1_%E1%83%A2%E1%83%A3%E1%83%A0%E1%83%98%E1%83%96%E1%83%9B%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Geiranger2.JPG","page_title":"ნორვეგიის ტურიზმი","context_page_description":"ნორვეგიის მთავარი ტურისტული ღირსშესანიშნაობებია ფიორდები, რომლებიც სანაპირო ზოლს ქსელავენ და მთები, ისევე როგორც ქვეყნის შიდა ნაწილის ხელუხლებელი ბუნება, ქალაქები და სხვა პატარა დასახლებები.\\n2008 წლის მსოფლიო ეკონომიკურ ფორუმზე ნორვეგიას მოგზაურობისა და ტურიზმის კონკურენტუნარიანობის ინდექსის მაჩვენებლით მე-17 ადგილი მიაკუთვნეს."},{"page_url":"https://ca.wikipedia.org/wiki/Assenay","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Saint-Jean-de-Bonneval_monument_aux_morts_%281%29.jpg","page_title":"Assenay","context_page_description":"Assenay és un municipi francès, situat al departament de l'Aube i a la regió del Gran Est. L'any 2007 tenia 141 habitants."}]`),T={name:"App",components:{PoemCard:M},data(){return{searchQuery:"",visibleCount:4,poemsData:P,isLoading:!1}},computed:{filteredPoems(){const a=this.searchQuery.trim().toLowerCase();return a?this.poemsData.filter(e=>e.page_title&&e.page_title.toLowerCase().includes(a)||e.context_page_description&&e.context_page_description.toLowerCase().includes(a)):this.poemsData},displayedPoems(){return this.searchQuery.trim()?this.filteredPoems:this.filteredPoems.slice(0,this.visibleCount)},hasMorePoems(){return!this.searchQuery.trim()&&this.visibleCount<this.poemsData.length}},methods:{async loadMore(){this.isLoading=!0,await new Promise(a=>setTimeout(a,1e3)),this.visibleCount+=4,this.isLoading=!1}}},L={class:"search-container"},F={class:"card-container"}